-- ----------------------------
-- Function structure for getDepts
-- ----------------------------
DROP FUNCTION IF EXISTS `getDepts`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getDepts`(pid BIGINT) RETURNS varchar(1000) CHARSET utf8
BEGIN
 DECLARE deptid VARCHAR(1000);
	 select GROUP_CONCAT(dept_id) dept_id from (
			select t1.dept_id,
			if(find_in_set(parent_id, @pids) > 0, @pids := concat(@pids, ',', dept_id), 0) as ischild
			from (
					 select dept_id,parent_id from t_dept t order by parent_id, dept_id
					) t1,
					(select @pids := pid) t2
		) t3 where ischild != 0 into deptid;
 RETURN deptid;
END
;;
DELIMITER ;
