INSERT INTO `t_fc_company` VALUES ('3111', '北京学研领航教育科技有限公司', '1673', '吴海洋', '', '周莎', '15801420562', '2015年08月26日', '300万元', '北京市', '北京市', '石景山区', null, '实兴大街30号院3号楼2层A-1211房间', '北京市', '北京市', '房山区', '阎村镇', '阎村镇开古庄1里84号', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2015年08月26日', '2045年08月25日', '', '', '', '9111010735524598XH', '', '技术开发、技术咨询、技术服务、技术转让；网页设计；营销策划；设计、制作、代理、发布广告；企业管理咨询；翻译服务；计算机技术培训；教育咨询；文化咨询、体育咨询；会议服务；组织文化艺术交流活动（演出除外）；承办展览展示活动。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司主要从事一级消防工程师证书培训工作。', '116.19343600000001', '39.939397', '116.063394', '39.702067999999997', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3112', '北京盛海伟业消防安全科技有限公司', '1672', '王鹏举', '', '于亚伟', '13161452322', '2014年11月04日', '100万元', '北京市', '北京市', '密云区', null, '北京市密云区康馨雅苑38号楼1单元102', '北京市', '北京市', '密云区', '果园街道', '北京市密云区康馨雅苑38号楼1单元102', '', '消防产品', '有限责任公司（自然人独资）', '2014年11月04日', '2034年11月03日', '', '', '', '91110228318157729J', '', '技术推广；承办展览展示活动；灭火器检测；家居装饰；零售消防器材、建筑材料、专用设备、通用设备、电气机械、电子产品；销售、安装、维修楼宇对讲系统、报警系统、视频监控设备、防弹复合玻璃、办公用文具、办公用机械；技术检测；室内装饰工程设计；专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京盛海伟业消防安全科技有限公司成立于2014年11月4日，位于北京市密云区。本公司自成立以来，经过多年的实践与经验积累，已经建立了一套比较完善的管理体系和质量监督体系。公司的管理人员和专业技术人员均具备多年丰富的经验和熟练的职业技能，所有的作业人员都经过岗前培训。凭着多年的专业经验，我们以“最好的产品质量、最优惠产品的价格”为您提供优质、高效、可靠、安全的消防产品。 \n       本公司主要经营项目：灭火器检测维修；零售消防器材、专用设备、通用设备；销售、安装、维修消防报警系统。所销售的消防产品全部获得公安部消防产品合格评定中心颁发的认证证书及相关检测报告。公司同时还建立了完善的售后服务体系，为各企业遇到的问题和困难提供指导帮助。我们始终以“质量是立业之道，诚信乃成功之本”的坚定信念，与社会各界同仁携手，共同为消防事业的发展做出贡献。\n       我们相信，通过我们的不断努力和追求，一定能够实现“全民消防、生命至上”的理念！', '116.82467', '40.375520000000002', '116.82467', '40.375520000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3113', '北京育人阳光教育科技有限公司', '1668', '张淑艳', '', '孟晨阳', '18911668142', '2008年09月16日', '2000万元', '北京市', '北京市', '朝阳区', null, '五里桥二街一号院7号楼一层0118', '北京市', '北京市', '朝阳区', '常营地区办事处', '五里桥二街一号院7号楼一层0118', '', '消防安全评估', '有限责任公司（自然人投资或控股）', '2008年09月16日', '2028年09月15日', '', '', '', '911101056804779522', '', '消防技术服务、技术开发、技术咨询、技术推广、技术转让；软件开发；基础软件服务；应用软件服务（不含医用软件）；计算机系统服务；教育咨询（不含出国留学咨询及中介服务）；计算机技术培训；办公设备维修；电脑动画设计；电脑图文设计、制作；摄影服务；企业策划；承办展览展示活动；城市园林绿化；家居装饰及设计；销售家具、建筑材料、电子产品、文具用品、计算机、软件及辅助设备、通讯设备、机械设备、玩具、工艺品、社会公共安全设备及器材；广播电视节目制作。（企业依法自主选择经营项目，开展经营活动；广播电视节目制作以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2008年9月，注册资本2000万元，主要从事行业信息化外包服务、智慧校园、消防安全评估、安全技术咨询、安防监控系统等业务。秉承“诚信待人、技术创新、服务社会”的理念，为客户定置“实用、时效、实惠”的服务方案。\n       公司获得了多项相关认证及资质：消防安全评估资质；ISO9001；2015质量管理体系认证；ISO27001信息安全管理体系认证；计算机信息系统集成资质；北京市高新技术企业等资质。\n       公司自主开发了：育人阳光幼儿园质量评估系统、安防、消防智能巡检评估系统、生产安全巡检评估系统等共10 多个系统，并取得软件著作权，各模块功能独立，可以根据客户需求自由定制，满足客户需求。', '116.617065', '39.928638999999997', '116.617065', '39.928638999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3114', '北京鑫淼源保洁服务有限公司', '1666', '张宏宇', '', '范奇林', '15810448567', '2018年12月24日', '200万元', '北京市', '北京市', '顺义区', null, '北京市顺义区仁和镇军营街16号院8号楼2层203', '北京市', '北京市', '顺义区', '旺泉街道', '北京市顺义区仁和镇军营街16号院8号楼2层203', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年12月24日', '长期', '', '', '', '91110113MA01GBWW0B', '', '清洁服务（不含餐具消毒）；物业管理；家政服务；城市园林绿化施工；专业承包；信息咨询（不含中介服务）；接受委托提供劳务服务（不含排队服务、对外劳务合作）；技术开发、技术咨询、技术服务；企业形象策划；销售日用品、五金交电（不含电动自行车）、机械设备、装饰材料、工艺品（不含文物、象牙及其制品）；家居装饰；汽车装饰（不含洗车服务）；道路货物运输。（企业依法自主选择经营项目，开展经营活动；道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '鑫淼源清洗公司所提供的是行业最优、最佳的烟道清洗服务。鑫淼源公司是北京消防协会排油烟设施清洗行业认证单位，北京消防先进企业，国内油烟清洗行业优秀服务商。\n我们可以为客户提供更有保障力的清洗服务。我司全员意外保险，避免各种可能带给甲方的意外损失。此外，我公司还为重点岗位人员缴纳了雇主责任险，尽最大可能为甲方避免各种风险，免除客户的后顾之忧!', '116.631227', '40.107897999999999', '116.631227', '40.107897999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3115', '北京鼎盛创安消防技术有限公司', '1665', '杨勇刚', '', '杨勇刚', '13693693998', '2012年07月05日', '500万元', '北京市', '北京市', '海淀区', null, '海淀南路13号亿方大厦后院201室', '北京市', '北京市', '海淀区', '海淀街道', '海淀南路13号亿方大厦后院201室', '', '消防设施,宣传教育培训', '有限责任公司（自然人投资或控股）', '2012年07月05日', '2032年07月04日', '2018/10/30', '2019/10/29', '京消协（2018）证字343号', '91110108599691378Q', '', '技术开发、技术咨询、技术服务、技术推广；企业策划、设计；设计、制作、代理、发布广告；承办展览展示活动；包装服务；建筑物清洁服务；机动车公共停车场服务；专业承包；物业管理。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京鼎盛创安消防技术有限公司于2012年5月在北京市海淀区工商局注册成立的股份制企业。经北京市公安局、北京市消防局批准，隶属于北京市消防总队直接领导，是一家集消防教育培训、安防、消防产品维修保养、研发和技术服务为一体的消防技术服务有限公司。公司组织机构完善，管理制度健全，服务态度明确，现设总经理、办公室、企管部、财务部、人事部、工程部、研发部和消防检测部七个内设职能部门，管理人员均为大专以上文化水平，5年以上管理工作经验，对消防行业有深刻了解。', '116.306831', '39.976089000000002', '116.306831', '39.976089000000002', '', null, null, null, null);
