INSERT INTO `t_fc_company` VALUES ('3117', '上海久蔚环保技术有限公司北京分公司', '1661', '尚召侠', '', '尚召侠', '18811126264', '2020年01月13日', '', '北京市', '北京市', '通州区', null, '景盛中街13号8幢2层310', '北京市', '北京市', '丰台区', '马家堡街道', '名流未来大厦1417室', '', '烟道清洗', '有限责任分公司（自然人投资或控股）', '2020年01月13日', '长期', '', '', '', '91110112MA01PWMR29', '', '环保技术推广、技术开发、技术咨询、技术转让、技术服务；建筑物清洁服务；维修机械设备（不含农业机械维修）、电气设备、空调制冷专用设备；城市园林绿化；销售日用品、水处理专用设备、建筑材料、装饰材料、化工产品（不含危险化学品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '上海久蔚环保技术有限公司北京分公司隶属于上海久蔚环保技术有限公司，总公司原隶属于上海市科委科技发展总公司，是上海市科学技术委员会、上海市经济委员会审定批准的、并予颁发及拥有《上海市安全生产企业许可资质证书》、《上海市中央空调、机电设备清洗维修安装A级专业资质》、《工业废水处理资质乙级》、《化学清洗A级资质》、《上海职业安全健康管理体系证书》、《A类纳税信用证书》《中国清洗行业协会常务理事资质证书》、《生活水箱二次供水清洗消毒》、《地下有限空间施工操作证》、《公共场所集中空调通风系统甲级专业清洗机构资质证书》、《集中空调循环水系统清洗水处理基本能力》《油烟设备及管道系统清洗维修》《中国质量信用AAAAA级企业》《重合同守信用示范企业》《环境保护知名企业》《长三角地区市场活力龙头企业》等资质的专业化集研发、生产、销售、施工于一体的声誉卓越的高新技术企业。公司在行业内拥有良好的信誉度和知名度。', '116.56482099999999', '39.738886999999998', '116.371319', '39.834107000000003', '', null, null, null, null);
