INSERT INTO `t_fc_company` VALUES ('3122', '北京尚仕洁保洁有限公司', '1653', '尚斌', '', '尚斌', '13910302107', '2008年01月22日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区平房乡姚家园村275室', '北京市', '北京市', '朝阳区', '平房地区办事处', '北京市朝阳区平房乡姚家园村275室', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年01月22日', '2028年01月22日', '2019/1/11', '2020/1/10', '京消协（2019）证字017号', '91110105671724819D', '', '清洁服务；销售日用品、文具用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司有经验丰富、专业的管理人员，经过培训的专职清洗员工团队，完善的清洁设备，清洁剂和消毒剂均使用环保型产品，公司还建立了完善的管理制度，制订了规范的业务操作流程，秉承“环保、健康、科技　创新、专业”的服务理念，在不断为餐饮业、企事业单位服务的过程中一点点进步，追求卓越，力求完善。拥有严格的管理制度、先进的设备、优良的服务质量，精湛的技术。清洗技师都具备多年清洗、 并不断吸收新的技术和先进的检测设备来满足广大客户的需求。所有的工作人员上岗前都必须经过严格的岗前培训及思想素质的提升，并通过统一的考核方可上岗。', '116.51764', '39.937885999999999', '116.51764', '39.937885999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
