INSERT INTO `t_fc_company` VALUES ('3124', '北京天宸鸿晟环保服务有限公司', '1651', '白民辉', '', '白民辉', '18612886348', '2019年12月25日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号-D11927', '北京市', '北京市', '房山区', '拱辰街道', '北京市房山区良乡凯旋大街建设路18号-D11927', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年12月25日', '2049年12月24日', '', '', '', '91110111MA01PJ8H6W', '', '大气污染治理；物业管理；家居装饰及设计；销售五金交电（不含电动自行车）、厨房用具、日用杂品；园林绿化设备；清洁服务；家庭劳务服务；维修空调制冷设备；劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司北京天宸鸿晟环保服务有限公司，成立于 2019年12月25日，位于北京市房山区良乡凯旋大街建设路18号-D11927， 是一家专业做环保、清洁的企业单位。本公司法定代表人及企业负责人：白民辉   公司员工人数十人左右， 我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的开荒保洁和清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.137918', '39.721812999999997', '116.137918', '39.721812999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3125', '北京绿洁阳光环保科技有限公司', '1647', '郭广甫', '', '郭哲', '13001922966', '2013年12月13日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区团河路48号院2号楼115室', '北京市', '北京市', '大兴区', '黄村地区办事处', '北京市大兴区刘一村村委会', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年12月13日', '2033年12月12日', '', '', '', '91110115085487515J', '', '技术开发、推广、服务；租赁舞台灯光、音响设备；承办展览展示活动；组织文化艺术交流活动（不含演出）；设计、制作、代理、发布广告；人工装卸服务；清洁服务；婚庆服务；礼仪服务；会议服务（不含食宿）；家政服务（中介除外）；物业管理；销售食用农产品、办公用品、日用品、洗涤用品、清洁设备、清洁用品、体育用品、文化用品、家用电器、消防器材、厨房用具、卫生间用具、建筑材料、装饰材料、汽车装饰用品；家居装饰；维修家用电器、空调制冷设备；大气污染治理；病虫害防治；专业承包；园林绿化管理；销售食品；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是由三名热爱服务事业的退伍军人合力创办的，于2008年成立《北京经华顺达家政服\n务中心》，2013年成立《北京绿洁阳光环保科技有限公司》。自成立以来一直以退伍军人为主力，\n致力于社区便民服务、家政保洁服务、城市生活垃圾清扫收集、物业管理、企事业单位、大中院校\n的日常保洁服务、会议、礼仪服务、电力电信设备的清洁养护、厨房及排油烟系统的清洗维护、外\n墙清洗、中央空调及管道清洗工程、家用空调清洁维护、清洁地毯、有害生物消杀（灭蚊蝇鼠蟑）、\n消毒等PCO综合服务。园林绿化工程、石材养护、运动场草坪建植与养护管理等。\n随着业务不断扩大和市场需要，公司的综合实力也在不断提升，公司产值、人力资源、机械设\n备等方面都有了长足发展。\n公司目前拥有技术人员30多名，操作人员都具有设备清洗养护等方面的专业特长，同时具有\n丰富的现场管理和现场清洁养护经验。\n公司秉承开拓进取、与时俱进的企业精神，在不断发展中谋求社会效益与经济效益的和谐统一，\n本着求质量、讲信誉的企业管理方针，以积极的态度，优质的服务以用户。以优质的工程质量和售\n后服务赢得用户的信赖与支持。', '116.35408700000001', '39.736448000000003', '116.374628', '39.717875999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3126', '北京学信无忧教育咨询有限公司', '1645', '高波', '', '高波', '13521421807', '2016年11月24日', '500万元', '北京市', '北京市', '昌平区', null, '北京市昌平区回龙观镇黄平路19号院2号16层1617', '北京市', '北京市', '昌平区', '回龙观地区办事处', '北京市昌平区回龙观镇黄平路19号院2号16层1617', '', '宣传教育培训', '有限责任公司（自然人独资）', '2016年11月24日', '2046年11月23日', '', '', '', '91110105MA009WAT4Y', '', '教育咨询（不含出国留学咨询及中介服务）；技术推广服务；计算机系统服务；软件开发；产品设计；电脑图文设计、制作；设计、制作、代理、发布广告。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京学信网校成立于2016年，专注职业培训，目前通过率在业界口碑最高，学员目前遍及中国各大城市，累计培训学员4万余次。学信网校有一支思想创新、锐意进取的教师团队，特聘国内知名学府资深教授、行业一线消防专业讲师及具有专业素质的专家任教，已经成为职业培训教育的姣姣者。', '116.348698', '40.066676000000001', '116.348698', '40.066676000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3127', '北京木火通明消防科技有限公司', '1644', '王海彬', '', '王海彬', '13811991391', '2016年05月30日', '100万元', '北京市', '北京市', '密云区', null, '北京市密云区东邵渠镇东邵渠村578号', '北京市', '北京市', '密云区', '果园街道', '北京市密云区康馨雅苑38号楼1单元102', '', '消防产品', '有限责任公司（自然人独资）', '2016年05月30日', '2046年05月29日', '', '', '', '91110228MA005TEW4R', '', '技术推广；灭火器检测；承办展览展示活动；技术检测；家居装饰；零售消防器材、建筑材料、专用设备、通用设备、电气机械、电子产品、办公用文具、办公用机械；销售、安装、维修楼宇对讲系统、入侵探测器、防盗报警控制器、报警系统出入口控制设备、报警系统视频监控设备、防弹复合玻璃；室内装饰工程设计；专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京木火通明消防科技有限公司是一家实力雄厚的消防器材销售、检测服务公司。公司为了能够提供更好、更完善的配套服务，集多家名优设备厂及各类泵阀为一体化。以不断开拓进步精神、严密的品质管理、实实在在的价格及周到的服务原则，与每一位客户建立良好的合作关系。\n本公司主要经营项目：灭火器检测；零售消防器材、专用设备、通用设备；销售、安装、维修消防报警系统。', '116.964522', '40.29233', '116.82467', '40.375520000000002', '注册地址坐标位置不准确', null, null, null, null);
