INSERT INTO `t_fc_company` VALUES ('3134', '上海盛善电气有限公司', '1634', '夏晓东', '', '曹科', '13761118810', '2006年04月07日', '1200万元', '', '', '', null, '上海市普陀区祁连山南路2891弄200号C楼5层', '', '', '', '', '上海市普陀区祁连山南路2891弄200号C楼5层', '', '电气防火', '有限责任公司（自然人投资或控股）', '2006年04月07日', '长期', '', '', '', '913101077872463103', '', '电气设备、仪器仪表、电子产品、消防设备、通信设备生产（限分支机构）、开发、销售，照明设备、智能设备、计算机软件开发及销售，计算机系统集成，电子科技、消防科技领域内的技术开发、技术服务、技术咨询、技术转让。 【依法须经批准的项目，经相关部门批准后方可开展经营活动】', '上海盛善电气有限公司创建于2006年，是一家专注于智慧用电安全产品研发、生产和销售的高新技术企业，在智能配用电和电气火灾监控 领域有着十几年的技术积累和各行业应用的服务经验，致力于为用户侧提供高品质的智慧用电安全监管、电气综合监控及能耗管理、电气火灾及消防电源、防火门监控等系统解决方案。\n     作为智慧用电安全系统解决方案服务商，基于物联网、云计算、大数据等新兴信息技术，用科技赋能电气安全，创新用户价值；高度重视产品质量和技术创新，以严格的工艺流程、高效的管理体制和完善的质保体系为产品质量提供可靠的保障，用领先的产品和完善的解决方案为用户提供更优质更便捷的服务，实现用户侧智慧用电安全与节能管理。', '121.373321', '31.267464', '121.373321', '31.267464', '', null, null, null, null);
