INSERT INTO `t_fc_company` VALUES ('3142', '北京京安民业安全防范技术有限公司', '1624', '王利军', '', '王利军', '13671330855', '2018年03月22日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区渤海镇怀沙路536号', '北京市', '北京市', '朝阳区', '管庄地区办事处', '朝阳区双桥东路10号院5号楼1804', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年03月22日', '长期', '', '', '', '91110116MA01AYBG67', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；企业策划；企业管理；组织文化艺术交流活动(不含演出)；销售安全技术防范产品、通用设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京安民业安全防范技术有限公司是一家专业提供社会公共安全消防培训、消防器材、消防设施等的专业公司。为牢固树立全新的“消防安全文化理念”我公司为广大客户提供最新安全咨讯、消防理论与实践专业知识，为响应“预防为主，防消结合”核心方针，我公司为各企事业单位及家庭提供实用安全产品介绍及推荐。为落实消防基本原则，坚持“专门机关与群众相结合原则”我公司秉承“诚信，专业，共赢”的经营理念，弘扬“用户至上，安全第一”的企业宗旨，号召各企事业单位、家庭预防火灾，远离火灾伤害，为各单位家庭及人身安全保驾护航，努力打造成为国内安全用品一流服务供应商。', '116.612056', '40.346499999999999', '116.604094', '39.899493', '', null, null, null, null);
