INSERT INTO `t_fc_company` VALUES ('3144', '北京市西城区外施建筑业职工培训中心', '1621', '汪小英', '', '张风华', '13683604247', '2011年09月13日', '50万元', '北京市', '北京市', '西城区', null, '北京市西城区南滨河路31号华亨大厦6层611', '北京市', '北京市', '西城区', '白纸坊街道', '北京市西城区南滨河路31号华亨大厦6层611', '', '宣传教育培训', '民办非企业单位', '', '', '', '', '', '5211010257515393XN', '', '', '北京市西城区外施建筑业职工培训中心成立于2002年，当时名称为“北京市建设工程专业劳务发包承包交易中心培训部”。2003年市建委根据工作需要，成立了北京市建筑业管理服务中心，将“北京市建设工程专业劳务发包承包交易中心培训部”划归到北京市建筑业管理服务中心，名称变更为（北京外施建筑业职工培训中心），2005年，北京外施建筑业职工培训中心的举办者变更为 “北京市外地在京施工企业工会联合会”系北京市外地在京施工企业工会联合会所属职工培训学校，受北京市外施企业工会联合会行政领导，属公立性质学校，同时接受区教委成教部门的监督与指导。 中心最初的办学目标与定位是“根据国家建设主管部门关于行业内部各类技术人员、管理人员持证上岗的有关政策规定，结合北京市经济建设发展需要为企业培养各类管理人员，实现全面持证上岗的目标”；随着市场不断深化改革，培训中心也不断在办学实践中成长，逐渐形成了“以人为本，服务至上”的办学理念，坚持“诚信办学、规范管理、服务社会”的办学宗旨，为外地在京施工企业和本地施工企业、学员提供更多更加优质的培训课程和良好的教学环境。', '116.34842399999999', '39.880778999999997', '116.34842399999999', '39.880778999999997', '', null, null, null, null);
