INSERT INTO `t_fc_company` VALUES ('3149', '北京广桥金安消防器材有限公司', '1615', '姜乾容', '', '穆萱泽', '18801472300', '2003年08月06日', '120万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区安外北苑大羊坊', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区安外北苑大羊坊', '', '消防产品', '有限责任公司（自然人投资或控股）', '2003年08月06日', '2023年08月05日', '', '', '', '91110105753333993J', '', '销售消防器材、建筑材料；维修灭火器。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司是经北京消防局核准备案的消防产品销售、维修检测为一体的专业公司，公司设有消防产品销售部、消防器材维修中心。公司始终坚持“质量第一、用户至上”的经营方针，凭借雄厚的实力的良好的信誉，不断扩大与生产厂家的联营，努力加强内部管理和严格质量监督，积极降低经营成本，建立完善直销服务体系，我们深刻认识到消防安全的重要，永远把产品质量和良好服务放在第一位，把最优最好的产品销售给客户，我们本着对消防事业高度负责的精神，把公司发展壮大。', '116.41585499999999', '40.038196999999997', '116.41585499999999', '40.038196999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3150', '北京中消创安教育科技有限公司', '1614', '王世珩', '', '曹广进', '13220198583', '2016年10月21日', '100万元', '北京市', '北京市', '朝阳区', null, '北苑东路19号院1号楼13层', '北京市', '北京市', '昌平区', '回龙观地区办事处', '建材城西路中腾建华商务大厦三楼', '', '宣传教育培训', '有限责任公司（自然人独资）', '2016年10月21日', '2046年10月20日', '', '', '', '91110105MA0090MQ9G', '', '技术推广服务；经济贸易咨询；组织文化艺术交流活动（不含演出）；会议服务；电脑图文设计、制作；教育咨询（不含出国留学咨询及中介服务）；企业策划；设计、制作、代理、发布广告；互联网信息服务；从事互联网文化活动；出版物零售（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、出版物零售、互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中消创安教育科技有限公司简介\n\n北京中消创安教育科技有限公司简称“中消创安”，只专注于注册消防工程师人才的培训，全国最早专门从事注册消防工程师培训的办学机构。中消创安总部位于北京朝阳区，在江苏南京、甘肃兰州设有事业部。\n自2013年以来，从早期对内给消防官兵、消防部队、消防重点单位和一些消防资质单位做消防培训到2016年正式成立公司，中消创安一直专注于消防领域培训，目前已经在消防培训领域深耕6年，历经多年沉淀，在唯一主营业务——注册消防工程师培训项目上，中消创安教育已成为集报考咨询、政策研究、教育培训和就业指导为一体的专注从事消防工程师培训的机构，并打造了“师资好+服务好+性价比高+通过率高”的口碑，成为希望获得消防证书、为国家消防安全贡献一份力量的有志之士的不二选择。\n中消创安教育拥有雄厚的师资和教研团队，他们来自国内消防界资深专家和名师，骨干教师具有一级注册消防工程师等专业技术职称，多年从事国家一级注册消防工程师执业资格考试的培训工作，现已成为消防职业培训在线教育领域的优选者，为广大考生提供了精益求精的课程质量和安全、可靠、优质的教学服务。\n未来，中消创安将始终秉承“让消防安全', '116.44092499999999', '40.041983000000002', '116.33592400000001', '40.058742000000002', '', null, null, null, null);
