INSERT INTO `t_fc_company` VALUES ('3152', '北京立美净环保科技服务有限公司', '1612', '哈金龙', '', '哈金龙', '13716236352', '2019年12月18日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区望京东园四区13号楼-4至33层101内19层19A502室', '北京市', '北京市', '顺义区', '高丽营镇', '北京市顺义区高丽营镇七村北街3号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年12月18日', '2049年12月17日', '', '', '', '91110105MA01PDFEXY', '', '技术开发、技术转让、技术推广、技术服务、技术咨询；软件开发；应用软件服务（不含医用软件）；计算机系统服务；基础软件服务；销售日用品、通讯设备、计算机、软件及辅助设备、电子产品、五金交电、机械设备、建筑材料、化工产品（不含危险化学品）、装饰材料、塑料制品、汽车配件；清洁服务（不含餐具消毒）；害虫防治服务；物业管理；城市园林绿化管理（不含施工）；家庭服务（不符合家政服务通用要求不得开展经营活动）；礼仪服务；会议服务；代收洗衣服务；普通货物道路货物运输（仅限使用清洁能源、新能源车辆）。（企业依法自主选择经营项目，开展经营活动；普通货物道路货物运输（仅限使用清洁能源、新能源车辆）以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京立美净环保科技服务有限公司地址位于北京市朝阳区望京东园。 主要服务领域：技术服务、技术转让、技术推广、技术咨询、技术开发、软件开发、应用软件服务；计算机系统服务；基础软件服务；销售消防器材、建筑材料、装饰材料、电气设备、空调制冷专用设备、五金交电（不含电动自行车）、化工产品（不含危险化学品 ）公司为企业提供环境污染问题综合解决方案、净化工程实施和运营维护等一体化服务。业务覆盖环境治理、环境监测、水污染治理、油烟治理、净化设备运营维护、油烟净化设备清洗。', '116.489192', '39.996799000000003', '116.507096', '40.178282000000003', '经营地址坐标位置不准确', null, null, null, null);
