INSERT INTO `t_fc_company` VALUES ('3154', '北京普思顿教育科技有限公司', '1610', '孙影', '', '孙影', '13070187010', '2014年08月11日', '660万元', '北京市', '北京市', '朝阳区', null, '北京市昌平区东小口镇立汤路188号院1号楼9层0908', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市昌平区东小口镇立汤路188号院1号楼9层0908', '', '宣传教育培训', '有限责任公司（自然人独资）', '2014年08月11日', '2034年08月10日', '', '', '', '91110108306618815D', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；经济贸易咨询；产品设计；模型设计；翻译服务；公共关系服务；组织文化艺术交流活动（不含营业性演出）；会议服务；承办展览展示活动；包装装潢设计；教育咨询（中介服务除外）；企业管理咨询；设计、制作、代理、发布广告。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京普思顿教育科技有限公司由8名消防退伍兵从事消防安全教育工作开始，匠心筑梦倾力打造，成立之初，与各大消防单位、学校、消防部门合作开展消防安全类培训，先后建立了人才简历库和企业\n信息库，搭建了人力资源和教育系统相结合的服务平台，是2015年首批开展消防工程师培训的机构，也是中国首批高级注册消防工程师在职人才培训机构，经过不断完善，2017年客户遍及中国各大中型城市，累计培训学员2万余人次，获得＂十大教育品牌”称号。一直专注于注册消防工程师培训，通过内容，师训，授课，课后服务的互联网化，成就了更多的消防人才。', '116.41494', '40.056438999999997', '116.41494', '40.056438999999997', '', null, null, null, null);
