INSERT INTO `t_fc_company` VALUES ('3157', '北京绿源同州环保科技有限公司', '1607', '吴桐', '', '吴桐', '17600169595', '2019年06月13日', '1000万元', '北京市', '北京市', '密云区', null, '北京市密云区新北路15号投资促进局办公楼205室-163（投资促进局集中办公区）', '北京市', '北京市', '密云区', '十里堡镇', '北京市密云区河南寨镇提辖庄村养殖小区内', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年06月13日', '长期', '', '', '', '91110228MA01KQRL17', '', '技术推广服务、技术开发、技术咨询、技术转让、技术推广、技术服务；销售专用设备、通用设备、电气机械；建筑物清洁服务；城市园林绿化；城市污水排放、疏通、清淤；城市道路养护；建设工程项目管理；专业承包、劳务分包、施工总承包；水污染治理；房屋的清扫、消毒；家庭劳务服务；大气污染治理；废气治理；固体废物污染治理；噪声、光污染治理；地质灾害治理；汽车尾气治理；烟气治理；辐射污染治理；水污染治理；环境监测；工程勘察；工程设计；垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计、垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京绿源同州环保科技有限公司成立于2019年6月，是一家集大气治理，环境治理，设备销售及安装的多功能企业。自成立以来已为北京市密云镇政府、密云区税务局、密云区司法局、密云区体育局、首都经贸大学密云分校等，成功更换厨房油烟净化器设备及厨房设备，达到合格标准，获得一致好评。北京绿源同州环保科技有限公司的前身致力于厨房烟气净化，设备改造，设备维护、清洗等工作5年之久，我们的宗旨“信誉至上 用户第一 质量满意 交货准时”', '116.801372', '40.357939000000002', '116.783714', '40.378571000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3158', '北京清与净环保服务有限公司', '1606', '阳小霞', '', '汪小清', '13901185284', '2019年11月11日', '500万元', '北京市', '北京市', '怀柔区', null, '雁栖经济开发区雁栖路33号院1号楼103室', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '十八里店乡大洋路市场西门酒店用品二楼办公室', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年11月11日', '2019年11月10日', '', '', '', '91110116MA01NLFP07', '', '大气污染治理；生活清洗、消毒服务；建筑物清洁服务、办公室保洁服务；技术开发、咨询、转让、推广、服务；销售厨房设备、环保设备、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京清而净环保设备服务有限公司是专业销售环保设备、油烟净化器、空气净化设备，厨房设备，排油烟罩，电器设备，酒店用品；及餐饮业大气污染物解决方面的技术开发、技术服务、技术咨询；环保设备安装、维修及清洗服务的餐饮业大气污染综合解决方案型企业。\n公司坚持“品质第一，服务至上”的宗旨，为大型酒店、政府机关和企业食堂提供过科学合理的排烟设计安装，咨询及后期维护清洗服务。\n公司主要产品有静电式光解复合油烟净化器、风机等产品及系统工程设计达到国家先进水平。为酒店餐饮业一大批知名企业提供高品质的空气净化产品和系统服务。', '116.68315699999999', '40.352058', '116.470787', '39.856206999999998', '经营地址坐标位置不准确', null, null, null, null);
