INSERT INTO `t_fc_company` VALUES ('3163', '北京恒泰创艺装修装饰工程有限公司', '1598', '张社民', '', '张社民', '18611859633', '2016年01月05日', '1000万元', '北京市', '北京市', '平谷区', null, '黄松峪乡黄松峪东街402号', '北京市', '北京市', '平谷区', '黄松峪乡', '黄松峪乡黄松峪东街402号', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年01月05日', '2036年01月04日', '', '', '', '91110117MA002X8B91', '', '专业承包；施工总承包；室内外装饰设计；技术开发、技术咨询、技术转让、技术服务；销售金属材料、机械设备、电气设备、木材、日用品、针纺织品、电子产品、建筑材料、装饰材料、五金交电、化工产品；承办展览展示；企业管理；经济贸易咨询；会议服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京恒泰创艺装修装饰工程有限公司从事酒店、食堂、学校、机关单位油烟机、油烟管道清洗清洗。\n我公司将人性化的服务模式及专业的清洗技术融为一体，公司拥有一流的管理队伍、高精尖的研发人员、国内最早从事油烟管道清洗行业的专业施工服务队伍、现场模拟演示系统，技术培训基地。\n 我公司针对国内部分油烟管道的复杂性，研制出适合任何异形管道的清洗方法，工程已经涵企事业单位、宾馆酒店、大型商场超市、医院、车站、学校等各种使用排油设备的餐厅食堂场所，并得到了客户的一致好评和行业的推荐\n 公司在完成施工的同时，还为客户提供清洗前后对比照片、清洗证明等服务。', '117.26473', '40.225599000000003', '117.26473', '40.225599000000003', '', null, null, null, null);
