INSERT INTO `t_fc_company` VALUES ('3165', '北京中建高科环保科技有限公司', '1596', '孙向国', '', '孙向国', '17301080959', '2014年03月12日', '100万元', '北京市', '北京市', '昌平区', null, '北京市昌平区回龙观镇发展路8号院8号楼10层1011', '北京市', '北京市', '昌平区', '回龙观地区办事处', '回龙观大厦818室', 'AA', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年03月12日', '2044年03月11日', '2019/12/26', '2020/12/25', '2019-HY-0574', '91110114095176665A', '烟道清洗', '专业承包；工程勘察设计；建设工程项目管理；清洗环保设备、排风管道及整体厨房设备；销售机械设备、建筑材料、金属材料、电子产品、五金交电、日用品。（领取本执照后，应到住建委、规划委取得行政许可）(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京中建高科环保科技有限公司是一家专业化保洁服务公司,北京消防协会会员单位。公司拥有一批专业保洁服务人才，技术力量雄厚。公司拥有一批世界知名品牌的专业保洁设备。本公司坚持“以质量求生存、以信誉求发展”为原则，来 为客户提供最完美的服务。 本公司主要承接项目 1.各大酒店、宾馆、酒楼、会馆、学校食堂档口、企事业单位餐厅、商场美食城、等等的厨房烟罩、烟道、净化器、风机的清洗、及维修、厨房设备的维修与保养。 2.酒店、宾馆、大厦、写字楼、商场、机关单位、小区的各项保洁服务，保洁托管、开荒保洁、清洁石材、地面、翻新、结晶、保养打蜡、高空外墙清洗，清洗空调与管道，木地板保洁与保养，地毯清洗。 我公司自成立以来，已经建立了一套比较完美的质量，监督、管理体系。会以“服务第一、质量第一、管理第一”为我公司的服务宗旨，来做好每一个客户给予的工作。我公司全体员工愿以一流的服务，最低的价格为广大客户提供一个洁净、舒适的环境。', '116.294754', '40.104081999999998', '116.316813', '40.074641999999997', '经营地址坐标位置不准确', null, null, null, null);
