INSERT INTO `t_fc_company` VALUES ('3168', '北京鑫培安全自动化技术有限公司', '1590', '秦培杰', '', '秦培杰', '18901278686', '2014年03月12日', '2000万元', '北京市', '北京市', '门头沟区', null, '龙兴南二路6号院3号楼25层2508', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '张仪村甲96号', '', '烟道清洗,消防设施,电气防火,消防安全评估', '有限责任公司（自然人独资）', '2014年03月12日', '2034年03月11日', '2019/1/28', '2020/1/27', '京消协（2019）证字052号', '91110106094561465L', '', '技术开发、技术服务、技术转让、技术咨询；清洁服务；设备维修；消防安全评估；技术检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫培安全自动化技术有限公司创建于2014年。公司业务范围涵盖技术开发、技术服务、技术转让、技术咨询等，拥有消防技术服务机构资质证书，是北京市消防建设、维护的重要新生力量。长期以来，公司致力于根据客户需求，全面提供消防工程建设、维护，在业界享有良好的口碑和声誉，所承建的工程和维护的项目质量优良，多次得到客户的认可和表彰。公司坚持“以人为本”的人才战略，始终将人才视为最重要的财富和长期发展的原动力。不断吸引、培养和留用密切相关的高层次人才，打造配置合理、结构优化的精英人才团队；不断完善创新薪酬福利制度，与企业品牌、规模相适应，保护合理流动，为稳定骨干员工队伍提供坚实的保障；塑造优秀雇主形象，构建“学习型组织”员工成长机制，有效促进员工与企业共同发展。 公司以管理求效益，以质量求生存，以信誉求发展，始终秉承以管理创新为先导、以战略创新为方向、以技术创新为手段、以市场创新为目标，专注于行业的发展，用我们辛勤和智慧，持续为客户创造更多价值而不断奋斗。', '116.142205', '39.897635000000001', '116.224338', '39.875100000000003', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3169', '北京中巨建设工程有限公司', '1589', '孔令元', '', '孔工', '15300066005', '2016年12月15日', '6000万元', '北京市', '北京市', '房山区', null, '北京市房山区石楼镇梨元店村村委会东330米', '北京市', '北京市', '大兴区', '北京经济技术开发区', '亦庄经济技术开发区宏达工业园7号楼永昌商务中心3层301室', '', '建筑防火', '有限责任公司（自然人独资）', '2016年12月15日', '2066年12月14日', '', '', '', '91110113MA00AKEU0K', '', '施工总承包；专业承包；劳务分包；城市园林绿化施工；工程项目管理；租赁机械设备；家庭服务；经济贸易咨询；工程勘察设计；销售消防器材、五金、家用电器、建筑材料（不含砂石及砂石制品）、装饰材料、机械设备、化工产品（不含危险化学品及一类易制毒化学品）、文化用品、电子产品、工艺品（不含文物）、花卉。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中巨建设工程有限公司成立于2016年，是国家建设部和公安部正式批准的国家消防工程专业施工二级企业和建筑智能化工程专业承包等10项资质企业。公司已通过了ISO9001质量管理体系认证ISO14001环境管理体系认证、GB/T28001职业健康安全管理体系认证。\n自公司于2016年成立，中巨以质量求发展，靠诚信行天下。公正与诚信是中巨不变的追求，“零缺陷”是中巨永恒的目标。公司本着“以科学的管理、精心的设计、精良的施工、创造环保安全的工作环境，实现质量第一、服务至上、信誉一流的目标”的方针，按照国家相关法律法规和消防安全管理体系的规范要求，采用国际先进的建设工程项目管理模式，为消防工程建设提供从项目策划、可行性研究、消防规划及性能化设计、工程招投标、设备采购、施工管理、竣工验收的专业化全程服务，确保消防工程建设项目的进度、质量和安全。中巨公司开竣工的消防工程项目涵盖政府机关、高档写字楼、大型商业楼、民用住宅群等，建筑面积几百万平方米。作为人类的安全卫士，中巨清晰地意识到自己的责任重大，要勤于创造、乐于奉献，以崇高的使命感、强烈的自豪感以及高尚的道德观要求自己，满怀热情期待您的垂询与合作', '116.039658', '39.655200000000001', '116.509486', '39.803024000000001', '注册地址坐标位置不准确', null, null, null, null);
