INSERT INTO `t_fc_company` VALUES ('3176', '北京鼎立家政服务有限公司', '1578', '党军军', '', '党军军', '15110197586', '2018年03月23日', '200万元', '北京市', '北京市', '怀柔区', null, '怀北镇怀北路308号', '北京市', '北京市', '怀柔区', '怀北镇', '怀北镇怀北路308号', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年03月23日', '长期', '', '', '', '91110116MA01AYWQ1G', '', '家庭劳务服务；办公室保洁服务、建筑物清洁服务；施工总承包；劳务分包；专业承包；会议服务；承办展览展示；设计、制作、代理、发布广告；城市园林绿化；租赁建筑工程机械、建筑工程设备；技术开发、咨询、服务、转让、推广。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鼎立家政服务有限公司 从事酒店、餐厅、食堂、油烟管道清洗服务，油罐、油罐车、水泵等清洗服务,业务涵盖北京、天津、河北等地。 公司被评为“重合同守信用单位”,以先进的清洗设备和优质的服务成为同行业中领跑企业。我公司致力于烟道清洗技术的开发和应用实践,并取得了令人瞩目的骄人成绩。 我公司针对国内部分油烟管道的复杂性,选用适合任何异形管道的清洗方法,工程已经涵盖企事业单位、宾馆酒店、大型商场超市、医院、车站、学校等各种使用排油设备的餐厅食堂场所,并得到了客户的一致好评和行业的推荐。 公司在完成施工的同时,还为客户提供清洗证明等服务。我们的服务宗旨是为广大客户提供最优质的产品、最优惠的价格、以及最周到的服务。 我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念,始终保持“健康、科技、环保、创新、专业”的宗旨,竭尽全力为您提供最完美的服务。', '116.68822299999999', '40.389386000000002', '116.68822299999999', '40.389386000000002', '', null, null, null, null);
