INSERT INTO `t_fc_company` VALUES ('3181', '北京皓德恒溥教育科技有限公司', '1569', '郑惠芳', '', '郑惠芳', '13820774761', '2012年03月06日', '6000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区酒仙桥2号院内（707厂）【5-2】1层', '北京市', '北京市', '朝阳区', '酒仙桥街道', '北京市朝阳区酒仙桥2号院内（707厂）【5-2】1层', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2012年03月06日', '2042年03月05日', '', '', '', '911101055923854683', '', '技术推广服务；企业策划；票务代理；翻译服务；文艺创作；舞蹈技术培训（不得面向全国招生）；教育咨询（不含出国留学咨询及中介服务）；经营电信业务；广播电视节目制作；从事互联网文化活动。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、经营电信业务、广播电视节目制作以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京皓德恒溥教育科技有限公司，是国内最专注学术研究的综合类目在线教育企业。教学团队核心成员均为各专业领域的顶级教育管理人才。国内最早致力于注册消防工程师人才培训的机构之一，学员遍布及全国各大中型城市，累计培训学员数量超过 5 万人,力求为学员提供完整的再教育平台，形成完善的教育培训生态产业链。皓德恒溥教育，在注册消防工程师考试中，独树一帜，引领教学方向。', '116.49638899999999', '39.987133', '116.49638899999999', '39.987133', '注册和经营地址坐标位置不准确', null, null, null, null);
