INSERT INTO `t_fc_company` VALUES ('3183', '北京志恩远宏科技有限公司', '1567', '李秀清', '', '刘恩羽', '18518373777', '2016年02月24日', '100万元', '北京市', '北京市', '石景山区', null, '北京市石景山区古城大街特钢公司十一区（首特创业基地A座）二层248号', '北京市', '北京市', '海淀区', '四季青地区办事处', '八大处甲1号院', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年10月10日', '长期', '', '', '', '91110107MA008NW07D', '', '技术开发、技术咨询、技术推广；基础软件服务；应用软件服务；销售电子产品、通讯器材、安全技术防范产品、建筑材料（不从事实体店铺经营）、日用品、服装、鞋帽、针纺织品、文化体育用品、五金交电（不从事实体店铺经营）、工艺品、家用电器；维修机械设备；保洁服务；设计、制作、发布、代理广告；城市园林绿化；承办展览展示活动；室内装饰工程设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '厨房烟道清洗，油烟排风机，油烟净化器清洗', '116.179346', '39.914909000000002', '116.20249200000001', '39.951492000000002', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3184', '北京一凡雅保洁有限公司', '1565', '张美霞', '', '臧雪冬', '18910309095', '2004年03月22日', '800万元', '北京市', '北京市', '丰台区', null, '城南嘉园益城园16号楼8层3-0810', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '东三环南路联合国际大厦甲段611', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2004年03月22日', '2024年03月21日', '', '', '', '911101057601068016', '', '包括清洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '专业从事中央空调系统清洗、油烟管道清洗的服务型企业。为用户的中央空调系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\n公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成中央空调系统清洗全系列工作。\n我们丰富的经验可广泛服务于所有使用中央空调的场所，包括写字楼、宾馆、饭店、商场、学校、机关办公区等。\n您的健康是我们的责任，一凡雅愿用自己的努力，为您提供一个洁净、健康、舒适的环境。为我们人类多留一片洁净的蓝天。\n公司成立至今，目前公司有各类职工86人，从事中央空调风管清洗32人，从事油烟管道清洗54人以一流的服务、先进的技术、严格的管理为众多物业酒店提供优质服务，在同行业中树立了专业化清洁公司的典范，成为活跃在北京市高智能综合大厦、写字楼、小区、工厂学校清洁服务的尖兵。\n不懈努力、不懈追求是本公司永保活力的源泉；科学灵活的经营管理是本公司成功的保证；客户至上，信誉第一，奉行诚信服务是本公司赖以发展的宗旨。', '116.368792', '39.832715999999998', '116.459834', '39.868295000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3185', '北京鑫淼缘保洁服务有限公司', '1564', '包书名', '', '包书名', '15010517319', '2019年10月21日', '200万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南法信镇金关北二路2号院1号楼4层442', '北京市', '北京市', '顺义区', '南法信地区办事处', '北京市顺义区南法信镇金关北二路2号院1号楼4层442', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年10月21日', '长期', '', '', '', '91110113MA01N7JF69', '', '清洁服务；保洁服务；物业管理；家政服务；城市园林绿化施工；接受委托提供劳务服务（不含对外劳务合作、排队服务）；信息咨询（不含中介服务）；持术开发；技术服务；技术咨询；企业形象策划；销售日用品、机械设备、装饰材料、厨房用具、工艺品（不含文物、象牙及其制品）、体育用品（不含弩）、五金交电（不含电动自行车）；维修机械设备；病虫害防治；家居装饰；汽车装饰（不含洗车服务）；专业承包、劳务分包；道路货物运输。（企业依法自主选择经营项目，开展经营活动；专业承包、劳务分包、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\n北京鑫淼缘保洁服务有限公司是一家技术研发生产与销售为一体的生产厂家，公司主要生产北京三项达标油烟净化器，风机，风柜，油水分离器，定做厨房油烟管道设备,工程通风管道设备，空调通风管道设备。\n为了更好服务各企业，公司成立设备安装，维修，保养清洗，是经北京消防协会评审的专业公司，具备厨房油烟管道清洗资质，员工均持证上岗，我们拥有最强的技术实力，为客户提供了最完备的服务综合保障；可以为客户提供各种管道清洗结果，既确保了清洗结果的真实性，也减少了甲方对清洗结果的疑虑。我们与阳光保险公司共同创立了中国烟道清洗行业的工程意外险种，确保６０天责任期内由于我方清洗质量问题导致甲方发生火灾的责任赔偿问题，最大限度减少了甲方可能承担的风险。\n我们的技术势力在行业无可比拟。我们注重学习、不断创新，\n打 好蓝天保卫战，为 治理大气污染，为 后人打造蓝天白云坚持不懈 是北京鑫淼缘保洁服务有限公司肩负的使命', '116.612531', '40.116512999999998', '116.612531', '40.116512999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3186', '北京国泰宏业消防安全检测有限公司', '1559', '叶翔', '', '于淑敏', '15901345032', '2004年07月15日', '300万元', '北京市', '北京市', '丰台区', null, '北京市丰台区新发地京良桥西侧2000米路北北京新发地丰和顺农产品市场7号楼3单元302室', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区新发地京良桥西侧2000米路北北京新发地丰和顺农产品市场7号楼3单元302室', '', '消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2004年07月15日', '2024年07月14日', '', '', '', '91110106765008813N', '', '建筑消防设施检测；电气防火检测技术服务；专业承包；清洗保洁服务；销售消防器材、建筑材料、五金交电、日用品；技术开发；维修机械设备；维修消防设备；清洁服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京国泰宏业消防安全检测有限公司成立于2004年，是经北京市公安消防局、市技术监督局审核并授权的消防安全检测服务专业机构。作为北京市消防协会理事单位，公司通过了《北京市电气及消防安全检查技术规范》，并经北京市技术监督局审核颁布证书，同时也成为了北京市消防协会的双优会员。\n根据中华人民共和国公安部消防局、北京市公安消防总队、北京市公安消防局的有关政策规定，我公司面向各类重要政治活动场所、写字楼、影剧院、体育场馆、大型娱乐场所、大型商、市场、各类工矿企业、专业仓库、酒店宾馆、住宅社区等建筑设施，采用先进的消防安全检测技术，结合系统化的专项检测设备，以图谱化、数据化及计算机自动化处理技术为一体的科技手段，全面、科学、准确地反映建筑设施内部火灾隐患的危险程度及其准确位置，自动消防设施系统的工作状态及故障点，并及时提出相应整改措施，从而彻底消除隐患，避免各类火灾事故的发生。\n公司基于消防检测基础之上的专业化维修保养工作模式，全面、及时、准确地反映消防设施的即时工作状态，及时发现存在隐患的表现形式、危险程度和具体位置，并整治修复，确保消防系统的正常运行。', '116.339394', '39.818218999999999', '116.339394', '39.818218999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3187', '北京明远嘉诚教育咨询有限公司', '1555', '王子业', '', '张馨', '13370155004', '2012年12月05日', '1000万元', '北京市', '北京市', '密云区', null, '北京市密云区西大桥路67号十里堡镇政府办公楼407室-314', '北京市', '北京市', '通州区', '新华街道', '北京市通州区新华大街绿地中央广场一期805', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2012年12月05日', '2032年12月04日', '', '', '', '91110228059284781G', '', '教育咨询；企业管理咨询；经济贸易咨询；会议服务；文化咨询；技术开发、技术推广、技术转让、技术咨询、技术服务；体育咨询；软件咨询；产品设计；企业策划；设计、制作、代理、发布广告；组织文化艺术交流活动（不含演出及棋牌娱乐活动）；影视策划；翻译服务；市场调查；承办展览展示活动。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '明远教育隶属于北京明远嘉诚教育咨询有限公司，成立于2012年，注册资金1000万元，总部坐落于北京。在互联网变革浪潮中，明远教育时刻走在时代前沿，与新兴的互联网行业相结合，将视线由线下转入线上，引领网络教育开启一个新时代。明远教育经过多年的发展，不断改进课程质量，积极建设加强师资队伍，完善服务渠道，建设灵活多样的课堂管理制度，现已成为一家以职业资格教育培训为核心，以考试教研、报考服务、就业指导等多方面服务的教育平台。多年来，明远教育专注教育一个领域一件事情，一直专项做在线直播课程的研究与开发，现已将录播加直播课程作为全国推广的新型学习模式。', '116.8018', '40.358111999999998', '116.65837999999999', '39.915590000000002', '', null, null, null, null);
