INSERT INTO `t_fc_company` VALUES ('3190', '北京星磊宜洁环保科技有限公司', '1552', '相小红', '', '相小红', '13522002686', '2019年11月25日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳万兴路86号-N2162', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区长阳万兴路86号-N2162', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年11月25日', '2049年11月24日', '', '', '', '91110111MA01NXKN9H', '', '技术服务；技术检测；清洁服务；园林绿化服务；物业管理；家庭劳务服务；商务办公服务；规划设计管理；单位后勤管理服务；酒店管理；销售办公用品、化工产品（不含危险化学品）、卫生间洁具、日用杂品、酒店用品、清洁用品、洗涤用品；劳务分包；施工总承包；专业承包；人力资源服务。（企业依法自主选择经营项目，开展经营活动；施工总承包、专业承包、人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司主要经营各大酒店；饭店；宾馆烟道清洗以及中央空调清洗业务。', '116.169729', '39.775677000000002', '116.169729', '39.775677000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3191', '北京志远鸿达消防设备有限公司', '1551', '李吉生', '', '李雪松', '13301265868', '2004年09月21日', '100万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区城子大街31号', '北京市', '北京市', '海淀区', '八里庄街道', '玲珑路恩济西园8号楼8101室', '', '消防设施', '有限责任公司（自然人独资）', '2004年09月21日', '2034年09月20日', '', '', '', '9111010976753768XP', '', '销售、维修消防器材及设备；销售机电设备、钢材、木材、建筑材料、五金交电、陶瓷、汽车配件、计算机软硬件、办公自动化设备、家具、日用百货、化工产品（不含化学危险品及一类易制毒化学品）；家居装饰；信息咨询（不含中介）；房地产信息咨询（不含中介）；技术开发、转让、咨询、服务；组织文化艺术交流活动；承办展览展示。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2004年，注册资金一百万元。（拟增加至一千万元）公司现有职工15人，中高级职称4人。办公面积720平方米。公司自成立以来一直从事消防设施，设备维修工作。拥有一批多年从事消防工作的专业员工，公司将以不断的开拓进步精神，严格管理，周到服务，合理价格。和您携手共创未来。', '116.09321199999999', '39.966861999999999', '116.28292399999999', '39.931668999999999', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3192', '北京万山从商贸有限公司', '1550', '张秀存', '', '张秀存', '15001356346', '2014年12月12日', '100万元', '北京市', '北京市', '延庆区', null, '北京市延庆区永宁镇北关小区6号楼102', '北京市', '北京市', '西城区', '展览路街道', '中关村南大街方圆大厦优客工场2层', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年12月12日', '2064年12月11日', '', '', '', '911102293183109492', '', '销售文化用品、安全技术防范产品、办公用品、建筑材料、通讯设备、机械设备、电子产品、计算机及辅助设备、五金、化工产品（第一类中的非药品类易制毒化学品除外）、日用品、服装；汽车租赁（不含九座以上客车）；绿化管理；建筑物清洁服务；承办展览展示活动；安装、维修空调；维修锅炉；设计、制作、代理、发布广告；租赁建筑工程机械、建筑工程设备；仓储服务（需要审批的除外）；城市园林绿化施工；专业承包、劳务分包；清洁服务；家庭服务；体育运动项目经营;城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京万山从商贸有限公司是延庆地区经营项目广、涉猎行业多的一家综合性的个人独资企业。该公司成立于2014年12月，注册资本100万元。主要经营销售文化用品、办公用品、电子通讯器材、建筑材料、绿化管理、清洁服务、汽车租赁、安装维修空调、锅炉、设计广告、专业承包、劳务分包等等。其中，清洁服务是我公司重要经营项目，在我区承接清洁服务项目累计超过50余个，具有丰富的专业管理体系和专业的施工队伍，受到包括行政机关单位、学校、医院和各大企业客户的一致好评。并为我区创造了几十个就业机会，为延庆区创建和谐社会贡献一份力量。我公司本着“以客户为中心”的经营思想，客户的需要就是我们的追求，坚持为农民工朋友提供就业机会，为延庆创建全国文明城区而努力奋斗！', '115.967868', '40.464759999999998', '116.329601', '39.939078000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3193', '北京智博天琪科技发展有限公司', '1549', '石惠', '', '张佳萌', '17801234707', '2012年02月20日', '1000万元', '北京市', '北京市', '通州区', null, '北京市通州区宋庄镇徐辛庄大街1号373室', '北京市', '北京市', '通州区', '宋庄镇', '北京市通州区宋庄镇徐辛庄大街1号373室', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2012年02月20日', '2042年02月19日', '', '', '', '91110112590651953A', '', '技术开发及转让；技术服务；中央空调清洗；大气污染治理服务；建筑物清洁服务；计算机系统的设计、调试和管理；酒店管理；组织文化艺术交流活动（棋牌除外）；销售机电设备；销售空调专业设备；专业承包。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '我公司北京智博天琪科技发展有限公司（简称智博天琪），本着对社会负责、对所服务企业负责的态度，积极响应国家有关部门的政策，做绿色、环保、健康企业。并且承诺：我公司今后的发展，仍会积极配合相关部门的一切规章制度。\n北京智博天琪科技发展有限公司（简称智博天琪），成立于2012年2月10日，位于北京市通州区宋庄镇徐辛庄大街1号373室。是一家专业做环保、清洁的企业单位。 公司一贯坚持“质量第一，用户至上，优质服务，信守合同”的宗旨，凭借着高质量的产品，良好的信誉，优质的服商务家，获得大众的好评。', '116.69811', '39.990516999999997', '116.69811', '39.990516999999997', '', null, null, null, null);
