INSERT INTO `t_fc_company` VALUES ('3197', '北京中威宏酒店设备有限公司', '1543', '林伟平', '', '张强', '13601173228', '2007年06月28日', '5002万元', '北京市', '北京市', '', null, '琉璃河镇白庄村9区1号', '北京市', '北京市', '', '', '琉璃河镇白庄村9区1号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2007年06月28日', '2027年06月27日', '', '', '', '91110111663700948N', '', '销售机电设备、酒店设备、厨房设备、不锈钢制品、五金交电、制冷空调设备、环保设备、节能设备、污水处理设备、水处理设备、家具、针纺织品、清洁设备、清洁用品；安装家用空调、厨房设备；维修厨房设备；清洗排烟罩；专业承包；产品设计；技术开发、技术咨询（中介除外）、技术服务、技术转让；生产厨房设备。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京中威宏酒店设备有限公司是专业从事商用厨房工程策划设计，制造、安装、销售服务、代理外购、技术咨询与培训的公司，是北京市先后获取ISO9001：生产品种全、售后服务快捷的厨房设备生产厂家。先后通过2008国际质量管理体系认证、ISO14001环境管理体系认证和GB/T28001职业健康安全管理认证体系的商用厨具公司，目前国内实力雄厚、研发能力强。\n我司工厂坐落在房山区琉璃河工业区交通便利。占地面积15000余平米，经过多年的蓬勃发展，公司拥有一大批先进的专业制造设备，生产设备具有完美的流水线作业，具有先进的设备自检设施，汇集了全国各地的专业人才，具备了较强的研发在全国各地设立十几处办事机构，以确保产品的销售市场和售后服务工作。公司产品已经通过北京市燃气及燃气用具产品质量监督检测站并获取工业产品生产许可证，认定为优质产品。我司是国内外著名品牌指定为一级销售代理商。', '116.006218', '39.581477999999997', '116.006218', '39.581477999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
