INSERT INTO `t_fc_company` VALUES ('3203', '北京睿沨环保科技有限公司', '1534', '朱桂玉', '', '李廷玉', '15210381215', '2016年05月18日', '2000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区阜成路81号院1号楼五层529房间', '北京市', '北京市', '海淀区', '八里庄街道', '北京市海淀区阜成路81号院1号楼五层529房间', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年05月18日', '2036/5/17', '', '', '', '91110108MA005J4R2R', '', '技术咨询、技术服务；水污染治理；大气污染处理；销售机械设备、五金交电(不含电动自行车)、电子产品、建筑材料、厨房用具、日用杂货；建筑物清洁服务；会议服务；承办展览展示活动。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京睿沨环保科技有限公司是一家从事空气净化领域和建筑物清洁服务的环保科技型企业。公司位于北京市海淀区，专注于新风系统设备的研发、生产、销售和服务工作，拥有一支精干的研发和管理团队。\n公司重视人才及科研工作，聘请数名各行业中、高级工程师，围绕“新风系统”，进行研发生产，不断创新，取得了多项实用新型专利和外观设计专利。\n睿沨秉承“用爱心去创造”的企业创展精神，以“环保，节能，高效、智能”为产品研发导向，针对办公楼、学校、养老机构等不同行业、不同规模而形成了各种新风系列产品,并为用户提供专业的空气治理解决方案。\n睿沨人以不断提高您生活品质为己任，不断超越自己，全身心的致力于空气净化，为环保事业衔石填海。', '116.292851', '39.925051000000003', '116.292851', '39.925051000000003', '', null, null, null, null);
