INSERT INTO `t_fc_company` VALUES ('3211', '北京华夏众安科技有限公司', '1524', '张学会', '', '高云', '13581911446', '2019年07月17日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡西店村42号楼7号二层', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高碑店乡西店村42号楼7号二层', '', '消防产品', '有限责任公司（自然人投资或控股）', '2019年07月17日', '长期', '', '', '', '91110105MA01LGD929', '', '技术推广、技术开发、技术服务、技术转让、技术咨询；软件开发；计算机系统服务；数据处理；销售计算机、软件及辅助设备、社会公共安全设备及器材、化工产品(不含危险化学品)、金属制品、电子产品；产品设计；企业管理咨询；委托加工社会公共安全设备及器材；仓储服务；货物进出口、技术进出口、代理进出口；互联网信息服务；从事互联网文化活动；工程勘察；工程设计；保险代理业务；保险经纪业务；认证服务；城市生活垃圾清扫、收集、运输。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、认证服务、城市生活垃圾清扫、收集、运输、互联网信息服务、保险经纪业务、保险代理业务、工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华夏众安科技有限公司（简称：华夏众安）由具有安全应急领域十余年经验的行业精英发起，与国家应急管理部门、行业组织及消防安全行业伙伴积极协作，运用移动互联网人工智能、大数据云计算系统和物联感知技术推动灭火器智慧管理创新，致力于解决威胁人类生命安全、社会公共财产安全的隐患问题。公司秉承“让世界更安全”使命，打造为人民群众生命财产安全保驾护航，为社会创造价值的互联网高科技企业。', '116.520988', '39.904933', '116.520988', '39.904933', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3212', '北京圣美伦清洁科技有限公司', '1523', '徐彦合', '', '刘永彬', '13146388626', '1998年07月08日', '800万元', '北京市', '北京市', '西城区', null, '北京市西城区平原里小区20号楼陶然居B-103', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区玉泉营桥南京开大厦三层3FA21-25', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1998年07月08日', '2048年07月07日', '', '', '', '9111010263308753X7', '', '技术开发、技术培训、技术咨询、技术服务、技术转让、技术推广；销售机械设备、电器设备、仪器仪表、五金交电、百货、电子计算机及外配件、汽车配件、橡胶制品、塑料制品、建筑材料、装饰材料、文化体育用品、饮食炊事机械、化工产品（不含一类易制毒化学品及化学危险品）；经济信息咨询；接受委托提供劳务服务；清洗、保洁服务；家居装饰；维修日用电器、日用电子器具；接受委托提供物业管理；机械设备租赁。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '圣美伦清洁设备商城成立于1998年，是一家专业销售清洁设备、保洁用品并提供售后服务为一体的商贸公司。公司以“锐意进取、服务无限”为宗旨，凭借多年积累的经验，专业技术不断的创新，诚信优质的服务，赢得了广大客户及国内外多家知名清洗设备、保洁用品供应商的信任与支持，为企业获得了卓越的商誉，成为中国清洁行业协会“常务理事单位”。并被评为“清洁行业十大经销商”、“清洁行业优秀企业”。\n圣美伦销售的产品有：全自动洗地机，驾驶式扫地机，洗车机，高压清洗机，地毯清洗机，吸尘吸水机，石材翻新养护设备等等。我公司历经多年不懈的努力，现已有完善的营销网络，并建立了完善的售后服务体系。公司将在第一时间内解决产品维修问题，并提供免费的技术培训与咨询！苏州黑猫（集团）有限公司在京办事处\n美国EDIC清洗设备在京办事处	\n意大利强力洗清洗机在京办事处\n格美扫地机在京办事处\n凯驰清洁设备在京经销处\n海宝清洗设备在京办事处', '116.37362899999999', '39.882311000000001', '116.344719', '39.838779000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3213', '北京万达新保洁服务有限责任公司', '1522', '谭佳顺', '', '谭佳顺', '13001208265', '2006年09月28日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区朝阳路十里堡综合楼618室', '北京市', '北京市', '朝阳区', '八里庄街道', '北京市朝阳区朝阳路十里堡综合楼618室', '', '烟道清洗', '有限责任公司（自然人独资）', '2006年09月28日', '2026年09月27日', '', '', '', '911101057940800722', '', '保洁服务；市场调查；经济贸易咨询；企业管理咨询；会议服务；承办展览展示活动；组织文化艺术交流活动（不含演出）；公共关系服务；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司北京万达新保洁服务有限责任公司，成立于2006年9月28日，经营地址位于：北京市朝阳区朝阳路十里堡综合楼618室。主要经营：保洁服务;市场调查;经济贸易咨询;企业管理咨询;会议服务;承办展览展示活动;组织文化艺术交流活动(不含演出);公共关系服务;专业承包。(企业依法自主选择经营项目,开展经营活动;依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动;不得从事本市产业政策禁止和限制类项目的经营活动。)', '116.50303099999999', '39.916336999999999', '116.50303099999999', '39.916336999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3214', '北京京盾西科姆电子安全有限公司', '1521', '赵舒鑫', '', '温桂勇', '13701387921', '1995年12月28日', '250万美元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区八里庄西里100号住邦2000商务中心东区5层', '北京市', '北京市', '朝阳区', '八里庄街道', '北京市朝阳区八里庄西里100号住邦2000商务中心东区5层', 'AAA', '消防信息化', '有限责任公司（中外合资）', '1995年12月28日', '2045年12月27日', '', '', '', '91110000600039005A', '', '开发、设计、委托生产、安装安全报警、防灾、消防、交通安全、电视监控、计算机等系统设备、软件；销售自产产品、提供相关的技术咨询、技术服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京京盾西科姆电子安全有限公司成立于1995年，投资规模250万美元，是由西科姆中国有限公司(投资规模5000万美元)与北京市通达资产管理集团公司合资经营的一家以电子安全技术防范为主(包含：防灾、消防)的公司。\n1996年北京西科姆公司中标承建《城八区110金融紧急报警网》，并负责其中的：东城区、西城区、朝阳区、海淀区(后陆续增加：延庆区、顺义区、首都机场、西客站等地区)联网运行服务。至今已安全运行22年。\n西科姆集团在全球18个国家和地区拥有320万客户。2017年荣获福布斯最受信赖的公司第176名，最佳雇主第349名(以上排名在安全防范企业中是最高排名)。西科姆中国在：北京、上海、深圳、广东等省市建立了21个安全服务公司。\n公司宗旨：为社会、企业、家庭提供安全、安心的服务！\n服务模式：联网安全服务。为用户设计安装安全防范系统(包括：烟感、煤气泄漏、紧急报警/紧急呼救、温度监控、入侵报警、漏水报警、视频监控等各种传感探测器和主机)。系统通过有线、无线、4G5G网络等通讯方式，将监控到的用户异常信息传送到(365天*24小时)监控中心。监控中心根据异常种类不同采取相应的紧急处理措施。', '116.49515700000001', '39.915157999999998', '116.49515700000001', '39.915157999999998', '', null, null, null, null);
