INSERT INTO `t_fc_company` VALUES ('3216', '北京金石鸿泰清洗服务有限公司', '1519', '孔德立', '', '孔德立', '18610568005', '2014年09月29日', '100万元', '北京市', '北京市', '昌平区', null, '北京市昌平区回龙观镇西大街35号院3号楼3层350', '北京市', '北京市', '昌平区', '回龙观地区办事处', '北京市昌平区回龙观镇西大街35号院3号楼3层350', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年09月29日', '2044年09月28日', '', '', '', '9111011431806491XU', '', '清洁服务；建筑物清洁；销售日用品、卫生用品、文化用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京金石鸿泰清洗服务有限公司是一家具有独立法人资格的专业化保洁服务公司； 承接酒店、宾馆、大厦、写字楼、商场、小区、机关等企事业单位的室内外各项保洁服务，维修、清洗厨房油烟罩、烟道，风机，净化器。清洁石材地面，翻新、结晶、保养打蜡、承接高空外墙、玻璃清洗及其他高难度、危险性作业等；总之，您有什么困难、要求、我公司会尽全力为你排忧解难。我公司管理人员和专业人员具备多年丰富经验和熟练的职业技能，所有的作业人员都经过岗前培训；使用专业的清洗设备及清洗药剂等。严格按照操作程序及技术规范进行各种清洗、保洁服务。 我公司经过多年的实践与经验积累，已经建立了一套比较完善的质量、监督、管理体系，为企事业单位、办公楼、大厦、酒店、写字楼、商场等提供长期、短期各种清洗、保洁服务。 珍惜荣誉、完善管理、服务至上、质量第一是我公司成功发展的服务宗旨，我公司全体员工愿以一流的服务、优惠的价格为客户提供一个优美、洁净的环境，愿我们的优质服务，能为你带来愉快的心情！', '116.33288899999999', '40.080187000000002', '116.33288899999999', '40.080187000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3217', '北京圣泰珈皓消防科技有限公司', '1518', '贾炳友', '', '贾炳友', '13381202036', '2009年11月13日', '600万元', '北京市', '北京市', '平谷区', null, '北京市平谷区夏各庄镇纪太务村南街61号', '北京市', '北京市', '平谷区', '夏各庄镇', '北京市平谷区夏各庄镇纪太务村南街61号', '', '消防设施', '有限责任公司（自然人独资）', '2009年11月13日', '2029年11月12日', '', '', '', '91110117697745423H', '', '技术开发及转让、技术咨询与服务；消防设备维修；专业承包；家居装饰及设计；消防设施工程设计；销售消防器材、五金交电（不含电动自行车）、建筑材料、安全技术防范产品；消防技术服务；技术检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京圣泰珈晧消防科技有限公司成立于2009年11月13日，注册地：北京市平谷区夏各庄镇纪太务村南街61号，经营范围：技术开发及转让、技术咨询与服务；消防设备维修；专业承包；消防设施施工工程设计；销售消防器材。', '117.18650700000001', '40.140326999999999', '117.18650700000001', '40.140326999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3218', '北京福喜家政服务有限公司', '1517', '周亚龙', '', '蔡春玲', '13601038837', '2016年05月24日', '20万元', '北京市', '北京市', '顺义区', null, '北京顺义区李桥镇顺通路李桥段60-188', '北京市', '北京市', '顺义区', '李桥镇', '北京顺义区李桥镇顺通路李桥段60-188', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年05月24日', '长期', '2018/12/6', '2019/12/5', '京消协（2018）证字443号', '91110113MA005Q7855', '', '家庭服务；清洁服务（不含餐具消毒）；病虫害防治；接受委托提供劳务服务（不含排队服务、对外劳务合作）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司专业从事酒店，宾馆，食堂，学校，机关单位等厨房排油烟管道清洗，风机和净化器清洗，大型油烟机清洗以及中央空调清洗，通风管道工程安装等业务。还经营销售各种厨房设备，机械设备，清洗设备，保洁用品，环保产品等，我公司将人性化的服务模式及专业的清洗技术融为一体，拥有严格的管理制度，先进的设备，一流的服务质量和精湛的技术。清洗维修技师都具备多年清洗，维修和安装经验，并不断吸收新的技术和先进的检测设备成果来满足广大客户的需求。公司在完成施工的同时，为客户提供清洗前后对比照片，清洗证明等服务。得到了客户的一致好评和行业的推荐。', '116.677358', '40.025446000000002', '116.677358', '40.025446000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3219', '北京吉顺宇翔科贸有限公司', '1516', '葛艳敏', '', '葛艳敏', '13611208785', '2012年01月06日', '50万元', '北京市', '北京市', '房山区', null, '德润街6号院8号楼17层1708', '北京市', '北京市', '房山区', '城关街道', '德润街6号院8号楼17层1708', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年01月06日', '2032年01月05日', '', '', '', '91110106589109403Y', '', '技术推广；销售建筑材料、装饰材料、机械设备、五金交电、汽车配件、文具用品；城市园林绿化服务；劳务服务；专业承包；组织文化艺术交流活动；设计、制作、代理、发布广告；打字复印；电脑图文设计；维修办公设备；租赁机械设备；清洁服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司：北京吉顺宇翔科贸有限公司（简称吉顺宇翔），成立于 	2012年1月6日，位于北京市房山区德润街6号院8号楼17层1708。从事酒店、餐厅、食堂油烟管道清洗服务,业务涵盖北京、天津、河北等地。为用户的清洗系统提供“最优质的解决方案”是企业的服务宗旨。做环保、清洁的企业单位。 公司一贯坚持“质量第一，用户至上，优质服务，信守合同”的宗旨，凭借着高质量的产品，良好的信誉，优质的服商务家，获得大众的好评。我们的承诺：您的满意才是我们的满意！', '116.01043', '39.712412999999998', '116.01043', '39.712412999999998', '', null, null, null, null);
