INSERT INTO `t_fc_company` VALUES ('3221', '北京聚利泰佳环境科技有限公司', '1514', '王金富', '', '王金富', '13811560668', '2015年08月17日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区造甲街110号2号平方', '北京市', '北京市', '丰台区', '长辛店镇', '丰台区太子峪白草洼', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年08月17日', '2045年08月16日', '', '', '', '91110106355222542F', '', '包括技术开发、技术服务；餐饮管理；会议服务；企业形象策划；设计制作；代理、发布广告；网上销售厨房用具、空调制冷设备、机械设备；清洁服务，水污染治理，大气污染治理，网上销售厨房设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '2016年开始生产低空净化器，2017年到2018年新增排烟通风管道制作。2018年因净化器售后需要，新增清洗管道，清洗净化器。2019年至今生产自创品牌：   JLTJ-静电光解复合式净化器   售后净化器清洗。JLTJ-静电光解复合式净化器 达标北京2019年环保新规要求。清洗售后一条龙服务。', '116.297507', '39.843966999999999', '116.166183', '39.853270000000002', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3222', '北京吉宇鑫中央空调清洗有限公司', '1512', '徐建亭', '', '徐建亭', '17611635635', '2004年12月02日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区幸福二村20号住宅楼11层1101室', '北京市', '北京市', '朝阳区', '三里屯街道', '北京市朝阳区幸福二村20号住宅楼11层1101室', '', '消防设施,烟道清洗', '有限责任公司（自然人独资）', '2004年12月02日', '2024年12月01日', '', '', '', '9111010576994406XJ', '', '清洗制冷空调设备、锅炉；销售机械设备、电子产品、五金交电、化工产品（不含危险化学品）；维修空调；专业承包。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司 北京吉宇鑫中央空调清洗有限公司（简称吉宇鑫），本着对社会负责、对所服务企业负责的态度，积极响应国家有关部门的政策，做绿色、环保、健康企业。并且承诺：我公司今后的发展，仍会积极配合相关部门的一切规章制度。', '116.44528099999999', '39.939343999999998', '116.44528099999999', '39.939343999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3223', '北京星空清洗服务有限公司', '1511', '赵小永', '', '赵小永', '13910516320', '2008年03月19日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区八里庄西里97号1106室', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区大黄庄西路3号院', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2008年03月19日', '2028年03月18日', '', '', '', '91110105673840047E', '', '清洁服务；物业管理；机动车公共停车场服务；销售化工产品（不含化学危险品）、针纺织品、日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京星空清洗服务有限公司是一家从事油烟管道清洗、化工产品销售的专业单位。本公司清洗设备先进，技术力量雄厚，管理完善。具有高素质、严纪律、精工艺的专业施工团队，以及精干的领导班子，汇集了同行业的业务精英，在北京市场有了广泛的影响力，取得了明显的效果。\n      北京星空清洗服务有限公司是经北京市工商局正式注册批准的，我司竭诚致力于清洗保洁的专业清洗公司。我们面向社会各机关、团体、宾馆、酒店、医院、大学院校等提供全方位的清洗保洁服务。 \n      我们很高兴有机会向您提供服务，北京星空清洗服务有限公司全体员工坚信，只要您给我们一次机会，我们将以最真诚的服务为您创造一个优美、理想的环境。', '116.49547099999999', '39.914608999999999', '116.53650399999999', '39.921168999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3224', '北京望海环保科技有限公司', '1509', '何小军', '', '何小军', '13366356635', '2009年06月16日', '1000万元', '北京市', '北京市', '昌平区', null, '北京市昌平区科技园区超前路37号院16号楼2层B0072号', '北京市', '北京市', '昌平区', '城南街道', '北京市昌平区科技园区超前路37号院6号楼B单元808室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年06月16日', '长期', '', '', '', '911101146908219997', '', '技术咨询、技术服务、技术开发、技术转让；大气污染治理；地质灾害治理；专业承包；施工总承包；建设工程项目管理；货物进出口、技术进出口、代理进出口；销售机械设备、五金交电、仪器仪表、金属材料、建筑材料。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京望海环保科技有限公司成立于2009年，坐落于北京中关村昌平科技园区，注册资本1000万人民币，公司拥有强大的科研团队，长期深耕于科研与工程一线，经验丰富，并与中科院、清华大学、北京航空航天大学等国内一流大学和科研院所长期开展技术交流和合作，掌握了一批具有自主知识产权的核心关键技术，具有为客户提供高品质技术和产品服务的雄厚实力。\n公司专注于油烟净化、废气处理、除尘净化、环保燃烧等领域的技术和产品研发，形成了系列化的产品与解决方案，广泛应用于餐饮、机械、冶金、化工、航天等行业的环境综合治理。\n公司以需求为导向，以创新为动力，以质量求生存，以贡献求发展，不断在技术和应用上进行创新和突破。公司成立以来，业务快速增长，研发生产、客户服务、资质条件协调推进，各方面能力大大提升。\n公司愿与客户共同成长、与伙伴共同进步，不断完善自我、不断超越自我，合作共赢!', '116.256021', '40.206110000000002', '116.256021', '40.206110000000002', '', null, null, null, null);
