INSERT INTO `t_fc_company` VALUES ('3228', '北京金煜蓝天环保科技有限公司', '1504', '杨海峰', '', '杨海峰', '13651305810', '2015年10月10日', '800万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区景园北街2号院67号楼11层1209', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡老君堂村甲五号院三号楼二单元303', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年10月10日', '2045年10月09日', '', '', '', '91110302MA0014DF9P', '', '技术推广服务；销售厨房用具、电气设备、机械设备、电子产品、建筑材料、家用电器、日用品、酒店用品、不锈钢制品、计算机、软件及辅助设备、消防器材；厨房设备安装、维修；专业承包；委托加工厨房设备；家庭劳务服务、清洁服务；承办展览展示活动、会议服务；制作、代理、发布广告；组织文化艺术交流活动（不含演出）；软件开发；产品设计；设备安装。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '本公司于2015年10月10日注册经营，注册资金800万元，员工20余人。主要经营厨房设备的安装与维修。现阶段计划发展厨房排烟管道清洗这一项目，为首都消防工作尽一份绵力。', '116.51927999999999', '39.777855000000002', '116.512011', '39.837969000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3229', '航天屹邦（北京）国际环保科技有限公司', '1503', '刘林', '', '刘长林', '13311073833', '2008年07月29日', '500.83万元', '北京市', '北京市', '通州区', null, '北京市通州区朱家垡村西900号院', '北京市', '北京市', '大兴区', '北京经济技术开发区', '科创四街36号院3-507', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2008年07月29日', '2028年07月28日', '', '', '', '911101066787854978', '', '技术咨询、技术开发、技术服务、技术转让；经济信息咨询；设计、制作、代理、发布广告；劳务服务；软件开发；企业管理咨询；销售电子产品、电子元器件、计算机软硬件及辅助设备、仪器仪表、文具用品、机械设备、家用电器、大气污染治理；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '航天屹邦(北京)国际环保科技有限公司于2008年成立，注册资金500、83万，注册地址:北京市通州区朱家垡。2013年与中国科学院环保科技人员经过多年潜心努力开发研制而成，采用纳米无机合成高科技术, 生产的湿渗法（屹邦牌）餐饮油烟除尘净化机10余类，HTYB/16D95-5、HTYB/16C96-6、HTYB/16B98-8、HTYB/16A99-9系列，我司技术力量雄厚，拥有一批优秀的科研、生产、销售、设计、安装、清洗、除尘、除味、管理人才和实力的专业施工队伍，在长期实践中形成了独特的安装流程理念和管理模式。\n\n屹邦除油烟、净化生存空间、实现碧空蓝天。\n\n感谢您了解选择屹邦专业餐饮油烟清洗队伍或购买屹邦牌油烟净化除味机产品，我们将秉承“服务第一、诚信为本、客户至上、时效为重”的经营理念，坚持、积极、迅速、准时、合理”的服务原则，为您提供专业、高效的服务。守初心成就梦想、尽责任担当重托。\n\n全国服务热线——400——900——1395', '116.623017', '39.839303000000001', '116.528312', '39.805928000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3230', '北京腾飞红鹏科技发展有限公司', '1502', '王蛇扣', '', '王蛇扣', '18511325849', '2012年02月13日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区东铁匠营横一条31号6楼3层3042号', '北京市', '北京市', '丰台区', '东铁匠营街道', '北京市丰台区东铁匠营横一条31号6楼3层3042号', '', '消防设施,消防产品,电气防火', '有限责任公司（自然人独资）', '2012年02月13日', '长期', '2018/11/26', '2019/11/25', '京消协（2018）证字396号', '911101065906769903', '', '技术开发；技术服务；技术转让；技术咨询；技术检测；劳务分包；劳务服务；系统集成服务；机械设备维修；消防设备维修；清洁服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京腾飞红鹏科技发展有限公司是一家经北京市消防协会认证的检测企业，为北京消防协会会员单位，中国消防协会会员。通过GB/T19001-2000质量管理体系认证，公司成立于2012年，主要从事技术开发、技术服务、技术转让、技术咨询、技术检测、系统集成服务、机械设备维修、消防设备维修。\n公司拥有一支专业齐全、经验丰富、技术实力雄厚，长期从事消防及电气防火安全检测的专业队伍。公司依托雄厚的技术力量和先进的仪器设备，能够准确、及时地发现新旧建筑中存在的消防及电气安全隐患，并提出科学的整改意见，及时消除火灾隐患，为预防和减少相关损失提供有力的技术保证。\n我们以高素质的检测人员、先进的检测设备及科学的管理体系为保障，为受检单位提供优质可靠的服务。公司严格执行消防协会的有关规定，坚持检测质量第一。以高起点、高效率为服务宗旨，以认真负责的工作态度为原则，在检测工作中不漏检、不误检，恪守科学、公正行业理念，严格执行国家消防法规和技术规范。做到数据准确、检测全面，热情服务。', '116.43406299999999', '39.848945999999998', '116.43406299999999', '39.848945999999998', '', null, null, null, null);
