INSERT INTO `t_fc_company` VALUES ('3242', '北京鑫未来保洁服务有限公司', '1474', '屈清山', '', '屈清山', '18500546756', '2018年09月29日', '800万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号A1378', '北京市', '北京市', '房山区', '拱辰街道', '北京市房山区良乡凯旋大街建设路18号A1387', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年09月29日', '2048年09月28日', '', '', '', '91110111MA01EWUTXU', '', '清洁服务（不含洗车服务）；包装服务；建筑物清洁服务；家庭劳务服务；工程技术咨询；大气污染治理、水污染治理；施工总承包；专业承包；劳务分包；物业管理；销售日用杂品、文化体育用品（音像制品除外）、五金交电（不含电动自行车）、建筑材料、计算机软硬件及辅助设备、电子产品、通讯器材（卫星接收设备除外）、厨房用具、卫生间洁具、机械设备、办公用品、服装鞋帽、工艺美术品、化工产品（危险化学品除外）；城市生活垃圾清扫、收集、运输、处理；工程勘察。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、工程勘察以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫未来保洁服务有限公司是一家经工商部门批准、 正规注册的合法经营执照的保洁公司。公司于保洁、保养、护理、清洗、清洁与一体的保洁服务公司，为公司单位、办公区、商业化领域等各企业单位提供全方位的保洁服务。\n该公司自成立以来，凭借精良设备、丰富的经验以真诚的服务迅速发展。公司经营范围主要包括日常保洁、外墙清洗、地毯清洗、木地板打蜡、石材翻新与保养，中央空调清洗、厨房大型油烟管罩(道)清洗、灭火器材检测与销售等业务\n\n公司在管理运作方面，贯以严格的管理和规范的服务。拥有-批高素质、高技术水平的清洁服务人员，所有上岗入员均经过严格的培训和考核。其次专业化的管理人员，可以为客户制定详细的保洁计划，厨房，烟罩，管道，风机、净化器，各种设备制做及安装。', '116.137918', '39.721812999999997', '116.137918', '39.721812999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3243', '富瑞保洁服务(北京）有限公司', '1472', '刘占河', '', '刘占河', '13020041406', '2019年10月11日', '300万元', '北京市', '北京市', '大兴区', null, '北京市大兴区龙发大街1号院1号楼1层2单元101', '北京市', '北京市', '大兴区', '魏善庄镇', '北京市大兴区龙发大街1号院1号楼1层2单元101', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年10月11日', '2049年10月10日', '', '', '', '91110115MA01N2FUXL', '', '清洁服务；零售日用品；机动车公共停车场的经营管理；建筑机械设备租赁；经济贸易咨询；企业管理咨询；公共关系服务；零售五金（不含电动自行车）；技术开发；技术咨询；技术服务；城市园林绿化工程；技术推广服务；病虫害防治服务；维修家用电器、制冷空调设备；物业管理；企业管理；出租商业用房、办公用房；家政服务；专业承包；道路货物运输；代理记账；城市生活垃圾经营性清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；道路货物运输、代理记账、城市生活垃圾经营性清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司富瑞保洁服务(北京）有限公司，成立于 2019年10月11日，位于北京市大兴区龙发大街1号院1号楼1层2单元101， 是一家专业做环保、清洁的企业单位。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的开荒保洁和清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.401205', '39.683566999999996', '116.401205', '39.683566999999996', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3244', '北京栋梁强晟科技有限公司', '1471', '张国良', '', '张国良', '15811393826', '2017年09月28日', '100万元', '北京市', '北京市', '通州区', null, '北京市通州区中关村科技园区通州园金桥科技产业基地环科中路17号26幢1至3层102-Y050', '北京市', '北京市', '通州区', '马驹桥镇', '北京市通州区中关村科技园区通州园金桥科技产业基地环科中路17号26幢1至3层102-Y050', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年09月28日', '2047年09月27日', '', '', '', '北京栋梁强晟科技有限公司', '', '技术服务、技术推广、技术转让；家庭劳务服务；建筑物清洁服务；维修空调制冷专用设备、厨房用具；室内装饰设计；销售环保专用设备；专业承包；道路货物运输。（企业依法自主选择经营项目，开展经营活动；道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京栋梁强晟科技有限公司成立于2017年09月28 日，地址位于：北京市通州区中关村科技园区通州园金桥科技产业基地环科中路17号26幢1至3层102-Y050 \n先申请加入消防协会，开展烟道清洗业务', '116.55490500000001', '39.730510000000002', '116.55490500000001', '39.730510000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3245', '北京瑶新名媛商贸有限责任公司', '1470', '李秀芝', '', '张配青', '18516951931', '2008年06月16日', '50万元', '北京市', '北京市', '东城区', null, '北京市东城区火桥北里6号楼一层6-4', '北京市', '北京市', '西城区', '陶然亭街道', '北京市西城区平原里21-4', '', '建筑防火,法规政策', '有限责任公司（自然人独资）', '2008年06月16日', '2028年06月15日', '', '', '', '911101016774479126', '', '销售化妆品； 广告代理； 信息咨询（不含中介服务）。（未经专项审批的项目除外。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '    北京瑶新名媛商贸有限责任公司是世界中医药学会联合会美容专业委员会理事、中国百名优秀企业家之李瑶新博士亲自创办。公司具有雄厚经济基础和深厚医学背景，其下为瑶新名媛美容院品牌连锁店。\n \n    公司将凭借准确而高远的市场定位、以智取胜的品牌战略和一支高素质、高技术的专业化队伍，打造出别具一格的瑶新名媛品牌、引领国内美容业潮流逐步走向世界！\n \n    瑶新名媛自1995年成立以来，一直坚持引进全球最尖端美容项目，走访德国、韩国、日本等发达国家，为中国女性寻求最佳美丽方案，打造精致名媛女人。二十一来年，瑶新名媛赢得京城数十万女性信赖，树立京城美容连锁第一品牌的美誉。\n \n    瑶新名媛·为健康美丽而存在', '116.433896', '39.882188999999997', '116.373732', '39.881203999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3246', '北京瑞阳泰通科技有限公司', '1468', '龚群卫', '', '龚群卫', '13801119688', '2015年03月11日', '1580万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧桥路25号院7号楼1806', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧桥路25号院7号楼1806', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年03月11日', '2035年03月10日', '', '', '', '911101153354369140', '', '技术开发；专业承包；产品设计；劳务分包；销售医疗器械（Ⅰ类、Ⅱ类）、厨房设备、通风管道、不锈钢制品、环保设备、家用电器、制冷空调设备、污水处理设备、消防设备、通讯设备、仪器仪表、五金产品（不含电动自行车）、家庭用品、建筑材料、金属材料、健身器材；承办展览展示；家居装饰；物业管理；清洁服务；大气污染治理；水污染治理；保洁服务；园林景观设计；安装家用电器；维修燃气灶具；技术检测；销售安全技术防范产品；加工厨房设备、通风管道（限外埠从事生产活动）；工程勘察；工程设计；销售第三类医疗器械。（企业依法自主选择经营项目，开展经营活动；销售第三类医疗器械、工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京瑞阳泰通科技有限公司，成立于 2015年03月11日，位于北京市大兴区旧桥路25号院7号楼18067， 是一家专业做环保、清洁的企业单位。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的开荒保洁和清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.45650999999999', '39.793190000000003', '116.45650999999999', '39.793190000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3247', '北京中泰亿鑫工程有限公司', '1466', '毛阳阳', '', '陶学东', '13811680760', '1999年04月13日', '3000万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区军庄镇军庄路2号院JZ1424室', '北京市', '北京市', '丰台区', '马家堡街道', '北京市丰台区马家堡西里13号楼', '', '建筑防火,消防设施,电气防火', '有限责任公司（自然人投资或控股）', '1999年04月13日', '长期', '', '', '', '911101067000892885', '', '施工总承包；专业承包；劳务分包；建设工程项目管理；技术检测；技术服务、咨询、开发、推广、转让；技术培训；企业管理；企业管理咨询；计算机系统服务；经济信息咨询；会议服务；承办展览展示；机械设备租赁；销售计算机、软件及辅助设备、五金交电、消防器材、建筑材料、安防产品、化工产品（不含化学危险品及一类易制毒化学品）、仪器仪表、机械设备、家用电器、电子产品、电气设备、通讯设备、文化用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中泰亿鑫工程有限公司，是1999年4月13日在北京工商行政管理局注册登记的一家有限责任公司，注册资金为3000万元。现公司专业资质为：消防设施工程专业承包贰级、建筑装修装饰工程专业承包贰级、电子与智能化工程专业承包贰级、建筑机电安装工程专业承包叁级。\n公司在多年专业工程施工的过程中着重人才储备工作，积累了一大批高素质的管理人才和高科技的专业人才，具备电气、设备、自动化、给排水、机电、工民建、消防自控、电子等多种专业技术职称的中高级工程师、项目经理，形成了公司的骨干队伍。\n公司从事消防设施工程专业承包施工以来，至今已经完成了大小消防工程160多项。具有代表性的有北京航空航天大学、E世界、北京世纪金源购物中心、北京恒和中西医结合医院有限公司、大唐电信、椿树园小区、马连道家乐福、马连道茶城、定福庄小区以及国家税务总局、邮政中心局、管理局、天坛家具公司、中国科技会堂、当代商城、中国艺术研究院、中央美院、美廉美超市等消防工程项目。在从事各项消防安全工程施工中，得到用户和消防监督部门及监理公司的好评。', '116.086399', '39.973205', '116.374448', '39.855483', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3248', '北京金源荣达保洁服务有限公司', '1465', '夏海荣', '', '夏海荣', '13691385422', '2011年04月29日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区管庄乡小寺村149号', '北京市', '北京市', '朝阳区', '管庄地区办事处', '北京市朝阳区管庄乡小寺村149号', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年04月29日', '2031年04月28日', '', '', '', '91110105573154904B', '', '清洁服务（不含餐具消毒）；家庭劳务服务；销售机械设备；日用电器修理（限符合家用电子电器维修业服务经营规范）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金源荣达保洁服务有限公司，是一家集保洁服务；油烟管道清洗；厨具维修等综合性服务于一体的有限公司。', '116.58567499999999', '39.902258000000003', '116.58567499999999', '39.902258000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
