INSERT INTO `t_fc_company` VALUES ('3250', '北京安锐达消防设备有限公司', '1463', '冯庆茹', '', '沈玉松', '13501091921', '2017年03月29日', '300万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区开放路113号南四层409室', '北京市', '北京市', '丰台区', '东铁匠营街道', '北京市丰台区东铁匠营横一条31号金泰翔达院内平房', '', '消防产品', '有限责任公司（自然人投资或控股）', '2017年03月29日', '长期', '', '', '', '91110116MA00D4BM9E', '', '销售机械设备、消防器材、安全技术防护产品、电子产品、金属制品、化工产品（不含危险化学品）、五金交电、通讯设备（不含卫星地面接收、发射设备）；施工总承包、专业承包、劳务分包；城市园林绿化；技术开发、咨询、服务、转让、推广。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安锐达消防设备有限公司，成立于2017年03月29日，是一家自然人投资或控股有限责任公司。注册地址在北京市怀柔区开放路113号南四层409室，注册资本：300万元。主要经营范围：销售机械设备、消防器材、安全技术防护产品、电子产品、金属制品、化工产品（不含危险化学品）、五金交电、通讯设备（不含卫星地面接收、发射设备）；施工总承包、专业承包、劳务分包；城市园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '116.64410100000001', '40.334054999999999', '116.43376000000001', '39.849412000000001', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3251', '中天华源（北京）环保科技有限公司', '1462', '许勇虎', '', '许勇虎', '13801252851', '2011年05月24日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号-D4219', '北京市', '北京市', '房山区', '拱辰街道', '北京市房山区良乡凯旋大街建设路18号-D4279', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年05月24日', '2031年05月23日', '', '', '', '91110102575198089W', '', '技术开发、技术转让、技术咨询、技术服务；组织文化艺术交流活动（不含演出）；经济贸易咨询；计算机系统服务；销售日用品、电子产品、机械设备、五金交电、工艺品、建筑材料、化工产品（不含一类易制毒化学品及危险品）；维修家用电器；清洁服务；机械设备维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\n\n中天华源（北京）环保科技有限公司， 成立于2011年，并于同年取得了北京市消防局颁发的厨房排烟系统清洗资格证书，同年成为北京市消防协会会员单位，公司主要服务于餐饮企业、宾馆、饭店、企事业单位食堂厨房排烟系统的消防清洗，维修和保养以及集中空调通风系统与末端清洗。公司遵循“用心、安全、专业、捷净”的服务精神，以“减少客户厨房安全隐患”为目标，“保障客户工作环境整洁”为己任，不断提高和完善服务质量。\n我公司现拥有一批具有专业素质的管理和施工团队，确保让每一个合作伙伴感受到我们服务的“专业和捷净”。客户的安全是我们的责任，客户的满意是我们的准则。我们将与客户一同分享“用心和安全”所带给双方的效益。\n\n服务项目\n\n厨房排烟系统                        中央空调\n\n排烟罩、集烟罩等清洗                   水循环系统的清洁、保养及维护 \n各类排烟管道清洗                       空调机组的清洁\n各类排风机的清洗和维护                 冷冻水/冷却水循环系统清洗\n各类油烟净化器清洗和维护', '116.137918', '39.721812999999997', '116.137918', '39.721812999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3252', '北京浩华鼎景科技服务有限公司', '1461', '谷玉英', '', '史小锋', '15911167718', '2019年05月17日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区瀛吉街8号院3号楼15层1504', '北京市', '北京市', '大兴区', '瀛海地区办事处', '北京市大兴区瀛吉街8号院3号楼15层1504', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年05月17日', '2049年05月16日', '', '', '', '91110115MA01K7C021', '', '技术开发；技术服务；维修厨房设备、家用电器、空调制冷设备；病虫害防治；保洁服务；清洁服务；销售厨房设备、家用电器、消防器材、照明设备、机械设备、电气设备、电子产品、洗涤用品、家庭用品、五金产品（不含电动自行车）、卫生用品、消毒用品、农药（不含危险化学品农药）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京浩华鼎景科技服务有限公司是一家油烟管道系统清洗的服务型企业。为用户的清洗系统提供“最优质的解决方案”是企业的五福宗旨。立志用最优的资源配备，最优的资源模式，最优的服务质量，为用户提供系统清洗的最优解决方案。公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术，职业素养考核，高素质的专业团队可确保高效，优质的油烟管道全系列工作。我们丰富的经验可广泛服务于写字楼，宾馆，饭店，商场，学校，机关办公区等。您的健康是我们的责任，用自己的努力，为您提供一个洁净，舒适的环境，为我们的生存空间增添更洁净的蓝天。', '116.449923', '39.763109999999998', '116.449923', '39.763109999999998', '', null, null, null, null);
