INSERT INTO `t_fc_company` VALUES ('3254', '北京巡城消防安全技术有限公司', '1459', '张玉芹', '', '张玉芹', '18518185260', '2014年08月25日', '50万元', '北京市', '北京市', '通州区', null, '北京市通州区西集镇后寨府村115号', '北京市', '北京市', '通州区', '西集镇', '北京市通州区西集镇后寨府村115号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年08月25日', '2044年08月24日', '', '', '', '911101123067359158', '', '专业承包；技术推广；清洗厨房设备；建筑物清洁服务；维修消防设备、家用电器；承办展览展示；会议服务；销售日用杂货、服装、鞋帽、文化用品、体育用品（不含弩）、工艺品（不含文物）、家用电器、新鲜蔬菜、新鲜水果；零售消防器材、五金交电、电子产品、通用设备、专用设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京巡城消防安全技术有限公司是一家年轻、充满朝气、具有法人资格的专业性保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写字楼、娱乐场所等提供全方位的清洗保洁服务，包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清洗保洁服务。本公司采用美国进口的清洁设备及意大利进口的清洁药剂，具备承揽大型项目所需的配套设施及清洗能力，可以为不同领域客户提供全方位的满意服务。作为北京消防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具有严格专业素质的管理及清洗人员，赢的了广大客户的一致好评，在业内树立了良好的口碑。科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是本公司信赖以发展的宗旨。巡城消防公司将继续以一流的质量、优惠的价格、周到热情的服务态度为广大客户提供更多、更好的清洁服务，并热诚欢迎社会各界朋友光临本公司洽谈业务', '116.89556399999999', '39.796573000000002', '116.89556399999999', '39.796573000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
