INSERT INTO `t_fc_company` VALUES ('3256', '北京龙德天成教育科技有限公司', '1457', '毕列勇', '', '于振', '15652573210', '2016年05月09日', '300万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区汤立路201号院1号楼2层A-209', '北京市', '北京市', '昌平区', '霍营街道', '北京市昌平区科星西路龙跃苑43号楼3层2-102', '', '宣传教育培训', '有限责任公司（自然人独资）', '2016年05月09日', '2036年05月08日', '', '', '', '91110105MA005LKU4A', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；企业管理；企业管理咨询；经济贸易咨询；市场调查；税务咨询；教育咨询；计算机系统服务；销售化妆品、日用品、化学产品（不含危险化学品）、电子产品、体育用品；企业策划；公共关系服务；会议服务；翻译服务；应用软件服务（不含医用软件）；基础软件服务；数据处理；设计、制作、代理、发布广告；摄影服务；文艺创作；软件开发；健康管理（需经审批的诊疗活动除外）；健康咨询（须经审批的诊疗活动除外）；法律咨询（律师执业活动除外）；建筑工程项目管理；医学研究（不含诊疗活动）；租赁建筑工程机械设备；销售社会公共安全设备及器材、建筑材料；产品设计；模型设计；包装装潢设计；工艺美术设计；电脑图文设计、制作；承办展览展示活动；组织文化艺术交流活动（不含演出）；自然科学研究；工程和技术研究；农业科学研究；销售计算机、软件及辅助设备；广播电视节目制作；互联网信息服务；从事互联网文化活动；工程设计。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、互联网信息服务、广播电视节目制作、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '龙德在线，隶属于北京龙德天成教育科技有限公司，创立于2016年5月，截至目前，龙德在线现有编制员工已打近百人，编外员工上千人，累计服务全国上万名学员。凭借先进的技术优势、不断创新的教学产品、领先的互联网教育运营理念，龙德在线秉承“为国家输送人才，为个人提供发展”的经营理念，提升公司自身服务能力，打造业界良好的教育培训系统。2019年10月24日，中国财富网与龙德在线教育达成战略合作，成立国民素养教育培训中心，共同助力国民素养提升。', '116.411293', '40.054547999999997', '116.358694', '40.074171999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3257', '北京远洋同创保洁服务有限公司', '1456', '张洋', '', '张洋', '18610625889', '2003年07月17日', '2000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区双龙南里边128号2幢一层116', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区双龙南里边128号2幢一层116', '', '烟道清洗', '有限责任公司（自然人独资）', '2003年07月17日', '2023年07月16日', '', '', '', '91110105752628781X', '', '清洁服务；家庭服务；打字；复印；安装家用空调制冷设备；花卉租摆；风景园林工程设计；餐饮管理；酒店管理；物业管理；教育咨询；会议服务；劳务派遣（劳务派遣经营许可证有效期至2022年10月22日）；城市生活垃圾清扫、收集、运输、处理；工程勘察；工程设计；人力资源服务。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、工程勘察、工程设计、人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京远洋同创保洁服务有限公司成立于2003年7月17日，是一家集日常保洁、开荒保洁、高空作业、地毯清洗、石材翻新、消毒杀虫等多项服务为一体的专业环保型清洁公司。公司管理机制完善，清洁作业经验丰富，拥有雄厚的技术力量，严格实行岗前培训—岗中督查—上岗再培训的员工管理措施，凭着优良的清洁质量和严格的督察管理，为众多企事业单位、医院、酒店、商场、学校等提供优质的后勤清洁服务。公司历经十四年，不仅拥有各类进口清洁养护设备、清洁工具、安全环保型清洁药剂，还积淀了一支优秀的精英团队。我公司以共同创造为理念，为给客户带来绿色美好的环境而不懈奋斗！', '116.48362', '39.869672999999999', '116.48362', '39.869672999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3258', '北京亿鹏东方制冷设备维修有限公司', '1455', '李章明', '', '李国东', '13651251963', '2009年07月15日', '10万元', '北京市', '北京市', '昌平区', null, '北京市昌平区城北街道鼓楼东街33号3等9幢楼9号楼一层9101室', '北京市', '北京市', '昌平区', '城北街道', '北京市昌平区城北街道鼓楼东街33号3等9幢楼9号楼一层9101室', 'AA', '烟道清洗', '有限责任公司（自然人独资）', '2014年09月28日', '2064年09月27日', '2019/12/9', '2020/12/8', '2019-HY-409', '91110114L27466698P', '烟道清洗', '维修家用电器、厨房设备、办公设备、计算机、家用电器、通讯设备、仪器仪表、专用设备；建筑物清洁服务；机器及办公设备的清洗；锅炉烟囱的清扫；厨房设备（油烟机等）的清洗；经济信息咨询（不含中介服务）；家庭劳务服务；物业管理；销售五金交电（不含电动自行车）、金属材料、仪器仪表、电子产品、装饰材料、机械设备、门窗、家具、木制品、文化用品、玩具、针纺织品、服装鞋帽、日用品、建筑材料、花卉、计算机软硬件及辅助设备、家用电器、厨房用具、家用电器、通讯设备；计算机系统服务；技术开发、技术咨询、技术服务；设计、制作、代理、发布广告；普通货运。（企业依法自主选择经营项目，开展经营活动；普通货运以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京亿鹏东方制冷设备维修有限公司，位于风景优美的北京市昌平区鼓楼东街中心，地理位置优越.交通便利。公司成立于2009年，营业面积120平方米，是一家集销售.维修.清洗.安装售后于一体的专业厨房设备.制冷设备.家用电器服务公司，公司经过十余年的坚持不懈的努力，以公平的价格.良好的服务成为众多客户不可缺少的重要合作伙伴。', '116.237163', '40.224620000000002', '116.237163', '40.224620000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3259', '北京渊大教育科技有限公司', '1454', '李建东', '', '辛明江', '15313743549', '2010年06月24日', '2000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡北花园村388号华汇大厦A座四层A4011号', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区双桥2049文创产业园A25-8', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2010年06月24日', '2030年06月23日', '', '', '', '911101055585979348', '', '技术推广服务；经济贸易咨询；组织文化艺术交流活动（不含演出）；会议服务；电脑图文设计、制作；教育咨询（不含出国留学咨询及中介服务）；企业管理咨询；计算机系统服务；数据处理；健康管理（须经审批的诊疗活动除外）；健康咨询（须经审批的诊疗活动除外）；工程和技术研究与试验发展；医学研究与试验发展（不含诊疗活动）；企业策划；设计、制作、代理、发布广告；出版物零售；互联网信息服务；人力资源服务；广播电视节目制作；从事互联网文化活动；经营电信业务。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、出版物零售、互联网信息服务、经营电信业务、广播电视节目制作、人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京渊大教育科技有限公司成立于2010年6月。公司位于北京市朝阳区，\n是以互联网技术为基础，打造教育产品融合、教育项目推广、互联网技术\n开发等项目，提供全方位、专业化的教育服务，为广大求知者打造真正的\n网络教育资源。我司专注于安全技术服务与咨询等项目，与多家单位合作，如：举办安全管理公益讲座，邀请多家单位参会，共同学习交流等；举办消防安全知识讲座，提供宣传手册及纪念品，消防工程师网络培训等。', '116.550603', '39.907859000000002', '116.57338900000001', '39.912795000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3260', '北京众合安消防技术有限公司', '1453', '赵富松', '', '赵富松', '13552168636', '2019年09月26日', '200万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区西环南路18号A幢3层办公7', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区西环南路18号A幢3层办公7', '', '消防产品', '有限责任公司（自然人投资或控股）', '219年09月26日', '长期', '', '', '', '91110302MA01MUFPXW', '', '技术开发、技术服务、技术咨询；企业管理咨询；设备维修；销售消防设备、消防器材、塑料制品、橡胶制品、服装、服饰、五金交电（不含电动自行车）、电子产品；清洁服务；计算机系统集成；质检技术服务；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京众合安消防技术有限公司，坐落于北京市北京经济技术开发区，隶属于北京众合平安消防培训学院旗下，成立于2019年9月，公司为有限责任公司，注册资金200万元，已取得《劳务派遣经营许可证》。公司自成立以来具有清晰的战略思想，注重企业品牌意识和企业文化建设。\n公司目前拥有一批长期从事消防工作、警惕消防服务、熟练消防法律法规、实践经验丰富的工程技术人员，且拥有一支强大的安装技术过硬、能吃苦耐劳的专业施工队伍，保证了“一流的技术，一流的服务”，并深得广大客户的赞誉和信赖。\n公司秉承“创新务实、诚信经营、优质高效、以人为本、共创价值”的企业文化精神，在公司经营领域范围内积极开拓，努力进取，并以优质的产品、优良的服务、为客户提供全方位的配套服务。“安全防范重于泰山”，在社会飞速发展的今天，我们满怀信心、抓住机遇、迎接挑战，保持对消防事业的高度责任感，不断的提高技术水平，为客户提供热情、及时、优质的服务，为维护社会的稳定和促进首都的现代化建设贡献力量。\n我们愿以先进的技术和良好的质量信誉为用户提供最优质的服务。', '116.532742', '39.766238999999999', '116.532742', '39.766238999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3261', '乐享源科技（北京）有限公司', '1451', '田贝贝', '', '田贝贝', '15727302865', '2019年11月11日', '500万元', '北京市', '北京市', '海淀区', null, '创业中路32号楼32-1-1-470', '北京市', '北京市', '海淀区', '清河街道', '创业中路32号楼32-1-1-470', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年11月11日', '长期', '', '', '', '91110108MA01NL9T55', '', '技术推广、技术开发、技术转让、技术服务、技术咨询；软件开发；建筑物清洁服务；销售厨房用具、服装、五金交电（不含电动自行车）、化工产品（不含危险化学品及一类易制毒化学品）、机械设备（不从事实体店铺经营）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '乐享源科技（北京）有限公司是以技术科技为主体，并结合线下经验进行相辅相成的企业，经营范围:技术推广，技术开发，软件开发，建筑物清洁服务，厨具清洗服务等！', '116.312873', '40.038406999999999', '116.312873', '40.038406999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3262', '北京京锦天诚科技有限公司', '1449', '田晓丽', '', '邱现东', '13671024196', '2012年02月16日', '350万元', '北京市', '北京市', '顺义区', null, '北京市顺义区马坡镇京密路马坡段30号院3幢1号', '北京市', '北京市', '昌平区', '东小口地区办事处', '东小口镇店上村委会', '', '电气防火,烟道清洗', '有限责任公司（自然人独资）', '2012年02月16日', '2032年02月15日', '', '', '', '91110114590649191R', '', '技术推广服务、技术开发、技术咨询；软件设计；经济信息咨询（不含中介服务）；设计、制作、代理、发布广告；承办展览展示；会议服务；包装服务；销售专用设备、制冷设备、机械设备、五金交电（不含电动自行车）、电子产品、建筑材料（不含砂石及砂石制品）、化工产品（不含危险化学品）、环保设备、金属材料（不含电石、铁合金）、计算机、软件及辅助设备、装饰材料、家具、日用品、文化用品、办公用品、体育用品（不含弩）、I类医疗器械、厨房设备、家用电器、卫生间用具、灯具、花卉、电气设备、针纺织品、化妆品、消防器材、安全技术防范产品；专业承包、劳务分包；城市园林绿化施工；物业管理；维修机械设备、制冷设备、水处理设备；清洁服务；租赁建筑机械设备；施工总承包；产品设计；货物进出口、代理进出口；技术进出口；接受委托提供劳务服务（不含排队服务、对外劳务合作）；委托加工；家居装饰；道路货物运输；工程设计。（企业依法自主选择经营项目，开展经营活动；道路货物运输、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京锦天诚科技有限公司，成立于2012年02月，我们是一家以油烟管道清洁服务、电气防火服务为主的服务型企业，主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品。是经北京各教育、商业领域的合作专业公司，具备厨房烟囱清洗资质、员工均持证上岗， 北京京锦天诚科技有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。 我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念，始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为您提供最完美的服务。', '116.640838', '40.174836999999997', '116.381371', '40.067171000000002', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3263', '北京市朝航冷气设备有限公司', '1448', '张发', '', '米雪', '15910463927', '1998年01月26日', '5000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区首都机场宿舍区西平街甲1号', '北京市', '北京市', '朝阳区', '首都机场街道', '北京市朝阳区首都机场宿舍区西平街甲1号', '', '建筑防火,消防设施,消防信息化,消防产品,消防安全检查', '有限责任公司（自然人投资或控股）', '2002年04月18日', '2062年04月17日', '', '', '', '911101136336973973', '', '销售制冷空调设备及配件、建筑材料、消防器材、五金交电（不含电动自行车）、文化办公用品、机械电器设备、环保设备、酒店用品、体育用品、服装、日用百货；制冷设备工程设计、安装、维修；水处理设备安装；机电设备、电器设备维修；承接家居装饰；图文设计；技术咨询、技术服务；加工不锈钢设备及厨具；制作标牌；金属及塑料材料机械雕刻、切割；租赁汽车（不含九座以上客车）；建筑工程用机械与设备租赁；销售食品；劳务派遣（劳务派遣经营许可证有效期至2022年11月10日）；消防设施工程专业承包贰级2017/06/30；建筑机电安装工程专业承包贰级2017/11/14（有限期至2022年6月29日）；机电工程施工总承包叁级2017/06/27（有效期至2021年4月24日）。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市朝航冷气设备有限公司成立于1998年，注册资金5000万，是一家以暖通设备节能研发与实施、消防设施工程专业承包二级、暖通设备销售、安装、维修为主的现代化综合型企业，拥有国家建委颁发机电设备专业承包资质，北京市朝阳区维修行业协会颁发维修专业资格证；是中国制冷协会会员单位。\n北京市朝航冷气设备有限公司现拥有暖通工程师、消防工程师、一级建造师、二级建造师、暖通造价员、暖通施工员、专职安全员及其他各类高级技工，公司凭借20余年的施工经验，过硬的技术实力，一流的售后服务，为首都机场各企事业单位的重点项目提供服务，深得客户的一致好评。', '116.591633', '40.048802999999999', '116.591633', '40.048802999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3264', '北京瑞和众城环保科技有限公司', '1447', '宋瑞', '', '宋瑞', '13911237152', '2019年11月18日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号-D11264', '北京市', '北京市', '房山区', '拱辰街道', '北京市房山区良乡凯旋大街建设路18号-D11264', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年11月18日', '长期', '', '', '', '91110111MA01NR0D3W', '', '环保技术咨询（中介除外）；技术开发、技术咨询（中介除外）、技术转让、技术推广、技术服务；软件开发；基础软件服务；应用软件服务；计算机系统服务；组织文化艺术交流活动（不含演出）；租赁机械设备；企业管理；市场调查；经济贸易咨询、企业管理咨询、旅游信息咨询、教育信息咨询（中介除外）；公共关系服务；企业形象策划、设计；设计、制作、代理、发布广告；清洁服务；建筑物清洁服务；会议服务；承办展览展示；销售计算机软件及辅助设备、家用电器、金属材料、通风设备、厨房设备、酒店用品、办公用品、文化体育用品（音像制品除外）、健身器材、汽车零配件、家具、五金交电（不含电动自行车）、建筑材料、机械设备、装饰材料、机电设备、环保设备；维修空调制冷设备、机电设备；施工总承包；专业承包；劳务分包；物业管理；园林绿化服务；水污染治理；大气污染治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司北京瑞和众城环保科技有限公司，成立于 2019年11月18日，位于北京市房山区良乡凯旋大街建设路18号-D11264， 是一家专业做环保、清洁的企业单位。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的开荒保洁和清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.137918', '39.721812999999997', '116.137918', '39.721812999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
