INSERT INTO `t_fc_company` VALUES ('3267', '北京亨事物业管理有限公司', '1444', '蔡金荣', '', '陈紫意', '15313706164', '2018年03月21日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡长虹西路翠柳东街1号-4097', '北京市', '北京市', '房山区', '西潞街道', '北京市房山区良乡长虹西路翠柳东街1号-4097', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年03月21日', '2048年03月20日', '', '', '', '91110111MA01AWWB3J', '', '物业管理；清洁服务（不含洗车服务）；园林绿化服务；家居装饰及设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京亨事物业管理有限公司建立了健全的项目管理体系，通过了质量管理体系、环境管理体系、职业健康与安全管理体系标准认证，把管理至上、科技至上、服务至上作为驱动企业前进的动力，使亨事物业管理公司具有行业精良的施工能力，以适应市场变化和客户的多样化需求。 亨事物业将继续以高度的责任感和使命感，以充沛的激情和旺盛的斗志，为客户提供更加优质的产品与专业的服务，在与时俱进中不断筑牢企业的品牌根基。', '116.127211', '39.726692', '116.127211', '39.726692', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3268', '正博智远（北京）科技有限公司', '1443', '郑占杰', '', '焦立波', '13304110929', '2014年07月25日', '200万元', '北京市', '北京市', '朝阳区', null, '五里桥二街2号院6号楼4层0410', '北京市', '北京市', '朝阳区', '常营地区办事处', '五里桥二街1号院7号楼0118', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年07月25日', '2034年07月24日', '', '', '', '9111010530656583XW', '', '技术开发、技术推广、技术转让、技术咨询；消防的技术服务；基础软件服务；应用软件服务（不含医用软件）；计算机系统服务；计算机技术培训；租赁舞台灯光音响设备、通讯设备；产品设计；会议服务；承办展览展示活动；电脑图文设计、制作；销售计算机、软件及辅助设备、电子产品、通讯设备、文具用品、玩具、社会公共安全设备及器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司成立于2014年7月，现有员工26人， 主营业务为：技术开发、技术推广、技术转让、技术咨询、技术服务；基础软件服务；应用软件服务（不含医用软件）；计算机系统服务；计算机技术培训；租赁舞台灯光音响设备、通讯设备；产品设计；会议服务；承办展览展示活动；电脑图文设计、制作；销售计算机、软件及辅助设备、电子产品、通讯设备、文具用品、玩具、社会公共安全设备及器材。', '116.61723499999999', '39.928550000000001', '116.61723499999999', '39.928550000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3269', '北京富宏保洁有限公司', '1442', '王真真', '', '朱保红', '13552020675', '2017年05月18日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区康泽路3号院12号楼5层2单元509', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区康泽路3号院12号楼5层2单元509', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年05月18日', '2047年05月17日', '2018/12/19', '2019/12/18', '京消协（2018）证字451号', '91110108MA00EJTJ5E', '', '建筑物清洁服务；经济贸易咨询（中介除外）；公共关系服务；设计、制作、代理、发布广告；技术服务；市场调查；销售文具用品、工艺美术品、针纺织品、皮革制品、服装鞋帽、计算机软件及辅助设备、日用杂品、电子产品、五金交电（不含电动自行车）、文化体育用品（音像制品除外）、建筑材料；劳务分包；劳务总承包；专业承包；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京富宏保洁有限公司是一家拥有先进设备和高素质的专业技术工程施工人员的保洁服务公司，公司资质齐全、设备先进，竭诚以专业的保洁清洗技术为写字楼、商场、酒店、住宅小区、医院、工厂及学校、企事业单位提供日常保洁、地毯清洗、开荒保洁、大理石翻新养护、外墙清洗、油烟管道清洗等一切保洁业务。公司自成立以来,本着以质量求生存，以信誉求发展的服务精神,不断拼搏，不断创新，赢得了广大客户的支持和信赖，为广大客户提供低价位，高品质的清洁服务，公司通过与同行之间的学习交流及实干中的积极探索，形成了一套科学的管理体系和专业的清洁程序，为广大客户进行24小时全城服务，能为您服务是我们的理想，能让您满意是我们永远的追求。愿我们的服务给您带来精彩生活每一天。\n\n　　业务：开荒保洁，大理石翻新养护，外墙清洗，油烟管道清洗，地毯清洗', '116.21404099999999', '39.769855', '116.21404099999999', '39.769855', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3270', '北京京顺华安消防设备有限公司', '1441', '赵争光', '', '赵争光', '13910650447', '2012年01月06日', '550万元', '北京市', '北京市', '丰台区', null, '北京市丰台区花乡宜兰园三区底商10号', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区花乡宜兰园三区底商10号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2012年01月06日', '2032年01月05日', '', '', '', '91110106589109374K', '', '销售消防器材、消防装备、安全防范技术产品、社会公共安全设备、交通设施、化工产品（不含危险化学品）、仪器仪表、机械设备、日用品、文具用品、电线电缆；清洁服务；专业承包；技术检测；维修仪器仪表；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京顺华安消防设备有限公司成立于2012年，公司现已成为注册资本550万元的企业，企业总部设在北京市丰台区花乡宜兰园三区32号底商，目前年施工产值近百万元的消防工程承包企业，公司拥有永久性办公地点，正式员工。公司主要销售产品为：手提式灭火器，干粉灭火器，二氧化碳灭火器，车载灭火器，以及适用于不同企业的多种消防产品。公司通过了IS09001国际质量体系认证，拥有完整的质量保证体系和一套可行性的售后服务，确保为客户提供合格满意的产品。本公司在2018年取得了灭火器维修三级正式资质，拥有持灭火器维修合格证的固定工人，确保服务的有效性。', '116.333935', '39.827016999999998', '116.333935', '39.827016999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3271', '北京亚太银河消防科技集团有限公司', '1440', '韦安庆', '', '权麦玲', '13520609505', '2019年11月11日', '5033万元', '北京市', '北京市', '石景山区', null, '北京市石景山区鲁谷大街53号2层213-10', '北京市', '北京市', '石景山区', '八宝山街道', '北京市石景山区鲁谷大街53号2层213-10', '', '建筑防火,消防设施,宣传教育培训,消防信息化,消防产品,电气防火,消防安全评估', '有限责任公司（自然人投资或控股）', '2019年11月11日', '2049年11月10日', '', '', '', '91110115MA01NL0B07', '', '技术开发、技术服务、技术咨询、技术转让；技术检测；软件开发；市场调查；组织文化艺术交流活动（不含演出）；销售消防器材、金属材料、建筑材料、电子产品、安全技术防范产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京亚太银河集团是一家集消防设备设施维保服务、消防电气防火检测、消防安全评估、消防科普培训、消防产品研发一体化的集团公司，公司理念：“以安全为标准尽到责任”。', '116.23148500000001', '39.889952999999998', '116.23148500000001', '39.889952999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3272', '北京众信嘉华商业管理有限公司', '1439', '李海娟', '', '沙清华', '15210959619', '2019年10月25日', '800万元', '北京市', '北京市', '东城区', null, '东安门大街55号七层727B', '北京市', '北京市', '东城区', '北新桥街道', '交道口东大街85号东城区第一图书馆', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年10月25日', '长期', '', '', '', '91110101MA01NANC53', '', '企业管理；餐饮管理；机动车公共停车场经营管理；物业管理；出租商业用房、办公用房（不得作为有形市场经营用房）；汽车租赁（不含九座以上乘用车）；企业管理咨询；设计、制作、代理、发布广告；承办展览展示；会议服务；翻译服务；技术咨询、技术服务；城市园林绿化；花卉租摆；家庭劳务服务；建筑物清洁服务；宠物美容（不含诊疗活动）；旅游信息咨询；供热服务；销售服装、针纺织品、文化用品、体育用品（不含弩）、花卉、家用电器、电子产品、不再分装的包装饲料、日用品、报警系统视频监控设备；维修家用电器；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京众信嘉华商业管理有限公司，成立于2019年，是一家集保洁服务、油烟管道清洗、厨房设备销售维修、大型中央空调系统清洗等综合性服务于一体的有限公司。 公司配有专业的高压自动清洗设备和专业人员，运用专业的化学清洗技术，做到清洗后漆见光、板见亮等特点。公司员工都经过专业正规培训，并通过严格考核，熟练掌握相关技术。公司拥有严格的管理制度。我们以“美化环境、服务社会”为目的，以“您的满意就是我们的追求”为服务宗旨。我们将用先进的施工设备、一流的服务质量、精湛的工程技术尽心尽力地服务于单位、酒店、宾馆、机关、写字楼、娱乐场所等大型油烟系统、空调系统的清洗和保洁工作。 我们将用我们的优势和特长给您留下一个舒适、干净、明亮的工作和生活空间。', '116.407235', '39.916066999999998', '116.41273200000001', '39.941366000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3273', '北京众鑫八方劳务服务有限公司', '1438', '李建强', '', '孙峰', '13511011069', '2016年06月23日', '300万元', '北京市', '北京市', '顺义区', null, '北京市顺义区仁和地区河南村平安北路50号', '北京市', '北京市', '顺义区', '旺泉街道', '北京市顺义区仁和镇塔河村委会西侧', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年06月23日', '2046年06月22日', '', '', '', '91110113MA006H4K5L', '', '接受委托提供劳务服务（不含排队服务、对外劳务合作）；家庭服务；清洁服务（不含餐具消毒）；会议服务；销售办公用品、文化用品、体育用品（不含弩）、电子产品、五金交电、日用百货、日用杂品、家庭用品、服装鞋帽、针纺织品；零售建筑材料（不含砂石及其制品）、化工产品（不含危险化学品及一类易制毒化学品）、电子产品、通讯器材；机械设备租赁；货物进出口、代理进出口、技术进出口；技术开发、技术服务、技术咨询；信息咨询（不含中介服务）；旅游信息咨询；保洁服务；礼仪服务；物业管理；专业承包、劳务分包、施工总承包；城市园林绿化施工；汽车租赁；国内陆路货运代理；装卸服务；仓储服务（不含危险化学品）；包装服务；劳务派遣（劳务派遣经营许可证有效期至2020年05月17日）；互联网信息服务；销售食品；人才中介服务；道路货物运输。（企业依法自主选择经营项目，开展经营活动；人才中介服务、销售食品、互联网信息服务、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京众鑫八方劳务服务有限公司成立于2016年06月23日，坐落于北京市顺义区.注册资金300万元，拥有一个精诚合作，睿智进取的管理团队，一批高素质的工程技术人员，一支训练有素经验丰富的工程队伍，确保清洗工程高效、高速、高品质的完成。公司主营业务：接受委托提供劳务服务；家庭服务；清洁服务；会议服务；销售办公用品、五金交电、日用百货、日用杂品、家庭用品、服装鞋帽、针纺织品；零售建筑材料、化工产品、电子产品、通讯器材；机械设备租赁；货物进出口、代理进出口、技术进出口；技术开发、技术服务、技术咨询；信息咨询；旅游信息咨询；保洁服务；礼仪服务；物业管理；专业承包、劳务分包、施工总承包；城市园林绿化施工；汽车租赁；国内陆路货运代理；装卸服务；仓储服务；包装服务；劳务派遣；互联网信息服务；销售食品；人才中介服务；道路货物运输。', '116.702977', '40.107551999999998', '116.627926', '40.096865999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3274', '北京光尘启元环保科技有限公司', '1437', '单立鹏', '', '单立鹏', '18611020998', '2019年01月04日', '500万元', '北京市', '北京市', '房山区', null, '长阳万兴路86号-A3959', '北京市', '北京市', '房山区', '长阳镇', '长阳万兴路86号-A3959', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年01月04日', '2049年01月03日', '', '', '', '91110111MA01GKWA55', '', '环保技术开发；技术开发、技术转让、技术咨询（中介除外）、技术服务；销售厨房用具、不锈钢制品、家用电器、日用杂品、机械设备、酒店用品、五金交电（不含电动自行车）、建筑材料、装饰材料、塑料制品、针纺织品、化工产品（不含危险化学品）、计算机软硬件及辅助设备；清洁服务（不含洗车服务）；害虫防治服务；大气污染治理；噪声污染治理；安装、维修家用电器、空调制冷设备、机械设备；家庭劳务服务；家居装饰；餐饮管理；园林绿化工程；园林绿化服务；园林绿化设计；商务办公服务；设计、制作、代理、发布广告。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '启元环保科技致力于打造厨房设备销售、安装、维修、清洗一体的商用厨房综合服务集成商。 \n     启元环保始终视服务质量为企业的生命，不断的满足客户需求，追求品质卓越。公司一贯遵循“客户至上、至诚致信、诚己为人、以心换心、诚人达己、人兴己兴。”的服务精神，坚持高定位、高质量、高效率的三高服务标准。\n     在我公司日常管理工作中，公司充分发挥和挖掘内部潜力，培养了一支经验丰富，技术规范，扎实，素质优秀，人员稳定的专业队伍。此外公司还拥有各类专业设备、工具以及各种环保剂，建立起科学的管理体系和控制体系，形成了独具特色，高效，现代化的服务管理体系。\n    启元环保人的作风是精诚协作、求真务实，您的每一丝微笑都将是我们进取的永久动力！', '116.169729', '39.775677000000002', '116.169729', '39.775677000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3275', '北京万通清洁服务有限公司', '1435', '常宁', '', '常宁', '15033497221', '2019年10月23日', '600万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-A299', '北京市', '北京市', '房山区', '城关街道', '北京市房山区城关街道顾八路1区1号-A299', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年10月23日', '长期', '', '', '', '91110111MA01N93K07', '', '清洁服务；建筑清洁服务；家庭劳务服务；园林绿化服务；租摆花卉；物业管理；酒店管理；出租商业用房；专业承包；劳务分包；家居装饰及设计；安装、维修、租赁机械设备、家用电器、空调制冷设备；技术开发、技术转让；水污染治理；大气污染治理；固体废物污染治理；销售家用电器、空调制冷设备、日用杂品、清洁用品、五金交电（不含电动自行车）、电气设备、建筑材料、装饰材料、苗木、花卉、塑料制品、厨房用具、卫生间洁具。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京万通清洁服务有限公司是于2019年10月23日，经工商注册，属合法、正规、专业化的大型保洁服务公司。公司所有部门经理及技术培训人员都是集聚各人事部门的精英而组成，无论从业务、技术、用人等各方面都是绝对一流的。公司选用先进保洁设备和进口环保药剂，专为社区，别墅，医疗机构，无菌车间、写字楼，保洁，超市等提供专业的保洁清洗服务，工程设备运行，绿化，化粪池清掏管道疏通，内外墙粉刷清洗，工程开荒，地毯清洗，地板打蜡，石材病变处理，杀虫，消毒等系列保洁服务。具备承揽大中型工程所有资质和能力。\n我公司现在有总经理1名、副总经理2名、工程技术管理人员15余名。员工223名，专业培训技师2名，以及拥有多台先进施工设备的大公司。为了紧跟国际环保领域的发展趋势和管理模式。公司为健全管理机制同时设立 了人事部，市场部，工程部，绿化部，高空外墙作业部，单位定点保洁部和家庭居室保洁等部门，实行专人专管，做到专业细化，管理细化。    服务类行业的发展和生存的基本条件是专业。我们深刻理解客户对专业保洁的需求。为了参与激烈的市场竞争。我们\n坚持把对员工的专业技能培训和素质培养放在首位。我们的每名员工都是健康、', '116.015969', '39.705970000000001', '116.015969', '39.705970000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3276', '北京浩沣信达消防技术有限公司', '1424', '廖晓丽', '', '廖晓丽', '18600884775', '2013年01月09日', '1018万元', '北京市', '北京市', '大兴区', null, '北京市大兴区金苑路26号1幢2层219室', '北京市', '北京市', '大兴区', '观音寺街道', '北京市大兴区金苑路26号1幢2层219室', '', '建筑防火', '有限责任公司（自然人独资）', '2013年01月09日', '2033年01月08日', '', '', '', '91110115059205721K', '', '技术开发、转让、咨询、服务；销售消防器材、建筑材料、装饰材料、机械设备、五金产品（不含电动自行车）、金属制品；专业承包；劳务分包；施工总承包；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京浩沣信达消防技术有限公司，成立于2013年1月9日，注册资本1018万元，公司具有消防设施工程专业承包贰级、电子与智能化工程专业承包贰级、建筑机电安装工程专业承包叁级资质。公司经济实力与技术实力雄厚，公司现有职工60余名，各种专业技术人员30多人，其中国家认定的壹级项目经理6人，贰级项目经理2人，公司中高级职称的工程技术和工程管理人员共20余人。公司恪守“质量第一、客户至上”的服务宗旨，遵循“优质、高效、团结、奉献的工作态度，为社会创造优质精品工程。', '116.36066', '39.758966999999998', '116.36066', '39.758966999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3277', '北京合祥立业保洁服务有限公司', '1420', '郭小雄', '', '郭雄', '13651232014', '2009年06月26日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区东管头村289号乔金桥招待所211房间', '北京市', '北京市', '丰台区', '太平桥街道', '北京市丰台区东管头村289号乔金桥招待所211房间', '', '烟道清洗', '有限责任公司（自然人独资）', '2009年06月26日', '2029年06月25日', '', '', '', '91110106691696026C', '', '保洁服务；清洁服务；销售化妆品、日用品、五金交电、化工产品（危险品除外）、建筑材料；装饰设计；园林绿化服务；会议服务；图文设计、制作；信息咨询（中介除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京合祥立业保洁服务有限公司', '116.316078', '39.863103000000002', '116.316078', '39.863103000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3278', '北京东方京安消防工程有限公司', '1418', '王绍华', '', '姜建强', '13801126779', '2008年04月15日', '6358万元', '北京市', '北京市', '丰台区', null, '北京市西城区马连道南街6号院1号楼6层6B-15号', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区万丰路300号主楼7层', '', '建筑防火,消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2008年04月15日', '2046年04月14日', '', '', '', '911101026742671233', '', '专业承包；销售机械设备、消防器材、五金交电、化工产品（不含危险化学品）；工程设计；工程咨询；设备租赁；技术服务；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我司成立于2008年04月，公司类型为有限责任公司，注册资金6358万元。具有消防设施工程专业承包壹级、建筑智能化工程专业承包贰级、机电设备安装工程专业承包叁级资质、中华人民共和国消防技术服务机构资质、高新技术企业证书。我司作为中国消防协会会员单位，在业内已通过ISO9001质量体系认证、ISO14001环境管理体系认证、B/T28001职业健康安全管理体系认证、信用AAA信誉等级证书，是工会企业单位，根据相关部门规定我司积极配合并在开户银行开具农民工保函，以保障农民工工资的合法权益。公司主要由32个项目部组成，成员约1120名。其中管理层占比18%，技术负责人占比11%，八大员综合占比25%，其余人员占比46%；本科生及以上学历占比56%；一级建造师占比13%。公司自成立以来曾获得以下奖项：“八一电影制片厂第三期经济适用住房（消防）工程”荣获2010年度北京市建筑长城杯工程银质奖；“总政歌舞团万寿寺公寓区翻扩（消防）工程”荣获2014年底建筑长城杯金质奖；“309医院门诊楼改扩建（消防系统）工程”荣获2015年度建筑长城杯金质奖。', '116.293845', '39.869529999999997', '116.293845', '39.869529999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3279', '跨越时代清洁服务（北京）有限公司', '1417', '刘自付', '', '刘自付', '13716704321', '2016年06月23日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区东高村镇赵家务西路196号', '北京市', '北京市', '平谷区', '东高村镇', '北京市平谷区东高村镇赵家务村西路196号', '', '烟道清洗', '有限责任公司（法人独资）', '2016年06月23日', '2046年06月22日', '', '', '', '91110117MA006ELA34', '', '保洁服务；建筑物清洁服务；家庭劳务服务；技术开发及转让；技术咨询与服务；销售日用品、办公用品、化工产品、机械设备、电子产品、家用电器、厨卫用具。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '跨越时代清洁服务（北京）有限公司办公室地址位于中国的首都，政治、文化中心北京，北京 北京市平谷区东高村镇赵家务西路196号，于2016年06月23日在平谷分局注册成立，注册资本为100万元人民币，在公司发展壮大的3年里，我们始终为客户提供好的产品和技术支持、健全的售后服务，我公司主要经营保洁服务；建筑物清洁服务；家庭劳务服务；技术开发及转让；技术咨询与服务；销售日用品、办公用品、化工产品、机械设备、电子产品、家用电器、厨卫用具。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。，我们有好的产品和专业的销售和技术团队，我公司属于北京其他服务业黄页行业，如果您对我公司的产品服务有兴趣，期待您在线留言或者来电咨询', '117.091016', '40.084322999999998', '117.091016', '40.084322999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3280', '北京静瑞雅环保科技有限公司', '1415', '尤兴荣', '', '方容', '13581959138', '2015年04月03日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区卓秀北街10号院5号楼12层1211', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区卓秀北街10号院5号楼12层1211', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年04月03日', '2035年04月02日', '', '', '', '911101063355505657', '', '技术开发、技术服务；专业承包；劳务分包；清洁服务；销售日用品、清洁用品、五金交电、建筑材料、工艺品、电子产品、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京静瑞雅环保科技有限公司成立于2015年4月，是一家专业油烟防火清洗服务公司。从事厨房排油烟系统清洗、油烟净化升级改造、厨房设备安装维修等，竭诚为用户提供最优质的专业化服务。\n主要立足服务于房山本地市场，拥有雄厚的技术力量和先进的机械设备，施工作业专业环保、高效优质的规范化的专业公司。', '116.181557', '39.728881999999999', '116.181557', '39.728881999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3281', '北京朝力德厨房设备有限公司', '1407', '张恩朝', '', '张恩朝', '15911012651', '2019年04月15日', '50万元', '北京市', '北京市', '延庆区', null, '北京市延庆区井庄镇张伍堡村30号', '北京市', '北京市', '延庆区', '延庆镇', '北京市延庆区人合家和建材城一号门面', '', '烟道清洗', '有限责任公司（法人独资）', '2019年04月15日', '长期', '', '', '', '91110229MA01JG3M4H', '', '零售厨具卫具、日用品、卫生用品、文化用品、体育用品、一类医疗器械、家用电器、电子产品、五金、机械设备、安全技术防范产品；租赁机械设备；清洁服务；技术开发；施工总承包、专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京朝力德厨房设备有限公司成立于2019年04月15日，注册地位于北京市延庆区井庄镇张伍堡村30号，法人代表为张恩朝。经营范围包括零售厨具卫具、日用品、卫生用品、文化用品、体育用品、一类医疗器械、家用电器、电子产品、五金、机械设备、安全技术防范产品；租赁机械设备；清洁服务；技术开发；施工总承包、专业承包、劳务分包。  专业的油烟管道清洗单位，欢迎广大客户咨询。', '116.06490100000001', '40.426504000000001', '116.00546300000001', '40.453964999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3282', '北京泰合安消防科技有限公司', '1406', '王艳领', '', '闫冬雪', '18210050289', '2009年11月27日', '500.0001万元', '北京市', '北京市', '丰台区', null, '北京市丰台区纪家庙8号21号楼528号', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区纪家庙8号21号楼528号', '', '建筑防火,消防设施,电气防火,消防安全检查', '有限责任公司（自然人投资或控股）', '2009年11月27日', '2029年11月26日', '2018/11/21', '2019/11/20', '京消协（2018）证字382号', '911101066977070216', '', '技术推广；技术检测；设备维修；销售建筑材料、汽车配件。(依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。)', '北京泰合安消防科技有限公司成立于2009年11月27日，注册资金500余万元，主要从事建筑消防设施维护年度检测、验收及维护保养。\n\n公司经北京消防协会专家评审委员会评审通过，认定为具备建筑消防设施检测技术服务质量保障体系单位、具备电气防火检测技术服务保障体系单位。技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，提供公正、科学、优质、高效和真实的检测报告。\n\n我公司拥有一批老中青相结合的技术骨干，具有国家高、中级专业技术职称和中专以上学历的技术人员占职工总数的 75%以上，经北京市消防协会专业考核后在全市范围内从事电气检测和消防检测。\n公司技术力量雄厚，引进先进的高科技检测仪表、仪器，并拥有一批多年从事消防安全工作的工程技术人员，全部持证上岗。凭借经验丰富的管理队伍、雄厚的专业人才基础、科学严谨的质量保证体系、扎实的施工技术力量、先进的施工技术设备，公司先后承揽了北京市多项消防检测工程，并均受到工程项目各方的好评。为了保证检测工程质量，公司完善了各项规章制度，制定了适合自己的服务方针、员工行为准则、人员培训制度、设备管理制度，以', '116.33436399999999', '39.847138999999999', '116.33436399999999', '39.847138999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3283', '北京中公教育科技有限公司', '1405', '王振东', '', '刘伟', '13381155646', '2010年02月04日', '9000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区学清路38号B座9层911室', '北京市', '北京市', '海淀区', '学院路街道', '北京市海淀区学清路38号B座9层911室', '', '宣传教育培训', '有限责任公司（法人独资）', '2010年02月04日', '长期', '', '', '', '91110108551426892J', '', '教育技术咨询、技术开发、技术服务、技术推广、技术转让；教育咨询；文化咨询；企业管理咨询；企业投资咨询；计算机技术培训（不得面向全国招生）；公共关系服务；承办展览展示活动；组织文化艺术交流活动（不含演出）；会议服务；人力资源服务；经营电信业务；出版物零售；出版物批发。（企业依法自主选择经营项目，开展经营活动；人力资源服务、经营电信业务、出版物零售、出版物批发以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中公教育科技有限公司成立于2010年。公司创始人团队于1999年开始创业，经过近20年的创业积累，快速带领公司成为国内领先的职业就业培训综合服务提供商，每年培训学员超过230万人。\n截至2019年上半年，公司在全国31个省市、319个地市建立了880家直营分部和学习中心。公司共有员工30790余名，拥有11604名全职教师，1946名专职研发人员。\n近年来，随着核心业务竞争力的不断提升，公司的平台价值与综合运营能力不断提升并在业内处于领先地位，公司积极进入了消防类考试、财经类考试和IT等多个职业就业培训新领域。\n公司定位于职业就业培训服务，坚持“做善良的人”的核心价值观，紧随城镇化及劳动力职业化的社会经济趋势，用知识和科技的力量服务大学毕业生和职业化就业人群，帮助他们提升寻求更好工作所需要的就业素养与知识能力，最终成就他们良好的职业生涯。公司获得了航天产业基金等风险投资机构的投资。\n公司在创造商业价值的同时，高度重视履行企业社会责任，通过慈善捐款、资助贫困大学生、建立社会企业等多种形式，让更多人分享到经营的成果。', '116.354114', '40.001724000000003', '116.354114', '40.001724000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3284', '三人万物教育科技（北京）有限公司', '1404', '张萌', '', '于允', '18600261568', '2018年08月14日', '5000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高井文化园路8号东亿国际传媒产业园区元君书苑F1号楼1层105室', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高井文化园路8号东亿国际传媒产业园区元君书苑F1号楼1层105室', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年08月14日', '2048年08月13日', '', '', '', '91110105MA01E2LH2M', '', '技术推广服务；计算机信息服务；软件开发；数据处理（数据处理中的银行卡中心、PUE值在1；5以上的云计算数据中心除外）；基础软件服务；应用软件服务（不含医用软件）；经济贸易咨询；会议服务；承办展览展示活动；设计、制作、代理、发布广告；公共关系服务；企业管理咨询；教育咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '三人万物教育科技（北京）有限公司， 成立于2018年8月简称“三人教育”，从事消防类咨询服务业务，客户遍及中国各大中型城市，目前累计培训学员上千余人次。\n公司业务方向：目前主营一级消防工程师咨询服务，与数家消防单位合作，力求为学员提供完整的在线学习平台，让更多学员在师资匮乏小城镇乡村，通过互联网获取到优质师资和学习内容。成立之初不断吸引了来自北京交通大学，北京林业大学等工程系专业老师的加入，现教研主干团队已达到8人，硕博级以上占到80%以上。\n公司理念：秉承着“一生二，二生三，三生万物”的公司核心文化，帮助所有学员通过职业资格考试，找到自己的职业生涯方向。', '116.538381', '39.913210999999997', '116.538381', '39.913210999999997', '', null, null, null, null);
