INSERT INTO `t_fc_company` VALUES ('3291', '北京人文鑫诚厨房设备有限公司', '1395', '庞仁文', '', '庞仁文', '13718559591', '2016年10月25日', '600万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区桥梓镇兴桥大街1号南楼203室', '北京市', '北京市', '怀柔区', '桥梓镇', '北京市怀柔区桥梓镇兴桥大街1号南楼203室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年10月25日', '长期', '', '', '', '91110116MA00920M1R', '', '销售厨房用具、专用设备、金属制品、通用设备、五金交电、服装、化工产品（不含危险化学品及易制毒品）、日用品、办公用品、家用电器；技术开发、技术推广、技术转让、技术咨询、技术服务；机械设备清洗服务；房屋的清扫、消毒；建筑物清洁服务；承办展览展示活动；办公室保洁服务；家庭劳务服务；施工总承包、专业承包、劳务分包；物业管理；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\n北京人文鑫诚厨房设备服务有限公司成立于2016年，是从事厨房烟道清洗、中央空调清洗、地毯清洗；销售厨房设备，厨房用品，及厨房设备的维护与保养的综合性服务公司，注册资金 600万元；\n 本公司主要是排油烟管道清洗服务的企业，综合素质高，技术过硬。自入行至今，我公司在合作客户中未出现过由于我方清洗质量引发的烟道火灾。\n\n企业文化：厚德载物，行胜于言，科学发展，自主创新；打造满意服务，成就健康财富。\n设备特性：国际领先水准、智能化程度高、工作效率快、洁净度达标、安全性强、设备耐用性好。\n资源优势： 科研氛围，信息交流，政策导向等人文资源得天独厚。数十位高端技术人才的人力资源，具有规模化发展的资本优势资源。\n    我们具备：公司具有一流的管理团队，雄厚的技术力量和一支庞大的经过专业培训考核、管理严格的清洁清洗队伍，设有技术培训基地，手册式的操作模', '116.57381599999999', '40.290222', '116.57381599999999', '40.290222', '', null, null, null, null);
