INSERT INTO `t_fc_company` VALUES ('3293', '北京亿都嘉美环保科技有限公司', '1392', '姬腾振', '', '姬腾振', '13521555202', '2019年06月26日', '100万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区科创五街38号院1号楼C座4层C4179号', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区科创五街38号院1号楼C座4层C4179号', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年06月26日', '2039年06月25日', '', '', '', '91110302MA01L23N51', '', '环保技术推广服务；清洁服务；家庭服务（不符合家政服务通用要求不得开展经营活动）；销售消防器材、机械设备、电气设备、厨房用具、卫生间用具、装饰材料、建筑材料；技术开发、技术咨询、技术服务、技术转让、技术推广；城市生活垃圾清扫、收集、运输、处理（仅限餐厨（含废弃油脂）垃圾处理、厨余垃圾处理、建筑垃圾消纳）。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京亿都嘉美环保科技有限公司是一家年轻、充满朝气、具有法人资格的专业性环保公司。我司面向社会，竭诚为为各机关单位、饭店、食堂、宾馆、酒店、写字楼、娱乐场所等提供全方位的清洗保洁服务，建筑物清洗服务、办公室保洁服务、家庭劳务服务、机械设备专业清洗服务、生活清洗消毒服务；销售灭火器材、制冷设备、环保设备、净化器除尘设备、销售厨卫用具（液化气钢瓶除外）、装饰材料、建筑材料等各种服务。\n我司采用专业清洁设备及清洁制剂，具备承揽大型工程所具备的设备及施工能力，可以为不同领域客户提供全方位的满意服务。作为北京消防协会的会员单位，我司一贯遵循“客户至上、至诚至信”的服务理念，坚持高定位、高质量、高效率的“三高”服务标准。经过多年的发展与积累，我司拥有一批具有严格专业素质的管理及施工人员，赢得广大客户的一致好评，在业内树立了良好的口碑。\n科学的经营理念是我公司成功的保障，“客户至上，信誉第一”是我司赖以发展的宗旨。我公司将继续以一流的质量、优惠的价格、周到热情的服务为广大客户提供更专业的保洁服务，热烈欢迎社会各界朋友光临本公司洽谈业务。\n期待与您的握手，愿我们的握手真挚而有力！', '116.532681', '39.802630999999998', '116.532681', '39.802630999999998', '', null, null, null, null);
