INSERT INTO `t_fc_company` VALUES ('3295', '北京力升高科科技有限公司', '1388', '罗万贵', '', '李曼', '18610501360', '2017年08月02日', '1000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区中关村东路1号院3号楼11层1109', '北京市', '北京市', '海淀区', '学院路街道', '北京市海淀区中关村东路1号院3号楼11层1109', '', '消防产品', '有限责任公司（自然人投资或控股）', '2017年08月02日', '2067年08月01日', '', '', '', '91110108MA00GQ857U', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；计算机系统服务；基础软件服务；应用软件服务；软件开发；产品设计；模型设计；包装装潢设计；工艺美术设计；电脑动画设计；企业策划；设计、制作、代理、发布广告；市场调查；企业管理咨询；自然科学研究与试验发展；工程和技术研究试验发展；农业科学研究试验发展；医学研究试验发展；数据处理（数据处理中的银行卡中心、PUE值在1.5以上的云计算数据中心除外）；销售自行开发后的产品、计算机、软件及辅助设备、电子产品、机械设备、安全技术防范产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京力升高科科技有限公司成立于2017年8月，是一家致力于为国家重要行业领域提供特种机器人综合技术解决方案的高新技术企业。公司拥有雄厚的研发实力，具有突出的技术创新优势。公司积极响应国家科技导向和安全政策，以颠覆性机器人产品为核心，以泛在网技术为枢纽，为国家应急安全领域提供先进的安全保障和技术支撑。目前公司耐高温机器人系列产品已装备多家消防单位，并多次参加消防应急演习任务，获得一致好评。', '116.32928800000001', '39.995323999999997', '116.32928800000001', '39.995323999999997', '', null, null, null, null);
