INSERT INTO `t_fc_company` VALUES ('3298', '北京鑫厨万佳厨房设备有限公司', '1383', '陈帝致', '15701328760', '庞思博', '18171897405', '2008年12月04日', '5018万元', '北京市', '北京市', '大兴区', null, '北京市大兴区黄村镇天堂河纬四路西庄工业区1-3幢', '北京市', '北京市', '石景山区', '五里坨街道', '北京市石景山区隆恩寺路99号院', '', '消防设施,烟道清洗', '有限责任公司（自然人投资或控股）', '2008年12月04日', '2028年12月03日', '', '', '', '91110115683595663T', '', '销售日用百货、厨房设备、不锈钢制品、酒店用品、机械设备、办公用品、文化用品、健身器材、体育用品、电子产品；餐饮管理；货物进出口；技术进出口；燃气灶具的安装及维修；专业承包；技术开发、推广、咨询、服务、转让；产品设计；加工厨房设备、不锈钢制品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫厨万佳科技有限公司成立于2009年，是国内领先的厨房设备公司，高品质、性价比备受市场认可。公司位于北京市石景山区隆恩寺路99号院，占地面积约15000平米，拥有员工120余人，具有各种高中级职称技术人员21人，拥有先进的数控设备。为迎合市场需求， 北京鑫厨万佳科技有限公司自2009年起开始从事油烟净化设备的研发与生产，致力于打造最先进、最实用、最有保障的环保科技设备品牌。公司坚持“品质第一，服务至上”的宗旨，为大型酒店、政府机关和企业食堂提供过科学合理的排烟设计安装，咨询服务。', '116.361743', '39.668613000000001', '116.12482', '39.975389999999997', '', null, null, null, null);
