INSERT INTO `t_fc_company` VALUES ('3300', '北京鸿远科蓝环保科技有限公司', '1381', '贾凤艳', '13911237152', '贾凤艳', '13911237152', '2019年11月06日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-A464', '北京市', '北京市', '房山区', '城关街道', '北京市房山区城关街道顾八路1区1号-A464', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年11月06日', '2049年11月05日', '', '', '', '91110111MA01NHPH89', '', '环保技术开发、技术咨询（中介除外）、技术转让、技术服务；基础软件服务；应用软件服务；组织文化艺术交流活动（演出除外）；计算机系统服务；租赁机械设备；企业管理；市场调查；经济贸易咨询、企业管理咨询（中介除外）；企业策划、设计；设计、制作、代理、发布广告；承办展览展示；会议服务；旅游咨询；翻译服务；公共关系服务；劳务分包；销售五金交电（不含电动自行车）、建筑材料、机械设备、装饰材料、机电设备、工艺美术品、日用杂品、保温材料、消防设备、通讯器材（卫星接收设备除外）、仪器仪表、金属材料、空调制冷设备；施工总承包；专业承包。（企业依法自主选择经营项目，开展经营活动；施工总承包、专业承包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司北京鸿远科蓝环保科技有限公司，成立于 2019年11月6日，位于北京市房山区城关街道顾八路1区1号-A464， 是一家专业做清洁的企业单位。我公司拥有相关专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.01599', '39.705970000000001', '116.01599', '39.705970000000001', '', null, null, null, null);
