INSERT INTO `t_fc_company` VALUES ('3302', '亚伯兰环保科技（北京）有限公司', '1379', '李海', '13701003384', '张志芳', '18516955623', '2017年05月03日', '1000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区空港工业区B区裕华路28号2幢2层A203室', '北京市', '北京市', '顺义区', '空港街道', '北京市顺义区空港工业区B区裕华路28号2幢2层A203室', '', '消防信息化,烟道清洗', '有限责任公司（自然人投资或控股）', '2017年05月03日', '2067年05月02日', '', '', '', '91110105MA00E9QQ60', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；技术进出口、货物进出口、代理进出口；安装、租赁、维修机械设备；施工总承包；委托加工；销售机械设备、化工产品（不含危险化学品及一类易制毒危险品）、电子产品、专用设备、通讯器材、仪器仪表。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '亚伯兰环保科技（北京）有限公司是一家专业的、面向全国的餐饮业油烟污染治理物联网综合解决方案的服务商。致力于餐饮业油烟污染的终极解决方案的技术研发、产品开发、生产、销售及服务。在油烟污染治理领域深耕25年，多次研发出颠覆行业内的革命性成果。\n\n公司拥有多项自主知识产权的核心技术及产品：创新型的专利的油烟净化系统、油水分离回收系统、油烟在线监测系统等构成的餐饮油烟污染治理物联网解决方案，构建了污染治理、油品回收再利用、在线监测管理、大数据运营、投资模式创新的全产业链服务模式。\n\n2005 年研发试验成功全世界第一台油烟管道清洗机器人；\n2014年研发成功动态拦截式油烟净化器，彻底解决油烟污染 问题；\n2016年联合中国科技大学科研团队研发油烟在线监测系统，物联网技术在环保领域的具体应用，是智慧城市建设的重要组成部分。', '116.55245600000001', '40.095008', '116.55245600000001', '40.095008', '', null, null, null, null);
