INSERT INTO `t_fc_company` VALUES ('3304', '中泰民安安全服务集团有限公司', '1377', '赵性仓', '13911286333', '安波', '18910907078', '2005年10月21日', '5000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区春和路39号院1号楼C座906', '北京市', '北京市', '大兴区', '西红门地区办事处', '北京市大兴区春和路39号院1号楼C座906', '', '建筑防火,消防设施,宣传教育培训,消防信息化,消防产品,电气防火,灭火救援,烟道清洗,消防安全评估', '有限责任公司（自然人投资或控股）', '2005年10月21日', '2025年10月20日', '', '', '', '911101157817313581', '', '安全防范技术服务；市场调查；企业管理；企业形象设计；影视策划；电脑动画设计；图文设计、制作；摄影服务；市场调查；翻译服务；劳务服务；劳务分包；保洁服务；技术开发、咨询、服务、转让；软件开发；计算机系统服务；舞台灯光音响设计；汽车装饰；汽车租赁（不含九座以上客车）；园林绿化管理；园林绿化工程；从事机动车公共停车场的经营管理；物业管理；餐饮管理；酒店管理；销售通讯器材、消防器材、安全技术防范产品、计算机、软件及辅助设备、电子产品、机械设备；农业科学研究和试验发展；农业观光；电影发行；电影摄制；广播电视节目制作；从事互联网文化活动；互联网信息服务；演出经纪。（企业依法自主选择经营项目，开展经营活动；演出经纪、电影发行、从事互联网文化活动、互联网信息服务、广播电视节目制作、电影摄制以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中泰民安安全服务集团有限公司于2005年成立，集团公司旗下8家子公司、33家分公司、1所安防学校。拥有包括工程院院士、三维仿真专家、军事专家以及从事20余年安保行业的资深专家等组成的精英团队，并聘请著名军事专家、首席品牌战略师、安防理论博士、公安大学安防理论教授、装备工程学院教授等组成知名顾问团队。在科技安防、智能安防、软件开发、影视制作、特勤护卫、应急处突、指挥调度等方面不断取得进步。\r\n总部位于大兴国家新媒体产业基地，涉及系统集成、技术开发、传媒、安保、农业等多个行业，并成为中国保安协会会员单位、北京市安防协会副理事长单位、北京市保安协会会员单位、森林防火及装备国家创新联盟会员单位、中国林业机械协会会员单位。\r\n公司坚持秉承军民融合的发展理念，科技创新的科研态度，包容奉献的媒体精神，为军民客户解决高新技术开发应用，为行业客户解决智能生态构建，为企业客户建立企业品牌战略和顶层战略设计，为弘扬民族优秀文化发挥新传媒的领先优势。并承担北京市大兴区人民武装部民兵应急分队、北京市红十字会应急救护培训基地、北京众合平安消防技能培训学校新机场分校、北京鹰翔保安培训中心等培训任务。', '116.35976700000001', '39.772652999999998', '116.35976700000001', '39.772652999999998', '', null, null, null, null);
