INSERT INTO `t_fc_company` VALUES ('3313', '北京中泰佳环保科技有限公司', '1366', '李海娜', '13811560668', '王金富', '13681511682', '2007年05月14日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区小井村296号', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区小井村296号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2007年05月14日', '2027年05月13日', '2017/7/26', '2018/7/25', '京消协（2017）证字1145号', '91110106662174034C', '', '技术开发；保洁服务；家庭服务；销售厨房设备、日用品、机械设备、电子产品。【经营范围中未取得专项许可的项目除外】(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京中泰佳环保科技有限公司专业从事通风管道，空调管道，焊烟除尘，消音除尘工程设计、生产安装、厨房排烟管道油烟清洗，调试服务为一体的专业制作中心。我们严格执行国家相关标准，质量第一，用户第一，为您提供高质量的产品和服务。 \n      我们在通风工程安装上也有很深的造诣，在通风管道，空调管道，建筑通风排气系统、消防排烟系统、中央空调通风系统、厨房油烟净化器系统、厂房通风净化、除尘集尘系统、环保通风设备系统、涂装排尘设备系统、补气通风增压系统、防爆消音系统、环境治理系统等工程上深受新老用户的信赖。\n为了满足新老客户要求，不断完善更加有效的管理体系，不断创新，不断前进。公司计划在2014年成立管道清洗队伍。到时将为广大客户提供最优质的产品、最优惠的价格、以及最周到的服务。 竭尽全力为您提供最完美的服务。', '116.295894', '39.878661000000001', '116.295894', '39.878661000000001', '', null, null, null, null);
