INSERT INTO `t_fc_company` VALUES ('3315', '北京品格保洁服务有限公司', '1363', '张具飞', '13661088466', '贾德保', '13011009687', '2010年05月11日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区赵全营镇牛板路板桥段43号', '北京市', '北京市', '顺义区', '赵全营镇', '北京市顺义区赵全营镇牛板路板桥段43号', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年05月11日', '2040年05月10日', '2018/11/9', '2019/11/8', '京消协（2018）证字354号', '911101135548400011', '', '保洁服务；物业管理；施工总承包、专业承包、劳务分包；城市园林绿化施工；园林景观设计；维修机械设备、办公用品；销售化工产品（不含危险化学品及一类易制毒化学品）、机械设备、厨房卫生间用具、塑料制品、日用品；道路货物运输。（道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '保洁服务，物业管理，施工总包，专业成包，劳务分包，城市园林绿化施工，园林景观设计，维修机械设备，办公用品，日常保洁，开荒保洁，烟道清洗，卫生消杀等', '116.51090600000001', '40.210329000000002', '116.51090600000001', '40.210329000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3316', '航天海鹰安全技术工程有限公司', '1361', '高志国', '01068375976', '白文生', '15901178901', '1992年11月23日', '10855万元', '北京市', '北京市', '丰台区', null, '云岗西路7号', '北京市', '北京市', '丰台区', '云岗街道', '云岗西路7号', '', '建筑防火', '其他有限责任公司', '1992年11月23日', '长期', '', '', '', '914600006200100585', '', '承接各类建筑智能化工程的设计和施工；各类消防设施工程的设计和施工；消防设施的维修保养及检测；机电安装工程施工；安防工程的设计和施工；计算机网络集成的设计和施工；计算机软硬件开发；技术开发、技术咨询、技术转让、技术服务；建筑装饰装修工程的施工；光伏发电项目EPC总承包业务；自有房屋租赁；进出口贸易；产品研发、代理、制造和销售；供水服务、供电服务、供暖服务、排水服务；售电服务；信息系统集成及咨询服务；职业卫生技术服务、安全生产技术服务；环境保护检测、咨询及治理；节能技术推广；科技中介服务；安全环保相关人员培训；市政工程、节能环保工程；工程勘察设计；机电设备设施运维；电气试验。', '航天海鹰安全技术工程有限公司成立于1992年，公司控股股东是中国航天科工集团第三研究院，注册资金10855万元。\n公司主营业务包括机电系统集成、智慧产业、节能环保、职业病危害评价、设备设施运维、国际工程承包，动力系统（包括供水、供暖、供电、污水处理）规划、设计、建设、运营与管理。\n公司秉承先进的航天军工技术，在机电系统集成、智慧管廊（网）、动力系统建设、消防工程、安防工程、职业卫生技术服务、职业病危害评价等领域具有行业领先的专业实力。公司拥有机电设备安装工程专业承包壹级，消防设施工程专业承包壹级，建筑智能化工程专业承包壹级，安防工程企业设计施工维护壹级，消防设施专项工程设计甲级，建筑智能化系统集成专项工程设计甲级等资质。\n公司在北京奥运安保系统项目、北京水立方消防弱电工程、海南三亚凤凰机场消防自动报警项目、哈尔滨智慧管廊、内蒙古赤峰智慧管廊、广西南宁智慧管廊、德州地下管线综合管理试点项目、北控智慧水务项目、中粮大悦城智能化工程、贵州赫章天网工程、新疆吉木萨尔光伏电站项目、宁波象山平安城市项目中，赢得了良好的声誉，并成功打入了国际市场。公司承建的多项工程获得国家鲁班奖、国家优质工程奖和省', '116.158901', '39.810313000000001', '116.158901', '39.810313000000001', '', null, null, null, null);
