INSERT INTO `t_fc_company` VALUES ('3318', '北京龙辰泉消防设备安装工程有限公司', '1359', '李霞', '', '王辉', '63702701', '2011年04月21日', '1700万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路188号十二区11号楼6层', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路188号十二区11号楼6层', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2011年04月21日', '2031年04月20日', '2019/1/11', '2020/1/10', '京消协（2019）证字003号', '91110106573194260T', '', '专业承包；施工总承包；劳务分包；劳务派遣；工程造价咨询；工程勘察设计；物业管理；家居装饰；技术咨询；企业管理服务；设计、制作、代理、发布广告；承办展览展示活动；销售计算机软件及辅助设备、五金交电、电子产品、机械设备、建筑材料、金属材料、化工产品；机械设备租赁；出租商业用房、办公用房。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京龙辰泉消防设备安装工程有限公司，位于北京市丰台区南四环西路188号总部基地，于2011年4月21日成立，系住建委及规划委核准的国家消防设施工程专业承包贰级资以及消防设施工程专项设计乙级资质，是全国消防行业中具备专业化、规模化、年轻化的企业之一，另荣获建筑装修装饰工程专业承包贰级、电子与智能化工程专业承包贰级等多项建筑行业贰三级资质的企业。\n公司拥有一支团结协作、素质过硬、技术一流、敢打硬仗的员工队伍，机械设备3500千瓦。为了满足消防工程施工需要，公司每年都组织一定数量的专业人员参加省、市组织的各种培训、学习、考试。员工全部持证上岗，90%以上拥有专业技术职称，大专以上学历占80%。\n公司始终把工程质量视为企业的生命，严格按照质量管理、环境管理、职业健康安全管理的标准规范工程作业。公司将一如既往，与时俱进，开拓创新，求实奋进，在这个航程上走得更快、更远。我们期待与您一起，共铸辉煌灿烂的美好明天。', '116.287819', '39.820630000000001', '116.287819', '39.820630000000001', '', null, null, null, null);
