INSERT INTO `t_fc_company` VALUES ('3321', '北京天恒安科集团有限公司', '1355', '杨金锋', '010-81297200', '李文婷', '13683611379', '2015年04月01日', '10000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区庞各庄镇瓜乡路10号3号楼1层', '北京市', '北京市', '大兴区', '庞各庄镇', '北京市大兴区庞各庄镇瓜乡路10号3号楼1层', '', '宣传教育培训', '有限责任公司（法人独资）', '2015年04月01日', '2035年03月31日', '', '', '', '9111011533554363X3', '', '工程技术咨询；技术开发、服务、转让、推广；技术检测；软件开发；企业管理咨询；企业形象策划；技术研究与试验发展；销售日用品、通讯设备、塑料制品、文具用品、电子产品、机械设备、仪器仪表；租赁建筑机械设备；市场调查；教育咨询（不含出国留学咨询及中介服务）；认证服务。（企业依法自主选择经营项目，开展经营活动；认证服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天恒安科集团有限公司主要从事安全评价、安全科技研发、安全技术咨询、安全培训、安全体验场馆EPC服务等业务。具有良好的线上、线下安全体验教育资源。其中，安全体验项目及装备研发、体验场馆设计建设及运营服务、体验式安全教育培训服务等在国内处于领先地位。\n集团公司自成立以来，始终专注于安全产业的研究和创新，与多家研究机构、院校联合开展课题研究，创建了一支高素质的科研、服务及管理团队，人力资源和技术力量雄厚。集团旗下有北京天恒世纪建筑设计咨询有限公司、北京金地正方建筑勘察设计有限公司等子公司，实现企业多元化发展战略目标。\n     作为新时代的创新型企业，在未来的发展中，我们将继续遵循“一切从安全出发”的理念，以优秀的团队、专业的技术、丰富的业务种类为国内外用户提供最优质的服务，充满激情的为社会做贡献。', '116.31165799999999', '39.620381000000002', '116.31165799999999', '39.620381000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3322', '深圳市安环技术有限公司', '1353', '洪洋', '0755-83251164', '洪楚望', '13602576769', '1995年04月04日', '800万元', '北京市', '北京市', '房山区', null, '深圳市南山区蛇口水湾村9排3号', '北京市', '北京市', '房山区', '拱辰街道', '房山区拱辰街道办事处二街村金花商业大厦', '', '烟道清洗', '有限责任公司', '1995年04月04日', '长期', '', '', '', '914403001923282886', '', '安全生产、环境保护相关的技术咨询、检测维护；劳保、环保产品的购销；排油烟系统、中央空调系统的上门清洗保洁服务（以上均不含法律、行政法规、国务院决定规定需前置审批和禁止的项目）', '深圳市安环技术有限公司于1995年4月4日经工商部门注册登记成立，注册资本800万元。经营范围：安全生产、环境保护相关的科技成果推广；技术咨询服务；废水、废气、噪声等环境污染物的治理项目的设计、施工、维保；排油烟设备（运水烟罩、排烟管道、排烟风机、油烟净化器）、中央空调（冷凝、冷却、风管、末端系统）及工业设备（锅炉、管道）的化学（物理）清洗及维修保养服务。\n公司技术力量雄厚、组织机构健全、员工队伍稳定、专业设施齐备、建安经验丰富、工程质量优秀、企业文化健康、商业信誉良好。在全国建立了东(上海）、南（深圳）、西（成都）、北（北京）、中（武汉）、5个区域清洗维保服务站，服务范围涉及全国所有大、中城市。公司成立20多年来，坚持遵章守法、诚信为本的经营理念；克守安全第一、质量致上的工程原则，使企业在环境工程领域稳步发展，清洗工程遍及全国，为国家的环境保护事业和工业清洗行业做出了一定的贡献，为客户的防火安全和设备保养提供了可靠的保障。', '116.142426', '39.732273999999997', '116.142426', '39.732273999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3323', '亿嘉鑫（北京）环保科技有限公司', '1352', '马昆明', '17319206987', '马昆明', '17319206987', '2019年09月11日', '100万元', '北京市', '北京市', '延庆区', null, '北京市延庆区延庆镇广积屯村278号02室', '北京市', '北京市', '延庆区', '延庆镇', '北京市延庆区延庆镇广积屯村278号02室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年09月11日', '长期', '', '', '', '91110229MA01MKLJ1J', '', '技术推广、技术服务；清洁服务；家庭服务；专业承包、劳务分包；维修通用设备；设计、制作、代理、发布广告；销售厨具卫具、五金、电子产品、日用品、化工产品（第一类中的非药品类易制毒化学品除外）、机械设备、服装、电气设备、消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '在居民生活水平，生活服务要求不断提高的情况下，不断的完善公司的保洁服务管理体系，不断提高保洁人员的工作素质水平，不断引进先进、环保、节能的保洁设备，以此来满足广大北京餐饮业，居民的生活和工作的保洁服务要求。亿嘉鑫（北京）环保科技有限公司以能为北京居民提供“高标准”的保洁服务为己任，并为北京保洁服务行业做出突出贡献而自豪！', '116.01141800000001', '40.483505999999998', '116.01141800000001', '40.483505999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3324', '北京玖弘建设有限公司', '1346', '王国红', '18601969666', '石李涛', '13363869038', '2016年12月07日', '5000万元', '北京市', '北京市', '昌平区', null, '北京市昌平区沙河镇兆丰家园10-8-106底商', '北京市', '北京市', '昌平区', '兴寿镇', '北京市昌平区小汤山御汤山东三区22', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年12月07日', '长期', '', '', '', '91110114MA00A9H63E', '', '施工总承包、工程勘察设计、专业承包、劳务分包；销售建筑材料、机械设备、五金交电；租赁机械设备；物业管理；清洗保洁；出租商业用房；技术开发、技术转让、技术服务；农产品仓储服务；道路货物运输。（企业依法自主选择经营项目，开展经营活动；道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京玖弘建设有限公司建立了健全的项目管理体系，通过了质量管理体系、环境管理体系、职业健康与安全管理体系标准认证，把管理至上、科技至上、服务至上作为驱动企业前进的动力，使玖弘建设具有行业精良的施工、设计能力，以适应市场变化和客户的多样化需求。\n为实现企业的百年愿景，玖弘建设将继续以高度的责任感和使命感，以充沛的激情和旺盛的斗志，为客户提供更加优质的产品与专业的服务，在与时俱进中不断筑牢企业的品牌根基。', '116.284122', '40.150835999999998', '116.395695', '40.186861999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3325', '北京国兴仁安消防科技有限责任公司', '1344', '李树宽', '18519791494', '李树宽', '18519791494', '2019年10月25日', '30万元', '北京市', '北京市', '通州区', null, '北京市通州区临河里1号楼1单元1621室', '北京市', '北京市', '通州区', '新华街道', '北京市通州区新华北路117号东方集贤写字楼1-169室', '', '宣传教育培训,消防产品', '有限责任公司（自然人投资或控股）', '2019年10月25日', '2049年10月24日', '', '', '', '91110112MA01NAN31B', '', '技术转让、技术推广、技术服务、技术开发、技术咨询；组织文化艺术交流活动；软件开发；基础软件服务；应用软件服务（不含医用软件）；计算机系统服务；零售文化用品、体育用品（不含弩）、工艺品（不含文物）、消防器材；工艺美术设计；文化咨询；教育咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京国兴仁安消防科技有限责任公司\n始于2019年10月， 北京国兴仁安消防科技有限责任公司所在地为通州国资委院内东方集贤写字楼。地处北京副中心区域，东临副中心政府机构和大运河森林公园，其独特的区域优势和交通展示了副中心广阔的发展前景和价值空间，诣在打造一个在首都让民众满意的消防应急产业！\n园区内均是各大影视、广告、传媒公司，饮食便利，工作氛围轻松愉悦，上班期间乘坐公交车到岳庄站下车，步行200米即可，独立的办公空间，激情活力的年轻团队，让您充满归属感。', '116.685925', '39.882247', '116.65655', '39.913051000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3326', '北京智汇火种教育科技有限公司', '1343', '王晓伟', '', '李云飞', '13366625619', '2018年04月03日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区怡和北路5号院4号楼7层701', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区怡和北路5号院4号楼7层701', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年04月03日', '2038年04月02日', '', '', '', '91110114MA01B74TXM', '', '技术推广、技术服务；教育咨询、经济贸易咨询、企业策划（不含中介服务）；电脑图文设计；设计、制作、代理、发布广告；组织文化艺术交流活动（不含演出）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '火种教育，是中国首批注册消防工程师和金融资格证书人才培训机构之一，主营业务有：基金从业资格证、证券基础考试、私募股权考试、一级注册消防工程师考试', '116.208647', '39.762940999999998', '116.208647', '39.762940999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3327', '北京杰明欣环保科技有限公司', '1341', '黎宙', '18610253039', '庞思博', '18171897405', '2001年09月27日', '500万元', '北京市', '北京市', '石景山区', null, '北京市石景山区红卫路1号', '北京市', '北京市', '石景山区', '五里坨街道', '北京市石景山区红卫路1号', '', '消防设施,烟道清洗', '有限责任公司（自然人投资或控股）', '2001年09月27日', '2021年09月26日', '', '', '', '911101078022978034', '', '环保设备的技术推广服务、技术开发、技术服务；销售专用设备、厨房用具、酒店用品、不锈钢制品、体育用品、建筑材料、电子产品；委托加工环保设备、专用设备；维修厨房用具、机械设备；燃气灶具安装、维修；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京杰明欣环保科技有限公司成立于2001年，是国内领先的厨房设备公司，高品质、性价比备受市场认可。公司位于北京市石景山区红卫兵路1号，占地面积约15000平米，拥有员工120余人，具有各种高中级职称技术人员21人，拥有先进的数控设备。为迎合市场需求，北京杰明欣环保科技有限公司自2009年起开始从事油烟净化设备的研发与生产，致力于打造最先进、最实用、最有保障的环保科技设备品牌。公司坚持“品质第一，服务至上”的宗旨，为大型酒店、政府机关和企业食堂提供过科学合理的排烟设计安装，咨询服务。', '116.127441', '39.974805000000003', '116.127441', '39.974805000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3328', '北京四季嘉业保洁服务有限公司', '1338', '张小刚', '15801010786', '张小刚', '15801010786', '2019年03月15日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳万兴路86号-N397', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区长阳万兴路86号-N397', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年03月14日', '2069年03月13日', '', '', '', '91110111MA01HQ9U4K', '', '清洁服务（不含洗车服务）；技术开发；技术转让；技术推广；技术服务；专业承包；园林绿化工程；园林绿化服务；园林绿化设计；家庭劳务服务；销售消防器材、清洁用品、厨房用具、卫生间洁具、装饰材料、建筑材料、化工产品（不含危险化学品）、日用杂品、办公用品、生物制剂（药品除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京四季嘉业保洁服务有限公司是一家年轻、充满朝气、具有法人资格的专业性 保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写字楼、娱乐场所等提供全方位的烟道清洗保洁服务，销售检测维修灭火器等消防安全服务包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清洗保洁服务。本公司采用专用清洁设备及清洁药剂，具备承揽大型工程所需的配 套设施及施工能力，可以为不同领域客户提供全方位的满意服务。 作为北京消防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具 有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了 良好的口碑。 科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是 本公司信赖以发展的宗旨。本公司将继续以一流的质量、优惠的价格、周到热情 的服务态度为广大客户提供更多、更好的清洁服务，并热诚欢迎社会各界朋友光临本公司洽谈业务。', '116.169729', '39.775677000000002', '116.169729', '39.775677000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3329', '北京世龙坤泰环保科技有限公司', '1337', '陈尔兵', '13910039347', '李玉华', '13601354204', '2019年11月15日', '500万元', '北京市', '北京市', '海淀区', null, '北京市海淀区清河西三旗东新都东站南27幢平房033', '北京市', '北京市', '海淀区', '西三旗街道', '北京市海淀区清河西三旗东新都东站南27幢平房033', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年11月15日', '2049年11月14日', '', '', '', '91110108MA01NPR89F', '', '技术服务、技术开发、技术转让；软件开发；物业管理；环境监测；技术检测；会议服务；电脑动画设计；承接展览展示活动；销售日用品、卫生用品、厨房用具、文化用品、电子产品；城市园林绿化；大气污染治理；水污染治理；建筑物清洁服务；厨房设备（抽油烟机等）的清洗；锅炉烟囱的清扫；房屋的清扫、消毒；害虫的防治服务；灭鼠及预防。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '是北京市政府采购服务单位，公司坚持规范管理，特色服务，严控质量。主营业务分为油烟管道清洗、保洁服务、及家政服务三大板块，业务范围涵盖：企事业单位、小区、大厦、酒店的常年保洁托管业务、大型建筑外墙清洗、油烟管道清洗，地毯清洗、地面清洗、石材翻新养护、大理石结晶、地板打蜡、展会保洁、日常保洁、物业管理服务、园林绿化工程、城市垃圾分类、物业保洁、企事业单位空调维修、企事业单位装修、开荒保洁、工程开荒等。', '116.367012', '40.064082999999997', '116.367012', '40.064082999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3330', '北京环球兴学科技发展有限公司', '1336', '伊贵业', '01062126633', '刘宁', '13581883237', '2003年11月24日', '1474万', '北京市', '北京市', '海淀区', null, '北京市海淀区知春路知春路7号致真大厦D座403室', '北京市', '北京市', '海淀区', '花园路街道', '北京市海淀区知春路知春路7号致真大厦D座403室', '', '建筑防火,宣传教育培训,消防信息化,消防安全评估', '其他有限责任公司', '2003年11月24日', '2023年11月23日', '', '', '', '91110108756728341R', '', '技术开发、技术服务、技术转让、技术推广、技术咨询；计算机技术培训；基础软件服务；应用软件服务；企业管理；市场调查；经济贸易咨询；投资咨询；会议服务；承办展览展示活动；电脑动画设计；翻译服务；设计、制作、代理、发布广告；销售自行开发后的产品、计算机、软件及辅助设备、文化用品、钟表、眼镜、箱包、婴儿用品、小饰品、礼品、体育用品、玩具；教育咨询（中介服务除外）；互联网信息服务不含新闻、出版、教育、医疗保健、药品和医疗器械、含电子公告服务（基础电信业务经营许可证有效期至2023年08月01日）；从事互联网文化活动；经营电信业务；图书批发、零售、网上销售(有效期至2022年4月30日止)。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、经营电信业务、互联网信息服务不含新闻、出版、教育、医疗保健、药品和医疗器械、含电子公告服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京环球兴学科技发展有限公司（品牌名：环球网校）成立于2003年，是国内较早一批的在线教育机构，专注于中国职业在线教育的资格考试培训和职业技能培训。16年间，环球网校不断壮大规模，拓宽培训领域，加强与相关部门、企业的合作，为各行各业源源不断地输送人才。\n（1）环球网校总部设在北京，此外，在天津、保定、邢台、无锡、广州、呼和浩特、乌鲁木齐、深圳拥有10家分公司，平均办公、学习场地达700平方米以上，全职员工总数达1000人以上，累计培训学员超过1000万人，年度营收达5亿元。\n（2）开设建工、消防安全、财经、医卫、外语、职业资格、教师公考、学历及IT技能等八大类上百个项目的网络辅导课程，在北京、天津、保定、上海、广州等地拥有几千平米的录课室、直播间和教室，可实现多个课程同时在线直播。\n（3）环球网校拥有900余人的教学、教研团队，由全职教研师资，权威专家、学者，重点高校离退休教授，以及企业内专业工作人员构成，保证项目培训、体系建设、课程开发的专业性。其中，全职教研师资400人，硕士及以上学历占比66%，兼职教研师资500余人。', '116.35124999999999', '39.977761000000001', '116.35124999999999', '39.977761000000001', '', null, null, null, null);
