INSERT INTO `t_fc_company` VALUES ('3335', '北京众成泽兴消防科技有限公司', '1329', '陆志刚', '010- 50689119', '张元元', '18910733176', '2019年06月20日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区房山马各庄村西南（厂区）135幢一层101室', '北京市', '北京市', '房山区', '城关街道', '北京市房山区房山马各庄村西南（厂区）1956创业园消防楼', '', '建筑防火,消防设施,宣传教育培训,电气防火,灭火救援,消防安全检查,消防安全评估', '有限责任公司（自然人投资或控股）', '2019年06月20日', '2049年06月19日', '', '', '', '91110111MA01KX9C2H', '', '技术推广；技术开发；技术咨询；技术转让；技术服务；软件开发；基础软件服务；应用软件服务；计算机系统服务；会议服务；包装设计；模型设计；承办展览展示活动；销售消防器材、日用杂品、家用电器、电子产品、安全防范技术产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我校坐落于北京市房山区马各庄1956创业园区内，占地千余平米，办学宗旨为全面贯彻党和国家的教育方针，遵守国家法律、法规，遵守社会道德风尚，致力于培养消防救援人才，补充社会专业救援能力，提高从业人员素质。配有各大教室供学生学习，教学设备配备齐全，学校为了给广大学员提供更高层次的学习平台，教学中采用多媒体教学方式，结合实际案例营造生动课堂。同时，我校为学员提供了优质的住宿条件，为大家创造和谐、安全、整洁、舒适的住宿环境，保证学员的生活和学习质量。', '116.01615099999999', '39.701521999999997', '116.01584', '39.700699999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3336', '赛诺创意（北京）科技发展有限公司', '1327', '贾大梅', '18210593966', '赵培', '13718317577', '2016年04月20日', '100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区四季青路8号7层732-4', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区四季青路8号7层732-4', '', '宣传教育培训', '有限责任公司（自然人独资）', '2016年04月20日', '2036年04月19日', '', '', '', '91110108MA004XB5X8', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；计算机系统服务；基础软件服务；应用软件服务；软件开发；软件咨询；产品设计；模型设计；包装装潢设计；教育咨询（中介服务除外）；经济贸易咨询；文化咨询；体育咨询；公共关系服务；会议服务；工艺美术设计；电脑动画设计；企业策划、设计；设计、制作、代理、发布广告；市场调查；企业管理咨询；组织文化艺术交流活动（不含营业性演出）；文艺创作；承办展览展示活动；影视策划；翻译服务；数据处理（数据处理中的银行卡中心，PUE值在1.4以上的云计算数据中心除外）；销售自行开发的产品、电子产品、通讯设备、文化用品、机械设备、化工产品（不含危险化学品及一类易制毒化学品）、五金交电（不含电动自行车）、安全技术防范产品；机械设备租赁（不含汽车租赁）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '简称SINOTEQ，公司致力于各行业和机构提供具有独特创意体验的软硬件产品及服务、技术开发、推广及合作。公司专注于防火安全教育领域，创造了世界先进的SIMFIRE便携式模拟灭火实训仪及系列防火安全教育类实训设备，并与众多合作伙伴共同探索和合作，在大众化防火技能实训服务中积累了丰富的技能教学经验及解决方案。公司推动智能化实训演练产品和服务的同时，在政府的鼓励指导下组建“SIMFIRE全民防火墙”公益行动，在各街道和企事业单位普及和推广初起火灾扑救技能，获得良好的社会口碑。', '116.27123400000001', '39.953758000000001', '116.27123400000001', '39.953758000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3337', '多易点教育科技（北京）有限公司', '1324', '张宝', '13716347672', '李跃辉', '18660832810', '2019年05月07日', '100万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区科创十三街29号院一区3号楼8层801-02', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区科创十三街29号院一区3号楼8层801-02', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2019年05月07日', '长期', '', '', '', '91110302MA01JYH293', '', '经营电信业务；零售出版物；广播电视节目制作；音像制品制作；从事互联网文化活动；技术开发、技术转让、技术推广、技术服务、技术咨询；软件开发；应用软件服务；计算机系统服务；基础软件服务；教育咨询；贸易咨询；销售文具用品、体育用品。（（企业依法自主选择经营项目，开展经营活动；经营电信业务、零售出版物、广播电视节目制作、音像制品制作、从事互联网文化活动以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。））', '北京多点教育，全称多易点教育科技（北京）有限公司，专注于职业技能培训，业务涵盖范围广泛如 一级消防工程师、一级建造师、健康管理师、初级经济师技能培训、学历提升等，致力于为广大职场人员提升职业技能和晋升渠道，拓宽就业选择，为社会培养更多优秀的职业技能人员。\n公司教育方向：目前主营职业证书，与数千家消防单位合作，主要提供咨询、培训、辅导等一系列服务。力求为学员提供完整的在线教育平台，形成完善的教育培训生态产业链，教育资源已轻松遍及全国各个城市，农村及偏远城镇。也让更多学员在师资匮乏小城镇乡村，通过互联网获取到优质师资和教育内容。成立之初不断吸引了来自北京交通大学，北京林业大学等工程系专业老师的加入，现教研主干团队已达到8人，硕博级以上占到80%以上，且均执一级消防工程师资格证书。', '116.55762199999999', '39.781027000000002', '116.55762199999999', '39.781027000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3338', '北京净无忧兄弟清洁环保科技有限公司', '1323', '郝占宝', '13901331605', '郝占宝', '13901331605', '2007年11月06日', '2000万元', '北京市', '北京市', '昌平区', null, '北京市昌平区小汤山镇沙顺路91号院3号4层416-1', '北京市', '北京市', '昌平区', '小汤山镇', '北京市昌平区小汤山镇沙顺路91号院3号4层416-1', '', '电气防火,烟道清洗', '其他有限责任公司', '2007年11月06日', '长期', '', '', '', '91110105669138490P', '', '技术开发、技术转让、技术咨询、技术服务；建筑物清洁服务；害虫防治服务；家庭劳务服务；房地产信息咨询、经济贸易咨询、企业管理咨询（不含中介服务）；市场调查；组织文化艺术交流活动（不含营业性演出）；承办展览展示活动；会议服务；包装装潢设计、电脑动画设计；设计、制作、代理、发布广告；销售电子产品、计算机、软件及辅助设备、医疗器械I类、钟表、家具、建筑材料、汽车配件、通讯设备、文化用品、体育用品、家用电器、机械设备、厨房用品、金属材料、音响设备、五金交电（不含电动车）、化工产品（不含危险化学品）、针纺织品、服装鞋帽、花、草、观赏性绿植；办公设备维修；租赁建筑工程机械设备、舞台设备；舞台美工；灯光音响；技术检测；专业承包、劳务分包；工程造价咨询；货物进出口、技术进出口、代理进出口；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京净无忧兄弟清洁环保科技有限公司于2007年11月6号成立，是工商管理机关注册的正规企业，注册资金为贰仟万元。公司主要承接排油烟设施清洗、电气防火检测、建筑物清洁服务、害虫防治服务、家庭劳务等服务项目。企业设备设施齐全，建立了完善的管理制度，制定了规范的业务操作流程、完善的员工培训制度和安全保障体系等。\n在意服务为本的今天，企业秉承“顾客至上、诚信服务”的企业宗旨、以品质求生存的经营理念，全体员工本着一个共同的信念：以优良的品质，合理的价格，全面、快捷、周到、细致、热情的服务来追求不断创新、服务社会。', '116.394193', '40.181880999999997', '116.394193', '40.181880999999997', '', null, null, null, null);
