INSERT INTO `t_fc_company` VALUES ('3340', '中成卓越(北京)厨房设备有限公司', '1321', '王进侠', '13501228011', '师中秀', '13501228011', '2014年01月27日', '1500万元', '北京市', '北京市', '通州区', null, '北京市通州区西集镇国防路43号A座508', '北京市', '北京市', '通州区', '梨园地区办事处', '北京市通州区九棵树西路90号,英特商务园写字楼A座东冀小楼', 'AAA', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年01月27日', '2034年01月26日', '2019/7/23', '2020/7/22', '京消协（2019）证字461号', '911101120918821756', '', '销售厨房设备、金属制品、玻璃制品、塑料制品、橡胶制品、工艺品（不含文物）、五金交电、机械设备、通风专用设备、电子产品、针纺织品、家具、化工产品（不含危险化学品）、制冷专用设备、空气净化专用设备、日用杂货、医疗器械、文化用品、环保专用设备、专用设备；技术咨询；计算机技术培训；承办展览展示；电脑图文设计；维修厨房设备；家庭劳务服务；厨房油烟管道清洗；货物进出口、技术进出口、代理进出口；环保技术开发；大气污染治理；水污染治理；固体废物污染治理；委托加工厨房专用设备；城市园林绿化。（领取本执照后，应到区县商务委备案。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '中成卓越（北京）厨房设备有限公司是北京大型的厨房设备生产厂家，专业从事设计、制造、安装各类宾馆、酒店、单位食堂的厨房设备及冷库、冻柜、通风系列工程，并代理世界各国名牌厨房设备，产品质量受到广大用户的好评。\n公司具有雄厚的技术力量及较大规模的生产能力。拥有一支高、中级机械电子产品开发等工程师及工程策划设计师和技术人员组成的专业技术队伍和素质的生产、服务队伍。成批引进国内先进数控生产设备和生产工艺，建立了ERP系统，使各项管理得以升级，并通过了ISO9001国际质量管理体系认证证书、ISO14001：2004环境管理体系认证证书、GB/T28001-2001职业健康安全管理体系认证证书、GB/T27922-2011五星级售后服务认证证书及企业资质等级证书。\n本公司现有员工140人，多年厚积的技术力量和管理经验。使公司业务迅猛发展，公司依靠先进的技术，优良的产品质量。完善的售后服务体系占领市场，赢得广大客户的信赖。\n“配套齐全，质量优异，价格合理，服务周到”是我公司永远不变的宗旨。', '116.879456', '39.815719000000001', '116.651208', '39.882807999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3341', '北京一凡雅清洁服务有限公司', '1318', '刘宏', '18910230538', '臧雪冬', '18911807251', '2009年02月27日', '50万元', '北京市', '北京市', '朝阳区', null, '高碑店乡半壁店村惠河南街1089号1层K1119', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '东三环南路联合国际大厦甲段615', '', '烟道清洗', '有限责任公司（自然人独资）', '2009年02月27日', '2029年02月26日', '', '', '', '911101056857737697', '', '清洁服务；经济贸易咨询；组织文化艺术交流活动（不含演出）；会议服务；企业策划；销售五金交电（不含电动自行车）、建筑材料、计算机、软硬件及辅助设备。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京一凡雅清洁有限公司是一家专业从事中央空调系统清洗、油烟管道清洗的服务型企业。为用户的中央空调系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\n公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成中央空调系统清洗全系列工作。\n我们丰富的经验可广泛服务于所有使用中央空调的场所，包括写字楼、宾馆、饭店、商场、学校、机关办公区等。\n您的健康是我们的责任，一凡雅愿用自己的努力，为您提供一个洁净、健康、舒适的环境。为我们人类多留一片洁净的蓝天。\n公司理念：不懈努力、不懈追求是本公司永保活力的源泉；科学灵活的经营管理是本公司成功的保证；客户至上，信誉第一，奉行诚信服务是本公司赖以发展的宗旨。', '116.49939000000001', '39.905276999999998', '116.459834', '39.868295000000003', '', null, null, null, null);
