INSERT INTO `t_fc_company` VALUES ('3344', '北京煜德商贸有限公司', '1312', '杨伟', '13911688231', '杨伟', '13911688231', '2019年03月04日', '100万元', '北京市', '北京市', '大兴区', null, '黄村镇兴华大街（三段）1号51幢3层51-1', '北京市', '北京市', '大兴区', '兴丰街道', '黄村镇兴华大街（三段）1号51幢3层51-1', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年03月04日', '2039年03月03日', '', '', '', '91110115MA01HGAF0G', '', '零售日用品、照相器材、厨房用品、针纺织品、文化用品、体育用品、家用电器、电子产品、服装、鞋帽、五金（不含电动自行车）；软件开发；计算机系统服务；技术开发；技术咨询；技术转让；技术推广；技术服务、清洁服务、家政服务（中介除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京煜德商贸有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一。主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机等产品。采用专业的清洁设备，专业的清洁员工，不断完善和改进，经过多年在清洁及相关行业的探索和实践，凭借丰富的管理经验，利用现代化管理手段和一流的专业化技术，您的认可和满意就是我们最高的荣耀。.我公司始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为您提供最完美的服务。', '116.33156099999999', '39.737043', '116.33156099999999', '39.737043', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3345', '北京璟洛网络科技有限公司', '1307', '苏宇', '18612720724', '张祥', '18801102375', '2019年03月13日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区阎富路69号院46号楼1至4层101二层11', '北京市', '北京市', '房山区', '阎村镇', '北京市房山区阎富路69号院46号楼1至4层101二层11', '', '宣传教育培训', '有限责任公司（自然人独资）', '2019年03月13日', '2049年03月12日', '', '', '', '91110111MA01HNKK4M', '', '网络技术开发；软件开发；技术开发；技术咨询（中介除外）；技术转让；技术推广；技术服务；应用软件服务；产品设计；计算机系统服务；从事互联网文化活动。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京璟洛网络科技有限公司以职称提升考前辅导、建筑领域执业资格考证辅导等培训为主营业务，致力于打造一个既促进行业发展又能合理创收的良性生态循环系统，逐步开发和建设成基于移动互联网和大数据应用的职业教育培训生态系统。\n公司高度重视教学质量和服务质量，重视教学服务的优化和创新，公司教学服务与产品中应用的主要技术和要素均来自公司创业团队多年的研究与实践。公司创立初期就计划逐步建立自有师资和教学研发团队，如形成专业教学研发团队，专注于教学内容的研究、课程体系的设计、教学方法的提炼、服务体系的优化，不断创新学习体系，经实践检验后逐步形成公司独特且成熟的产品模式。同时，公司努力健全的技术研发流程及规范化的管理制度，使得公司的产品创新和技术研发动力更强劲，争取处于建筑工程类执业资格证考前辅导等培训领域的技术领先地位。\n公司创业团队拥有的核心技术主要指相对成熟的教研成果、教学方法及技术平台和管理系统，这些都源于公司创业团队多年来坚持自主研发、或在现有成熟技术基础上集成创新所形成，所有权均将归属于公司。', '116.04498', '39.714471000000003', '116.04498', '39.714471000000003', '', null, null, null, null);
