INSERT INTO `t_fc_company` VALUES ('3348', '北京优能净环保科技有限公司', '1302', '何裕鹏', '15732750822', '何裕鹏', '13426439491', '2019年10月17日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号—D10467', '北京市', '北京市', '大兴区', '黄村地区办事处', '海鑫北路10号院', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年10月17日', '长期', '', '', '', '91110111MA01N5Y46N', '', '环保技术开发；建筑物清洁服务；清洁服务；家庭劳务服务；销售空调制冷设备、节能环保设备、通风设备；技术开发、技术咨询（中介除外）、技术服务、技术推广、技术转让；城市园林绿化；销售日用杂品、清洁用品、文化用品（音像制品除外）、厨房设备、五金交电（不含电动自行车)、卫生间洁具；租摆花卉；水污染治理；施工总承包；专业承包；劳务分包。（企业依法自主选择经营项目，开展经营活动；施工总承包、专业承包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司北京优能净环保科技有限公司，成立于 2019年10月17日，位于北京市房山区良乡凯旋大街建设路18号—D10467， 是一家专业做环保、清洁的企业单位。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的开荒保洁和清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.137918', '39.721812999999997', '116.402885', '39.716887999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
