INSERT INTO `t_fc_company` VALUES ('3350', '北京生辉环保科技有限公司', '1298', '翟茹', '13241397996', '许东辉', '13161558000', '2019年10月10日', '800万元', '北京市', '北京市', '大兴区', null, '北京市经济技术开发区天华东路5号院2号楼负一层008.009', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市经济技术开发区天华东路5号院2号楼负一层008.009', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年10月10日', '2049年10月09日', '', '', '', '91110302MA01N1JW91', '', '技术开发、技术咨询、技术服务、技术推广、技术转让；清洁服务；家政服务（不符合家政服务通用要求不得开展经营活动）；施工总承包、专业承包；劳务分包；承办展览展示活动；销售机械设备、家用电器、电气设备、建筑材料、装饰材料、金属材料、钢材、五金交电（不含电动自行车）、日用品、家庭用品、厨房用具、电子产品、初级食用农产品；机动车公共停车场服务；物业管理；设备维修；工程勘察；工程设计；销售食品。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计、销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京生辉环保科技有限公司坐落于北京经济开发区天华东路5号院2号楼负一层008.009，是经国家批准注册及研发.油烟管道清洗.中央空调系统清洗.厨房自动灭火装置安装维修保养为一体的高新综合企业。是北京消防协会会员。\n我公司具有油烟管道专业清洗工60余人，经验丰富，公司还定期聘请消协工程建筑方面清洗专家来公司进行技术讲座，对工人进行定期培训，持证上岗。充分得到了消防，环保等部门的肯定。   \n经北京市消防科学研究所监制，我公司负责安装维护的厨房自动灭火装置是根据欧洲发达国家标准设计，制造，按照GA498-2012厨房设备灭火装置国标生产，通过IS9001-2008质量管理体系认证，并在中国人民保险公司投保，最高赔偿100万元。充分保证了客户厨房着火的后顾之忧。\n    公司成立以来始终重视高质量的服务，树立了“生辉环保”优秀品牌。凭借行业最前沿的技术，实惠的价格以及完善的售后服务体系，赢得了广大客户的信赖和推崇。公司一贯信奉“以诚求城、精益求精”追求品质超越平凡的企业宗旨，“诚信为本 专业服务”的经营理念，全力为客户提供最专业保洁清洗队伍和厨房消防安全保障。', '116.497843', '39.802042', '116.497843', '39.802042', '', null, null, null, null);
