INSERT INTO `t_fc_company` VALUES ('3353', '北京嘉美惠祥保洁服务有限公司', '1291', '谭爱凤', '13311160485', '谭志强', '18910905309', '2011年09月15日', '300万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区东柳西里5号楼2门411号', '北京市', '北京市', '朝阳区', '管庄地区办事处', '北京市朝阳区东柳西里5号楼2门411号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2011年09月15日', '2031年09月14日', '', '', '', '9111010558253428X0', '', '清洁服务；家庭劳务服务；销售五金交电、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京嘉美惠祥保洁服务有限公司，成立于2011年，注册资金300万元。经过几年的成长与磨砺，今天已发展成为一家综合性专业性的中型保洁服务公司。主要开展的业务有：油烟管道清洗、商务保洁托管、家居保洁服务、楼宇外墙清洗、工程开荒清洁、石材地面养护、地毯窗帘清洗等项目。公司实行总经理负责制，下设市场合作部、日常保洁部、开荒突击部、石材养护部、布艺清洗部、劳务输出部。各部门既有明确分工，又要密切协作。公司有11名中层以上技术骨干，组成一支强有力的管理团队，下面带领100多名训练有素技能娴熟的专业工人。另外公司还有多名工人作为储备力量。随时都能高标准地完成合作客户交给的各类保洁工作。\n        一直以来，我们信诚“信誉第一”的宗旨，遵循“以质量求生存，向管理要效益”的原则。先后与合生创展、国家电网、北京朝阳建委、武警车辆油料监理所等单位合作。用诚心、贴心、放心的服务赢得了广大客户的信任。 我们的承诺是：我的标准就是你的满意！公司上下同心同德，团结一致，以优质的服务赢得了客户的认可，建立起了稳定的客户群。', '116.574129', '39.900784999999999', '116.574129', '39.900784999999999', '', null, null, null, null);
