INSERT INTO `t_fc_company` VALUES ('3356', '北京途方教育科技有限公司', '1286', '战营', '18698664129', '战营', '18698664129', '2018年05月15日', '2000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区天华街9号院19号楼7层706', '北京市', '北京市', '大兴区', '北臧村镇', '北京市大兴区天华街9号院19号楼7层706', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年05月15日', '2038年05月14日', '', '', '', '91110115MA01C5RU48', '', '技术开发、推广、转让、咨询、服务；软件开发；教育咨询（不含出国留学咨询及中介服务）；承办展览展示活动；会议服务（不含食宿）；组织文化艺术交流活动（不含演出）；企业管理咨询；企业形象策划；设计、制作、代理、发布广告；从事互联网文化活动；互联网信息服务。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京途方教育科技有限公司（简称“途方教育”品牌），成立于中国北京，\n于2018年正式转型互联网在线教育(原北京较受欢迎的职业教育面授辅导机构)\n是一家面向全国职业类培训品牌机构，位于北京市大兴区，辅导课程消防工程师、消防建筑师、建造师、执业药师等，公司现有员工五百人，教研与客服创作团队人数过半，其中职业专业辅导专家十余名，专注创造职业类考试培训教案，创造中国职业类考试通关风暴，我们愿极尽利用专家团队和专业客服团队去打造中国较高通过率机构！为您保驾护航，提高职业生涯竞争力！', '116.314257', '39.685015', '116.314257', '39.685015', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3357', '北京江山永安消防安全设备有限公司', '1285', '周志军', '13520522848', '李海萍', '13693088079', '2013年09月22日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区晓月五里6号楼101-89', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区西洪泰庄11号', '', '消防产品', '有限责任公司（自然人独资）', '2013年09月22日', '2033年09月21日', '2017/2/20', '2018/2/19', '京消协（2017）证字028号', '9111010607853159X5', '', '销售消防器材、交通设施、机械设备、电子产品、五金交电、建筑材料、装饰材料、化工产品（不含危险化学品）；维修消防器材、交通设施；清洗服务；技术检测；专业承包。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京江山永安消防安全设备有限公司成立于2013年，是经北京市消防局核准备案同时获的中华人民共和国消防技术服务机构资质证书的消防专业公司，2015年成为北京市消防协会会员单位。\n公司拥有一支专业性强、经验丰富、技术力量雄厚的专业团队，可承接灭火器维修、检测、火灾自动报警设备检修、气体灭火系统检修、销售消防器材/交通器材/消防设备等业务。\n我们深刻认识到消防安全的重要，永远把产品质量和良好服务放在第一位，我们本着对消防事业高度负责的精神，在发展和壮大中不断购进许多先进的检测仪器和专业工具,我们期待与各界朋友的合作，未来我们将用专业的技能和一流的服务为广大合作伙伴提供一条龙消防服务,真诚为您做好每一个项目，成为您的消防安全守卫者！\n\n\n公司的企业宗旨：“以信誉为根本，以质量求发展，以服务创品牌”\n  公司的企业精神：“诚信为本，客户至上，同心同德，创新发展”\n  公司的企业口号：“团结、细致、进取、发展”', '116.237595', '39.834634000000001', '116.25067', '39.847622999999999', '', null, null, null, null);
