INSERT INTO `t_fc_company` VALUES ('3359', '北京众智博睿教育科技有限公司', '1274', '李文振', '18322417315', '时小静', '18600555061', '2018年02月28日', '200万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区经海三路109号院32号楼4层403室', '北京市', '北京市', '朝阳区', '奥运村街道', '北京市朝阳区北苑13号院领地大厦C座1010室', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年02月28日', '2048年02月27日', '', '', '', '91110108MAO1AHRJ68', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；教育咨询（不含出国留学咨询及中介服务）、计算机系统服务；基础软件服务；应用软件服务（不含医用软件）；软件开发；软件咨询；产品设计；模型设计；包装装潢设计；经济贸易咨询；文化咨询；体育咨询；公共关系服务；会议服务；工艺美术设计；电脑动画设计；企业策划、设计；设计、制作、代理、发布广告；市场调查；企业管理咨询；组织文化艺术交流活动（不含营业性演出）；承办展览展示活动；影视策划；翻译服务；自然科学研究；工程和技术研究；农业科学研究；医学研究（不含诊疗活动）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京众智博睿教育科技有限公司，是国内最早致力于注册消防工程师人才培训的机构之一，学员遍布及全国各大中型城市，目前累计培训学员共2万余人.\n公司成立之初，已具备相当数量的消防教育资源，强大的师资团队及教研团队在国内消防工程师培训行业内引起了强烈关注，课程质量、授课水平得到广大学员的一致好评。众智博睿教育，在注册消防工程师考试中，独树一帜，引领教学方向。', '116.55932799999999', '39.788189000000003', '116.41452200000001', '40.040531000000001', '', null, null, null, null);
