INSERT INTO `t_fc_company` VALUES ('3364', '北京仁友家政服务有限公司', '1261', '郭海艳', '13466630324', '马楠楠', '13141218436', '2012年01月06日', '5000万元', '北京市', '北京市', '昌平区', null, '北京市昌平区城北街道永安路22号楼1-3层22-1', '北京市', '北京市', '昌平区', '城北街道', '北京市昌平区城北街道永安路22号楼1-3层22-1', 'AAA', '烟道清洗', '有限责任公司（自然人投资或控股）', '2012年01月06日', '2062年01月05日', '', '', '', '91110114589109649K', '', '家庭劳务服务、保洁服务；居家养老服务；社会看护与帮助服务；室内空气净化治理服务；婚庆服务；礼仪服务；技术推广服务；劳务派遣（不含境外劳务派遣）；销售日用品、服装鞋帽、机械设备；城市园林绿化；物业管理；维修家用电器；货运代理；装卸服务；害虫的防治服务；灭鼠及预防；城市生活垃圾清扫、收集、运输、处理；道路货物运输。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京仁友家政服务有限公司是经工商局注册，注册资金为5000万元的一家社会化保障型企业，受民政局监管,北京仁友杰洁保洁服务保洁服务有限公司分别经营单位清洁服务；家庭劳务服务、洗涤用品领域的技术开发；高端家政服务、劳务派遣等项目。\n公司向管理要效益，真正实现了各种资源的整合。在几年如一日的经营里，公司在社会上建立了良好的声誉。公司目前有固定员工1080，家政服务人员109人，外联单位人员20人，保洁人员951元 ，人员分别分布在北京市各个区县，从事着日常保洁服务、高空作业服务、物业保障、家庭服务等。\n公司目前设有，总经理办公室、财务部、市场拓展部、业务部、人力资源部、基层管理部、品质部、行政部保洁用品销售部等配套的部门。', '116.234982', '40.207847999999998', '116.234982', '40.207847999999998', '', null, null, null, null);
