INSERT INTO `t_fc_company` VALUES ('3367', '北京市巨龙工程有限公司', '1258', '孙敏', '13901071970', '郑庆芳', '13810606532', '1998年11月03日', '1913万元', '北京市', '北京市', '石景山区', null, '实兴大街30号院3号楼2层D-0974房间', '北京市', '北京市', '丰台区', '新村街道', '南四环西路188号12区11楼', '', '建筑防火', '有限责任公司（自然人投资或控股）', '1998年11月03日', '2048年11月02日', '2018/10/12', '2019/10/11', '京消协（2018）证字312号', '91110107700100512E', '', '建筑智能化工程专业承包叁级；机电设备安装工程专业承包叁级；消防设施工程设计与施工壹级；智能建筑设计（系统集成，其中消防子系统除外）；安装制冷空调设备、机械设备、电器设备、舞台灯光音响设备、电子计算机网络；有线电视台、站及共用天线、卫星地面接收设施设计、安装（一级）；安全技术防范工程设计、施工（一级）；装饰设计；园林绿化服务；技术开发、技术转让、技术咨询、技术服务；销售上述开发经鉴定合格的新产品；信息咨询（不含中介服务）；销售机械设备、电器设备、仪器仪表、装饰材料、五金交电、化工产品（不含危险化学品）、消防器材、安全技术防范产品；机械设备维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京市巨龙工程有限公司是北京市高新技术企业；公司总部设在北京市丰台区总部基地。\n公司成立于1985年。前称中国人民警官大学科技开发公司，1998年改制组建更名为北京市巨龙工程有限公司。公司具有中华人民共和国建设部、北京市住房和城乡建设委员会等主管单位颁发的消防设施工程设计与施工一体化、建筑智能化工程、机电设备安装工程施工等多项资质证书。\n巨龙以其先进的经营理念、雄厚的技术实力、完善的实施方案和超值的客户服务，在同行业中居领先地位。\n巨龙业务遍及全国，拥有一大批专家教授级的高、中级专业技术人才和经济管理人才，每年按市场经济需要，有选择的补充不同专业的大学毕业生，使技术和管理人员队伍不断知识更新和年青化。\n巨龙主要着重于“消防安全工程、智能弱电工程、能源环境工程”等系统集成和服务，主要内容有：消防设施工程设计与施工、消防工程维护保养、建筑智能化工程、机电设备安装等。', '116.19359300000001', '39.939335', '116.287806', '39.820611', '', null, null, null, null);
