INSERT INTO `t_fc_company` VALUES ('3369', '北京青山绿水环保科技有限公司', '1255', '石建海', '13911727888', '石思', '18511111610', '2004年01月05日', '200万元', '北京市', '北京市', '顺义区', null, '北京市顺义区林河南大街9号院14号楼1层24室', '北京市', '北京市', '顺义区', '牛栏山地区办事处', '北京市顺义牛栏山镇嘉寓集团北侧胡同1门', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2004年01月05日', '2054年01月04日', '', '', '', '91110113757708190E', '', '环保技术开发、技术服务、技术培训、技术转让；销售净化器、机械电子设备、五金交电、建筑材料（不含砂石及砂石制品）、化工产品（一类易制毒化学品及化学危险品除外）；专业承包、劳务分包、施工总承包；污水处理；维修机械设备；室内装饰设计；接受委托提供劳务服务（不含排队服务、对外劳务合作）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司主要经营环保技术开发、技术服务、技术培训、技术转让、销售净化器、机械电子设备等，专业承包、施工总承包、污水处理，室内装饰设计等', '116.70041399999999', '40.091743000000001', '116.654903', '40.218879999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3370', '北京立达卓消防技术有限公司', '1254', '姜颐兰', '13522584679', '吴昱', '13901238144', '2011年03月03日', '1000万元', '北京市', '北京市', '石景山区', null, '北京市石景山区石景山路23号科研楼016房间', '北京市', '北京市', '石景山区', '鲁谷街道', '北京市石景山区石景山路23号科研楼016房间', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2011年03月03日', '2031年03月02日', '2018/11/21', '2019/11/20', '京消协（2018）证字384号', '91110107569464790C', '', '建筑消防设施检测、电气防火检测技术服务；技术开发、技术转让、技术检测；消防设备及器材维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京立达卓消防技术有限公司是经国家工商局石景山分局正式注册的独立法人机构，面向社会开展建筑消防设施检测和电气防火检测工作。具有独立开展检验检测工作的资格，具有独立账户，独立对外行文，其对外法律责任由独立法人地位承担。公司曾依法取得了北京市公安消防总队颁发的《中华人民共和国消防技术服务机构资质证书》（临时一级）和北京市消防协会颁发的《电气防火检测技术服务机构资信证书》，通过了ISO 9001-2008质量管理体系认证，通过了北京市质量技术监督局CMA检测能力认证。\n公司拥有一支专业性强、经验丰富、技术力量雄厚的专业团队，并与所有相关工作人员均建立了唯一的劳动关系。根据需要分别从事检验检测、制作、签发检测报告、设备维护等工作。确保检验检测数据、结果的科学、公正、准确、规范。\n公司按照GA1157-2014的要求具备从事检验检测活动所必须的检验检测设备设施，并拥有100%产权。对检测设备进行日常管理，包括设备的申购、验收、检定/校准、建档、使用、维修等环节的控制管理，保证所有计量器具均在检定周期内按时送检，做到周检率、完好率100%。', '116.212892', '39.905644000000002', '116.212892', '39.905644000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3371', '京润天城（北京）建设有限公司', '1253', '葛辉', '010-67869986', '崔国明', '13651006818', '2017年06月20日', '6000万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区杨坨粮库院内CZ0596室', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京经济技术开发区宏达北路10号万元商务中心407', '', '建筑防火,消防设施,消防信息化,消防产品,烟道清洗,电气防火,消防安全检查,消防安全评估', '有限责任公司（自然人独资）', '2017年06月20日', '2047年06月19日', '', '', '', '91110109MA00FDCP56', '', '施工总承包；专业承包；劳务分包；房地产开发；工程设计；物业管理；园林绿化；污水处理；景观设计；销售自行开发的商品房、五金交电、机械设备、建筑材料、化工产品（不含危险化学品及一类易制毒化学品）、消防器材、安防产品；机械设备租赁；技术开发、推广、转让、咨询、服务；会议服务；企业形象策划；设计、制作、代理、发布广告；技术检测（不含认证、认可）；保洁服务；出租商业用房；出租办公用房。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '京润天城（北京）建设有限公司位于北京市大兴区宏达北路10号万源商务中心，公司成立于2017年6月20日，注册资金6000万元。专业从事消防、建 筑装修装饰、机电工程和机电安装工程的施工，并提供相应的技术服务。\n\n目前拥有消防设施工程专业承包贰级，电子与智能化工程专业承包贰级，建 筑装修装饰工程专业承包贰级，建筑幕墙工程专业承包贰级，防水防腐保温工 程专业承包贰级，地基基础工程专业承包叁级，市政公用工程施工总承包叁， 石油化工工程施工总承包叁级，机电工程施工总承包叁级，建筑机电装工程专 业承包叁级，环保工程专业承包叁级，钢结构工程专承包叁级，建筑工程施工 总承包叁级。\n\n公司可独立完成资质内的各类工程的施工，以消防为主营业务，业务以北京 为核心向周边城市辐射。公司以丰富的施工经验、优异的工程质量、承接完成的大型工程有中海油能源技术研究院建设项目 消防工程、中海油网络数据中心项目消防工程、北 京电子学院电子电信实训楼消防工程等深得业主的信赖与好评，在业界树立了 良好的企业形象。，面对不断升级的市场竞争，公司 坚持以质量筑伟业，服务赢客户的宗旨不变，坚持夯实业务做大做强的信心不变。', '116.10581000000001', '40.007694000000001', '116.507593', '39.801355999999998', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3372', '北京特丽洁环保科技有限公司', '1252', '杨德琴', '18911845485', '冯善扬', '13801263422', '2017年11月07日', '600万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区杨宋镇凤翔东大街9号A座A2233室', '北京市', '北京市', '怀柔区', '杨宋镇', '北京市怀柔区杨宋镇凤翔东大街9号A座A2233室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年11月07日', '2047年11月06日', '2018/10/30', '2019/10/29', '京消协（2018）证字350号', '91110116MA018LD28J', '', '环保技术开发、咨询、服务、推广、转让；专业承包；劳务分包；销售化工产品（不含危险化学品）、机械设备、家用电器、厨房设备、空气净化设备、水处理设备、通讯设备（不含卫星地面接收、发射设备）、日用品、仪器仪表。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京特丽洁环保科技有限公司，是专业致力于环保技术开发，咨询，空气净化设备，水处理设备，厨房设备等销售与施工的环保科技企业，具备专业承包和劳务分包的施工资质', '116.684876', '40.295285', '116.684876', '40.295285', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3373', '北京安征昊消防技术服务有限公司', '1249', '姜松华', '13801313894', '徐莉菲', '63929383', '2001年03月22日', '510万元', '北京市', '北京市', '丰台区', null, '新发地京良桥西侧2000米路北6号楼5单元201室', '北京市', '北京市', '丰台区', '西红门地区办事处', '新发地京良桥西侧2000米路北6号楼5单元201室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2001年03月22日', '2024年03月21日', '2018/10/19', '2019/10/18', '京消协（2018）证字318号', '911101067601083646', '', '技术检测；技术服务、技术咨询；维修消防设备。（领取本执照后，应到市质量技术监督局计量认证；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安征昊消防技术服务有限公司（以下简称公司）成立于2004年3月22日，是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，并已通过了ISO9001:2008质量管理体系认证。\n公司经北京市消防局消防协会的严格考核和认证，具备消防设施检测和电气防火检测领域的专业检测资质，是开展建筑消防设施及电气防火检测技术服务的消防检测单位，经过北京市质量技术监督计量认证考核授权开展58项目。公司技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，提供公正、科学、详尽和真实的检测报告。', '116.334322', '39.802365999999999', '116.334322', '39.802365999999999', '', null, null, null, null);
