INSERT INTO `t_fc_company` VALUES ('3375', '北京环城清洁服务有限公司', '1245', '于洪磊', '13521094887', '于红超', '15652770888', '2016年03月22日', '500万元', '北京市', '北京市', '丰台区', null, '成寿寺路1号楼11层1120', '北京市', '北京市', '丰台区', '南苑地区办事处', '成寿寺路1号楼11层1120', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年03月22日', '2036年03月21日', '2018/9/26', '2019/9/25', '京消协（2018）证字302号', '91110106MA004A743R', '', '清洁服务；技术开发、技术服务、技术转让；劳务服务；物业管理；机动车公共停车场管理服务；机械设备租赁；销售厨房用具、清洁用品、电子产品、化工产品（不含化学危险品）、汽车配件、工艺品、针纺织品、日用品；杀虫服务；化粪池清掏。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京环城清洁服务有限公司是一家以保洁服务 建筑物清洁服务 物业管理为主的服务型企业，主要经营油烟管道清洗 厨房设备清洗 风机和净化器安装及清洗服务 是经北京市消防协会评审的专业公司。具备排油烟清洗资质和员工培训上岗证。北京环城清洁服务有限公司秉承诚信 专业 共赢的经营理念 坚持用户至上 质量第一。', '116.444429', '39.85812', '116.444429', '39.85812', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3376', '北京科洛迪科技发展有限公司', '1244', '代金华', '15369806801', '张恒', '13263281918', '2018年01月08日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区春和路50号院7号楼7层713', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '北京市大兴区春和路50号院7号楼7层713', '', '消防产品', '有限责任公司（自然人独资）', '2018年01月08日', '2038年01月07日', '', '', '', '91110115MA019RA47X', '', '科技开发、咨询、转让、服务；软件开发；销售安全技术防范产品、环保设备、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司致力于消防真火、烟热实战训练系统的研发、生产。通过多年不懈努力,科洛迪消防培训系统一直保持着行业领先水平。公司拥有多项消防培训系统的发明创新,在科学、创新、安全、环保等方面一直坚守行业内的最高标准。', '116.355732', '39.771751999999999', '116.355732', '39.771751999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3377', '北京市万年青环保厨房设备有限责任公司', '1242', '潘志洪', '13901037157', '梁彩霞', '13321196325', '2001年11月27日', '8070万元', '北京市', '北京市', '大兴区', null, '北京市大兴区宏业路9号院8号楼10层1009', '北京市', '北京市', '大兴区', '中关村国家自主创新示范区大兴生物医药产业', '北京市大兴区天贵街3号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2001年11月27日', '2020年11月26日', '', '', '', '91110115802898078N', '', '销售灶具、橱具、通风管道、油烟净化设备、消毒设备、水净化设备、制冷空调设备、不锈钢制品、铝合金门窗、五金产品（不含电动自行车）、建筑材料、机械电器设备、消防器材、办公用品、家庭用品、通讯设备、医疗器械（限I类、II类)、专业承包；厨房设计；加工厨房设备、通风管道(限在外埠从事生产活动）；家居装饰；劳务分包；经济贸易咨询（中介除外）；保洁服务；道路货物运输。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我司座落在北京市大兴区宏业路9号院8号楼10层1009，交通非常便利。经过多年的蓬勃发展，公司拥有一大批先进的专业制造设备，汇集了全国各地的专业人才，具备了较强的研发和自主创新能力。专业从事设计、制造、安装宾馆、酒店、机关团体、学校等单位食堂的中西厨房设备及代理国内外知名品牌中西厨房设备、食品机械、中西厨房用具、自助餐用具、吧台用具、金银餐具、玻璃器皿、日韩料理用品、大堂用品、清洁设备、宴会家具、客房家具、洗衣房等专业酒店配套用品。 先后取得了“ISO9001质量管理体系认证”，“ISO14001环境管理体系认证”，“GB/T28001职业健康安全管理体系认证”，“全国工业产品生产许可证”“北京市优质产品”，“北京市名优企业”，“北京市消防油烟清洗认证证书”，“节能环保产品认证”，“中国工程建设推荐产品”，“北京市信用企业”“质量、服务、信誉AAA企业”“全国质量诚信企业”“安全生产标准化证书”等资格证书，并通过了北京市燃气及产品质量监督检验站检测。\n  公司系列产品经过精心的设计，每台设备不但外形美观，而且更具有出色的实用功能性和操作的安全、方便性。', '116.32364800000001', '39.786124999999998', '116.30628900000001', '39.689452000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3378', '北京利双业环保科技有限公司', '1241', '王晨菲', '王晨菲', '熊一诺', '18518883641', '2018年03月23日', '1000万元', '北京市', '北京市', '延庆区', null, '北京市延庆区康庄镇龙庆·望都佳园6号楼1层2单元201号102室', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区兴隆家园南区42号楼3单元202', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年03月23日', '2038年03月22日', '', '', '', '91110229MA01B0F97Q', '', '技术转让、技术推广、技术服务、技术咨询、技术开发；社会经济咨询（投资咨询除外）；销售日用品、五金、交电、机械设备、电气设备、电子产品、化工产品（第一类中的非药品类易制毒化学品除外）；专业承包、劳务分包；专业化设计服务；维修家用电器；清洁服务；环境保护监测；城市生活垃圾清扫、收集、运输。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京利双业环保科技有限公司位于北京，北京利双业环保科技有限公司主要经营：技术转让、技术推广、技术服务、技术咨询、技术开发；社会经济咨询（投资咨询除外）；销售日用品、五金、交电、机械设备、电气设备、电子产品、化工产品（第一类中的非药品类易制毒化学品除外）；专业承包、劳务分包；专业化设计服务；维修家用电器；清洁服务；环境保护监测；城市生活垃圾清扫、收集、运输。北京利双业环保科技有限公司有完善的质量保证体系，通过了所有合作伙伴的高标准质检及认可。为开拓市场，实现互惠互利，我们将本着“价格，质量”双优，“诚信，服务”共赢的经营理念，竭诚为广大客户服务。我们公司本着“不争价格最低，但求质量最好”的原则，竭诚为国内外用户提供优质的产品及诚信的服务。', '115.896536', '40.377884999999999', '116.524996', '39.909807000000001', '', null, null, null, null);
