INSERT INTO `t_fc_company` VALUES ('3380', '金星恒大（北京）教育科技有限责任公司', '1238', '王文娟', '13910949664', '武继旺', '13910061146', '2016年04月07日', '100万元', '北京市', '北京市', '石景山区', null, '北京市石景山区杨庄路110号院5号楼11层1105室', '北京市', '北京市', '石景山区', '八角街道', '北京市石景山区杨庄路110号院5号楼10层1007室', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2016年04月07日', '长期', '', '', '', '91110107MA004M8F2M', '', '技术服务、技术咨询；会议服务：承办展览展示活动；人才中介服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '金星恒大（北京）教育科技有限责任公司是一家经营理念新颖、极具市场拓展力的新型科技传媒机构，专业为企事业单位、相关机构、组织和有关政府部门提供信息咨询、公共形象设计、专题会议、媒体广告代理、猎头、展览展示等全方位公共关系服务的机构，与政府有关部门密切合作的良好关系，逐步形成了自己的研究特色。\n    金星恒大专业从事市场信息研究分析、行业资料汇编、品牌建设、品牌策划、职业教育等领域形成协同发展的产业集群，成为具有专业和实力的咨询服务机构和会展培训组织机构之一。我们的服务对象为国内企事业单位和各级政府决策部门。不论您是成长于何种机构，发展于何种领域，您所散发的优点是我们学习的起点，您所成就的得失将是我们宝贵的财富。', '116.18917500000001', '39.922184999999999', '116.18917500000001', '39.922184999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3381', '北京科华消防工程有限公司', '1236', '鲍晓庆', '01062258427', '厉励', '13911266535', '1998年11月09日', '3000万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区石龙经济开发区永安路20号3号楼A-6828室', '北京市', '北京市', '西城区', '新街口街道', '北京市西城区西直门内五根檩胡同11号金泰华云写字楼B座105', '', '建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '1998年11月09日', '2028年11月08日', '', '', '', '911101097000794770', '', '消防工程施工、安装、设计；工程设计；建筑智能化工程设计与施工；工程技术咨询；工程造价咨询；物业管理；钢结构、针织物、木材、阻燃工程施工及设计；消防技术服务；销售消防器材、机械设备、电子产品、建筑材料、五金交电（不含电动自行车）；电脑图文设计；劳务派遣；消防设施维护保养。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于1998年，经北京市住房和城乡建设委员会批准具有消防设施工程专业承包壹级资质、电子与智能化工程专业承包贰级资质；经中华人民共和国住房和城乡建设部批准具有消防设施工程设计专项甲级资质；北京市规划和自然资源委员会批准具有建筑智能化系统设计专项乙级资质；经北京市公安局消防局批准，具有消防设施维护保养检测临时一级资质。公司注册资金3000万元。目前，公司拥有各类专业人员113人，其中建造师13人，大专以上学历人员占员工总数的85%。公司于2003年度通过了ISO9001：2000质量管理体系认证；2006年通过了ISO14001：2004环境管理体系及GB/T28001—2001职业健康安全管理体系认证，现三体系运行正常。近几年来，公司完成了一大批国家、省、市级重点工程的消防设施工程设计与工程施工及维护保养项目，均一次通过验收，得到了客户广泛好评，赢得了社会守信的声誉，先后多次被评为“质量、信誉双保障示范单位”、“全国质量诚信示范企业”、“全国质量服务信誉双保障产品企业”、“全国消防工程公司服务质量无投诉用户满意单位”、“全国消费者用户满意企业”。企业信用等级为AAA级', '116.127228', '39.896763999999997', '116.362692', '39.943091000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3382', '晟天城（北京）环保科技有限公司', '1235', '陈宇超', '15010873817', '慈苒媚', '13126606665', '2018年06月19日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳万兴路86号-A2978', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区阎村镇炒米店村', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年06月19日', '2068年06月18日', '', '', '', '91110111MA01D46LX9', '', '投资管理；技术开发、技术推广、技术培训、技术转让、技术咨询、技术服务；经济信息咨询；投资咨询；项目投资；资产管理；劳务服务；企业管理服务；财务咨询（不得开展审计、验资、查账、评估、会计咨询、代理记账等需经专项审批的业务，不得出具相应的审计报告、验资报告、查账报告、评估报告等文字材料）；机械设备租赁；销售机械设备、家具、服装、医疗器械（限I类）、塑料制品、计算机软件、电子产品、文具用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '晟天城（北京）环保科技有限公司是主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品。是经北京消防协会评审的专业公司，具备厨房烟囱清洗资质、员工均持证上岗，晟天城（北京）环保科技有限公司 秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。 我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念，始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为您提供最完美的服务', '116.169729', '39.775677000000002', '116.169729', '39.775677000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3383', '北京金淼鑫盾智慧物联安全科技有限公司', '1234', '周志民', '13911934829', '王志强', '13671393239', '2018年06月11日', '1000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区后沙峪镇安平街3号', '北京市', '北京市', '顺义区', '后沙峪地区办事处', '北京市顺义区后沙峪镇安平街3号', '', '消防信息化,电气防火', '有限责任公司（自然人投资或控股）', '2018年06月11日', '长期', '', '', '', '91110113MA01CRKE9U', '', '物联网技术服务；技术开发、技术咨询、技术转让、技术推广；专业承包；销售计算机、软件及辅助设备、消防设备、安全技术防范产品、电气设备、机械设备、电子产品；软件开发；计算机信息系统集成。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金淼鑫盾智慧物联安全科技有限公司是烟台淼盾物联技术有限公司设在北京的华北、东北地区总部基地。主要负责华北、东北地区的业务开展、技术服务等工作。公司是一家基于网联网、大数据、云计算技术为政府、行业主管部门、社会单位和居民家庭提供消防安全技术解决方案和安全服务的物联网企业，中国智慧消防的建设者，安全数据的运营商。\n产品1：智慧消防安全服务云平台	市场占有率：50%\n产品2：智慧消防电气火灾隐患预警平台	市场占有率：30%\n产品3：城市物联网远程监控系统	市场占有率：15%\n其它产品：淼盾慧眼系统、宅贝贝系统', '116.56207499999999', '40.119723999999998', '116.56207499999999', '40.119723999999998', '', null, null, null, null);
