INSERT INTO `t_fc_company` VALUES ('3385', '北京世纪双节清洗有限公司', '1232', '史艳军', '13031011714', '史艳军', '13031011714', '2006年07月27日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区海鹰路5号4层418室', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区海鹰路5号4层418室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年07月27日', '2026年07月26日', '', '', '', '91110106791609911A', '', '城市生活垃圾清扫；清洁服务；接受委托提供劳务服务；信息咨询（中介除外）；城市园林绿化；机动车公共停车场服务；设计、代理、发布广告；会议服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京世纪双节有限公司，清洗服务；油烟清洗', '116.28560400000001', '39.828862000000001', '116.28560400000001', '39.828862000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3386', '北京汉邦唐科技有限公司', '1231', '杜立静', '13911060921', '邢军', '18210391828', '2018年04月17日', '2000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区望京东园四区13号楼-4至33层101内A座8层808室', '北京市', '北京市', '朝阳区', '崔各庄地区办事处', '北京市朝阳区望京东园四区13号楼-4至33层101内A座8层808室', 'AA', '消防设施,消防信息化,消防产品', '有限责任公司（自然人投资或控股）', '2018年04月17日', '长期', '2019/11/15', '2020/11/14', '2019-HY-0236', '91110105MA01BGBE6R', '消防产品消防设施消防信息化', '技术开发、技术咨询、技术服务、技术转让；销售公共安全设备及器材、汽车、汽车配件、智能机器人、机械设备、通讯设备、仪器仪表、建筑材料、五金交电、计算机、软件及辅助设备、照相器材、服装、体育用品、电子产品、音响设备、鞋帽、金属材料、润滑油、化工产品（不含危险化学品）；计算机系统服务；旅游信息咨询；数据处理；货物进出口；技术进出口；代理进出口；企业管理咨询；经济贸易咨询；设计、制作、代理、发布广告；污染治理设施运营；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '汉邦唐科技有限公司 是一家以空间信息技术为核心的解决方案提供商和服务商，以技术创新为基础，提供应急管理、林业、环保、农业、消防、旅游等行业信息化建设过程中的解决方案、产品和服务。\n公司依托清华大学、中国农业大学、北京工业大学等高校，充分发挥产、学、研一体优势，建立了以知名高校博士、硕士为核心的研发团队。目前在北京、拉萨两地设有分支机构。', '116.48909399999999', '39.999397000000002', '116.48909399999999', '39.999397000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3387', '北京燕雨灭虫服务有限公司', '1230', '李月东', '', '李春风', '18601383887', '2018年09月28日', '50万元', '北京市', '北京市', '密云区', null, '北京市密云区永安街210号1至2层210-7', '北京市', '北京市', '密云区', '太师屯镇', '北京市密云区永安街210号1至2层210-7', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年09月28日', '长期', '', '', '', '91110228MA01EWPU6Q', '', '害虫防治服务；灭鼠及预防服务；树木、植物的虫害防治；建筑物清洁服务；城市园林绿化；水污染治理；厨房设备（抽油烟机等）的清洗；销售化工产品（不含危险化学品及易制毒品）、第二类医疗器械、机械设备、环保设备；软件开发；销售第三类医疗器械。（企业依法自主选择经营项目，开展经营活动；销售第三类医疗器械以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京燕雨灭虫服务有限公司成立于2018年9月，主营业务为面向机关、企事业单位、小区、宾馆、饭店、学校、医院、写字楼、商场超市、仓储、工厂、幼儿园等场所提供全面的四害消杀及保洁服务。专业师傅上门消杀，药物均经国家药监部门和卫生防疫部门批准的安全、低毒的城市卫生用药，药剂安全、无毒、无味、无刺激，环保无污染，除虫彻底、药效持久。服务一次，质保一年。\n公司同时承接北京地区大型酒店、食堂、学校、机关单位油烟管道清洗，商场大型烟道清洗，油烟净化器清洗，油烟罩清洗。施工队伍人员技术熟练，经验丰富，可根据不同的现场设备，采取灵活多样的清洗方案，利用客户非工作时间，合理安排清洗顺序，确保客户正常使用。', '117.12243100000001', '40.538324000000003', '117.12243100000001', '40.538324000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3388', '浙江大华技术股份有限公司', '1229', '傅利泉', '0571-28939522', '张立波', '13910226463', '2001年03月12日', '299757.7730万元', '', '', '', null, '杭州市滨江区滨安路1187号', '', '', '', '展览路街道', '杭州市滨江区滨安路1187号', '', '消防信息化', '其他股份有限公司（上市）', '2001年03月12日', '长期', '', '', '', '91330000727215176K', '', '计算机软件的开发、服务、销售，电子产品及通讯产品的设计、开发、生产、安装及销售，网络产品的开发、系统集成与销售，电子产品工程的设计、安装，信息技术咨询服务，经营进出口业务（范围详见《进出口企业资格证书》）。（依法须经批准的项目，经相关部门批准后方可开展经营活动）', '浙江大华技术股份有限公司，是全球领先的以视频为核心的智慧物联解决方案提供商和运营服务商，以技术创新为基础，提供端到端的视频监控解决方案、系统及服务，为城市运营、企业管理、个人消费者生活创造价值。\n\n公司现拥有16000多名员工，研发人员占比超50%，自2002年推出业内首台自主研发8路嵌入式DVR以来，一直持续加大研发投入和不断致力于技术创新，每年以10%左右的销售收入投入研发。基于视频业务，公司持续探索新兴业务，延展了机器视觉、视频会议系统、专业无人机、智慧消防、电子车牌、RFID及机器人等新兴视频物联业务。', '120.178742', '30.184103', '120.178742', '30.184103', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3389', '北京广翰消防技术有限公司', '1227', '韩宗曙', '13501359261', '孙亚宁', '15718861520', '2017年01月05日', '900万元', '北京市', '北京市', '丰台区', null, '北京市丰台区科技园富丰路4号21层21A01', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区科技园富丰路4号21层21A01', '', '建筑防火,消防设施,电气防火,消防安全检查', '有限责任公司（自然人独资）', '2017年01月05日', '2037年01月04日', '', '', '', '91110106MA00B2LX63', '', '技术开发、技术转让、技术服务、技术咨询；技术检测；工程勘察设计；电脑图文设计、制作；承办展览展示；软件开发；数据处理；应用软件服务；网上销售消防器材、仪器仪表、机械设备、水产品、针纺织品、化工产品（不含危险化学品）、汽车配件、电子产品、日用品、工艺品；技术进出口、代理进出口、货物进出口；市场调查；经济信息咨询；企业管理。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京广翰消防技术有限公司\n4.公司简介\n    北京广翰消防技术有限公司是经国家工商局正式注册，隶属于独立法人单位，面向社会开展检测工作。本公司具有独立开展检测工作的资格，具有独立账户，独立对外行文，对外法律责任由北京广翰消防技术有限公司以独立法人地位承担。设立了检测部、管理部两大部门。\n1.1 资源\n北京广翰消防技术有限公司共有13名具有丰富检测经验的专职检验/检测人员，其中2人为工程师（其中消防工程师1人），本科生3名，大专生4名，高中及中专3人。\n近1年，北京广翰消防技术有限公司投入专项建设经费100余万元，主要用于实验室改造及配备检测设备，已到位36余台（套），包括热象仪等设备，能够满足检测工作的需要。拥有100%产权。机构总面积219.99m2，，具备单独的仪器室、会议室及办公室等。\n1.2 能力范围 描述\n资质认定未通过\n机构识别\n机构名称：北京广翰消防技术有限公司\n机构性质： 消防安全检测\n法定代表人： 韩宗曙\n地址：北京市丰台区科技园富丰路4号21层21A01\n\n邮政编码： 100071\n电话： 010-83512005\n传真： 010-83512005', '116.28489999999999', '39.83531', '116.28489999999999', '39.83531', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3390', '北京玛斯特系统工程有限公司', '1226', '李海钧', '13810895518', '韩静', '18513612996', '1998年12月17日', '7500万元', '北京市', '北京市', '平谷区', null, '北京市平谷区兴谷经济开发区6区302-32号', '北京市', '北京市', '朝阳区', '呼家楼街道', '北京市朝阳区朝外大街乙6号朝外SOHO B座0659室', '', '建筑防火,消防设施', '有限责任公司（自然人独资）', '2019年07月05日', '2039年07月04日', '', '', '', '911101177000697113', '', '专业承包；计算机软硬件技术开发及转让；技术咨询、技术服务；计算机系统集成安装、调试；批发计算机软硬件及外围设备、机械电子设备；货物进出口、技术进出口；安全技术防范系统及建筑智能信息系统设计。（该企业自2019年7月5日之前为外资企业，2019年7月5日之后为内资企业。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京玛斯特系统工程有限公司成立于1998年，是专门从事建筑智能化、消防设施工程专业设计、施工、维护保养的公司。经过多年的锤炼，公司已具有了建筑智能化系统设计专项甲级资质；电子与智能化工程专业承包壹级、消防设施工程专业承包资质壹级、安防工程壹级资质等多项资质。并通过了ISO9001、ISO14001、ISO18001质量管理体系认证。', '117.14184299999999', '40.159950000000002', '116.45466399999999', '39.919662000000002', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3391', '北京隆盛清洁服务有限公司', '1225', '王飞龙', '18311470328', '王飞龙', '18311470328', '2019年09月04日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖镇京加路18号', '北京市', '北京市', '怀柔区', '雁栖地区办事处', '北京市怀柔区雁栖镇京加路18号', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年09月04日', '长期', '', '', '', '91110116MA01MENY03', '', '清洁服务；地质环境监测服务；技术开发、技术咨询、技术转让、技术推广、技术服务；城市园林绿化；施工总承包、专业承包、劳务分包；家庭劳务服务；租赁建筑工程机械、建筑工程设备；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京隆盛清洁服务有限公司成立于2019年9月，主要负责机器和办公设备的清洗，锅炉烟囱的清洗；厨房设备的清洗。', '116.658866', '40.359959000000003', '116.658866', '40.359959000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3392', '北京金航顺科技发展有限公司', '1223', '张鹏飞', '15611111750', '刘淼', '13581799820', '2019年05月08日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区汇海南路1号院4号楼4层4-503', '北京市', '北京市', '顺义区', '李桥镇', '北京市顺义区汇海南路1号院4号楼4层4-503', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年05月08日', '2049年05月07日', '', '', '', '91110113MA01KOLD7U', '', '技术开发；技术咨询；技术转让；技术推广；技术服务；清洁服务（不含餐具消毒）；保洁服务；家政服务；机械设备安装、维修；室内外装饰设计；销售厨房用具、通讯设备、安全技术防范产品、环保设备、五金交电（不含电动自行车）、建筑材料（不含砂石及其制品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金航顺科技发展有限公司位于北京市顺义区汇海南路1号院4号楼4层4-503，公司本着诚信、发展的原则，通过诚信经营、技术创新、项目管理，提倡团队精神、广泛合作、寻求发展的理念，炼造出了高素质的专业人才队伍，积累了大量的工作经验，奠定了雄厚的技术基础。主要经营技术开发；技术咨询；技术转让；技术推广；技术服务；清洁服务（不含餐具消毒）；保洁服务；家政服务；机械设备安装、维修；室内外装饰设计；销售厨房用具、通讯设备、安全技术防范产品、环保设备、五金交电（不含电动自行车）、建筑材料（不含砂石及其制品）。\n公司坚持“信守合同，提交优良新产品；不断创新，争行业先进；真诚服务，让客户满意”的承诺，秉承“诚信、发展”的企业文化，以创造更多优质的产品，报效社会，奉献客户。', '116.642129', '40.042265999999998', '116.642129', '40.042265999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
