INSERT INTO `t_fc_company` VALUES ('3394', '北京恒博远通厨房设备有限公司', '1219', '于连奎', '13910813896', '于连奎', '13910813896', '2009年02月13日', '500万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区长哨营满族乡大沟村70号', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '泉河街道开放路80-2', 'AA', '烟道清洗', '有限责任公司（自然人独资）', '2009年02月13日', '2039年02月12日', '2019/12/12', '2020/12/11', '2019-HY-0424', '91110116685119855T', '烟道清洗', '销售厨房设备、制冷设备、家用电器、五金交电、电器设备、日用杂品、灯具、灶具配件、不锈钢制品；维修家用电器；厨房设备清洗；普通货运。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京恒博远通厨房设备有限公司主要经营；不锈钢灶具、食品机械、厨房电器、制冷设备、厨房排油烟设备、油烟净化等系列产品。专供饭店、机关、院校、企业食堂及家庭厨房使用。产品包括不锈钢水池系列、操作台、餐车、食品保温系列、燃气灶具系列、商用及家用厨房排油烟设备、油烟净化系列、保鲜冷藏柜、冰柜系列、节能电开水器，燃气调压及燃气泄漏报警等系列产品。厨具展厅位于开放路80号80-2-金都KTV北侧。 “低碳、节能、环保”作为公司发展的宗旨，为新老用户提供优质的厨房设备。可以根据用户需要，提供设备定做、厨房前期规划设计、安装及售后维修服务。公司产品严格执行生产厂家售后保修标准要求，终身维修；并对用户承诺24小时到位的售后服务。 电话/传真；13910813896 69612238 邮箱；ylk2627@sina.com', '116.80745', '40.767128999999997', '116.645268', '40.339109000000001', '注册地址坐标位置不准确', null, null, null, null);
