INSERT INTO `t_fc_company` VALUES ('3405', '舜创（北京）环保科技有限公司', '1199', '刘颖达', '18601303101', '周琳', '13810284654', '2014年06月21日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区建国路77号2801内2807A单元', '北京市', '北京市', '朝阳区', '八里庄街道', '北京市朝阳区十里堡甲3号都会国际A座18A', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年06月21日', '2034年06月20日', '2018/10/12', '2019/10/11', '京消协（2018）证字309号', '91110105306341254X', '', '技术推广服务；室内环境监测；环境保护与治理咨询服务；企业管理咨询；经济贸易咨询；销售仪器仪表、建筑材料、机械设备、五金交电（不含电动自行车）、化工产品（不含危险化学品）、计算机、软硬件及辅助设备；清洁服务（不含餐具消毒）；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '舜创（北京）环保科技有限公司是一家主要致力于为客户提供排油烟设备销售、清洁服务、污水处理设备销售、室内环境监测、环境保护与治理咨询、365环保管家服务等综合性的环保企业。\n公司长期致力于为客户提供全方位管家式服务，具有丰富的废水、废气、噪声污染治理和系统运营管理经验。', '116.48023499999999', '39.909191', '116.501628', '39.91516', '', null, null, null, null);
