INSERT INTO `t_fc_company` VALUES ('3410', '北京永发平安环保科技有限公司', '1187', '张长有', '16601190191', '臧雪冬', '18911807251', '2017年10月19日', '100万元', '北京市', '北京市', '朝阳区', null, '东三环南路19号院1号楼-2至15层101内三层A406号', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '东三环南路19号院1号楼-2至15层101内三层A406号', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年10月19日', '2067年10月18日', '', '', '', '91110105MA0188070G', '', '技术推广、技术服务、技术开发、技术转让、技术咨询；清洁服务（不含餐具消毒）；销售日用品、社会公共安全设备及器材、厨房用具、卫生间用具（不从事实体店铺经营）、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京永发平安环保有限公司是一家专业从事中央空调系统清洗、油烟管道清洗的服务型企业。为用户的中央空调系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\n公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成中央空调系统清洗全系列工作。\n您的健康是我们的责任，永发平安用自己的努力，为您提供一个洁净、健康、舒适的环境。为我们人类多留一片洁净的蓝天。\n公司成立至今，目前公司有各类职工32人，从事中央空调风管清洗17人，从事油烟管道清洗15人以一流的服务、先进的技术、严格的管理为众多物业酒店提供优质服务，在同行业中树立了专业化清洁公司的典范，成为活跃在北京市高智能综合大厦、写字楼、小区、工厂学校清洁服务的尖兵。\n不懈努力、不懈追求是本公司永保活力的源泉；科学灵活的经营管理是本公司成功的保证；客户至上，信誉第一，奉行诚信服务是本公司赖以发展的宗旨。', '116.459808', '39.868271999999997', '116.459808', '39.868271999999997', '', null, null, null, null);
