INSERT INTO `t_fc_company` VALUES ('3412', '北京乐润永鑫消防工程有限公司', '1180', '郜爱云', '13901036842', '缪永军', '13911861852', '2009年04月28日', '602万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区广渠东路3号院中水电国际大厦7-435', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区广渠东路3号院中水电国际大厦7-435', '', '消防设施', '有限责任公司（自然人投资或控股）', '2009年04月28日', '2029年04月27日', '', '', '', '911101056883579470', '', '专业承包；销售五金交电、建材；技术推广服务；产品质量检验。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京乐润永鑫消防工程有限公司成立于2009年4月公司位于北京广渠东路，紧临东四环，交通便利。 \n        从事消防工程施工、调试、消防系统维护、保养的专业消防公司，拥有专业的技术人员和经验丰富的施工队伍，以及完备的消防检测设施。\n        北京乐润永鑫消防工程有限公司为二级消防施工资质，主要做消防施工及做维保（如中央机构编制委员会）。\n        公司自成立以来，以人为本、用户至上，树诚信形象、创优质品牌，坚持对客户负责、对社会负责的态度，严控施工质量，精益求精，为广大用户提供优质消防服务。', '116.501805', '39.893738999999997', '116.501805', '39.893738999999997', '', null, null, null, null);
