INSERT INTO `t_fc_company` VALUES ('3414', '北京安宏兴消防器材有限公司', '1178', '郜爱云', '13901036842', '郜风云', '13911861852', '2002年04月01日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区广渠东路3号院中水电国际大厦附楼4层432', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区广渠东路3号院中水电国际大厦附楼4层432', 'AAA', '消防产品', '有限责任公司（自然人投资或控股）', '2002年04月01日', '2022年03月31日', '2018/10/30', '2019/10/29', '京消协（2018）证字334号', '911101057376826917', '', '销售消防器材及设备、防火涂料、防火门、建筑材料（不从事实体店铺经营）、仪器仪表、五金交电（不从事实体店铺经营、不含电动自行车）、日用品、服装、化工产品（不含危险化学品）、电子产品、计算机、软件及辅助设备、通讯设备；修理消防器材；消防设备检测；技术咨询、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安宏兴消防器材有限公司,成立于一九九三年隶属于国家安全部下属企业，企业类型为有限责任公司,公司位于北京广渠东路，紧临东四环，交通便利。\n     公司主要销售名优消防器材及设备（火灾灭火系统、泡沫灭火装置、消防炮、柴油消防泵组、超细干粉灭火系统、气体灭火系统、消防栓、消防炮、消防水带、水枪、接口、消火栓箱、灭火器箱、防火门、防火涂料、各类消防标致灯、灭火器、防爆工具、破拆工具、空气呼吸器等个人防护装备）及灭火器维修\n     公司通过了ISO9000质量认证；是消防局核准备案企业，消防局指定的专业维修灭火器的厂家，取得消防设备维修服务资质三级资质。我们为用户提供优质的售前、售中、售后服务，并盈得了广大用户的信赖与好评！并多次被消防局授予消防工作先进单位称号！\n     公司凭借雄厚的科技人才基础、扎实的施工技术力量、科学严谨的质量保证体系、先进的施工技术设备来保证为广大客户提供优质满意的服务。\n     我们将再接在励为广大用户提供优质的消防产品，并提供优质的服务来满足广大用户的使用要求，共筑平安！', '116.501892', '39.894632000000001', '116.501892', '39.894632000000001', '', null, null, null, null);
