INSERT INTO `t_fc_company` VALUES ('3428', '北京修哪儿互联网科技有限公司', '1159', '杨一萌', '18501258927', '马晓雨', '13801058260', '2015年01月28日', '204.7838万元', '北京市', '北京市', '海淀区', null, '北京海淀区阜成路11号3号楼第四层419-421室', '北京市', '北京市', '海淀区', '北下关街道', '北京市海淀区皂君庙路国家农业科技创新园北圃场', '', '烟道清洗', '其他有限责任公司', '2015年01月28日', '2065年01月27日', '', '', '', '91110108330337327R', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；会议服务；承办展览展示活动；销售计算机、软件及辅助设备、电子产品、通讯设备、家用电器、厨房用具、卫生间用具、自行开发后的产品、医疗器械Ⅱ类、日用品；计算机维修；日用电器修理（限符合家用电子电器维修业服务经营规范）；建筑物清洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京修哪儿互联网科技有限公司（品牌名“修哪儿”）成立于2012年01月28日，注册资金204.7838万元。是全国第一家以家电维修及保养为切入点的社区服务O2O平台，致力于让所有的维修问题变得更简单。公司服务目前主要覆盖全国30个省市及韩国、英国等海外市场。全国服务人员32万余名，服务用户累计三百多万。修哪儿率先推出了平台+自营的双规模式，采用英式管理，德式服务，透明低廉的价格，标准化工序，解决用户对水电电器维修的“不信任”痛点。专业工程师在修哪儿App、网站以及微信平台24小时接单待命，快速调配就近解决所有维修问题。例如水电线路问题、家用与商用电器、手机售后以及各种设备的检修、维护、清洗以及回收置换等需求！', '116.326325', '39.921588999999997', '116.332866', '39.966076999999999', '经营地址坐标位置不准确', null, null, null, null);
