INSERT INTO `t_fc_company` VALUES ('3430', '北京国禾安全技术有限公司', '1154', '唐念嫄', '18618292972', '王硕', '13811705213', '2016年03月28日', '300万元', '北京市', '北京市', '朝阳区', null, '北京朝阳区高碑店乡西店村56号楼5号一层', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京朝阳区高碑店乡西店村56号楼5号一层', '', '消防设施,宣传教育培训,消防产品,消防安全评估', '有限责任公司（自然人投资或控股）', '2016年03月28日', '2046年03月27日', '', '', '', '91110105MA004ELR1H', '', '技术推广服务；销售社会公共安全设备及器材、日用品、电子产品、医疗器械（I类）；健康咨询（须经审批的诊疗活动除外）；经济贸易咨询；计算机维修；工程勘察、设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京国禾安全技术有限公司是一家专业提供社会公共安全设备、消防器材、消防培训、消防设施、医疗器械，为客户提供最新安全类咨询，消防专业知识，家居安全专业培训顾问，家庭实用安全产品介绍与推荐，号召更多人家主动预防火灾，远离火灾伤害，为您的家庭人身安全保驾护航，努力打造成为国内家居安全用品领导品牌运营商。', '116.51970900000001', '39.904736', '116.51970900000001', '39.904736', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3431', '北京众安美悦科技有限公司', '1150', '王胜堂', '15311064655', '王胜堂', '15311064655', '2019年06月27日', '100万元', '北京市', '北京市', '西城区', null, '北京市海淀区志强北园30号楼1层125', '北京市', '北京市', '西城区', '德胜街道', '北京市海淀区志强北园30号楼1层125', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年06月27日', '2049年06月26日', '', '', '', '91110108MA01L39B8L', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；建筑物清洁服务；公共关系服务；承办展览展示活动；体育运动项目经营（高危险性体育项目除外）；健康管理（须经审批的诊疗活动除外）；健康咨询（须经审批的诊疗活动除外）；家庭服务（限符合家政服务通用要求）；销售开发后的产品、安全技术防范产品、文化用品；餐饮管理；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京众安美悦科技有限公司是一家以保洁服务、建筑物清洁服务为主的服务型企业，主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品。北京众安美悦科技有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。 我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念，始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为您提供最完美的服务。', '116.36613', '39.954070000000002', '116.36613', '39.954070000000002', '', null, null, null, null);
