INSERT INTO `t_fc_company` VALUES ('3433', '北京峰涛立洁保洁有限公司', '1147', '李涛', '13311533523', '王越奇', '18901126770', '2013年06月08日', '500万元', '北京市', '北京市', '昌平区', null, '北京市昌平区城北街道商业街30号三层302', '北京市', '北京市', '昌平区', '城北街道', '北京市昌平区城北街道商业街30号三层302', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年06月08日', '2033年06月07日', '', '', '', '91110105071749078J', '', '保洁服务；管道疏通；技术推广服务；承办展览展示活动；经济贸易咨询；销售日用品、建筑材料、五金交电（不含电动自行车）、机械设备、家用电器；租赁建筑工程机械设备；维修家用电器；专业承包；家庭劳务服务；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京峰涛立洁保洁有限公司是一家具有独立法人资格的股份制合作专业化保洁服务公司,北京消防协会会员单位。公司拥有一批专业保洁服务人才，技术力量雄厚。公司拥有一批世界知名品牌的专业保洁设备。本公司坚持“以质量求生存、以信誉求发展”为原则，来 为客户提供最完美的服务。\n   本公司主要承接项目\n1.各大酒店、宾馆、酒楼、会馆、学校食堂档口、企事业单位餐厅、商场美食城、等等的厨房烟罩、烟道、净化器、风机的清洗、及维修、厨房设备的维修与保养。\n2.酒店、宾馆、大厦、写字楼、商场、机关单位、小区的各项保洁服务，保洁托管、开荒保洁、清洁石材、地面、翻新、结晶、保养打蜡、高空外墙清洗，清洗空调与管道，木地板保洁与保养，地毯清洗。\n   我公司自成立以来，已经建立了一套比较完美的质量，监督、管理体系。会以“服务第一、质量第一、管理第一”为我公司的服务宗旨，来做好每一个客户给予的工作。我公司全体员工愿以一流的服务，最低的价格为广大客户提供一个洁净、舒适的环境。', '116.23168699999999', '40.214908999999999', '116.23168699999999', '40.214908999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3434', '北京嘉伯瑞科技有限公司', '1146', '李国荣', '13910003337', '李国荣', '13910003337', '2015年07月28日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖经济开发区乐园大街17号2层', '北京市', '北京市', '怀柔区', '北京雁栖经济开发区', '北京市怀柔区雁栖经济开发区乐园大街17号2层', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年07月28日', '2035年07月27日', '', '', '', '9111011635157417X3', '', '技术开发、技术服务、技术咨询、技术转让；家庭劳务服务；建筑物清洁服务；代理进出口、技术进出口、货物进出口；销售化工产品（不含危险化学品）、五金交电（不含电动自行车）、日用杂货、电子产品、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京嘉伯瑞科技有限公司，本公司成立于2015年07月28日，目前主要经营建筑物清洁服务，现申请会员证', '116.687279', '40.348705000000002', '116.687279', '40.348705000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3435', '北京龙链科技有限公司', '1144', '高彦彬', '18210429883', '高志超', '18210429883', '2015年12月18日', '1000万元', '北京市', '北京市', '丰台区', null, '马家堡东路106号2号楼9层909', '北京市', '北京市', '丰台区', '大红门街道', '马家堡东路106号2号楼9层909', '', '宣传教育培训', '有限责任公司（法人独资）', '2015年12月18日', '2035年12月17日', '', '', '', '91110106MA002MAJ7M', '', '销售食品；电影放映；电影发行；互联网信息服务；广播电视节目制作；从事互联网文化活动；技术开发、技术推广、技术服务、技术转让；发布广告；经济信息咨询；市场调查；投资管理；会议服务；销售日用品、电子产品、软件及辅助设备、计算机软硬件及辅助设备、健身器材；数据处理；软件开发；企业形象策划；营销策划；会议服务；承办展览展示活动；组织文化艺术交流活动；电脑动画设计；电脑图文设计、制作；标识设计；舞台灯光音响设计；影视策划；代理、租赁、机械设备；计算机软硬件开发；商务咨询服务；设计、制作、代理发布广告；计算机系统服务。（“1、未经有关部门批准，不得以公开方式募集资金；2、不得公开开展证券类产品和金融衍生品交易活动；3、不得发放贷款；4、不得对所投资企业以外的其他企业提供担保；5、不得向投资者承诺投资本金不受损失或者承诺最低收益”；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京龙链科技有限公司成立于2015年，公司主营业务为互联网在线直播业务，公司自主开发“酸枣”直播平台，该平台是一个基于微信的语音、视频在线学习平台，专注于各个领域的知识分享、学习，单课支持十万人同时在线，内容永久保存，可随时回放，适用于行业干货、大V分享、个人经验、网红直播、在线答疑、营销培训等高质量内容分享。目前，酸枣直播，以公众直播为主，涵盖了生活、综艺、课堂等多种直播内容。每天，都有众多的观众与主播在酸枣直播在线交流、分享生活，从而获得属于自己独一份的生活品质。\n        酸枣直播欢迎每一名用户，无论是组织还是个体，无论是主播还是观众，我们都全心为您提供好的直播环境与观看环境，如果您有创意、有才华、有执行力，欢迎加入充满无限可能的“酸枣”。我们的服务宗旨是，随时随地让精彩发声。\n      公司成立以来，遵纪守法、合法经营，无违法违规行为。', '116.38701500000001', '39.841377000000001', '116.38701500000001', '39.841377000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3436', '北京圣邦环境科技有限公司', '1142', '孙立峰', '18911957845', '李亚周', '18510088305', '2014年07月11日', '100万元', '北京市', '北京市', '昌平区', null, '北京市昌平区南邵镇三合庄村三合街46号', '北京市', '北京市', '昌平区', '南邵镇', '北京市昌平区南邵镇三合庄村三合街46号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年07月11日', '2034年07月10日', '2018/9/26', '2019/9/25', '京消协（2018）证书303号', '91110114306392887B', '', '技术开发、技术服务、技术咨询、技术转让；专业承包；建筑物清洁服务；家庭劳务服务；维修家用电器；技术检测；销售机电设备、厨房用具、家用电器、日用品、电子产品、文化用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京圣邦环境科技有限公司是一家专业做机关、部队、学校食堂以及饭店、酒店厨房油烟管道、风机、净化器清洗的一家专业服务公司，公司一直秉承“改善环境，保护健康，消除隐患”的服务宗旨；因为了解油烟管道清洗这个行业，所以更关注服务质量；因为清楚清洗油烟管道行业的特殊性，所以更注重清洗前后的安全和预防。公司的发展壮大离不开广大用户的鼓励和支持，我们始终把“客户至上，服务至上”的理念牢记心头，给我们一次机会也给您一次享受金牌服务的机会！', '116.292979', '40.234095000000003', '116.292979', '40.234095000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3437', '北京东方舜景科技发展有限公司', '1141', '胡有恩', '13426251312', '张方方', '15601166669', '2016年07月07日', '500万元', '北京市', '北京市', '朝阳区', null, '双营路2号院12号楼一层105内105-2-2', '北京市', '北京市', '朝阳区', '来广营地区办事处', '双营路2号院12号楼一层105内105-2-2', '', '建筑防火,消防设施,烟道清洗,消防产品,消防安全检查', '有限责任公司（自然人独资）', '2016年07月07日', '2036年07月06日', '', '', '', '91110105MA006QBL24', '', '技术开发、技术转让、技术咨询、技术服务；销售机械设备、建筑材料、金属材料、五金交电、化工产品（不含危险化学品）、电子产品、计算机、软件及辅助设备、日用品、文具用品、工艺品、新鲜蔬菜、新鲜水果、未经加工的干果、坚果、化妆品；承办展览展示活动；组织文化艺术交流活动（不含演出）；害虫防治服务；物业管理；出租商业用房；餐饮管理；家庭服务（不符合家政服务通用要求不得开展经营活动）；代收洗衣服务；机动车公共停车场服务；儿童室内游戏娱乐服务（不含电子游艺）；打字、复印服务；组织体育赛事；体育运动项目经营（高危险性体育项目除外）；清洁服务（不含餐具消毒）；城市生活垃圾清扫、收集、运输、处理；销售食品。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东方舜景科技发展有限公司成立于2016年7月7日，坐落于北京市朝阳区双营路2号院12号楼，注册资金500万元，是一家集于技术开发、销售机械设备、餐饮管理、清洁服务为一体的科技传媒有限公司。\n我公司响应中共十九大提出的，加强社会主义精神文明建设的号召，大力发展清洁产业，发掘中国传统文化中的经纪价值，将清洁服务转化为市场动力，即传播了中国传统文化，又实现了经济利益增长，促进产业的良好发展。', '116.42688099999999', '40.037211999999997', '116.42688099999999', '40.037211999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3438', '北京百方教育咨询有限公司', '1140', '辛伟', '15210304868', '辛伟', '15210304868', '2013年07月29日', '30万元', '北京市', '北京市', '顺义区', null, '北京市顺义区天竺空港工业区B区安庆大街9号5幢2层202室', '北京市', '北京市', '顺义区', '空港街道', '北京市顺义区天竺空港工业区B区安庆大街9号5幢2层202室', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2013年07月29日', '2033年07月28日', '', '', '', '911101050741376165', '', '教育咨询（不含出国留学咨询及中介服务）；技术开发、技术转让、技术咨询；计算机技术培训（不得面向全国招生）；企业管理；企业策划；经济贸易咨询；器乐技术培训（不得面向全国招生）；舞蹈技术培训（不得面向全国招生）；声乐技术培训（不得面向全国招生）；绘画技术培训（不得面向全国招生）；组织文化艺术交流活动（不含演出）；承办展览展示活动；礼仪服务；会议服务；销售乐器、工艺品、文具用品、计算机、软件及辅助设备、电子产品；设计、制作、代理、发布广告；计算机系统服务；计算机维修；电脑图文设计、制作。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '消防安全宣传教育和技术培训', '116.544738', '40.096553999999998', '116.544738', '40.096553999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3439', '北京来菜乐科技有限公司', '1139', '靳军', '18510880158', '靳军', '18510880158', '2016年10月11日', '600万元', '北京市', '北京市', '怀柔区', null, '雁栖经济开发区乐园大街38号', '北京市', '北京市', '怀柔区', '庙城地区办事处', '融城北路10号院73号楼1层107', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年10月11日', '长期', '', '', '', '91110116MA008P4712', '', '计算机技术开发；会议服务；机动车公共停车场管理服务；物业管理；厨房设备清洗服务；办公室保洁服务；建筑物清洁服务；家庭劳务服务；害虫防治服务；灭鼠及预防服务；城市园林绿化；施工总承包、劳务分包、专业承包；经济信息咨询；设计、制作、代理、发布广告；机械设备专业清洗服务；生活清洗消毒服务；化粪池清掏；管道疏通；销售电气设备、家用电器、厨房设备、金属制品；环境监测；工程管理服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京来菜乐科技有限公司是一家专业型服务企业，拥有专业清洗设备及清洗队伍，本公司经过专业的清洗培训，拥有一批专业清洗人员，主要从事排油烟设施清洗服务、厨房设备清洗服务；办公室保洁服务；空调清洗服务；管道疏通服务；更换纱窗；建筑物清洁服务；家庭劳务服务；害虫防治服务；灭鼠及预防服务；城市园林绿化；机动车公共停车场管理服务；物业管理；租赁建筑工程设备、建筑工程机械；会议服务；施工总承包、劳务分包。本公司经过专业培训，拥有相关专业技术人员并获得了北京市消防协会颁发的《排油烟设施清洗》行业资质，管理机制完善，清洁作业经验丰富，凭着优良的清洁质量、便捷的服务于各行各业千家万户。', '116.672111', '40.345101999999997', '116.635459', '40.297288999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3440', '北京新朝商贸有限公司', '1138', '古连辉', '17772521503', '古连辉', '17772521503', '2019年08月19日', '800万元', '北京市', '北京市', '房山区', null, '北京市房山区窦店镇山水汇豪苑60号楼12层八单元1201', '北京市', '北京市', '房山区', '窦店镇', '北京市房山区窦店镇山水汇豪苑60号楼12层八单元1201', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年08月19日', '长期', '', '', '', '91110111MA01M5FT4A', '', '销售服装、鞋帽、机械设备、五金交电（不含电动自行车）、家用电器、家具、卫生用品、电子产品、建筑材料、日用杂货、汽车零配件、通讯设备、文化用品（音像制品除外）；清洁服务；维修机械设备、仪器仪表、家用电器；建筑物清洁服务；家庭劳务服务；家居装饰；承办展览展示；会议服务；施工总承包；专业承包；劳务分包；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京新朝商贸有限公司是一家经过正式注册，拥有合法经营执照的正规企业。专业从事酒店、食堂、学校、机关单位油烟管道清洗，烟道清洗，大型油烟机清洗服务的清洗技术公司，我公司将人性化的服务模式及专业的清洗技术融为一体，拥有严格的管理制度、先进的设备、一流的服务质量，精湛的技术。清洗维修技师都具备多年清洗、维修、安装经验，并不断吸收新的技术和先进的检测设备来满足广大客户的需求。所有的工作人员上岗前都必须经过严格的岗前培训及思想素质的提升，并通过统一的考核方可上岗。\n公司的服务形式灵活多样，价格合理，并全心全意为客户提供细致周到的服务，客户的满意和认可是我们赖以生存的基础，也是我公司全体员工坚持不懈的追求目标,公司在运营中注重各方面的管理，定期对各岗位员工进行清洁技术培训，严格要求，积极进取，并且不断完善更加有效的管理体系，不断创新，不断前进，以尽善尽美的服务为每一位客户打造一个健康、洁净、舒适的美好环境\n采用高压清洗机和蒸汽清洗机，可以很好的去除顽固的油渍、污渍、消除细菌、快速杀菌等问题，其应用场所可以遍及任何地方，甚至任何人手难以到达点位。', '116.072531', '39.647522000000002', '116.072531', '39.647522000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3441', '北京市西城区中磊职业技能培训学校', '1136', '张磊', '13911448084', '张磊', '13911448084', '', '30万元', '北京市', '北京市', '西城区', null, '北京市西城区宣武门外大街25号富豪写字楼四层401', '北京市', '北京市', '西城区', '椿树街道', '北京市西城区宣武门外大街25号富豪写字楼四层401', '', '宣传教育培训,消防安全评估', '', '2019年06月05日', '2020年05月31日', '', '', '', '521101025731502417', '', '', '北京市西城区中磊职业技能培训学校（以下简称：中磊培训）于2011年经北京市西城区人力资源和社会保障局批准，在西城区民政局登记注册并正式成立，是专门从事各项专业培训的民办非企业单位。单位地址为北京市西城区宣武门外大街25号富豪写字楼四层。\n       中磊培训以“提升就业技能，拓宽就业能力”为办学方针，开展等级培训、非等级培训、定制培训等多方位技能培训。\n       为了紧密贴合就业市场，提高培训适应能力，中磊培训不断的优化扩大师资队伍，目前拥有一支含专、兼职专家、教授等高级职称的教学团队。', '116.373864', '39.897320999999998', '116.373864', '39.897320999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3442', '北京雅林士博建筑工程有限公司', '1134', '林山', '13801137376', '王雅婷', '18600171758', '1994年03月09日', '3000万元', '北京市', '北京市', '石景山区', null, '北京市石景山区杨庄路70号院5号楼1层', '北京市', '北京市', '石景山区', '八角街道', '北京市石景山区杨庄路70号院5号楼1层', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2011年12月19日', '2061年12月18日', '', '', '', '91110108101401639B', '', '建筑装修装饰工程专业承包壹级；经济信息咨询（不含中介服务）；工程勘察设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京雅林士博建筑工程有限公司（原名北京雅林士达装饰公司）是由建筑界资深人士胡承林先生发起，于一九九四年注册成立，拥有建筑装修装饰专业承包壹级、建筑装饰专项工程设计甲级、建筑幕墙工程设计与施工贰级及钢结构工程专业承包、金属门窗工程专业承包、特种专业工程专业承包、机电安装工程专业承包及安防工程贰级等资质。公司成立近二十年来一直坚持不断提升产品品质和客户价值，构建了完善的管理体系，公司通过了ISO9001质量管理体系认证、ISO14001环境管理体系认证、GB/T28001职业健康安全管理体系认证。雅林士博聚集了一批高素质的管理和技术人才，我们将团队合作制度化，注重人才构成的“质”与“量”，创造人才结构的梯次分布和动态变化，充分发挥每个员工的潜在能力，最终实现人才体系整体效果的优化。', '116.18798700000001', '39.921790000000001', '116.18798700000001', '39.921790000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3443', '北京一只船教育科技有限公司', '1132', '王凯飞', '18513115191', '王奥', '15200820901', '2016年03月03日', '120万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区劲松三区甲302楼13层1306A室', '北京市', '北京市', '昌平区', '回龙观地区办事处', '北京市昌平区中腾建华商务大厦3层', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2016年03月03日', '2036年03月02日', '', '', '', '91110105MA003Y8Y5T', '', '技术推广服务；经济贸易咨询；组织文化艺术交流活动（不含演出）；会议服务；电脑图文设计、制作；教育咨询（不含出国留学咨询及中介服务）；企业策划；设计、制作、代理、发布广告；互联网信息服务；从事互联网文化活动；出版物零售。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、出版物零售、互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '从2016年开始，北京一只船教育科技有限公司便秉承“专业、高效”的服务理念，积极配合国家“公安部61号和129号令” 国家“产学融合”“军民融合”“科教融合”战略需求为导向，以中国人才增值为己任，大力推动产业发展。\n北京一只船教育科技有限公司是一所擅于结合自身优势，通过产业孵化和实训实践实现院校学生并集研发、教学、就业和职业发展于一体的中国立体化人才增值新模式的企业。\n公司目前只主营职业证书——注册消防工程师项目，力求为学员提供完整的再教育平台，形成完善的教育培训生态产业链。\n核心人员均是来自国内各大教育机构，消防系统人才，业务能力覆盖全国30多个省市自治区。', '116.460244', '39.882900999999997', '116.33592400000001', '40.058742000000002', '', null, null, null, null);
