INSERT INTO `t_fc_company` VALUES ('3445', '北京同华兴达环境工程技术有限公司', '1128', '许丹华', '13436495327', '靳宝同', '18610308504', '2019年08月05日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧桥路25号院9号楼3层305', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧桥路25号院9号楼3层305', '', '烟道清洗,消防产品', '有限责任公司（自然人投资或控股）', '2019年08月05日', '2039年08月04日', '', '', '', '91110115MA01LUTH8W', '', '工程技术咨询；工程设计；工程勘察；技术开发、转让、服务、推广；专业承包；劳务分包；维修空调制冷设备、厨房设备；清洁服务；租摆花卉；病虫害防治服务；大气污染治理；园林绿化管理；水污染治理；企业管理；物业管理；销售空调制冷设备及配件、水处理设备、机械设备、电气设备、五金产品（不含电动自行车）、建筑材料、化工产品（不含危险化学品及一类易制毒化学品）、电子产品、仪器仪表、厨房用具、卫生间用具。（企业依法自主选择经营项目，开展经营活动；工程设计、工程勘察以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京同华兴达环境工程有限公司，是一家集排油烟设备维修、清洗服务于一体的综合性公司。公司以美化生活，优化环境、服务社会为目的，以“高质量、低价格，优服务、快效率”为服务宗旨，全力贯彻管理人性化、工作细腻化、作业标准化、服务诚信化的方针政策，始终如一的坚持“诚实、正直、勤劳、俭朴”的宗旨，在油烟清洗行业精益求精，在环境绿化上努力奉献自己的一份力量。\n       公司清洗项目包括灶台、烟罩、烟管道、风机、过滤净化器等。公司本着“以人为本、诚信至上、立足环保、优质服务”的原则，严格按照“系统调查、科学分析、高质量施工、完善的售后服务”的工作流程，为客户提供周到、细致的清洗、消毒、维修等优质服务。我们拥有完善的技术经验、拥有先进的清洗、消毒、净化等设备及产品，同时也拥有训练有素的专业技术人员队伍。\n       诚信是我们立业的基本，服务至上是我们永恒的主题，您的满意将是我们最大的动力。', '116.45520999999999', '39.792779000000003', '116.45520999999999', '39.792779000000003', '', null, null, null, null);
