INSERT INTO `t_fc_company` VALUES ('3454', '庞德迪隆（北京）智能科技有限公司', '1118', '张多福', '13911889094', '苏正樱', '13911889094', '2015年12月21日', '3168万元', '北京市', '北京市', '密云区', null, '大桥路67号十里堡镇政府办公隆407室－2172', '北京市', '北京市', '密云区', '北京密云经济开发区', '大桥路67号十里堡镇政府办公隆407室－2172', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年12月21日', '2035年12月20日', '', '', '', '91110228MA002NNFX3', '', '技术开发、技术推广、技术咨询、技术服务；家居装饰；设计、制作、代理、发布广告；零售灯具、建筑材料、五金、交电、机械设备、家具、文具用品、厨房用具、专用设备；建筑物清洁服务；害虫防治服务；灭鼠及预防服务；大气污染治理服务；林业有害生物防治活动；城市园林绿化；建筑物清洁服务；物业管理；餐饮管理；家庭劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '庞德迪隆（北京）智能科技有限公司成立于2015年12月21日，注册资金3000万元，拥有员工26人。公司主营业务是中央空调设备安装、维护、维修保养、水处理和通风管道清洗全系列服务；厨房设施设备安装、维修、托管、清洗服务；楼宇保洁服务、外墙清洗服务、石材养护服务、消杀灭虫服务、下水管网疏通服务等。 我们的服务对象包含党政机关、单位，院校、医院，宾馆、饭店，餐厅、物业公司等，业务区域覆盖京、津、冀、辽地区。 “做中国酒店业、餐饮业的后勤管家服务”是我们的使命。荣誉在身我们继续努力，责任在肩我们一刻不停，为您、为社会，为我们的使命，不忘初心一路前行。', '116.80151600000001', '40.358508999999998', '116.80151600000001', '40.358508999999998', '', null, null, null, null);
