INSERT INTO `t_fc_company` VALUES ('3456', '北京茗钧一涵商贸有限公司', '1115', '刘宁', '18611255990', '刘伟轮', '13701190380', '2010年05月14日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北苑2号院（北苑路66号）中国民用飞机开发公司宾馆内209室', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区北苑2号院（北苑路66号）中国民用飞机开发公司宾馆内209室', '', '烟道清洗,消防产品', '有限责任公司（自然人投资或控股）', '2010年05月14日', '2030年05月13日', '', '', '', '911101055548248294', '', '批发（非实物方式）预包装食品；销售日用品、文具用品、工艺品、服装、电子产品、建筑材料、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京茗钧一涵商贸有限公司成立于2010年5月14日，公司所在地为北京市朝阳区北苑   一、 企业基本概况\n北京茗钧一涵商贸有限公司，主要经营预包装食品、日用百货、文具用品、工艺品服装电子产品，建筑材料，机械设备。从公司建立以来取得了显著的成效，在经营的前提下完善更加创新。\n茗钧一涵商贸还是一个以文化核心价值为统领的现代化商贸企业，企业既有章程，还有完善的管理制度。\n二、企业经营情况\n公司的商品以包装食品为主，兼及日用百货等预包装产品。目前注册资本为50万元。自从公司成立以来，经过艰苦卓越的努力，极大地提高了公司商品质量，实现连续性、规模化大生产，最大效率的满足了消费者的购买心。\n三．工作计划\n2019年是我公司阶段的一年。人力资源制度建设、渠道建设等方面货币投入到位、思想意识到位、执行结果到位，为公司2020年全面启动经营打下了坚实的基础。为了下一步更好的发展，我公司将申请加入北京市消防协会，扩大公司经营项目，更好的服务社会。\n\n本公司希望在消防技术服务上和行业程序规范上，更好的为社会服务。以及在消防管理方面，为全社会做出更多贡献，提供更好服务，增加与公众的交流沟通，特此申请入会。', '116.42081899999999', '40.037438999999999', '116.42081899999999', '40.037438999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
