INSERT INTO `t_fc_company` VALUES ('3460', '北京中森世纪环保科技有限公司', '1106', '崔秀花', '18911807251', '臧雪冬', '18911807251', '2013年07月12日', '50万元', '北京市', '北京市', '丰台区', null, '和光里1号1层3单元1003', '北京市', '北京市', '丰台区', '丰台街道', '和光里1号1层3单元1003', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2013年07月12日', '2033年07月11日', '', '', '', '911101060741836714', '', '技术开发、技术转让、技术服务；城市园林绿化服务；清洁服务；日用电器修理（不符合家用电子电器维修业务服务经营规范不得开展经营活动）；家庭服务（不符合家政服务通用要求不得开展经营活动）；会议服务；经济信息咨询；组织文化艺术交流活动；销售清洁用品、日用品、文具用品、五金交电（不含电动自行车）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中森世纪环保科技有限公司是一家集环保技术研发、设计、制造、销售于一体的民营科技企业，公司总部位于北京，在国内多数城市设有分公司和办事处，同时在北京各区有现代智能化制造基地，产品不仅畅销国内市场，也远销韩国、东南亚、中东、欧洲、美洲及港澳台等国家和地区。 依靠科技求发展，自2014年以来，中森一直专注于静电技术在空气污染防治、餐饮油烟、工业废气处理、自动节能烤炉等领域的应用，凭借领先的科技，精湛的工艺和卓越的品质，不断取得革命性突破，在充分引进和吸收国内外先进技术的基础上，陆续研发出多款具有卓越品质的KL系列化油烟净化产品、废气处理设备、厨房排烟系统智能设备、商用节能电烤炉。 业务范围：生产静电式油烟净化器；销售环保设备；租赁空气净化设备；劳务服务；保洁服务；清洁服务；环保技术开发、技术咨询、技术服务，提供相应售后服务。', '116.26171600000001', '39.862250000000003', '116.26171600000001', '39.862250000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3461', '北京丽洁环通保洁服务有限公司', '1105', '田玉伟', '13811935318', '田玉伟', '13811935318', '2010年10月25日', '200万元', '北京市', '北京市', '丰台区', null, '北京市丰台区青塔西路58号院21号楼1层07室', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区青塔西路58号院21号楼1层07室', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年10月25日', '2030年10月24日', '2018/8/27', '2019/8/26', '京消协（2018）证书278号', '91110106563659175M', '', '清洗保洁服务；接受委托提供劳务；家庭服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京丽洁环通保洁服务有限公司是一家经过正式注册，具有合法经营执照的正规企业。公司拥有严格的管理制度、先进的设备、一流的服务质量，清洗维修技师均具备多年清洗、维修、安装经验，专业提供油烟管道清洗、厨房设备维修以及大理石结晶养护和地毯清洗等服务。经过多年施工，我公司积累了丰富的经验，北京丽洁环通保洁服务有限公司是一家年轻、充满朝气、具有法人资格的专业性保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写字楼、娱乐场所等提供全方位的清洗保洁服务，包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清洗保洁服务。可以为不同领域客户提供全方位的满意服务。 作为北京消防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了良好的口碑。 科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是本公司信赖以发展的宗旨', '116.265283', '39.880578999999997', '116.265283', '39.880578999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3462', '北京高洁恒通科技有限责任公司', '1104', '刘庆斌', '13901097240', '刘庆斌', '13901097240', '2010年08月17日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区新源南路6号京城大厦2006A', '北京市', '北京市', '朝阳区', '左家庄街道', '北京市朝阳区新源南路6号京城大厦2006A', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年08月17日', '2030年08月16日', '', '', '', '91110105560392647Q', '', '技术推广服务；销售机械设备、电子产品、计算机软硬件及辅助设备、医疗器械（Ⅰ类）、日用品、化工产品（不含危险化学品）；清洁服务（不含餐具消毒）；污染治理设施运营。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我单位北京高洁恒通科技有限责任公司，成立于2010年08月17日，注册地址在北京市朝阳区新源南路6号京城大厦2006A，主要经营范围：	技术推广服务；销售机械设备、电子产品、计算机软硬件及辅助设备、医疗器械（Ⅰ类）、日用品、化工产品（不含危险化学品）；清洁服务（不含餐具消毒）；污染治理设施运营。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '116.45303', '39.947381', '116.45303', '39.947381', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3463', '北京利金源消防工程有限公司', '1103', '刘晓华', '13701139250', '于海燕', '18516858768', '2014年09月29日', '2000万元', '北京市', '北京市', '密云区', null, '高岭镇政府办公楼208室-518', '北京市', '北京市', '朝阳区', '团结湖街道', '绿洲开发区', '', '消防设施,消防产品', '有限责任公司（自然人独资）', '2014年09月29日', '2044年09月28日', '', '', '', '911102283179522456', '', '施工总承包、专业承包、劳务分包；城市园林绿化；室内装饰工程设计；工程勘察；工程设计；旅游资源开发；公路养护、管理；家居装饰；建设工程项目管理；销售建筑材料、五金交电（不含电动自行车）、化工产品（不含危险化学品及易制毒品）、金属材料、金属制品、专用设备、通用设备、通讯设备、体育用品、工艺品（不含文物）、消防器材、仪器仪表、矿产品（不包含煤炭及石油制品）。（（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。））', '北京利金源消防工程有限公司简介\n北京利金源消防工程有限公司坐落在北京市密云区绿洲开发区，紧邻密云环城主干道，可快速到达京承高速公路。\n我公司是一家专业从事厨房自动灭火装置设计、研发、销售、安装、维护保养一体的智能企业。公司销售CMJS10-1-MY型和CMJS18-2-MY型厨房设备自动灭火装置，可在3-8秒内扑灭火情，被誉为厨房安全卫士。目前已取得国家CCC强制性认证证书，通过国家质量监督检验中心检测。为诸多酒店、宾馆、机关、医院、学校等企事业单位提供了高安全、高精度、高品质的厨房自动灭火设备。\n近年来，公司以科技为导向，以智能化产品为创新，不断将新材料、新工艺、新技术融入产品中，确保一流品质。坚持从市场需求出发，针对每一位客户意愿，提出贴心的设计方案。并以厨房为基点，展现不同的产品风格和生活理念，彰显个性自我。已申请四项专利产品，部分专利已审批发证，领跑行业产品。\n在机遇与挑战并存的今天，我公司以市场需求为导向、创新争先为动力、用户满意为目标，竭诚为您提供厨房设备灭火装置系统产品、工程施工及咨询服务。\n“海纳百川、追求卓越”，广集人才、智慧，精心打造企业的核心竞争力，不断提升企业文', '117.11096499999999', '40.604450999999997', '116.46069300000001', '39.929409', '经营地址坐标位置不准确', null, null, null, null);
