INSERT INTO `t_fc_company` VALUES ('3466', '北京金顿教育科技有限公司', '1100', '于兵', '13366775506', '于兵', '13366775506', '2014年12月23日', '50万元', '北京市', '北京市', '海淀区', null, '北京市海淀区西郊北洼路1区195幢1层094', '北京市', '北京市', '海淀区', '东升地区办事处', '北京市海淀区西郊北洼路1区195幢1层094', '', '消防信息化', '有限责任公司（自然人投资或控股）', '2014年12月23日', '2034年12月22日', '', '', '', '91110108327137164D', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；出版物批发；出版物零售。（企业依法自主选择经营项目，开展经营活动；出版物批发、出版物零售以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我单位北京金顿教育科技有限公司成立于2014年12月23日，办公地址是：	北京市海淀区西郊北洼路1区195幢1层094 ，注册资金：50万元，经营范围：技术开发、技术推广、技术转让、技术咨询、技术服务;出版物批发;出版物零售。(企业依法自主选择经营项目,开展经营活动;出版物批发、出版物零售以及依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动;不得从事本市产业政策禁止和限制类项目的经营活动。)', '116.340112', '40.042085999999998', '116.340112', '40.042085999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3467', '北京暖赢高压水清洗科技有限公司', '1099', '崔暖侠', '13855758532', '张伟', '13718862599', '2014年06月30日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区三间房乡西柳村中街（三间房动漫集中办公区1446号）', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区三间房乡茶家坟道桥一分公司', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年06月30日', '2034年06月29日', '2018/8/15', '2019/8/14', '京消协（2018）证书268号', '9111010530641576X1', '', '专业承包；工程勘察设计；城市园林绿化施工；技术推广服务；清洁服务（不含餐具消毒）；销售机械设备、五金交电、建筑材料；货运代理；维修电机、水泵。(领取本执照后，应到市规划委、住房城乡建设部、市住房城乡建设委、区县住房城乡建设委、市园林绿化局取得行政许可；到市交通委运输管理局各城近郊区管理处、远郊区县交通局备案备案。；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '公司简介:\n北京暖赢高压水清洗科技有限公司是一家专业从事管道安装,维修更换,油烟管道改造清理,电机水泵维修及专业设备销售与一体的一家服务公司.\n公司拥有多年服务大中型企业客户的经验,具有良好的施工服务团队,为各种行业服务的企事业单位提供了较为满意的解决方案,得到了客户的一致好评和认可.同时公司以诚信的服务态度和专业的服务理念回馈客户.\n\n   管道安装质量及承诺\n管道更换安装,施工完毕后达到常规的验收标准,能够使管道畅通无阻,达到新管道安装使用效果.提供24小时全天服务\n\n清洗质量及服务承诺同以前的一样\n\n\n电机水泵维修的服务及承诺同以前一样', '116.56970099999999', '39.903207000000002', '116.565966', '39.908259999999999', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3468', '北京宇润铭泰环保科技有限公司', '1098', '刘丹', '15321387818', '陈勇刚', '15321158062', '2016年12月23日', '500万元', '北京市', '北京市', '密云区', null, '北京市密云区大城子镇政府东侧海惠城综合楼101室1762（大城子镇集中办公区）', '北京市', '北京市', '密云区', '大城子镇', '北京市密云区大城子镇政府东侧海惠城综合楼101室1762（大城子镇集中办公区）', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年12月23日', '2036年12月22日', '2018/8/15', '2019/8/14', '京消协（2018）证书265号', '91110228MA00AP9E1N', '', '技术开发、技术转让；维修办公设备、计算机、通讯设备、家用电器、空调制冷设备、仪器仪表；厨房设备的清洗；建筑物清洁服务；技术开发、技术转让；销售厨房用具、家用电器、空调制冷设备、汽车零配件、通讯设备、机械设备、日用杂货、金属材料、办公设备、金属制品；害虫防治服务；家庭劳务服务；包装装潢设计；安装空调制冷设备、仪器仪表、家用电器；专业承包、劳务分包、施工总承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京宇润铭泰环保科技有限公司是一家专业化保洁服务公司；承接酒店、宾馆、大厦、写字楼、市场、小区、机关等企事业单位的室内各项保洁服务，清洁石材地面，翻新结晶、保养打蜡、承接高空外墙、玻璃清洗、维修、清洗厨房油烟罩、烟道及其他高难度、危险性作业，中央空调清洗等；总之你有困难、要求、我公司会尽全力为您排忧解难。我公司管理人员和专业人员具备多年丰富的经验和训练的职业技能，所有的工作人员都经过岗前培训；使用专业的清洗设备及清洁药剂等。严格按照操作程序及技术规范进行各种清洗、保洁等服务。\n      我公司经过多年的实践与经验积累，已经建立了一套比较完善的质量、监督、管理体系，为企事业单位、办公楼、大厦、饭店、写字楼、商场等提供长期、短期各种清洗、保洁服务。\n      珍惜荣誉、完善管理、服务至上、质量第一是我公司成功发展的服务宗旨，我公司全体员工愿以一流的服务、优惠的价格为广大客户提供一个优美、洁净的环境。愿我们优质的服务，能为你带来愉快的心情！', '117.109668', '40.392935000000001', '117.109668', '40.392935000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3469', '北安清洗（北京）有限公司', '1097', '任彬', '15301069110', '于磊', '13811221692', '2013年12月02日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区马坊镇金河街106号院5号楼7层720', '北京市', '北京市', '平谷区', '马坊地区办事处', '北京市平谷区马坊镇金河街106号院5号楼7层720', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年12月02日', '2033年12月01日', '', '', '', '91110117085481025Q', '', '清洁服务；空调制冷设备清洗；供水设施卫生维护（限清洗、消毒）；仓储保管；专业承包；技术检测；技术服务；维修家用电器；企业管理咨询；销售空调制冷设备、机械设备、五金交电（不含电动自行车）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北安清洗（北京）有限公司创立于2013年，注册资本100万，公司位于北京市平谷区，在大兴有办事处，服务本地及周边各大城市。公司经卫生局批准的对生活供水设备、设施清洗、消毒、改造、维保的专业型企业。\n   本企业《二次供水系统清洗》、《供水设备改造》等业务于一体。开展多元化服务，斩获多项荣誉称号。具备给水领域专业清洗设备。      \n自公司创立以来坚持努力奋斗、技术创新，赢得广大客户的信任和好评，我们本着以诚信、务实为宗旨，以细致入微的服务、人性化的管理创造行业品牌，为首都广大客户提供优质的服务。', '117.009175', '40.058906999999998', '117.009175', '40.058906999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3470', '北京众邦京安消防工程有限公司', '1096', '郎振东', '13911358596', '郎振东', '13810223539', '2018年06月27日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区怡馨家园13号楼208室', '北京市', '北京市', '顺义区', '胜利街道', '北京市顺义区怡馨家园13号楼208室', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年06月27日', '长期', '2018/9/6', '2019/9/5', '京消协（2018）证书288号', '91110113MA01D51GXW', '', '专业承包；技术服务、技术转让、技术开发、技术推广、技术咨询；物业管理；销售机械设备、家用电器、厨房用具、日用品、电气设备、金属制品、五金交电（不含电动自行车）、消防器材、建筑材料（不含砂石及砂石制品）；厨房设备维修；劳务分包；清洁服务（不含餐具消毒）；保洁服务；委托加工；家庭服务；城市园林绿化施工；建设工程项目管理；工程造价咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京众邦京安消防工程有限公司是原一家消防设施工程专业承包壹级资质，可承担火灾自动报警及联动系统、消防广播系统、消防水喷淋系统、消火栓系统、气体灭火系统的设计、施工、申报、验收、物业管理、技术开发、技术转让等一条龙服务及技术服务、专业承包服务为一体的服务性公司；长期以来，以“顾客第一、诚信为本、高效求实、稳步发展”的经营理念为宗旨，销售和维修、维保及机电、消防工程、安保系统安装劳务为主，开拓发展了厨房烟囱排油烟道、外墙清洗、石材保养、厨具设备清洗及空调清洗业务。\n  公司具有完善的工作管理制度和安全操作制度，制订了规范的工序操作流程。同时，拥有经过专业培训的作业人员以及全套优质设备，各项服务费合理，能为客户提供安全、规范和满意的消防设备安装维保、烟道清洗、建筑物清洗、石材维护等服务。', '116.649305', '40.121462000000001', '116.649305', '40.121462000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3471', '北京上元天下水处理设备中心', '1094', '张海峰', '13693606613', '张海峰', '13693606613', '1995年08月22日', '80万元', '北京市', '北京市', '丰台区', null, '北京市丰台区小郭庄西路43号3层301', '北京市', '北京市', '丰台区', '宛平城地区办事处', '北京市丰台区小郭庄西路43号3层301', '', '烟道清洗', '集体所有制', '1995年08月22日', '2045年08月21日', '', '', '', '91110106102231969T', '', '销售电器设备、机电设备、机械设备、厨房设备；专业承包；清洁服务；消毒服务；城市园林绿化；家庭服务（不符合家政通用要求不得开展经营活动）；技术服务；机动车公共停车场服务；货运代理；会议服务；工程管理服务；销售日用品、五金交电（不含电动自行车）、厨房用具、电气设备、空调制冷设备、电子产品、家用电器、不锈钢制品、文化用品、体育用品、塑料制品、陶瓷制品、社会公共安全设备、家具；化粪池清掏。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我单位北京上元天下水处理设备中心成立于1995年8月22日，办公地址是：	北京市丰台区小郭庄西路43号3层301 ，注册资金：80万元，经营范围：销售电器设备、机电设备、机械设备;专业承包。(企业依法自主选择经营项目,开展经营活动;依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动;不得从事本市产业政策禁止和限制类项目的经营活动。)', '116.222482', '39.86374', '116.222482', '39.86374', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3472', '北京鑫昊天成环保科技有限公司', '1092', '刘志伟', '13581582368', '刘志伟', '13581582368', '2019年07月10日', '500万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区开放东路13号院4号楼第三层办公区302室', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '北京市怀柔区开放东路13号院4号楼第三层办公区302室', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年07月10日', '2069年07月09日', '', '', '', '91110116MA01LBAP0A', '', '环保技术开发、咨询、服务、转让、推广；建筑物清洁服务；办公室保洁服务；大气污染治理；家庭劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫昊天成环保科技有限公司是一家集烟道清洗、中央空调清洗、外墙清洗粉刷施工、高空作业设备销售、高空作业技术培训于一体的综合性服务公司。公司全体同仁以“美化生活，清洁环境、服务社会”为目的，以“你的满意——就是我们的追求”为服务宗旨，全力贯彻“管理人性化、工作细腻化、作业标准化、服务诚信化”的方针政策，始终如一的坚持“诚实、正直、勤劳、简朴、守信”的企业精神。使公司在商业运作与公司管理中逐步走向规范化、正规化。公司现有人员100余人，基层管理人员10多人，中高层管理人员10余人，随着公司业务不断发展，壮大。公司主要经营：高空外墙清洗、外墙粉刷、外墙翻新、外墙打蜡、外墙补漏、安装灯饰、拆装广告牌等专业的高空作业服务。中央空调清洗、油烟管道清洗服务。日常保洁托管洗服务。北京鑫昊天成环保科技有限公司愿竭诚为您服务!!!', '116.651816', '40.322918000000001', '116.651816', '40.322918000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3473', '北京中山消防保安技术有限公司', '1091', '俞楚明', '13901058092', '刘洋', '18600269423', '1992年07月10日', '1659万元', '北京市', '北京市', '密云区', null, '北京市密云区穆家峪镇穆峪南街1号镇政府办公楼401室-32（穆家峪镇集中办公区）', '北京市', '北京市', '西城区', '金融街街道', '北京市西城区金融街33号通泰大厦c915', '', '建筑防火,消防设施,烟道清洗,电气防火,消防安全评估', '其他有限责任公司', '1992年07月10日', '2022年07月09日', '2018/12/28', '2019/12/27', '京消协（2018）证书484号', '91110228600054539E', '', '技术开发、咨询、推广、服务；开发、研发消防保安新技术产品；消防保安建筑智能化工程的设计、安装、调试；销售自产产品、安全技术防范产品、建筑材料、计算机、软件及辅助设备、通讯设备、广播电视设备（不含销售卫星电视广播地面接收设施）、五金、交电、仪器仪表、金属材料、电子产品、办公用文具、体育用品、电器机械；提供自产产品的技术咨询、技术培训；资产管理；销售维修入侵探测器、防盗报警控制器、楼寓对讲系统、防盗安全门、报警系统视频监控设备；维修消防设备、空调；专业承包、劳务分包；建设工程项目管理；技术检测；物业管理；建筑物清洁服务。（“1、未经有关部门批准，不得以公开方式募集资金；2、不得公开开展证券类产品和金融衍生品交易活动；3、不得发放贷款；4、不得对所投资企业以外的其他企业提供担保；5、不得向投资者承诺投资本金不受损失或者承诺最低收益”；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本单位具有消防设施工程专业承包壹级、电子与智能化工程专业承包贰级、建筑智能化系统设计专项甲级、消防设施工程设计专项甲级、机电工程总承包叁级、消防设施维护保养检测临时一级、消防安全评估临时二级等多项国家批准的专业资质，拥有AAA级企业信用等级证书，获得GB/T19001-2016/ISO9001:2015质量管理、GB/T24001-2016/ISO14001:2015环境管理和GB/T28001-2011/ OHSAS18001:2007职业健康安全管理体系认证。公司创建以来先后承接了涉及国家各大部委、航空航天、工业、电力、交通、金融证券、教育科研、医疗卫生等行业的国家重点大型项目工程，其中部分项目工程获得鲁班奖、长城杯和优质工程奖等，合格率达到100%，在业内得到一致好评。公司近五年主要承接的建筑面积在10万平方米以上、合同金额较大的消防设施专项工程有：首创团河定向安置房消防工程、朝阳区六里屯消防工程、香河富力新城消防工程、香河大爱城消防工程、富力通州惠兰美居消防工程、景枫中心消防工程、国金中心消防工程、嘉德艺术中心消防工程、中海国际社区消防工程等。', '116.943573', '40.411320000000003', '116.358611', '39.910764', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3474', '北京久安正华消防科技有限公司', '1090', '孟凡龙', '13011179512', '孟凡龙', '13011179512', '2006年05月23日', '1000万元', '北京市', '北京市', '石景山区', null, '石景山区古城大街西侧古城旅馆1号楼一层2102室', '北京市', '北京市', '西城区', '白纸坊街道', '西城区鸭子桥路39号院9号楼2层', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2006年05月23日', '2026年05月22日', '2018/11/13', '2019/11/12', '京消协电证字（2018）068号', '91110107788981843H', '', '建筑消防设施检测技术服务；电气防火检测技术服务；消防设施的技术咨询、技术服务、技术开发；维修消防设施；销售建筑材料（不从事实体店铺经营）、五金交电（不含电动自行车，不从事实体店铺经营）、矿产品、机械设备、电子产品、金属材料、日用品、消防器材、通讯设备；消防安全评估。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司具有一流的高科技检查检测手段与技术，拥有高素质的专业检测队伍。工作业绩优秀，为本市众多企事业单位、宾馆饭店、大中小学、居民社区、餐饮娱乐场所提供了电气防火检测和建筑消防设施检测技术服务。具有良好的信誉，并连续多年获得消防协会颁发的双优企业证书。', '116.186295', '39.910730999999998', '116.345169', '39.874885999999996', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3475', '北京中鼎华康环保科技有限公司', '1089', '武兆忠', '15011030061', '武兆忠', '15011030061', '2017/11/8', '200万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖经济开发区雁栖路33号院1号楼103室', '北京市', '北京市', '怀柔区', '北京雁栖经济开发区', '北京市怀柔区雁栖经济开发区雁栖路33号院1号楼103室', '', '烟道清洗', '有限责任公司（自然人独资）', '2017/11/8', '2047/11/7', '', '', '', '91110116MA018LWE71', '', '技术开发、服务、咨询、推广；家庭劳务服务、建筑物清洁服务、办公室保洁服务；大气污染治理；生活清洗、消毒服务；施工总承包、专业承包、劳务分包；销售家用电器、日用品、办公用品、机械设备、仪器仪表。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司：北京中鼎华康环保科技有限公司（简称中鼎华康），成立于	2017年-11月-08日，位于  北京市怀柔区雁栖经济开发区雁栖路。是一家专业做环保、清洁的企业单位。\n公司一贯坚持“质量第一，用户至上，优质服务，信守合同”的宗旨，凭借着高质量的产品，良好的信誉，优质的服商务家，获得大众的好评。', '116.683115', '40.352055999999997', '116.683115', '40.352055999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3476', '北京美雅洁环境科技有限公司', '1088', '姜立强', '13311166878', '姜立强', '13311166878', '2016/10/31', '300万元', '北京市', '北京市', '丰台区', null, '北京市丰台区黄土岗村12号A座五层50235室', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区五里店南里小区37号楼8门001室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016/10/31', '2046/10/30', '', '', '', '91110106MA0096ED84', '', '技术开发、技术转让、技术咨询、技术服务、技术推广、技术培训；清洁服务；城市园林绿化；物业管理；会议服务；承办展览展示；机械设备租赁；产品设计；销售化工产品（不含化学危险品）、机械设备、日用品、办公用品、电子产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京美雅洁环境科技有限公司注册于2016年10月31日，具有独立的法人资格。本公司主要服务于各类商业企业，机关团体，大型的楼宇开荒、高空外墙、日常保洁托管，石材翻新养护等工作。公司目前拥有一支高素质、高技能的专业清洁队伍。为客户提供优质便捷的服务。\n     同时公司致力于与客户建立长期合作关系，提高服务质量，我们的经营理念：带走尘埃、留下欢笑，给您一份清新、还您一份洁净。专业为您营造一个更清洁、亮丽的生活和工作环境。\n    诚信是是公司成功的保证。“客户至上、信誉第一”是我们的宗旨，维护客户的利益和形象是我们始终不渝的目标。', '116.330798', '39.831837999999998', '116.25771899999999', '39.852953999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3477', '北京耀邦环保技术开发有限公司', '1086', '李刚', '13911229858', '王士友', '13810096896', '2004年08月12日', '518万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区金盏乡马各庄南工业区甲8号', '北京市', '北京市', '朝阳区', '常营地区办事处', '北京市朝阳区管庄路150号东方华瑞A座401室', '', '消防设施,烟道清洗,消防产品', '有限责任公司（自然人投资或控股）', '2004年08月12日', '2024年08月11日', '2018/8/27', '2019/8/26', '京消协（2018）证书274号', '91110105766285660C', '', '技术开发；技术服务；技术转让；承办展览展示；组织文化艺术交流活动（不含演出）；清洁服务（不含餐具消毒）；销售日用品、机械设备、化工产品（不含危险化学品）、建筑材料、电子产品；互联网信息服务；普通货物道路货物运输（仅限使用清洁能源、新能源车辆）。（企业依法自主选择经营项目，开展经营活动；互联网信息服务、普通货物道路货物运输（仅限使用清洁能源、新能源车辆）以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京耀邦环保技术开发有限公司成立于2004年08月12日，注册资金518万元，是注册于北京市的集研发、设计、加工制造、销售和安装于一体的高新技术企业。公司主营环保设备，包括油烟净化设备和油烟在线监测系统、UV光氧化除味净化设备、焊接除尘器、低温等离子净化器、油水分离器、无烟烧烤车、通风设备、消防排烟设备以及各种风机、风管、风阀、风口设备。\n    公司还承接VOCs工业废气治理工程、除尘工程、酒店餐饮油烟净化工程、通风工程、消防排烟工程、人防工程和无尘净化工程等。\n    公司已获得质量管理体系认证、环境管理体系认证和中国环境保护产品认证，企业管理水平和产品质量居于行业领先位置。公司自建有一支专业售后服务队伍，从产品安装、调试，到交付用户的后期维保清洗，保证全程及时、有效地解决用户设备投入使用后的所有问题。\n    公司产品广泛应用于商业写字楼、酒店、机关事业单位、工矿企业、娱乐场所、商场等场所的厨房油烟净化处理以及加工制造业、化工行业、医药制药行业、城市垃圾处理等行业的废气及刺激性气体的环保处理。', '116.592457', '39.946734999999997', '116.59099500000001', '39.921937', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3478', '北京利颖润洁环保科技有限公司', '1084', '傅颖秀', '18612038276', '石其海', '13693205160', '2018年11月23日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区庙城镇彩各庄村184号2门', '北京市', '北京市', '怀柔区', '庙城地区办事处', '北京市怀柔区庙城镇彩各庄村184号2门', '', '建筑防火,消防设施,烟道清洗', '有限责任公司（自然人投资或控股）', '2018年11月23日', '长期', '', '', '', '91110116MA01FQRB2G', '', '技术开发、技术服务、技术转让、技术推广、技术咨询；家庭劳务服务；建筑物清洁服务、办公室保洁服务；施工总承包、专业承包、劳务分包；维修家用电器、环保设备；销售机械设备、消防器材、安全技术防范产品、计算机、软件及辅助设备、电子产品、家用电器、日用品、化工产品（不含危险化学品）；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京利颖润洁环保科技有限公司成立于2018年11月23日。法定代表人：傅颖秀。注册资本：100万元。公司注册地址：北京市怀柔区庙城镇彩各庄村184号2门。公司成立以来厨房油烟净化：厨房排烟、烟罩 风管 抽排风系统  制作安装  。', '116.637649', '40.280275000000003', '116.637649', '40.280275000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3479', '北京鸿创佳誉环保科技有限公司', '1082', '穆蕊', '13911550025', '马跃', '18811184111', '2019年03月13日', '100万元', '北京市', '北京市', '密云区', null, '北京市密云区长安商业街2号楼6号', '北京市', '北京市', '密云区', '鼓楼街道', '北京市密云区长安商业街2号楼6号一层', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年03月13日', '长期', '', '', '', '91110228MA01HNPQSE', '', '技术推广；家庭劳务服务；机器和办公设备的清洗；房屋的清扫、消毒；销售环保设备、五金交电（不含电动自行车）；餐饮服务。（企业依法自主选择经营项目，开展经营活动；餐饮服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鸿创佳誉环保科技有限公司致力于为家庭、企业事业单位提供高性价比、全方位的清洗、保洁、养护服务，以规范清洁行业为责，引领产业升级为己任，公司全力培养保洁员行为规范、综合认知能力，致力打造一支专业化、年轻化、高素质的保洁服务团队。', '116.84378', '40.374817', '116.84378', '40.374817', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3480', '北京四季共享环保科技有限公司', '1080', '龚会丽', '13717740346', '龚会丽', '13717877132', '2019年07月16日', '500万元', '北京市', '北京市', '顺义区', null, '高丽营镇文宫村北（临空二路1号科技创新功能区）', '北京市', '北京市', '顺义区', '高丽营镇', '高丽营镇文宫村北（临空二路1号科技创新功能区）', '', '烟道清洗', '自然人独资', '2019年07月16日', '2069年07月15日', '', '', '', '91110113MA01LFB2XM', '', '技术开发；技术服务；技术咨询；技术转让；销售家用电器；安装家用电器；清洁服务；保洁服务；销售电子产品、办公用品、五金交电（不含电动自行车）、消防产品；维修消防器材；病虫害防治；机械设备租赁、维修；技术检测；专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；专业承包、劳务分包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京四季环保科技有限公司成立于2019年7月16日，注册地顺义区高丽营镇。经营业务;技术开发；技术服务；技术咨询；销售家用电器；安装家用电器；清洁服务；保洁服务；销售电子产品；病虫害防治；机械设备租赁、维修。', '116.579059', '40.178814000000003', '116.579059', '40.178814000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3481', '北京新松融通机器人科技有限公司', '1077', '李胜', '18610033386', '乐丹', '13161166679', '2018年09月13日', '5000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路186号四区3号楼2层', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路186号四区3号楼2层', '', '消防产品', '有限责任公司（自然人投资或控股）', '2018年09月13日', '2038年09月12日', '', '', '', '91110106MA01ELHA1T', '', '技术开发、技术服务、技术转让、技术咨询、技术推广；产品设计；生产（制造）机械设备、电子产品（限在外阜从事生产活动）；销售电子产品、机械设备、计算机、软件及辅助设备；电子产品租赁；机械设备租赁。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京新松融通机器人有限公司是由新松机器人投资公司和北京融通智慧科技有限公司合资的一家智能机器人公司，是一家以专业智能机器人研发、生产、销售、运维为一体的创新型科技企业，致力于为客户提供全方位的智能机器人解决方案。\n新松公司本部位于沈阳，在上海设有国际总部、在北京设有投资总部，在沈阳、上海、杭州、青岛建有产业园区，现已在全国六大区域构建了立体化的研发及服务网络。公司现拥有4000余人的研发创新团队，形成以自主核心技术、核心零部件、核心产品及行业系统解决方案为一体的完整全产业价值链。目前，公司总市值在国际同行业中名列前茅，成长性机器人行业全球罕见。\n融通智慧是国内较早研发和将“电网建设智能管控系统”、“输变电智能安防管控系统”、“可视化智能安全管控系统”三大业务系统投入企业生产管理的公司。双方强强联合，为新松融通提供了全方位的支持和保障。\n公司大力研发智能巡检、智能安防、智能消防、智能服务等功能的机器人系列产品，全心全意为客户提供优质、先进的技术服务。\n公司的产品分为智能巡检机器人、智能消防机器人、智能安保机器人、智能服务机器人四大类，产品种类10余种。', '116.29574', '39.820791999999997', '116.29574', '39.820791999999997', '', null, null, null, null);
