INSERT INTO `t_fc_company` VALUES ('3483', '北京坤辰伟业环保科技有限公司', '1075', '辛建坤', '13552917028', '辛建坤', '13552917028', '2015年08月17日', '100万元', '北京市', '北京市', '通州区', null, '北京市通州区潞城镇胡郎路80号561室', '北京市', '北京市', '通州区', '宋庄镇', '北京市通州区宋庄镇葛渠村284号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年08月17日', '2065年08月16日', '2019/8/5', '2020/8/4', '京消协（2019）证书507号', '91110112353002482J', '', '科普宣传服务；技术开发、技术服务；销售电气设备、机械设备、制冷专用设备、厨房用具、仪器仪表、五金交电、装饰材料、电子产品、日用品、文化用品、针纺织品、木制品、塑料制品、化工产品（不含危险化学品）、不锈钢制品、彩钢板、建筑材料、家具；设计、制作、代理、发布广告；家庭劳务服务；建筑物清洁服务；办公室保洁服务；害虫防治服务；大气污染治理；室内装饰设计；维修制冷专用设备、通用设备；委托加工机械设备、电子产品、金属制品；货物进出口；专业承包；工程勘察设计；施工总承包；劳务分包；城市园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京坤辰伟业环保科技有限公司自成立以来，经过多年的实践与经验积累，已经建立了一套比较完善的管理体系和质量监督体系，为企事业单位、办公楼、大厦、饭店、写字楼、商场、超市等提供长期、短期各种清洗、保洁服务，公司的管理人员和专业技术人员具备多年丰富的经验和熟练的职业技能，所有的作业人员都经过岗前培训。使用专业的清洗设备及清洁药剂等，严格按照操作程序及技术规范进行各种清洁、保洁服务。客户至上“以品质谋生存，以信誉图发展”是我公司成功发展的服务宗旨。', '116.745626', '39.900315999999997', '116.65295399999999', '40.007717', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3484', '北京空港新风中央空调清洗有限公司', '1074', '聂晨毅', '13501006556', '李秀钰', '13811465625', '2007年09月11日', '300万元', '北京市', '北京市', '顺义区', null, '北京市顺义区李桥镇任李路沿河段162号', '北京市', '北京市', '顺义区', '李桥镇', '北京市顺义区李桥镇任李路沿河段162号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2007年09月11日', '2057年09月10日', '2018/8/29', '2019/8/28', '京消协（2018）证书282号', '911101136669206124', '', '中央空调清洗、维修（涉及审批的项目除外）；接受委托提供劳务服务（不含对外劳务合作、排队服务）；保洁服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '公司简介\n\n   我公司成立于2007年，公司注册资金：300万元。机构类型：企业法人，法人代表负责人：聂晨毅。坐拥首都机场核心区常年为机场航站楼、办公楼提供中央空调清洗服务、油烟道清洗服务。通过机场的严格的严格的质量管理、严格的安全管理、严格的施工管理。已经锻炼出一支过硬的施工队伍。成为了一家专业为别墅、公寓、宾馆饭店、机关单位、写字楼提供中央空调清洗和厨房排油系统清洗服务的优质公司\n    2007年11月获得首批由北京是卫生局颁发的中央空调通风系统清洗资格证书；2011年通过ISO9001质量管理体系认证；2011年成为北京消防协会会员单位。\n   油烟道清洗业务近年来长年和首都机场T1T2航站楼合作，打造了过硬的施工团队，施工过程完全按照《北京市消防条例》等有关规定进行施工。本着“服务社会、合法公正、安全第一”的原则遵循行业规则，严格工作责任，保证服务质量。', '116.689458', '40.034301999999997', '116.689458', '40.034301999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
