INSERT INTO `t_fc_company` VALUES ('3487', '北京策琳腾达消防工程服务有限公司', '1071', '王航宇', '13661378200', '王翔宇', '13381226037', '2015年05月25日', '100万元', '北京市', '北京市', '平谷区', null, '田园街四眼井合同36号', '北京市', '北京市', '平谷区', '渔阳地区办事处', '北京市平谷区园田街四眼井胡同36号', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年05月25日', '2035年05月24日', '', '', '', '91110106344276633J', '', '技术开发、技术转让；家庭劳务服务；建筑物清洁服务；销售日用品、安全技术防范产品；安全防范技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京策琳腾达消防工程服务有限公司根据国务院办公厅《消防改革与发展刚要》的精神，遵循北京市消防局“预防为主、防消结合”的方针，根据建筑消防及电气防火检测工作的需要，本着“质量第一、用户至上”的经营方针，公司从组织架构到人员配置均进行了合理的配置和安排。公司服务员工通过专业技能培训，同时进行从业道德、服务质量、安全第一等意识方面的培训，通过考核后方可上岗。\n本公司本着“品质为先、客户第一”的企业宗旨，不断完善各项管理，我们要与时俱进，勇攀高峰，为北京的繁荣奉献自己的力量', '117.12509900000001', '40.135995999999999', '117.12509900000001', '40.135995999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3488', '北京顺兴顺通环保科技有限公司', '1069', '周成斌', '15120061161', '周成斌', '15120061161', '2012年09月26日', '8000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区李桥镇西大坨村幸福街9号', '北京市', '北京市', '顺义区', '南彩镇', '北京市顺义区南彩镇左堤路1号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年05月27日', '2046年05月26日', '', '', '', '91110113L54034460M', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；城市园林绿化施工；专业承包；水污染治理、化粪池清掏；维修厨房用具；机械设备安装、维修、租赁；体育运动项目经营（高危险体育运动项目除外）；接受委托提供劳务服务（不含对外劳务合作、排队服务）；机动车公共停车场管理；家居装饰；信息咨询（中介除外）；销售汽车、厨房用具、花卉、日用品、机械设备、汽车配件、润滑油、建筑材料（不含砂石及砂石制品）、计算机软硬件及辅助设备、五金（不含电动自行车）、油烟净化器、空气净化设备、污水处理设备；计算机信息系统集成服务；软件开发；应用软件服务；设计、制作、代理、发布广告；仓储服务（不含危险化学品、粮油）；国内、国际、海上、航空陆路货运代理；装卸服务；包装服务；清洁服务；销售食品；道路货物运输；餐饮服务；城市生活垃圾清扫、收集、运输、处理（仅限厨余垃圾处理）。（企业依法自主选择经营项目，开展经营活动；销售食品；道路货物运输；餐饮服务；城市生活垃圾清扫、收集、运输、处理（仅限厨余垃圾处理）以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京顺兴顺通环保科技有限公司（简称：顺兴顺通）位于风景优美的北京市顺义区工业园区，地理位置优越，交通便利。顺兴顺通长期致力于人类生存的社会环境的改善，立足顺通，用科学的观念与您共建美好地球家园。\n    本公司专业从事餐饮业油烟净化设备及工业烟气净化工程的科研、设计、生产与销售为一体的环保工作。拥有设备研发、产品制造、市场调研、推广销售、售后服务等众多中高级技术人才，目前主要生产高压静油烟净化器，低排油烟净化器、烧烤车、工业油烟净化器，隔油池等油烟净化产品。', '116.71033799999999', '40.135983000000003', '116.68207700000001', '40.138255999999998', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3489', '北京兴业恒达建设工程有限公司', '1068', '付世余', '13263337888', '高亮', '13810818521', '2019年03月13日', '6000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区天华街9号院16号楼5层508', '北京市', '北京市', '大兴区', '北臧村镇', '北京市大兴区天华街9号院16号楼5层508', '', '消防设施,烟道清洗', '有限责任公司（自然人投资或控股）', '2019年03月13日', '2049年03月12日', '', '', '', '91110115MA01HNUE97', '', '施工总承包；专业承包；劳务分包；承办展览展示活动；技术开发、技术咨询、技术转让、技术推广、技术服务；工程造价咨询；工程招标代理；园林绿化工程；家居装饰设计；销售建筑材料、装饰材料、消防器材、日用品、钢材、五金产品（不含电动自行车）、机械设备、照明器材、文化用品、家用电器、化工产品、电子产品、厨房用具；清洁服务；保洁服务；租赁建筑机械设备；委托加工厨房设备；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', ' 北兴业恒达建设工程有限公司（简称：兴业恒达）成立于2019年，注册资本6000万元，总部位于北京，主要以市政公用工程、钢结构工程、环保工程、建筑消防工程、建筑消防设施检测、建筑消防设施维护保养、水污染治理为核心业务，并多方面开展其他业务，经过多年的发展，现已发展为专业的建筑消防工程与建筑智能化建设服务型企业，为工程项目提供适用的解决方案和技术支持。公司主要成员12人。\n       兴业恒达视人才运作为企业发展的根本，十分重视人才的引进、培训和提高，并与多家研究机构建立了战略合作关系，公司拥有一批技术精湛、实践经验丰富的技术人员和管理人员，专业的服务队伍，掌握了从产品设计到系统化的全部经验，建立了以客户需求为导向的营销管理体系，能够为客户提供从可行性分析、系统设计、系统建立到服务支持的一系列的服务体系，从而保障公司在该领域始终保持稳步发展。\n     兴业恒达品牌定位于规范化、科技化、专业化、人性化，为客户建立科学、严谨的工程质量管理体系。兴业恒达全体员工恪守“专注消防事业，让生命财产更安全；专注智能化建设，让人们出行更简洁”的企业使命，凭借优良的服务和精湛的技术，为保障用户工程系统', '116.31177700000001', '39.685395', '116.31177700000001', '39.685395', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3490', '亚太龙润（北京）能源科技有限公司', '1067', '张洪伟', '13911830349', '张洪伟', '13911830349', '2016年04月14日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十里堡1号118号楼120室', '北京市', '北京市', '丰台区', '南苑街道', '北京市丰台区中福丽宫5号楼221室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年04月14日', '2036年04月13日', '', '', '', '91110105MA0050NC9T', '', '技术推广服务；市场调查；销售机械设备、化工产品（不含危险化学品）、五金交电（不从事实体店铺经营）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2016年，主要研发、生产清洗设备，技术推广服务。', '116.499315', '39.918146999999998', '116.354809', '39.808247999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3491', '北京信诚佳美保洁有限公司', '1065', '刘丽', '18001375558', '张菁', '13910815027', '2016年04月07日', '1000万元', '北京市', '北京市', '石景山区', null, '北京市石景山区古城西路113号4层437', '北京市', '北京市', '石景山区', '古城街道', '北京市石景山区古城西路113号4层437', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年11月17日', '2060年11月16日', '', '', '', '91110107565838927D', '', '清洁服务；会议服务；技术开发、技术推广；经济信息咨询；电脑图文设计；家居装饰；市场调查；计算机技术培训；机动车停车管理服务；保洁服务；建筑物清洁服务；锅炉烟囱的清扫；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；城市园林绿化；租赁机械设备；化粪池清掏；劳务派遣；城市生活垃圾清扫、收集、运输；普通货物道路货物运输（仅限使用清洁能源、新能源车辆）。（企业依法自主选择经营项目，开展经营活动；普通货物道路货物运输（仅限使用清洁能源、新能源车辆）以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京信诚佳美保洁有限公司于2010年11月17日成立，办公地址位于北京市石景山区古城西路113号景山财富中心437。法人：刘丽。\n主要经营范围：专业从事日常保洁、物业保洁，石材翻新及养护、地板打蜡、烟道清洗、开荒保洁、高空外墙清洗、精细保洁、家庭除螨、家居装饰等多项服务业务和技术开发、技术推广等。\n主要资质：通过了ISO9001质量管理体系、GB/T24001-2004环境管理体系和GB/T28001-2011职业健康安全管理体系的认证。 取得了北京市清洗保洁资质、油烟管道清洗服务资质、高空作业清洗服务资质和消毒杀菌专业资质等一系列专业资质证书。\n主要荣誉：现为中国商业企业管理学会清洁服务商专业委员会会员单位、中国职业安全健康协会高空服务业分会会员单位以及北京市保洁商会副会长单位，2017年第七届中国清洁行业品牌评比第一名。', '116.178315', '39.915076999999997', '116.178315', '39.915076999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3492', '北京艾德艾嘉商贸有限公司', '1064', '杨丽', '18610153887', '杨丽', '18610153887', '2016年09月07日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区窦店镇田家园村村委会北200米', '北京市', '北京市', '房山区', '窦店镇', '北京市房山区窦店镇田家园村村委会北200米', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年09月07日', '2046年09月06日', '', '', '', '91110111MA00857X98', '', '销售日用杂品、清洁用品、汽车配件、五金交电（不含电动自行车）、建筑材料、装饰材料、酒店用品、办公用品、工艺美术品、花卉、苗木、针纺织品、服装、鞋帽、塑料制品、化妆品、卫生用品；物业管理；家庭劳务服务；清洁服务（不含洗车服务）；园林景观设计；园林绿化工程；园林绿化服务；租摆花卉；会议服务；专业承包；家居装饰及设计；技术开发、技术服务；技术咨询、商务信息咨询（中介除外）；化粪池清掏；建筑物清洁服务；城市生活垃圾清扫、收集、运输、处理；美容。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、美容以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京艾德艾嘉商贸有限公司成立于2016年，是北京工商局正规注册、实力雄厚、专业从事物业管理，清洗项目，保洁项目，管道疏通项目和化粪池清理项目的服务性公司。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦、各大小社区及家庭等都提供了全方位的保洁清洗，管道疏通等服务。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。\n公司的创业宗旨:服务到位、质量到位、廉价高效、技与时新、着重长远、发展未来。\n公司的创业精神:敬业爱岗、奉献拼搏、永久服务、争创一流。\n公司的服务忠旨是:达到您的满意才是我们要做的～达到您的完美就是我们追求的目标。', '116.064065', '39.653481999999997', '116.064065', '39.653481999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3493', '北京玉海利华保洁有限公司', '1062', '季玉峰', '13641034054', '季玉峰', '13716245167', '2007年09月12日', '50万元', '北京市', '北京市', '西城区', null, '北京市丰台区菜户营58号14层1407', '北京市', '北京市', '西城区', '白纸坊街道', '北京市丰台区菜户营58号14层1407', '', '烟道清洗', '有限责任公司（自然人独资）', '2007年09月12日', '2027年09月11日', '2019/8/5', '2020/8/4', '京消协（2019）证书502号', '911101066669146690', '', '清洁服务；维修机械设备；家居装饰；劳务服务；汽车装饰服务；经济信息咨询；组织文化艺术交流活动；承办展览展示；电脑图文设计；物业管理；设计、制作、代理、发布广告；销售清洁用品、化工产品、电子产品、机械设备、五金交电、金属材料、建筑材料、装饰材料、家具、灯具、日用品、工艺品、机械设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京玉海利华保洁有限公司是一家以保洁服务、建筑物清洁服务为主的服务型企业，主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品。是经北京消防协会评审的专业公司，具备厨房烟囱清洗资质、员工均持证上岗， 北京玉海利华保洁有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。 我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念，始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为您提供最完美的服务。', '116.347897', '39.872036000000001', '116.347897', '39.872036000000001', '', null, null, null, null);
