INSERT INTO `t_fc_company` VALUES ('3497', '北京明泰来环保科技有限公司', '1056', '王慧平', '13910726072', '尤思晨', '15203229593', '2011年01月06日', '800万元', '北京市', '北京市', '通州区', null, '聚和一街1号7幢A室', '北京市', '北京市', '通州区', '于家务回族乡', '聚和一街1号7幢A室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2011年01月06日', '2031年01月05日', '', '', '', '91110112567443582A', '', '生产VOC净化设备、除尘器、曝气罐、加药器、膜处理器；施工总承包；环保技术开发；技术推广；技术服务；环保技术推广；设计、销售机械设备及配件、专用设备；专业承包；货物进出口、技术进出口、进出口代理。(领取本执照后，应到区县住建委（房管局）取得行政许可；应到区县商务委备案。；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京明泰来环保科技有限公司专注于为企业提供油烟治理和VOCs治理的综合解决方案，是一家集研发、制造、销售、服务为一体的国家级高新技术企业。公司拥有从事环境保护技术开发及环保工程专业承包叁级实施的专业队伍。主营产品有油烟净化设备、催化燃烧设备、低温等离子设备、光催化氧化设备、活性炭吸附设备、粉尘治理成套设备、水处理设备等。在印刷、汽车维修及制造、家具、化工、注塑、制药、电子等领域树立了样板工程。经过多年的探索与实践，明泰来已成为具有较强综合实力与影响力的品牌。参与多项VOCs排放标准的起草工作，连年入选年度行业报告骨干企业，在印刷业首推环保管家服务，是中国环境保护产业协会的理事、废气委员会常委、中华环保联合会委员、中国环境科学学会会员，中标科技研发项目，通过了最新版ISO9001质量体系认证、国际IQNET体系认证、14000环境体系认证，拥有众多专利技术。公司组建了专家顾问团队，由此孵化未来可持续发展的核心竞争力平台。', '116.702372', '39.674492999999998', '116.702372', '39.674492999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3498', '兰商(北京)科技有限公司', '1055', '刘现震', '13910639127', '刘现震', '13910639127', '2018年02月07日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店兴隆西街2号兴隆小区综合楼6层623', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高碑店兴隆西街2号兴隆小区综合楼6层623', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年02月07日', '2048年02月06日', '', '', '', '91110105MA01AC742P', '', '技术推广服务；出租办公用房；销售计算机、软件及辅助设备、建筑材料、电子产品、日用品、机械设备、电子产品；清洁服务（不含餐具消毒）；家庭服务（不符合家政服务通用要求不得开展经营活动）；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司兰商(北京)科技有限公司注册资金100万，成立日期：2018年2月7日 经营范围是：技术推广服务;出租办公用房。(企业依法自主选择经营项目,开展经营活动;依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动;不得从事本市产业政策禁止和限制类项目的经营活动。)', '116.5271', '39.916285999999999', '116.5271', '39.916285999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3499', '深圳市丰修科技有限公司', '1053', '曾治平', '13925022222', '吴鹏', '13311129865', '', '', '北京市', '北京市', '顺义区', null, '北京市顺义区顺航路8号院3幢1层101', '北京市', '北京市', '顺义区', '南法信地区办事处', '北京市顺义区顺航路8号院3幢1层101', '', '烟道清洗', '', '', '', '', '', '', '914403003587573159', '', '', '深圳市丰修科技有限公司（简称“丰修”），于2015年10月15日开始运营，是顺丰速运集团全资子公司。依托顺丰的物流体系资源优势，顺丰丰修正在不断地拓展业务边界，覆盖3C、智能硬件、智能门锁、智能马桶盖、家电维修、家电清洗等多领域、多行业，打造平台式的“多品服务”，实现“一次上门，多项服务”，更好地服务用户群体。\n丰修清洗业务团队来自于TCL、IBM,创维、十分到家、轻松家电等业内知名企业，对传统企业与互联网跨界模式有独特的见解和多年实战经验，先后与TCL、东芝、乐视、微鲸、风行、暴风TV、清华同方、桑乐战略合作.', '116.59007699999999', '40.132007000000002', '116.59007699999999', '40.132007000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3500', '北京金生浩达商贸有限公司', '1051', '王浩达', '13552821905', '王浩达', '13552821905', '2016年02月05日', '50万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区融城北路10号院162号楼405室', '北京市', '北京市', '怀柔区', '庙城地区办事处', '北京市怀柔区融城北路10号院162号楼405室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年02月05日', '2046年02月04日', '', '', '', '91110116MA003JMG6G', '', '销售服装服饰、日用品、厨房设备、五金交电、工艺品、化工产品（不含危险化学品）、机械设备、电子产品、针纺织品、体育用品、文化用品、办公设备、计算机软件及辅助设备；租赁建筑工程设备、建筑工程机械；建筑物清洁服务、办公室保洁服务、家庭劳务服务；专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金生浩达商贸有限公司，成立于2016年，是一家集保洁服务、油烟管道清洗、厨房设备销售维修、大型中央空调系统清洗等综合性服务于一体的有限公司。\n公司配有专业的高压自动清洗设备和专业人员，运用专业的化学清洗技术，做到清洗后漆见光、板见亮等特点。公司员工都经过专业正规培训，并通过严格考核，熟练掌握相关技术。公司拥有严格的管理制度。我们以“美化环境、服务社会”为目的，以“您的满意就是我们的追求”为服务宗旨。我们将用先进的施工设备、一流的服务质量、精湛的工程技术尽心尽力地服务于单位、酒店、宾馆、机关、写字楼、娱乐场所等大型油烟系统、空调系统的清洗和保洁工作。\n我们将用我们的优势和特长给您留下一个舒适、干净、明亮的工作和生活空间。', '116.63546100000001', '40.296866999999999', '116.63546100000001', '40.296866999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
