INSERT INTO `t_fc_company` VALUES ('3504', '北京和兴实盛科技有限公司', '1047', '张占成', '15028880891', '张占成', '15028880891', '2019年04月19日', '300万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号—D6746', '北京市', '北京市', '房山区', '西潞街道', '北京市房山区良乡凯旋大街建设路18号—D6746', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2019年04月19日', '长期', '', '', '', '91110111MA01JKNC05', '', '技术开发；技术咨询；技术转让；技术推广；技术服务；劳务分包；园林绿化服务；专业承包、施工总承包；家居装饰；租赁机械设备；工程管理服务；销售机械设备、电气机械、专用设备、通用设备、金属制品、建筑材料、金属材料、化工产品（不含危险化学品）、五金交电（不含电动自行车）、厨房用品、卫生间用具、电子产品、消防器材；家庭劳务服务；建筑物清洁服务；公共关系服务；维修空调制冷设备、家用电器；（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司创立于2019年04月19号，经营业务范围广泛，技术开发;技术咨询;技术转让;技术推广;技术服务;销售机械设备、厨房用品、卫生间用具、电子产品、消防器材；家庭劳务服务；建筑物清洁服务；公共关系服务。团队精耕消防多年，油烟机清洗业务和厨房业务效果显著，汇聚行业精英人才，集销售、安装、售后一条龙服务，受业界和客户多方好评，消防意识强，希望对消防事业做出进一步的贡献，在消防技术服务、消防工程质量领域、消防管理方面，为全社会做出更多贡献，提供更好服务，增加与公众的交流沟通。', '116.12697', '39.717785999999997', '116.12697', '39.717785999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3505', '中建文化旅游发展有限公司', '1045', '吴宜夏', '13801269744', '韩景夫', '18710047004', '2018年12月05日', '5000万元', '北京市', '北京市', '东城区', null, '北京市东城区青龙胡同甲1号、3号2幢3层316室', '北京市', '北京市', '西城区', '展览路街道', '北京市海淀区三里河路15号中建大厦B座7层', '', '消防信息化,电气防火,消防安全评估', '有限责任公司（法人独资）', '2018年12月05日', '长期', '', '', '', '91110101MA01G04Y95', '', '旅游资源开发；组织文化艺术交流（不含营业性演出）；体育运动项目经营（高危险性运动项目除外）；健康咨询、管理（须经审批的诊疗活动除外）；旅游信息咨询；设计、制作、代理、发布广告；技术开发、技术服务、技术咨询、技术转让、技术推广；会议服务；承办展览展示；翻译服务；影视策划；市场调查；电脑动画设计、制作；图文设计、制作；摄影、扩印服务；礼仪服务；婚庆服务；版权贸易；计算机系统服务；应用软件服务；产品设计；酒店管理；物业管理；餐饮管理（未取得专项许可不得经营餐饮服务）；销售日用品、针纺织品、工艺品、体育用品、文化用品、计算机、软件及辅助设备、服装、鞋帽、家用电器、电子产品、黄金制品、汽车配件、化妆品；境内旅游业务；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计、境内旅游业务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中建文化旅游发展有限公司，隶属于中国中建设计集团有限公司，是中国建筑股份有限公司组织体系内文旅板块唯一专业公司。公司紧跟文化消费与旅游度假时代的新趋势，高水准建构研究策划与规划设计板块，打造了策划、规划、设计、建造、运营一体化轻资产运营模式下的产业整合与全过程咨询服务模式。以创新为竞争力，从理念、产品、技术、服务等多重纬度为旅游行业发展提供全过程服务。其中，规划业务涵盖全域旅游规划、旅发大会规划、体旅融合规划、旅游景区创建和提升规划、旅游度假区总体规划和修建性详细规划等各类专项规划。同时，也提供针对旅游特色小镇、美丽乡村、风景道绿道、运动专类公园等各类文体旅融合产品的设计建设运营一体化服务。\n目前，中建文化旅游发展有限公司已形成文旅智库团队、项目开发团队、产业运营团队、核心管理团队30余人，核心骨干20余位。建立了“中建文旅专家库”，汇集了一批一流旅游专家，包括学术专家、规划设计专家、运营管理专家、投融资专家等，对外提供高品质培训与咨询服务。未来，中建文旅还将打造一支泛旅游全产业链策划、规划、设计、施工、运营、营销一体化百人规模的“钢铁部队”。公司业务主要布局于北京、河北、山东和内蒙', '116.423361', '39.948624000000002', '116.332548', '39.928908', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3506', '北京中宇京安工程技术有限公司', '1043', '姬芝', '13911197508', '张静静', '13681506756', '2014年05月07日', '1500万元', '北京市', '北京市', '朝阳区', null, '朝阳路67号9号楼1单元1101', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '朝阳路67号9号楼1单元1101', '', '消防产品', '有限责任公司（自然人投资或控股）', '2014年05月07日', '2034年05月06日', '', '', '', '911101050994470391', '', '技术推广服务；投资咨询；维修消防设备（不含特种设备）；销售建筑材料（不从事实体店铺经营）、装饰材料（不从事实体店铺经营）、社会公共安全设备及器材；工程咨询；技术检测。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '本公司成立于2017年5月，公司位于北京市朝阳区朝阳路67号9号楼1单元1101。主要从事技术推广服务；技术咨询；维修消防设备。', '116.535989', '39.917003999999999', '116.535989', '39.917003999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3507', '北京中消永汇科技有限公司', '1042', '赵霞', '13910859688', '庞傲丽', '13717899907', '2017年11月22日', '210万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南法信镇信中街12号院7号楼1层102室', '北京市', '北京市', '顺义区', '仁和地区办事处', '北京市顺义区南法信镇信中街12号院7号楼1层102室', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2017年11月22日', '长期', '2018/7/31', '2019/7/30', '京消协培证字（2018）009号', '91110113MA018XNP2E', '', '技术开发、技术咨询、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中消永汇科技有限公司成立于2017年，注册资金210万，公司占地面积822平方米，公司依据社会消防安全机构设置要求，设置各种先进的消防模拟装置14套，设备、器材30余台。公司主要服务于企事业单位消防负责人员安全专项服务，技术咨询、技术服务的公司。公司依照公安部发布《社会消防安全培训机构设置与评审》要求，组建具有多年培训及行业经验的管理人员、培训人员11人，高级工程师2人，工程师人10余人，公司设置三个理论培训教室，可同时培训200余人，均配有多媒体教学系统，230平方米实操培训场地，全套消防系统设备、设施供学员培训使用，公司以“专注安全，生命至上”为核心价值，希望通过我们的专业水平和不懈努力，重塑企事业单位安全意识的思想，为加强消防教育培训工作提高公民消防安全素质，有效预防和减少火灾，提供服务指导。同时还建立了完善的售后服务体系，为企业发展中遇到的问题和困难提供指导帮助。我们相信，通过我们的不断努力和追求，一定能够实现“全民消防、生命至上”的理念！', '116.61433599999999', '40.120570000000001', '116.61433599999999', '40.120570000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3508', '北京京盾永安消防设备销售中心', '1041', '娄文连', '13701133984', '娄文连', '13701133984', '2002年09月26日', '50万元', '北京市', '北京市', '海淀区', null, '体院西路甲二号6号平房', '北京市', '北京市', '海淀区', '上地街道', '体院西路甲二号6号平房', '', '消防设施,消防产品', '集体所有制（股份合作）', '2002年09月26日', '2052年09月25日', '2018/7/19', '2019/7/18', '京消协（2018）证书237号', '91110108742606044N', '', '销售安全消防器材、交通运输设备、五金交电、建筑材料；维修、检测消防器材；技术服务、技术咨询。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司成立于2002年，位于北京市海淀区中关村科技园区。本公司将凭着多年的专业经验，以“最好的产品质量、最优惠产品的价格”为您提供优质、高效、可靠、安全的消防产品。\n北京京盾永安消防设备销售中心是一家集专业仓储批发各类消防器材，灭火器专业维修检测为一体的专业批发企业，所销售的消防产品全部获得公安部消防产品合格评定中心颁发的认证证书及相关检测报告。本公司主营：消防灭火防护设备，消防水带，接口水枪，干粉灭火器，二氧化碳灭火器，消防应急照明灯，疏散指示标志灯，手动报警按钮，气体自动灭火系统，自动喷淋灭火系统等各类消防器材，各种规格成套消火栓箱，专业年检维修充装各种灭火器，消防电气设施检测及维保，消防安装改造。定做各种道路交通设施标识标牌。\n北京京盾永安消防设备销售中心将始终以“质量是立业之道，诚信乃成功之本”的坚定信念，愿与社会各界同仁携手共同致力于消防事业的发展做出贡献。', '116.315507', '40.020398999999998', '116.315507', '40.020398999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3509', '北京吉麦克商贸有限公司', '1040', '任朝富', '13911755263', '任朝富', '13911755263', '2013年08月16日', '500万元', '北京市', '北京市', '海淀区', null, '北京市海淀区远大路39号1号楼7层703-6号', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区远大路39号1号楼7层703-6号', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年08月16日', '2033年08月15日', '2018/7/6', '2019/7/5', '京消协（2018）证书218号', '91110108076605313R', '', '销售机械设备、电子产品、计算机、软件及辅助设备、家具、建筑材料、汽车零配件、通讯设备、工艺品、家用电器、金属材料、文化用品、服装、鞋帽、花、草及观赏植物、医疗器械（限一类）；货物运输代理；货物进出口、代理进出口；企业管理咨询；设计、制作、代理、发布广告；电脑动画设计；厨房设备的清洗；技术开发、技术服务、技术咨询、技术转让。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京吉麦克商贸有限公司是开发、销售、UV油烟净化设备，并承接烟道清洗工程，从事保洁服务的现代新型环保公司。公司理念：不懈的努力、不懈的追求是本公司永保活力的源泉；科学灵活的经营管理是本公司的成功的保证；客户至上，信誉第一，奉行诚信服务，是本公司赖以发展的宗旨。在签订合同的同时，以双方认可的样板为基础，互惠互助的合作的原则达成协议，以客户满意为验收标准。员工实行统一管理、统一形象、统一培训并注重企业形象力。所有上岗人员均经过严格的培训和考核。跟踪世界清洁技术发展潮流，引进先进的清洁设备、清洁用品及先进的清洁保养理念，对高校、写字楼、酒店、机关单位的清洁管理运作贯以严格管理和规范服务。拥有一流的机械设备、进口高效清洁剂一套完整的清洗保洁质量保证体系，严格按照服务程序，倡导星级保洁。洗涤机、抛光机、吸尘器、吸水机、烘干机、干洗机等都为意大利产品。对清洁行业中系列难处理的棘手问题都有独到的处理方法，比如厨房油污、卫生间污垢、水泥垢等等都可以做到洁白如新。\n特别指出：北京吉麦克商贸有限公司对厨房油烟机、油烟管道有独到的处理方法，”', '116.276718', '39.957191999999999', '116.276718', '39.957191999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3510', '北京宏金华市政工程有限公司', '1039', '张新利', '13801051222', '韩潮', '13811188616', '2016年06月12日', '200万元', '北京市', '北京市', '通州区', null, '北京市通州区通朝大街233号（北京北机机电工业有限责任公司.1幢）', '北京市', '北京市', '通州区', '北苑街道', '北京市通州区通朝大街233号（北京北机机电工业有限责任公司.1幢）', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年06月12日', '2066年06月11日', '', '', '', '91110112MA00668K0K', '', '工程勘察设计；施工总承包；专业承包；城市园林绿化；城市生活垃圾清扫、收集、处理；建筑工程项目管理；劳务分包；建筑物清洁服务；电脑图文设计；承办展览展示；组织文化艺术交流活动；污水治理；棋牌服务；园林景观设计；大气污染治理；零售厨房用具、机械设备；害虫防治服务；清洁服务；生活清洗、消毒服务。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京宏金华市政工程有限公司2016年6月注册成立。公司经营范围有：工程勘察设计；工程总承包；专业承包；城市园林绿化；城市生活垃圾清扫、收集、处理；建筑工程项目管理；劳务分包；建筑物清洁服务；电脑图文设计；承办展览展示；污水处理；园林景观设计；组织文化艺术交流；棋牌服务；大气污染治理等。公司注重副中心环境与资源的保护以及公共消防安全。公司成立以来主动参加年度报告，真实、及时的公示信息，依法纳税，依法缴纳社会保险，自觉履行法定义务，严格遵守法律，诚实守信经营。', '116.63881000000001', '39.892944', '116.63881000000001', '39.892944', '', null, null, null, null);
