INSERT INTO `t_fc_company` VALUES ('3512', '祖强科技(北京)有限公司', '1035', '宋建平', '18140228628', '骆升平', '15811046441', '2015年10月16日', '5000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区酒仙桥东路18号B座7层', '北京市', '北京市', '朝阳区', '将台地区办事处', '北京市朝阳区酒仙桥东路18号B座7层', '', '消防产品', '有限责任公司（自然人投资或控股）', '2015年10月16日', '2065年10月15日', '', '', '', '91110114MA001BPB18', '', '薄膜太阳能系列产品、移动能源系统、太阳能电池及光伏发电储能电池系统、航空无人机、机械电气的技术开发；节能环保技术咨询、技术服务；产品设计；企业管理；租赁机械设备；维修专用设备；合同能源管理；货物进出口、代理进出口、技术进出口；销售专用设备、电子产品、通讯设备、建筑材料、五金交电、文化用品、体育用品、日用品、厨具、服装鞋帽、工艺美术品、计算机软硬件及外围设备、汽车；经济信息咨询（不含中介）；承办展览展示；会议服务；组织文化艺术交流活动（不含演出）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '祖强科技（北京）有限公司是一家以柔性薄膜太阳能技术为基础，拥有自主集成创新核心能力，提供移动能源整体解决方案和无人机系列装备制造的供应商。公司在移动能源领域拥有完全自主知识产权的关键核心技术和高素质研发团队，研究开发了移动能源、无人机两大类共计六款产品，适用于应急、安防、抢险救灾等各类应用场景。公司秉承“一分应急，十分保障”的理念，为客户和合作方提供优质的产品及服务解决方案。', '116.49955199999999', '39.974615999999997', '116.49955199999999', '39.974615999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3513', '华信中安（北京）保安服务有限公司', '1033', '刘新', '63831616', '刘艺桐', '63831616-8216', '2010年12月23日', '10000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰北路甲45号楼2层201', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区郭庄子甲一号', '', '消防安全评估', '有限责任公司（自然人投资或控股）', '2010年12月23日', '2030年12月22日', '', '', '', '911101065674751381', '', '门卫、巡逻、守护、安全检查、安全技术防范、随身护卫；技术开发；技术转让；劳务派遣；劳务服务；组织文化艺术交流活动；经济信息咨询；市场营销策划；企业形象策划；承办展览展示；摄影服务；货物进出口、代理进出口、技术进出口；销售电子计算机软硬件及辅助设备、机械电器设备；物业管理；机动车公共停车场服务；清洁服务；家政服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '华信中安集团是在华信中安（北京）保安服务有限公司、华信中安（北京）保安技术服务有限公司、华信中安教育培训学院的基础上组建成立的，注册资金10000万元人民币，是以安全服务为核心，具有现代化、国际化、专业化管理水平的大型安保集团公司，为客户提供可靠的安全咨询、安全风险评估、职业技能培训、安防消防系统集成及维护保养、保安服务、海上武装护航、海外陆地安保等一体化安保解决方案。\n华信中安集团在全球拥有超过26,000名员工，拥有一支管理水平先进、技术手段领先、专业素质过硬的服务团队，及一支由中、外资深安保专家组成的顾问团队，并与国内、外多家知名保安组织和机构建立了长期的专业合作伙伴关系，在境外21个国家设立了分支机构和办事处，服务客户遍及全球，为客户提供全方位的安全保障。\n华信中安集团将坚持秉承军人品质，坚持以务实、专业、可靠、超越的精神经营企业，注重标准建设与行业合作，引进国外先进科技和理念，增强核心竞争力，打造卓越的安保综合服务商，努力满足客户的安全需求，持久为客户创造价值，积极承担社会责任，成为中国安保行业的引领者。', '116.30037', '39.867035000000001', '116.244927', '39.862926000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3514', '北京华涛恒泰安全技术有限公司', '1032', '崔有华', '13051316015', '崔有华', '13051316015', '2019年07月08日', '500万元', '北京市', '北京市', '通州区', null, '北京市通州区张家湾镇北大化村116号9栋二层61', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区东四环南路53号院2号楼706', '', '消防产品', '有限责任公司（自然人独资）', '2019年07月08日', '2069年07月07日', '', '', '', '91110112MA01L97B1P', '', '技术服务、技术转让、技术推广、技术咨询、技术开发；软件开发；应用软件服务；计算机系统服务；基础软件服务；销售消防器材、建筑材料、装饰材料、电气设备、空调制冷专用设备、五金交电（不含电动自行车）、化工产品（不含危险化学品）；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京华涛恒泰安全技术有限公司成立于2019年7月，主要服务领域：技术服务、技术转让、技术推广、技术咨询、技术开发、软件开发、应用软件服务；计算机系统服务；基础软件服务；销售消防器材、建筑材料、装饰材料、电气设备、空调制冷专用设备、五金交电（不含电动自行车）、化工产品（不含危险化学品 ）、维修消防器材。公司拥有最齐全的灭火器年检、检测设备。\n\n公司愿景：中国企业消防行业专业品牌！\n公司使命：创造价值，为中国民营企业可持续性发展而奋斗不息！\n服务理念：专心、专注、专业！\n服务精神：以品质求生存、凭服务创口碑！', '116.692002', '39.793768', '116.48553699999999', '39.863339000000003', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3515', '北京华恒智远环保科技有限公司', '1031', '王培', '13910726072', '胡燕', '15311191063', '2017年07月25日', '500万元', '北京市', '北京市', '通州区', null, '北京市通州区经济开发区聚富苑产业园区聚和六街1号-1502', '北京市', '北京市', '通州区', '于家务回族乡', '北京市通州区经济开发区聚富苑产业园区聚和六街1号-1502', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年07月25日', '2037年07月24日', '', '', '', '91110112MA00GG2M0K', '', '技术服务、技术转让、技术开发、技术推广、技术咨询；建筑物清洁服务；销售环保专用设备；专业承包；劳务分包；维修环保专用设备（仅限上门维修）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）。', '北京华恒智远环保科技有限公司于2017年7月成立，公司地址位于北京通州经济开发区。公司为企业提供环境污染问题综合解决方案、净化工程实施和运营维护等一体化服务。业务覆盖VOCs治理、水污染治理、油烟治理、净化设备运营维护、油烟净化设备清洗、环保管家等服务。2018年营业额1000余万元，实施工程百余例，如承德凯润车间废气净化工程，漷县镇中心区污水处理厂水质采样项目，汇顺汽车净化设备维护项目，通州马驹桥镇汽配城油烟改造工程，各类餐饮单位油烟净化设备清洗服务等。公司秉承“绿色发展、安全至上”的经营理念，致力于打造优质的运维服务团队，让客户省心、省力和省钱。', '116.703452', '39.686781000000003', '116.703452', '39.686781000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3516', '北京东霖消防科技有限公司', '1030', '晋宝生', '67806832', '白相东', '15503169743', '2013年03月14日', '12687.32万元', '北京市', '北京市', '大兴区', null, '北京经济技术开发区科创七街29号院4号楼', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京经济技术开发区科创七街29号院4号楼', '', '建筑防火,消防设施,宣传教育培训,消防信息化,消防产品', '有限责任公司（自然人投资或控股）', '2013年03月14日', '2033年03月13日', '', '', '', '91110302064943470R', '', '技术开发、技术服务、技术转让、技术咨询；销售消防器材、I类医疗器械、化工产品（不含一类易制毒化学品及危险化学品）、机械设备、五金交电、电子产品、通讯设备、照相器材、建筑材料、计算机软硬件及辅助设备、金属材料、仪器仪表；经济信息咨询（不含行政许可的项目）；会议服务；承办展览展示活动；投资管理；设计、制作、代理、发布广告；电脑图文设计、制作；计算机系统集成；文艺创作；数据处理（数据处理中的银行卡中心、PUE值在1.5以上的云计算数据中心除外）；组装生产智能消防疏散及人员追踪定位系统；生产独立性喷淋灭火装置及独立式烟感探测器；生产组装信息传输装置机箱；生产组装智能家用空气质量检测仪产品；生产高分子、水基型环保灭火剂（器具）产品；互联网信息服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东霖消防科技有限公司坐落于北京经济技术开发区，注册资本1.27亿元，是具有独立法人资格的现代国家级高新技术企业、中关村高新技术企业、双软认定企业，并获得多项知识产权及国家专利。公司主要从事：智能消防疏散系统、单兵作战定位系统及智慧消防物联网系统、有害气体探测自动控制系统、独立式智能喷淋报警系统、独立式烟感火灾报警器、高效水系灭火瓶、高分子灭火凝胶等产品的开发、设计、生产制造、销售与服务。公司现有的研发团队：由2名教授、5名博士学历的专家以及40余名本科以上学历的技术专业人员共同组成。强大的软、硬件开发实力是我们领先于国内同行的有力保证。同时，东霖科技联合公安部沈阳消防研究所和上海消防研究所共同制定“十三五智慧应急指挥系统平台”的标准，并参与后期的开发工作。', '116.537842', '39.798307999999999', '116.537842', '39.798307999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3517', '北京振海名泉商贸有限公司', '1029', '段海彦', '13911341897', '李振兵', '13269999979', '2012年07月04日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区姚家园西里甲7号院1号楼1层24号', '北京市', '北京市', '朝阳区', '平房地区办事处', '北京市朝阳区姚家园西里甲7号院1号楼1层24号', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年07月04日', '2032年07月03日', '', '', '', '91110105599655942N', '', '销售日用品、机械设备、电子产品、五金交电（不含电动自行车）、建筑材料、文具用品；清洁服务（不含餐具消毒）；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京振海名泉商贸有限公司办公室地址位于中国的首都，政治、文化中心北京，北京 北京市朝阳区姚家园西里甲7号院1号楼1层24号，于2012年07月04日在朝阳分局注册成立，注册资本为200 万元 人民币，在公司发展壮大的7年里，我们始终为客户提供好的产品和技术支持、健全的售后服务。', '116.512438', '39.942788999999998', '116.512438', '39.942788999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3518', '京诚华信（北京）科技发展有限公司', '1027', '陈少华', '13261625266', '陈少华', '13261625266', '2019年07月08日', '100万元', '北京市', '北京市', '石景山区', null, '北京市石景山区石景山路乙18号院5号楼12层1312', '北京市', '北京市', '石景山区', '八宝山街道', '北京市石景山区石景山路乙18号院5号楼12层1312', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年07月08日', '2049年07月07日', '2015/6/15', '2020/6/14', '中消协证书第1128号', '91110107MA01L9PM65', '', '技术开发；技术交流；技术转让；技术推广；技术服务；技术咨询；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；害虫的防治服务；灭鼠及预防；保洁服务；餐饮管理；企业管理；物业管理；设计、制作、代理、发布广告；销售日用品、服装、鞋帽、针纺织品、皮革制品、工艺礼品、玩具、化妆品、钟表、眼镜、五金交电(电动自行车除外）、电子产品、电子元器件。批发、零售食品。（企业依法自主选择经营项目，开展经营活动；批发、零售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司经营范围为：技术开发；技术交流；技术转让；技术推广；技术服务；技术咨询；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；害虫的防治服务；灭鼠及预防；保洁服务；餐饮管理；企业管理；物业管理；设计、制作、代理、发布广告；销售日用品、服装、鞋帽、针纺织品、皮革制品、工艺礼品、玩具、化妆品、钟表、眼镜、五金交电(电动自行车除外）、电子产品、电子元器件。批发、零售食品。（企业依法自主选择经营项目，开展经营活动；批发、零售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '116.224519', '39.905766999999997', '116.224519', '39.905766999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3519', '北京蔚穆嘉城科技有限公司', '1025', '孙淑江', '13552494889', '张常龙', '13910725666', '2019年05月21日', '1080万元', '北京市', '北京市', '通州区', null, '北京市通州区砖厂北里142号楼4层5442', '北京市', '北京市', '通州区', '玉桥街道', '北京市通州区砖厂北里142号楼4层5442', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年05月21日', '长期', '', '', '', '91110112MA01K9L21G', '', '技术开发、技术转让、技术咨询、技术服务、技术推广、技术检测；租赁建筑工程机械、建筑工程设备；建筑物清洁服务；零售电气设备、节能专用设备、环保专用设备、空调制冷专用设备、水处理专用设备、建筑材料、金属制品、五金交电（不含电动自行车）、办公用品、厨房用具、橡胶制品、日用品、消防器材、电子产品、通讯设备；害虫防治服务；产品设计；大气污染治理；水污染治理；日用电器、家用电子产品修理（不符合家用电子电器维修业服务经营规范不得开展经营活动）；安装家用电器；委托加工不锈钢专用设备、环保专用设备；城市园林绿化；施工总承包；专业承包；劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）。', '北京蔚穆嘉诚科技有限公司，前身为北京宇兴恒盛厨房设备有限公司，一直专注于餐饮厨房设备的研发及安装销售一条龙公司，为了致力于客户体验，特于2019年5月成立北京蔚穆嘉诚科技有限公司，专注于油烟管道、中央空调风道的清洗服务，注册资本1080万元。公司一直致力于为企事业单位、宾馆酒店、餐饮场所的厨房排油烟设施、中央空调、玻璃幕墙等清洁保养服务，开发、生产、销售现代化新型清洁保洁产品，开展技术培训、连锁服务及中央空调与热能设备应用技术的研究。\n公司拥有一支稳定而优秀的员工队伍，具有强大的技术力量和施工能力，施工质量获得了客户和社会各界的广泛认同。历经多年的快速发展，蔚穆嘉诚在产品设计研发、清洗作业质量控制等方面均处于行业领先地位。具有完善高效的管理体系和服务团队，是一家集人才、技术、经验于一体的资深服务机构。        公司具有自主研发国内首创的机器人中央空调风道清洗技术，与世界同步，可根据不同的中央空调通风系统，制定出符合客服需求的个性化的清洗施工方案，能够洁净、高效的完成清洗任务；厨房设备和油烟管道清洗，公司有独特的清洗方法，能够高效解决各种问题。', '116.698138', '39.875335999999997', '116.698138', '39.875335999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3520', '清大东方教育科技集团有限公司', '1024', '周金峰', '13906701777', '马浒利', '13701078130', '2003年08月14日', '20000万元', '北京市', '北京市', '朝阳区', null, '广渠东路3号中水电国际大厦801', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '广渠东路3号中水电国际大厦801', '', '宣传教育培训', '有限责任公司（自然人投资或控股的法人独资）', '2003年08月14日', '长期', '', '', '', '9133088175304020X8', '', '消防教育技术开发、技术服务、技术咨询、技术转让；消防职业教育投资；消防信息化教育建设集成服务；云智能教育平台开发与营运。初、中、高级消防设施操作员培训(有效期至2022年11月26日）；消防科普宣传服务；消防教育软件研发与应用；其他社会消防安全知识项目推广服务；图书零售、图片批发；接受委托对消防队日常综合管理服务；家具销售，通信设备，计算机及辅助设备零售（依法须经批准的项目,经相关部门批准后方可开展经营活动）', '清大东方教育科技集团有限公司是专门从事社会消防安全教育培训的集团化公司，旗下清大东方消防职业培训学校成立于2006年3月，是国内最早开展社会消防安全教育培训的专业化培训机构之一。2016年集团抓住机遇，迅速在全国30个省、自治区、直辖市建成130所培训学校，是国内唯一集团化、连锁式经营的消防教育培训机构。集团管理层和社会培训高级讲师绝大多数为有20年以上消防工作经验的消防部队退休或自主择业警官，保证了消防教育培训的专业性和权威性。目前，集团培训业务除了消防设施操作员培训外，还开展了消防员培训、社会化培训、注册消防工程师培训和消防学历教育以及其他类安全领域培训等多种教育培训项目，涵盖了消防安全全部领域和社会各个层面。清大东方教育集团已经成为全国消防安全教育培训领域学校数量最多、师资力量最强、教学质量最优、培训范围最广、业内信誉最佳、社会影响最大的集团化连锁消防培训机构。集团十余年来累计向社会输送各类消防人才30余万人，组织社会消防安全培训3000余场。优质的教学质量得到广大学员和企业认可，被誉为消防培训的专家和消防人才的摇篮。', '116.502155', '39.893717000000002', '116.502155', '39.893717000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3521', '北京众合平安消防科技有限责任公司', '1023', '尹杰', '82032387', '李滨', '18519708498', '2016年05月17日', '200万元', '北京市', '北京市', '延庆区', null, '北京市延庆区八达岭镇营城子北路10号1幢一层', '北京市', '北京市', '延庆区', '八达岭镇', '北京市延庆区八达岭镇营城子北路10号1幢一层', '', '建筑防火,宣传教育培训,消防产品', '有限责任公司（自然人投资或控股', '2016年05月17日', '长期', '2018/7/12', '2019/7/11', '京消协（2018）证书229号', '91110229MA005HAR5G', '', '技术开发、技术咨询、技术服务；消防技术培训（不得面向全国招生）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司成立于2016年5月20日，注册资本200万元人民币，从业人员5人，主要从事：消防产品的技术开发、技术咨询、技术服务，消防技术培训。', '115.934309', '40.353839999999998', '115.934309', '40.353839999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3522', '北京科岚环保科技有限公司', '1022', '刘晓飞', '13051280726', '孙登霄', '13051286838', '2004年09月01日', '532.86万元', '北京市', '北京市', '昌平区', null, '北京市昌平区北七家镇歇甲村', '北京市', '北京市', '昌平区', '北七家镇', '北京市昌平区北七家镇歇甲村', '', '烟道清洗', '有限责任公司（自然人投资或控股', '2004年09月01日', '2024年08月31日', '', '', '', '911101147662521138', '', '生产静电式油烟净化器；环保技术开发、技术咨询、技术服务、技术转让；专业承包；销售环保设备、厨房用具、电子产品；租赁空气净化设备；劳务服务；货物进出口、代理进出口、技术进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京科岚环保科技有限公司是一家集环保技术研发、设计、制造、销售于一体的民营科技企业，公司总部位于北京，在国内多数城市设有分公司和办事处，同时在沧州市中捷产业园区拥有现代智能化制造基地，产品不仅畅销国内市场，也远销韩国、东南亚、中东、欧洲、美洲及港澳台等国家和地区。         \n 依靠科技求发展，自2002年以来，科岚一直专注于静电技术在空气污染防治、餐饮油烟、工业废气处理、自动节能烤炉等领域的应用，凭借领先的科技，精湛的工艺和卓越的品质，不断取得革命性突破，在充分引进和吸收国内外先进技术的基础上，陆续研发出多款具有卓越品质的KL系列化油烟净化产品、废气处理设备、厨房排烟系统智能设备、商用节能电烤炉。“科岚”产品先后通过ISO9001:2008质量管理体系认证、中国环境保护产品认证；并获得几十项国家专利证书。\n 业务范围：生产静电式油烟净化器；销售环保设备；租赁空气净化设备，劳务服务；环保技术开发、技术咨询、技术服务，提供相应售后服务', '116.438723', '40.076141', '116.438723', '40.076141', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3523', '北大青鸟环宇消防设备股份有限公司', '1020', '蔡为民', '13301296567', '邹瑶', '18600013590', '2001年06月15日', '18000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区成府路207号北大青鸟楼', '北京市', '北京市', '海淀区', '清华园街道', '北京市海淀区成府路207号北大青鸟楼', '', '', '股份有限公司（非上市）', '2001年06月15日', '无限期', '', '', '', '91130700730245739F', '', '消防设备研发、生产销售、代理；自营进出口业务；普通货运（仅限分支机构经营）。（法律、行政法规、国务院决定设定的许可经营项目，须取得许可并经登记机关登记后方可经营）', '北大青鸟环宇消防设备股份有限公司（以下简称“公司”、“青鸟消防”）成立于2001年6月15日，注册资本1.8亿元人民币，是一家以消防报警系统为核心，集研发、制造及物联网应用为一体的高新技术企业，经过18年的艰苦奋斗，目前已经发展成消防报警领域的第一内资品牌。\n公司拥有员工超过2,100人；依托60余家覆盖全国的经销商销售服务网络，公司一直保持着稳定快速的发展，近四年营收的复合增长率超过23%；公司在2018年实现营业收入17.8亿元、净利润3.4亿元，实际缴纳税金2.0亿元。\n公司拟于深交所中小板上市的IPO申请已于2017年4月获得了中国证监会发审委审核无条件通过，目前正在等待发行批文的下发。', '116.31891299999999', '39.993307000000001', '116.31891299999999', '39.993307000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3524', '北京市建设工程质量第二检测所有限公司', '1019', '张胜', '01088043368', '刘媛', '13811182920', '2007年04月05日', '2000万元', '北京市', '北京市', '西城区', null, '北京市西城区南礼士路62号10号楼', '北京市', '北京市', '西城区', '金融街街道', '北京市西城区南礼士路62号10号楼', '', '消防设施,电气防火,消防安全评估', '有限责任公司（法人独资', '2017年11月23日', '长期', '', '', '', '91110102660522816W', '', '建设工程质量检测；材料试验；技术开发、咨询、服务；计量器具检定。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本单位最早是依据北京市机构编制委员会（1987）京编事字45号批复、北京市城乡建设委员会（87）京建质字第123号通知、《北京市建设工程质量检测管理办法》和《北京市建设工程质量检测暂行规定》等文件规定成立，单位名称为“北京市建设工程质量检测中心第二检测所”，当时行政上隶属于北京市建筑设计研究院，业务上受北京市监督总站检测中心领导。1991年首次通过北京市质量技术监督局的计量认证。2003年5月通过了国家实验室认可，其认可名称为“北京市建筑设计研究院第二检测所”。依据中华人民共和国建设部令第141号《建设工程质量检测管理办法》的规定要求，于2007年4月5日在北京市工商局注册成为独立的法人机构，注册的机构名称为“北京市建设工程质量第二检测所”。2008年通过了检验机构认可。我公司资质认定（计量认证）、实验室认可和检验机构认可名称均为“北京市建设工程质量第二检测所”。2017年11月23日经注册更名为“北京市建设工程质量第二检测所有限公司”。我单位为独立法人，能独立承担第三方公正检测/检验，独立对外行文和开展业务活动，有独立帐目和独立核算。', '116.354738', '39.908760999999998', '116.354738', '39.908760999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3525', '中国建筑设计研究院有限公司', '1017', '宋源', '88328002', '赵锂', '88328008', '2014年07月24日', '30000万元', '北京市', '北京市', '西城区', null, '北京市西城区车公庄大街19号', '北京市', '北京市', '西城区', '展览路街道', '北京市西城区车公庄大街19号', '', '建筑防火,消防信息化,消防产品,电气防火', '有限责任公司（法人独资', '2014年07月24日', '长期', '', '', '', '91110000717843400B', '', '建筑工程设计、咨询；建筑智能化系统工程咨询、设计、施工、总承包；城市与小城镇规划；古建、园林与环境景观规划；历史文化遗产保护规划与申遗；国家建筑设计标准、规范、规程、产品标准的研究、开发、咨询、转让；房地产开发；工程总承包；建筑与住宅产业技术的研究、开发、咨询、转让、技术展览、展示；建筑材料及设备的开发、生产、销售；技术服务；工程制图及设备的开发、生产、销售；进出口业务；承包境外建筑工程和境内国际招标工程；承包上述境外工程的勘测、咨询、设计和监理项目；广告业务；办公设备、五金交电及日用百货的销售。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中国建筑设计研究院有限公司（以下简称“中国院”，英文标识CADG）隶属于国资委所辖的大型骨干科技型中央企业中国建设科技集团股份有限公司。\n    中国院秉承优良传统，始终致力于推进国内勘察设计产业的革新发展，将成就客户、专业诚信、协作创新作为企业发展的核心价值观，为中国建筑的现代化、标准化、产业化、国际化提供最为专业的综合技术咨询服务。\n    中国院现有职工近2000人。其中包括工程院院士2人，全国工程勘察设计大师5人，国家“百千万人才工程”人选3人；经国务院批准享受政府津贴的专家59人，国家级有突出贡献中青年专家10余人；各类国家职业注册人员400余人，高级设计、研究人员近500人。\n    中国院致力于打造建筑设计的专业化、全链条、一体化的服务式平台，为社会提供质量最优、服务最好、技术最强、效率最高的优质设计咨询服务。', '116.33825899999999', '39.933000999999997', '116.33825899999999', '39.933000999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3526', '中国中元国际工程有限公司', '1014', '刘小虎', '68732660', '韩伟', '68732736', '1987年08月15日', '62000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区西三环北路5号', '北京市', '北京市', '海淀区', '紫竹院街道', '北京市海淀区西三环北路5号', '', '消防安全评估', '有限责任公司（法人独资', '1987年08月15日', '长期', '', '', '', '911100001000064426', '', '对外派遣实施境外工程所需劳务人员；医疗器械经营；承包境外化工石化医药、机械、建筑工程和境内国际招标工程；工程勘测、咨询、设计、监理、管理和工程承包；进出口业务；设备承包；畜禽、汽车、钢材、铁矿砂、焦炭、焦油、化工产品（不含危险化学品）、设备、材料及成套设备采购、销售；建设工程招标代理；与上述业务相关的技术开发、技术转让、技术服务、咨询、展览和技术交流；机电设备安装工程、建筑智能化工程、建筑装饰工程、手术室洁净工程、空调洁净工程的专业承包；广告经营；消防安全评估。（企业依法自主选择经营项目，开展经营活动；医疗器械以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中国中元国际工程有限公司是集工程咨询、工程设计、工程总承包、项目管理、设备成套、装备制造和技工贸为一体的大型工程公司。\n公司具有工程设计综合资质甲级、建筑工程施工总承包壹级、专业承包壹级（电子与智能化工程、建筑装修装饰工程、消防设施工程、建筑机电安装工程）及对外承包工程资格证书及其相关资质，可以承接全行业、各等级的工程设计业务和从事工程设计资质标准划分的建筑、机械、医药、船舶、兵器、市政、商业、化工、能源、建材、轻工等21个行业的工程总承包、项目管理等业务及境外工程承包等业务；承接建筑工程施工总承包壹级资质范围内的施工总承包、工程总承包和项目管理业务。 \n公司具有城乡规划编制、工程监理、工程咨询、工程造价咨询甲级资质；具有压力管道设计资格；具有独立的进出口经营贸易权、对外经济合作资格证书、进出口企业资格证书、自理报关单位注册登记证书、工程招标代理机构资质证书、施工图设计文件审查许可证书及建筑装饰工程设计与施工资质证书；公司具有市政行业（载人索道）工程甲级设计资质证书、工程咨询单位（索道工程）、工程咨询单位（索道工程）项目管理和索道工程评估咨询资格证书。', '116.308442', '39.958156000000002', '116.308442', '39.958156000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3527', '睿佳智慧（北京）科技发展有限公司', '1013', '李继东', '18611889189', '李继东', '李继东', '1999年02月14日', '30万元', '北京市', '北京市', '东城区', null, '北京市东城区夕照寺西里9号', '北京市', '北京市', '朝阳区', '崔各庄地区办事处', '北京78-9信箱', '', '建筑防火,消防设施,宣传教育培训,消防信息化,消防产品,电气防火,消防安全评估', '有限责任公司（自然人投资或控股', '1999年02月14日', '2039年02月13日', '', '', '', '91110101700246706B', '', '教育咨询；销售日用百货、五金交电、机械电器设备、针纺织品、服装鞋帽、装饰材料、建筑材料、空调制冷设备、计算机软硬件及外部设备、汽车配件、文化体育用品；信息咨询（以上\"咨询\"均不含中介服务）；技术开发；计算机技术培训；技术转让。（未经专项审批的项目除外。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '睿佳智慧（北京）科技发展有限公司，是经北京市工商行政管理局东城分局注册，性质为有限责任公司。\n公司创建于 1999年，注册资本 30万元人民币。专业从事专业信息咨询服务与消防设备设施、建筑材料、五金销售，公司发展至今，已培养建立了一支以高科技人才为主的专业技术团队。90％具有大学及以上学历，其中具备中、高级职称的技术人员达到 60％以上。公司内部建立了科学的行之有效的企业管理体系，公司创建以来先后与香港利福国际集团、必维国际检测集团、欧尚（中国）有限公司、高纬环中国区建立了良好的合作关系，得到客户的一致好评。公司业务已扩展至上海、沈阳、哈尔滨、大连、天津、无锡、成都、海南等省市的业务，公司成立以来效益良好发展。\n公司本着以质量求生存，以信誉求发展的方针，以雄厚的实力，专业的技术，卓越的品质，优质的服务为客户提供优质的服务。', '116.439291', '39.891412000000003', '116.48988900000001', '39.997064000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3528', '琪舰消防工程有限责任公司', '1011', '范伟博', '13911760088', '赵然', '13811757523', '2002年06月09日', '5000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区马坡镇毛家营村南大街2号', '北京市', '北京市', '顺义区', '马坡地区办事处', '北京市顺义区马坡镇毛家营村南大街2号', '', '建筑防火', '有限责任公司（自然人投资或控股', '2002年06月09日', '2022年06月08日', '', '', '', '911101137400609145', '', '专业承包；施工总承包；工程设计；工程项目管理；消防设施检测、电气消防安全检测；机械、电子设备安装；消防设备维修；销售消防器材；清洁服务；技术咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '琪舰消防工程有限责任公司，成立于2002年，注册资金5000万元。下设张家口、三亚、湖南、重庆分公司。具有消防工程设计国家甲级资质、消防设施工程专业承包壹级资质，并拥有电子与智能化专业承包资质和建筑机电安装工程专业承包资质。专业从事消防设施、机械、电子设备安装、调试和维修保养，以及电气、消防设施检测、火灾探测器清洗、烟道清洗、消防器材销售，以及城市消防远程监控系统的安装与服务。公司先后通过ISO9001、ISO14001、OHSMS三标一体认证和AAA质量资质等级认证。', '116.608098', '40.184213999999997', '116.608098', '40.184213999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3529', '北京市洁迅达保洁服务有限公司', '1010', '张中洲', '13601059285', '张丽娟', '18601229828', '2000年06月13日', '185万元', '北京市', '北京市', '通州区', null, '北京市通州区砖厂北里142号楼7层4707', '北京市', '北京市', '通州区', '玉桥街道', '北京市通州区砖厂北里142号楼7层4707', '', '烟道清洗,消防产品,消防安全评估', '有限责任公司（自然人独资）', '2000年06月13日', '2020年06月12日', '', '', '', '91110102717786346G', '', '建筑物清洁服务；技术服务、技术培训（不得面向全国招生）、技术开发、技术咨询、技术转让；电脑图文设计；大气污染治理；企业管理咨询；零售专用设备、花卉、厨房设备；专业保洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京市洁迅达保洁服务有限公司是2000年在国家工商局注册的正规服务机构，注册资金185万。公司主要从事星级酒店、食堂、学校、机关单位等大型厨房油烟管道清洗；厨房设备节能减排；外墙清洗；石材翻新、结晶、养护；写字楼开荒等各种业务服务。公司一贯遵循“客户至上、至诚至信”的服务精神，坚持“高定位、高质量、高效率”的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具有严格专业素质的管理及施工人员。本公司采用美国进口的清洁设备及意大利进口的清洁药剂，具有承揽大型工程所需的配套设施及能力，可以为不同领域客户提供全方位的满意服务。', '116.698138', '39.875335999999997', '116.698138', '39.875335999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3530', '中消云（北京）物联网科技研究院有限公司', '1008', '肖祖德', '13723479034', '郑飞', '18862119119', '2016年06月29日', '2000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区翼之城3号楼506室', '北京市', '北京市', '顺义区', '李桥镇', '北京市顺义区翼之城3号楼', '', '消防信息化,消防产品,电气防火', '有限责任公司（法人独资', '2016年06月29日', '长期', '', '', '', '91110113MA006NLW86', '', '计算机软硬件技术开发、技术咨询、技术转让、技术服务；销售安全技术防范产品、消防器材、通讯器材、电子产品；产品设计；软件开发；计算机系统集成服务；安装安全技术防范产品；货物进出口、技术进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中消云(北京)物联网科技研究院有限公司是一家基于物联网、云计算、大数据的智慧城市安全应急服务项目投资建设与运营的国家级高新技术企业。智慧城市安全应急服务项目覆盖应急、治安、安监、交通、智慧消防、环保、医疗、金融、卫生防疫、自然灾害等领域，是智慧城市/平安城市的核心组成部分。公司通过不断的技术创新和模式创新，近年来在全国投资建设了多个覆盖社区、街道、乡镇的智慧安全项目，并与中国移动、中国电信、中国联通、华为、中国平安等企业建立战略合作伙伴关系，在智慧城市、平安城市、智慧社区、智慧消防，消防物联网平台,等领域展开广泛合作。已成为中国智慧城市安全应急服务项目投资建设与运营的先行者。', '116.64156199999999', '40.043011999999997', '116.642234', '40.046498999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3531', '北京阿科普机电工程有限公司', '1007', '黄智勇', '13501170935', '张逸', '13031117851', '1992年10月30日', '4000万元', '北京市', '北京市', '石景山区', null, '实兴大街30号院3号楼2层D-0943房间', '北京市', '北京市', '海淀区', '羊坊店街道', '复兴路33号翠微大厦东座12层', '', '建筑防火,消防设施,消防产品', '其他有限责任公司', '1992年10月30日', '2022年10月29日', '', '', '', '911101076000040059', '', '消防设施专项工程设计、施工；建筑智能化系统集成专项工程设计、施工；智能建筑系统集成及其软件的开发和应用；技术咨询、技术服务；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京阿科普机电工程有限公司创立于1992年，首次将气体灭火产品FM200引入中国。公司集研究开发、市场营销、咨询服务、施工调试、培训维保为一体，取得住建部颁发的消防专项工程设计施工双甲资质。经过26年的稳步发展，阿科普保持行业领先地位和业绩的稳步增长，扎根北京，在深圳、成都、长沙等地创立了分公司，为全国500多项重点工程的安全保驾护航，业务范围涉及国家政府机关、商业金融、航空、医院、商厦、酒店、写字楼、体育场馆、博物馆等公共行业领域，赢得了广大用户的信赖和支持。\n26年在建筑行业砥砺前行，目前建筑行业成本日益提高，消防产品低质低价竞争激烈。作为行业领头羊，我们有义务推动消防行业技术革命，将领先的消防产品引入中国。同时探索新的经营模式，用新的管理理念带领全体员工践行“一带一路”，为中国楼宇安全保驾护航。', '116.19359300000001', '39.939335', '116.303904', '39.908237999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3532', '北京市劳动保护科学研究所', '1006', '张斌', '010-63536974', '王培怡', '13810100198', '2016年04月07日', '5000万元', '北京市', '北京市', '西城区', null, '北京市西城区陶然亭路55号', '北京市', '北京市', '西城区', '陶然亭街道', '北京市西城区陶然亭路55号', '', '建筑防火,宣传教育培训,消防产品,事故调查,消防安全评估', '事业单位', '2016年04月07日', '2021年04月07日', '', '', '', '121100004006858114', '', '开展安全科学和环境科学研究，促进科技发展。安全工程环境工程设计 劳动保护环境保护技术开发 噪声振动控制技术开发 空气污染控制及检测 城市有毒有害易燃易爆危险源分析研究和防护 危险化学品应急和防护技术研究与服务 安全评价 环境影响评价 职业安全卫生评价 劳动防护用品和环境保护产品检测 室内环境检测 建筑材料及节能检测 环境和安全仪器仪表研发 中试产品经营 个体防护技术与电磁防护技术开发 相关技术咨询、技术培训、技术服务、成果转让 主办《安全》期刊及广告', '北京市劳动保护科学研究所成立于1956年，原隶属劳动部，是全国第一家经国务院批准成立的从事安全、环境与职业卫生领域研究的综合性科研机构，是国务院学位委员会批准的首批硕士学位授予单位。1972年划归北京市管理，作为市属公益性科研事业单位，现隶属于北京市科学技术研究院。劳保所主要致力于城市安全与治理领域的应用基础研究和重大公益研究，在成果转化的主战场上瞄准未来30年首都经济发展需求，着力产出能支撑北京市的重大工程或重大民生关切的重大成果，着力解决首都以及京津冀发展中的城市安全与治理重大科技问题。劳保所集科研开发、技术成果转化、技术服务及教育为一体，确立了“规范管理、人才优先、做强产业、服务全国”的发展战略，以及“增强创新能力，服务首都建设”的办所宗旨。全所共拥有2个国家级中心、1个国家级培训基地、1个国家级检测平台、3个北京市重点实验室、4个市委办局技术支撑中心、1个北京市国际合作基地、1个北京市科普基地。重点研究方向包括：安全风险评估与预测预警、事故处置与应急救援、职业危害风险评估与控制、区域空气质量模拟及人体健康风险评价技术研究等等。', '116.376448', '39.878889000000001', '116.376448', '39.878889000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3533', '北京市城市规划设计研究院', '1005', '施卫良', '', '何闽', '88073950', '1992年05月04日', '', '北京市', '北京市', '西城区', null, '北京市西城区南礼士路60号', '北京市', '北京市', '西城区', '金融街街道', '北京市西城区南礼士路60号', '', '建筑防火,法规政策,消防安全评估', '全民所有制分支机构（非法人）', '1992年05月04日', '无限期', '', '', '', '12110000400709406D', '', '城市规划设计甲级、建筑、市政（给排水）工程初步设计乙级；房地产评估。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京市城市规划设计研究院（简称北京市规划院）是北京市规自委（原规划委）所属负责编制城乡各项规划的事业单位，是国家建设部批准的甲级资质规划设计单位，国家文物局批准的文物保护工程勘察设计甲级资质单位、中国水利水电勘测设计协会批准的建设项目水资源论证资质证书地表水、地下水甲级（农林牧渔、水利水电、食品药品、建筑、其他服务业）；地表水、地下水乙级（机械制造），中国水利水电勘测设计协会批准的水文、水资源调查评价乙级资质单位。其主要职能是为市政府对城市建设宏观决策及各项建设提供规划服务。为北京市公安局消防局提供技术支持，承担了《消防站点规划》、《北京城市消防规划（2016年—2035年）》、《朝阳区消防队站专项规划》编制等重点工作。', '116.353337', '39.910038999999998', '116.353337', '39.910038999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3534', '北京岩铄永合环保科技有限公司', '1003', '陈运晓', '13683540653', '冀亚恒', '13520933602', '2009/7/28', '100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区上庄镇上庄村279号', '北京市', '北京市', '海淀区', '上庄地区办事处', '北京市海淀区上庄镇上庄村279号', '', '烟道清洗', '有限责任公司（自然人投资或控股', '2016/9/26', '2046年09月25日', '', '', '', '91110108MN008HNE87', '', '技术开发、技术咨询、技术转让、技术服务、技术推广；销售五金、建筑材料、日用品、文化用品、体育用品、家用电器、工艺品、金属材料、安全技术防范产品、机械设备、计算机、软件及辅助设备、厨房用具；工程和技术研究与实验发展；工程勘察设计；城市园林绿化；物业管理；设计、制作、代理、发布广告；建筑物清洁服务；家庭服务（限符合家政服务通用要求）；水污染治理；大气污染治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京岩铄永合环保科技有限公司是一家以保洁服务、建筑物清洁服务为主的服务型企业，主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品。 北京岩铄永合环保科技有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。', '116.206109', '40.106917000000003', '116.206109', '40.106917000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3535', '北京奥博瑞技术服务有限公司', '1002', '周婷婷', '13910233476', '周婷婷', '13910233476', '2014年07月14日', '200万元', '北京市', '北京市', '丰台区', null, '北京市丰台区大成里秀园13号楼东侧楼三层(卢沟桥企业集中办公区）', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区大成里秀园13号楼东侧楼三层(卢沟桥企业集中办公区）', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年07月14日', '2034年07月13日', '2018/6/27', '2019/6/26', '京消协（2018）证书205号', '91110106306507007N', '', '销售汽车配件、五金交电、电子产品、机械设备、金属材料；汽车装饰；劳务服务；清洁服务；技术咨询、技术开发、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京奥博瑞技术服务有限公司成立于2014年，是经北京市工商行政管理局正式批准成立的专业保洁服务公司，是北京消防团体会员单位。专业从事酒店、食堂、学校、机关单位油烟管道清洗，烟道清洗，大型油烟机清洗服务的清洗技术公司，我公司将人性化的服务模式及专业的清洗技术融为一体，拥有严格的管理制度、先进的设备、一流的服务质量，精湛的技术。清洗维修技师都具备多年清洗、维修、 安装经验，并不断吸收新的技术和先进的检测设备来满足广大客户的需求。所有的工作人员上岗前都必须经过严格的岗前培训及思想素质的提升，并通过统一的考核方可上岗。公司的服务形式灵活多样，价格合理，并全心全意为客户提供细致周到的服务，客户的满意和认可是我们赖以生存的基础，也是我公司全体员工坚持不懈的追求目标,公司在运营中注重各方面的管理，定期对各岗位员工进行清洁技术培训，严格要求，积极进取，并且不断完善更加有效的管理体系，不断创新，不断前进，以尽善尽美的服务为每一位客户打造一个健康、洁净、舒适的美好环境！', '116.26260000000001', '39.892505999999997', '116.26260000000001', '39.892505999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3536', '北京航天三发高科技有限公司', '1001', '王延文', '', '王春豪', '13910565205', '1993/6/12', '3000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区云岗北区东里8号', '北京市', '北京市', '丰台区', '长辛店镇', '北京市丰台区云岗北区东里8号', '', '消防产品', '有限责任公司（法人独资', '2008年09余e22ri', '2058年09月21日', '', '', '', '91110106102127600Q', '', '技术开发、技术转让、技术咨询、技术服务、技术培训；专业承包；通用航空及无人机装备（含动力系统）的研发、设计、装配、营销及技术服务；销售金属制品、机械设备、电子产品、针纺织品、服装鞋帽、乐器、音响设备及配件、日用品、家用电器、服装辅料、五金交电（不从事实体店铺经营）；售电服务；货物进出口；技术进出口；代理进出口；普通运输；加工、制造喷涂设备、风机专用设备、工业自动化仪表及设备、电子元件、包装机械、包装器材（限分支机构经营）；销售食品；会议服务。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京航天三发高科技有限公司，是中国航天科工集团第三十一研究所下属具有独立法人资格的全民所有制企业。公司成立于1993年，注册资金3000万人民币。公司自成立以来持续打造非标工程研制、航空装备制造、包装维修产业、产品研发、营销贸易、LED照明六大企业核心能力，致力于试验技术、测试技术、自动控制、动力机械、仿真模拟技术、大型非标工程系统设计集成等，具有非标工程研制与建设、机械产品精密加工、电气及大功率LED灯具产品设计与生产、产品装配检测生产线研制等方面的综合实力。', '116.165237', '39.812314000000001', '116.165237', '39.812314000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3537', '北京攻垢清洁服务有限公司', '1000', '马亮', '13501390681', '马亮', '13501390681', '2017/1/16', '50万元', '北京市', '北京市', '平谷区', null, '北京市平谷区王辛庄镇北上营西路263号', '北京市', '北京市', '平谷区', '王辛庄镇', '北京市平谷区王辛庄镇北上营西路263号', '', '烟道清洗', '有限责任公司', '2017年01月16日', '2037年01月15日', '2018/7/6', '2019/7/5', '京消协（2018）证书220号', '91110117MA00BAXP91', '', '包括保洁服务、建筑物清洁服务；家庭劳务服务；技术推广、技术服务；销售日用品（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京攻垢清洁服务有限公司是一家以保洁服务、建筑物清洁服务为主的服务型企业，主要经营油烟管道清洁、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品。是经北京消防协会评审的专业公司，具备厨房烟囱清洗资质、员工均持证上岗， 北京攻垢清洁服务有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。\n我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念，始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为您提供最完美的服务。', '117.117558', '40.203664000000003', '117.117558', '40.203664000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3538', '北京悦祥润达消防器材技术有限公司', '997', '陈利利', '18801339626', '高杰', '13552010172', '2013年12月04日', '100万元', '北京市', '北京市', '朝阳区', null, '柳芳南里甲5号1号楼1至5层1-1三层3164号', '北京市', '北京市', '朝阳区', '左家庄街道', '柳芳南里甲5号1号楼1至5层1-1三层3164号', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年12月04日', '2033年12月03日', '', '', '', '91110105085532718F', '', '技术推广服务；清洁服务（不含餐具消毒）；销售厨房及卫生间用具、电子产品、五金交电、建筑材料、金属材料、化工产品（不含危险化学品及一类易制毒化学品）、仪器仪表。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京悦祥润达消防器材技术有限公司是通过国家工商局、税务局批准成立的合法保洁有限公司,成立于2013年，注册资金为一百万元。本公司拥有专业的施工团队和管理人员，所有施工人员上岗前都经过了严格的技术培训，在保洁清洗管理运作方面贯以严格管理和规范服务。\r\n我们的经营理念：\r\n专业为您营造一个更清洁、亮丽的生活和工作环境而努力！“诚信“是本公司成功的保证。\r\n“客户至上，信誉第一。”是本公司的宗旨。\r\n“给您多一份清洁、少一份劳累”是我们的原则;\r\n“第一时间提供一流的客户服务，维护客户利益、形象”是我们始终不渝的目标。\r\n优质服务：\r\n1.我们以客户为中心，公司规定各施工人员在施工中必须倾听客户的要求。\r\n2.我们有完善的客户管理系统，对客户定期回访，保证工程质量和后期维护。', '116.438571', '39.952792000000002', '116.438571', '39.952792000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3539', '北京拓思教育咨询有限公司', '996', '黄东', '13500339080', '黄东', '13500339080', '2015年12月28日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区天朗园c座3层03商业(丰收孵化器984号)', '北京市', '北京市', '朝阳区', '奥运村街道', '北京市朝阳区天朗园c座3层03商业(丰收孵化器984号)', '', '宣传教育培训', '有限责任公司（自然人独资）', '2015年12月28日', '2035年12月27日', '', '', '', '91110105MA002R7Y46', '', '教育咨询（不含出国留学及中介服务）；经济贸易咨询；会议及展览服务；设计、制作、代理、发布广告；组织文化艺术交流活动（不含演出）；承办展览展示活动；销售体育用品、文具用品、玩具、工艺品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京拓思教育科技有限公司，专注于执业资格证书——消防工程师人才培训的机构之一，公司有着强大的消防教育体系， 是一家致力于专业教育培训的机构，主要做招考信息咨询，报名，以及培训等业务。从2015年开始，面向全国进行招生，今年规模扩展咨询接待部门。此外，公司着力研发在线学习平台，多样化教学方式结合，始终为学员提供优质的教学服务，争创成为中国一流的教育培训机构。', '116.414097', '40.032276000000003', '116.414097', '40.032276000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3540', '北京创科天脉清洁服务有限公司', '995', '李志民', '13621321981', '李志民', '13621321981', '2019年07月03日', '100万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区大台商贸公司玉皇庙门市部2幢1至2层DT0310', '北京市', '北京市', '门头沟区', '大台街道', '北京市门头沟区大台商贸公司玉皇庙门市部2幢1至2层DT0310', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年07月03日', '长期', '', '', '', '91110109MA01L6T62H', '', '清洁服务；物业管理；劳务分包；建设工程项目管理；园林绿化；家居装饰设计；家政服务；建筑物外墙清洁服务；施工总承包；专业承包；工程设计。（企业依法自主选择经营项目，开展经营活动；施工总承包、专业承包、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司建于北京市门头沟区大台商贸公司玉皇庙门市部2幢1至2层DT0310\r\n公司经营：清洗油烟机，清洗服务，物业管理\r\n办公室法人 1人 经理1人常务理事1人 电工2人', '115.914108', '39.956812999999997', '115.914108', '39.956812999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3541', '北京中宇启航建设工程有限公司', '993', '张永成', '13601268887', '张静静', '17310552899', '2018年04月02日', '5000万元', '北京市', '北京市', '顺义区', null, '南法信镇府前街56号院1号楼7层2-711', '北京市', '北京市', '顺义区', '仁和地区办事处', '南法信镇府前街56号院1号楼7层2-711', '', '建筑防火', '有限责任公司（自然人独资）', '2018年04月02日', '2038年04月01日', '', '', '', '91110113MA01B68Y3A', '', '施工总承包、专业承包、劳务分包；工程项目管理；城市园林绿化施工；建设工程项目管理；物业管理；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本单位成立于2018年4月2日，位于北京市顺义区南法信镇府前街56号院1号楼7层2-711。注册资本5000万元，主要承接：施工总承包、专业承包、劳务分包；工程项目管理；城市园林绿化施工；建设工程项目管理；物业管理；工程勘察；工程设计。', '116.613573', '40.120319000000002', '116.613573', '40.120319000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3542', '北京富仕杰商用设备有限公司', '992', '简宏', '13501262258', '张经理', '13521658445', '2009年04月10日', '1508万元', '北京市', '北京市', '通州区', null, '北京市通州区宋庄镇草寺村委会南600米', '北京市', '北京市', '通州区', '梨园地区办事处', '北京市通州区九棵树西路90号英特商务园A座2层', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年04月10日', '2029年04月09日', '', '', '', '91110112687604125k', '', '销售机械设备、厨房用具、金属材料、不锈钢制品、五金交电（不含电动自行车）、通用设备、专用设备、消防器材、建筑材料、锅炉、水暖器材、家具、灯具、针纺织品、文化用品、日用杂货、计算机软件及辅助设备；餐饮管理；技术开发、技术服务（不含农业技术推广）、技术转让；维修厨房专用设备、空调制冷专用设备、家用电器；建筑物清洁服务；大气污染治理；水污染治理；普通货运（道路运输经营许可证有效期至2022年06月03日）；专业承包；劳务分包；施工总承包；生产厨房用具、环保专用设备（限在外埠从事生产经营活动）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京富仕杰商用设备有限公司成立于2009年，长期致立于饮食行业环保设备的开发、生产、销售，以环保工程项目技术开发、设备设计制造、成套工程安装为主营业务。在对已有技术、市场进行扩大延伸的同时将充分利用相关资源，建立互利的供应链战略联盟；通过引进技术人才及科研院所合作，吸收国际领先的环保技术，在饮食业环保产品和技术上具有明显的优势。公司向用户全方位提供包括设计、制造、设备成套、安装调试和运营服务等环保问题的完全解决方案，建成以饮食业用户提供全套环保设备、设施、及技术支持的环保企业。\r\n富仕杰将不断超越和完善，以研发、创新、安全、实用、高效为坚持不变的生产方略，以服务饮食行业的环保技术支持、技术创新为企业经营理念，本着学习和创新精神与业界人士一起共创健康美好的明天！\r\n \r\n企业愿景：造客户最满意的产品\r\n企业宗旨：造最优质的产品，做最诚信的服务\r\n企业精神： 团结拼搏、仁爱奉献；开拓创新、敢为天下', '116.678932', '39.989223000000003', '116.651207', '39.882809000000002', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3543', '北京兰玫环保科技有限责任公司', '990', '李岩海', '13910994688', '李岩海', '13910994688', '2011年11月21日', '200万元', '北京市', '北京市', '大兴区', null, '北京经济技术开发区经海三路109号院26号楼2层201', '北京市', '北京市', '丰台区', '花乡地区办事处', '怡海花园富润园7号1610室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2011年11月21日', '2031年11月20日', '', '', '', '911101015858168642', '', '技术开发、技术咨询、技术转让、技术服务；大气污染治理；环境保护监测；害虫防治服务；灭鼠及预防服务；清洁服务；家庭服务（不符合家政服务通用要求不得开展经营活动）；城市园林绿化服务；物业管理；水污染治理；施工总承包；专业承包；劳务分包；技术检测；销售仪器仪表、日用品、文具用品、电子产品、塑料制品、机械设备、电器设备、通讯设备、五金交电（不含电动自行车）、化工产品、橡胶制品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京兰玫环保科技有限责任公司成立于2011年11月、注册资金200万元，主要投资人曾任康佳集团任营销总经理。公司宗旨：“做良心工程、凭科技净化、用心净化每一寸空间”；公司目前主要针对酒店、饭店、企事业单位及家庭开展家电清洗、大型油烟机及管道清洗服务，投入资金数万元引进国内知名清洗品牌广州三淼环保的大型油烟机清洗设备、机器人智能清洗技术和设备，并成为三淼环保在北京区域的重点扶持客户；公司也派驻专人到广州学习和进修；熟练掌握了大型现代清洗设备的使用和环保事项及安全事项；同时公司积极掌握北京首都消防部门出台的关于大型油烟机清洗规定和管理要求、积极跟随消放协协会要求 做到安全清洗、环保清洗、规范达标！', '116.554035', '39.782837000000001', '116.301382', '39.831687000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3544', '北京玉鼎磊诺气体科技有限公司', '989', '侯玉柱', '13601204361', '赵兴', '18800154557', '2012年08月16日', '2100万元', '北京市', '北京市', '延庆区', null, '北京市延庆区八达岭经济技术开发区康西路1426号（中关村延庆园）', '北京市', '北京市', '延庆区', '八达岭镇', '北京市延庆区八达岭经济技术开发区康西路1426号（中关村延庆园）', '', '消防产品,消防安全评估,宣传教育培训,消防设施', '有限责任公司（法人独资）', '2012年08月16日', '2062年08月15日', '', '', '', '91110229051362693K', '', '技术开发、咨询；消防技术培训；租赁钢瓶；销售消防器材；消防灭火器体充装站/无缝、焊接钢瓶检测；维修钢瓶；生产气体灭火剂（危险化学品除外）；气瓶充装。（企业依法自主选择经营项目，开展经营活动；气瓶充装以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京玉鼎磊诺气体科技有限公司成立于2012年8月16日，注册资本2100万元，公司经营范围：技术开发、咨询；消防技术培训；钢瓶租赁；销售消防器材；消防灭火气体充装站；无缝、焊接钢瓶检测；维修钢瓶；生产气体灭火剂（危险化学品除外）；气瓶充装。\r\n公司具有北京市质量技术监督局颁发的：《气瓶充装许可证》、《特种设备检验检测机构核准证》；具有国家安监总局颁发的：《危险化学品经营许可证》。\r\n公司生产的CO2、IG－541灭火剂产品获得公安部消防产品合格评定中心颁发的：《中国国家强制性产品认证证书》（CCC）。', '115.932832', '40.363185000000001', '115.932832', '40.363185000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3545', '北京东方华谊清洗服务有限公司', '985', '曲桂彬', '13910519692', '马艳华', '13581529249', '2006年02月17日', '100万元', '北京市', '北京市', '昌平区', null, '北京市昌平区沙河镇南一村115号', '北京市', '北京市', '昌平区', '沙河地区办事处', '北京市昌平区沙河镇南一村115号', '', '烟道清洗', '有限责任公司（自然人独资）', '2006年02月17日', '2036年02月16日', '2018/9/26', '2019/9/25', '京消协（2018）证字306号', '91110114785517631B', '排油烟设施清洗机构', '保洁服务；设计、制作广告；技术服务、技术开发；投资管理；专业承包；维修厨房设备；害虫的防治服务；销售厨房设备、机械设备、建筑材料、消防器材、日用品、日用杂货；劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东方华谊清洗服务有限公司是一家专业设计 安装 改造 维修 清洗排油烟系统的大型服务型企业，主要针对宾馆 饭店 学校食堂 机关单位食堂等，公司有十几年的工作经验，为用户提供“最优质的解决方案”是企业的服务宗旨，公司拥有一批专业的技术人才队伍，以及专业的清洗设备，所有员工均经过系统的专业技术培训，拥有严格的技术和职业素养考核，高素质的专业团队确保高效 优质的完成各项工作，公司不断吸收和引进各类专业技术和管理人才，提高管理人员的素质，以一流的服务赢得客户的满意，我们的今天，全凭客户以往的支持和信任。我们坚信做到专业，就能做到最好。', '116.258442', '40.114750000000001', '116.258442', '40.114750000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3546', '北京润晟科技有限公司', '982', '宋欢', '17601605786', '宋欢', '17601605786', '2019年06月25日', '100万元', '北京市', '北京市', '丰台区', null, '北京市大兴区西红门镇西红门路12号22幢2号平房', '北京市', '北京市', '丰台区', '南苑地区办事处', '北京市大兴区西红门镇西红门路12号22幢2号平房', '', '消防产品,建筑防火,烟道清洗,消防设施,消防安全检查', '有限责任公司（自然人独资）', '2019年06月25日', '2049年06月24日', '', '', '', '91110115MA01L0BN3H', '', '科技开发、转让、咨询、服务；清洁服务；销售日用品、服装鞋帽、化工产品（不含危险化学品及一类易制毒化学品）；家政服务；建筑物清洁服务；保洁服务；水污染处理；专业承包；劳务分包；施工总承包；企业管理咨询；技术开发、推广、咨询、服务；租赁建筑机械设备；汽车租赁；机动车维修（限色漆使用水性漆且喷漆和喷枪清洗环节密闭并配套废气收集处理装置）；企业形象策划；婚庆服务；机动车公共停车场的经营管理；代理进出口；货物进出口；知识产权代理（专利除外）；餐饮服务；道路货物运输。（企业依法自主选择经营项目，开展经营活动；餐饮服务、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京润晟科技有限公司是一家承接清洁服务、销售消防器材的科技型公司，公司于2019年6月25日成立，现有专兼职员工12人，所有人员均持有相关的证书。', '116.36178099999999', '39.792974999999998', '116.36178099999999', '39.792974999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3547', '金舟消防工程（北京）股份有限公司', '979', '田桂兰', '85861500', '杨铮', '15011351278', '1995年04月28日', '2012万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区八里庄西里61号楼22层2207、2208、2209', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京经济技术开发区鸿坤云时代B3座12层', '', '建筑防火', '股份有限公司（非上市、自然人投资或控股）', '1995年04月28日', '长期', '2019/5/27', '2021/5/27', '912', '91110105101759286D', '', '承担自动报警及固定灭火系统工程施工及设计；消防设备维修；三级安全技术防范工程的设计、施工；物业管理；建设工程项目管理；软件开发；技术咨询、技术服务、技术推广、技术转让；销售机械设备、社会公共安全设备及器材、建材（不从事实体店铺经营）、五金交电（不从事实体店铺经营）、电子产品、计算机、软件及辅助设备、工艺品、文具用品、日用品；承办展览展示活动；组织文化艺术交流活动（不含演出）；工程设计；互联网信息服务。（企业依法自主选择经营项目，开展经营活动；互联网信息服务、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '金舟消防工程（北京）股份有限公司创建于一九九五年，注册资金为2012万元，经营范围包括自动报警及固定灭火系统的工程设计和施工；消防设备维修；安全技术防范工程的设计和施工等。公司是经北京市工商行政管理局注册、北京市消防局、国家建设部批准的消防设施工程专业承包壹级和消防设施专项工程设计甲级资质，机电安装总承包及专业承包叁级资质，电子与智能化专业承包贰级资质，消防维护保养一级资质。为国家级高新技术企业，新三板上市公司。', '116.49124', '39.912373000000002', '116.575396', '39.789614', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3548', '北京华商远大电力建设有限公司', '976', '彭勇', '63125325', '陈晓虹', '15801567953', '2002年02月20日', '8900万元', '北京市', '北京市', '东城区', null, '前门西大街41号14号楼101室', '北京市', '北京市', '丰台区', '花乡地区办事处', '科兴路3号', '', '电气防火,建筑防火,灭火救援', '有限责任公司（法人独资）', '2002年02月20日', '2022年02月19日', '', '', '', '911101027355940142', '', '施工总承包、专业承包；技术开发、技术推广、技术服务、工程技术培训、技术咨询；电器设备维修；合同能源管理；产品设计；机械设备租赁；销售机械设备、电子产品、化工产品（不含一类易制毒化学品及危险品）、建筑材料、金属材料、木材、电线电缆、电气设备、五金交电、钢材、铅材、铜材、消防器材、安全防范技术产品；电力供应；工程设计。（企业依法自主选择经营项目，开展经营活动；电力供应、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华商远大电力建设有限公司成立于2010年9月，2015年11月结合经营模式转型对原机构进行了调整。通过持续优化，目前公司内设本部设置8个经营管理部门、5个业务支撑机构，下辖4家分公司；公司拥有电力工程施工总承包二级资质、消防设施工程专业承包二级资质、输变电工程专业承包二级资质、市政公用工程施工总承包二级资质、建筑机电安装工程专业承包三级资质、二级承装（修）、三级承试类电力设施许可证及电力行业（变电工程、送电工程）专业丙级设计资质，于2017年初率先取得售电公司资格注册，并通过职业健康安全管理体系、环境管理体系、质量管理体系认证，现已成为具备设计、施工、物资一体化建设管理和实施能力的经营管理型单位。公司主要承接北京地区消防工程建设、电网设计建设、客户服务、运维业务和新能源五个市场的工程项目，拥有丰富的施工管理经验。', '116.390528', '39.900627999999998', '116.294881', '39.837361999999999', '', null, null, null, null);
