INSERT INTO `t_fc_company` VALUES ('3550', '北京贺宇兴程科技发展有限公司', '974', '方华程', '18911983356', '方华程', '18911983356', '2019年06月17日', '200万元', '北京市', '北京市', '丰台区', null, '北京市丰台区黄土岗高场村2号2-A013室', '北京市', '北京市', '朝阳区', '黑庄户地区办事处', '北京市朝阳区黑庄户乡大鲁店二队74号4号', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年06月17日', '2049年06月16日', '', '', '', '91110106MA01KTQ875', '', '技术推广、技术服务、技术咨询、技术开发、技术转让；清洁服务；机械设备租赁；室内装饰工程设计；物业管理；销售日用品、建筑材料、五金交电（不含电动自行车）、服装、化工产品（不含化学危险品）、金属材料、工艺品、机械设备、电子产品、厨房设备、文具用品、计算机、软硬件及辅助设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是一家经过正式注册（注册资金：200万），拥有合法经营执照的正规企业。专业为宾馆饭店机关单位食堂提供厨房大型排油烟系统清洗和设备维护服务！公司拥有严格的管理制度以及施工质量标准；依靠先进的设备、精湛的技术为客户提供全方位服务！。清洗维修技师都具备多年清洗、维修、安装经验，特别是在清洗过程中对厨房的电源保护的非常到位；并不断吸收新的技术和先进的检测设备来满足广大客户的需求！ 公司经营范围：技术推广，技术服务，技术咨询，技术开发，技术转让。排油烟系统清洗维护；排烟风机清洗维；厨房设备及排烟系统设计生产安装一条龙服务！', '116.32823500000001', '39.833593', '116.59083800000001', '39.834968000000003', '注册地址坐标位置不准确', null, null, null, null);
