INSERT INTO `t_fc_company` VALUES ('3556', '北京富甲通达科技发展有限公司', '968', '潘海英', '18210318711', '潘海英', '18210318711', '2019年02月22日', '500万元', '北京市', '北京市', '大兴区', null, '天华街9号院14号楼10层1009', '北京市', '北京市', '大兴区', '北臧村镇', '天华街9号院14号楼10层1009', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年02月22日', '2039年02月21日', '', '', '', '91110115MA01HBW985', '', '技术服务、咨询、开发；劳务服务；汽车租赁(不含九坐以上客车)；物业管理；清洁服务；园林绿化工程；园林绿化设计；园林绿化管理；销售文具用品、食用农产品、电子产品、日用品、服装、鞋帽、箱包；普通货运（道路运输经营许可证有效期至2023年3月13日）。（企业依法自主选择经营项目，开展经营活动；普通货运以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京富甲通达科技发展有限公司，成立于2018年1月，是一家厨房保洁，厨房安装、维修及管道清洗的服务性公司，公司采用军事化的严格管理制度，严格高效诚信的为各大商场、酒店、企事业单位和学校等提供优质的清洁服务。', '116.313644', '39.684862000000003', '116.313644', '39.684862000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3557', '北京创森泓润环保科技有限公司', '967', '许东辉', '13161558000', '许东辉', '13161558000', '2016年09月13日', '70万元', '北京市', '北京市', '大兴区', null, '北京市大兴区华佗路9号院3号楼4层437', '北京市', '北京市', '大兴区', '观音寺街道', '北京市大兴区黄村富强路4号', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年09月13日', '2036年09月12日', '', '', '', '91110115MA00893UX4', '', '技术咨询、服务、推广、转让；专业承包；劳务分包；家居装饰；清洁服务；家政服务；承办展览展示；销售建筑材料、装饰材料、金属材料、钢材、五金产品（不含电动自行车）、日用品、家庭用品、家用电器；机械设备、空调制冷设备、厨房设备、电气设备、食用农产品、安全技术防范产品；物业管理；机动车公共停车场的经营与管理；施工总承包；工程勘察；工程设计；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品、工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京创森泓润环保科技有限公司位于北京市大兴区黄村富强路4号，是经国家批准注册及研发.油烟管道清洗.中央空调系统清洗.厨房自动灭火装置安装维修保养为一体的高新综合企业。是北京消防协会会员。\r\n我公司具有油烟管道专业清洗工50余人，经验丰富，公司还定期聘请消协工程建筑方面清洗专家来公司进行技术讲座，对工人进行定期培训，持证上岗。充分得到了消防，环保等部门的肯定。   \r\n经北京市消防科学研究所监制，我公司负责安装维护的厨房自动灭火装置是根据欧洲发达国家标准设计，制造，按照GA498-2012厨房设备灭火装置国标生产，通过IS9001-2008质量管理体系认证，并在中国人民保险公司投保，最高赔偿100万元。充分保证了客户厨房着火的后顾之忧。\r\n    公司成立以来始终重视高质量的服务，树立了“创森泓润”优秀品牌。凭借行业最前沿的技术，实惠的价格以及完善的售后服务体系，赢得了广大客户的信赖和推崇。公司一贯信奉“以诚求城、精益求精”追求品质超越平凡的企业宗旨，“诚信为本 专业服务”的经营理念，全力为客户提供最专业保洁清洗队伍和厨房消防安全保障。', '116.319574', '39.675105000000002', '116.34215500000001', '39.737200999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3558', '北京京华屈佳清洁服务有限公司', '966', '彭桂华', '13693261980', '屈兴红', '13910941154', '2011年04月29日', '200万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区桥梓镇平义分村532号', '北京市', '北京市', '怀柔区', '桥梓镇', '北京市怀柔区桥梓镇平义分村532号', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年04月29日', '2031年04月28日', '2018/11/26', '2019/11/25', '京消协（2018）证字409号', '91110105573160132M', '', '清洁服务、化粪池清掏；销售清洁用品、五金交电（不含电动自行车）；技术开发、技术转让、技术推广、技术服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。', '北京京华屈佳清洁服务有限公司是一家年轻、充满朝气、具有法人资格的专业性保洁公司。公司主要承接各机关单位、饭店、餐厅、宾馆、酒店、写字楼等清洗保洁服务，另公司销售检测维修灭火等消防安全服务。本公司作为北京消防协会会员单位一惯遵循客户至上、至诚至信园服务精神，坚持高定位、高质量、高效率德服务标准。', '116.528519', '40.270256000000003', '116.528519', '40.270256000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3559', '北京东方勤达保洁服务有限公司', '965', '郝士军', '13381215135', '贾青枝', '18201505815', '2015年05月27日', '200万元', '北京市', '北京市', '朝阳区', null, '小黄庄一区8-10号', '北京市', '北京市', '朝阳区', '王四营地区办事处', '化工路官悦欣园22号楼', '', '烟道清洗,消防设施', '有限责任公司（自然人独资）', '2015年05月27日', '2035年05月26日', '', '', '', '91110101344329292J', '', '保洁服务；企业管理咨询；会议服务；产品设计；计算机技术培训；承办展览展示；组织文化艺术交流；维修家用电器；建筑物清洗服务；城市园林绿化；道路货运代理；机动车公共停车场管理；家居装饰；打字复印；图文设计；技术开发；技术服务；害虫防治服务；灭鼠预防服务零售五金交电、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2015年5月27日，经营业务主要以居民住宅小区、办公写字楼、高档公寓楼、酒店宾馆、旅游景区等日常清洁服务为主，同时承揽大型保洁开荒工程、绿化养护工程、停车场管理、消防中控室值守、地下管线清洗、石材养护、地毯清洗及社区家庭服务。\r\n      公司自成立以来，凭借着优质专业高效的服务，赢得社会各界的广泛赞誉，先后承接了芍药居北京军区总院家属楼、民安危改住宅小区、交东危改住宅小区、小黄庄住宅小区、国家林产工业规划设计院、华世隆国际公寓、农商银行办公楼、王四营官悦欣园住宅小区等日常清洁服务管理项目。\r\n      2016年获得北京清洁行业协会颁发的企业三级资质，2018年通过了ISO9001质量管理体系认证。\r\n      目前拥有专业管理人员20人，清洁管理师4人、石材护理管理师1人、建筑消防管理员20人，清洁员工150人，大型清洁设备、驾驶式扫地车及洗地车、多功能清洗机、石材翻新养护机、地毯清洗机、高温高压蒸汽清洗机等。\r\n     公司一直秉承“安区第一、服务至上、以人为本、创建和谐”的管理理念，遵循“安全、便捷、专业、高效”的服务宗旨为业主提供优质服务。', '116.408732', '39.962142', '116.49985', '39.879860000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3560', '北京厨宝商用厨具有限公司', '963', '杜坤', '13301287676', '杜爱云', '18600848750', '2014年05月13日', '1010万元', '北京市', '北京市', '昌平区', null, '北京市昌平区城北街道西环路32-4一层', '北京市', '北京市', '昌平区', '城北街道', '北京市昌平区城北街道西环路32-4一层', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年05月13日', '2064年05月12日', '', '', '', '91110114306324454G', '', '销售厨房用品、机械设备、不锈钢制品、空调制冷设备及配件、家用电器、日用品、消防器材、电子产品、文化用品、仪器仪表、五金交电、建筑材料、计算机软硬件及外围设备；技术推广服务；维修机械设备；清洁服务；图文设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '司简介\r\n    北京厨宝商用厨具有限公司是一家集销售、安装、设备维修、售后服务及厨房设计改造为一体的专业不锈钢厨房设备公司。专为企事业单位、酒店、学校、食堂等厨房提供设计，承接及安装不锈钢厨房设备、厨房通风系统等工程。并以高水平的专业设计，高质量的产品，完善的售后服务，深得广大用户的赞誉。企业通过ISO9001：2008质量管理体系认证，ISO14001：2004环境管理体系认证，OHSAS18001：2007职业健康安全管理体系认证。主要经营\r\n    炊事机械类设备、不锈钢厨具、制冷设备、排油烟设备、调理设备、商用厨房配套工程。\r\n经营项目\r\n    不锈钢厨房设备、厨房制冷设备、排油烟系统设备、西餐设备、厨房改造等商用设备及配套工程的设计、生产、销售、安装、售后服务及排油烟系统设备清洗保洁等。\r\n应用行业\r\n    主要适用于酒店、酒楼、宾馆、饭店、餐厅等餐饮场所以及各大机关单位、学校、工厂食堂的大型厨房设备。\r\n企业宗旨\r\n    “节能，环保，安全”是厨宝公司的基本要求，优质的产品、合理的价格、良好的信誉、完善', '116.22977299999999', '40.223751', '116.22977299999999', '40.223751', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3561', '北京正彦环绿环保科技有限公司', '960', '王诤', '13910925161', '王诤', '13910925161', '2017年08月23日', '1250万元', '北京市', '北京市', '石景山区', null, '北京市石景山区实兴大街30号院3号楼2层A-0131房间', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区西四环南路辅路101号创新大厦6033', '', '消防产品,消防信息化,烟道清洗', '有限责任公司（自然人投资或控股）', '2017年08月23日', '2047年08月22日', '', '', '', '91110107MA00HDEB4L', '', '技术开发、技术服务、技术咨询、技术转让；销售家用电器、消防器材、安全防范技术产品、日用品、厨房用品、机械电器设备；水污染治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京正彦环绿环保科技有限公司，通过招商引资入户北京中关村科技园石景山园区，并于2017年8月23日成立，注册资金1250万元。公司是目前拥有各类大、中型专业生产设备40台套，职工达100多人，专业生产、工程等技术人员30多人。并且拥有一批具有丰富经验和开拓精神的高级专业技术与管理人才，其中包括了油烟净化器研发者及多年从事油烟净化器的专家，具有雄厚的技术实力，同时公司拥有先进的生产设备和系统的科学管理，相继通过了ISO14001环境管理体系认证、ISO9001质量管理体系认证、OHSAS18001职业健康安全管理体系认证、欧盟CE认证等，为公司进一步的发展奠定了坚实的基础。市场试点成功以来一直并受到了金融市场的追捧，目前拥有有了强大的资金链库，并快速在全国各大、中城市展开服务。\r\n     公司还是以市场为导向，以质量为基础，以优质服务为宗旨，以高科技产品为主要发展目标，充分发挥科技、人才和现代化的企业理的优势，打造专业化、国际化发展的服务队伍，以发展民族环保事业为己任。\r\n“真无油”免拆洗环保油烟净化一体机技术和新型便捷餐饮消防安全一体化技术已经形成产品并在京津冀、长三角、山东、安徽等多个', '116.193454', '39.939404000000003', '116.285669', '39.839585999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3562', '北京丽景仁亮环保科技有限公司', '959', '张景仁', '13840011288', '庞微', '13701234847', '2018年05月29日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区红庙北里4号楼1层1-4', '北京市', '北京市', '朝阳区', '六里屯街道', '北京市朝阳区红庙北里4号楼1层1-4', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年05月29日', '长期', '', '', '', '91110105MA01CGMM7L', '', '技术推广服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2018年05月29日，技术推广服务', '116.48183299999999', '39.921053000000001', '116.48183299999999', '39.921053000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3563', '北京玉龙易阳科技有限公司', '957', '许玉龙', '17631141339', '许玉龙', '17631141339', '2014年07月29日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区平谷镇园田小区南路88号院', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡西直河村276号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年07月29日', '长期', '', '', '', '911101173066397126', '', '技术开发、技术转让、技术服务、技术推广、技术咨询；建筑物清洁服务；保洁服务；家庭劳务服务；家居装饰及设计；承办展览展示；会议服务；销售机械设备、文化用品、日用品、五金交电（不含电动自行车）、建筑材料、金属材料、计算机软硬件及外围设备、家用电器、化工产品、体育用品、厨卫用具、花卉、苗木；物业管理；施工总承包、专业承包；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京玉龙易阳科技有限公司成立于2014年7月，是一家以技术服务，专业承包、消防烟道消洗等一条龙服务公司，随着社会的发展，消防安全，食品安全，消洁卫生越来越被大家接受和需要，并已进入了千万食堂，餐厅，酒店等等大中小型饭馆共同成长中，我们公司致力于给客户千万个同胞创造一个安全生产，更加清洁更加亮丽的生活工作环境而努力!为每个经营饭店食堂酒店的老板提供一个安全生产的环境，努力提升人们的现化生活质量而努力!\r\n\r\n    公司成立以来，致力于长期合作系，提高服务质量，提更高标准的清洁服务，以“消防安全为已任，顾客至上，信警第一，诚信为本，高效求实，稳步发展的经管理念为宗旨，高标准高质量提供服务，维护客户利益，形象是我们始终不渝的目标。\r\n\r\n    公司服务员工.均通过消防安装，维护，烟道设备清洗，高空作业等方面的专业培训，同时还要进行从业道德，服务质量，安全第一，等意识方面的培训，通过考核后方可上岗。', '117.123256', '40.133741999999998', '116.530371', '39.844318000000001', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3564', '北京睿图科技有限公司', '956', '刘宝兰', '', '徐宁涛', '18600051885', '2015年01月07日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区化工路59号院4号楼5层', '北京市', '北京市', '朝阳区', '垡头街道', '北京市朝阳区化工路59号院4号楼5层', '', '消防信息化', '有限责任公司（自然人投资或控股）', '2015年01月07日', '2045年01月06日', '', '', '', '91110117327277458C', '', '技术推广服务；软件开发；代理、发布广告；产品设计；电脑图文设计、制作；企业策划；组织文化艺术交流活动（不含演出）；会议服务；承办展览展示活动；计算机系统集成；销售计算机、软件及辅助设备、电子产品、五金交电、机械设备、日用品、花卉、摄影器材、社会公共安全设备及器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京睿图有限公司是一家致力于原创科技研发，拥有物联网、电子引信、cop、光电系统等多项知识产权，为行业用户提供适应行业特点的综合物联网解决方案的企业。\r\n公司的业务是为交通、军队、金融、港口、航空、电力等行业用户提供满足行业需求的解决方案，为客户在行业物联网应用、消防安防应急联动、远距离光电探测提供量身定做的解决方案。\r\n公司有一支诚实敬业、知识结构新、专业的技术研发、营销团队及军队、公安、消防、中科院、航天等顶级专家顾问团队，主要科研创新成员来自国家973项目、部队研究所和电信企业，已经完成多项军队863课题。公司的团队能够深层次的了解客户实际需求，与客户进行全方位的沟通；能够根据用户的需求提供系统、完整、经济的技术解决方案。\r\n北京睿图科技有限公司将以丰富的行业经验和先进的科技理念、以市场为向导、以技术为后盾、以服务为保障，力争成为中国消防、安防行业解决方案的领导者。', '116.529579', '39.850959000000003', '116.529579', '39.850959000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3565', '北京市春益通保洁服务有限责任公司', '955', '张士春', '13901030738', '任俊武', '13693573821', '2001年03月12日', '500万元', '北京市', '北京市', '通州区', null, '北京市通州区宋庄镇内军庄村355号', '北京市', '北京市', '通州区', '宋庄镇', '北京市通州区宋庄镇内军庄村355号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2001年03月12日', '2021年03月11日', '', '', '', '91110112801744165A', '', '保洁服务；劳务服务；建筑物清洁服务；市场营销策划；会议服务；图文设计、制作；经济贸易咨询；管道疏通；租赁环保专用设备；水污染治理；城市生活垃圾清扫、收集；道路货物运输。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京市春益通保洁服务有限责任公司是一家从事多项清洁服务，集管理、养护、服务于一体的专业清洁服务公司。公司采用标准化，制度化，规范化的科学管理方式，聘请清洁管理、养护方面的专业人才，并不断引进国内外先进的专业机械设备，在简单清洁被动服务的基础上，积极开拓，努力提高，使一般的“搞卫生”变成现代化的以维护保养为主，清洁服务并举的服务项目，在提高大厦养护保洁能力的同时，提高劳动效率，保证了服务质量。 \r\n    公司秉承“诚信、服务、责任、效率”的宗旨．贯彻“高标准，高素质，高效率”的企业精神。竭诚希望能同您建立起长期密切的合作关系．共同创建一个清洁、舒适、健康的工作环境和生活环境。', '116.698759', '40.006357000000001', '116.698759', '40.006357000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3566', '北京华夏裕德建筑工程有限公司', '954', '张书红', '13263446956', '王伟德', '17718425019', '2016年02月24日', '200万元', '北京市', '北京市', '怀柔区', null, '怀柔区怀北镇怀北路308号', '北京市', '北京市', '大兴区', '青云店镇', '魏善庄镇伊庄村', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年02月24日', '2046年02月23日', '2019/6/20', '2020/6/19', '京消协（2019）证字381号', '91110116MA003Q6R3N', '', '施工总承包、专业承包、劳务分包；工程勘察设计；建设工程项目管理；租赁建筑工程机械、建筑工程设备；房地产开发；物业管理；销售五金交电、机械设备、电子产品；建筑物清洁服务；家庭劳务服务；城市园林绿化；承办展览展示。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华夏裕德建筑工程有限公司成立于2016年\r\n从事北京地区排油烟设施清洗、保洁服务。', '116.68822299999999', '40.389386000000002', '116.460396', '39.677363999999997', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3567', '北京华淼环保工程有限公司', '953', '汪亚硕', '13910803497', '汪亚硕', '13910803497', '2005年01月28日', '100万元', '北京市', '北京市', '密云区', null, '北京市顺义区牛栏山镇张家庄村南边路13号', '北京市', '北京市', '密云区', '巨各庄镇', '北京市顺义区牛栏山镇张家庄村南边路13号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年08月22日', '长期', '', '', '', '92110113L264150718', '', '环境治理；专业承包；技术开发、技术转让、技术咨询；建筑工程机械与设备租赁；接受委托提供劳务服务（不含排队服务、对外劳务合作）；城市园林绿化施工；家居装饰；清洁服务（不含餐具消毒）；家庭服务；棋牌服务；销售建筑材料（不含砂及砂石制品）、装饰材料、化工产品（不含危险化学品及一类易制毒化学品）、五金产品（不含电动自行车）、日用品、文化产品、厨具、通讯器材、体育用品（不含弩）、机械设备、针纺织品、家用电器、金属制品；物业管理；普通货运；城市生活垃圾运输。(企业依法自主选择经营项目，开展经营活动；城市生活垃圾运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京华淼环保工程有限公司成立于2005年1月28日，我公司是一家以环保设备销售、环保技术推广咨询为主，同时涉足厨房设备清洁服务和厨具销售等多产业的综合性科技服务企业。 我公司自成立以来，先后引进国内先进的环保设备、环保材料及清洁设备，公司秉承着“质量第一”的服务于北京市大中性企业，政府行政单位，为客户提供优质的服务。', '116.986576', '40.344123000000003', '116.986576', '40.344123000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3568', '北京丰河佳业保洁服务有限公司', '952', '夏丰收', '13521234603', '夏彪', '15010439564', '2014年07月14日', '100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区信息路甲28号B座（二层）02C室', '北京市', '北京市', '海淀区', '马连洼街道', '北京市海淀区马连洼北路151号药用植物所院内', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年07月14日', '2034年07月13日', '', '', '', '91110108306473265M', '', '建筑物清洁服务；技术服务；销售电子产品、日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京丰河佳业保洁服务有限公司是保洁优秀企业。服务项目：烟道清洗，家居保洁，地板打蜡养护，地毯清洗，石材养护，真皮布艺沙发清洗，办公座椅清洗，高空外墙清洗，大型商场、写字楼的开荒和保洁托管。我们的宗旨是：服务北京，立足北京，发展北京保洁行业，还北京一个蓝天。 公司的服务理念是：健康、环保、安全、专业。', '116.311919', '40.034976999999998', '116.27510599999999', '40.033467999999999', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3569', '北京伟达嘉业保洁服务有限公司', '950', '孙如伟', '13521599904', '孙如伟', '13521599904', '2014年07月14日', '100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区信息路甲28号B座（二层）02C室-441号', '北京市', '北京市', '海淀区', '上地街道', '北京市海淀区信息路甲28号B座（二层）02C室-441号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年07月14日', '2034年07月13日', '', '', '', '911101083064732303', '', '建筑物清洁服务；技术服务；销售电子产品、日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京伟达嘉业保洁服务有限公司成立于2014年，主要从事北京地区大型食堂和单位饭店厨房排油烟设施清洗，保洁等。', '116.311919', '40.034976999999998', '116.311919', '40.034976999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3570', '华夏竣诚（北京）智能建筑工程有限公司', '949', '孙巍', '13901185359', '宋荃', '13811626347', '2005年05月23日', '3000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区瀚河园113号-1层01', '北京市', '北京市', '西城区', '广安门内街道', '北京市西城区广安门内广益大厦B508', '', '消防设施', '有限责任公司（自然人投资或控股）', '2005年05月23日', '2025年05月22日', '', '', '', '9111010877548117XA', '', '专业承包；工程勘察；工程设计；技术服务、技术咨询；物业管理。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '华夏竣诚（北京）智能建筑工程有限公司成立于2005年。公司以工程施工为主体，通过开拓市场、强化内部管理、资源的有效整合，经过不断的努力已经发展成为具有消防设施工程专业承包贰级资质、建筑智能化专业承包贰级资质的专业化、科学化建筑工程公司。面对激烈竞争的市场挑战，敢于拼搏，善于创新，以崭新的理念、科学的管理和优质的服务，积极培育和提高企业的核心竞争力，在国内消防工程市场中奠定了可靠基础，并在市场中树立了良好的信誉和企业形象。\r\n公司十分注重人才的开发和培养，始终把人力资源作为公司的第一资源。公司实行总经理领导下的项目经理负责制，从工程项目的设计到施工提供全过程的技术支持与服务，为市场开拓和工程实施提供了有力保障。\r\n在近几年的经营中，我公司恪守诚信、稳健、务实的理念，本着“信誉第一”,“质量第一”,“顾客至上”的宗旨，不断完善企业管理架构，吸引优秀人才，拓展业务领域。目前发展以经营施工、销售报警设备为主体，在此基础上公司又增加了维修保养、消防器材销售和维修，以及检测等业务。 \r\n公司将一如既往的坚持“以质量求生存、以信誉求发展”的经营理念，严格执行完善的质量保证体系，继续谱写公司新的篇章。', '116.23437199999999', '39.975844000000002', '116.3553', '39.890681999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3571', '北京豪顺达不锈钢厨具制造有限公司', '948', '郑国春', '13901232687', '陈效芸', '18810591629', '2003年04月28日', '500万元', '北京市', '北京市', '海淀区', null, '北京市海定区清河安宁庄东路18号2号办公楼2155室', '北京市', '北京市', '顺义区', '高丽营镇', '北京市顺义区高丽营镇西王路村中路9号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2003年04月28日', '2023年04月27日', '', '', '', '9111010875014947XB', '', '生产厨具、排风设备（限分支机构经营）；室内装饰工程设计。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京豪顺达不锈钢厨具制造有限公司成立于2003年，是从事不锈钢厨房设备及通风排烟设备的专业企业之一。\r\n公司拥有一批专业技术人才和经验丰富的施工队伍，主要从事不锈钢厨房设备、通风排烟及油烟净化设备的技术开发、设计、制造、调试、工程总承包等业务。\r\n公司拥有卓越的员工队伍，优质的产品与服务，完善的软硬件设施。拥有先进的加工生产设备，具备加工生产多种通风排烟设备及油烟净化设备的能力。工程设计、研发部主要负责新技术的开发与引进，设计研发部门研发的产品，已取得多项技术专利。撞击流式油烟净化设备于2008年通过来中国环境产业保护协会的认证，获得《环境保护产品认证证书》。\r\n多年来公司遵循“以人为本、服务社会、技术高新、追求卓越”的企业宗旨，在通风排烟及油烟净化处理领域取得了一定的成绩，实现了自身价值。\r\n北京豪顺达不锈钢厨具制造有限公司将以“创一流技术、建一流队伍、干一流工程，造福子孙后代”的经营理念，为拥有“蓝天、碧水”而奉献我们的一切。', '116.333018', '40.041342999999998', '116.498746', '40.150618000000001', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3572', '东方神韵中坤环境服务（北京）有限公司', '947', '刘永国', '69015195', '曾宪利', '69015195', '2014年05月05日', '300万元', '北京市', '北京市', '密云区', null, '北京市密云区溪翁庄镇七孔桥西', '北京市', '北京市', '密云区', '溪翁庄镇', '北京市密云区溪翁庄镇七孔桥西', '', '消防产品', '有限责任公司（自然人独资）', '2014年05月05日', '长期', '', '', '', '9111022809919289XW', '', '建筑物清洁服务；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；害虫的防治服务；机器和办公设备的清洗；火车、汽车、飞机、船舶的专业清洗和消毒；城市污水排放、疏通、清淤；城市道路养护；装卸服务；城市地下公共设施的管理；城市公用设施的综合管理；城外旷野公用设施的管理；销售日用杂货、洗涤用品、卫生用品、卫生洁具；零售五金交电；公共停车场管理服务；居家养老服务；社会看护与帮助服务；专业承包；物业管理；城市园林绿化；普通货运；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '东方神韵中坤环境服务（北京）有限公司是东方神韵公司的下属企业，成立于2014年，法定代表人：刘永国，注册资本：300万元，主要从事城市环境卫生管理、城市道路巡查。\r\n公司目前的经营主要分为三个板块：一是公司现场作业管理体系；二是公司对外业务拓展板块，即市场拓展体系；三是公司内部后勤管理板块，及内部保障体系。三者鼎立配合，确保日常经营管理活动的有效展开，为公司持续、稳定和健康发展奠定了坚实的基础公司拥有一支专业、团结协作、锐意进取的管理团队和技术过硬、作风优良、经验丰富的员工队伍。\r\n本公司内部现有正式员工80余人，劳务用工及代管员工650人，囊括了经济管理、人力资源、环境工程、园林绿化等方面多种专业人才。公司管理人员30人，海外留学生1人，本科毕业生15人，专科毕业生9人，具备高级专业技术职称1人，其他职业技能、技术职称人员6人。', '116.83193900000001', '40.478146000000002', '116.83193900000001', '40.478146000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3573', '北京恒辉东方环保科技有限公司', '946', '陈莉', '13439741237', '陈莉', '13439741237', '2009年08月24日', '1000万元', '北京市', '北京市', '顺义区', null, '顺义区龙湾屯镇府前街13号北2号楼140', '北京市', '北京市', '顺义区', '龙湾屯镇', '顺义区龙湾屯镇府前街13号北2号楼140', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年08月24日', '2029年08月23日', '', '', '', '91110105693233842Y', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；销售厨具、日用品、电子产品、化工产品（不含危险化学品及一类易制毒化学品）、工艺品（不含文物、象牙及其制品）、建筑材料（不含砂石及其砂石制品）、五金交电（不含电动自行车）、Ⅰ类医疗器械、家具（不得从事实体店铺经营）、化妆品、体育用品（不含弩）、装饰材料、汽车配件、煤炭（不在北京地区开展实物煤的交易、储运活动）、金属材料（不含电石、铁合金）、机械设备、家用电器；清洁服务；日用电器修理（限符合家用电子电器维修业服务经营规范）；维修制冷设备；会议及展览服务；租赁建筑工程机械及设备；企业策划；组织文化艺术交流活动（不含演出）；票务代理；货运代理；餐饮管理；经济贸易咨询；货物进出口；代理进出口；技术进出口；接受委托提供劳务服务（不含排队、对外劳务合作）；害虫防治服务；环境治理；家居装饰；城市园林绿化施工；仓储服务（不含危险化学品、粮油）；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京恒辉东方环保科技有限公司是集商用厨房油烟排烟系统清洗、改造、安装；制冷空调设备销售、安装、维修；中央空调通风系统清洗；中央空调水处理；中央空调系统调试；商用厨房设备销售、安装、维修；物业楼宇开荒保洁、日常保洁；石材保养、翻新、养护；环境治理于一体的综合集成商，公司已具备了对高级写字楼、宾馆、大厦、酒店、小区、工厂等楼宇进行全面服务的能力。 \r\n     恒辉东方始终视服务质量为企业的生命，不断的满足客户需求，追求品质卓越。公司一贯遵循“客户至上、至诚致信、诚己为人、以心换心、诚人达己、人兴己兴。”的服务精神，坚持高定位、高质量、高效率的三高服务标准。在我公司日常管理工作中，公司充分发挥和挖掘内部潜力，培养了一支经验丰富，技术规范，扎实，素质优秀，人员稳定的专业队伍。此外公司还拥有各类专业设备、工具以及各种环保剂，建立起科学的管理体系和控制体系，形成了独具特色，高效，现代化的服务管理体系。\r\n     恒辉东方将遵循用真诚感动客户、用真诚凝聚员工\"的企业精神，\"创新、高效、共赢\"的价值理念，期待与社会各界的真诚合作。\"', '116.85764399999999', '40.232380999999997', '116.85764399999999', '40.232380999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3574', '北京宇龙建筑工程有限公司', '943', '程青', '13910987613', '程青', '13910987613', '2013年12月20日', '3000万元', '北京市', '北京市', '昌平区', null, '北京市昌平区东小口镇天通中苑二区40号楼12层1208内101室', '北京市', '北京市', '昌平区', '天通苑北街道', '北京市昌平区东小口镇天通中苑二区40号楼12层1208内101室', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年12月20日', '2063年12月19日', '', '', '', '911101080854834853', '', '劳务分包、专业承包、施工总承包；城市园林绿化服务；投资咨询；经济贸易咨询（不含中介服务）；机械设备租赁（不含汽车租赁）；销售五金交电（不含电动自行车）、建筑材料、机械设备；技术咨询；家庭劳务服务；厨房设备（抽油烟机等）的清洗；工程设计；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '从事清洗服务及劳务分包，专业承包，施工总承包。', '116.415969', '40.069642000000002', '116.415969', '40.069642000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3575', '北京星聚国际企业管理有限公司', '942', '张琪明', '15699916806', '张琪明', '15699916806', '2016年04月21日', '200万元', '北京市', '北京市', '通州区', null, '北京市通州区梨园镇刘老公庄东侧（北京英特塑料机械总厂）81幢8037号', '北京市', '北京市', '通州区', '梨园地区办事处', '北京市通州区梨园镇刘老公庄东侧（北京英特塑料机械总厂）81幢8037号', '', '宣传教育培训,消防信息化', '有限责任公司（自然人投资或控股）', '2016年04月21日', '长期', '', '', '', '91110112MA0050LM8R', '', '企业管理；产品设计；计算机技术培训（不得面向全国招生）；计算机技术开发；技术推广；技术转让；技术咨询；消防技术服务；会议服务；承办展览展示；礼仪服务；组织文化艺术交流活动；经济贸易咨询；零售体育用品（不含弩）、消防器材、电子产品、机械设备；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京星聚国际企业管理有限公司立足于首都城市副中心，与全国多所知名院校合作，专注于提供企业所需要的技术、产品、培训、人才及营销方案，目前服务企业超过100家，服务人数超过3000人，星聚国际与客户共同成长，共赢未来。', '116.651349', '39.883830000000003', '116.651349', '39.883830000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3576', '北京宇通远大科技有限责任公司', '941', '周肖逸', '13011133833', '周肖逸', '13011133833', '2019年06月11日', '200万元', '北京市', '北京市', '顺义区', null, '北京市顺义区牛栏山镇府前街9号-159', '北京市', '北京市', '顺义区', '牛栏山地区办事处', '北京市顺义区牛栏山镇府前街9号-159', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年06月11日', '2049年06月10日', '', '', '', '91110113MA01KNPA03', '', '技术开发、技术推广、技术转让、技术咨询；建设工程项目管理；物业管理；专业承包；劳务分包；清洁服务；软件开发；城市园林绿化施工；大气污染治理；水污染治理；委托加工；销售消防器材、安全技术防范产品、机械设备、专用设备、五金交电（不含电动自行车）、金属制品、珠宝首饰（不含进口黄金）、办公用品、体育用品（不含弩）、化工产品（不含危险化学品及一类易制毒化学品）、制冷设备、厨房用具、家用电器；工程设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京宇通远大科技有限责任公司成立于2019年6月11日，注册资金200万，是经北京市工商行政管理局正式批准成立的专业清洁服务公司。我公司以先进的清洗设备和优质的服务成为同行业中领跑企业。拥有一批实践经验丰富，具有高度责任感的员工，以朝气蓬勃的精神、专业的服务、严谨的管理为企业的经营理念，本着客户至上的原则，“以质量求生存，以信誉求发展，在发展中创新，在竞争中超越”为经营宗旨，为各企事业单位、宾馆酒店、大型商场超市、医院、学校等各种使用排油烟设备的公共餐厅、食堂场所，提供高效、优质的清洁服务，并得到了客户的一致好评和行业推荐。', '116.65489599999999', '40.210248999999997', '116.65489599999999', '40.210248999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3577', '北京美怡家环保科技有限公司', '940', '王新武', '15010862427', '谭朝双', '13911464849', '2017年12月11日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区桥梓镇兴桥大街1号南楼203室', '北京市', '北京市', '怀柔区', '桥梓镇', '北京市怀柔区桥梓镇兴桥大街1号南楼203室', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年12月11日', '长期', '2018/6/15', '2019/6/14', '京消协（2018）证字200号', '91110116MA0199YY62', '', '技术服务、技术转让、技术开发、技术推广、技术咨询；承办展览展示活动；设计、制作、代理、发布广告；组织文化艺术交流活动（不含演出）；办公室保洁服务、建筑物清洁服务、家庭劳务服务；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京美怡家环保科技有限公司是一家专业从事排油烟设施清洗工程的服务型企业。为用户的清洗系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。 公司拥有一批专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成油烟管道的清洗工作。 公司不断吸收和引进各类专业技术和管理人才，提高经营管理人员的素质，以一流的品质求生存、一流的诚信求发展、一流的管理求进取、合理的价格来服务于广大客户。 　公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！ 我们的承诺：您的满意才是我们的满意！我们的今天：全凭客户以往的支持！ 我们的未来：将继续全方位的服务！我们的坚信：做到专业，就能做到最好！', '116.57381599999999', '40.290222', '116.57381599999999', '40.290222', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3578', '北京爱鑫清洁有限公司', '939', '魏峰', '18911886838', '魏峰', '18811546063', '2019年03月07日', '500万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区双峪路6号6幢113', '北京市', '北京市', '门头沟区', '大峪街道', '北京市门头沟区双峪路6号6幢113', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年03月07日', '2049年03月06日', '', '', '', '91110109MA01HJFJ32', '', '保洁服务；销售服装鞋帽、日用品、玩具、灯具、家具、工艺美术品、针纺织品、文化用品、体育用品、家用电器、电子产品、五金交电（不含电动自行车）、电线电缆、机电设备、化工产品（不含危险化学品及一类易制毒化学品）、建筑材料、装饰材料、金属制品、不锈钢制品、橡胶制品、塑料制品、汽车配件、计算机软硬件及外设、消防器材、电子元器件、厨房用具、卫生间用具、木制品、珠宝首饰、仪器仪表、花卉、摄影器材、通讯器材、空调制冷设备、钟表眼镜；技术开发、咨询、转让、服务；施工总承包；专业承包；劳务分包。（企业依法自主选择经营项目，开展经营活动；施工总承包；专业承包；劳务分包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '保洁服务、销售服装鞋帽、厨房用具、日用品、玩具、家具等', '116.10915199999999', '39.935437', '116.10915199999999', '39.935437', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3579', '北京优明佳保洁有限公司', '938', '姜后平', '13212302222', '姜后平', '13212302222', '2019年04月18日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市怀柔区渤海镇怀沙路536号', '北京市', '北京市', '朝阳区', '王四营地区办事处', '北京市朝阳区白鹿司路2号院2底商', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年04月18日', '长期', '', '', '', '91110116MA01JK989B', '', '建筑物清洁服务；建筑物管道疏通服务；建筑物下水管道疏通；市政排水管道疏通；技术开发；技术咨询；技术转让；技术推广；技术服务；清洁服务；生活清洗、消毒服务；办公室清洁服务；水污染治理、大气污染治理；家庭劳务服务；城市园林绿化；物业管理；绿植租摆；销售日用品、文化用品、电子产品、化工产品、五金交电（不含电动自行车）、机械设备、电气设备、花卉。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京优明佳保洁服务有限公司组建于2018年，是一家专门为写字楼、宾馆、饭店油烟机清洗、酒店、行政单位、商场、公寓、小区提供长期、全面的清洁、保养、维护、绿化、消杀灭等服务的专业保洁公司。\r\n     公司自成立以来，秉承“质量、信誉、友谊”的发展原则，以专业化的保洁服务，为客户提供了舒适的生活空间，创造了卫生、健康、整洁的工作、购物环境。优质的服务得到了客户的赞誉和推荐，其守信、敬业、吃苦耐劳的品格受到了广大客户的普遍好评。', '116.55506699999999', '39.874296000000001', '116.55506699999999', '39.874296000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3580', '北京前景新缘物业服务有限公司', '937', '高立军', '13501184259', '张帅', '13611136885', '2010年10月21日', '1000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区李桥镇北庄头村中东街5号', '北京市', '北京市', '顺义区', '李桥镇', '北京市顺义区李桥镇北庄头村中东街5号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年10月21日', '2040年10月20日', '', '', '', '91110113563670526W', '', '物业管理；保洁服务；组织文化艺术交流活动（不含演出）；承办展览展示活动；会议服务；企业形象策划；机动车公共停车场服务；安全防范技术咨询；机械设备租赁；接受委托提供劳务服务（不含排队服务、代驾服务、对外劳务合作）；劳务分包；酒店管理；餐饮管理；家政服务；城市园林绿化施工（建筑工程除外）；技术开发、技术咨询、技术推广、技术服务；大气污染治理；污水处理；餐饮服务；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；餐饮服务、城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京前景新缘物业服务有限公司成立于2010年，经过十几年的业务发展，我们从1999年注册成立的专业保洁公司逐步发展扩大到如今初具规模的、拥有综合服务业务的专业物业公司。本公司自成立以来，秉着求实创新、诚信服务的经营理念，经过十余年的不懈努力，积累了丰富的物业服务管理经验。公司现拥有物业管理专业人员30余人，职工200余人；有初级师25人，中级师6人，高级师1人，另外，公司具有清洁二级资质，获得ISO9001质量标准体系、ISO14001环境管理体系及OHSAS18001职业健康安全管理体系的认证，另有30余家合作单位.\r\n通过公司领导的科学管理和全体员工的不懈努力，2014年公司的业绩不断提高，连续两届成为顺义区政府物业采购定点中标单位，2016年成为北京市政府物业采购定点中标单位。在2017年被清洁行业权威媒体评为“年度清洁保洁服务品牌企业”，并且荣获顺义区人社局、总工会、工商联及国资委联合评选的“劳动关系和谐单位”称号；2018年里北京企业评价协会及北京清洁协会联合为我企业颁发“AAA级诚信企业”证书；2019年在北京市安监局授权举行的安全生产标准化评选，获得“安全生产标准化二级企业', '116.756995', '40.032941000000001', '116.756995', '40.032941000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3581', '北京世纪洪源环保科技有限公司', '936', '王禹', '13521994632', '王禹', '13521994632', '2015年01月13日', '50万元', '北京市', '北京市', '西城区', null, '北京市丰台区菜户营58号1102室', '北京市', '北京市', '西城区', '白纸坊街道', '北京市丰台区菜户营58号1102室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年01月13日', '2035年01月12日', '', '', '', '91110106327281692P', '', '技术开发、技术推广；网上销售环保产品、五金交电、装饰材料、建筑材料、日用品、电子产品、机械设备；保洁服务、接受委托提供劳务服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经展经营活动）(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '本公司是一家经过正式注册，拥有合法经营执照的正规企业。专业提供厨房排烟系统清洗和维护服务！公司拥有严格的管理制度、先进的设备、一流的服务质量，精湛的技术。清洗维修技师都具备多年清洗、维修、安装经验，并不断吸收新的技术和先进的检测设备来满足广大客户的需求！\r\n根据北京市政府令177号文件“关于加强厨房烟罩、排油烟管道防火安全管理通知”，凡是本市宾馆、餐厅、酒家、招待所等单位，必须将烟罩、排油烟管道纳入防火责任重点管理，灶台、烟罩、排油烟管道（水平烟道）转角、排油烟罩口的清洗每两个月不少于一次。\r\n本公司每次清洗均提供清洗前后对比照片，清洗作业后无质量问题再付款；', '116.347876', '39.871893', '116.347876', '39.871893', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3582', '北京华海天地环保科技有限公司', '934', '杨玄玄', '15210174486', '杨玄玄', '18600911741', '2016年11月30日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区桥梓镇兴桥大街1号南楼203室', '北京市', '北京市', '怀柔区', '桥梓镇', '北京市怀柔区桥梓镇兴桥大街1号南楼203室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年11月30日', '长期', '', '', '', '91110116MA009XKM3Y', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；专业承包、劳务分包、施工总承包；租赁建筑工程机械、建筑工程设备；工程勘察设计；建筑物清洁服务、家庭劳务服务、机械设备专业清洗服务；大气污染治理；承办展览展示；会议服务；销售五金交电、金属制品、化工产品（不含危险化学品）、日用品、体育用品、计算机、软件及辅助设备、机械设备、文化用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n\r\n北京华海天地环保科技有限公司成立于2016年，本公司是由北京工商行政管理局注册成立的。公司注册资金为一百万。公司承接包括日常保洁、外墙清洗、物业管理、厨房排烟清洁、建筑清洁、设备销售、以及劳务分包等业务。\r\n公司拥有各类施工车辆，设备三十余套。专业施工人员数百人，其中从事各个工种十多年的将近四十余人，公司每个季度安排领班进行安全培训，确保从事每个工作岗位的安全，高效的进行施工。\r\n公司主营服务\r\n一保洁类；服务范围包括家庭保洁、酒店机关单位保洁、各种单位的开荒保洁、高中低档小区常年保洁\r\n二清洗类；酒店地毯清洗、餐厅厨房排烟系统清洗、家庭地板清洗、大理石开荒打磨打蜡清洗、中央空调管道清洗、以及各类通风设备管道清洗\r\n\r\n公司以人为本，诚信经营，以客户的需求为我们追求的目标，让客户以最低的成本获得同行最高的服务', '116.57381599999999', '40.290222', '116.57381599999999', '40.290222', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3583', '北京中消平程消防安全技术有限公司', '933', '张磊', '13393534099', '张磊', '13393534099', '2019年06月06日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区建国路15号院甲1号北岸1292三间房创意生活园区8号楼4层216', '北京市', '北京市', '朝阳区', '管庄地区办事处', '北京市朝阳区建国路15号院甲1号北岸1292三间房创意生活园区8号楼4层216', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2019年06月06日', '2049年06月05日', '', '', '', '91110105MA01KMBR8D', '', '技术咨询、技术转让、技术推广、技术服务、技术开发；教育咨询；承办展览展示活动；企业策划；设计、制作、代理、发布广告；会议服务；销售针纺织品、服装、鞋帽、日用品、文具用品、体育用品、机械设备、五金交电、通讯设备、电子产品、社会公共安全设备及器材；租赁建筑工程机械设备；工程勘察。（企业依法自主选择经营项目，开展经营活动；工程勘察以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中消平程，立志于防灾减灾事业，降低北京首都的火灾人员伤亡比例，消灭火灾于无形，尽己力保民安，国家兴亡匹夫有责，火灾乃人民群众缔造，也是广大人民群众第一时间发现，中消平程决心把消防意识，消防知识，以及先进的消防技术普及至每一家企业、单位，每一户家庭，让更多的人提高防范意识，拥抱幸福明天，中国的消防技术，人生的平安旅程，中消平程愿做您身边的消防卫士，守护您平安的人生旅程。', '116.582199', '39.910756999999997', '116.582199', '39.910756999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3584', '北京雅斯丽保洁服务有限公司', '931', '陈守银', '13910178131', '陈守银', '13910178131', '2011年04月08日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区岳各庄167号', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区岳各庄167号', '', '烟道清洗', '其他有限责任公司', '2015年05月05日', '2045年05月04日', '2019/6/20', '2020/6/19', '京消协（2019）证字375号', '91110106L379481722', '排油烟设施清洗机构', '建筑物清洁服务；劳务服务；技术开发、技术咨询、技术推广服务；维修厨房设备；销售日用品、体育用品、针纺织品、五金交电、厨房设备、玩具、建筑材料、办公用品、工艺美术品、电子产品、电线电缆。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京雅斯丽保洁服务有限公司是一家经过正式注册，具有合法经营执照的正规企业。公司拥有严格的管理制度、先进的设备、一流的服务质量，清洗维修技师均具备多年清洗、维修、安装经验，专业提供油烟管道清洗、厨房设备维修以及大理石结晶养护和地毯清洗等服务。经过多年施工，我公司积累了丰富的经验，北京清江鸿达技术服务有限公司是一家年轻、充满朝气、具有法人资格的专业性保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写字楼、娱乐场所等提供全方位的清洗保洁服务，包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清洗保洁服务。可以为不同领域客户提供全方位的满意服务。 作为北京消防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了良好的口碑。 科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是本公司信赖以发展的宗旨。', '116.27709900000001', '39.880132000000003', '116.27709900000001', '39.880132000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
