INSERT INTO `t_fc_company` VALUES ('3586', '行征和环保科技（北京）有限公司', '929', '李雍', '13241723993', '李雍', '13241723993', '2008年04月08日', '500万元', '北京市', '北京市', '海淀区', null, '北京市海淀区万泉庄路17号写字楼A座二层229室', '北京市', '北京市', '海淀区', '海淀街道', '北京市海淀区万泉庄路17号写字楼A座二层229室', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年04月08日', '2028年04月07日', '', '', '', '91110108674282147K', '', '环保技术开发、技术推广、技术转让、技术咨询、技术服务；油水分离设备的设计、调试和维修服务；货物进出口、技术进出口、代理进口；会议服务；销售计算机、软件及辅助设备、电子产品、机械设备、文化用品、化工产品（不含危险化学品及一类易制毒化学品）、机械设备；机动车公共停车场服务；道路货物运输；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '行征和环保科技（北京）有限公司成立于2008年4月，注册资本500万元，是一家专注于油烟管道清洗，中央空调清洗，油烟净化器设备安装维保，服务为一体的科技公司。我们的服务宗旨是为广大客户提供最优质的产品，最优惠的价格，最周全的服务。', '116.29873499999999', '39.969467000000002', '116.29873499999999', '39.969467000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3587', '北京浩可环保科技有限公司', '928', '马士勇', '13611194132', '马士勇', '13611194132', '2016年04月27日', '100万元', '北京市', '北京市', '石景山区', null, '北京石景山区实兴大街30号院3号楼2层A-1949房间', '北京市', '北京市', '石景山区', '苹果园街道', '北京石景山区实兴大街30号院3号楼2层A-1949房间', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年04月27日', '2046年04月26日', '', '', '', '91110107MA00549L69', '', '技术推广；软件开发；软件咨询；教育咨询；文化咨询；计算机系统服务；应用软件服务；企业策划、设计；电脑动画设计；承办展览展示活动；翻译服务；技术开发、技术咨询、技术服务、技术推广；组织文化艺术交流活动（演出除外）；化粪池清掏；保洁服务；销售计算机、软件及辅助设备、电子产品、日用品、消防器材、节能产品、环保设备、劳保用品、水果、化工产品（不含危险化学品）、五金交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京浩克环保科技有限公司，成立于2016年，主要从事专业承包；技术推广；清洁服务；社会公共安全设备及器材；消防器材等。\r\n公司成立以来，一直以优质的产品及完善的售后服务的经营理念，不断地进行创新和突破，建立了严格的质量保证管理体系，制定了规范的安全操作流程，严格执行国家行业的有关标准,规范要求自己，对所有工程精心施工、严守规范；我们成长的过程，就是服务客户并和客户一起不断成功的过程，我们用心努力做好每一件事、满怀信心迎接没一次挑战。\r\n北京安美佳保服务有限公司是一个充满生机和蓬勃发展的企业，我们秉承“遵纪守法、以人为本”的指导思想，一直以优质的产品及完善的售后服务的经营理念，以“精、诚、优、新”的企业文化精神。经过了几年不断的努力和创新，以专业、快捷、优质的服务，赢的了数以千万家客户的信誉和认可。\r\n我们坚信，只要以市场为导向，以创新为动力，以质量求生存，以服务求发展，我们一定会赢得更好的明天。', '116.193454', '39.939404000000003', '116.193454', '39.939404000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3588', '北京豪盛恒大科技有限公司', '927', '许光春', '13901392395', '党小新', '13811868844', '2006年06月27日', '5000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区祥云路北四条208号1号楼202', '北京市', '北京市', '大兴区', '青云店镇', '北京市大兴区青云店大东社区华联创意园4号楼', '', '烟道清洗', '有限责任公司（自然人独资）', '2006年06月27日', '2026年06月26日', '', '', '', '91110115790666770M', '', '科技开发；销售机械设备、医疗器械（Ⅰ类、Ⅱ类）、清洁用品、日用品；零售制冷设备；保洁服务；空调维修、清洗、消毒；家居装饰；装饰设计；专业承包；承办展览展示；生产非医用口罩；货物进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '油烟管道及厨房设计、销售、安装、清洗、中央空调新风净化、安装、清洗、维保、商场、大厦、写字楼高端物业管理。', '116.490646', '39.688181999999998', '116.537454', '39.678232000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3589', '北京丽锦清洗服务有限公司', '925', '熊天镜', '13651119203', '张雪', '13683615045', '2017年07月10日', '800万元', '北京市', '北京市', '昌平区', null, '北京市昌平区沙河镇北街家园五区2号楼6层4单元625', '北京市', '北京市', '昌平区', '沙河地区办事处', '北京市昌平区沙河镇北街家园五区2号楼6层4单元625', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年07月10日', '2047年07月09日', '', '', '', '91110114MA00G8PM5D', '', '厨房设备的清洗；房屋的清扫、消毒；建筑物清洁服务；技术推广。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京丽锦清洗服务有限公司是一家具有独立法人资格的专业化保洁服务公司； 承接酒店、宾馆、大厦、写字楼、商场、小区、机关等企事业单位的室内外各项保洁服务，维修、清洗厨房油烟罩、烟道，风机，净化器。清洁石材地面，翻新、结晶、保养打蜡、承接高空外墙、玻璃清洗及其他高难度、危险性作业等；总之，您有什么困难、要求、我公司会尽全力为你排忧解难。我公司管理人员和专业人员具备多年丰富经验和熟练的职业技能，所有的作业人员都经过岗前培训；使用专业的清洗设备及清洗药剂等。严格按照操作程序及技术规范进行各种清洗、保洁服务。  \r\n我公司经过多年的实践与经验积累，已经建立了一套比较完善的质量、监督、管理体系，为企事业单位、办公楼、大厦、酒店、写字楼、商场等提供长期、短期各种清洗、保洁服务。\r\n珍惜荣誉、完善管理、服务至上、质量第一是我公司成功发展的服务宗旨，我公司全体员工愿以一流的服务、优惠的价格为客户提供一个优美、洁净的环境，愿我们的优质服务，能为你带来愉快的心情！', '116.270214', '40.166091999999999', '116.270214', '40.166091999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3590', '北京美华洁邦环保科技有限公司', '924', '李萍', '13261269678', '胡召信', '13241906515', '2015年09月01日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路128号院4号楼12层1515-1516（园区镕辉佳特企业集中办公区）', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路128号院4号楼12层1515-1516（园区镕辉佳特企业集中办公区）', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年09月01日', '2045年08月31日', '', '', '', '9111010635835054X1', '', '技术推广；清洁服务；劳务服务；室内装饰工程设计；物业管理；网上销售日用品、建筑材料、五金交电、服装、劳保用品、化工产品（不含危险化学品）、金属材料、工艺品、机械设备、电子产品、制冷空调设备、厨房设备；设备维修。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '公司名称：北京美华洁邦环保科技有限公司\r\n本企业自2015年成立以来主要经营厨房管道设备安装维护、厨房设备清洗,风机清洗,净化器清洗,清洗脱排油烟机,大型饭店中央空调清洁服务、销售净化器、风机，定做厨房管道等产品，北京美华洁邦环保科技有限公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断 创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。\r\n\r\n公司业务范围\r\n主要业务： \r\n一 油烟管道安装 \r\n二 厨房设备安装及改造 \r\n三 专业定制油烟管道\r\n四 安装、维修风机及净化器\r\n五 央空调的清洗\r\n\r\n清洗方案服务流程\r\n服务流程\r\nA、勘查现场：\r\n1、清洗工程量的测量\r\n2、油垢堆积程度的检查\r\nB、清洗方案\r\n1、分析现场测量数据\r\n2、制定合理清洗方案\r\nC、签订合同\r\n1、正规的服务合同\r\n2、双方利益的保障\r\nD、合理施工\r\n1、检查设备运行情况\r\n2、专业人员保证施工质量\r\n3、客户验收，签字确认。\r\nE、客户回访\r\n公司理念\r\n您的安全是我们的责任\r\n您的满意是服务的标准\r\n您的信任是我们的荣耀\r\n我们的专业是您的保障', '116.29863899999999', '39.829504', '116.29863899999999', '39.829504', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3591', '北京绍晖信达消防安全技术有限公司', '923', '赵江峰', '13910981762', '杨振光', '13910981762', '2003年05月26日', '50万元', '北京市', '北京市', '大兴区', null, '北京市大兴区庞各庄镇福上村村委会东500米', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区大成路28号院3号楼6单元639室', '', '烟道清洗', '有限责任公司（自然人独资）', '2003年05月26日', '2053年05月25日', '', '', '', '91110115750115720D', '', '消防安全技术开发、技术咨询、技术服务；清洗服务；消防安全工程设计；劳务服务；销售消防器材、厨房用具、机械设备、建筑材料、五金交电（不含电动自行车）、金属材料、电气设备、安全技术防范产品；出租办公用房；维修消防器材、厨房设备、制冷设备。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京绍晖信达消防安全技术有限公司成立于2003年，是一家专门从事油烟管道清洗的企业,\r\n 本公司已经过走十几年的辉煌历程逐渐发展成为清洗设备先进、技术力量雄厚、管理完善、在同行业中小有名气的企业。十几年以来，始终以良好的服务质量，优质的服务态度为宗旨，赢得了广大客户的广泛赞誉。目前本公司已和北京市和周边地区200多个单位签订了长期服务合同。公司始终坚持“质量第一、信誉至上”的原则，愿将一流的舒适环境和客户的形象融为一体\r\n本公司在发展的同时，不断追求卓越，在烟道防火清洁方面，严格按照国家消防部门规定，排除因油烟而存在的消防隐患。同时还对排烟系统进行维修和日常保养。使其达到安全、高效、环保、节能、。\r\n我们全体员工很高兴能有机会向贵公司提供服务，我们将以最真诚的服务态度，为您创造一个理想的环境。', '116.27601', '39.588940999999998', '116.256823', '39.886605000000003', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3592', '北京翰拓教育科技有限公司', '921', '孙忱', '13731021766', '孙忱', '13731021766', '2018年04月04日', '100万元', '北京市', '北京市', '朝阳区', null, '昌平区东小口镇天通苑西苑二区17号楼2单元101二层210', '北京市', '北京市', '朝阳区', '来广营地区办事处', '昌平区东小口镇立汤路188号院北方明珠大厦3号楼1103', '', '消防产品,烟道清洗,消防设施', '有限责任公司（自然人投资或控股）', '2018年04月04日', '2048年04月03日', '', '', '', '91110114MA01B81P0Y', '', '技术开发；组织文化艺术交流（不含演出）；会议服务；电脑图文设计、制作；教育咨询（不含出国留学咨询及中介服务）；企业策划；设计、制作、代理、发布广告；从事互联网文化活动；互联网信息服务。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京翰拓教育科技有限公司于2018年04月04日成立。法定代表人孙忱，公司注册资金100万元，主要从事消防器材的维修与销售、提供消防设施维护保养，消防技术咨询等服务。是旨在打造专业消防文化、传播消防知识、提高全民消防意识的科技公司。公司注重每一个服务细节，规范作业，质量第一。同时，公司努力为员工提供良好的工作环境、工作报酬，进行多层次的职业技能、职业道德培训，不断提高员工的整体素质，保证公司持续稳定发展。 公司注重创建企业品牌，秉承企业文化和服务宗旨，以科学管理、优质服务、满足客户的各种需求为目标，在行业中拥有良好信誉，不断开拓进取，竭诚为客户提供优质技术产品与服务。', '116.41499399999999', '40.056123999999997', '116.41499399999999', '40.056123999999997', '', null, null, null, null);
