INSERT INTO `t_fc_company` VALUES ('3597', '北京京鑫环境工程有限公司', '913', '李广滢', '13366054767', '李广滢', '13366054767', '2018年12月20日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区湖光小区5号楼2幢422室', '北京市', '北京市', '怀柔区', '泉河街道', '北京市怀柔区湖光小区5号楼2幢422室', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年12月20日', '长期', '', '', '', '91110116MA01GA1N7M', '', '水污染治理；大气污染治理；施工总承包、专业承包、劳务分包；机械设备专业清洗服务；办公室保洁服务、建筑物清洁服务；家庭劳务服务；生活清洗、消毒服务；化粪池清掏；城市园林绿化；销售箱包、五金交电（不含电动自行车）、I类医疗器械、日用品、家具、灯具、花卉、工艺品、机械设备、家用电器、文化用品、化工产品（不含危险化学品）；设计、制作、代理、发布广告；电脑动画设计；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京鑫环境工程有限公司，是一家及安装和保洁；维保等为一体的综合性服务公司。公司实行总经理负责制，采用只能组织机构，遵循精于高效的原则，竭诚为北京市宾馆、酒店、写字楼、机关团体、企事业单位、学校、医院等提供各类型的服务。 公司机构； 公司下设管道清洗服务部、工程部、安装维修部、售后服务部。 主要业务； 一：专业对酒店、宾馆、写字楼、机关团体、企事业单位、学校、医院等 （1）厨房设备及油烟管道的清洗，安装维护和保养； （2）高层玻璃幕保洁、空调清洗；开荒；日常保洁；大理石翻新打蜡。 公司一直采用标准化；制度化；规生物、化粪池清掏等。 二：技术及服务特色范化的科学管理方法，不断引进国内外先进的机械设备，聘请有经验的管理人员。现已拥有一批稳定的专业技术服务队伍，全部管理人员都长期从事过本行业工作，有着丰富的管理经验的专业技术，所有受聘员工需经过培训后才能上岗工作，以确保服务质量，提高劳动效率。 我们深知公司今天的成就来之不易，除了不断完善和提高自身，还需要新老顾客的大力支持与合作。因此，我们珍惜每一次机会，愿与各界朋友真诚合作', '116.630252', '40.325654999999998', '116.630252', '40.325654999999998', '', null, null, null, null);
