INSERT INTO `t_fc_company` VALUES ('3601', '北京即刻到家科技服务有限公司', '905', '陈丽娜', '18518061912', '杨小同', '18518061916', '2014年07月03日', '500万元', '北京市', '北京市', '平谷区', null, '北京市平谷区中关村科技园区平谷园物流基地5号-918号', '北京市', '北京市', '平谷区', '兴谷街道', '北京市平谷区平谷大街18-18号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年07月03日', '2034/7/2', '', '', '', '911101173064859605', '', '农业技术开发及转让、技术服务与推广；网络技术开发、技术服务；组织文化艺术交流活动；承办展览展示；企业形象策划；营销策划；会议服务；园林绿化；电脑图文设计、制作；设计、制作、代理、发布广告；销售机械设备、新鲜水果、新鲜蔬菜、未经加工的干果及坚果、化工产品、电子产品、计算机软硬件及外围设备、办公用品、日用品、文化用品、工艺品、家用电器、服装鞋帽、空调制冷设备；技术进出口、代理进出口、货物进出口；道路货运代理；餐饮管理；旅游信息服务；软件开发；应用软件服务；火车票销售代理；建筑物清洁服务；婚庆服务；礼仪服务；家庭劳务服务；保洁服务；维修家用电器；室内装饰设计；室内空气成分测试；开锁服务；居家养老服务；物业管理；城市园林绿化施工；洗车服务；代驾服务；健康管理、健康咨询（须经审批的诊疗活动除外）；教育咨询；小客车代驾服务；汽车租赁（不含九座以上客车）；境内旅游业务；城市生活垃圾清扫、收集、运输、处理；集中养老服务；中医科医疗服务；外科医疗服务。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、集中养老服务、境内旅游业务、中医科医疗服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京即刻到家服务科技有限公司成立于2014年7月，是平谷区首家运营365天+24小时“互联网+生活服务”的平台，也是首家入驻到区电子商务孵化基地的企业。即刻到家商标已注册保护45个全类别并于2017年获得双高新技术企业，是首都首批社会企业，承接民政局项目建设并运行多家连锁养老驿站。 \r\n即刻到家致力于完美建设“区域养老服务体系”，体系主要包括居家养老、社区养老、机构养老三大类。其主要是利用互联网平台+智能终端设备+专业服务团队+养老驿站等四位一体的模式对用户进行居家养老和社区养老服务，基本满足老人10大类300余项服务。\r\n即刻到家连锁养老驿站主要覆盖在北京市平谷区，其中山区镇罗营上镇、五里庙、关上建有三家幸福晚年驿站，城区主要建有建兰、建西、金谷园、海关、兴谷家园等五个社区门口。十余项目主要解决老人八大难问题：包括老人看病买药难；购物、买菜、吃饭做饭难；卫生保洁难；维修家电、水电难；信息和法律服务难；危机处理难；精神关怀、文化文体健身难；再生资源处理难。即刻到家先后为区域内重残、离休、建国前、空巢、独居、山区等老人开展服务，有效紧急救助16次老人，累计为老人服务16余万次。', '117.13264100000001', '40.160739999999997', '117.11587299999999', '40.157922999999997', '注册地址坐标位置不准确', null, null, null, null);
