INSERT INTO `t_fc_company` VALUES ('3607', '北京四季清科贸有限公司', '898', '岳辉', '15201382614', '卜云广', '15011589194', '2010年11月30日', '300万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-M85', '北京市', '北京市', '昌平区', '东小口地区办事处', '北京市昌平区霍营街道资金新干线四区7号楼1单元1002室', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年11月30日', '2060年11月29日', '', '', '', '91110111565796894U', '', '技术开发、技术服务、技术转让、技术咨询（中介除外）；清洁服务（不含洗车服务）；舞台音响设计；接受委托提供劳务服务；销售乐器、机械设备、机电设备；维修空调制冷设备、机电设备；家居装饰及设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京四季清科贸有限公司成立于2010年，注册资金300万，是北京一家专业的厨房油烟管道系统服务公司。公司主要服务于餐饮，酒店行业，提供厨房油烟管道改造，清洗，保养于一体的专业服务。公司以“专业，敬业，信任，责任，安全，安心”为核心价值，希望通过我们的专业水平和不懈努力，为客户防火安全保驾护航。\r\n 九年来，北京四季清科贸有限公司一直秉承以用户需求为核心，在专注北京本地市场开拓的同时，为超过一百家酒店提供清洗及改造服务，优质、用心的服务赢得了众多客户的信赖和好评。我们相信，通过我们的不断努力和追求，一定能够实现与客户的互利共赢！\r\n 四季清公司在管理上建立和健全了各项管理制度。强化了技术管理，现场施工管理，质量管理，安全管理，文明施工管理等制度。在客户管理上我们实行了挡案式管理。如建立了客户信息档案和客户技术档案。公司的数据库已收集了三万多个客户的信息档案，建立了一万三千多个客户的技术档案。为及时掌握和联系客户，为客户高标准，高质量的服务奠定了良好的基础。\r\n四季清公司具有良好的售后服务。为客户制定厨房油烟管道系统的维护，清洗计划。每季度为客户提供检测服务，随时提供系统运行状况。', '116.01728', '39.712449999999997', '116.382116', '40.077097000000002', '注册地址坐标位置不准确', null, null, null, null);
