INSERT INTO `t_fc_company` VALUES ('3613', '北京万强安全技术有限公司', '889', '李景克', '13701003556', '郜洁', '13811715389', '2015年06月18日', '1000万元', '北京市', '北京市', '大兴区', null, '金苑路文化都汇3号楼802', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '金苑路文化都汇3号楼802', '', '消防产品,消防安全评估,电气防火,建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '2015年06月18日', '2045年06月17日', '', '', '', '91110115348295794K', '', '消防安全技术开发、转让、咨询、服务；技术检测；维修消防设施；销售消防器材、安全技术防范产品、建筑材料、金属材料、机械设备、计算机、软件及辅助设备；维修消防器材；消防安全评估。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n万强安全技术有限公司成立于2015年,注册资金200万， 万强安全技术有限公司是家专业消防服务提供商。公司具有专业的团队，是一家消防退伍老兵创业公司；公司主要服务于中小企业，提供消防设计、出图；消防施工；消防设备、器材销售；消电检、消防设施维护；装修材料见证取样；烟感清洗、灭火器年检维修等一站式消防解决方案。公司以“专注消防，用心服务”为核心价值，认真贯彻“质量为基础，服务作保证”的方针，希望通过我们的专业水平和不懈努力，为中小企业保驾护航，为企业的消防安全提供专业化服务指导。\r\n万强安全技术有限公司一直秉承“以用户需求”为核心，在专注北京本地市场开拓的同时，为一百多家中小企业提供消防设计、施工服务，优质、用心的服务赢得了众多企业的信赖和好评，在北京地区逐渐树立起公司良好口碑。公司不仅仅提供专业的消防设计、施工服务，同时还建立了完善的售后服务体系，为企业发展中遇到的消防安全问题和困难提供指导帮助。我们相信，通过我们的不断努力和追求，一定能够实现与中小企业的互利共赢!', '116.356936', '39.75994', '116.356936', '39.75994', '', null, null, null, null);
