INSERT INTO `t_fc_company` VALUES ('3616', '北京八方速达保洁服务有限公司', '885', '秦先文', '13161147700', '秦经理', '18611196988', '2012年03月29日', '30万元', '北京市', '北京市', '通州区', null, '北京市通州区工业开发区光华路15号3层523', '北京市', '北京市', '通州区', '张家湾镇', '北京市通州区工业开发区光华路15号3层523', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2012年03月29日', '2032年03月28日', '', '', '', '9111010659389722XC', '', '建筑物清洁服务；零售日用品、电子产品、机械设备、家用电器；技术推广；城市园林绿化；保洁服务；家庭服务（限符合家政服务通用要求）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京八方速达保洁服务有限公司是一家商务服务的企业，是经国家相关部门批准注册的保洁服务企业。企业注册号91111010659389722XC，公司主营保洁用品，保洁清洗服务，集清洁技术服务，代理销售，保洁技术培训，清洁设备及清洁用品配送于一体，经过几年的学习和实践逐步走向成熟，公司位于北京市通州区工业开发区光华路15号3层523，北京八方速达保洁服务有限公司本着“客户第一，诚信至上的原则”与多家企业建立了长期的合作关系。热诚欢迎各界朋友前来参观、考察、洽谈业务。\r\n   北京八方速达保洁服务有限公司主要以大型开荒保洁、日常保洁及外墙清洗为主。公司的业务承接：别墅、宾馆、酒楼、办公楼、商务楼、企事业单位、厂房日常清洗保洁，单位开荒保洁、新居开荒、日常保洁、家居保洁、清洗地毯、工程开荒保洁、定期保洁、托管保洁，承接各种石材、翻新、剪口整平、防护、晶面处理、除锈、去水斑、斑渍，承接 外墙清洗，外墙粉刷，高空作业施工，吊灯清洗，户外广告牌清洗，擦玻璃，新居开荒，工程开荒各种大型工业设备清洗，', '116.721312', '39.856253000000002', '116.721312', '39.856253000000002', '', null, null, null, null);
