INSERT INTO `t_fc_company` VALUES ('3618', '北京事易达清洗保洁服务有限公司', '877', '高义满', '13910772803', '高义满', '13910772803', '2011年08月16日', '600万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-Q132', '北京市', '北京市', '房山区', '城关街道', '北京市房山区城关街道顾八路1区1号-Q132', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年08月16日', '2031年08月15日', '', '', '', '911101025808232139', '', '清洁服务；家庭劳务服务；承办展览展示；经济贸易咨询；物业管理；维修空调制冷设备；销售厨房用具、日用品、化工产品（不含一类易制毒化学品及危险品）、机械设备、五金交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '公 司 简 介 :\r\n     公司成立之初承接各大饭店、企事业机关厨房油烟管道的清洗和高档办公楼内的日常保洁服务业务。本着诚信、诚心的态度经过一段 的发展，现已成为一家拥有高素质的管理队伍、严格的管理程序、完善的培训制度、专业化的机器设备，具备较 强实力的专业保洁公司，可承接业内各种标准的保洁工作，及各大酒店，宾馆食堂和企事业单位厨房从事专业的 油烟管道防火清洗业务。 \r\n公司现有固定客户 100 余家，拥有专业员工 80 余人，公司主要经营、厨房油烟管道消防清洗、外墙清洗、 杀虫灭鼠、日常保洁、各种石材保养打腊及室内外开荒。虽不属于业内的大公司，但能一如继往的保持与客户良 好的合作关系，诚心的服务态度和较高的服务质量。 公司奉行“以质胜人、以信感人、以诚待人”的经营宗旨为用户提供全面、快捷的服务，并不断创新发展， 为广大用户解除后顾之忧。', '116.01728', '39.712449999999997', '116.01728', '39.712449999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3619', '北京开拓明光消防设备有限公司', '876', '席宝水', '13520482851', '席宝水', '13520482851', '2002年03月08日', '208万元', '北京市', '北京市', '丰台区', null, '北京市丰台区万芳园二区3号楼2层201-125号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店南桥', '', '消防产品', '有限责任公司（自然人独资）', '2008年01月10日', '2028年01月09日', '', '', '', '9111010673645745XE', '', '销售消防产品、建筑材料、装饰材料、电器设备、制冷空调设备、五金交电、化工；技术开发、技术推广、技术咨询、技术培训；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京开拓明光消防设备有限公司经北京市消防总局、北京市消防协会、北京市工商局核准注册的单位。我公司主要经营范围： 销售消防产品、灭火器年检维修。\r\n      公司拥有一支专业性强、经验丰富、技术精湛、力量雄厚的团队，并拥有先进的维修技术和设备。公司始终坚持“质量第一，信誉至上，以技术为中心，以服务为基础”的经营理念，真诚的为广大客户提供优质的产品和精湛的技术及更好的服务。您的需求是我们努力的方向，您的满意是我们最大的安慰，您的放心就是我们公司为之奋斗的目标。北京开拓明光消防设备有限公司竭诚欢迎各位新老朋友光临洽谈，并希望长期建立互利互惠的友好合作。', '116.313779', '39.847611000000001', '116.47126799999999', '39.837477999999997', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3620', '汇欣时代（北京）清洁服务有限公司', '875', '朱明彩', '13439413114', '王婷', '15205210440', '2010年03月08日', '1319万元', '北京市', '北京市', '丰台区', null, '北京市丰台区成寿寺路5号楼16层1607', '北京市', '北京市', '丰台区', '南苑地区办事处', '北京市丰台区成寿寺路鑫源国际5号楼302室', '', '烟道清洗,消防设施', '有限责任公司（自然人独资）', '2010年03月08日', '2030年03月07日', '', '', '', '911101065513861575', '', '清洁服务；物业管理；会议服务；城市园林绿化服务；经济信息咨询；机动车停车场管理；餐饮管理；销售五金交电、花卉，建筑材料、日用品、装饰材料、机械设备、化工产品、计算机软件及辅助设备；接受委托提供劳务服务；技术咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '汇欣时代（北京）清洁服务有限公司是经北京市工商管理局正规注册的公司。公司资质齐全、设备先进，下设有工程部、业务部、培训部和人事部，现有工作人员500多人，管理人员35人，所有员工均经过专业的岗前培训，能快速响应客户的不同需要。我们凭着专业的清洗保洁技术、优质高效的服务、丰富的实际工作经验、良好的信誉、合理的价格，与众多的酒店、医院、银行、学校、商场、办公楼等机关团体建立了长期合作关系。\r\n在全体员工的共同努力及各界朋友的大力支持下，使我们公司成为当前规模最大、设备最先进、服务一流化的清洗保洁公司之一。', '116.44435900000001', '39.857410000000002', '116.44435900000001', '39.857410000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3621', '北京北燃环能科技发展有限公司', '873', '车立新', '', '孙燕', '13717926727', '2017年11月21日', '3000万元', '北京市', '北京市', '密云区', null, '北京市密云区经济开发区兴盛南路8号开发区办公楼501室-2015（经济开发区集中办公区）', '北京市', '北京市', '朝阳区', '和平街街道', '北京市朝阳区安外外馆东后街35号', '', '消防产品', '有限责任公司（法人独资）', '2017年11月21日', '2037年11月20日', '', '', '', '91110105MA018WDJ7U', '', '技术开发、技术服务、技术咨询、技术推广；技术检测；计算机系统集成；专业承包、劳务分包、施工总承包；工程造价专业咨询服务；工程管理服务；市政设施管理；城市地下公共设施管理服务；维修仪器仪表；销售仪器仪表、电子产品、通用设备、专用设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京北燃环能科技发展有限公司成立于2017年11月21日，注册资本3000万元，是北燃实业的全资子公司，是落实北燃实业战略发展中科技创新驱动的重要载体之一，是加速高新技术成果转化、拓展高技术服务，加速产业化培育的重要平台。北燃环能下设5个事业部，以燃气和供热为核心，从事低碳燃烧器的研究、制造、销售、服务等业务；从事燃气计量仪表的故障修理、工厂式定期维护和现场仪表维护等业务；从事运动会火炬、景观火炬、手持火炬及艺术燃火的设计、安装与维护等业务；从事城市燃气产品及相关技术服务；从事户内家用安全产品销售及相关技术服务。未来北燃环能将以高技术为引领，以市场为核心，致力于市政公用系统和能源领域市场拓展。在做好当前业务的前提下，重点关注和开发供热节能、工业燃烧系统节能环保、可再生能源利用、多种能源综合利用、燃气应用产品等市场，从而实现可持续发展。', '116.817438', '40.35304', '116.405438', '39.965657', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3622', '北京首津润通科技有限公司', '872', '闫洪松', '13671034387', '付金辉', '18311387371', '2013年11月19日', '100万元', '北京市', '北京市', '石景山区', null, '北京市石景山区模式口村西口102号2号楼1层125房间', '北京市', '北京市', '石景山区', '苹果园街道', '北京市石景山区模式口村西口102号2号楼1层125房间', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年11月19日', '2033年11月18日', '', '', '', '91110107082844089A', '', '专业承包；技术开发、技术转让、技术咨询、技术服务、技术推广；设备清洗；保洁服务；维修机械设备；城市园林绿化；仓储服务；销售空调制冷设备、专用设备、电子产品、仪器仪表、五金交电、金属材料。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京首津润通科技有限公司是一家专业从事中央空调销售、安装、维修、保养、清洗节能、金属罐装清洗、室内空气净化、保洁、设备清洗为一体的专业科技公司。\r\n   公司致力于中央空调的销售、安装、维修、保养、清洗消毒、节能改造及技术咨询，通过对空调的良好维修及保养，最大限度维持空调的最佳状态和延长使用年限，对室内空气净化有极大的效果。\r\n   自公司成立以来，我们已拥有一支技术精湛、态度良好的服务队伍，以丰富的专业化经验以及雄厚的技术实力为大量的公司、学校、超市、酒店宾馆、高档写字楼等大型综合场所进行各种型号空调及相关辅助设备的安装设计、调试维修、年度维保、水处理及绿色中性无腐蚀清洗。\r\n   服务态度和服务质量得到了客户的充分肯定，随时为您保驾护航！\r\n   我公司秉承“服务至上”的服务理念，以我们精湛的技术，竭诚为您服务！\r\n  “快捷、准确、亲切”是我们的宗旨，您的满意就是对我们最大的鼓励！\r\n服务项目\r\n   中央空调销售配件供应\r\n      变频氟系统中央空调\r\n      恒温恒温中央空调\r\n   清洗项目\r\n      中央空调风系统清洗\r\n      中央空调水系统清洗\r\n     中央空调氟系统', '116.166183', '39.935226', '116.166183', '39.935226', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3623', '北京晋鸿运环保科技有限公司', '871', '陈新户', '18801440638', '陈新户', '18801440638', '2016年03月24日', '100万元', '北京市', '北京市', '丰台区', null, '丰台镇游泳场北路9号院71幢6层611室', '北京市', '北京市', '丰台区', '丰台街道', '丰台区北大地四里18号楼一单元102室', 'AA', '烟道清洗', '有限责任公司（自然人独资）', '2016年03月24日', '2036年03月23日', '2019/12/26', '2020/12/25', '2019-HY-0571', '91110106MA004FG444', '烟道清洗', '技术开发、技术推广、技术服务；清洁服务；家居装饰；销售日用品、电子产品、机械设备、机电设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '技术开发、技术推广、技术服务；烟道清洗；家居装饰；销售日用品、电子产品、机械设备、机电设备。', '116.292512', '39.855438999999997', '116.28332899999999', '39.858545999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3624', '北京中泽万通能源管理有限公司', '870', '张晓平', '13601286080', '杨文娟', '13810445030', '2015年12月11日', '500万元', '北京市', '北京市', '顺义区', null, '后沙峪镇安富街8号院1号楼101-A15', '北京市', '北京市', '顺义区', '后沙峪地区办事处', '后沙峪镇安富街8号院1号楼101-A15', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年12月11日', '2045年12月10日', '', '', '', '91110113MA002FX5X1', '', '企业管理；天然气供热；家政服务；清洁服务（不含餐具消毒）；接受委托提供劳务服务（不含对外劳务合作、排队服务）；零售机械设备、五金产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中泽万通能源管理有限公司   \r\n    公司简介\r\n一、北京中泽万通能源管理有限公司成立于2015年12月11日，注册资本金500万元，经营地址位于后沙峪镇安富街8号院1号楼101-A15。\r\n\r\n二、北京中泽万通能源管理有限公司是以专业清洗厨房排油烟管道为主，环境治理；销售环保设备为辅的专业环保科技公司。是正规工商注册的环保科技公司。现拥有一批实践经验丰富，具有高度责任感的员工，本着客户至上的原则，“以质量求生存，以信誉求发展，在发展中创新，在竞争中创新”为经营宗旨，以客户满意为服务宗旨，多年来致力于保洁行业，“高质量、低价格，优服务、快效率”的理念为京城多家饭店企事业单位提供优质满意快捷的服务。', '116.55508', '40.112105', '116.55508', '40.112105', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3625', '北京海淀晶晶科技有限公司', '869', '聂群', '010-82475403', '彭中文', '13911541057', '1992年01月01日', '1000万元', '北京市', '北京市', '海淀区', null, '学院路20号院北教楼三层307号', '北京市', '北京市', '海淀区', '学院路街道', '学院路20号院北教楼三层307号', '', '烟道清洗,消防产品', '其他有限责任公司', '1998年09月29日', '长期', '2018/5/11', '2019/5/10', '京消协（2018）证字112号', '9110108101951438G', '', '化工产品（不含危险化学品及一类易制毒化学品）、仪器仪表、电子产品、建筑材料、设备、建筑物清洗技术及设备、水处理技术及设备、磁性材料、防水保温材料、制冷设备的技术开发、技术服务、销售。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '晶晶科技有限公司始建于1992年，是全国第一家专业清洗机构。自创建以来，依托卓越技术品质，凭借良好的信誉魅力，公司现已发展成为集中央空调机组维保、水处理，中央空调制冷系统、风道系统清洗，厨房油烟道系统清洗，热水循环供暖、供水系统清洗，冷却塔维修保养等中央空调业界的一家具有权威技术、先进施工工艺、先进生产设备的大型民营高科技企业集团。', '116.361152', '39.995434000000003', '116.361152', '39.995434000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3626', '北京约洗吧清洁服务有限公司', '868', '石国安', '13391985818', '石国安', '13391985818', '2014年12月23日', '1000万元', '北京市', '北京市', '大兴区', null, '北京经济技术开发区科创五街38号院3号楼1108', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市大兴京珠盛世科技园2幢307', '', '烟道清洗', '有限责任公司（法人独资）', '2014年12月23日', '2034年12月22日', '', '', '', '911101053271709095', '', '清洁服务（不含餐具消毒）；销售家用电器、电子产品、建筑材料、办公用品、家具、通讯设备、机械设备、空调制冷设备、水处理设备、日用品、清洁用品、卫生间用具、化妆品、厨房用品；技术推广服务；经济贸易咨询；企业策划；企业管理咨询；市场调查。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京约洗吧清洁服务有限公司成立于2014年12月23日，注册资金1000万元，是一家专注于深度清洗服务的企业，其团队前身在北京做了十多年的知名家电售后服务，有着良好的职业素养及丰富的质量管理经验，现拥有一线清洗技师80余人，覆盖北京12个行政区域。 \r\n北京约洗吧清洁服务有限公司对外服务统一使用注册商标“约洗吧”标识，所有上门人员均使用标准装备及执行严格的上门服务流程。\r\n公司为所有服务人员均购买了全面的人身及财产保险，以降低服务过程中各项风险。\r\n约洗吧团队服务精神：想人所想、尽心尽责、生命不息、奋斗不止！', '116.534344', '39.801264000000003', '116.501535', '39.78492', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3627', '北京美意美境物业管理服务有限公司', '867', '卫峰兵', '13901299065', '杨明刚', '13001068625', '2017年02月27日', '5700万元', '北京市', '北京市', '丰台区', null, '北京市丰台区东铁营苇子坑109号2幢223室', '北京市', '北京市', '海淀区', '甘家口街道', '北京市海淀区八里庄街道八宝庄2号楼4门01地下室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年02月27日', '长期', '', '', '', '91110106MA00C6NX50', '', '物业管理；劳务派遣（劳务派遣经营许可证有效期至2020年07月11日）；机动车公共停车场管理服务；城市园林绿化规划；清洁服务；从事城市生活垃圾经营性清扫、收集、运输服务；销售日用品、电子产品、计算机、软件及辅助设备、文具用品、机械设备、医疗器械；技术开发、技术推广、技术转让、技术咨询、技术服务；企业管理服务；劳务服务；办公设备维修；餐饮管理。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '○成立于2017年2月；\r\n○注册资金5700万元，管理运营团队40余人；\r\n○主要针对所管项目提供物业服务，确保物业资金的保值和增值；\r\n○公司执照；物业公司营业执照；\r\n○质量管理体系认证、环境管理体系认证、职业健康安全体系认证；\r\n○我司致力于高端办公楼、商业楼宇、高端服务式公寓的整体物业服务；\r\n○经营范围：物业管理、机动车公共停车场管理服务、城市园林绿化规划、销售日用品、电子产品、计算机、软件及辅助设备、文具用品、机械设备、技术开发、技术推广、技术转让、技术咨询、技术服务、企业管理服务、劳务服务、劳务派遣、办公设备维修……\r\n○我们的奋斗蓝图是为客户创造更大价值；为客户提供高品质的服务体验……', '116.434426', '39.848025999999997', '116.29511599999999', '39.921818999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3628', '北京市燕山工业燃气设备有限公司', '865', '陈力生', '13801332701', '孙燕', '13717926727', '2001年06月04日', '520万元', '北京市', '北京市', '昌平区', null, '北京市昌平区科技园区中兴路10号', '北京市', '北京市', '朝阳区', '和平街街道', '安外外馆东后街35号', '', '', '有限责任公司（法人独资）', '2001年06月04日', '2021年06月03日', '', '', '', '91110114802654233Y', '', '生产燃气调压器（箱）；加工组装燃气设备；生产商（家）用燃气灶具、压力容器、管道压力元件（限分公司经营）；仪表、燃气、供热、供水、节能技术的开发、转让、咨询、服务；专业承包；维修机械设备、仪器仪表、电子设备；销售燃气设备、仪器仪表、电子产品、五金交电；智能燃气设备的技术开发。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市燕山工业燃气设备有限公司是由北京市燃气集团所属北京市公用事业科学研究所兴办的集科、工、贸于一体的高新技术企业。主要从事燃气壁挂炉、商（家）用厨房燃气设备、燃气输配设备、流量仪表、燃气锅炉等方面的研制与生产。公司具有雄厚的科研、开发、设计、生产及测试检验能力，并拥有国内多个一流的测试及检测设备。公司研制开发的新型工业及民用燃气设备具有安全可靠、高效节能、自动化程度高、环保效果好等特点。公司前身为北京市煤气用具厂，是国内最早引进家用燃气热水器和壁挂式燃气锅炉的厂家。多年来，我们致力于开发新品、满足市场需求，改进工艺、保证产品质量，树立了良好的“燕山”品牌形象。随着国家对节能及环保要求的不断提高，我公司还就厨房燃气灶具节能的课题进行了研究和开发并推向市场，其中在国管局和中直机关的改造项目里我公司共改造了千余台，节能效果良好，并获得了发改委颁发的《2011年北京市重点节能低碳技术》。公司具有研制大型运动火炬及艺术燃火装置的能力，北京2008奥运会的主火炬由我公司设计和制作安装。会场主火炬及燃烧自控系统的设计、制造、安装及运行工作，为祖国争得了荣誉。', '116.234185', '40.194560000000003', '116.405438', '39.965657', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3629', '北京诚同消防科技有限公司', '861', '李亚丽', '13718193326', '郜玥', '13693221622', '2017年02月13日', '800万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山岗北路2号E座配楼二层2059', '北京市', '北京市', '丰台区', '东铁匠营街道', '北京市丰台区石榴园北里42号楼四层三单元407', '', '消防产品', '有限责任公司（自然人独资）', '2017年02月13日', '2047年02月12日', '', '', '', '91110106MA00BRTUON', '', '技术推广、技术检测、技术咨询、技术服务；销售安全技术防范产品、电子产品、机械设备、医疗器械Ⅰ类、办公用品、日用品、建筑材料、（不从事实体店铺经营）、装饰材料（不从事实体店铺经营）、家具（不从事实体店铺经营）；组织文化艺术交流活动；承办展览展示；企业管理咨询；会议服务；设计、制作、代理、发布广告；货物进出口、代理进出口、技术进出口；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '本公司致力发展厨房烟道清理、技术推广、技术咨询、技术服务、销售消防器材。', '115.970304', '39.752569000000001', '116.419804', '39.846637999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3630', '北京隆世康科贸有限公司', '860', '焦乾龙', '15810660078', '焦乾龙', '15810660078', '2014年03月31日', '50万元', '北京市', '北京市', '朝阳区', null, '管庄乡1号1幢2层2075号', '北京市', '北京市', '朝阳区', '管庄地区办事处', '管庄乡1号1幢2层2075号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年03月31日', '2044年03月30日', '2019/1/28', '2020/1/27', '京消协（2019）证字050号', '91110105096447711B', '', '技术推广服务；销售厨房及卫生间用具（不从事实体店铺经营）、五金交电（不从事实体店铺经营）、电子产品、机械设备、建筑材料（不从事实体店铺经营）；清洁服务（不含餐具消毒）；维修厨房设备；经济贸易咨询。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京隆世康科贸有限公司专业从事厨房排烟系统的清洗、维修、保养、改造一条龙服务！公司具备厨房烟囱清洗资质、全体员工均持证上岗，采用专用高科技的清洗设备、施工全程机器人检测录像，可24小时随时上门服务！\r\n公司以诚信为本，客户至上，千锤百炼不遗余力是本公司永存活力的源泉；科学灵活的经营管理是本公司成功的保证；探讨研修至上，技术超越为基础，诚信奉行服务是本公司发展的保障；我们的服务对象包含党政单位，院校、医院，宾馆...', '116.595715', '39.909706', '116.595715', '39.909706', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3631', '北京立华环保科技有限公司', '859', '刘永宽', '15811023346', '刘永宽', '15811023346', '2013年11月13日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区草桥欣园一区五号楼底商三层高德优品快捷连锁酒店A306室', '北京市', '北京市', '丰台区', '马家堡街道', '北京市丰台区草桥欣园一区五号楼底商三层高德优品快捷连锁酒店A306室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年11月13日', '2033年11月12日', '', '', '', '911101060828562662', '', '室内装饰工程设计；劳务分包；技术开发、技术服务；清洁服务；园林绿化设计；设计、制作、代理、发布广告；家庭服务；销售日用品、家用电器、电子产品、厨房用具、文具用品、卫生间用具。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京立华环保科技有限公司是一家专业从事厨房油烟管道清洗、排烟罩清洗、工程承包、通风管道工程、厨房排烟罩加工、中央空调系统清洗的服务型企业。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供厨房油烟管道清洗、通风管道工程、厨房排烟罩加工等，最优的解决方案。\r\n公司具有雄厚的专业技术实力，拥有一支经验丰富、技术过硬、以及高素质的技术安装、维修、清洗人员和知识创新能力强的设计人员，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成厨房油烟管道排烟系统安装、清洗、维修等全系列工作。\r\n我们丰富的经验可广泛服务于所有使用油烟管道排烟系统的场所，包括写字楼、宾馆、饭店、商场、学校、机关单位等。\r\n您的健康是我们的责任，立华环保愿用自己的努力，为您提供一个洁净、健康、舒适的工作环境。为我们的家园多留一片洁净的蓝天。', '116.358535', '39.846449999999997', '116.358535', '39.846449999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3632', '北京杰厨酒店设备有限公司分公司', '858', '刘杰', '13911216006', '游伟志', '13910888459', '2013年07月26日', '', '北京市', '北京市', '东城区', null, '东花市南里四区2号楼2单元121', '北京市', '北京市', '东城区', '东花市街道', '东花市南里四区2号楼2单元121', '', '烟道清洗,消防产品', '有限责任公司（自然人投资或控股）', '2013年07月26日', '长期', '', '', '', '911101010741274937', '', '销售不锈钢厨房设备、酒店用品；维修厨房设备；技术服务；保洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京杰厨酒店设备有限公司分公司，上级单位为北京杰厨酒店设备有限公司。主要服务于上级公司生产、销售的设备的售后维修。', '116.435174', '39.894826000000002', '116.435174', '39.894826000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3633', '北京亿维智慧科技有限公司', '857', '刘杰', '13911216006', '李勇', '13901157918', '2012年01月05日', '5058万元', '北京市', '北京市', '东城区', null, '左安门内大街19号龙潭湖体育产业园1-108室', '北京市', '北京市', '东城区', '龙潭街道', '左安门内大街19号龙潭湖体育产业园1-216室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2012年01月05日', '2032年01月04日', '2018/7/26', '2019/7/25', '京消协（2018）证字245号', '91110101589111028F', '', '技术推广服务；软件开发；经济贸易咨询；电脑图文设计、制作；销售厨房用具、专用设备、机械设备、电子产品、五金交电、家用电器。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京亿维智慧科技有限公司始创于2004年，注册资金为5058万元，是一家依托科技研发、科技进步，致力于环境保护与安全生产的创新型科技企业，全资控股亿维智慧河北环保科技有限公司、北京馨天地科技有限公司和北京杰厨酒店设备有限公司三家子公司。是专业的废气治理及空气净化设备设计、研发、制造、施工、服务于一体的综合性企业。\r\n       近年来经过不懈努力，在安全生产和环境保护两个领域不断创新，多次获得北京市政府、市安监局、市消防局、市环保局、市科委等单位领导及专家高度评价。北京电视台、北京晚报、搜狐、新浪等多家媒体报道。', '116.43791899999999', '39.876150000000003', '116.43791899999999', '39.876150000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3634', '北京优奕建筑工程有限公司', '856', '郝书涛', '13911968871', '郝书涛', '13911968871', '2019年03月18日', '6000万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山岗北路26号87号一层西侧1015', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区德元九和大厦1002', '', '建筑防火,消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2019年03月18日', '2049年03月17日', '', '', '', '91110304MA01HRHW4F', '', '专业承包；施工总承包；劳务分包；园林绿化服务；销售消防器材、办公用品、五金交电（不含电动自行车）、机械设备、环保设备、工艺品；设计、制作、代理、发布广告；承办展览展示活动；会议服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京优奕建筑工程有限公司成立于2019年3月18日，主要从事专业承包，施工总承包，劳务分包，园林绿化服务，销售消防器材，机电设备，环保设备等业务。目前公司正在申办建筑类资质6项，分别是1建筑工程总承包三级，2建筑装修装饰专业二级，3消防设施工程专业承包二级，4环保工程专业承包三级，5防水防腐保温工程专业二级，6特种工程结构补强。', '115.964179', '39.750061000000002', '116.46261199999999', '39.867654999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3635', '北京京达美洁物业管理有限公司', '855', '朱威风', '13521233281', '朱威风', '13521233281', '2015年11月19日', '800万元', '北京市', '北京市', '顺义区', null, '顺义区北务镇政府街9号H-3', '北京市', '北京市', '顺义区', '北务镇', '顺义区北务镇政府街9号H-3', '', '', '有限责任公司（自然人投资或控股）', '2015年11月19日', '2065年11月18日', '2018/5/11', '2019/5/10', '京消协（2018）证字122号', 'MA0023GWX8', '', '物业管理；停车场管理服务；专业承包、劳务分包；城市园林绿化施工；家庭服务；保洁服务；家居装饰；风景园林景观设计；维修、租赁机械设备；酒店管理；销售日用品、服装、消防器材；零售五金产品；有害生物防治。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '公司简介\r\n\r\n    北京京达美洁物业管理有限公司成立于2015年11月19日，注册资金800万元人民币，是中国物业管理协会会员单位。公司现有员工70余人，管理人员全部持证上岗，形成各种高、中、初级管理人员及技术工人配备合理的物业管理专业队伍。\r\n   公司成功通过ISO9001质量管理体系、ISO14001环境管理体系、OHSAS18001职业健康安全管理体系认证，荣获社会治理先进单位。\r\n现物业管理服务项目包括：\r\n芙蓉里社区(专项保洁)，北京大学(物业服务)，科贸写字楼(消防中控室服务)。\r\n公司将继续坚持“真诚待人、热情服务、扎实工作”的服务宗旨，通过科学的管理和诚信优质的服务，给业主及使用者创造一个温馨 、舒适、洁净、安全的工作、生活环境。同时企业员工们将一如继往，鼓足干劲，与时俱进，开拓创新，以高昂的斗志，饱满的热情，再谱服务新篇章。\r\n\r\n\r\n                   北京京达美洁物业管理有限公司\r\n\r\n                               2019年4月22日', '116.829432', '40.066327999999999', '116.829432', '40.066327999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3636', '京利堡集团有限公司', '854', '安书迎', '63361905', '李娇', '18601180790', '2000年11月07日', '10000万元', '北京市', '北京市', '西城区', null, '北京市西城区广义街5号广益大厦7层A707室', '北京市', '北京市', '西城区', '广安门内街道', '北京市西城区广义街5号广益大厦7层A707室', 'AA', '建筑防火', '有限责任公司（自然人投资或控股）', '2000年11月07日', '长期', '2019/5/9', '2020/5/8', '京消协（2019）证字237', '91110102802935668B', '建筑防火', '专业承包；销售消防器材、安全技术防范产品、家用电器、机械设备、电子产品、通讯设备；技术服务；物业管理；绿化管理；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京利堡消防工程有限公司是专门从事火灾自动报警及消防联动系统、空气采样报警系统、自动喷水灭火系统、消火栓系统、自动跟踪水炮灭火系统、气体灭火系统、防排烟系统、防火涂料、火灾电源监控系统、火灾漏电保护系统等各种消防设施工程的技术咨询、设备提供、施工安装、系统调试、维修保养等项业务的专业公司。\r\n  公司设有设备销售、工程安装、售后服务三大业务板块，业务范围覆盖了整体中央空调系统和消防通风系统，并延伸到了服务全系统领域。同时公司是集中央空调、净化空调、通风设备销售、安装、服务为一体的综合性公司。公司资金、技术力量雄厚，拥有较强的市场营销拓展能力和专业工程技术人员队伍。\r\n 公司成立于2000年，注册资金5000万。目前现有管理人员50余人,其中具有各类技术职称和获得消防专业资格的消防专业技术人员占公司总人数的97%以上。目前，京利堡公司经营代理的产品已达到300多个品种，800余件产品，服务项目已经覆盖民用、商用、军工、医疗、电力、工矿等众多领域，广泛被用于楼宇消防通风，制冷供暖、净化、除尘等多种用途，是京津地区较大型的消防、暖通供应服务商企业。', '116.355712', '39.890734999999999', '116.355712', '39.890734999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3637', '北京市京久龙消防科技有限公司', '853', '方文梅', '13701137952', '徐华飞', '13716213285', '2005年09月16日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区博大路3号院9号楼222号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区博大路3号院9号楼222号', '', '消防设施,消防产品', '其他有限责任公司', '2005年09月16日', '2025年09月15日', '2018/6/27', '2019/6/26', '京消协（2018）证字203号', '911101057802028339', '', '技术推广服务；专业承包；清洗服务；维修消防设备、五金交电、建材；销售消防设备、五金交电、建材、计算机、软件及辅助设备、机械设备；计算机技术培训（不得面向全国招生）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市京久龙消防科技有限公司是经北京消防局核准备案的消防产品消防产品销售、检测维修的专业公司，是北京消防协会的会员单位，公司设有消防产品销售部、消防器材维修、电气安全防火检测。\r\n公司始终坚持“质量第一，用户至上”的经营方针，凭借雄厚的实力和良好的信誉，不断扩大与生产厂家的联营，努力加强内部管理和严格质量监督，积极降低低营业成本，建立完善直销服务体系，公司坚持把产品质量和良好服务放在第一位，吧最优最好的产品销售给客户。\r\n   公司主要业务，专业批发销售消防产品、各种手提式ABC灭火器、手提式二氧化碳灭火器、推车式灭火器、消防水带、接扣、水枪、灭火栓、消防应急灯、指示牌、消防呼吸器、消防装备等；承担消防器材维修年检，电气安全防火检测，消防设施检测，火灾报警探测器清洗和维保等。', '116.473292', '39.836433999999997', '116.473292', '39.836433999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3638', '北京嘉乐清洁服务有限公司', '849', '王振华', '18143941339', '王现伟', '13673944279', '2019年04月23日', '100万元', '北京市', '北京市', '通州区', null, '怡乐中路303号院1号楼-B104', '北京市', '北京市', '通州区', '梨园地区办事处', '怡乐中路303号院1号楼-B104', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年04月23日', '长期', '', '', '', '91110112MA01JN6E76', '', '建筑物清洁服务；租赁建筑工程机械、建筑工程设备；企业管理咨询；技术推广、技术服务；城市园林绿化；家庭服务（不符合家政服务通用要求不得开展经营活动）；酒店管理；物业管理；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京嘉乐清洁服务有限公司是一家具有法人资格的，专业的后勤服务公司。秉承诚信、亮丽、高效、务实的发展原则，配备有先进的清洁机械设备、保养设备，公司采用意大利特丽洁、美国洁士所生产的高质量、高水准、纯环保的清洁用品和专业设备。可以为企事业单位，家庭，宾馆，学校，别墅，酒店，商厦，物业小区，公共设施等场所提供科学的清洁工程开荒、外墙清洗、地毯清洗、油烟机清洗、地板打蜡、石材翻新、晶面处理、日常保洁、企业定点保洁、驻场保洁、物业管理、环境空气净化、环卫清扫、垃圾清运、管道疏通、园林绿化、家政、搬家，运输等后勤服务。', '116.635014', '39.879314000000001', '116.635014', '39.879314000000001', '', null, null, null, null);
