INSERT INTO `t_fc_company` VALUES ('3640', '北京安氧特科技有限公司', '848', '束克庆', '13901385099', '李霞', '13811936125', '2012年01月12日', '1500万元', '北京市', '北京市', '海淀区', null, '北京市海淀区永丰产业基地永捷北路3号B座2层201室', '北京市', '北京市', '海淀区', '西北旺地区办事处', '北京市海淀区永丰产业基地永捷北路3号B座2层201室', '', '建筑防火,宣传教育培训,灭火救援,消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2012年01月12日', '2062年01月11日', '', '', '', '91110108589085640G', '', '技术开发、技术咨询、技术服务、技术转让、技术推广；经济贸易咨询；销售日用品、医疗器械II类、自行开发后的产品、计算机、软件及辅助设备、机械设备、电子产品；环境应急救生、消防救护、煤矿安全等设备器材的组装生产。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安氧特科技有限公司，成立于北京市中关村国家自主创新示范区永丰高科技产业基地。公司在获得国家科技进步特等奖基础上，开发出应急救生制氧技术和呼吸器等多种安全防护产品，为应急救生、安全生产保障以及生命支持系统提供系列创新产品和优质服务，成功入选国家高新技术企业、中关村高新技术企业、中关村海帆企业和北京市专利试点单位。\r\n公司拥有强大的研发团队和实力，与北京科技大学气体分离研究所进行产学研合作，共享实验室，同时公司自主拥有研发中试基地和生产基地，拥有多种国内先进的研发试验、测试、检测设备和生产设备，截止目前公司已成功申报二十余项国家专利，填补国内外多项空白。', '116.243081', '40.082568000000002', '116.243081', '40.082568000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3641', '北京久恒荣发环保科技有限公司', '846', '张小玲', '13716719585', '胡风雷', '13717646691', '2013年12月12日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区金星路12号院2号楼2层2077室', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '北京市大兴区金星路12号院2号楼2层2077室', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年12月12日', '2033年12月11日', '', '', '', '91110106085495476F', '', '技术开发、推广、咨询、转让、服务；大气污染治理；会议服务；清洁服务；害虫的防治服务；施工总承包；专业承包；劳务承包；销售办公用品、五金产品（不含电动自行车）；建筑工程项目管理；物业管理；城市园林绿化；工程勘察；工程设计。（企业依法自主选择经营项目开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京久恒荣发环保科技有限公司坐落于首都的北京市大兴区金星路12号院2号楼2层2077室。本公司现有员工18名，拥有一流的保洁设备及先进的保洁保养理念，建立了完善的专业保洁服务体系，积累了丰富的保洁服务工作经验。拥有一批高级专业管理人才，专业技术力量雄厚，积累了丰富的实践工作经验，创造了极佳的经济效益和社会效益。我们实施先进的科学管理方法，运用科学严谨的经营理念，凭借一流的产品、专业的服务、良好的清洁服务态度赢得了北京市场蓬勃发展的机遇。', '116.35006799999999', '39.762312000000001', '116.35006799999999', '39.762312000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3642', '北京双虹电气有限公司', '845', '孙翔', '13911097707', '戴陈君', '13552015207', '2004年07月22日', '960万元', '北京市', '北京市', '石景山区', null, '经济技术开发区文化园西路8号院21号楼10层1103', '北京市', '北京市', '石景山区', '广宁街道', '经济技术开发区文化园西路8号院21号楼10层1103', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2004年07月22日', '2054年07月21日', '', '', '', '911101027655408269', '', '中央空调维修、设计、销售；销售建筑材料、五金交电、电子产品、机械设备、消防器材、日用品、办公用品、文化用品、体育用品、化妆品、服装鞋帽、针纺织品、珠宝首饰、工艺美术品、计算机、软件及辅助设备、金属制品、机电设备、电气设备、电子元器件、仪器仪表；技术推广服务；施工总承包、专业承包；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京双虹电气有限公司成立于2004年7月22日，注册资金960万元。公司成立后，先后取得了建筑业企业消防设施工程专业承包贰级、机电安装工程专业承包叁级、安全生产许可证证书；并且公司根据其发展要求和自身的实际情况，建立健全了与之相适应的管理体系，先后通过了质量管理体系、职业健康安全管理体系、环境管理体系的认证。建立了科学化、规范化的管理体系。\r\n   公司人才资源丰富，拥有多种人才和一流技术人员。具有较强的施工能力和丰富的消防设施和机电安装工程经验，可独立承担资质范围内的建筑业企业消防设施工程专业承包贰级、机电安装工程专业承包叁级工程。并且可做消防检测及消防维保，是一个以消防为中心的综合性消防科技服务公司。', '116.11338000000001', '39.935433000000003', '116.11338000000001', '39.935433000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3643', '北京嘉恒汇宝科技有限公司', '843', '贾恒茂', '17610603273', '郑建锋', '13520906303', '2012年03月20日', '50万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳镇嘉州水郡225号9层1-936', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区长阳镇嘉州水郡225号9层1-936', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年03月20日', '2032年03月19日', '', '', '', '91110111592328738X', '', '技术开发、技术咨询（中介除外）、技术服务；销售工艺品、电子产品、机械设备；货物进出口（国营贸易管理货物除外）、代理进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '技术开发、技术咨询（中介除外）、技术服务；销售工艺品、电子产品、机械设备；货物进出口（国营贸易货物管理除外）、代理进出口。（企业依法自主选择经营项目，开展经营活动，依法须经批准的项目，经相关部门亦批准的内容开展经营活动；不得从事本市产业政策禁止和限制类的经营活动）', '116.168908', '39.771500000000003', '116.168908', '39.771500000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3644', '北京盛世开元环保有限公司', '842', '徐云', '13466710960', '施升武', '13124796126', '2019年04月17日', '50万元', '北京市', '北京市', '石景山区', null, '北京市门头沟区双峪路35号院1号12层1215', '北京市', '北京市', '石景山区', '广宁街道', '北京市门头沟区双峪路35号院1号12层1215', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年04月17日', '2049年04月16日', '', '', '', '91110109MA01JHU68R', '', '大气污染治理；污水处理；水污染治理；土壤污染治理；保洁服务；建筑物外墙清洁服务；销售花卉、绿植、箱包、服饰鞋帽、五金交电（不含电动自行车）、建筑材料、日用品；害虫生物防治服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京盛世开元环保有限公司，成立于2019年4月17日，是一家专业提供清洗保洁服务的有限公司，前身是2006年成立的北京盛世开元保洁中心。13年来，我们始终秉承“以诚做事，以信做人”的经营理念，以“为创造清洁、美好、和谐的环境空间而努力”为服务宗旨，以精通业务、精益求精、服务至上为行动准则，竭诚为北京市内各类宾馆、酒店、学校、医院、机关单位等提供各类型的清洗保洁服务，赢得广大客户的一致好评。\r\n	迎着新时代，面向新未来，我们将本着不断的追求，更加完善我们的服务，为构建和谐美丽的新北京而不懈努力！期待您的继续支持与关注！\r\n	\r\n	     联系电话:010~69868520，13466710960，13124796126。\r\n										\r\n                                                             北京盛世开元环保有限公司\r\n                                                                       2019年4月26日', '116.11338000000001', '39.935433000000003', '116.11338000000001', '39.935433000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3645', '北京市金伟博清洁服务有限公司', '841', '陈伟', '13381186972', '陈伟', '13381186972', '2008年09月22日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区崔各庄乡南皋村130号', '北京市', '北京市', '朝阳区', '管庄地区办事处', '司辛庄55号', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年09月22日', '2028年09月21日', '', '', '', '91110105680465652T', '', '保洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市金伟博清洁服务有限公司成立于2008年，长期服务于为企业的外包服务的阵地上，从专业的视角向客户提供高水准的增值服务服务。起点人本着追求卓越，永远超越的企业精神，为众多企业营造整洁、舒适、环保的工作生活的优雅环境做出了积极的努力。 \r\n\r\n    北京市金伟博清洁服务有限公司致力于为企事业单位提供全面日常保洁解决方案，及油烟清洗，外墙清洗服务凭借现代化的企业管理手段与优秀高效的团队，不断发挥自身优势和整合行业资源，利用丰富的技术经验，向客户提供专业的室内外保洁服务、油烟清洗服务、外墙清洗服务、地毯清洗、地板打蜡等完整的保洁服务全方位解决方案。同时公司也提供较为齐全的基础业务如：保洁咨询、保洁培训等服务。北京市金伟博清洁服务有限公司是一家专业保洁服务、清洗服务，致力于企业外包服务的专业服务公司。 \r\n\r\n志存高远，锐意进取。公司将继续以良好的信誉为基础，秉承稳固与发展、求实与创新的精神，为客户提供更全面、更优质的服务。', '116.517601', '40.007407999999998', '116.60847699999999', '39.902852000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3646', '北京融合清洗服务有限公司', '840', '关艳梅', '13811937910', '关艳梅', '13811937910', '2019年01月15日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡半壁店村惠河南街1089号1层k1096', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高碑店乡半壁店村惠河南街1089号1层k1096', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年01月15日', '长期', '2019/1/28', '2020/1/27', '京消协（2019）证字051号', '91110105MA01GRWQ59', '', '清洁服务（不含餐具消毒）；技术推广服务；销售厨房用具、五金交电（不含电动自行车）、电子产品、日用品、化工产品（不含危险化学品）、机械设备、服装。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是一家经过正式注册（注册资金：100万），拥有合法经营执照的正规企业。专业为宾馆饭店机关单位食堂提供厨房大型排油烟系统清洗和设备维护服务！公司拥有严格的管理制度以及施工质量标准；依靠先进的设备、精湛的技术为客户提供全方位服务！。清洗维修技师都具备多年清洗、维修、安装经验，特别是在清洗过程中对厨房的电源保护的非常到位；并不断吸收新的技术和先进的检测设备来满足广大客户的需求！\r\n公司经营范围：排油烟系统清洗维护；排烟风机清洗维修；油烟净化器销售安装；厨房灶具维修改造；节能型炉头推广；蒸箱热水器除垢；炊事机械设备销售维修；冰箱制冷设备维修销售；厨房设备及排烟系统设计生产安装一条龙服务！', '116.499578', '39.905203999999998', '116.499578', '39.905203999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3647', '北京泽通源科贸有限公司', '839', '赵玉敏', '13520133888', '赵玉敏', '13520133888', '2015年06月30日', '1180万元', '北京市', '北京市', '房山区', null, '北京市房山区阜盛东街60号院3号楼4层410', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区阜盛东街60号院3号楼4层410', '', '烟道清洗', '其他有限责任公司', '2015年06月30日', '2045年06月29日', '2018/7/6', '2019/7/5', '京消协（2018）证字225号', '91110111348460788Y', '', '技术开发、技术服务、技术转让；销售日用杂货、针纺织品、清洁用品、化妆品、包装材料、纸制品、服装、鞋帽、计算机软硬件及辅助设备、通讯器材（卫星接收设备除外）、办公用品、照明电器、酒店用品、摄影器材、第一类医疗器械、机电设备、五金、交电、电子产品、橡塑制品、机械设备及配件、建筑材料、金属制品、电线电缆、钢材、玻璃制品、橡胶制品、不锈钢制品、门窗、化工产品（不含危险化学品）、防水材料、消防器材、保温材料、装饰材料；计算机技术培训（不得面向全国招生）；电脑图文设计；承办展览展示；设计、制作、代理、发布广告；组织文化艺术交流活动（演出除外）；货物进出口（国营贸易管理货物除外）、技术进出口；经济贸易咨询（中介除外）；数据处理（不含银行卡中心及PUE值在1；5以上的云计算数据中心）；企业管理；投资管理；市场调查；清洁服务（不含洗车服务）；家居装饰及设计；施工总承包；专业承包；劳务分包；餐饮管理；物业管理；租赁机械设备；园林绿化设计；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京泽通源科贸有限公司成立2015年06月30日，注册资金1180万元，在册员工19人，临时工27人，公司主营业务1：后厨排油烟设施清洗2：后厨设备安装3:集中央空调通风管道清洗.', '116.190095', '39.733441999999997', '116.190095', '39.733441999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3648', '北京天赐良机冷却设备有限公司', '837', '张治敏', '13911346713', '张治敏', '13911346713', '2014年05月15日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区五里桥二街2号院5号楼5层0530', '北京市', '北京市', '朝阳区', '常营地区办事处', '北京市朝阳区五里桥二街2号院5号楼5层0530', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年05月15日', '2034年05月14日', '', '', '', '91110105399066908X', '', '专业承包；销售机械设备、五金交电、电子产品、空调制冷设备；技术开发；维修空调制冷设备；清洁服务（不含餐具消毒）。（依法须经批准的项目，经相关部门批准后方可开展经营活动。）（领取本执照后，应到住房城乡建设部、市住房城乡建设委、区县住房城乡（市）建设委取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天赐良机冷却设备有限公司--自成立伊始，致力于冷却塔及零配件服务，本着“诚信务实、互利共赢”的经营理念，曾先后与国内多家著名企事业单位建立友好合作，得到多方认可。\r\n   冷却塔设备销售环节上竭诚为用户推荐性价比极高的品牌冷却塔产品，负责所属产品的销售、技术支持、售后服务工作,并在区域内得到众多用户及合作商认可。\r\n   多年冷却塔零配件销售方面有着丰富的技术经验，经销性价比极高的各种冷却塔专用与匹配通用部件，如冷却塔填料、防水电机、减速器、风机、布水器、喷头、消音毯、收水器等等。\r\n   我方在冷却塔维修、改造方面有着丰富的现场实践及技术经验，擅长于对各类冷却塔的维修、改造服务；如果您的冷却塔使用日久后，冷却效能下降、设备更新后原有冷却设备不能匹配、噪声大、漂水率高、不符合环境使用要求等等，您只要将它交给我们，我们能提供测试、设计、改造、维修、保养等全套服务，使其最终满足设计、节能、环保、便于维护的系统工程要求。\r\n   为了用户整体管理，确保设备正常运行、提供对口更加专业的服务，在涉及制冷机组与机电设备维修保养、水处理与设备清洗、水泵与水箱更新、管路与保温架设、玻璃钢防腐等方面工作时，', '116.615988', '39.925286999999997', '116.615988', '39.925286999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3649', '北京亿万佳保洁服务有限公司', '836', '王刘杰', '13693536128', '王刘杰', '13693536128', '2015年04月23日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区林荫北街13号信息大厦802室', '北京市', '北京市', '平谷区', '滨河街道', '北京市平谷区林荫北街13号信息大厦802室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年04月23日', '2035年04月22日', '2018/11/26', '2019/11/25', '京消协（2018）证字414号', '91110117339788853X', '', '专业承包；建筑物清洁服务；家庭劳务服务；销售厨卫用具、装饰材料、建筑材料、化工产品、日用品、办公用品；技术开发、技术转让、技术推广、技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '本公司成立于2015年，主要清洗油烟管道，清洗地毯', '117.105101', '40.141105000000003', '117.105101', '40.141105000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3650', '北京鑫源祥瑞环保科技有限公司', '834', '孙晓萌', '13911736219', '孙晓萌', '13911736219', '2018年06月05日', '1000万元', '北京市', '北京市', '丰台区', null, '北京市怀柔区雁栖经济开发区雁栖路33号院1号楼103室', '北京市', '北京市', '丰台区', '方庄地区办事处', '方庄镇芳群公寓5栋203', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年06月05日', '长期', '2018/11/26', '2019/11/25', '京消协（2018）证字418号', '91110116MA01CM9T8T', '', '技术推广、技术转让、技术咨询、技术服务；建筑物清洁服务；销售五金交电（不含电动自行车）、消防设备、机械设备、汽车配件、电线电缆、电子产品、日用品、家用电器、仪器仪表、卫生间用具、计算机、软件及辅助设备、化工产品（不含危险化学品）、安全技术防范产品；环境监测；机械设备专业清洗服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n\r\n北京鑫源祥保洁服务有限公司成立于二零一八年，是一家行业内新起的电器清洗企业，专业从事大型油烟管道清洗服务、集中空调系统清洗服务、室内环境净化与监测服务、物业清洁维护服务等一体化的保洁企业。\r\n本公司清洗设备先进，技术力量雄厚，管理完善，本着以质量求生存，以信誉求发展的原则，赢得了广大客户的支持和信赖。为给客户提供更好的服务保证，员工经过专业培训持证上岗，按照专业清洗程序为客户认真做好每一次服务。本公司在发展的同时，不断追求卓越，在烟道清洁方面，严格按照国家消防部门规定，排除因油烟而存在的消防隐患。同时还对排烟系统进行维修和日常保养。使其达到安全、高效、环保、节能。\r\n我公司全体员工很高兴有机会向贵公司提供服务，我们珍惜与每一个客户的合作关系，能为客户服务好是我们的理想，能让每一个客户服务满意是我们的追求，愿我们用专业的服务给您打造更舒适的环境。', '116.425203', '39.859349999999999', '116.425203', '39.859349999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3651', '北京中昌盛业建筑工程有限公司', '833', '姜祥根', '18500222278', '卢会玲', '15215707663', '2017年03月01日', '10000万元', '北京市', '北京市', '石景山区', null, '北京市门头沟区军庄镇军庄路2号院JZ1405室', '北京市', '北京市', '石景山区', '八角街道', '北京市石景山区古城南街9号院5号楼1111室', '', '建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '2017年03月01日', '2047年02月28日', '2018/7/26', '2019/7/25', '京消协（2018）证字248号', '91110109MA00C70M11', '', '施工总承包；专业承包；劳务分包；物业管理；建设工程项目管理；工程招标代理；工程造价咨询；园林绿化；工程勘察；工程设计；园林景观设计；产品设计；企业形象策划；设计、制作广告；销售金属制品、建筑材料、装饰材料、五金交电（不含电动自行车）、食用农产品、苗木、花卉、绿植；销售、租赁机械设备；技术开发、咨询、转让、推广、服务；货物进出口、代理进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '施工总承包，专业承包，劳务分包，物业管理，保洁服务，销售装饰材料，技术开发、咨询、转让、推广、服务，经济信息咨询，货物进出口，代理进出口，园林景观设计。', '116.185554', '39.904702999999998', '116.185554', '39.904702999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3652', '北京天天有喜保洁服务有限公司', '832', '张广顺', '13240417211', '张广顺', '13240417211', '2014年08月18日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区林荫北街13号信息大厦802室', '北京市', '北京市', '平谷区', '滨河街道', '北京市平谷区林荫北街13号信息大厦802室', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年08月18日', '2034年08月17日', '', '', '', '91110117306770905A', '', '专业承包；建筑物清洁服务；家庭劳务服务；销售厨卫用具（液化气钢瓶除外）、装饰材料、建筑材料、化工产品（不含危险化学品及一类易制毒化学品）、日用品、办公用品；技术开发及转让、技术推广与服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京天天有喜保洁服务有限公司是一家年轻、充满朝气、具有法人资格的专业性\r\n\r\n保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写\r\n\r\n字楼、娱乐场所等提供全方位的清洗保洁服务，销售检测维修灭火器等消防安全\r\n\r\n服务包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣\r\n\r\n工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清\r\n\r\n洗保洁服务。本公司采用专用清洁设备及清洁药剂，具备承揽大型工程所需的配\r\n\r\n套设施及施工能力，可以为不同领域客户提供全方位的满意服务。 作为北京消\r\n\r\n防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、\r\n\r\n高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具\r\n\r\n有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了\r\n\r\n良好的口碑。 科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是\r\n\r\n本公司信赖以发展的宗旨。本公司将继续以一流的质量、优惠的价格、周到热情\r\n\r\n的服务态度为广大客户提供更多、更好的清洁服务，并热诚欢迎社会各界朋友光\r\n\r\n临本公司洽谈业务。\r\n\r\n期待与你', '117.105101', '40.141105000000003', '117.105101', '40.141105000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3653', '北京世纪隆泽环保科技有限公司', '831', '马叶飞', '13522930304', '孙垚强', '13552775279', '2018年06月12日', '200万元', '北京市', '北京市', '丰台区', null, '北京市丰台区汽车博物馆东路1号院2号楼8层北座910', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区汽车博物馆东路1号院2号楼8层北座910', '', '烟道清洗', '有限责任公司（法人独资）', '2018年06月12日', '长期', '2018/8/1', '2019/7/31', '京消协（2018）证字251号', '91110106MA01CT5P9Q', '排油烟设施清洗机构', '技术推广服务、技术开发、技术咨询、技术转让；清洁服务；销售电子产品、建筑材料（不在实体店经营）、机械设备、金属材料、机电设备；农作物病虫害防治活动；大气污染治理；城市园林绿化服务；企业管理咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京世纪隆泽环保科技有限公司成立于2018年6月12日，主营业务是厨房设计，厨房设施设备维修、安装、改造、清洗。世纪隆泽拥有北京消防协会厨房烟道清洗资质。公司注册资金200万元，现有员工20人。公司拥有强大设备力量，公司拥有行业内最完备、最强大的专业设备；同时还拥有强大的维修技术力量。世纪隆泽工程师可以为客户提供各种排油烟设施、设备的维修和保养工作，服务质量最稳定、服务水平行业最优。', '116.300888', '39.827032000000003', '116.300888', '39.827032000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3654', '北京卓越恒美环保科技有限公司', '828', '王章兰', '010-89266506', '王章兰', '18210760332', '2012年02月29日', '160万元', '北京市', '北京市', '丰台区', null, '北京市丰台区太平桥西里甲一号塔楼东1-3幢103室', '北京市', '北京市', '大兴区', '青云店镇', '青云店小张本四海超市', '', '建筑防火,消防设施', '有限责任公司（自然人独资）', '2012年02月29日', '2042年02月27日', '', '', '', '91110106590614167b', '', '物业管理；专业承包；劳务分包；城市园林绿化；技术开发、技术服务、技术推广、技术咨询、技术转让；劳务服务；设计、制作、代理、发布广告；企业管理服务；物业管理；承办展览展示；企业形象策划；家居装饰；室内装饰工程设计；劳务服务；清洁服务；家庭服务；会议服务；组织文化艺术交流活动；汽车装饰；机械设备租赁；大气污染治理；汽车租赁（不含九座以上）；销售建筑材料、装饰材料、五金交电、化工产品（不含化学危险品）、金属材料、日用品、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京卓越恒美环保科技有限公司2012年02月27日成立，注册资金160万，注册号91131022mm0ckk6d6f，\r\n是一家综合性服务公司，  主要从事，物业装修施工  开荒保洁、清洗、日常保洁、别墅保洁、展会保洁、酒店地毯沙发窗帘清洗、水晶灯清洗、外墙清洗、地板打蜡、广告牌清洗，地毯清洗保养，石材翻新 结晶、瓷砖美缝、室内空气治理、等专项服务及日常托管服务，我公司既服务于各类商业企业，机关单位，建筑、装饰施工企业，同时也为千家万户提供优质、贴心的服务! 卓越恒美多年保洁经验、以优质的服务、合理的配置和专业清洁设备为客户创造着干净、整洁、舒适、愉快的清洁环境。本公司以科学的管理、合理的时间安排、敬业的保洁人员、严谨的工作程序和高标准的验收取得客户满意，已先后为多家单位提供了保洁服务，现和数十家单位建立了长期的合作伙伴关系。回顾多年来的发展历程，在全体员工精诚合作，勤俭创业的努力，\r\n卓越恒美公司专业严谨的队伍，周到细致热情的服务为您保驾护航，公司一直秉承以城市建设需求为核心，在专注北京本地市场开拓的同时，不断超越同行企业提供优质、用心的服务赢得了众多客户的信赖和好评，在北京地区', '116.312978', '39.885368999999997', '116.448869', '39.696635999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3655', '北京京安恒达消防安全设备有限公司', '827', '张齐', '18612897119', '张齐', '18612897119', '2015年04月14日', '300万元', '北京市', '北京市', '西城区', null, '北京市丰台区马连道卫强校村118号（万丰基业）D122室', '北京市', '北京市', '西城区', '广安门外街道', '北京市丰台区马连道卫强校村118号（万丰基业）D122室', '', '消防产品', '有限责任公司（自然人独资）', '2015年04月14日', '2035年04月13日', '2018/7/12', '2019/7/11', '京消协（2018）证字231号', '911101063397122690', '', '销售消防器材、交通设施、机械设备、五金交电、建筑材料、公共安全设备、电子产品、通讯器材；计算机系统服务；清洁服务；维修消防器材、机械设备；技术检测、技术服务、技术咨询；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京安恒达消防安全设备有限公司是专注于销售消防器材，交通设施，安防产品等行业的公司，并通过国家工商管理局注册成立的专业化的公司，成立于2015年04月14日，注册资本300万人民币元。公司坐落于北京市丰台区马连道卫强校村118号（万丰基业）D122室，北京京安恒达消防安全设备有限公司以规范、专业、创新、共赢的经营理念，高效贴心的服务，团结协作、敬业负责、服务奉献、求实进取的企业精神，始终贯彻以追求合作伙伴最大利益为目标，竭诚为合作伙伴提供最大程度的保障。我们将立志打造最精良的优秀团队，并为合作伙伴提供最优秀、最科学、最专业的服务，以获得合作者的信任和支持，打造属于我们自己的品牌。', '116.328334', '39.874490000000002', '116.328334', '39.874490000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3656', '北京同鑫鸿祥厨房设备有限公司', '826', '钱万俊', '13911237833', '钱万俊', '13911237833', '2014年05月13日', '1008万元', '北京市', '北京市', '东城区', null, '东花市南里东区15号楼-01层3-F01-02', '北京市', '北京市', '东城区', '东花市街道', '东花市南里东区15号楼-01层3-F01-02', 'AAA', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2014年05月13日', '2024年05月12日', '2019/2/27', '2020/2/26', '京消协（2019）证字074号', '91110101399007799X', '', '专业承包；销售厨房用具、五金交电（不含电动自行车）、建筑材料、机械设备；家居装饰；经济信息咨询；保洁服务；委托加工；维修电子产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京同鑫鸿祥厨房设备有限公司是一家集：开发、设计、生产、工程、清洗服务于一体的专业厨房设备生产和销售服务的企业，是国内最为专业的厨房设备整体解决方案的提供商之一。\r\n  \r\n 同鑫厨具，以市场需求为导向、以科技进步为动力、以雄厚的技术、资金实力为保障，积极吸取国内外同行业的先进经验，广泛征求用户意见，吸取科技人才，潜心专研各地烹调、饮食习惯，为客户提供完美的整体厨房解决方案。\r\n   \r\n公司自成立以来，同鑫厨具以独特设计思维、精益求精的生产工艺、细致专业的售后服务，成功为数家机关单位、酒店会所提供了高品质的厨房设备工程服务，得到了广大客户的褒奖与肯定。\r\n   \r\n同鑫厨具将秉承精益求精精神，采用行业最先进的生产设备及工艺，为客户做好每一个产品。确保同鑫厨具节能、高效、安全、环保。\r\n   \r\n同鑫鸿祥，秉承“精湛、精致、精密”的产品理念，始终坚持“专心、专业、专一”客户服务理念为每一位客户提供更加完善优质的服务。', '116.437769', '39.894409000000003', '116.437769', '39.894409000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3657', '北京恒远劳务服务有限公司', '822', '檀瑞莲', '13611311561', '夏强委', '13910221668', '2017年03月08日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区林河工业开发区顺仁路53号1幢3层3005室', '北京市', '北京市', '顺义区', '仁和地区办事处', '北京市顺义区林河工业开发区顺仁路53号1幢3层3005室', '', '烟道清洗,建筑防火,灭火救援,消防设施', '有限责任公司（自然人投资或控股）', '2017年03月08日', '2047年03月07日', '2018/7/6', '2019/7/5', '京消协（2018）证字217号', '91110113MA00CHKKXJ', '', '家庭服务；信息咨询（不含中介）；物业管理；保洁服务；害虫防治服务；机动车公共停车场管理服务；公共关系服务；会议服务；专业承包；劳务分包；城市园林绿化施工；房地产经纪业务；经济信息咨询（不含中介服务）；组织文化艺术交流活动（不含演出）；企业形象策划；摄影服务；劳务派遣（劳务派遣经营许可证有效期至2020年05月17日）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京恒远劳务服务有限公司是经北京市工商行政管理部门批准成立的服务公司。作为一民营企业，恒远自成立以来凭借着丰富的行业管理经验和专业的劳动技能，已树立起优良的服务管理形象，为客户提供着高标准的管理服务。\r\n我们主要服务对象为：高档写字楼、办公大厦、 政府办公楼、住宅、公寓、别墅、工业园区等；主要业务范围有：物业管理、公共区域管理、设备运行与维护、家庭服务、专业清洁服务、会议服务、专业承包、劳务分包、城市园林绿化施工服务、车场管理、害虫防治服务、经济信息咨询、劳务派遣等综合管理服务。', '116.66446000000001', '40.090966999999999', '116.66446000000001', '40.090966999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3658', '龙创蓝天（北京）科技有限公司', '821', '曹卫东', '13911708435', '高迪', '13911362356', '2016年03月31日', '4000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区青清商厦310', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区青清商厦310', '', '烟道清洗', '有限责任公司（法人独资）', '2016年03月31日', '2046年03月30日', '', '', '', '91110302MA04H0K97', '', '技术开发、技术转让、技术服务、技术咨询；大气污染治理；销售机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '龙创蓝天（北京）科技有限公司，主要从事餐饮油烟管道的清洗，以及油烟净化设备，主要公司内容请参见公司官网www.loch.com.cn。', '116.276751', '39.957428', '116.276751', '39.957428', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3659', '北京馨净界家政服务有限公司', '819', '刘秋杰', '13810010848', '高学明', '13311208977', '2010年08月30日', '10000万元', '北京市', '北京市', '大兴区', null, '景园北街2号60栋13层', '北京市', '北京市', '大兴区', '北京经济技术开发区', '景园北街2号60栋13层', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年08月30日', '长期', '', '', '', '92110114MA00F91R0H', '', '家政服务；清洁服务；劳务分包；商务咨询；物业管理；建筑装潢设计；技术转让、技术咨询、技术检测；城市园林绿化服务；设备安装、维修；健康咨询、健康管理（需经审批的诊疗活动除外）；企业管理咨询；企业形象策划；设计、制作、代理、发布广告；教育咨询（不含出国留学咨询及中介服务）；销售办公用品、酒店用品、卫生间用具；餐饮管理；施工总承包、专业承包；互联网信息服务；工程勘察；工程设计；道路货物运输。（企业依法自主选择经营项目，开展经营活动；“互联网信息服务”、道路货物运输、工程勘察、工程设计、施工总承包、专业承包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京馨净界家政服务有限公司成立于2010年，隶属于青岩集团旗下，是一家专注于家政保洁技术整合研发以及一站式服务的专业公司。青岩集团是集安保服务、物业管理、水利工程、家政保洁，室内环保，劳务派遣、文化传媒、旅游开发、安全防范、高新技术等多元化企业发展集团。旗下子公司有中警保安服务有限公司、北京天成浩泰物业管理有限公司、北京馨净界家政服务有限公司，北京六合春天劳务服务有限公司、北京安顺祥园林绿化有限公司、北京六合停车管理有限公司。\r\n馨净界家政服务有限公司深耕家政保洁领域多年，形成了以工程保洁、空气治理为核心，家电清洗、生活管家、家庭保洁等为辅助，涉及全服务链几十种业务板块的一站式专业保洁商业模式，如今已经与众多政府机关单位及大型物业合作，提供保洁相关服务，致力于为中国四亿家庭和物业提供温馨、洁净、健康的空间环境。', '116.520768', '39.779336000000001', '116.520768', '39.779336000000001', '', null, null, null, null);
