INSERT INTO `t_fc_company` VALUES ('3661', '北京东方盛辉消防器材有限公司', '816', '李剑辉', '13601237637', '李剑辉', '13910112972', '2006年02月20日', '310万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区左家庄15号4号楼8108室', '北京市', '北京市', '朝阳区', '左家庄街道', '北京市朝阳区左家庄15号4号楼8108室', '', '消防产品', '有限责任公司（自然人投资或控股）', '2006年02月20日', '2026年02月19日', '2018/5/11', '2019/5/10', '京消协（2018）证字117号', '911101057855329542', '', '销售消防器材、建筑材料、金属制品、化工产品（不含危险化学品）；维修消防器材；清洁服务（不含餐具消毒）。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '公司拥有一批多年从事消防维修器材等实践经验丰富的工程技术人员和管理人员，并具有公安部、北京市消防局认可的资质。我公司拥有雄厚的科技人才基础、扎实的施工技术力量、丰富的管理队伍、科学严谨的质量保证体系、先进的施工技术设备。我公司与中国科学院、首都机场、中国电信、中国火箭运载研究院、国贸中心等几百家知名企业先后签订了消防器材维修销售协议，并得到了客户的广泛赞誉。', '116.44365000000001', '39.952621999999998', '116.44365000000001', '39.952621999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3662', '北京柔兴兴消防器材有限公司', '815', '于占江', '13901023297', '杨洁', '13810060758', '1999年06月02日', '50万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区开放路113号', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '北京市怀柔区开放路11号', '', '消防设施', '有限责任公司（自然人投资或控股）', '2002年04月26日', '2052年04月25日', '2018/6/15', '2019/6/14', '京消协（2018）证字191号', '911101167002672917', '', '销售、维修消防器材；销售五金交电(不含电动自行车)、化工（不含危险品、剧毒品）、建筑材料、金属材料、日用百货、计算机软、硬件及外国设备、针纺织品、工艺品、服装鞋帽、安全技术防范产品、通讯设备（不含卫星地面接收、发射设备）、电子产品、仪器仪表、办公用品；经济信息咨询；技术开发、咨询、服务；专业承包；普通货运。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司经北京市公安局消防局审核批准于1995年3月成立，名称为北京柔兴兴消防器材有限公司，注册资本50万元，法定代表人于占江，经营场所为怀柔区开放路113号，企业建筑面积为150平方米。', '116.644119', '40.333708000000001', '116.64426400000001', '40.326053000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3663', '北京恒安保洁有限公司', '813', '曾新顺', '13691143767', '曾新顺', '13691143767', '2011年12月01日', '50万元', '北京市', '北京市', '海淀区', null, '北京市海淀区西郊北洼路1区195幢2层142', '北京市', '北京市', '海淀区', '东升地区办事处', '北京市海淀区西郊北洼路1区195幢2层142', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年12月01日', '2031年11月30日', '2019/3/6', '2020/3/5', '京消协（2019）证字081号', '91110108587694469N', '', '建筑物清洁服务；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京恒安保洁有限公司专注建筑物清洁服务；厨房排烟系统的清洗及维护；房屋的清扫、消毒；', '116.340112', '40.042085999999998', '116.340112', '40.042085999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3664', '北京通聚鑫科贸有限公司', '812', '齐自林', '18600390079', '齐云', '13501121650', '2006年11月07日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧宫镇世界之花C3公寓1106', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧宫镇世界之花C3公寓1106', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年11月07日', '2026/11/6', '2018/10/30', '2019/10/29', '京消协（2018）证字351号', '91110106795996875P', '排油烟设施清洗机构', '技术开发、服务、转让；电脑图文设计；会议服务(不含食宿)；保洁服务；接受委托提供劳务服务；销售五金产品（不含电动自行车）、家用电器、电子产品、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司自2006年成立至今，目前公司有各类职员53人，一一流的服务、先进的技术、严格的管理为众多客户提供优质的服务，在同行业中树立了专业化清洁公司的典范，成为活跃在北京市高智能综合大厦、写字楼、小区、工厂、学校、酒店、饭店清洁服务的尖兵。\r\n集开发、生产、销售清洗保洁产品，承接清洗工程，从事保洁服务，开展技术培训及连锁服务于一体的现代型保洁公司\r\n不懈努力、不懈追求是本公司永葆活力的源泉；科学灵活的经营管理是本公司成功的保证；客户至上，信誉第一，奉行诚信服务是本公司赖以发展的宗旨。\r\n在签订合同的同时，以双方认可的样板为基础，互惠互助的合作达成协议，以客户满意为验收标准。员工实行统一管理、统一形象、统一培训并注重企业形象\r\n所有上岗员工均经过严格的培训和考核，紧跟世界清洁技术发展潮流，引进先进的清洁设备、清洁用品及先进的清洁保养理念，更加重视对每位员工的素质培养，从礼节礼貌到规范化清洁作业，掌握和使用新型建材维护技术等诸多方面对员工进行职业培训教育，从而实现全面整体的系统化管理。\r\n拥有一流的机械设备，进口高效清洁剂，倡导星级保洁。洗涤机，抛光机，吸尘器，吸水机，烘干机，干洗机等均为进口产品。', '116.420473', '39.819048000000002', '116.420473', '39.819048000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3665', '北京绸缪消防科技有限公司', '809', '赵秀敏', '13520992321', '张中华', '13601297694', '2016年08月26日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区石楼镇吉羊村北一区54号', '北京市', '北京市', '房山区', '城关街道', '北京市房山区城关科技产业园', '', '宣传教育培训,消防设施', '有限责任公司（自然人独资）', '2016年08月26日', '长期', '2018/5/3', '2019/5/2', '京消协（2018）证字100号', '91110111MA007WPM1G', '', '技术开发、技术服务、技术推广、技术咨询（中介除外）、技术转让；技术检测；销售消防设备、电气设备；维修消防设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京绸缪消防科技有限公司主要经营：技术开发、技术服务、技术推广、技术咨询（中介除外）、技术转让。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）等产品。公司尊崇“踏实、拼搏、责任”的企业精神，并以诚信、共赢、开创经营理念，创造良好的企业环境，以全新的管理模式，完善的技术，周到的服务，卓越的品质为生存根本，我们始终坚持用户至上 用心服务于客户，坚持用自己的服务去打动客户。', '115.998057', '39.621547999999997', '115.983724', '39.688724999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3666', '辰安天泽智联技术有限公司', '808', '王宇', '13301168378', '李振铎', '18500425913', '2018年08月20日', '5000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区丰秀中路3号院1号楼4层101-408', '北京市', '北京市', '海淀区', '西北旺地区办事处', '北京市海淀区丰秀中路3号院1号楼4层101-408', '', '消防信息化', '其他有限责任公司', '2018年08月20日', '长期', '', '', '', '91340111MA2T0EPN2J', '', '计算机软硬件、消防产品、安防产品、物联网产品设计、开发、生产（限分支机构）、销售、技术服务、安装、维修、咨询、代理、租赁；信息系统及网络系统开发、设计、集成、运维管理；信息安全服务；电信业务代理、增值电信业务；数据采集、存储、处理；电子商务技术服务；电子系统工程、建筑智能化工程、建筑装饰装修工程、机电设备安装工程、工业安全与消防工程、公共安全防范系统及工程的咨询、评估、设计、施工、配套服务；工程图纸审核；安全评价及技术咨询；消防设施、电气防火系统、安防系统维护、保养、检测；消防安全评估与咨询；公共安全技术成果转让、技术咨询；企业管理、商务咨询；物业服务；国内广告设计、制作、发布、代理；机械设备、房屋、车辆租赁；保险事务代理；自营和代理各类商品和技术的进出口业务（但国家限定企业经营或禁止进出口的商品和技术除外）。（依法须经批准的项目，经相关部门批准后方可开展经营活动）', '辰安天泽智联技术有限公司依托清华大学公共安全研究院的专家力量和领先技术，为智慧城市公共安全体系建设提供专业的解决方案和产品服务，助力构建动态化、立体化、精细化的消防安全监管及风险防控体系；以消防安全管理为切入点，整合产业链资源，综合运用物联网、大数据、云计算等新兴IT技术，创新运营机制、服务模式和产业业态，构建基于消防工作结果为保证的消防社会化服务体系，提升消防安全综合管理、应急指挥能力和城市火灾防控及灭火救援效能，为我国公共安全发展贡献力量，为人民安居乐业和经济发展保驾护航!', '116.2379', '40.075918999999999', '116.2379', '40.075918999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3667', '北京宝仑工贸有限公司', '807', '杨亚超', '13901327774', '陈金', '13501033552', '2007年04月25日', '5000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区槐房西路316号院二号楼三层3001室', '北京市', '北京市', '丰台区', '南苑街道', '北京市丰台区槐房西路316号院二号楼三层3001室', '', '消防产品', '有限责任公司（自然人投资或控股）', '2007年04月25日', '2027年04月24日', '', '', '', '91110106661569632Q', '', '销售厨房用具、家具、文具用品、五金交电（不在实体店经营、不含电动自行车）、日用品、针纺织品、电子产品、通讯设备、建筑材料（不在实体店经营）、工艺美术品、机械设备；技术开发、技术咨询；施工总承包；专业承包；房地产开发；劳务分包；物业管理；投资管理；机械设备租赁；设计、制作、代理、发布广告；组织文化艺术交流活动；园林绿化服务；工程造价服务；工程设计；汽车租赁（不含九座以上客车）；企业管理咨询；清洁服务；食品、饮料、酒及茶生产专用设备制造（限外阜经营）；农副食品加工专用设备、商业、饮食、服务、专用设备制造（限外阜经营）；餐饮服务用机械、环境保护专用设备制造（限外阜经营）；不锈钢厨房设备生产、制造。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。', '北京宝仑工贸有限公司位于北京市丰台区，厂房位于河北省涿州市开发区，地理位置优越，是一家集开发生产及工程设计、制造和安装服务为一体的综合化厨房设备制造企业，同时代理经销“MEIKO、HOBART、Electrolux、FAGOR、VOLLRATH、ZANUSSl、SANYO等世界多种名牌厨具，几年来一直占据厨具行业的领先地位。\r\n宝仑秉承“发展不忘稳健、服务必尽忠诚”的企业宗旨和“质量第一、顾客至上”的经营方针，运用先进的现代化设备和管理手段，建立了严格的质量保证体系和核心技术之产品研发体系，为您选购系列化产品提供了保证；本公司拥有雄厚的工程技术力量和新业务为承接国内外现代化酒店之厨房工程，并配套生产所配套之设备用具，据客户需要，进行特殊的专业设计和整体布局，为客户提供尽善尽美的服务。', '116.36939700000001', '39.808081000000001', '116.36939700000001', '39.808081000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3668', '北京顾友环保科技有限公司', '806', '吕淑萍', '13910507275', '李博乔', '18910984024', '2017年09月07日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区万芳园一区1号楼1层104', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区万芳园一区1号楼1层104', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年09月07日', '长期', '2018/5/3', '2019/5/2', '京消协（2018）证字096号', '91110106MA017DQQXY', '', '技术开发、技术服务、技术咨询、技术转让；数据处理；基础软件服务；应用软件服务；计算机系统集成；家庭劳务服务；建筑物清洁服务；礼仪服务；家用电器维修；设计、制作、代理、发布广告；经济信息咨询；销售通信设备、金属材料、日用品、化妆品、服装、蔬菜、水果、未经加工的干果、文具用品、体育用品、计算机、软件及辅助设备、体育运动项目经营（高危险运动除外）；物业管理；销售食品；互联网信息服务。（企业依法自主选择经营项目，开展经营活动；互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京顾友环保科技有限公司从事专业化保洁服务项目。我们采用进口设备、环保清洁用品、科学管理，由专业保洁技师指导施工。拥有一支技术和作风过硬的保洁团队，注重现代化的安全管理与提高员工素质相结合。我们地处丰台区，服务面向全北京，服务宗旨：以诚挚的爱心服务于客户，以高质量的服务奉献于客户，以忠诚的服务取信于客户，经过坚持不懈的努力，北京顾友环保科技有限公司现已占据北京市部分服务市场，还将业务逐步向全国扩展，公司以热诚的服务赢得了客户的认可，竭诚为客户服务。', '116.32023599999999', '39.847566999999998', '116.32023599999999', '39.847566999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3669', '北京华信恒泰建设工程有限公司', '805', '李立威', '13910327281', '刘丽', '13331137119', '2018年09月20日', '5000万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号-A1376', '北京市', '北京市', '丰台区', '南苑街道', '北京市丰台区中福丽宫品牌基地5号楼208室', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2018年09月20日', '2038年09月19日', '2019/2/27', '2020/2/26', '京消协（2019）证字062号', '91110111MA01EQXY3X', '', '工程勘察；工程设计；施工总承包；专业承包；劳务分包；家庭劳务服务；工程管理服务；家居装饰；工程招标代理；工程造价咨询、工程技术咨询（中介除外）；技术服务、技术检测；园林绿化服务；园林绿化设计；租赁、维修机械设备；销售消防设备、机械设备、空调制冷设备、电器设备、通讯设备（卫星接收设备除外）、电子产品（电动自行车除外）、日用杂品、办公用品、苗木、花卉、采暖设备、建筑材料、装饰材料、保温材料、金属材料、门窗、五金交电（不含电动自行车）；维修消防设备。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华信恒泰建设工程有限公司（以下简称公司）成立于2018年09月20日，是依法在北京市工商管理局注册的具有独立法人地位的公司。\r\n我公司拥有一批老中青相结合的技术骨干，具有国家中级专业技术职称和中专以上学历的技术人员占职工总数的75%以上，公司共有19人，设总经理1名、检测队长1名（高级消防员）、检测员2名（中级消防员）、技术负责人6名（一级消防工程师）、施工负责人2名（二级建造师）、办公室人员4名、财务人员3名。从事检测的人员均经培训考核合格，持证上岗。\r\n公司的主要业务是：主做电气防火技术检测、建设消防设施检测。\r\n公司现有仪器23台（套）：感烟、感温探测器功能试验装置、数字微压计、风速仪、声级计、照度计、一般压力表、红外热像仪、辐射温度计、钳形接地电阻测试仪、钳形表、插座测试仪、微差压测试仪、数字多用表、钳形表、超声波流量计、手持式激光测距仪、电子秒表、游标卡尺、钢卷尺、电笔、数字温湿度计、线型光束感烟探测器减光片。设备齐全、先进，状态完好并检定/校准，能够满足检测工作的需要。', '116.137918', '39.721812999999997', '116.354809', '39.808247999999999', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3670', '北京金鑫盾消防安全科技有限公司', '801', '祝钦锋', '83811826', '李冰', '1885611959', '2010年05月05日', '990万元', '北京市', '北京市', '丰台区', null, '北京市丰台区马家堡路180号6层658', '北京市', '北京市', '丰台区', '大红门街道', '北京市丰台区马家堡路180号6层658', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2010年05月05日', '2030年05月04日', '2019/2/27', '2020/2/26', '京消协（2019）证字066号', '91110106554853654T', '电气防火检测技术服务机构', '技术检测、技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京金鑫盾消防安全科技有限公司是依法注册的法人机构，组建于2010年，于2018年11月通过北京消防局正式一级资质评审，是北京首批拥有正式一级资质单位，现有员工50人，其中一级消防工程师10人，高级消防员2人，中级消防员10人，电工6人。公司以消防和电气检测、消防维护保养业务为主，并拥有先进的试验检测设备，如红外测温仪、普通钳形电流表、漏电电流测试仪、喷水实验装置、谐波分析仪、火灾模拟实验装置，对计量仪器设备定期检定，仪器设备完好率达100%，量值传递精确。公司还配备了现代化办公设备电脑，实现了电脑化管理，全面实现信息化办公。为了保证试验的准确性、公正性，我公司严格按照“公司严格公司和检查机构资质认定管理办法”和“公司资质认定评审准则”有关各项计量检测的有效法规、标准等的要求，建立了科学完善的管理体系，制订了一系列严密的规章制度，使公司的质量管理水平和整体实力进一步提高。', '116.379614', '39.834924000000001', '116.379614', '39.834924000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3671', '北京天城环保科技有限公司', '800', '李红云', '17611282890', '陈效芸', '18810591629', '2015年07月24日', '5000万元', '北京市', '北京市', '延庆区', null, '北京市延庆区延庆经济开发区百泉街10号3栋162-1室', '北京市', '北京市', '东城区', '和平里街道', '北京市西城区安德路112号132室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年07月24日', '2065年07月23日', '', '', '', '91110229351274265M', '', '技术开发、技术转让、技术咨询、技术服务；计算机系统集成服务；环境治理；销售化工产品（不含危险化学品及一类易制毒化学品）、五金交电（不含电动自行车）、家用电器、金属材料（不含电石、铁合金）、厨具卫具、机械设备、电气设备、计算机、软件及辅助设备（不含计算机信息系统安全专用产品）、专用设备、电子产品、玩具、文化用品、体育用品（不含弩）、通讯设备；货物进出口、技术进出口、代理进出口；清洁服务（不含餐具消毒）；电脑图文设计、制作；设计、制作、代理、发布广告；教育咨询（涉及文化教育、培训的除外）；组织文化艺术交流活动（不含演出）；专业承包。（企业依法自主选择经营项目，开展经营活动；专业承包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天城环保科技有限公司，致力于北京蓝天保卫战相关环保项目，包括“煤改电”、“低氮改造”、“油烟净化”、“空气治理”等项目。控股母公司基石能源同时开展公建项目智慧能源、节能改造和能源托管及投资运营。\r\n●  基石能源愿景\r\n采用新的商业模式、成熟的技术设备和现代产业互联网技术（智慧供热），立志成为受人尊重的供热（制冷）系统投资建设运营商。\r\n● 基石能源理念\r\n汇聚专业------整合行业上下游各个专业TOP1-3单位，让专业的人干专业的事，建设运营管理最优质的能源系统。\r\n随心所享------不忘初心，结合产业互联网技术（智慧能源），为每一位用户提供可感知、规范化、舒适性的能源服务。\r\n● 基石能源价值观\r\n以人为本 客户为王  结果为王  发展为王    \r\n●业务分布\r\n基石能源：供热(BOT)、节能改造、能源托管。\r\n天城环保：油烟净化、空气治理、低氮改造、煤改电等', '115.983285', '40.440911', '116.38776', '39.950436000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3672', '北京茂鑫源物业管理服务有限公司', '799', '杨松林', '13801031472', '王辉', '13501156246', '2007年09月26日', '1001万元', '北京市', '北京市', '朝阳区', null, '旧宫镇小红门路西11幢平房-2号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '旧宫镇小红门路西11幢平房-2号', '', '烟道清洗', '有限责任公司（自然人独资）', '2007年09月26日', '2027年09月25日', '2019/2/27', '2020/2/26', '京消协（2019）证字078号', '91110115666926061C', '', '物业管理；家政服务（中介除外）；保洁服务；家居装饰；经济贸易咨询；劳务分包；劳务服务；技术开发、转让、咨询、服务；维修家用电器；销售家用电器、文化用品；心理咨询；组织文化艺术交流活动（不含演出）；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京茂鑫源物业管理服务有限公司注册资金1001万，是北京市政府采购服务单位，并于2018年取得ISO9001质量管理体系认证、ISO18001职业健康安全管理体系认证证书、ISO14001环境管理体系认证、AAA级信用等级证书、政府采购优秀供应商、AAA级重合同守信用证书、AAA级质量服务信誉证书、AAA级资信等级证书、AAA级诚信经营示范单位证书，公司坚持规范管理，特色服务，严控质量。主营业务分为保洁服务、物业服务管理及家政服务三大板块，业务范围涵盖：企事业单位、小区、大厦、酒店的常年保洁托管业务、大型建筑外墙清洗、油烟管道清洗，地毯清洗、地面清洗、石材翻新养护、大理石结晶、地板打蜡、展会保洁、日常保洁、物业管理服务、园林绿化工程、城市垃圾分类、物业保洁、企事业单位空调维修、企事业单位装修、开荒保洁、工程开荒等。', '116.458065', '39.836711000000001', '116.458065', '39.836711000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3673', '北京鸿泽达科技有限公司', '798', '李小红', '13911815472', '韩浩', '13811583344', '1999年09月23日', '200万元', '北京市', '北京市', '海淀区', null, '北京市海淀区长智路5号长运财智会馆329室', '北京市', '北京市', '海淀区', '紫竹院街道', '北京市海淀区长智路5号长运财智会馆329室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1999年09月23日', '2019年09月22日', '2019/3/6', '2020/3/5', '京消协（2019）证字083号', '911101087187008828', '', '技术开发、转让、咨询、服务、培训；信息咨询（除中介服务）；提供劳务服务；装饰设计；承办展览展示；组织文化艺术交流活动；零售百货、五金交电（不含电动自行车）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是国内首家专业清洗公司，自1984年以来为全国大小用户近百家排忧解难，为人民大会堂、钓鱼台宾馆、中央电视台、人大会议楼、科技部、铁道部等单位解决了重大疑难问题，包括循环水系统、热交换系统、供暖系统、空调风道系统及管道系统、厨房设备等。长期为各大机关单位进行清洗服务，以严谨的工作作风，可靠的质量和周到的服务与客户建立了良好的关系。\r\n随着市场发展的需要，于1999年9月又注册了北京鸿泽达科技有限公司，并从日本羽田公司引进了ECO-GEM电气石物理防垢、防锈技术，可以胜任各类设备的防垢、防腐蚀于清洗工作。', '116.30150999999999', '39.942712999999998', '116.30150999999999', '39.942712999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3674', '北京蓝箭消防设备有限公司', '797', '李涛', '18611751986', '李涛', '18611751986', '2011年02月28日', '218万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡昌宏西路翠柳东街1号-1737', '北京市', '北京市', '房山区', '西潞街道', '北京市房山区良乡昌宏西路翠柳东街1号-1737', '', '消防产品', '有限责任公司（法人独资）', '2011年02月28日', '2061年02月27日', '2018/5/22', '2019/5/21', '京消协（2018）证字146号', '91110111569460933N', '', '销售消防器材、计算机软硬件及辅助设备、机械设备、建筑材料、装饰材料、五金、交电、化工产品（不含危险化学品）；技术开发、技术咨询（中介除外）、技术转让、技术服务。(依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。)', '北京蓝箭消防设备有限公司，是经国家批准注册生产、研发、安装为一体的高新企业公司，产品由北京市消防科学研究所和本公司联合开发研制生产。公司专业生产的厨房自动灭火设备是根据国外发达国家标准设计、制造并结合国内相关标准要求的产品，该产品通过《国家固定灭火系统和耐火构件质量监督检验中心》检测合格和国家权威部门监督检验合格。早已投入批量生产，通过实践与用户反馈，该装置性能和市场占有率遥遥领先于国内外产品。公司始终重视产品质量，以高质量的产品、良好的信誉树立了“北京蓝箭”消防设备的优秀品质，产品销售和服务网络遍布全国，凭借高新的技术，实惠的价格，完善的售后服务体系赢得了广大客户的信赖和推崇。厨房自动灭火设备，是厨房灶台及排烟设备必备的灭火系统，可广泛用于宾馆、饭店、机关单位、医院、学校、大型超市等场所的厨房操作间的消防保护，该装置可对灶具设备、排烟系统和排烟管道实施自动监控灭火，并具有切断燃气阀和自动喷洒冷却水降温的功能，为使用者提供了高效、安全、可靠、有保障的工作环境，赢得了用户的信赖和权威部门的认可。', '116.127313', '39.726514999999999', '116.127313', '39.726514999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3675', '北京海文博瑞科技有限公司', '796', '陈文群', '18910279065', '宋加宏', '13311398330', '2015年01月30日', '100万元', '北京市', '北京市', '顺义区', null, '高丽营镇文化营村北（临空二路1号）', '北京市', '北京市', '顺义区', '高丽营镇', '高丽营镇文化营村北（临空二路1号）', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年01月30日', '长期', '', '', '', '91110113330299164T', '', '技术开发、技术服务、技术咨询、技术转让；信息咨询（不含中介服务）；企业管理咨询；维修制冷设备；零售机械设备及配件、电子产品；安装、维修机械设备（不含特种设备）；专业承包；清洁服务（不含餐具消毒）；保洁服务；水污染治理；接受委托提供劳务服务（不含对外劳务合作、排队服务、代驾服务）；设计、制作、代理、发布广告；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京海文博瑞科技有限公司成立2015年，公司主营业务是中央空调设备安装、维护、维修保养、水处理和通风管道清洗全系列服务；厨房设施设备安装、维修、托管、清洗服务；楼宇保洁服务、下水管网疏通服务等。\r\n       公司成立以来，一直秉承诚信、敬业、高效、创新的发展原则，一直遵循“以人为本，诚信至上；规范管理,专业服务；开拓市场，惠及于民的企业宗旨，发扬团结务实开拓创新的企业精神，树立了\"同舟共济，团结合作；爱岗敬业，文明服务\"的服务理念。“做中国酒店业、餐饮业、物业公司最大、最专业、最诚信的设备、设施外包服务承接商”是我们的使命。荣誉在身我们继续努力，责任在肩我们一刻不停，为您、为社会，为我们的使命，“海文博瑞”一路前行。\"', '116.578569', '40.170088', '116.578569', '40.170088', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3676', '北京优锘科技有限公司', '795', '马烈', '010-84914126', '杨阳', '13810924284', '2012年04月19日', '6618.5601万元', '北京市', '北京市', '昌平区', null, '北京市海淀区建材城西路50号2号楼二层280室', '北京市', '北京市', '朝阳区', '望京街道', '北京市朝阳区花家地北里14号楼北京国际画材中心5层', '', '消防信息化', '有限责任公司（自然人投资或控股）', '2012年04月19日', '2032年04月18日', '', '', '', '91110108593809883R', '', '技术开发、技术推广、技术转让、技术咨询、技术服务、技术培训；计算机系统集成；软件开发；货物进出口、技术进出口、代理进出口；销售自行开发后的产品、计算机、软件及设备、电子产品、五金交电、金属材料、机械设备、通讯设备；数据处理；应用软件服务、基础软件服务；承办展览展示活动；产品设计；租赁计算机；经济贸易咨询；第二类增值电信业务中的信息服务业务（仅限互联网信息服务）（互联网服务不含新闻、出版、教育、医疗保健、药品和医疗器械、电子公告服务）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京优锘科技有限公司致力于以DigitalTwins的理念提供新一代智能可视管理平台，实现对万物互联的数字化世界的可视化、智能化、人性化、众创化的创新管理，是IT智能管理和IoT物联网可视化管理领域的领导厂商。\r\n优锘科技的技术团队由来自IT管理软件和计算机图形两个领域的顶尖专家组成，专注于用户交互方式的不断创新，以“让人们更好的认知和管理数字化新世界”为企业愿景，自主创意并研发了世界上首款专业的IT智能可视运营平台Tarsier和新一代物联网可视化PaaS平台ThingJS。凭籍前瞻的战略眼光、超强的技术实力和跨界的创新理念，优锘科技已经成为中国成长最快的数据可视化管理软件厂商。\r\n 优锘科技的可视化管理软件平台受到市场的关注和欢迎，至今为止已经在四百余家中国大中型客户的企业IT部门和数据中心部署使用，是目前市场上应用最广泛、使用最普及的智能可视化管理平台。', '116.333341', '40.056766000000003', '116.465064', '39.985365000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3677', '北京嘉信邦科技有限公司', '794', '李国忠', '18611156143', '陈婷', '18510908596', '2017年08月23日', '100万元', '北京市', '北京市', '怀柔区', null, '雁栖经济开发区乐园大街38号', '北京市', '北京市', '怀柔区', '北京雁栖经济开发区', '雁栖经济开发区乐园大街38号', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年08月23日', '长期', '', '', '', '91110116MA00HCXE70', '', '技术开发、服务、咨询、转让、推广；专业承包、劳务分包、施工总承包；物业管理；建筑物清洁服务、办公室保洁服务、机械设备专业清洗服务；城市园林绿化；组织文化艺术交流活动（不含演出）；会议服务；婚庆服务；旅游信息咨询；企业管理咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京嘉信邦科技公司是原一家消防设施工程专业承包壹级资质，可承担火灾自动报警及联动系统、消防广播系统、消防水喷淋系统、消火栓系统、气体灭火系统的设计、施工、申报、验收、物业管理、技术开发、技术转让等一条龙服务及技术服务、专业承包服务为一体的服务性公司；现更名为嘉信邦，长期以来，以“顾客第一、诚信为本、高效求实，稳步发展”的经营理念为宗旨，销售和维修、维保及机电、消防工程、安保系统安装劳务为主，开拓发展了厨房烟囱排油烟道、外墙清洗、石材保养、厨具设备清洗及空调清洗业务。\r\n  公司服务员工都通过消防安装，维保、烟道设备清洗、高空作业等方面的专业技能培训,同时还要进行从业道德、服务质量、安全第一等意识方面的培训，通过考核后方可上岗。\r\n  公司具有完善的工作管理制度和安全操作制度,制订了规范的工序操作流程。同时，拥有经过专业培训的作业人员以及全套优质设备,各项服务收费合理，能为客户提供安全、规范和满意的消防设备安装维保、烟道清洗、建筑物清洗、石材维护等服务。\r\n   公司全体员工本着勤奋务实的拼搏精神、真诚热情的服务态度 、严禁的工作作风,赢得了同业界和广大客户的赞誉,公司已发展成为了北京地区安全', '116.672111', '40.345101999999997', '116.672111', '40.345101999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3678', '北京江山诚信消防器材有限公司', '792', '严朝德', '13601208108', '严恒', '18257130067', '2001年08月27日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡半壁店村315号', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高碑店乡半壁店村315号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2001年08月27日', '2019年08月26日', '', '', '', '91110105X003848684', '', '专业承包；销售消防器材、日用品、五金交电、机械设备、电子产品、建筑材料、通讯设备、计算机、软件及辅助设备；维修消防器材；技术推广服务；清洁服务（不含餐具消毒）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京江山诚信消防器材有限公司创建于1996年，坐落于北京市朝阳区王四营乡道口村白鹿司东路8号，占地面积500多平方米，注册资金1005万元，主要销售和维修消防器材，技术咨询，年营业额达到5000多万元，是经北京市消防局核准备案的消防专业公司，是北京市消防协会的会员单位，也是北京市铁路局指定维修厂家之一。\r\n本公司是公安部消防局定点销售，维修消防器材及清洗烟感探测器及其它设备的专业公司，销售和检修各类手提、推车式灭火器、干粉灭火器、泡沫灭火器、二氧化碳灭火器、销售成套的消防水带系统、灭火器箱，各类防火标牌。应急照明装置等产品，是消防企业的重要骨干企业，公司可通过登入北京消防局网站----点击（北京市消防技术服务机构和执业人员备案系统）即可搜索到我公司在消防局网上的备案记录。公司主要销售的灭火器有（紫金山牌灭火器、神龙牌灭火器、天坛牌灭火器，姚江牌灭火器）\r\n公司坚持持续发展战略，“诚信高效，质量为本”是我公司一直坚持的宗旨，“更好的产品，更好的服务”是我公司一直遵循的质量方针，公司建立了完善的质量保证体系，以确保公司产品及服务质量，随时愿意为您提供全方位的服务。', '116.519852', '39.896245999999998', '116.519852', '39.896245999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3679', '北京洁帮盛世启峰环保科技有限责任公司', '790', '崔海峰', '17611388618', '邵世杰', '17600359518', '2019年04月12日', '1000万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区庙城镇庙城村临300号401室', '北京市', '北京市', '丰台区', '太平桥街道', '吴家场路1号盛今佳园3号楼', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年04月12日', '长期', '2018/4/25', '2019/4/24', '京消协（2018）证字089号', '91110116MA01JEEGXR', '', '技术推广、技术开发、技术咨询、技术转让、技术服务；软件开发；设计、制作、代理、发布广告；计算机系统服务；家庭劳务服务；办公室清洁服务；建筑物清洁服务；施工总承包、专业承包、劳务分包；销售电子产品、计算机、软件及辅助设备、办公设备、日用品、机械设备、家用电器、金属制品；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京洁帮盛世启峰环保科技有限责任公司 简介北京洁帮盛世启峰环保科技有限责任公司成立了于2019年4月12日注册资金1000万元，我公司是一家以环保设备销售、环保产品开发、环保技术推广咨询为主，同时涉足厨房设备清洁服务及制冷设备、机械设备、五金交电销售等多产业的综合性科技服务企业。 我公司自成立以来，先后引进国内先进的环保设备、环保材料及清洁设备，公司秉承着“专业、诚信、值得信赖”的服务于北京市大中性企业，政府行政单位，为客户提供多方案的同时，提供专业化、个性化、全天候、全方位的服务。', '116.639351', '40.293089999999999', '116.307547', '39.894184000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3680', '北京芸众缘咨询服务有限公司', '788', '李宏', '13811020995', '李宏', '13811020995', '2016年10月10日', '210万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区百子湾西里402号楼12层1212', '北京市', '北京市', '昌平区', '小汤山镇', '北京市昌平区小汤山工业区北侧流西路', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年10月10日', '2046年10月09日', '2019/1/11', '2020/1/10', '京消协（2019）证字013号', '91110105MA008N7J3F', '', '企业管理咨询；物业管理；餐饮管理；经济贸易咨询；市场调查；公共关系服务；企业策划；会议及展览服务；销售日用品、厨房用具；酒店管理；技术咨询；技术转让；技术服务；技术推广；组织文化艺术交流活动（不含演出）；清洁服务（不含餐具消毒）；工程勘察设计；劳务派遣（劳务派遣经营许可证有效期至2019年12月18日）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京芸众缘咨询服务有限公司主要业务包括：企业管理咨询；物业管理；餐饮管理；经济贸易咨询；市场调查；公共关系服务；企业策划；会议及展览服务；销售日用品、厨房用具；酒店管理；技术咨询；技术转让；技术服务；技术推广；组织文化艺术交流活动（不含演出）；清洁服务（不含餐具消毒）；工程勘察设计；劳务派遣等。\r\n“芸众缘”人凭借业内多年丰富的行业经验，致力于把公司打造成为国内最具有竞争实力的企业。按照“品牌至上、市场至尊；技术为本、服务为魂”经营理念。提出创造服务型、知识型、专业型的企业定位。全面构建人性化、制度化、科技化、终身学习的、创新的、可持续的发展企业文化。\r\n    “芸众缘”人学习国际先进行业经验和专业知识的同时，从中国市场的需求出发，为客户量身订制个性化、多样化、本土化的业务整体解决方案。依据客户市场定位和企业的特点，满足国家机关、部队、医院、院校、大厦、酒店、餐饮企业的需要。给客户提供专业化的增值性的服务。\r\n    “芸众缘”人秉承“诚信是根、专业是本，服务是魂”的核心服务理念，倡导差异化服务，不断扩大创新服务内涵。', '116.49472799999999', '39.894778000000002', '116.475944', '40.183442999999997', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3681', '北京鑫诚吉顺科贸有限公司', '787', '张志国', '13911084906', '张彦辉', '18519888781', '2007年03月16日', '50万元', '北京市', '北京市', '通州区', null, '北京市通州区永顺镇乔庄村商业街69号', '北京市', '北京市', '通州区', '玉桥街道', '北京市通州区永顺镇乔庄村商业街69号', '', '烟道清洗,建筑防火,消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2007年03月16日', '2027年03月15日', '2018/3/20', '2019/3/19', '京消协（2018）证字1044号', '91110112799982278Q', '排油烟设施清洗机构', '技术推广服务；安装、维护制冷设备；清洗通风管道；货运代理；装饰设计、组织文化艺术交流（不含棋牌）、信息咨询（不含中介服务）；销售五金交电、制冷设备、其他日用品、其他机械设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京鑫诚吉顺科贸有限公司成立于2007年，注册资金50万元。公司拥有雄厚的技术力量和专业的技术人才。\r\n本公司的经营范围主要有：装配厨房安全自动防火设备，烟道风道机器人销售及清洗，中央空调及制冷设备的清洗维修，地毯\r\n清洗及大理石翻新保养等。', '116.687179', '39.895946000000002', '116.687179', '39.895946000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3682', '好师傅（北京）劳务服务有限公司', '785', '张鹏', '13911350289', '王志奎', '13520021848', '2017年07月20日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区兴华大街（二段）3号院1号楼5层607', '北京市', '北京市', '大兴区', '清源街道', '北京市大兴区兴华大街（二段）3号院1号楼5层607', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年07月20日', '长期', '2018/11/26', '2019/11/25', '京消协（2018）证字413号', '91110115MA00GE4J32', '', '劳务服务；维修家用电器、制冷设备、计算机；专业承包；技术开发、转让、咨询、推广、服务；道路货运代理；货物进出口；代理进出口；技术进出口；会议服务（不含食宿）；组织文化艺术交流活动（不含演出）；承办展览展示；经济贸易咨询；租赁建筑工程机械设备；销售厨房设备、家用电器、制冷设备、电子产品、中央空调、机械设备、通讯设备、建筑材料、装饰材料、五金产品（不含电动自行车）、日用品、计算机、软件及辅助设备、文化用品；水污染治理；大气污染治理；土壤修复；园林绿化工程；园林绿化管理；园林景观设计；花卉租摆；清洁服务；家政服务；维修手机；道路货物运输。（企业依法自主选择经营项目，开展经营活动；道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '好师傅（北京）劳务服务有限公司，是一家专注于民生、商业服务类的连锁品牌，在维保服务市场中具有较好口碑。公司严格按照诚信经营，服务质量第一的宗旨，执行统一管理、统一标识、统一服务的标准，让广大用户享受高质量的一站式服务。\r\n企业标语：好家庭 就选好师傅。我们的服务宗旨：好用户 好服务 好师傅\r\n中国商业企业管理协会会员\r\n2019年公司通过中国招标投标网公示、\r\n315全国信用评价公示系统企业认证、中一信国际信用评价有限公司评审为：\r\nAAA级信用企业认证       AAA级诚信经营示范单位   行业AAA级诚信示范单位\r\nAAA级重服务守信用单位   AAA级重合同守信用单位   AAA级重质量守信用单位\r\nAAA级资信等级认证   优秀供应商   诚信企业   诚信经理人等认证与殊荣。\r\n\r\n目前已开通业务：\r\n二手家电回收；搬家、家政保洁；签约式家电管家；电脑、手机维修；空气除甲醛治理；企业电气设备维保；全品类家电安装、清洗、维修；房屋装修、拆旧、日常维修服务；\r\n\r\n目前公司拥有本科学历2人，持证高空作业人员3人，电工1人，电器四级维修工12人，清洁保洁人员4人。\r\n为更多个人及企业用户建立了服务保障。', '116.33114', '39.749808000000002', '116.33114', '39.749808000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3683', '北京市必克机电设备有限责任公司', '784', '王全红', '13901182467', '穆杨', '13911687610', '1998年12月01日', '2100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区远大路39号1号楼B1层B-19号', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区西四环北路10号院1号楼2层', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1998年12月01日', '2048年11月30日', '', '', '', '91110108700154879D', '', '销售机械电器设备、计算机及外围设备、五金交电、汽车配件、化工产品（不含危险化学品及一类易制毒化学品）、服装、百货、针纺织品、工艺美术品、开发后的产品；维修机械电器设备；家用电器；修理非家用制冷空调设备；信息咨询（除中介服务）；技术开发、技术转让、技术咨询、技术培训。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市必克机电设备有限责任公司成立于1998年，是以销售中央空调设备及水泵等相关配套设备为主体，配以咨询、设计、安装、调试、维护等售前、售后服务的专营公司。公司以“诚信合作，互惠互利，信誉至上，服务一流”为宗旨，依靠一批具有很强的敬业精神和过硬素质的员工，经过十年的努力，在北京市各部委、高校、房地产商及周边省市建立了牢固的合作网络，并做出了良好的成绩。2003年公司顺应市场需求，专门成立了‘北京世纪全景空调维修服务中心’这一独立的公司，整体加强了必克公司的售后力量。\r\n        公司下设：行政部、财务部、销售部、技术部、合约部、采购部、工程部等。主要经营：美的、海信日立、東芝等商用空调，顿汉布什、特灵、约克、美的等大型空调机组，梅兰日兰、阿尔西、优力等恒温恒湿空调设备，荏蒝、格兰富、肯富来等知名品牌的相关配套设备；辅以零配件销售、设备安装、维修保养等多项服务。', '116.27649', '39.967720999999997', '116.27649', '39.967720999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3684', '北京广大宏朗联拓科技有限公司', '782', '张景齐', '13901222120', '沈永革', '13661279231', '2011年05月20日', '680万元', '北京市', '北京市', '丰台区', null, '北京市丰台区新村巴庄子124号8号', '北京市', '北京市', '丰台区', '南苑地区办事处', '北京市丰台区双庙125号院2号楼', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2011年05月20日', '2031年05月19日', '2018/5/22', '2019/5/21', '京消协（2018）证字124号', '91110106575194395F', '', '销售食品；委托加工金属材料、电控设备；专业承包；销售食品、家用电器、金属材料、日用品、办公用品、工艺品、电子产品、五金交电、机械设备、电器设备、建筑材料、装饰材料、纸制品、针纺织品、汽车配件、劳保用品；仓储服务；电器维修；保洁服务；建筑设备租赁；接受委托提供劳务服务；技术开发、技术咨询、技术服务、技术转让、技术推广；城市园林绿化；风景园林工程设计；承办展览展示；花卉租摆；绿植租摆；销售花卉、苗木、装饰植物、盆景、陶瓷制品；出租商业用房。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京广大宏朗联拓科技有限公司是一家环保技术开发及推广应用企业。公司成立于2011年，公司自成立以来，一直以“科技创新，追求卓越”为宗旨，特别是在环保领域的技术开发，公司开发团队向世界最先进技术看齐，开发出许多适应我国国情且史无前例的创新型科技产品，解决了许多以前解决不了的环保疑难问题。如对餐厨油烟治理项目的研究，研制了获得国家科委授予“国内领先水平”的长寿命紫外汞齐灯油烟净化装置。此项目也进入了北京市发改委低碳节能环保产品政府推荐名录。在可挥发有机物气体治理上也取得了突破性成绩，公司研制的多级多层气体净化器，防爆光解式可挥发性有机物气体净化器，在实际应用中都取得很好的治理效果，获得了用户好评。目前公司拥有自主研发的几十项专利，研发核心团队以守护碧水蓝天为己任，不断攻坚克难，向污染宣战、向雾霾宣战。研制的泳池循环水净化系流，污水处理系统，以及除臭除味设备均是“即过得去，也过得硬”的 环保领域领先的技术产品。\r\n北京广大宏朗联拓科技有限公司于近期购买大批烟道清洗设备,并组织公司人员参加北京消防协会烟道清洗培训,参加培训人员全部通过消防协会的考试,取得了<排油烟设施清洗人员技术培训合格证>。', '116.428937', '39.837722999999997', '116.428937', '39.837722999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3685', '北京天怡大和投资管理有限公司', '781', '孙树立', '13901208791', '李美霞', '13699279501', '2005年12月12日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区安立路101号1号楼906', '北京市', '北京市', '朝阳区', '大屯街道', '北京市朝阳区安立路101号1号楼906', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年12月12日', '2025年12月11日', '2018/5/11', '2019/5/10', '京消协（2018）证字121号', '911101057832035837', '排油烟设施清洗机构', '物业管理；投资管理；餐饮管理；企业管理；建筑物清洁服务；机动车公共停车场服务；技术开发、技术服务、技术咨询、技术转让；计算机系统服务；应用软件服务（不含医用软件服务）；基础软件服务；维修计算机；设计、制作、代理、发布广告；组织文化交流活动（演出除外）；承办展览展示；会议服务；电脑图文设计；翻译服务；摄影扩印服务；经济信息咨询；租赁建筑机械、建筑设备；销售文化用品、体育用品、计算机软件及辅助设备、电子产品、医疗器械（不含Ⅱ、Ⅲ类）、建筑材料、五金交电、通讯设备、金属材料、汽车配件、服装、鞋帽、日用品、工艺品、化妆品、家具、厨房用具、卫生间用具、日用杂货；出租商业用房。（“1、未经有关部门批准，不得以公开方式募集资金；2、不得公开开展证券类产品和金融衍生品交易活动；3、不得发放贷款；4、不得对所投资企业以外的其他企业提供担保；5、不得向投资者承诺投资本金不受损失或者承诺最低收益”；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '投资管理、餐饮管理、清洗服务等', '116.40501500000001', '39.995339999999999', '116.40501500000001', '39.995339999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3686', '北京中置天龙科技发展有限公司', '777', '陈兆伟', '13901302276', '陈兆伟', '13901302276', '2006年07月19日', '1180万元', '北京市', '北京市', '大兴区', null, '北京市大兴区乐园路4号院3号楼5层601', '北京市', '北京市', '通州区', '永乐店镇', '北京市通州区永乐经济开发区恒业北七街6号及6号院5号楼', '', '消防产品', '有限责任公司（自然人独资）', '2006年07月19日', '2036年07月18日', '2018/5/22', '2019/5/21', '京消协（2018）证字149号', '91110115791630649C', '', '技术开发、咨询、转让、服务；信息咨询（不含中介服务）；组织文化艺术交流活动（不含演出）；承办展览展示；会议服务（不含食宿）；广告设计、制作（仅限使用计算机进行制作）；企业形象设计；销售消防器材、计算机软硬件及辅助设备、机械电器设备、建筑材料、装饰材料、五金交电、化工产品（不含一类易制毒化学品及危险品）；专业承包；产品设计；清洁服务；计算机系统集成；以下项目仅限分支机构经营：组装、加工、安装、维修消防灭火设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中置天龙科技发展有限公司位于北京市通州区永乐经济开发区产业园内，是经国家批准注册研发生产安装维修保养为一体的高新综合企业公司。产品由北京市消防科学研究所和本公司联合开发研制生产，是北京消防协会会员。\r\n公司专业生产的厨房自动灭火装置是根据国外发达国家标准设计、制造并结合。关于厨房设备灭火装置的国家标准GA498-2012”而制造，该产品通过《国家固定灭火系统和耐火构件质量监督检验中心》检测合格并领取检测报告并先后通过“IS09001-2008质量管理体系认证。于2016年2月1日通过并取得中国国家强制性产品3C认证的生产企业。其产品已取得了2项专利证书，并在人民保险公司投保最高赔偿100万元。\r\n建厂十年来，公司始终重视产品质量，以高质量的产品、良好的服务、信誉。树立了“北京中置天龙”优秀品牌。产品销往全国引入各个省市、网络遍布全国。凭借高新的技术、实惠的价格、完善的售后服务体系，赢得了广大客户的信赖和推崇。公司一贯秉承“以诚求诚、精益求精”追求品质超越平凡的企业宗旨。“诚信为本、专业服务”的经营理念。“构筑平安、服务社会”的企业宗旨，全力为客户提供最专业的厨房消防安全保障。', '116.333777', '39.765348000000003', '116.78691000000001', '39.615136999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3687', '北京尚品嘉美保洁服务有限公司', '776', '张苗', '13581822586', '张苗', '13581822586', '2015年04月23日', '60万元', '北京市', '北京市', '平谷区', null, '北京市平谷区林荫北街13号信息大厦802室', '北京市', '北京市', '平谷区', '滨河街道', '北京市平谷区林荫北街13号信息大厦802室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年04月23日', '2035年04月22日', '2018/11/26', '2019/11/25', '京消协（2018）证字416号', '91110117339788730W', '', '专业承包；建筑物清洁服务；家庭劳务服务；销售厨卫用具、装饰材料、建筑材料、化工产品、日用品、办公用品；技术开发、技术转让、技术推广、技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京尚品嘉美保洁服务有限公司是一家年轻、充满朝气、具有法人资格的专业性\r\n\r\n保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写\r\n\r\n字楼、娱乐场所等提供全方位的烟道清洗保洁服务，销售检测维修灭火器等消防安全\r\n\r\n服务包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣\r\n\r\n工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清\r\n\r\n洗保洁服务。本公司采用专用清洁设备及清洁药剂，具备承揽大型工程所需的配\r\n\r\n套设施及施工能力，可以为不同领域客户提供全方位的满意服务。 作为北京消\r\n\r\n防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、\r\n\r\n高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具\r\n\r\n有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了\r\n\r\n良好的口碑。 科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是\r\n\r\n本公司信赖以发展的宗旨。本公司将继续以一流的质量、优惠的价格、周到热情\r\n\r\n的服务态度为广大客户提供更多、更好的清洁服务，并热诚欢迎社会各界朋友光\r\n\r\n临本公司洽谈业务。', '117.105101', '40.141105000000003', '117.105101', '40.141105000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3688', '北京孝善科技服务有限公司', '775', '程秀峰', '15510728849', '程秀峰', '15510728849', '2015年09月23日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区镇罗营镇上营中路12号', '北京市', '北京市', '平谷区', '镇罗营镇', '北京市平谷区镇罗营镇上营中路12号', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年09月23日', '2045年09月22日', '2018/7/12', '2019/7/11', '京消协（2018）证字230号', '91110117358312156H', '排油烟设施清洗机构', '技术开发、技术转让、技术服务、技术推广、技术咨询；物业管理；专业承包；劳务分包；建筑物清洁服务；家庭劳务服务；家居装饰及设计；园林绿化；承办展览展示；会议服务；经济贸易咨询；设计、制作、代理、发布广告；销售机械设备、文化用品、日用品、五金交电（不含电动自行车）、建筑材料、金属材料、计算机软硬件及外围设备、家用电器、化工产品、体育用品、厨卫用具、花卉、苗木、低毒低残留农药；大气污染治理；室内空气检测；有害生物防治服务；机械设备清洗；空调清洗。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京孝善科技服务有限公司成立于2015年9月，是一家依技术服务，专业承包，烟道清洗，建筑物清洗，家庭劳务服务，大气污染治理，室内空气检测，有害生物防治，地毯清洗，空调清洗等一条龙服务的公司，随着社会的发展消防安全，食品卫生，清洁服务，生活健康越来越被社会接受和需要。我们公司致力于给客户给千万同胞提供一个安全生产，更加清洁亮丽的生活工作环境而努力！努力提升人们的现代生活质量而努力！\r\n        我公司之成立以来，致力于长期合作关系，努力提高服务质量，更高标准严要求，以“消防安全为己任，顾客至上，信誉第一，诚信为本，高效求实，稳步发展”的经营理念为宗旨，高标准高质量提供服务，维护客户利益，形象是我们始终不渝的目标！\r\n        我公司具有完善的工作管理制度和安全操作制度，制定了规范的工序操作流程。公司的员工都通过相关部门专业培训，考核上岗的专业队伍！公司管理机制完善，清洁作业经验丰富，拥有雄厚的技术力量，严格实行岗前培训一岗中督查一上岗在培训的员工管理措施，凭着优良的督查管理，为众多的单位，医院，酒店，商场，学校，食堂，餐厅，饭店等提供优质的后勤清洁服务，，，，，', '117.14286', '40.341794999999998', '117.14286', '40.341794999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3689', '北京大德空间环境科技有限公司', '774', '郑美妹', '13910797866', '郑美妹', '13910797866', '2010年08月13日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北苑路170号6号楼15层1506', '北京市', '北京市', '朝阳区', '大屯街道', '北京市朝阳区北苑路170号6号楼15层1506', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年08月13日', '2030年08月12日', '2018/12/13', '2019/8/8', '京消协（2018）证字255号', '91110105560399873D', '排油烟设施清洗机构', '技术开发、技术服务、技术咨询、技术转让；清洁服务（不含餐具消毒）；害虫防治服务；销售厨房设备、电气设备、电子产品、机械设备、厨房及卫生间用具（不从事实体店铺经营）、家用电器、建材、化工产品（不含危险化学品类）；合同能源管理；净化设备租赁；环境保护设施运营；环境污染设施运营。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京大德空间环境科技有限公司成立于2010年，总部位于北京，作为领先的物联网+商用排烟净化整体解决方案提供商，专注服务于中国的环保事业，是集商用排烟净化领域项目咨询、设计、设备研发制造、运维等服务为一体的高新技术企业。大德空间始终坚持“以实现客户价值为核心，以科技创新为发展方向，以改变油烟净化市场环境为目标”的发展思路，积极响应国家节能、减排的战略发展目标，以科技创新开启油烟治理监管新模式，为客户创造更大的价值，创造最佳的经济和社会效益，实现节能减排、可持续发展。我们愿携手有识之士，不懈努力，为中国的环境事业贡献力量，让油烟不再污染蓝天，使环保不再成为负担', '116.418803', '39.997506999999999', '116.418803', '39.997506999999999', '', null, null, null, null);
