INSERT INTO `t_fc_company` VALUES ('3692', '北京国伟科技发展有限公司', '767', '李国伟', '15901367082', '李国伟', '15901367082', '2016年04月12日', '500万元', '北京市', '北京市', '密云区', null, '北京市密云区太师屯镇政府办公楼415室-683(太师屯镇集中办公区）', '北京市', '北京市', '密云区', '太师屯镇', '北京市密云区太师屯镇政府办公楼415室-683(太师屯镇集中办公区）', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年04月12日', '2036年04月11日', '2018/5/22', '2019/5/21', '京消协（2018）证字138号', '91110228MA004QHLXR', '', '技术开发、技术转让、技术咨询、技术推广、技术服务；电脑图文设计、制作；工程勘察设计；建设工程项目管理；家居装饰；家庭劳务服务；城市园林绿化；租赁建筑工程机械、建筑工程设备；设计、制作、代理、发布广告；销售针纺织品、服装、鞋帽、厨房及卫生间用具、五金、交电、生活用陶瓷器皿；厨房设备（抽油烟机等）的清洗；建筑物清洁服务；锅炉烟囱的清扫；维修、安装空调制冷设备；专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司主要负责宾馆 酒店 后厨油烟  中央空调清洗 维修 目前员工10余人 具有强大的施工能力', '117.126707', '40.540627999999998', '117.126707', '40.540627999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3693', '北京冰春莲科技有限公司', '766', '徐善志', '13311599278', '徐善志', '13311599278', '2009年11月16日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区巴庄子139号62栋128室', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区巴庄子139号62栋128室', '', '电气防火,烟道清洗', '有限责任公司（自然人独资）', '2009年11月16日', '2029年11月15日', '2018/5/3', '2019/5/2', '京消协（2018）证字094号', '91110106697740286K', '', '技术术开发、技术服务；音视频设备维修、制冷设备维修；厨房油烟管道清洗；专业承包；销售制冷成套设备、电器成套设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京冰春莲科技有限公司是一家专业从事中央空调系统清洗、油烟管道清洗的服务型企业。为用户的中央空调系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\r\n       公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成排油烟设施系统清洗全系列工作。我们丰富的经验可广泛服务于所有使用排油烟系统的场所，包括写字楼、饭店、商场、学校、机关办公区等。\r\n您的健康是我们的责任、我们愿用自己的努力，为您提供一个洁净、健康、舒适的环境。为我们人类多留一片洁净的蓝天。', '116.326447', '39.834572000000001', '116.326447', '39.834572000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3694', '北京联城正安智能消防安全技术有限公司', '765', '柴元香', '18613878482', '18613878482', '18613878482', '2013年10月29日', '2882万元', '北京市', '北京市', '昌平区', null, '北京市昌平区流村镇工业企业总公司东二楼259号', '北京市', '北京市', '昌平区', '马池口地区办事处', '北京市昌平区流村镇工业企业总公司东二楼259号', '', '消防产品', '有限责任公司（自然人独资）', '2013年10月29日', '2063年10月28日', '2018/8/1', '2019/7/31', '京消协（2018）证字253号', '91110114080484059K', '', '专业承包；工程勘察设计；技术推广、技术服务、技术检测（不含食品检测、不含产品质量检测）；销售消防器材、五金交电、体育用品、建筑材料、电子产品、机械设备；维修消防器材；家庭劳务服务。（领取本执照后，应到住建委、规划委办理行政许可）（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n\r\n 北京联城正安智能消防安全技术有限公司成立于2013年10月29日，是经过消防局正式认可的机构。公司成立以来，本着对消防事业高度负责的精神，我们坚持“质量第一、诚信至上”的经营方针，把质量和售后服务放在第一位。本公司拥有高素质的消防专业工程师和现场作业队伍，我们凭借着专业的的团队和良好的信誉，努力加强公司内部管理，严格质量监督制度，建立完善用户服务体系。\r\n公司高级工程师和经验丰富的技术人员组成的专业队伍，所有员工都通过有关的消防培训和技术考核。做到及时发现问题、消除隐患，保证用户的消防设施能够正常有效的运行，充分发挥报警和灭火的作用。消防检测过程中采用高科技手段和精密测量相结合的方法，为有效预防、避免火灾的发生，消除火灾隐患并帮助客户达到满意的效果。\r\n本公司批发销售各种消防器材，品种、规格齐全，质量保证，价格优惠。主要经营各种灭火器、消防水带、接口、水枪、消火栓、消防应急灯、疏散标志灯、消防呼吸器、消防服装、缓绛器、防毒面具、灭火毯、消防服、正压式空气呼吸器、报警器、逃生器材、安防监控器材等。为保障用户利益，提供优质的售后服务，我们成立了经过北京市消防局认定的消防维修器材维', '116.106898', '40.173721', '116.106898', '40.173721', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3695', '通县节能技术推广站', '759', '孙伟', '15510503811', '韩晓艳', '13522159078', '1987年07月13日', '200万元', '北京市', '北京市', '通州区', null, '北京市通州区新华大街248号', '北京市', '北京市', '通州区', '宋庄镇', '北京市通州区小堡村南3号院', '', '烟道清洗', '全民所有制', '1987年07月13日', '2037年07月12日', '2018/5/30', '2019/5/29', '京消协（2018）证字167号', '91110112102439671N', '', '能源节能技术开发、推广、改造；环保节能技术推广；建筑物清洁服务；销售太阳能专用设备、炉具；技术服务；零售供暖专用设备、制冷专用设备、环保专用设备、水处理专用设备、除尘专用设备、仪器仪表、润滑油、化肥（不含危险化学品）；维修水处理专用设备、除尘专用设备（仅限上门维修）；水污染治理；技术咨询；组织文化艺术交流活动；承办展览展示；会议服务；出租商业用房、办公用房（不得作为有形市场经营用房）；制造金属结构；专业承包;供暖服务；安装、修理锅炉；施工总承包；物业管理；劳务分包；人才中介服务；城市园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '通县节能技术推广站隶属于北京市通州区人民政府国有资产监督管理委员会，是北京市通州区煤炭公司下属的全资子公司。本单位于1987年7月在工商部门注册成立，注册资金：200万。依法批准开展的经营范围有：能源节能技术开发、推广、改造；环保节能技术推广；建筑物清洁服务；销售太阳专用设备、炉具；技术服务；零售供暖专用设备、制冷专用设备、环保专用设备、水处理专用设备、除尘专用设备、仪器仪表、润滑油、化肥（不含危险化学品）；维修水处理专用设备、除尘专用设备（仅限上门维修）；水污染治理；技术咨询；组织文化艺术交流活动；承办展览展示；会议服务；出租商业用房、办公用房；制造金属结构；专业承包；供暖服务；安装、修理锅炉；施工总承包；物业管理；劳务分包；人才中介服务；城市园林绿化。我公司一直秉承“团结、奋进、求实、创新”的企业精神和“用户至上，服务第一”的文化理念，为客户提供优良的服务，创造安全的工作环境，提高客户的安全保障和经济效益，在确保社会效益的同时，竭诚服务于社会。', '116.647325', '39.905884999999998', '116.72327799999999', '39.943956', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3696', '北京华融达国环科技有限公司', '758', '宋洪黎', '13011291559', '陈小方', '18310401557', '2004年03月19日', '1000万元', '北京市', '北京市', '海淀区', null, '马神庙1号二区19号楼74单元701室', '北京市', '北京市', '海淀区', '甘家口街道', '马神庙1号二区19号楼74单元701室', '', '烟道清洗', '其他有限责任公司', '2004年03月19日', '2024年03月18日', '2018/5/22', '2019/5/21', '京消协（2018）证字137号', '91110108760104750F', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；建筑物清洁服务；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华融达国环科技有限公司成立于2004年8月3日，主要业务包括厨房排烟工程设计安装、噪声处理、环保设备改造等。公司已经承包负责过许多大中排烟通风项目。经过14年多时间的艰苦拼搏，目前已成为一家集咨询、设计、生产、施工、服务等于一体的高科技环保企业，主营业务包括餐饮业环保综合服务、厨房排油烟管道清洗、通风工程、环境影响咨询、污水治理工程、锅炉节能工程、中央空调清洗等。', '116.306409', '39.926367999999997', '116.306409', '39.926367999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3697', '北京万和兴达科技发展有限公司', '756', '张琳', '13021905916', '柴雪艳', '13911012781', '2006年11月10日', '200万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧桥路25号院11号楼9层905', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧宫镇德茂庄华宇公寓14门201室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年11月10日', '2026年11月09日', '2018/5/22', '2019/5/21', '京消协（2018）证字140号', '91110105795984655M', '', '技术推广、服务、咨询；清洁服务；电脑图文设计；经济贸易咨询；物业管理；销售日用品、服装、工艺品、建材、厨房设备；厨房设备维修；汽车租赁；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京万和兴达科技发展有限公司，成立于2003年11月，是一家集管道清洁，厨房保洁，厨房安装，维修，保养为一体的综合性服务公司。\r\n采用职能组织机构，遵循精于高效的原则，竭诚为北京市内各类宾馆、酒店、写字楼、机关团体、企事业单位、学校等提供各类型的清洁服务。', '116.45367', '39.792791999999999', '116.444332', '39.779197000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3698', '北京聚美德馨环保科技有限公司', '755', '谭冰江', '13522473060', '谭冰刚', '13552098339', '2017年11月07日', '50万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖经济开发区雁西路33号院1号楼103室', '北京市', '北京市', '怀柔区', '北京雁栖经济开发区', '北京市怀柔区雁栖经济开发区雁西路33号院1号楼103室', '', '烟道清洗,消防设施,消防产品', '有限责任公司（自然人独资）', '2017年11月07日', '长期', '2018/6/15', '2019/6/14', '京消协（2018）证字188号', '91110116MA018KNJ8Y', '', '技术开发、技术转让、技术咨询、技术服务、技术推广；施工总承包、专业承包、劳务分包；租赁建筑工程机械、建筑工程设备；办公室保洁服务；建筑物清洁服务；机械设备专业清洗服务；承办展览展示；组织文化艺术交流活动（不含演出）；会议服务；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京聚美德馨环保科技有限公司是经北京市工商管理局正式注册批准，竭诚致力于清洗保洁的专业性清洗公司。我们面向社会各机关、团体、宾馆、酒店、商场、写字楼、娱乐场所等提供全方位的清洗保洁服务，主要致力于酒店、商场、快餐厅的大型厨房烟道防火清洗等；开展新大楼竣工、装饰后全套清洗保洁；各种石材地板清洗打蜡、翻新、结晶、养护技术；真皮沙发清洗养护；各种地毯的清洗护理；建立了完善的服务体系；积累了丰富的工作经验，并已在北京市场占有一席之地。 公司实行总经理负责制，严格管理，力争创新技术，努力发展企业文化。有市场总监率领着独立的团队，并设立网络部、企划公关部、业务部为公司的日益俱增的业绩做坚强的后盾；专人的调度，专业的车队确保客户的准时、准量高效完成。由设备检修组、库管众人组成的后勤部为前线时刻准备着，公司将以北京市区为中心，并继续努力拓展华北市场。 　　 公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！', '116.68302300000001', '40.352040000000002', '116.68302300000001', '40.352040000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3699', '北京全安达消防器材维修中心', '754', '罗六海', '13701177535', '罗六海', '13701177535', '2003年03月26日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区垡头西里一区12楼4门4-12', '北京市', '北京市', '朝阳区', '王四营地区办事处', '北京市朝阳区垡头西里一区12楼4门4-12', '', '消防设施', '集体所有制（股份合作）', '2003年03月26日', '长期', '2018/6/27', '2019/6/26', '京消协（2018）证字212号', '91110105748837193U', '', '维修消防器材；销售消防器材、化工产品（不含危险化学品、不含一类易制毒化学品）、机械设备、建筑材料；劳务服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '企业简介\r\n    北京全安达消防器材维修中心，成立于2003年3月26日是一家专业从事灭火器维修、销售各种消防器材及消防设备设施于一体的公司。\r\n    公司是通过消防部门颁发的相关资质，现有技术工人5名，高级一级工程师技术管理人员1名，拥有经验丰富的专业技术队伍及先进的设备设施，公司已通过ISO9001质量管理体系认证。\r\n    公司遵循北京市消防局“预防为主、消防结合”的工作方针，根据灭火器维修工作需要和要求“质量第一、用户至上”的经营方针，公司拥有一支高素质技术精湛的专业维修队伍工作认真负责。\r\n    “隐患险于明火，防范胜于救灾，责任重于泰山”。为了首都建筑消防的安全，预防和减少火灾事故的发生，维护社会稳定，确保北京市公共财产和公民人身财产安全，也是我公司的服务宗旨。\r\n    公司严格执行国家及北京市相关技术规范，自觉遵守行业自律规则，严格内部管理，努力提高从业人员素质，不断完善质量保证体系，全心全意为客户提供优质的维修服务。公司与众多央企、国家及市级重点企业合作，得到了各企业的一致好评。\r\n    公司将始终以诚信赢得商机、专业铸就品质的企业精神和对质量精益求精、', '116.51081499999999', '39.865903000000003', '116.51081499999999', '39.865903000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3700', '北京龙钊嘉业环保科技有限公司', '752', '杨俊艳', '13315929069', '谭朝双', '13911464849', '2017年12月11日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰葆路华英园12号3层313室', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区丰葆路华英园12号3层313室', '', '烟道清洗,建筑防火,消防设施', '有限责任公司（自然人独资）', '2017年12月11日', '长期', '2018/5/22', '2019/5/21', '京消协（2018）证字132号', '91110106053624140W', '', '物业管理；劳务分包；室内装饰工程设计；城市园林绿化；专业承包；技术检测；技术推广、技术服务、技术咨询、技术开发、技术转让；保洁服务；清洁服务；技术开发；家庭服务；劳务服务；企业管理服务；会议服务；承办展览展示；企业策划；组织文化艺术交流活动；汽车装饰；清洁服务；机械设备租赁；汽车租赁（不含九座以上）；大气污染治理；销售建筑材料、装饰材料、五金交电、化工产品（不含化学危险品）、金属材料、日用品、机械设备。(领取本执照后，应到区县住建委（房管局）、市规划委、市园林绿化局取得行政许可；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京龙钊嘉业环保科技有限公司是一家专业从事排油烟设施清洗工程的服务型企业。为用户的清洗系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。 公司拥有一批专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成油烟管道的清洗工作。 公司不断吸收和引进各类专业技术和管理人才，提高经营管理人员的素质，以一流的品质求生存、一流的诚信求发展、一流的管理求进取、合理的价格来服务于广大客户。 　公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！ 我们的承诺：您的满意才是我们的满意！我们的今天：全凭客户以往的支持！ 我们的未来：将继续全方位的服务！我们的坚信：做到专业，就能做到最好！', '116.29105300000001', '39.815416999999997', '116.29105300000001', '39.815416999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3701', '北京信利通物业管理有限公司', '751', '胡永成', '13641053252', '张祎楠', '15011293168', '2015年02月12日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区顺仁路57号院1号楼2层248', '北京市', '北京市', '顺义区', '仁和地区办事处', '北京市顺义区顺仁路57号院1号楼2层248', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年02月12日', '2065年02月11日', '', '', '', '91110113330386989Y', '', '物业管理；仓储服务（不含危险化学品、粮油）；施工总承包、专业承包、劳务分包；城市园林绿化施工；家居装饰；幕墙设计；装卸服务；保洁服务；家政服务；花卉租摆；技术开发、技术服务、技术咨询、技术转让；销售安全技术防范产品、日用品、办公用品、体育用品（不含弩）、装饰材料、塑料制品、服装鞋帽、计算机及辅助设备（不含计算机信息系统安全专用产品）；零售五金产品（不含电动自行车）、建筑材料（不含砂石及砂石制品）；安装门窗；租赁、维修机械设备（不含特种设备）；室内装饰设计；接受委托提供劳务服务（不含排队服务、代驾服务、对外劳务合作）；机动车公共停车场管理服务；组织文化艺术交流活动（不含演出）；承办展览展示活动；信息咨询（不含中介服务）；清洁服务（不含餐具消毒）；包装服务；劳务派遣；道路货物运输。（企业依法自主选择经营项目，开展经营活动；道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京信利通物业管理有限公司成立于2015年，注册地址位于北京市顺义区顺仁路57号院1号楼2层248，注册资金500万其中实缴资金200万。经营范围物业管理：施工总承包、专业承包、劳务分包；城市园林绿化施工；家居装饰；幕墙设计；装卸服务；保洁服务；家政服务花卉租摆；技术开发、技术服务、技术咨询、技术转让；销售安全防范技术产品、日用品、办公用品、体育用品、装饰材料、塑料制品、服装鞋帽、计算机及辅助设备；室内装饰设计；接受委托提供劳务服务；机动车公共停车场管理服务；组织文化艺术交流；承办展览展示活动；信息咨询；清洁服务；组织文化艺术交流；承办展览展示活动；信息咨询；清洁服务；劳务派遣。主要业务承接高档写字楼、商场、售楼处、宾馆、住宅小区、工厂及学校、企事业单位的日常保洁、开荒保洁服务；有外墙清洗、石材养护与翻新、地毯清洗等专项清洁服务和专业的服务团队。公司深知清洁服务业的生存发展之道，始终奉行“以人为本，至诚至信”的原则，严格遵照工作质量至上，为客户提供高品质的清洁服务，并且尤其注重对服务质量的监督和控制。公司追求的服务效果是“把一切还给自然”。', '116.663438', '40.086004000000003', '116.663438', '40.086004000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3702', '北京军威义消防科技有限公司', '750', '邱小军', '13911839372', '朱晓宁', '13911832887', '2011年01月10日', '1100万元', '北京市', '北京市', '东城区', null, '宝钞胡同107号118室', '北京市', '北京市', '丰台区', '东铁匠营街道', '方庄南路方恒偶2号楼B座307/308', '', '电气防火,消防设施', '有限责任公司（自然人独资）', '2011年01月10日', '2041年01月09日', '2018/6/27', '2019/6/26', '京消协（2018）证字208号', '91110101567432234D', '电气防火检测技术服务机构', '技术开发、技术转让、技术咨询、技术服务；技术检测；技术推广服务；经济信息咨询；承办展览展示；组织文化艺术交流；酒店管理；企业策划；维修消防器材；销售建筑材料、五金交电（不含电动自行车）、电气设备、消防器材、机械设备、电子产品、金属矿石、非金属矿石、化工产品（不含危险化学品）、计算机、软件及辅助设备、医疗器械（限Ⅰ类）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京军威义消防科技有限公司成立于2011年1月10日，经国家工商局正式注册，是独立法人，于2011年当年被北京市消防协会接纳为会员单位。本公司具备独立开展建筑消防设施检测和电气防火检测以及专业消防维保技术服务的资格，技术力量雄厚，检测设备齐全，检测人员均具备多年专业检测经验，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测，确保检测工作科学、公正、准确、规范。\r\n    于2014年12月接受北京市计量的考核取得CMA证书，于2015年1月接受北京市消防局一级的资质和资信证书的考核及评审，均已合格获得证书。凭借雄厚的实力和良好的信誉， 与各生产厂联营合作，保证了产品价格的优势性。使广大用户使用到质量可靠价格合理的产品，同时以市场为导向、客户为中心，加强内部管理和严格质量监 督，提高服务水平，积极的参与市场竞争。我们深刻认识到消防安全的重要性，永远把产品质量关和良好服务放在第一位，所售产品都是有国家消防装备质量监督检测中心检测认定资质，公安部消防产品型式认可证书的合格产品，旨在普及公众消防安全意识、提供更多质优价廉的消防产品及服务。', '116.39939', '39.942041000000003', '116.438327', '39.850915000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3703', '北京红门保洁有限公司', '749', '王树峰', '13671003999', '李思广', '15701583836', '2016年08月02日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路186号1区1号楼2层1810室', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路186号1区1号楼2层1810室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年08月02日', '2046年08月01日', '2018/11/9', '2019/11/8', '京消协（2018）证字372号', '91110106MA007D190G', '', '清洁服务；劳务服务；销售日用品、办公用品、文具用品、粮食、新鲜蔬菜、新鲜水果；技术开发、技术推广、技术咨询、技术服务；承办展览展示活动；设计、制作、代理、发布广告；餐饮管理；企业管理；城市园林绿化服务；机械设备租赁。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京红门保洁有限公司是一家具有独立法人资格的企业,经工商\r\n部门批准、正规注册的合法经营执照保洁公司。公司专为大中型酒店酒楼、餐厅、各企事业单位厨房排烟净化系统提供保养、护理、清洗、清洁于一体的保洁公司.\r\n公司自成立以来, 凭借精良设备、 丰富的经验, 以真诚的服务迅速发展。 公司拥有一批专业技术工人和几十台(套)先进的清洗设备.公司在运营管理方面,贵以严格的管理和规范的服务,拥有一批高素质、 高技术水平的清洁服务人员, 所有上岗人员均经过严格的培训和考核。其次拥有专业化的管理人员,可以为客户制定详细的保洁计划和方案.\r\n公司经营范围: 1、 清洗油烟罩、 运水烟罩、 脱水扇、 抽油烟机、 风机、 油烟净化器、 排油烟管(横管和竖管)、 大型风管, 2、大理石养护, 石材翻新3、 加工安装排烟管、 油烟机、 净化器、 改造排风系统、 改建隔油池, 4, 各种排烟道清洗, 各种油烟机维修,油烟净化器清洗,油烟管道清洗等。为了更方便的为您服务,我公司愿为您提供更快、更好、更全面的服务,如果签订长期清洗维修协议,价格更优惠民\r\n温馨提示: 全国每年油烟发生火灾上万起, 损失非常严重。', '116.29580199999999', '39.827879000000003', '116.29580199999999', '39.827879000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3704', '北京晶雅丽科贸有限公司', '748', '杨建生', '13261311763', '张晶晶', '13718257307', '2011年04月08日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区大红门南里10号楼1单元303室', '北京市', '北京市', '丰台区', '南苑地区办事处', '北京市丰台区大红门南里10号楼1单元303室', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年04月08日', '2031年04月07日', '2018/8/9', '2019/8/7', '京消协（2018）证字261号', '911101065732467299', '', '技术推广；技术服务；清洁服务；劳务服务；经济信息咨询；销售建筑材料、装饰材料、五金交电、家用电器、机械设备、服装、鞋帽。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京晶雅丽科贸有限公司，成立于1998年4月27日，是一家从事油烟管道清洗；防腐防水工程；石材翻新；开荒保洁；驻店管理；外墙清洗；地毯清洗；厨具制作等设备为一体的综合性服务公司。真诚为北京各类宾馆、酒店、大厦、机关单位、学校等提供各种清洁服务。晶雅丽在创业阶段，我们非常重视跟我们合作过的和即将合作的每个客户，我公司以服务为发展，以质量求生存！大家合作就是双赢，只要我们诚持着一颗心，才能把工作做的更好。晶雅丽有您一路陪伴；我们永远是朋友！', '116.402539', '39.836213000000001', '116.402539', '39.836213000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3705', '北京地道鼠环保科技有限公司', '747', '韩丽', '18701505098', '赵金峰', '13681324592', '2015年06月11日', '50万元', '北京市', '北京市', '大兴区', null, '北京经济技术开发区地盛北街1号院19号楼1层1单元101-04', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京经济技术开发区地盛北街1号院19号楼1层1单元101-04', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年06月11日', '2045年06月10日', '2018/9/12', '2019/9/11', '京消协（2018）证字294号', '911101063443477452', '排油烟设施清洗机构', '技术开发、技术推广、技术转让、技术咨询；销售化工产品（不含危险品）、电子产品、消防器材、厨房用具、机电设备及配件、文具用品、体育用品；清洁服务；打字复印；害虫防治服务；灭鼠预防服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介：  \r\n     北京地道鼠环保科技有限公司是一家正式工商注册的正规公司，专业从事清洗、保洁为一体的服务性质公司。竭诚为各种酒店、宾馆、饭店、商场、食堂、写字楼、家庭、银行、证券公司、工厂、各种大型的展会等，提供全方位保洁服务，并能输送长期保洁人员。公司拥有先进的设备，优质的工作员工及一流的服务。\r\n    在管理上，本公司注重人材素质培养，员工统一着装、言语文明、工作一丝不苟、尽职尽责、拾金不昧都受到广大客户一致的好评。在日常保洁中，本公司对清洁行业中难处理的棘手问题都有独到的处理方法：比如厨房油污、卫生间污垢、水泥垢等等都可以做到洁白如新。\r\n    北京地道鼠环保科技有限公司自成立以来一直奉行“信誉至上，客户至上”的宗旨，通过不懈努力工作，积累了丰富的工作经验，为美化北京环境做出了突出贡献，并得到了社会的认可。我公司拥有一支庞大的专业清洁队伍所有上岗人员均经过严格的培训和考核。其守信、敬业吃苦耐劳的品格受到了市内外单位和个人客户的普遍好评。', '116.497271', '39.782910999999999', '116.497271', '39.782910999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3706', '北京兴安盾消防器材有限公司', '746', '刘连乙', '13911902025', '刘冬', '13366669082', '2012年09月18日', '110万元', '北京市', '北京市', '大兴区', null, '北京市大兴区西红门镇金大路6号1幢一层3室', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '新媒体产业基地金星路15号（小二涮肉）', '', '消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2012年09月18日', '2032年09月17日', '2018/5/30', '2019/5/29', '京消协（2018）证字157号', '91110115053570867L', '', '专业承包；销售消防器材、建筑材料、五金产品（不含三轮摩托车及残疾人机动轮椅车）、仪器仪表、电子产品、交通设施、机械设备；维修消防器材；保洁服务；技术开发、咨询、服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '公司从事销售各种消防器材、灭火器检修，经北京市消防局资质审核批准、北京市技术监督局计量认证、北京市工商局核准依法成立。\r\n   公司具有现代的经营管理理念和与之相配套的组织机构。公司拥有精良的检测设备，红外测温仪、红外热像仪、数字微压计、数字式照度计、加烟器等。检测技术在国内外具有先进的水平。公司拥有雄厚的技术力量和高素质的专业队伍，高级工程师具有十多年建筑消防设施和设备的设计、施工及安装经验，熟悉国内外消防技术。检测队长从事消防行业多年，熟练掌握并运用各种相关消防技术规范。公司的业务范围主要有建筑消防设施检测、电气防火安全检测、消防设施的维护与保养及其他相关咨询服务。\r\n   按照国家有关消防法律、法规、技术范围的规定，各类建筑均需设计、安装消防设施，这是预防火灾发生的重要保证。但目前，许多建筑消防设施存在严重问题不能正常运行，一些建筑消防设施出现故障后不能及时发现，起不到防火、报警和灭火的作用，埋藏下隐患，危机公共消防安全，根据2008年新修订的«中华人民共和国消防法»', '116.38255100000001', '39.764114999999997', '116.34818799999999', '39.763599999999997', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3707', '北京秉承工程技术有限公司', '745', '温计虎', '010-51095003', '贾红艳', '010-51065003', '2014年01月14日', '1000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区蓝靛厂东路2号院2号楼（金源时代商务中心2号楼）1单元（A座）10D', '北京市', '北京市', '朝阳区', '奥运村街道', '北京市朝阳区北苑路13号院领地2-3-101', '', '建筑防火,消防设施,消防安全检查,消防产品', '有限责任公司（自然人投资或控股）', '2014年01月14日', '2064年01月13日', '2018/7/6', '2019/7/5', '京消协（2018）证字216号', '9111010809189669XT', '', '建设工程项目管理；物业管理；工程勘察设计；专业承包；技术服务、技术开发、技术转让、技术咨询；销售机械设备、电子产品、五金交电（不含电动自行车）、建筑材料；房地产开发；出租办公用房，出租商业用房；城市园林绿化；水污染治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京秉承工程技术有限公司于2014年1月经北京市工商行政管理局审批成立，注册资金1000万元，从业人员60余人，拥有经验丰富的技术服务工程师和专业技术人员占半数以上。是经北京市规划委员会和北京市住房和城乡建设委员会批准、北京市消防局备案的消防设施工程设计与施工贰级企业。\r\n北京秉承工程技术有限公司是北京秉承集团有限公司下设专业从事消防工程设计施工的公司，长期以来，秉承公司致力于为用户提供技术、服务的同时，锻炼和培养了一支具有专业素质和快速反应的技术和市场营销队伍。为了确保产品和服务质量，公司按照GB/T9001-2000“质量管理体系”要求建立了完整的质量保证体系。取得了ISO9001质量管理体系认证、ISO14001环境管理体系认证、GB/T28001职业健康安全管理体系认证。制定了“顾客满意，持续改进”的质量方针，以及明确的质量目标和一整套的质量管理文件，并严格地贯彻执行。具备能够独立完成消防工程系统的咨询、设计、供应、施工安装、调试及后期维修和保养的承包能力。', '116.288113', '39.960956000000003', '116.413828', '40.040759000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3708', '北京天锐杰厨房设备有限公司', '744', '孙俊杰', '15010191019', '孙俊杰', '15010191019', '2007年04月27日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区角门18号枫竹苑二区1号楼7层705', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区世界之花假日广场C4栋1001室', '', '烟道清洗', '有限责任公司（自然人独资）', '2007年04月27日', '2027年04月26日', '2018/5/11', '2019/5/10', '京消协（2018）证字110号', '9111010666157356X6', '排油烟设施清洗机构', '销售厨房用具、厨房设备、不锈钢制品、制冷设备、五金产品（不含电动自行车）、针纺织品、机械设备；清洁服务；劳务服务；清洗服务；厨具设备维修保养；专业承包；空调维修保养。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '公司简介：北京天锐杰厨房设备有限公司，成立于1998年，是一家集油烟管道清洗（消防认证）；厨房设备生产；厨具维修；大型中央空调系统清洗；装饰工程等综合性服务公司。竭诚为北京市各类宾馆、酒店、写字楼、机关单位、学校等提供各种一条龙一站式服务。', '116.371319', '39.834107000000003', '116.420344', '39.818941000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3709', '北京华融达科技有限公司', '742', '张林', '13011291562', '黄艳涛', '13810723916', '2000年08月01日', '1000万元', '北京市', '北京市', '朝阳区', null, '十里堡甲3号5号楼31A', '北京市', '北京市', '朝阳区', '八里庄街道', '十里堡甲3号5号楼31A', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2000年08月01日', '2020年07月31日', '2018/10/30', '2019/10/29', '京消协（2018）证字338号', '91110105721426204J', '排油烟设施清洗机构', '技术推广服务；清洁服务（不含餐具消毒）；企业策划；企业管理咨询；市场调查；财务咨询（不得开展审计、验资、查账、评估、会计咨询、代理记账等需经专项审批的业务，不得出具相应的审计报告、验资报告、查账报告、评估报告等文字材料）；会议服务；承办展览展示活动；设计、制作、代理、发布广告；产品设计；计算机系统服务；电脑图文设计、制作；销售机械设备、建筑材料、五金交电、电子产品、通讯设备、汽车配件、摩托车配件、仪器仪表、医疗器械（仅限I类）、计算机、软件及辅助设备、文具用品、日用品、工艺品、金属材料、服装、家用电器；室内装饰工程设计；园林绿化服务；物业管理；出版物零售；销售食品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华融达科技有限公司 创立于2000年，是集咨询、设计、生产、施工、服务为一体的科技环保企业，公司凭借着良好的技术背景、完善的管理体系、资深的专家队伍和广泛的院校机构合作网络，积累了丰富的技术和市场经验。公司长期致力于餐饮业环保治理和食堂烟道清洗服务，并得到环保部门和消防协会的认可，先后成为环保协会、消防协会会员单位。2012年4月加入央视网，并在环保服务方面获得黄金展位合作伙伴合作商。公司经过十几年实战经验积累，逐步形成独具特色、专业的餐饮一条龙全面服务。经营业务主要包括：项目环境影响咨询、通风工程设计与施工、噪声治理工程、油烟净化工程、通风设备维修、消防排油烟清洗服务等。\r\n企业成立至今，一直为致力于服务好每一家客户而不懈努力。多年来，我们不断的总结经验，提高服务水平，现已拥有一套完整的服务体系。坚持“以环保事业为中心，发展环保设备、工程和运营服务，发展清洗服务与环境咨询服务”的发展战略，力争成为北京餐饮业最专业的环保、清洗综合服务公司。', '116.50145999999999', '39.913609000000001', '116.50145999999999', '39.913609000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3710', '北京时代美林安全防范技术有限公司', '741', '解福华', '13801061467', '解福华', '13801061467', '2005年03月09日', '500万元', '北京市', '北京市', '西城区', null, '北京市丰台区菜户营甲88号2A号楼1605室', '北京市', '北京市', '西城区', '白纸坊街道', '北京市丰台区菜户营甲88号2A号楼1605室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年03月09日', '2025年03月08日', '2018/6/8', '2019/6/7', '京消协（2018）证字182号', '91110106771959236E', '排油烟设施清洗机构', '技术服务、技术咨询、技术推广；保洁服务；劳务派遣；劳务服务；设计、制作、代理、发布广告；经济信息咨询；会议服务；承办展览展示；建筑物清洁服务；厨房设备维修；管道清洗；防止病虫害的活动；园林绿化服务；销售空调制冷设备、机电设备、日用品、五金交电（不在实体店铺经营）、建筑材料（不在实体店铺经营）、装饰材料（不在实体店铺经营）、汽车配件；专业承包；劳务分包；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京时代美林保洁清洗公司成立于2005年，是一家经过正式注册，拥有合法经营执照的正规企业。专业提供厨房排烟系统清洗和维护服务！前身是北京隆兴达厨房设备维修部，成立于2002年，2005年3月份变更为现用名；2011年9月份天津分公司开业！\r\n   公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。每次清洗均提供清洗前后对比照片，清洗作业后7天无质量问题再付款；3个月内正常操作出现火灾事故由我公司承担损失；\r\n   本公司是一家拥有近十年城市清洁经验，是专业为酒店、宾馆、食堂、工厂、公司、饭店、单位提供油烟机清洗等一站式服务的专业清洗厨房油烟机公司，同时提供：地毯清洗，石材翻新、开荒清洁、沙发清洗等清洁服务，在北京市同行业中技术领先，服务方便、快速、高效，拥有全套进口清洁清洗设备。\r\n本公司采用专业的油烟机清洗剂和油烟机清洗设备，按照科学的油烟机清洗方法，为您提供优质高效的油烟机清洗维修服务，价格合理公道。清洗维修技师都具备多年清洗、维修、 安装经验，并不断吸收新的技术和先进的检测设备来满足广大客户的需求。', '116.347835', '39.870728', '116.347835', '39.870728', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3711', '北京三友安泰科技有限公司', '740', '闫海', '13601006766', '张玉琦', '15735150492 /01069513862', '2014年03月21日', '2000万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区迎宾南路11号五幢二层2213室', '北京市', '北京市', '朝阳区', '小红门地区办事处', '北京市朝阳区江南文化创意产业园19-2', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2014年03月21日', '2034年03月20日', '2019/2/27', '2020/2/26', '京消协（2019）证字067号', '91110116095352817C', '', '专业承包；技术开发、咨询、转让、服务；计算机系统服务；租赁建筑工程机械、建筑工程设备；组织文化艺术交流活动（不含演出）；影视策划；承办展览展示；设计、制作、代理、发布广告；销售安全技术防范产品、消防器材、服装、日用杂货、电子产品、工艺品、机械设备、体育用品、计算机、软件及辅助设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京三友安泰科技有限公司是一家基于物联网云技术而开展的消防火灾联网报警运营服务、防盗报警联网运营服务、智慧用电联网运营服务、远程监控联网运营服务、 防盗报警工程、视频监控工程、周界防范工程为主体的综合性安全服务运营公司。凭借高品质的产品、丰富行业运营经验、高水平及迅速周到的服务，赢得客户及同行业的信任和肯定。', '116.639675', '40.302295999999998', '116.474795', '39.820766999999996', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3712', '北京盛世鸿业清洁服务有限责任公司', '739', '吕绪锋', '13241068455', '吕绪锋', '13241068455', '2016年05月06日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北苑东路19号院1号楼', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区北苑东路19号院1号楼', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年05月06日', '2036年05月05日', '', '', '', '91110105MA005RPN53', '', '清洁服务（不含餐具消毒）；销售五金交电(不从事实体店铺经营)、玩具、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公 司 简 介      \r\n一、公司名称：北京盛世鸿业清洁服务有限责任公司\r\n二、主要业务：\r\nA) 宾馆、饭店、酒楼、餐厅厨房设备排烟系统、净化系统的清洁、维护与保养\r\nB) 地毯清洗及烟道改装\r\nC) 代理销售各种清洁剂及相关产品\r\n服务简介\r\n清洁标准\r\n1、烟罩同步烟道90%以上可以见到原有的内壁铁皮色，不残留块状干凅油垢；\r\n2、烟罩及灶台表面免费清洁，做到表面无油污，光亮整洁；\r\n3、风机叶轮达到表面90%以上能够见到底漆，电机底部无沉淀的油垢；\r\n4、外部烟道采用不同清洁方式达到不同的效果：i拆卸法可做到烟道内壁95%以上\r\n露出原有的金属颜色； ii  开孔法可做到烟道内壁85%以上露出原有的金属色；iii\r\n机械设备法只能清除表面60%左右的油污。\r\n服务特色：\r\n1、专业清洁油烟管道、风机、净化器等厨房排烟系统的公司\r\n2、公司有下属专业的施工队伍：向客户提供各项服务\r\n3、提供免费检测和优质的售后服务\r\n4、拥有世界先进的设备和技术，拥有丰富的实践经验\r\n5、拥有清洁前后的对比照片及清洁证明\r\n6、有专业的技术人员提供设备的维护、保养\r\n7、3年以上的专业清洁经验、有害生物防治经验、保障服务质量\r\n各项清', '116.440528', '40.042172000000001', '116.440528', '40.042172000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3713', '北京费尔消防技术工程有限公司', '737', '付奇光', '010-88392130', '杨女士', '010-88392130', '1991年12月01日', '4700万元', '北京市', '北京市', '西城区', null, '北京市海淀区三里河路17号甘家口大厦805室', '北京市', '北京市', '西城区', '展览路街道', '北京市海淀区三里河路17号甘家口大厦805室', '', '消防设施', '有限责任公司（自然人投资或控股）', '2012年03月19日', '2027年03月18日', '2018/10/30', '2019/10/29', '京消协（2018）证字331号', '91110108102060004R', '', '工程勘察设计；组装加工消防设备；建设工程项目管理；技术检测；可承担各类型消防工程的施工；技术开发、转让、咨询、培训、服务；销售五金交电、化工产品（不含危险化学品及一类易制毒化学品）、机械电器设备、办公设备、金属材料、建筑材料、开发后的产品；计算机系统集成；承接计算机网络工程；安装、维修机械电器设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京费尔消防技术工程有限公司（原北京市费尔消防技术工程公司）成立于1991年12月，是全国最早成立的消防企业之一，公司拥有完善的组织管理机构，具有科学的运行机制、先进的施工管理能力和完整的管理体系，在国内设有20余家分公司。公司拥有中华人民共和国建设部核发的消防设施工程专业承包壹级资质、消防工程设计甲级资质，并取得北京市建设委员会核发的建筑智能化工程专业承包贰级资质，注册资金为4700万元人民币。公司拥有一批实践经验丰富的高级技术人才,现有国家一、二级注册建造师20多名，中、高级技术管理人员50多名。公司已通过ISO9001：2000质量管理体系、ISO14001：2004环境管理体系、GB/T28001：2001职业健康安全管理体系认证。', '116.33326599999999', '39.927492999999998', '116.33326599999999', '39.927492999999998', '', null, null, null, null);
