INSERT INTO `t_fc_company` VALUES ('3717', '北京瑞祥顺保洁服务有限公司', '731', '赵蕊', '13716467246', '赵蕊', '13716467246', '2018年08月23日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区天竺地区府前一街13号5幢4层406室', '北京市', '北京市', '顺义区', '天竺地区办事处', '北京市顺义区天竺地区府前一街13号5幢4层406室', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年08月23日', '2068年08月22日', '2018/12/19', '2019/12/18', '京消协（2018）证字452号', '91110113MA01E8X81A', '排油烟设施清洗机构', '清洁服务；技术服务、技术转让、技术开发、技术推广、技术咨询；家庭服务；维修家用电器；施工总承包、专业承包、劳务分包；维修、租赁机械设备；城市园林绿化施工；销售机械设备；汽车租赁；家居装饰；风景园林景观设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '清洁服务，技术服务，技术转让。技术开发。劳务分包，维修家用电器。施工总承包，家居装饰，租赁机械设备等等', '116.580521', '40.061658000000001', '116.580521', '40.061658000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3718', '北京熠昇蓝天环保科技有限公司', '730', '张红杰', '13699140325', '王新', '15611231618', '2016年12月28日', '100万元', '北京市', '北京市', '顺义区', null, '龙湾屯镇焦庄户村后中小巷42号', '北京市', '北京市', '顺义区', '龙湾屯镇', '龙湾屯镇焦庄户村后中小巷42号', '', '', '有限责任公司（自然人独资）', '2016年12月28日', '长期', '2018/12/19', '2019/12/18', '京消协清证字（2018）050号', '91110113MA00B0XT4J', '排油烟设施清洗机构', '技术开发、技术咨询、技术服务、技术转让；城市生活垃圾清扫、收集（不含废旧物资回收）；清洁服务（不含餐具消毒）；大气污染治理；污水处理；环境治理；销售五金（不含电动自行车）、建筑材料（不含砂石及砂石制品）、环保设备、家用电器、机械设备；机动车公共停车场管理；城市园林绿化施工；体育运动项目经营（高危险性体育项目、承办体育比赛除外）；组织文化艺术交流活动（不含演出）；接受委托提供劳务服务（不含排队服务、对外劳务合作）；信息咨询（不含中介服务）；物业管理；专业承包、劳务分包、施工总承包；害虫防治服务；灭鼠及预防服务；人才中介服务；销售食品；销售林木种子；道路货物运输。（企业依法自主选择经营项目，开展经营活动；销售食品、销售林木种子、人才中介服务、道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京熠昇蓝天环保科技有限公司\r\n简介\r\n公司成立于2016年，注册实缴资金100万，已于2018年10月19日成为北京消防协会会员已取得北京消防协会颁发的《排油烟设施清洗》的专业资信证书，所有施工人员已在北京消防协会培训，已取得由北京消防协会颁发的《排油烟设施清洗》的资格认定上岗证书。\r\n我公司提供厨房油烟设备清洗服务，经发展公司已拥有数百家服务单位，业务遍布北京。主要业务大厦、酒楼、学校、医院、机关食堂、政府部门等餐厅厨房排烟系统清洗。有一大批专业技术工人和先进的清洗设备。已发展成为北京市专业的油烟设备清洗专业公司，因为更专业，所以我们会做得更好。 \r\n 公司经营范围： 清洗油烟罩、运水烟罩、脱水扇、抽油烟机、风机、油烟净化器、排油烟管（横管和竖管）、大型风管，为了更方便的为您服务，北京熠昇蓝天环保科技有限公司愿为您提供更快、更好、更全面的服务，关于清洗我们是专业的。如果签订长期清洗维修协议，价格更优惠民。\r\n我公司郑重承诺：\r\n一、清洁质量\r\n1、清洁质量符合北京市消防局《关于加强厨房烟筒、排油烟管道防火安全管理的通》的相关条例：\r\n2、每次清洁完毕均提供本次清洗的证明文件，包括清洗前后的对比照片', '116.872111', '40.233891999999997', '116.872111', '40.233891999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3719', '北京信诚环宇消防技术服务有限公司', '728', '贾娜', '18888840508', '邓守龙', '18610385899', '2009年02月26日', '500万元', '北京市', '北京市', '大兴区', null, '大兴区金星路12号院2号楼11层1213室', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '大兴区金星路12号院2号楼11层1213室', '', '电气防火,消防设施', '有限责任公司（自然人独资）', '2009年02月26日', '2029年02月25日', '2018/11/9', '2019/11/8', '京消协（2018）证字366号', '91110115685781013G', '电气防火检测技术服务机构', '消防安全技术咨询、服务；消防设施检测；电气技术防火检测；消防安全评估；消防设备维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京信诚环宇消防技术服务有限公司成立于2009年2月，我公司是经北京市工商行政管理局大兴分局注册，统一社会信用代码为：91110115685781013G；公司注册资金500万元；经营范围：消防安全技术咨询、服务;消防设施检测；电气技术防火检测。以下是我公司取得的相应资质：一、协会会员证，证书编号为京消协(2018)证字356号；二、电气防火检测技术服务机构资信证书，证书编号为京消协电证字（2018）090号；三、中华人民共和国消防技术服务机构资质证书，证书编号为京公消技字【2014】第026号；四、资质认定计量认证证书，证书编号为170121020600；五、质量管理体系认证证书，注册号01716Q10477R2S。', '116.350673', '39.762394', '116.350673', '39.762394', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3720', '北京海洋清洗有限公司', '727', '谢明芳', '60691645', '刘凤艳', '13552821905', '2010年07月23日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区庙城镇庙城293号院3号楼1层110', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '北京市怀柔区庙城镇庙城293号院3号楼1层110', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年07月23日', '2030年07月22日', '2018/8/29', '2019/8/28', '京消协（2018）证字286号', '91110116558502720K', '排油烟设施清洗机构', '清洗、维修机械设备、厨房设备、空调、家用电器；洗车；保洁服务；劳务服务（不含职业介绍）；销售厨房设备、家用电器、五金交电、化工产品（不含危险化学品、一类易制毒化学品）、建筑材料、日用杂货；经济信息咨询（不含中介服务）；建筑物清洁服务；零售烟草；销售食品。（企业依法自主选择经营项目，开展经营活动；零售烟草、销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京海洋清洗有限公司，成立于2010年，是一家集保洁服务、油烟管道清洗、厨房设备销售维修、大型中央空调系统清洗等综合性服务于一体的公司。\r\n公司配有专业的高压自动清洗设备和专业人员，运用专业的化学清洗技术，做到清洗后漆见光、板见亮等特点。公司员工都经过专业正规培训，并通过严格考核，熟练掌握相关技术。公司拥有严格的管理制度。我们以“美化环境、服务社会”为目的，以“您的满意就是我们的追求”为服务宗旨。我们将用先进的施工设备、一流的服务质量、精湛的工程技术尽心尽力地服务于单位、酒店、宾馆、机关、写字楼、娱乐场所等大型油烟系统、空调系统的清洗和保洁工作。\r\n我们将用我们的优势和特长给您留下一个舒适、干净、明亮的工作和生活空间。', '116.62248099999999', '40.296194999999997', '116.62248099999999', '40.296194999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3721', '北京中江旺盛消防装备有限公司', '726', '朱东均', '18001218151', '朱东均', '18001218151', '2008年05月22日', '110万元', '北京市', '北京市', '丰台区', null, '北京市丰台区卢沟桥晓月中路30-28', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区张仪村甲70号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2008年05月22日', '2028年05月21日', '2018/11/26', '2019/11/25', '京消协（2018）证字390号', '9111010667572041XY', '', '专业承包；销售消防器材、金属材料、五金交电、装饰材料、家用电器、文具用品、日用品、交通设施、电子产品、化工产品（不含危险化学品）、建筑材料；维修消防器材；技术检测；清洁服务；服装加工；货物进出口、技术进出口、代理进出口；机械设备租赁。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中江旺盛消防装备有限公司座落于中国历史文化名城北京丰台区卢沟桥边上，专业从事消防器材销售批发和维修检测灭火器、烟感清洗、消防电气检测、气体灭火系列维护保养等。自公司成立以来发展迅速，主营厂家直销各种消防呼吸器系列、消防战斗服装系列、个人装备系列、救生系列、阻燃灭火系列、多功能防护服装系列、手电系列等。产品具有相关部门检测报告及专利证书，并且在2015年开始进入北京市政府采购供应商信息库。所有销售的消防产品均通过国家消防装备质量监督检验中心机构检测合格，均具备国家消防装备质量监督检验中心核发的消防产品检验报告和消防产品型式认可证书。　　\r\n   公司的销售网络已遍布全国多个省市。继往开来，公司始终把产品质量放在首位，秉着“品质出众、服务第一、性能可靠、用户满意”的服务宗旨。以优质的产品、良好的信誉服务广大新老客户！,\r\n   公司秉承“互惠互利、共赢共进”的宗旨，愿意与社会各界进行广泛和多领域的合作。\r\n   我们真诚地回报社会的厚爱，以饱满的热情和坚定的信心与合作伙伴共同迎接辉煌的明天……', '116.22979599999999', '39.853183000000001', '116.22168499999999', '39.875644999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3722', '北京云涵日昌科技发展有限公司', '725', '陈福存', '13718679042', '陈福存', '13718679042', '2012年12月07日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区东三环南路19号院1号楼-2至15层101内十五层1505室', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区东三环南路19号院北区', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年12月07日', '2032年12月06日', '2018/9/26', '2019/9/25', '京消协（2018）证字300号', '911101050592762202', '排油烟设施清洗机构', '技术推广服务；清洁服务（不含餐具消毒）；销售机械设备、计算机、软件及辅助设备、日用品、电子产品、金属材料、工艺品、建筑材料（不在实体店铺经营）；经济贸易咨询；组织文化艺术交流活动（不含演出）；会议及展览服务；销售办公用品、文化用品、体育用品、日用品；电脑图文设计、制作；企业管理咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京云涵日昌科技发展有限公司：\r\n成立于2012年12月7日，是从事专业保洁公司、油烟管道清洗。公司服务做到想客户之所想，急客户之所急，让客户无忧满意为宗旨。公司设有业务部、工程部、专业清洗部、客户服务满意监督部、财务部等。另外，公司集开发、生产、销售清洗保洁产品及除味、除臭（除臭剂）产品。从事楼房开荒及日常保洁，宾馆、酒家等及连锁店的保洁服务。是一家具有新时代、新思想并创新服务现代新型保洁为主的朝阳公司。', '116.46002300000001', '39.868716999999997', '116.46002300000001', '39.868716999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3723', '北京京盾中安消防安全设备有限公司', '723', '姜忠', '18801260568', '姜忠', '18801260568', '2011年06月08日', '500万元', '北京市', '北京市', '丰台区', null, '大成里秀园13号楼东侧楼（卢沟桥企业集中办公区）', '北京市', '北京市', '丰台区', '卢沟桥街道', '大成里秀园13号楼东侧楼（卢沟桥企业集中办公区）', '', '消防设施', '有限责任公司（自然人独资）', '2011年06月08日', '2031年06月07日', '2018/10/12', '2019/10/11', '京消协（2018）证字310号', '911101065769246287', '', '销售消防器材、交通设施、建筑材料、五金交电、化工产品（不含化学危险品）、电子产品、公共安全设备、文具用品、体育用品、机械设备；维修消防器材、交通设施；清洁服务；专业承包；技术检测。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京京盾中安消防安全设备有限公司是一家综合性消防服务机构，专业进行消防器材检测维护保养；我单位立足京城，销售各类消防器材，业务现已逐渐扩大，产品质量符合国家标准，以质优价廉取得了良好的社会口碑，欢迎社会各界人士来电来函咨询。为了使广大客户使用到优质的产品，我公司与多家知名消防器材、消防设备厂家合作，并和行业知名企业厂家展开联营生产、合作，进而保证了产品的质量和供应链；', '116.26303', '39.892485999999998', '116.26303', '39.892485999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3724', '北京奥信建筑工程设备安装有限公司', '722', '赵剑', '84630667', '马赛', '84630667', '1999年09月14日', '8100万元', '北京市', '北京市', '朝阳区', null, '来广营西路5号院诚盈中心5号楼902、903、904单元', '北京市', '北京市', '朝阳区', '来广营地区办事处', '来广营西路5号院诚盈中心5号楼902、903、904单元', '', '消防安全评估,建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '1999年09月14日', '2029年09月13日', '2018/10/19', '2019/10/18', '京消协（2018）证字314号', '91110105700279882K', '', '专业承包；技术咨询；技术服务；信息咨询（不含中介服务）；消防安全评估；家居装饰设计；建筑工程设计；销售机电设备、化工产品（不含危险化学品）、建材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京奥信建筑工程设备安装有限公司成立于1999年，总部设立在北京，已经成为消防专业的全领域解决方案提供商和实施商。\r\n以8100万元注册资金起步，奥信历经20年蓬勃发展，资产规模突破6.3亿元人民币，在全国设有20多家分公司，连续多年被评为质量信得过企业、重合同守信用企业。在强手如林的消防工程市场、消防技术服务市场、建筑市场中占有一席之地，并逐步发展成为专业化、标准化、规范化、装备精良、配套完善、技术力量雄厚的综合性消防技术服务公司和建筑工程设备安装公司。\r\n奥信在改革开放大潮中应运而生、搏击成长，秉承“执著、诚信、创新、共赢”的经营理念，凭借苦练内功、技术创新，走出了一条富有时代烙印和自身特色的发展路径。', '116.465176', '40.021116999999997', '116.465176', '40.021116999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3725', '北京金鑫亚源环保科技有限公司', '719', '刘金', '13683581542', '刘金', '13683581542', '2014年02月25日', '800万元', '北京市', '北京市', '丰台区', null, '北京市丰台区郑常庄326号C座一层8118室', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区郑常庄326号C座一层8118室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年02月25日', '2034年02月24日', '2018/12/19', '2019/12/18', '京消协（2018）证字456号', '91110106092927937E', '', '害虫防治服务、灭鼠及预防；销售机械设备、厨房设备、五金交电（不含电动自行车）、电子产品、日用品、建筑材料、文具用品；污水处理；大气治理；技术开发、技术服务、技术推广、技术咨询；清洁服务；专业承包；园林绿化服务。（领取本执照后，应到区县住建委（房管局）、市园林绿化局取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金鑫亚源环保科技有限公司专业从事油烟管道清洗，风机，净化器清洗，厨房设备清洗等服务。公司拥有专业清洁队伍，先进专业的清洗设备，所有上岗人员均经过严格的培训和考核。为提高服务质量，先后引进专业化标准清洗设备多套，初步具备了清洗行业的规模化，专业化,努力为客户提供专业高效的高质量服务。\r\n\r\n油烟管道清洁服务范围：\r\n\r\n大型抽油烟机清洗服务：酒店、饭店、火锅店、医院、学校、部队、商场、机关单位等油烟机清洗，油烟管道清洗，风机清洗，油烟净化器清洗,等服务。\r\n\r\n企业目标： 成为清洗服务行业的领航者。\r\n\r\n质量目标： 质量满意率达到98%以上；客户满意率达到97%以上。\r\n\r\n我们的企业使命：为顾客创造价值，为员工创造机会，为社会承担责任。', '116.275442', '39.887337000000002', '116.275442', '39.887337000000002', '', null, null, null, null);
