INSERT INTO `t_fc_company` VALUES ('3729', '北京晟煜知达科技有限公司', '714', '马云飞', '13910413681', '马云飞', '13910413681', '2014年05月21日', '200万元', '北京市', '北京市', '大兴区', null, '北京市大兴区兴华大街二段波普中心4号楼1710', '北京市', '北京市', '大兴区', '清源街道', '北京市大兴区兴华大街二段波普中心4号楼1710', '', '烟道清洗,宣传教育培训,消防产品', '有限责任公司（自然人投资或控股）', '2014年05月21日', '2034年05月20日', '', '', '', '91110106399517043B', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；销售仪器仪表、计算机、软件及辅助设备、电子产品、机械设备、通讯设备、五金交电（不含电动自行车）、家用电器、工艺品、文化用品、体育用品、化工产品（不含危险化学品及一类易制毒化学品）；会议服务；旅游信息咨询；酒店管理；承办展览展示；经济信息咨询；票务代理（不含航空机票）；市场调查；组织文化艺术交流活动（不含演出）；保洁服务；清洁服务；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '设计研发环保清洗设备；代理销售清洗施工设备；清洗剂等', '116.33108300000001', '39.74736', '116.33108300000001', '39.74736', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3730', '北京华蕊清洗技术服务有限公司', '713', '李德忠', '13366608951', '李杰', '13366608951', '2015年06月02日', '1000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区黄村镇芦花路1号院10号楼1层138室', '北京市', '北京市', '大兴区', '黄村地区办事处', '北京市大兴区黄村镇芦花路1号院10号楼1层138室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年06月02日', '2035年06月01日', '2018/6/27', '2019/6/26', '京消协（2018）证字204号', '91110106344250417N', '排油烟设施清洗机构', '技术开发、技术服务、技术咨询、技术转让；清洁服务；维修机械设备、仪器仪表、家用电器；销售机械设备、电子产品、家用电器、日用品、建筑材料。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '	关于我们：北京华蕊清洗技术服务有限公司是开发、销售、KPC油烟净化设备,并承接烟道清洗工程，从事烟道清洗服务的现代新型环保公司。\r\n	公司理念：不懈的努力、不懈的追求是本公司永保活力的源泉 ，科学灵活的经营管理是本公司的成功的保证；客户至上，信誉第一，奉行诚信服务，是本公司赖以发展的宗旨。\r\n	个性服务特点：在签订合同的同时，以双方认可的样版为基础，互惠互助的合作的原则达成协议，以客户满意为验收标准，员工实行统一管理、统一形象、统一培训并注重企业形象力。\r\n	公司员工：所有上岗人员均经过严格的培训和考核。跟踪世界先进技术发展潮流，引进先进的清洁设备、清洁用品及先进的清洁保养理念，对高校、写字楼、酒店、机关单位的清洁管理运作贯以严格管理和规范服务。\r\n	公司设备：拥有一流的机械设备、进口高效清洁剂一套完整的清洗质量保证体系，严格按照服务程序，倡导星级保洁。\r\n	独到之处：对清洁行业中系列难处理的棘手问题都有独到的处理方法，可以做到洁白如新。\r\n特别指出：北京华蕊清洗技术服务有限公司对后厨油烟机、油烟管道有独到的处理方法，北京市消防局特别授予“质量服务合格达标单位”。\r\n\r\n非常感谢贵单位的', '116.284536', '39.790959999999998', '116.284536', '39.790959999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3731', '北京福升兴泰环保科技有限公司', '711', '梁东升', '18701259989', '梁东升', '18701259989', '2018年10月24日', '500万元', '北京市', '北京市', '延庆区', null, '北京市延庆区中关村延庆园风谷四路8号院27号楼1991', '北京市', '北京市', '延庆区', '', '北京市延庆区中关村延庆园风谷四路8号院27号楼1991', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年10月24日', '2038年10月23日', '2018/11/26', '2019/11/25', '京消协（2018）证字410号', '91110229MA01F8247J', '', '技术服务、技术咨询、技术推广；清洁服务；家庭服务；销售日用品、厨具卫具、建筑材料、化工产品（第一类中的非药品类易制毒化学品除外）、机械设备、文化用品、五金；劳务分包；维修家用电器；施工总承包、专业承包。（企业依法自主选择经营项目，开展经营活动；施工总承包、专业承包以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司经营厨房清洗，安装，改造', '115.921775', '40.368057999999998', '115.921775', '40.368057999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3732', '北京祈安顺达消防科技有限公司', '710', '王福旺', '13801100265', '赵丽荣', '13683088605', '2009年11月02日', '619万元', '北京市', '北京市', '大兴区', null, '旧宫镇庑殿路16号楼105', '北京市', '北京市', '大兴区', '旧宫地区办事处', '旧宫镇庑殿路16号楼105', '', '电气防火,消防安全评估,建筑防火,消防信息化,消防设施,消防安全检查,消防产品', '有限责任公司（自然人独资）', '2009年11月02日', '2029年11月01日', '2018/11/9', '2019/11/8', '京消协（2018）证字362号', '91110115696356645N', '电气防火检测技术服务机构', '消防科技开发、转让、咨询、服务；维修消防器材、监控设备；技术检测；专业承包；劳务分包；劳务服务；会议服务（不含食宿）；经济贸易咨询；设计、制作、代理、发布广告；组织文化艺术交流活动（不含演出）；承办展览展示；技术推广；图文设计；软件开发；企业管理咨询；租赁建筑机械设备；货物进出口；保洁服务；企业营销策划。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京祈安顺达消防科技有限公司，下设工程部、检测部、消防超市、器材修理厂、维保组等。公司在组建初期就完善了各项规章制度，制定了适合自己的服务方针、员工行为准则、人员培训制度、设备管理制度，以及各项业务工作管理制度、工作程序、检测报告编审、档案管理制度。在工作中严格按照各项规章制度执行，并顺利通过了质量管理体系认证。', '116.43822400000001', '39.819339999999997', '116.43822400000001', '39.819339999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3733', '北京华祥永安消防工程有限公司', '709', '陈永芬', '13910115837', '王永枫', '13912557525', '2011年07月13日', '3600万元', '北京市', '北京市', '丰台区', null, '南三环西路78号B座5层8号', '北京市', '北京市', '丰台区', '花乡地区办事处', '南三环西路78号B座5层8号', '', '电气防火,消防安全评估,建筑防火,消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2011年07月13日', '2041年07月12日', '2018/11/9', '2019/11/8', '京消协（2018）证字365号', '911101065790537099', '电气防火检测技术服务机构', '电气防火检测技术服务；建筑消防设施检测技术服务；技术开发、技术转让、技术咨询；清洁服务；技术推广。（领取本执照后，应到市质量技术监督局取得行政许可；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '《北京华祥永安消防工程限公司》是从事建筑消防设施、电气防火安全检测的专业检测技术服务公司。根据中华人民共和国消防法及有关政策规定, 公司面向各类场所提供消防设施检测、电气防火检测服务。公司拥有精良的检测设备（红外热像仪、红外测温仪、真有效电流表、数字微压计、照度计、火灾探测器实验装置等）。高级工程师从事多年消防施工、安装经验。\r\n我公司以热情的服务态度、严谨的工作作风、科学的检测手段和合理的收费价格，依据有关法规和消防规范对建筑设施、电气防火安全进行检测，出具科学的检测报告，并协助使用单位对设备故障进行维修、保养，保障了建筑的消防安全，赢得了社会各界的好评。\r\n在与时俱进的今天，公司将一如既往以科学、公正、准确、规范为行为准则，为您提供一流的检测质量和一流服务。为发展首都消防现代化，保障经济建设和人民生命财产安全做出贡献！', '116.3399', '39.847116999999997', '116.3399', '39.847116999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3734', '北京丽丽环保科技有限公司', '708', '张建军', '13522786631', '张建军', '13522786631', '2016年12月23日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区大红门桥东53号J1-224', '北京市', '北京市', '丰台区', '南苑地区办事处', '北京市丰台区大红门桥东53号J1-224', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年12月23日', '2036年12月20日', '2018/12/19', '2019/12/18', '京消协（2018）证字457号', '91110106MA00ATP776', '排油烟设施清洗机构', '技术服务；技术咨询；技术培训；清洁服务；劳务服务；城市园林绿化规划；室内装饰工程设计；销售花卉、化工产品(不含危险化学品)、机械设备；机械设备租赁；电脑图文设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京丽丽环保科技有限公司是一家专业从事厨房油烟管道清洗、排烟罩清洗。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供厨房油烟管道清洗，最优的解决方案。\r\n公司具有雄厚的专业技术实力，拥有一支经验丰富、技术过硬、以及高素质的清洗人员和知识创新能力强的设计人员，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成厨房油烟管道排烟系统清洗、维修等全系列工作。\r\n我们丰富的经验可广泛服务于所有使用油烟管道排烟系统的场所，包括写字楼、宾馆、饭店、商场、学校、机关单位等。\r\n您的健康是我们的责任，丽丽环保愿用自己的努力，为您提供一个洁净、健康、舒适的工作环境。为我们的家园多留一片洁净的蓝天。\r\n目前公司拥有各类职工66人，从事油烟管道清洗24人，其他各类职工42人，本公司会以先进的技术，严格的管理竭诚为您服务。\r\n公司理念：“精诚合作、精益求精、追求卓越”是本公司永保活力的源泉；科学灵活的经营管理是本公司的保证；客户至上，信誉第一，奉行诚信服务是本公司赖以发展的宗旨。', '116.40653500000001', '39.830654000000003', '116.40653500000001', '39.830654000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3735', '北京高炜懿德消防检测有限公司', '707', '高令辉', '13552188777', '刘鹏举', '13910835119', '2011年03月30日', '1000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区龙发大街1号院2号楼2单元一层B104', '北京市', '北京市', '大兴区', '魏善庄镇', '北京市大兴区龙发大街1号院2号楼2单元一层B104', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2011年03月30日', '2031年03月29日', '2019/3/6', '2020/3/5', '京消协电证字（2018）019号', '91110102571214723T', '电气防火检测技术服务机构', '技术检测、建设工程质量检测；建筑工程室内环境质量检测；技术开发、转让、咨询、服务；租赁机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京高炜懿德消防有限公司成立于2011年，注册资金1000万，固定资产500万，是一家北京市消防局备案认可的消防技术服务质量保障体系单位。取得了CMA计量认证证书、ISO9001质量管理体系认证证书、北京消防协会单位会员，北京市消防局颁发的中华人民共和国消防技术服务机构资质证书、电气防火检测资信证书、维护保养一级资质、是首都消防安全服务体系中的一个重要组成部分。\r\n       公司技术精湛、设备先进、服务优质、价格合理、高效公正。拥有专业技术人员26人，其中高级工程师3人、工程师5人，一级注册消防工程师10人，均通过了消防（构）筑物消防员国家考试，持证上岗，拥有消防设施检测最先进的仪器设备并通过检定和校准、电气防火安全检测设备采用先进的热成像仪、红外测温仪等设备并通过检定和校准、灭火器维修检测设备2套、消防安全应用软件1套。采集到的检测数据严格按照国家规范逐一比对，为受检单位提供真实有效的书面报告，及时发现安全隐患，免费做整改指导及中控人员培训，为受检单位的防火安全负责，替受检单位主管同志们分忧解难。', '116.399017', '39.682436000000003', '116.399017', '39.682436000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3736', '北京四方亚明安防工程有限公司', '706', '于小明', '13801022664', '李冬梅', '13601205645', '2002年09月26日', '500万元', '北京市', '北京市', '海淀区', null, '阜成路115号北京印象1号楼1门1018号', '北京市', '北京市', '海淀区', '八里庄街道', '阜成路115号北京印象1号楼1门1018号', '', '消防设施', '有限责任公司（自然人投资或控股）', '2002年09月26日', '2022年09月25日', '2019/1/11', '2020/1/10', '京消协（2019）证字005号', '91110108743346715U', '', '专业承包；工程勘察设计；销售机械设备、安全技术防范产品、五金交电、金属材料、电子产品、化工产品（不含危险化学品及一类易制毒化学品)；技术开发、技术咨询、技术服务；技术检测；消防器材维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京四方亚明安防工程有限公司成立于2002年，是北京安防协会常务理事单位、2004-2015年通过国际ISO9001质量管理体系认证。是北京市消防协会会员单位、是北京市消防局批准的消防器材维修单位。公司具有灭火器维修高科技检测设备与技术，拥有高素质的专业化维修检测队伍。公司从事维修检测的人员均具有多年的维修检测经验，依据公安部第129号令《社会消防技术服务管理规定》的要求，经北京市消防协会考核并取得灭火器维修检测上岗证书，引进了先进的灭火器维修检测设备：灭火器清洗水压一体机、灭火药剂灌装机、灭火器筒体烘干机、气密试验设备、灭火器驱动气体灌装设备机及压力指示器示指检验台等。为提高维修检测质量奠定了物质基础和技术基础，也充分展示了维修检测技术的科技含量。', '116.27825199999999', '39.925054000000003', '116.27825199999999', '39.925054000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3737', '北京汇诚骏景科技有限公司', '703', '李瑞鑫', '010-65001686', '于祥杰', '18910136923', '1998年02月24日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区东坝乡东小井甲1号', '北京市', '北京市', '朝阳区', '金盏地区办事处', '北京市朝阳区东坝乡东小井甲1号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1998年02月24日', '2028年02月23日', '2018/5/11', '2019/5/10', '京消协（2018）证字113号', '91110105699565653A', '', '技术开发、技术服务、技术咨询、技术转让；劳务派遣；企业管理咨询；投资咨询；经济贸易咨询；专业承包；销售建材、电子产品、日用品、机械设备、厨房用具、五金交电、家用电器、化妆品、卫生间用具（不得从事实体店铺经营）、化工产品（不含危险化学品）、社会公共安全设备及器材；电脑图文设计、制作；组织文化艺术交流活动（不含演出）；会议服务；承办展览展示活动；清洁服务（不含餐具消毒）；害虫的防治；灭鼠及预防服务；摄影服务；租赁摄影器材；出租办公用房；日用电器修理（不符合家用电子电器维修业服务经营规范不得开展经营活动）；租赁建筑工程机械设备；餐饮服务；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品、餐饮服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市骏景酒店用品有限责任公司(以下简称骏景公司)成立于1998年，是注册于朝阳区的专业的清洁剂设备和清洁剂生产的公司。本公司经过多年的努力和实践，承接了各大饭店、企事业机关厨房的清洁剂的供应。通过给客户清洗剂供应的工作过程中，许多客户提出了厨房烟道清洗的需求，于是骏景公司在2007年4月增加了厨房油烟道清洗的服务项目。同时通过了北京消防协会评审委员会批准。（消协证字（2007）36号证书。', '116.58968900000001', '39.946421999999998', '116.58968900000001', '39.946421999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3738', '北京鑫盛焰环境科技有限公司', '702', '郭莹', '18147630361', '郭莹', '18147630361', '2018年12月03日', '300万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳万兴路86号-A4424', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区长阳万兴路86号-A4424', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年12月03日', '2068年12月02日', '2018/12/28', '2019/12/27', '京消协（2018）证字494号', '91110111MA01FXR44B', '', '技术开发、技术咨询（中介除外）、技术推广、技术服务、技术转让；害虫防治服务；清洁服务（不含洗车服务）；园林绿化服务；市场调查；大气污染治理；水污染治理；销售中低毒农药、化工产品（危险化学品除外）、建筑材料；化粪池清掏。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫盛焰环境科技有限公司是一家以有害生物防制、清洁服务，室内空气治理及虫害药械销售为一体的综合性服务型公司，拥有数名经验丰富的害虫防控专业技术人员及先进的消杀设备，致力于营造良好健康安全的生活环境。\r\n本公司所用的药品均为国家药检部门和卫生疾控部门批准的安全、低毒、环保的城市卫生用药，证件齐全。主要服务于家庭，商场超市、餐饮酒店、医院学校、机关及其他公共设施卫生等场所。\r\n本公司秉着以人为本的服务理念，将客户的需求放在第一位，努力做好承诺过的每一件小事！', '116.169729', '39.775677000000002', '116.169729', '39.775677000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3739', '北京青道夫科技有限公司', '701', '孟祥金', '15010862805', '孟祥金', '15010862805', '2018年03月28日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳万兴路86号-A3491', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区长阳万兴路86号-A3491', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年03月28日', '2068年03月27日', '2018/5/11', '2019/5/10', '京消协（2018）证字113号', '91110105MA01B2QK27', '', '技术推广服务；清洁服务（不含洗车服务）；害虫防治服务；销售化工产品（不含危险化学品及一类易制毒化学品）、生物制剂（药品除外）、化肥、中低毒农药、花卉、苗木、观赏植物。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京青道夫科技有限公司成立于2018年，注册资金200万，是一家刚成立的创新型专业从事排油烟设施清洗公司。\r\n 团队人员统一经过北京市消防协会专业技能知识培训，并通过严格的考试，公司为北京市消防协会会员单位。\r\n公司主要服务于各单位食堂，餐饮服务公司，食品加工企业。公司以“高效服务，质量第一”为核心价值，希望通过我们的专业服务和不懈努力，重塑中小企业形象。\r\n   北京青道夫科技有限公司秉承以实惠客户，成就员工，满足公司的精神利用公司各项管理制度及按照协会培训施工方法为每位合作客户提供最专业的排油烟设施清洗服务。\r\n我们的成长离不开您的支持！', '116.169729', '39.775677000000002', '116.169729', '39.775677000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
