INSERT INTO `t_fc_company` VALUES ('3741', '北京京广兴业科技发展有限公司', '697', '倪玲玉', '15210051801', '倪玲玉', '15210051801', '2013年04月25日', '300万元', '北京市', '北京市', '大兴区', null, '北京市大兴区团结路19号院20号楼4层2单元408', '北京市', '北京市', '大兴区', '庞各庄镇', '北京市大兴区团结路19号院20号楼4层2单元408', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年04月25日', '2033年04月24日', '2018/12/19', '2019/12/18', '京消协清证字（2018）048号', '91110108067299713W', '排油烟设施清洗机构', '技术开发、技术转让、技术咨询、技术服务、技术推广；建筑物清洁服务；维修办公设备；维修仪器仪表；修理家用电器；修理非家用制冷、空调设备；清洗厨房设备；销售日用品、电子产品、五金产品（不含电动自行车）、家用电器、计算机、软件及辅助设备、通讯设备、机械设备、厨房用具；病虫害防治。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京广兴业科技发展有限公司成立于2013年4月25日，公司员工经过消防局考试达到了消防局要求的资格。经过五年来积累的经验员工技术过硬，有较高的作业本领。为树立我们自己的形象，人人苦练基本功，争创同行的榜样。', '116.31676', '39.630617000000001', '116.31676', '39.630617000000001', '', null, null, null, null);
