INSERT INTO `t_fc_company` VALUES ('3743', '北京中兴久安技术检测有限公司', '694', '李铁寅', '15601290868', '张权', '13321152440', '2009年04月21日', '400万元', '北京市', '北京市', '西城区', null, '北京市西城区黄寺大街26号院德胜置业大厦5号楼1003室', '北京市', '北京市', '西城区', '德胜街道', '北京市西城区黄寺大街26号院德胜置业大厦5号楼1003室', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2009年04月21日', '2039年04月20日', '2018/10/30', '2019/10/29', '京消协（2018）证字325号', '91110102688360177F', '电气防火检测技术服务机构', '消防设施技术检测；技术咨询、服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中兴久安技术检测有限公司是北京市消防协会会员单位之一，经北京消防协会专家评审委员会评审，具备建筑消防设施检测和电气防火检测资质的企业。\r\n本公司组建伊始，就制定了长远的发展规划，以及检测工作程序，配备先进的检测仪器，制定了适合本行业、本公司的服务方针、员工行为准则、人员培训制度、设备管理制度、检测报告编审制度、检测档案管理制度。在工作中严格按照各项规章制度执行。\r\n本公司高级工程师和技术员具有消防局认证的检测资格，有多年的相关经历和极强的处理、解决现场问题的能力，从事过多种现场检测任务和丰富的检测经验，以确保整个检测工作的顺利进行和圆满完成。\r\n本公司同时承接消防设备检修维护、消防技术咨询服务，本公司以安全、科学、严谨、公正的态度为客户服务，为首都的消防安全贡献自己的力量。', '116.382403', '39.961865000000003', '116.382403', '39.961865000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3744', '北京长城研修学院', '693', '李儒树', '13911891241', '沈禛', '17600406718', '', '', '北京市', '北京市', '大兴区', null, '凉水河一街20号', '北京市', '北京市', '大兴区', '北京经济技术开发区', '凉水河一街20号', '', '建筑防火,消防信息化,事故调查', '民办学校', '', '', '', '', '', '121100004006406644', '', '', '北京长城研修学院创立于2000年1月，是北京市教委批准的民办非学历高等教育机构。学院现位于北京（亦庄）经济技术开发区，毗邻奔驰、可口可乐、IBM、京东方、京东集团等世界500强名企。拥有完善的教学设施和雄厚的师资力量。近年来，学院大力发展以就业为导向的职业化教育，目前与全国200多所教育机构及多所高校建立了良好合作关系，并为开发区多家知名企业开展战略咨询和企业管理咨询。2011年学院荣获最受认可“十大民办高校”称号、“全国民办高等教育机构优质特色院校”称号等殊荣。', '116.51131100000001', '39.765965000000001', '116.51131100000001', '39.765965000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3745', '北京中青源环保科技有限公司', '692', '刘于忠', '13910149229', '田海燕', '13366572648', '2016年04月08日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区黄村镇芦花路1号院24号楼1层1-1号A101-10', '北京市', '北京市', '大兴区', '黄村地区办事处', '北京市大兴区黄村镇芦花路1号院24号楼1层', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年04月08日', '2036年04月07日', '2018/6/15', '2019/6/14', '京消协（2018）证字193号', '91110106MA004P103H', '', '技术推广服务；清洁服务；劳务服务；环境监测；技术检测；销售厨房设备、机械设备、公共安全设备、办公用品、化工产品（不含化学危险品）、日用品、酒店用品、办公设备、安全技术防范产品、防水材料；家居装饰；装饰设计；劳务分包；病虫害防治。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中青源环保科技有限公司是一家具有现代企业管理模式的有限责任公司，公式致力于清洗保洁和营销为一体的高薪技术环保企业，专业从事厨房排油烟设施清洗、地毯清洗、玻璃幕墙清洗、，厨房设备维修改造等劳务服务。针对餐饮行业所需求的排油烟设施清洗工作，可进行排烟罩、油烟管道、排烟风机以及排烟净化器等一系列的排烟设备清洗，做到“预防为主，防消结合”。为首都的消防安全做出了重大贡献。得到了有关部门和社会的认可。\r\n本公司注册资金500万人民币，设备先进。同时，我们与有关机构和专家保持着良好的合作关系，大大加强了我们的技术能力，有力的保证了企业的发展势头。坚持“以质量求生存，以信誉求发展”的理念贯穿于研发、清洗服务的各个环节，加强技术交流，走科技型、综合性的发展道路，促进了宾馆、酒店、食堂和食品加工的安全生产工作。\r\n资源共享、优势互补，实现双赢的市场竞争必然的走势，北京中青源环保科技有限公司为更好的服务于餐饮行业，服务于社会，提供更先进、更安全、优质可靠的排油烟设施清洗工作，为客户提供全面的售前、售后服务。', '116.285307', '39.787947000000003', '116.285307', '39.787947000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3746', '北京晶慧焱保洁服务有限公司', '690', '代先勤', '13621161004', '刘长成', '13521072364', '2013年02月19日', '50万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区迎宾南路11号五幢二层2213室', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '北京市怀柔区迎宾南路11号五幢二层2213室', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年02月19日', '2033年02月18日', '', '', '', '91110116062822974U', '', '建筑物清洁服务；厨房设备、机器和办公设备的清洗；技术开发、转让、咨询、服务；销售电子设备、机械设备、计算机及辅助设备、软件、仪器仪表；专业承包；城市园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京晶慧焱保洁服务有限公司是一家有独立法人资格专业性油烟管道清洗公司，承接各种酒店、宾馆、大厦、机关食堂等。公司管理人员和专业人员具备有丰富经验和熟练的专业技能，所有的操作人员都经过岗前培训，使用专业的清洗设备及清洁剂等，严格按照熟练的技术进行操作。\r\n公司进过多年的实践经验，已经建立一批专业化、管理体系的一支团队，不论是西餐、中餐烟道清洗，都达到各客户满意为标准。\r\n完善管理、服务至上、质量第一是我公司成功发展的服务宗旨，我公司全体员工愿以一流的服务，优惠的价格为广大客户提供一个优美、干净的后厨环境，愿我们的合作能给客户带来愉快的心情！', '116.639796', '40.302256999999997', '116.639796', '40.302256999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3747', '中超伟业建筑工程有限公司', '689', '陈明芽', '13911987666', '陈志新', '18611665605', '2017年04月21日', '5000万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区斋堂大街45号科技楼ZT082室', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南三环西路91号院宝隆大厦三层', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2017年04月21日', '2047年04月20日', '', '', '', '91110109MA00DQUC89', '', '施工总承包；专业承包；劳务分包；物业管理；保洁服务；销售机械设备、建筑材料、装饰材料、消防器材、五金交电、水暖器材；技术开发、咨询、转让、推广、服务；经济信息咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中超伟业建筑工程有限公司，注册资金5000万元，是一家以建筑装饰装修、建筑幕墙、消防工程、市政公用工程、建筑总承包、钢结构工程、环保工程等工程服务为一体的专业建筑公司。公司拥有：消防设施工程专业承包贰级资质、建筑装修装饰工程专业承包贰级、建筑幕墙工程专业贰级、市政公用工程施工总承包叁级、环保工程专业承包叁级、钢结构工程专业承包叁级、建筑工程施工总承包叁级。', '115.69638999999999', '39.972375999999997', '116.332672', '39.850287000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3748', '北京普瑞天泽科技有限公司', '688', '李筝', '52880867', '董明', '13311106312', '2004年06月18日', '500万元', '北京市', '北京市', '东城区', null, '幸福大街甲39号', '北京市', '北京市', '东城区', '龙潭街道', '幸福大街甲39号', '', '烟道清洗', '有限责任公司（自然人独资）', '2004年06月18日', '2034年06月17日', '', '', '', '911101087675488569', '', '技术推广、技术咨询、技术服务；大气污染治理；水污染治理；维修机械设备；害虫防治服务；建筑物清洁服务；修理非家用制冷空调设备；城市园林绿化服务；销售机械设备、电子产品、家用电器、化工产品（不含危险化学品及一类易制毒化学品）、金属材料、服装鞋帽、文化用品；建设工程项目管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京普瑞天泽科技有限公司是致力于以中央空调通风系统清洗与消毒、中央空调水系统清洗与水处理、中央空调机组维修与保养、空气过滤器清洗、室内空气净化项目及净化设备销售、厨房油烟系统清洗与维护等为主营业务的综合型企业。\r\n北京普瑞天泽科技有限公司依托一批经验丰富的高级技术人员和专业施工队伍，结合多年来实际施工经验和工艺技术，采用实用性极强、技术最为领先的设备，为大量的公司、学校、超市、写字楼、商业地产等大型综合场所进行清洗服务。\r\n公司严格贯彻执行《公共场所集中空调通风系统卫生管理办法》（北京市人民政府令第224号）及《公共场所集中空调通风系统卫生管理规范》（DB11/485---2011），使空气质量全面改善，真正为现代都市人营造健康卫生的生存环境。\r\n严格贯彻执行《北京市排油烟设施清洗行业管理办法》，本着“服务社会、合法公正、安全第一”的原则，遵循行业规则，严格工作责任，保证服务质量。\r\n北京普瑞天泽科技有限公司为创建和谐、绿色北京，始终秉持“优质的设备、高效的服务、合理的价格”和“客户至上”的经营理念，不断引进国外高端技术、不断倡导中央空调健康清洗，让我们的生活更健康......', '116.43047', '39.888767999999999', '116.43047', '39.888767999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3749', '北京博润立方环保科技有限公司', '687', '彭成', '15911163329', '彭成', '15911163329', '2015年11月25日', '100万元', '北京市', '北京市', '丰台区', null, '南三环西路91号院1号楼301-733室', '北京市', '北京市', '丰台区', '新村街道', '南三环西路91号院1号楼301-733室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年11月25日', '2035年11月24日', '2018/6/27', '2019/6/26', '京消协（2018）证字209号', '91110106MA0024P24T', '排油烟设施清洗机构', '技术推广、技术开发、技术服务、技术咨询；城市园林绿化设计；清洁服务；劳务服务；经济信息咨询；销售电子产品、机械设备、家用电器、日用品。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京博润立方环保科技有限公司自2015年成立以来，历经磨难，凭着自强不息的奋斗精神，现已发展成为管理完善，技术先进的企业，迅速地成为了北京市保洁清洗企业之一。以质量、信誉赢发展；以实现自我价值，服务大众为企业宗旨，立足北京，面向全国。\r\n我们无法选择历史，但我们可以把握今天。公司全体员工本着“质量保证、服务专业”的原则竭诚为广大客户提供优质服务。', '116.33291', '39.850259999999999', '116.33291', '39.850259999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3750', '北京隆开源消防安全检测中心', '686', '谢金建', '13501011551', '崔亚峰', '13701125551', '2002年05月23日', '410万元', '北京市', '北京市', '朝阳区', null, '北京市西城区北三环中路甲29号院2号楼A-303室', '北京市', '北京市', '朝阳区', '德胜街道', '北京市西城区北三环中路甲29号院2号楼A-303室', '', '电气防火', '集体所有制（股份合作）', '2002年05月23日', '2032年05月22日', '2018/8/1', '2019/7/31', '京消协（2018）证字252号', '911101027393884960', '电气防火检测技术服务机构', '消防安全检测；消防技术咨询；消防安全评估；消防技术服务；维修消防设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京隆开源消防安全检测中心是经国家工商行政管理局注册、北京市消防局、北京市消防协会正式批准注册的专业消防、电气检测单位，同时也是北京市消防协会会员单位。专业提供消防设施检测、维修保养活动。公司技术力量雄厚，技术人员均具有多年检测、维保经验。\r\n公司依照现代企业管理模式建立一套完整严密的组织机构和管理程序。不仅能为客户及时有效地提供最优秀的专业技术服务且保证检测过程的客观、公正、科学和准确性。', '116.382891', '39.971463999999997', '116.382891', '39.971463999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3751', '北京松诚普阳环保科技有限公司', '685', '徐继春', '13811051402', '常福升', '13426487625', '2013年11月14日', '500万元', '北京市', '北京市', '海淀区', null, '北京市海淀区清河朱房南街临甲6号', '北京市', '北京市', '海淀区', '清河街道', '北京市海淀区清河朱房南街临甲6号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年11月14日', '2033年11月13日', '2018/5/30', '2019/5/29', '京消协（2018）证字158号', '91110108082837698N', '', '技术开发、技术转让、技术服务、技术推广；销售首饰、工艺品、计算机、软件及辅助设备、电子产品、日用杂货、厨房用具、机械设备、五金交电（不含电动自行车）、建筑材料、仪器仪表、通讯设备（卫星接收设备除外）、金属材料；组织文化艺术交流活动（演出除外）；承办展览展示；会议服务；设计、制作、代理、发布广告；机器和办公设备的清洗；锅炉烟囱的清扫；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；建筑物清洁服务；维修办公设备；经济贸易咨询（中介除外）；市场调查；租赁机械设备（不含汽车租赁）；货物进出口（国营贸易管理货物除外）、技术进出口、代理进出口；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京松诚普阳环保科技有限公司，是一家工商局注册，拥有合法经营执照的正规的公司，注册资本500万元。专业从事中央空调清洗、中央空调维修，厨房排烟系统清洗、维修、保养。公司工程已经涵盖企事业单位、宾馆酒店、写字楼、大型商场超市、医院、车站、学校等各种场所，遍及京津冀地区。并得到了客户的一致好评和行业的推荐。\r\n我公司拥有专业技术人员和一线施工人员12人，经过多年施工，积累了丰富的经验，可以有效的去除顽固的油渍、污渍等问题，清洗效率达到90%以上。所使用的清洗材料均符合国家标准，绿色环保，无污染。\r\n公司自成立以来，一直坚持“质量第一、诚信经营、合作共赢”的经营理念，立足当下，着眼未来，在与客户的共同成长中逐步发展壮大，赢得了社会各界的广泛认可和充分肯定。公司在各项目施工中坚持“高标准，严要求”的原则，严格把好管理关，从而保证工程的施工质量。 为客户提供一流的服务。', '116.328644', '40.02655', '116.328644', '40.02655', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3752', '北京康宇信达环保科技有限公司', '684', '孙朝军', '15210670258', '孙朝军', '15210670258', '2016年06月28日', '50万元', '北京市', '北京市', '房山区', null, '北京市房山区顾八路1区1号-S928', '北京市', '北京市', '朝阳区', '小红门地区办事处', '北京市朝阳区成寿寺路150号天雅五金机电城2层B06', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年06月28日', '长期', '2019/1/17', '2020/1/16', '京消协（2019）证字035号', '91110106MA006K119P', '', '技术开发、技术推广、技术服务、技术咨询（中介除外）；清洁服务（不含洗车服务）；经济信息咨询；会议服务；组织文化艺术交流活动（演出除外）；承办展览展示；消防器材检测；维修机械设备、空调制冷设备；家庭劳务服务；施工总承包；专业承包；劳务分包；销售办公用品、化工产品（不含危险化学品）、电子产品、消防器材、机械设备、厨房设备；网上经营文化用品（音像制品除外）、办公用品、消防器材、机械设备、日用杂品、电子产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京康宇信达环保科技有限公司,成立于2016年6月28日，注册资金50万。该公司是一家正规注册、实力雄厚专业从事技术服务、技术开发、清洁服务、消防器材检测、家庭劳务服务、施工总承包、专业承包服务性公司。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进设备的基础上，为多家商场、写字楼、大厦及家庭提供了多方位的开荒保洁和清洁服务，公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训的员工才能上岗。公司的创业宗旨：服务到位、质量到位、廉价高效、技与时新、着重长远、发展未来。公司的创业精神：敬业爱岗、奉献拼搏、永久服务、争创一流。公司的服务忠旨是：达到您的满意才是我们要做的；达到您的完美才是我们追求的。 我们以一流的服务为您创造了整洁、舒适的娱乐环境，让您感受到，在我们精心的的努力下，给你的工作、生活带来了美好改变。发展未来我们公司希望能与各界朋友携手合作 。', '116.015978', '39.705956', '116.44861899999999', '39.837240000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3753', '北京耀弘环保科技有限公司', '683', '罗海燕', '18510332158', '刘硕', '13466633397', '2017年12月04日', '200万元', '北京市', '北京市', '顺义区', null, '北京市顺义区石园东区28号楼1-102', '北京市', '北京市', '顺义区', '石园街道', '北京市顺义区石园东区28号楼1-102', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年03月29日', '长期', '', '', '', '92110113MA0199CE2G', '', '技术开发、技术咨询、技术服务、技术转让、技术推广；风景园林景观设计；城市园林绿化施工；大气污染治理；种植业（不含野生植物、种子、芦荟、麻醉药品原植物、草皮）；花卉租摆；家庭服务；清洁服务（不含餐具消毒）；接受委托提供劳务服务（不含劳务派遣、排队服务、对外劳务合作）；销售苗木（种苗除外）、I类医疗器械、II类医疗器械、机械设备、建筑材料（不含砂石及砂石制品）、装饰材料、皮革制品、日用百货、珠宝首饰、花卉、日用杂品、橡胶制品、工艺品（文物、象牙及其制品除外）、服装鞋帽、针纺织品、家具、文化用品、办公用品、家用电器、木材、玩具、五金（不含电动自行车）、电子产品、化妆品、金属材料（不含电石、铁合金）、通讯器材；维修通讯器材；室内装饰设计；家居装饰；机械设备租赁；专业承包、劳务分包；销售食品；美容（不含医疗性美容）、理发；道路货物运输。（企业依法自主选择经营项目，开展经营活动；销售食品、道路货物运输、美容（不含医疗性美容）、理发以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京耀弘环保科技有限公司从事油烟管道清洗，大型油烟机清洗，油烟净化器清洗，酒店、食堂、学校、机关单位油烟管道清洗，业务涵盖北京。\r\n公司服务理念：\r\n人性化、普及化，推陈出新，锐意进取，双赢理念，踏实做人、专业北京服务.全天候、全方位、全心全意地为您提供一条龙北京服务。业内首推“快而美”优质的北京服务，做最诚信的公司，提供最专业的服务，是我们的服务宗旨。为了您厨房的安全、放心使用，请相信北京耀弘环保科技有限公司、您给的每一次机会，我们会用100%的热情去对待。您给的信任！我绝不辜负！\r\n烟道清洗定义：\r\n由于餐厅厨房的排烟管道经过长期使用，会在表面沉积一层油垢，如果不及时进行清洗，非常容易引发火灾，所以要定时进行油烟管道清洗、排烟罩清洗、油烟净化器清洗、灶台清洗、风机清洗、环保网清洗、风涡轮清洗，以免发生危险。我公司经过多年施工，积累了丰富的经验，可以彻底为用户消除火灾隐患。', '116.66529300000001', '40.111527000000002', '116.66529300000001', '40.111527000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3754', '北京速洁鑫源科技有限公司', '682', '冯林英', '13717711718', '冯林英', '13717711718', '2015年10月16日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区汽车博物馆东路6号3号楼1单元12层1201-E38（园区）', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区绿岛', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年10月16日', '2035年10月15日', '2018/12/28', '2019/12/27', '京消协（2018）证字472号', '91110106MA0019E143', '排油烟设施清洗机构', '技术开发、技术服务、技术转让、技术咨询、技术推广；清洁服务；会议服务；翻译服务；庆典服务；计算机系统服务；打字、复印；企业策划；组织文化艺术交流活动；承办展览展示活动；经济信息咨询；电脑图文设计；销售日用品、文具用品、体育用品、计算机软硬件及辅助设备、通讯器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京速洁鑫源科技有限公司成立于2005年，公司前身为北京金燃燃具销售中心，是一家专业从事星级酒店、宾馆、学校、工厂、医院等企事业单位厨房排烟系统及其他厨房设备清洗和维护的专业厨房清洗公司。我们拥有最专业的清洗队伍、最先进的清洗设备、最高效环保的清洗药水，最严格的操作标准、最优质的解决方案、最一流的服务质量、最完善的安全管理体系来满足广大客户的要求。\r\n       公司拥有一支高素质专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的职业素质考核并由消防协会颁发《排油烟设备清洗人员技术培训》证书才可进行上岗作业，专业的团队可确保高效，优质的为广大客户提供最优质的服务。\r\n       公司自创办以来，先后为北京及河北、天津等地区数百家单位提供了高标准、高质量、高要求的清洗清洁服务，得到了各界企业的高度赞扬，更获得了北京市消防局的专业认可，并在长期的厨房清洗工作中积累了丰富的经验，始终坚持客户至上、信誉第一、奉行诚信的服务总之。', '116.30412', '39.826866000000003', '116.548064', '39.917116', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3755', '北京蓝博同创环保科技有限公司', '680', '黄瑞春', '18811080067', '黄海萍', '13911829265', '2003年12月24日', '800万元', '北京市', '北京市', '顺义区', null, '北京市顺义区高丽营镇六村玉石井东街38号', '北京市', '北京市', '顺义区', '高丽营镇', '北京市顺义区高丽营镇六村玉石井东街38号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2003年12月24日', '2023年12月23日', '', '', '', '911101137577230324', '', '技术服务、技术开发及转让、技术咨询（不含中介服务）；施工总承包、专业承包；清洁服务（不含餐具消毒）；城市园林绿化施工；风景园林景观设计；为社会提供劳动服务；承办展览展示；销售环保设备、通讯设备、电气设备、制冷设备、装饰材料、玻璃钢制品、化工产品（不含危险化学品及一类易制毒化学品）、五金（不含电动自行车）、通风设备、建筑材料（不含砂石及砂石制品）；技术进出口、货物进出口、代理进出口；接受委托提供劳务服务（不含排队服务、对外劳务合作）；加工制造环保设备、厨房设备、不锈钢制品（不含表面处理作业）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '  　 北京蓝博同创环保科技有限公司是专业从事环保科技产品研发、生产、销售及服务于一体的高新技术企业。公司拥有强大的技术研发能力，并取得多项专利。公司主要产品有等离子油烟净化器系列、工业废气净化器、焊接烟尘净化器等产品及系统工程设计达到国家先进水平。为酒店餐饮业，机加工业，厂房洁净等一大批知名企业提供高品质的空气净化产品和系统服务。\r\n　　蓝博同创公司的等离子净化系列产品质量达到了当前行业的领先水平，产品通过国家权威部门检测各项性能优异，并取得中国环境保护的产品认证、国家高新企业认证。产品的主要技术性能指标及去除油烟的效率指标均超过了国家标准与行业标准。并通过ISO9001:2008质量管理体系认证。蓝博同创公司一贯秉持“市场为导向、技术为根本、服务为宗旨”的企业理念。始终致力于打造企业品牌，引领行业先锋的企业目的，公司从专业的角度设计生产，在国内受众多厂家使用推广。我们欢迎您的宝贵意见，愿与环保行业共同携手共同创造美好洁净的蓝天。', '116.510723', '40.173861000000002', '116.510723', '40.173861000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3756', '北京万家安泰消防器材有限公司', '679', '张释月', '13001229502', '张释月', '13001229502', '2010年06月29日', '50万元', '北京市', '北京市', '朝阳区', null, '北京朝阳区建国路15号院甲1号北岸12922三间房创意生活园区5-537', '北京市', '北京市', '朝阳区', '管庄地区办事处', '北京朝阳区建国路15号院甲1号北岸12922三间房创意生活园区5-537', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年06月29日', '2030年06月28日', '2018/6/15', '2019/6/14', '京消协（2018）证字196号', '91110105556843863A', '排油烟设施清洗机构', '销售电子产品；日用品、五金交电、工艺品、化工产品（不含危险化学品）、电子产品、通讯设备、机械设备、建筑材料、装饰材料、文具用品；技术推广服务；组织文化艺术交流活动（不含演出）；承办展览展示活动；企业形象策划；企业管理咨询；清洁服务（不含餐具消毒）。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '销售电子产品；日用品、五金交电、工艺品、化工产品（不含危险化学品）、电子产品、通讯设备、机械设备、建筑材料、装饰材料、文具用品；技术推广服务；组织文化艺术交流活动（不含演出）；承办展览展示活动；企业形象策划；企业管理咨询；清洁服务（不含餐具消毒）。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '116.582199', '39.910756999999997', '116.582199', '39.910756999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3757', '北京远洋昊天厨房设备有限责任公司', '678', '谢雪', '13301329516', '谢军', '13811982571', '2010年04月29日', '1000万元', '北京市', '北京市', '通州区', null, '北京市通州区云景东路5-2号2层2-3室', '北京市', '北京市', '通州区', '玉桥街道', '北京市通州区云景东路5-2号2层2-3室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年04月29日', '2030年04月28日', '2018/11/21', '2019/11/20', '京消协（2018）证字389号', '911101125548760129', '', '零售油气回收设备、通用设备、专用设备、制冷专用设备、家用电器；厨房设备管道清洗；技术推广；维修食品加工设备（仅限上门维修）；建筑物清洁服务；货物进出口、技术进出口、代理进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京远洋昊天厨房设备有限责任公司是一家 专业从事灶具、不锈钢设备的专业产商，公司秉承“节能、安全、环保”的经营理念，时刻把握行业的最新动态及方向，公司专为星级酒店、高中档宾馆、酒楼、餐厅、超市、快餐、机关、学校、企事业单位食堂提供先进技术、优质产品和完善的售后服务，是一家蓬勃发展的现代崭新厨房设备制造厂。\r\n   公司产品采用名优配件、精工制作、在保证质量的前提下大大降低了成本，让您的每一份投资都能得到合理的回报。远洋昊天品质将永驻您心中，客户满意是远洋昊天人永恒的追求。\r\n   “服务创造价值”是远洋昊天公司一直奉行的企业理念，缔造完美的产品满足客户的需求，公司人员不断学习专业知识，拓展业务能力，提升服务水平，努力为客户提供尽善尽美的产品。\r\n  公司全体成员将坚持：“团结协作、积极进取、开拓创新、保质高效”的经营理念，在日益激烈的市场竟争中显示自身的特色 和实力，以专业化、规范化、个性化的公司形象与广大的客户朋友共同促进酒店用品行业的发展！', '116.666578', '39.883118000000003', '116.666578', '39.883118000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3758', '北京骐馨科技有限公司', '675', '李领刚', '18813180420', '周海英', '13552493375', '2017年09月28日', '200万元', '北京市', '北京市', '顺义区', null, '北京顺义区赵全营镇北郎中村昌金路段31号', '北京市', '北京市', '顺义区', '赵全营镇', '北京顺义区赵全营镇北郎中村昌金路段31号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年09月28日', '长期', '', '', '', '91110113MA017WAP18', '', '技术开发、技术转让、技术咨询、技术服务；销售化妆品、日用品、五金（不含电动自行车）、机械设备；电子产品、建筑材料（不含砂石及砂石制品）、文化用品、体育用品（不含弩）、珠宝首饰（不含进出口黄金）、工艺品（不含文物、象牙及其制品）、金属制品、家具、通讯设备、化工产品（不含危险化学品及一类易制毒化学品）、服装鞋帽、针纺织品、金属材料（不含电石、铁合金）、计算机软件及辅助设备（不含计算机信息系统安全专用产品）；企业管理咨询；健康咨询（须经审批的诊疗活动除外）、健康管理；城市园林绿化施工；机械设备租赁；经济贸易咨询；清洁服务（不含餐具消毒）、保洁服务、家政服务；物业管理；维修、安装家用电器。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京骐馨科技有限公司，是一家集技术研发与产品销售的科研单位，注册资本200万元。我单位位于“北京最美的乡村”顺义北郎中西侧“双创基地”创业园，昌金路段31号，由顺义区人民政府批准，扶持成立。园区内良好的环境和完善的配套设施，给公司提供快速成长的发展空间。公司经营范围；技术开发,技术转让,技术咨询,技术服务：销售化妆品,日用品,企业管理咨询；健康咨询（须经审批的诊疗活动除外），健康管理，城市绿化施工；机械租赁；经济贸易咨询；清洁服务，保洁服务，家政服务；物业管理；维修，安装家用电器。骐馨科技有限公司自成立以来发展迅速，业务不断发展壮大，以良好的口碑赢得新老客户的赞誉，我们始终坚持用户至上，用心服务于客户，坚持自主,创新，以高品质的产品，优质的服务去被客户认可和爱上。我们秉承“产品就是人品，保证一流质量，保持一级信誉”的经营理念、坚持“骐馨人同命运,共呼吸”的精神。用强大凝聚力创造出更多更好的产品和服务，奉献社会，造福社会。欢迎更多的新老朋友加入,咨询合作！让我们用“来源于社会的誉，奉献于社会”。', '116.564145', '40.209552000000002', '116.564145', '40.209552000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3759', '北京佳洁家美保洁服务有限公司', '673', '果长友', '18310081593', '果长友', '18310081593', '2015年10月26日', '50万元', '北京市', '北京市', '密云区', null, '北京市密云区北庄镇抗峪村丰峪11号', '北京市', '北京市', '密云区', '北庄镇', '北京市密云区北庄镇抗峪村丰峪11号', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年10月26日', '2065年10月25日', '', '', '', '91110228MA001J82E', '', '建筑物清洁服务；家庭劳务服务；销售家用电器、厨房用具；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；害虫的防治服务；灭鼠及预防；办公设备的清洗。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京佳洁佳美保洁服务有限公司成立于2015年10月，本公司经营范围：建筑物清洁‘厨房设备清洁‘抽油烟机清晰等业务等。', '117.135974', '40.484827000000003', '117.135974', '40.484827000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3760', '北京中闳安技术服务有限公司', '672', '娄岩', '13901253515', '郝建', '13126926344', '2014年05月07日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡高碑店村民俗文化节1376号主楼630室', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高碑店润坤大厦315室', '', '消防安全评估', '有限责任公司（自然人独资）', '2014年05月07日', '2034年05月06日', '', '', '', '9111010509964792X6', '', '工程咨询；技术推广服务；经济贸易咨询；投资管理；投资咨询；维修仪器仪表（不含特种设备）；维修建筑工程机械设备；销售社会公共安全设备及器材、建筑材料（不在实体店经营）、五金交电（不在实体店经营）、机械设备、家用电器、电子产品、金属材料、针纺织品、化工产品（不含危险化学品）、日用品、工艺品、文具用品、体育用品；社会单位消防安全评估以及消防法律法规、消防技术标准、一般火灾隐患整改等方面的咨询活动。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。', '北京中闳安技术服务有限公司是北京市首家通过政府购买社会服务形式为政府提供消防安全综合解决方案的专业消防技术服务机构，有连续5年为朝阳区3个街道办事处、顺义区2个镇政府辖区内企业、事业、单位提供消防技术服务的成功经验，公司工作成绩得到了北京市公安局、北京市消防局、朝阳区人民政府的肯定与推广。中闳安按照北京市消防局要求，建立了完善的《消防安全评估过程控制体系》，配备了完整的消防安全评估设备，通过了北京市专家考核，于2018年成为首批获得“消防安全评估“正式资质的消防技术服务机构。', '116.544037', '39.894243000000003', '116.544037', '39.894243000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3761', '北京至浩众邦科贸有限公司', '670', '史鑫', '18910818062', '史鑫', '18910818062', '2013年10月25日', '300万元', '北京市', '北京市', '丰台区', null, '晓月五里六号楼101-126', '北京市', '北京市', '丰台区', '宛平城地区办事处', '晓月五里六号楼101-126', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年10月25日', '2043年10月24日', '2018/5/3', '2019/5/2', '京消协（2018）证字097号', '911101060804774810', '', '销售日用品、五金交电、电子产品、办公用品、机械设备、服装鞋帽、建筑材料；清洁服务；翻译服务；技术咨询、技术服务；专业承包；婚庆服务；设计、制作、代理、发布广告；劳务服务；汽车租赁（不含九座以上）；电脑图文设计、制作。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京至浩众邦科贸有限公司，是一家及安装和保洁；维保等为一体的综合性服务公司。公司实行总经理负责制，采用只能组织机构，遵循精于高效的原则，竭诚为北京市宾馆、酒店、写字楼、机关团体、企事业单位、学校、医院等提供各类型的服务。\r\n公司机构；\r\n公司下设管道清洗服务部、工程部、安装维修部、售后服务部。\r\n主要业务；\r\n一：专业对酒店、宾馆、写字楼、机关团体、企事业单位、学校、医院等\r\n（1）厨房设备及油烟管道的清洗，安装维护和保养；\r\n（2）高层玻璃幕保洁、空调清洗；开荒；日常保洁；大理石翻新打蜡。\r\n公司一直采用标准化；制度化；规生物、化粪池清掏等。\r\n二：技术及服务特色范化的科学管理方法，不断引进国内外先进的机械设备，聘请有经验的管理人员。现已拥有一批稳定的专业技术服务队伍，全部管理人员都长期从事过本行业工作，有着丰富的管理经验的专业技术，所有受聘员工需经过培训后才能上岗工作，以确保服务质量，提高劳动效率。\r\n我们深知公司今天的成就来之不易，除了不断完善和提高自身，还需要新老顾客的大力支持与合作。因此，我们珍惜每一次机会，愿与各界朋友真诚合作', '116.237623', '39.834605000000003', '116.237623', '39.834605000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3762', '北京嘉合保洁服务有限公司', '669', '杜少岗', '13366693624', '骆荣翠', '17310039771', '2013年08月02日', '50万元', '北京市', '北京市', '大兴区', null, '北京市大兴区安定镇安定北街北京安创投资有限责任公司院内二层202室', '北京市', '北京市', '大兴区', '安定镇', '北京市大兴区安定镇安定北街北京安创投资有限责任公司院内二层202室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年08月02日', '2033年08月01日', '2018/5/30', '2019/5/29', '京消协（2018）证字156号', '91110115074109519F', '排油烟设施清洗机构', '保洁服务；劳务服务；经济贸易咨询；承办展览展示；园林绿化管理；机动车公共停车场的经营管理；物业管理；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京嘉合保洁服务有限公司成立于 2013 年8月，注册资金 50 万元，具备厨房烟道清洗的专业单位，是（北京市消防协会）的会员单位，证书号码为[京消协（2018）证字156号]。排油烟设施清洗证书号码为[京消协清证字（2019）040号]。主要致力于学校、酒店、商场、快餐厅等大型厨房烟道防火清洗，是一支专业化的厨房烟道防火清洗的公司，拥有进口的高温高压清洗设备，有专业的施工队员，有完善的管理体制，有很好的质量反馈机制。公司在管理上注重员工的技能、素质培训，外出服务时统一着装，佩戴胸卡，严格要求服务人员在工作中细致入微，尽职尽责，在拓展市场的同时，还投入大量资金对员工进行相关业务技能和文化知识培训，使得员工的凝聚力、团队协同能力大大提高；公司坚持“以质量求生存，以信誉求发展”为原则，并严格按科学的管理手段为客户提供最完美的服务。', '116.513026', '39.621940000000002', '116.513026', '39.621940000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3763', '北京市泰隆全消防安全设备有限公司', '667', '王斌', '15811389555', '邵海英', '13716071136', '2005年05月16日', '100万元', '北京市', '北京市', '通州区', null, '北京市通州区通胡大街11号-1A2', '北京市', '北京市', '通州区', '潞城镇', '北京市通州区通胡大街11号-1A2', '', '消防设施', '有限责任公司（自然人投资或控股）', '2005年05月16日', '2035年05月15日', '2018/4/18', '2019/4/17', '京消协（2018）证字083号', '91110112775494237X', '', '销售消防器材、交通设施、报警系统视频监控设备、钢材、五金交电、日用品、建筑材料、化工产品（不含危险化学品）；发布广告；维修消防器材；技术推广；家居装饰设计；专业承包；工程勘察设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京市泰隆全消防安全设备有限公司是经北京市消防局核准备案的消防专业公司，是北京市消防协会会员单位，我公司主要从事消防器材销售及维修消防器材，公司至成立以来始终坚持质量第一、用户至上的经营宗旨，把产品质量和售后服务放在第一位。我们凭借高度的责任心和良好的信誉及与厂家的联营不断扩大经营规模，努力加强公司的内部管理，严格质量监督制度，积极降低经营成本，建立完善用户服务体系，让每位顾客满意放心', '116.693451', '39.916542', '116.693451', '39.916542', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3764', '北京蓝海环宇科贸有限责任公司', '664', '张晓红', '18601281918', '刘德华', '18813164595', '2018年08月23日', '500万元', '北京市', '北京市', '石景山区', null, '八宝山南路重兴园甲2号1层128', '北京市', '北京市', '石景山区', '八宝山街道', '八宝山南路重兴园甲2号1层128', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年08月23日', '2038年08月22日', '', '', '', '91110107MA01E8FF4M', '', '技术开发、技术转让、技术咨询、技术服务；企业管理；餐饮管理；厨房设备（抽油烟机等）的清洗；保洁服务；建筑物清洁服务；城市园林绿化；销售通讯设备、计算机、软件及辅助设备、机械设备；技术开发。物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京蓝海环宇科贸有限责任公司成立于2018年，是一家从事油烟管道，大型油烟机，风机、油烟净化器清洗的专业公司，目前公司拥有一支专业的清洗队伍及行业内先进的清洗设备，主要承接工厂、企事业单位食堂、酒店、餐馆、商场、超市等相关经营场所的厨房排烟罩，通风管道，风机、净化器等厨房排烟系统的清洗；销售安装风机、不锈钢排风管道、净化设备、厨房设备；公司本着“以质量求生存，以信誉求发展，在发展中创新，”的企业宗旨，高质量、低价格、服务于北京及周边相关单位。', '116.22798299999999', '39.892550999999997', '116.22798299999999', '39.892550999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3765', '北京育人四海教育科技有限公司', '663', '杜广敬', '18210616316', '张耀蓝', '18810192820', '2018年05月17日', '200万元', '北京市', '北京市', '海淀区', null, '北京市海淀区上地十街1号院1号楼6层604', '北京市', '北京市', '海淀区', '清河街道', '北京市海淀区上地十街1号院1号楼6层604', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年05月17日', '2048年05月16日', '', '', '', '91110108MA01C7LY49', '', '从事互联网文化活动；互联网信息服务；技术开发、技术咨询、技术转让、技术推广、技术服务；经济贸易咨询；组织文化艺术交流活动（不含营业性演出）；会议服务；电脑动画设计；教育咨询（中介服务除外）；企业策划；设计、制作、代理、发布广告。（企业依法自主选择经营项目，开展经营活动；从事互联网文化活动、互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京育人四海教育科技有限公司成立于2018年5月份，注册资本：200万，成立初期主要面对消防单位开展合作关系，现已发展为消防售后与文化一体的互联网公司，随着社会的发展，本公司走向成熟，不断完善，从产品质量，售后服务，严格要求，层层把关，得到广大客户的一致好评。\r\n公司使命：为消费者创造价值，实现互惠双赢;\r\n公司愿景： 让每一个人知识价值得以升华；让每一个人的知识价值得以实现；让每一个人的知识价值得以实用；让每一个人适应市场竞争环境；\r\n　　公司精神： 坚持品质、注重细节、服务社会\r\n　　公司作风：诚信、务实、团结、高效、创新\r\n　　公司道德：公平竞争、双赢发展\r\n　　公司环境：以真诚营造和谐\r\n　　经营理念：竞争求生存、合作为共赢、创新谋发展\r\n　　服务理念：识别客户期望，超越客户满意', '116.30240499999999', '40.053317', '116.30240499999999', '40.053317', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3766', '北京建筑材料检验研究院有限公司', '662', '张增寿', '13701107003', '沈炎明', '13381113002', '2006年11月02日', '8136.61万元', '北京市', '北京市', '石景山区', null, '北京市石景山区实兴大街30号院3号楼9层9059房间', '北京市', '北京市', '房山区', '窦店镇', '北京市房山区窦店镇亚新路15号', '', '电气防火,建筑防火,消防设施,消防安全检查', '有限责任公司（法人独资）', '2008年02月20日', '2058年02月19日', '2019/1/11', '2020/1/10', '京消协（2019）证字001号', '91110107795114924J', '电气防火检测技术服务机构', '工程和技术研究与试验发展；建筑材料质量检验、家具质量检验；工程监理；技术咨询、技术开发、技术转让、技术服务；销售仪器仪表、电子产品；环境监测；特种设备检验检测（特种设备许可证有效期至2020年06月10日）；技术检测（省级人民政府规定的审批部门批文有效期至2023年05月23日）；工程质量监督检查（省级以上建设部门资质审查有效期至2021年09月20日）；产品认证（05木材和木制品、纸浆、纸、和纸制品、印刷品、07建材产品、08家具、其他未分类产品）（国家授权单位批文有效期至2021年12月17日）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京建筑材料检验研究院有限公司（BMT）是具有独立法人资格的第三方质量检验机构，拥有三个市级质量监督检验站以及六个国家和行业检验中心，总部位于北京市石景山，并在海淀、通州、大兴、大红门等地设有分部，同时在房山区窦店建有大型检测基地，目前实验面积逾40000㎡。自成立以来，紧紧围绕“科学、公正、准确、高效”的质量方针开展各项工作，现已成为集检验、科研、咨询、培训为一体的综合性技术服务机构。BMT长期为生产领域、建设领域、消费领域提供从源头到终端的全产业链服务，并树立“客户满意为核心竞争力”的理念，不断提高服务水平，推出了包括产品质量监督检验、委托检验、仲裁检验、新产品开发鉴定检验、产品准用认证检验、生产许可证产品检验、人员培训、质量咨询、数据库信息查询等服务内容，为客户提供全方位的服务。　　', '116.193454', '39.939404000000003', '116.114356', '39.674211', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3767', '北京泓博香洁伟业保洁服务有限公司', '661', '赵建伟', '18514213969', '赵建伟', '18514213969', '2014年01月03日', '80万元', '北京市', '北京市', '丰台区', null, '北京市丰台区永外宋庄路11号1号楼3层3F30', '北京市', '北京市', '丰台区', '东铁匠营街道', '北京市丰台区永外宋庄路11号1号楼3层3F30', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年01月03日', '2034年01月02日', '2018/5/30', '2019/5/29', '京消协（2018）证字168号', '91110106089655985P', '', '清洁服务；厨房油烟管道清洗；劳务服务；销售空调制冷设备、计算机软硬件及辅助设备、机械设备；杀虫服务；技术开发、技术服务、技术咨询；企业管理咨询；承办展览展示活动；组织文化艺术交流活动；设计、制作、代理、发布广告。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京泓博香洁伟业保洁服务有限公司是一家专业的保洁服务公司。 自2014年1月至今，已积累了丰富的作业技术、 售后服务等经验。锻炼了一支坚韧的服务队伍，建立了一套完整的服务作业体系。取得了广大客户的信任，载誉无数；公司上下从领导到职工无时不刻的都在研究着如何把握和提高工程的清洗质量和安全水平，在达到工程消防目的、 消除工程火灾隐患、解除客户后顾之忧的同时、力求每一项工程都做到精益求精，一丝不苟。\r\n多年来，本公司不但得到了广大新老客户的大力支持，重要的是得到了新老客户的认可。并为此拥有了一大批长期合作的客户。 我公司上下人员都将以更加严谨的工作态度尊循“客户至上、价格合理、完美服务、安全第一”的重要原则，尽心尽力的为广大客户提供给我们的优质服务。立足人文，立足社会。为北京的洁净环境及消防事业做出我们应有的贡献！', '116.428189', '39.853895000000001', '116.428189', '39.853895000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3768', '北京久思信息技术有限公司', '660', '王彩', '18610333037', '张云涛', '13366267161', '2017年09月25日', '500万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区九渡河镇黄坎村735号', '北京市', '北京市', '朝阳区', '奥运村街道', '北京市朝阳区北苑路13号', '', '消防信息化', '有限责任公司（自然人投资或控股）', '2017年09月25日', '长期', '', '', '', '91110116MA017R5L3L', '', '技术开发、咨询、服务、转让、推广；软件开发；计算机系统服务；货物进出口；技术进出口；代理进出口；产品设计；模型设计；设计、制作、代理、发布广告；经济信息咨询；销售电子产品、工艺品、计算机、软件及辅助设备、文化用品、五金交电、家用电器、厨房用具、家具、模具、花卉、制冷设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京久思信息技术有限公司成立于2017年。公司专业从事消防信息化产品的开发和应用，致力于为客户提供专业化、定制化的产品及系统集成服务、通信技术服务。公司拥有80多名优秀员工，以及研发、项目运营和商务等多支优秀团队。2017年是商用物联网发展的元年，久思信息顺应物联网发展形势，发力于消防信息化建设领域，积极打造智慧消防云平台。', '116.468377', '40.360790000000001', '116.414615', '40.039952', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3769', '北京云青堂环保科技有限公司', '659', '王玉隆', '13801188617', '纪舒', '13811301879', '2018年04月26日', '100万元', '北京市', '北京市', '西城区', null, '北京市丰台区菜户营58号1315', '北京市', '北京市', '西城区', '白纸坊街道', '北京市丰台区菜户营58号1315', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年04月26日', '2048年04月25日', '', '', '', '91110106MA01BPPEX6', '', '技术开发、技术服务、技术咨询、技术转让；家庭劳务服务；建筑物清洁服务；劳务服务；清洁服务；礼仪服务；设计、制作、代理、发布广告；经济信息咨询；销售通讯设备、金属材料、日用品、化妆品、服装、文具用品、体育用品、计算机、软件及辅助设备、机械设备、家用电器、电子产品；体育运动项目经营（高危险运动除外）；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京云青堂环保科技有限公司是经北京市工商管理局正式注册批准，竭诚致力于清洁服务的专业性环保科技公司。\r\n云青堂面向社会各机关、团体、宾馆、酒店、商场、写字楼、娱乐场所等提供全方位的清洗保洁服务，主要致力于酒店、商场、快餐厅的大型厨房烟道防火清洗等。\r\n公司技术力量雄厚，设备齐全，技术人员具有多年清洗经验，确保在清洗过程中严格执行消防法规及北京市地方标准。\r\n 公司坚持“顾客至上，质量至上”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！', '116.347876', '39.871893', '116.347876', '39.871893', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3770', '天津小金手清洁服务有限公司北京分公司', '658', '周玉萍', '18522955688', '运迺林', '13902003232', '2019年05月07日', '', '北京市', '北京市', '大兴区', null, '北京经济技术开发区文化园西路8号院39号楼10层1001', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京经济技术开发区文化园西路8号院39号楼10层1001', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年05月07日', '长期', '', '', '', '91110302MA01JY7Q18', '', '清洁服务；环保设备、水处理设备、消防设备、自动化设备、厨房设备安装、维修；物业服务；餐饮管理；技术推广服务；销售清洁用品、五金交电（不含电动自行车）、服装、鞋帽、厨房设备、日用品、机械设备、电气设备、消防设备、办公用品、家具；在总公司授权范围内从事建筑活动。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '天津小金手清洁服务有限公司是2017年成立的从事厨房排烟系统清洗和中央空调系统清洗的专业公司，公司现有职工51人，各类专业技术职称人员17人，高级职称人员3人，技术操作人员30人。施工队伍过硬，技术精良。我公司采用国内先进的智能化机器人清洗设备和德国进口清洗药剂以及先进的检测设备。清洗设备固定资产达120万元，智能化的清洗设备和环保型清洗药剂使去除厨房油垢污染更彻底，检测也更方便。雄厚的智能化、机械化施工能力，“让天下没有难清除的油烟，让天下没有难清洗的厨房”成为现实。公司注册资金500万元，公司自成立以来致力于规模化和专业化管理，2018年我公司获得了“油烟管道清洗服务企业”资质证书；并通过了国家“质量管理体系认证（GB/T19001-2016/ISO9001:2015标准）、环境管理体系认证（GB/T24001-2016/ISO14001:2015标准）、职业健康安全管理体系认证（GB/T28001-2011/OHSAS18001:2007标准）先进的管理模式和施工中采用的智能化机械设备以及诚信经营的管理理念，在2019年被天津市消防协会吸收为会员单位。', '116.492689', '39.806699999999999', '116.492689', '39.806699999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3771', '北京洁都保洁服务有限公司', '657', '郭永中', '13910258964', '郭永中', '13910258964', '2001年04月18日', '150万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十里河村469号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十里河村469号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2001年04月18日', '2021年04月17日', '', '', '', '91110105801751226W', '', '保洁服务；劳务服务；维修家用电器；维修厨房及卫生间用具；消防器材；消防器材检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京洁都保洁服务有限公司成立于2001年初，公司以大型油烟机清洗、排烟道清洗、风机清洗、净化器清洗等酒店厨房全系列清洗服务为主要业务，公司有专职工程技术人员30于人，90%以上的员工拥有四年以上的工作经验，使用德国和意大利的进口清洗设备，配合先进的管理理念，保障客户单位防火需求的同时降低清洗成本。自公司成立以来，一直是北京市消防协会认可的烟道清洗单位，所清洗的排油烟管道在协议期内无一例火灾事故发生，施工质量及企业信誉度均得到社会各单位的一致好评', '116.458696', '39.861139999999999', '116.458696', '39.861139999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3772', '北京京安四海消防科技有限责任公司', '656', '冯庆如', '01067283586', '徐萌萌', '15011523763', '2012年03月09日', '600万元', '北京市', '北京市', '丰台区', null, '东铁匠营横一条31号6楼605室', '北京市', '北京市', '丰台区', '东铁匠营街道', '东铁营横一条31号金泰彤翔南院写字楼对面平房', '', '电气防火,消防安全评估,消防设施', '有限责任公司（自然人投资或控股）', '2012年03月09日', '2032年03月08日', '2018/11/26', '2019/11/25', '京消协（2018）证字401号', '91110106592365002J', '电气防火检测技术服务机构', '技术开发、技术转让、技术服务、技术推广；计算机技术培训；维修机械设备；技术检测；销售电子产品、建筑材料、汽车配件、机械设备。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司一家经北京市公安局消防局、消防协会资质认可，为社会提供电气防火检测与建筑消防设施检测服务的第三方专业化企业。公司拥有一批中、高级专业技术人才和具有中级以上岗位资格的检测技术人员，配备国内外先进的检测仪器设备，具备在北京市范围内从事电气防火检测和建筑消防设施检测的资质和技术能力。\r\n      我公司遵照“安全至上，科学检测，优质服务”的服务宗旨为企事业单位、机关团体、公共娱乐场所、展览展销场所等提供电气防火检测与建筑消防设施检测的专业化服务。电气防火检测采取正常用电状态下的带电非接触式检测手段，测试电气设备和线路的运行状态；建筑消防设施检测采用现场试验为主的检测方式，测试消防设施的运行状态；在数据处理方面，采用国内外最先进的设备分析仪器，对检测数据进行准确分析并出具完整的技术检测报告，确保能够科学、准确、公正地反映检测现场的真实情况和存在的消防隐患问题，为社会单位消防安全工作提供科学依据。', '116.43398000000001', '39.848908999999999', '116.43398000000001', '39.848908999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3773', '北京龙腾乐家环保科技有限公司', '655', '姚现权', '13436853238', '姚现权', '13436853238', '2019年03月28日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区大石窝镇石窝村北岗区21号', '北京市', '北京市', '房山区', '大石窝镇', '北京市房山区大石窝镇石窝村北岗区21号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年03月28日', '2049年03月27日', '', '', '', '91110111MA01J4F911', '', '技术开发；技术咨询（中介除外）；技术转让；技术服务；组织文化艺术交流活动（不含营业性演出）；家庭劳务服务；婚姻服务；翻译服务；企业管理；经济信息咨询；会议服务；设计、制作、代理、发布广告；居家养老服务；健康管理（须经审批的诊疗活动除外）；园林绿化工程；园林绿化服务；园林绿化设计；家居装饰及设计；专业承包；劳务分包；施工总承包；承办展览展示；销售卫生用品、办公用品、文化用品（音像制品除外）、体育用品、电子产品、日用杂品、家用电器、五金交电（不含电动自行车）、建筑材料、通讯设备（卫星接收设备除外）、仪器仪表、汽车零配件、橡胶制品、厨房设备、环保设备；租赁机械设备；清洁服务（不含洗车服务）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京龙腾乐家环保科技有限公司创建于2019年，坐落于北京市房山区大石窝镇石窝村。主要从事技术咨询，开发，服务，餐饮后厨以及油烟管道的清洗。公司本着“先做人，后做事，诚信为本”的态度，立志于为客户提供一体化的处理方案，节省客户施工成本，确保客户将资源集中于公司核心业务。遵循“业绩最大化，利润合理化”的经营理念，把最先进的技术，最专业的设计，最成熟的产品和最完善的服务提供给客户。我们将不断挑战自我，永攀高峰，并一如既往的以客户满意为己任。', '115.81310000000001', '39.56127', '115.81310000000001', '39.56127', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3774', '北京华安嘉成环保科技有限公司', '654', '罗秀琴', '13683124788', '侯长林', '13810798312', '2009年04月15日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区魏善庄镇龙发大街1号院1号楼2单元6层', '北京市', '北京市', '大兴区', '魏善庄镇', '北京市大兴区魏善庄镇龙发大街1号院1号楼2单元6层', '', '烟道清洗', '有限责任公司（自然人独资）', '2009年04月15日', '2029年04月14日', '', '', '', '911101066883988886', '', '技术开发；技术服务；技术转让；技术咨询；销售环保产品、五金交电（不含电动自行车）、装饰材料、建筑材料、日用品、厨房用具、办公用品、电子产品、机械设备、计算机及辅助设备；清洁服务；专业承包；劳务服务；维修厨房设备、空调制冷设备；空气污染治理；水污染治理；园林绿化工程。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是一家经过正式注册，拥有合法经营执照的正规企业。专业提供厨房排油烟系统清洗和服务！', '116.401169', '39.683484999999997', '116.401169', '39.683484999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3775', '北京世纪海源商贸有限公司', '652', '朱勇敢', '13522376046', '潘风娟', '18939468088', '2009年04月29日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧宫镇四村北京千山雪装饰工程有限责任公司1楼102室', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧宫镇四村北京千山雪装饰工程有限责任公司1楼102室', '', '电气防火,烟道清洗,消防产品', '有限责任公司（自然人独资）', '2009年04月29日', '2029年04月28日', '', '', '', '911101156883540339', '', '零售制冷设备；销售五金交电、厨房设备、日用品、家用电器、办公用品、服装服饰、电子产品、机械设备、计算机软硬件及外围设备、工艺美术品；保洁服务；家政服务（中介除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京世纪海源有限公司成立于2019年4月29日，是一家正规注册，专业从事排烟清洗与保洁服务性公司，我公司拥有一批专业的管理和技术实力的员工队伍，通过我们共同的努力以及各界朋友的支持与厚爱，公司业绩不断上升，为市场内的饭店。商场，宾馆，写字楼，大厦等提供了全方位的开荒保洁和清洗保洁，公司在管理上，注重员工素质的培养以技术的提高，公司创业精神，敬业爱岗，奉献拼搏，，客户至上，合理价格，服务到位，达到客户的满意是我们的追求！', '116.45689400000001', '39.804523000000003', '116.45689400000001', '39.804523000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3776', '北京北安消防工程技术有限公司', '651', '孙勇', '18101065959', '孙勇', '18101065959', '2012年03月13日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-P12', '北京市', '北京市', '东城区', '和平里街道', '安华里二区13号院甲7号四层', '', '消防设施', '有限责任公司（自然人独资）', '2012年03月13日', '2042年03月12日', '2018/10/30', '2019/10/29', '京消协（2018）证字348号', '9111011159234501XY', '', '消防工程技术开发、技术服务、技术转让、技术咨询（中介除外）；专业承包；清洁服务；销售消防器材、电子设备、建筑材料、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京北安消防工程技术有限公司是一家具有独立法人资格综合性消防服务公司。公司拥有雄厚的技术力量，秉承全新的管理理念，涵盖了各类消防工程承包、施工、改造、消检电检、消防设施维修与保养、消防器材销售与维修及消防报审、验收工作等多项业务。\r\n   公司可承接火灾自动报警系统、公共广播系统、自动喷洒灭火系统、气体灭火系统、防火卷帘门联动系统的设计、施工、报审、验收等工作。经过几年的发展，拥有一批高水平的工程技术人员和工程管理人员，专业施工队伍，是一家素质精良，设备齐全、技术雄厚、安装经验丰富、售后服务及时的消防设施专业施工企业。\r\n   我们坚持以“质量第一、用户至上”的经营方针，始终把质量和服务放在第一位，并且凭借雄厚的实力和良好信誉，不断扩大与生产厂家合作，建立完善的用户服务体系，使用户满意放心。公司始终秉承“团结敬业，高效节俭”的企业精神，不断健全各项管理制度，与时俱进的调整市场经营战略以工期短、质量优、服务周到取信于用户。严格全面的管理体系和优质的售后服务可满足各方用户的需求。我们承诺：将以最优的施工质量、最完善的施工设计、最快捷的施工进度、最顺畅的验收服务以及无偿的技术支持回报您的信任。', '116.018866', '39.708221999999999', '116.403864', '39.966670000000001', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3777', '北京凯悦通达机电安装有限公司', '650', '高美彦', '13901165521', '高国锋', '18901165521', '2006年07月04日', '3100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区黄村镇大庄京开公路东侧大兴国家粮食储备库院内', '北京市', '北京市', '大兴区', '黄村地区办事处', '北京市大兴区永兴路5号院7号楼201', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年07月04日', '2036年07月03日', '', '', '', '9111011579066456C', '', '专业承包；销售建筑材料、装饰材料、五金交电、机械设备、计算机软硬件及外围设备、汽车配件、金属材料；建筑机械租赁；维修管道清洗设备；劳务服务；家居装饰；零售化工产品（不含危险化学品及一类易制毒化学品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京凯悦通达机电安装有限公司是具有企业资质的施工企业。前身为北京大成水暖管道安装有限公司，成立于1987年6月，于2006年7月更名为北京凯悦通达机电安装有限公司并申请资质，公司注册资金1000万元。公司主要从事机电设备安装，承接电气、自控、暖通、通风空调设备安装、污水处理、供水系统、工业除尘等机电安装项目。\r\n我公司引进先进的管道疏通清理设备，提供给水排水管道疏通，工业管道疏通清洗等服务。\r\n\r\n我公司施工技术全面，管理经验丰富。工程技术人员主要为有学历、有素质的中青年知识分子，也有企业管理经验和施工经验丰富的老专家。公司项目经历队伍强大，曾参加北京市的大型公共建筑、民用建筑等各项专业工程。\r\n\r\n公司坚持以质量求生存，以荣誉、价格求发展的企业宗旨和安全第一、质量第一、诚信为本、价格低廉的企业理念，竭诚为各公司及业主提供最优质的服务。\r\n\r\n公司以市场化、专业化发展思路，真诚希望为客户提供优质的机电项目安装服务，以专业的技术、能力及优质的服务，成为良好的合作伙伴。', '116.331148', '39.686917999999999', '116.32264000000001', '39.686804000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3778', '北京永安泰消防工程有限公司', '648', '冯海春', '13311210706', '冯琦', '13439458006', '2002年05月23日', '1000万元', '北京市', '北京市', '西城区', null, '北京市西城区冠英园西区28号楼1032房间', '北京市', '北京市', '西城区', '什刹海街道', '北京市西城区冠英园西区28号楼1032房间', '', '电气防火', '有限责任公司（自然人投资或控股）', '2002年05月23日', '2022年05月22日', '', '', '', '91110102739386618T', '', '专业承包；销售建筑材料、制冷空调设备、消防器材、五金交电、金属制品、化工产品（不含一类易制毒化学品及危险品）、百货、通讯器材、计算机软硬件及外围设备、土产品、工艺美术品、办公用品、劳保用品、日用杂品、针纺织品、汽车配件；技术开发、转让、服务、咨询；技术检测；维修消防设备；技术检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京永安泰消防工程有限公司成立于2002年5月23日（统一社会信用代码：91110102739386618T），于2006年由北京住房和城乡建设委员会颁发（消防设施工程专业承包贰级，证书编号D211022928）（建筑机电安装工程专业承包叁级，证书编号D311023088）与2018年颁发（安全生产许可证，编号：京JZ安许证字2018 201822-01）。2019年由北京市消防总队颁发了（中华人民共和国消防技术服务机构资质证书，证书编号：京公消字《2019》第0051号）正式二级。\r\n   公司现有高级工程师4人：工程师18人：助理工程师10人：高级管理人员13人，建立了一整套科学架构管理模式，能够确保工程质量及施工安全体系。具备承接大型高层、综合性消防系统工程施工能力和机电设备安装，检测、保养工程①消防报警系统；②消防给水系统；③气体灭火系统；④泡沫灭火系统；⑤防排烟系统；⑥消防广播系统；⑦自动防火卷帘系统；⑧应急照明系统；⑨暖通系统。\r\n公司以“内养素质、外树形象、虚心进取”为指导思想，各种定期与不定期的培训，有效地提高了技术人员的技能素质和管理能力。在工程施工过程中坚持以“质量、安', '116.36688700000001', '39.937824999999997', '116.36688700000001', '39.937824999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3779', '北京市融安消防职业技能培训学校', '647', '袁永刚', '', '林琳', '15611982646', '', '', '北京市', '北京市', '朝阳区', null, '北京市朝阳区双泉堡甲1号3号楼（商业配套）', '北京市', '北京市', '朝阳区', '奥运村街道', '北京市朝阳区双泉堡甲1号3号楼（商业配套）', '', '宣传教育培训', '民办非企业单位', '', '', '2018/11/9', '2019/11/8', '京消协（2018）证字363号', '521101056757041104', '', '', '北京市融安消防职业技能培训学校成立于2008年6月，专门从事消防设施操作员初、中级资格培训，是全国第一家消防专业培训试点学校，第一个消防行业特有工种职业技能鉴定（北京）站授权的鉴定点，是消防行业内权威的、北京市官方的消防中控培训学校。\r\n        融安学校总校注册在北京市朝阳区双泉堡甲1号院，有北沙滩校区、南纬路校区、西客站校区、管庄校区、大兴校区及20余个报名点。学校面积近5千平米，教室内教学设备齐全，拥有全国最先进、设备最全的实验室和全国一流的消防行业师资，常年聘请消防行业专家来授课。\r\n        我校自成立以来，不断为社会各界输送高质量的消防中控技术人员，按照国家规定，商场、写字楼、物业公司等单位必须配备一定数量的专业消防人员，就业前景广泛。对培训结束后取得国家资格证书的学员，我校可免费推荐工作，不挑拣工作的情况下可达100%就业。经定期回访，多数学员表示对工作待遇满意，部分学员凭借优秀的工作表现被提升至单位的中、高层领导岗位，真正实现了低成本高回报的职业愿望。', '116.367902', '40.006117000000003', '116.367902', '40.006117000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3780', '北京东永祥云环保科技有限公司', '646', '顾小云', '18513589158', '顾小云', '18513589158', '2017年06月09日', '200万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖湖经济开发区乐园大街38号', '北京市', '北京市', '怀柔区', '北京雁栖经济开发区', '北京市怀柔区雁栖湖经济开发区乐园大街38号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年06月09日', '2047年06月08日', '2019/5/8', '2020/5/7', '京消协（2019）证字218号', '91110116MA00F6QJ6R', '', '技术开发、服务、咨询、推广、转让；专业承包；劳务分包；城市园林绿化；家庭劳务服务；建筑物清洁服务；办公室清洁服务；交通设施保洁服务；水污染治理；大气污染治理；销售办公用品、日用品；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东永祥云环保科技有限公司专业从事油烟管道清洗，风机，净化器清洗，厨房设备清洗等服务，公司位于北京市怀柔区雁栖湖。公司拥有专业清洁队伍，先进专业的清洗设备，所有上岗人员均经过严格的培训和考核。为提高服务质量，先后引进专业化标准清洗设备多套，初步具备了清洗行业的规模化，专业化,努力为客户提供专业高效的高质量服务。\r\n\r\n油烟管道清洁服务范围：\r\n\r\n大型抽油烟机清洗服务：酒店、饭店、火锅店、医院、学校、部队、商场、机关单位等油烟机清洗，油烟管道清洗，风机清洗，油烟净化器清洗,等服务。\r\n\r\n企业目标： 成为清洗服务行业的领航者。\r\n\r\n质量目标： 质量满意率达到98%以上；客户满意率达到97%以上。\r\n\r\n我们的企业使命：为顾客创造价值，为员工创造机会，为社会承担责任。', '116.672111', '40.345101999999997', '116.672111', '40.345101999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3781', '北京浩通博宇消防安全技术有限公司', '644', '叶翔', '13720053516', '叶翔', '13720053516', '2009年07月02日', '500万元', '北京市', '北京市', '延庆区', null, '北京市延庆区八达岭经济开发区康西路967号', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市经济技术开发区隆庆街4号', '', '电气防火,消防设施,消防产品', '有限责任公司（自然人独资）', '2009年07月02日', '2029年07月01日', '2018/11/21', '2019/11/20', '京消协（2018）证字385号', '911102296916651667', '电气防火检测技术服务机构', '技术开发；维修、清洗消防器材；提供劳务服务；信息咨询（不含中介服务）；消防器材安全技术检测；建筑物清洁服务；销售消防器材、安全技术防范产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京浩通博宇消防安全技术有限公司（以下简称浩通消防）成立于2009年，是依法在北京市工商局注册的具有独立法人地位的公司。公司前身为北京八达岭永恒消防器材有限公司，主营业务为消防器材的销售、检测及维护保养。经过多年的发展，如今浩通消防依托先进的技术力量及完备的服务体系，已成为北京地区消防技术服务行业中的领跑者。', '115.85913600000001', '40.405979000000002', '116.507158', '39.800142000000001', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3782', '北京铧盛建筑工程有限公司', '642', '刘志刚', '13911360213', '田丽丽', '18701498969', '2016年09月02日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区长阳镇广阳新路7号院3号楼705室', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区长阳镇广阳新路7号院3号楼705室', '', '建筑防火', '有限责任公司（自然人独资）', '2016年09月02日', '2036年09月01日', '2018/11/26', '2019/11/25', '京消协（2018）证字422号', '91110105MA0081X700', '', '施工总承包；专业承包；劳务分包；工程造价咨询；技术检测、技术推广、技术服务；销售安全技术防范产品、五金交电（不含电动自行车）、建筑材料、机械设备、金属材料、消防器材、消防设备；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京铧盛建筑工程有限公司（原名北京铧盛消防技术有限公司），是国家认可的专业消防技术推广服务公司，公司成立於2016年9月，是从事消防工程、消防设备、消防器材、消防系统维保、灭火器检测、工程勘察设计的专业公司。\r\n     公司拥有雄厚的经济实力和技术力量，公司注册资金为壹仟万元，现有员工25人，企业有职称的工程技术和经济管理人员3人，其中消防电气、设备专业有职称人员2人，经过消防专业考试合格的工程技术人员5人。\r\n     公司设有综合管理办公室、市场经营部、技术研发部、工程管理部、安全管理部、质量监察部等6个职能部门。公司员工具有较高的技术水平和丰富的施工经验，有很强的进取精神和竞争意识。\r\n     近来的工程施工中，公司走向市场经济之路，严格遵守国家招投标等法律法规，在众多消防设备公司竞争中脱颖而出，树立了很好的形象，其中有如下几个重点工程项目：北京雅宝大厦装修工程消防安全技术咨询；北京团结湖玛琳娜酒店消防安全技术咨询；北京东四六条社区消防安全技术咨询；消防社区网建设经营维护等。', '116.212602', '39.753484999999998', '116.212602', '39.753484999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3783', '清淞（北京）科技发展有限公司', '640', '邵雅琳', '13398672833', '郭忠军', '15726693358', '2015年03月06日', '50万元', '北京市', '北京市', '东城区', null, '和平里中街甲27号2幢甲810室', '北京市', '北京市', '东城区', '和平里街道', '和平里中街甲27号2幢甲810室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年03月06日', '2035年03月05日', '2018/3/13', '2019/3/12', '京消协（2018）证字1036号', '9111010131824358X0', '排油烟设施清洗机构', '技术开发、技术咨询、技术服务；清洁服务；家庭劳务服务；零售五金交电；销售日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '清淞（北京）科技发展有限公司成立于2015年3月16日，是北京市一家专业从事油烟机清洗服务的企业，公司注册资金50万元，具有独立法人资质，公司地址位于北京市东城区和平里中街甲27号2幢甲810号，是经过北京消防协会专业培训，合格。专业从事大型抽油烟机油烟管道清洗、油烟净化器、风机及厨房设备安装、外墙清洗等、是一家拥有着油烟管道清洗资质持证上岗的公司，公司拥有严格的管理制度，先进的设备，一流的服务，精湛的技术，清洗技工具有多年清洗维修经验。', '116.415927', '39.957295999999999', '116.415927', '39.957295999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3784', '北京天富消防科技有限公司', '639', '李自朋', '18210580586', '李自朋', '18210580586', '2014年08月26日', '1000万元', '北京市', '北京市', '门头沟区', null, '石龙经济开发区永安路20号3号楼A-2649室', '北京市', '北京市', '通州区', '马驹桥镇', '马驹桥镇姚辛庄村422号', '', '消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2014年08月26日', '2034年08月25日', '', '', '', '91110109306723041B', '', '专业承包、劳务分包；技术开发、服务、咨询、转让、推广；维修建筑工程机械设备、消防器材；销售建筑材料、消防器材、通信器材、机械设备、电子产品、仪器仪表、五金交电、装饰材料、文化用品。(领取本执照后，应到区县住建委（房管局）取得行政许可。；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京天富消防科技有限公司是一家注册已久，新开业的专业性消防技术服务公司。\r\n公司遵循北京市消防局预防为主，防消结合\"的工作方针，根据\"质量第一，用户至上\"的经营方针，依据消防法律法规要求，编制了一套完整的《消防安全重点单位消防档案建设模版》及相关文件性资料，为用户制定不同的应急预案和消防设备配备方案。', '116.12666', '39.896962000000002', '116.634888', '39.756973000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3785', '北京新亮洁建筑工程有限公司', '638', '单心凯', '18310269982', '单心凯', '18310269982', '2017年10月31日', '500万元', '北京市', '北京市', '平谷区', null, '马坊镇金河街106号院5号楼5层513', '北京市', '北京市', '平谷区', '马坊地区办事处', '马坊镇金河街106号院5号楼5层513', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年10月31日', '2047年10月30日', '2018/11/21', '2019/11/20', '京消协（2018）证字388号', '91110117MA018FC766', '排油烟设施清洗机构', '施工总承包；专业承包；劳务分包；建筑物清洁服务；保洁服务；家居装饰设计；电脑图文设计、制作；设计、制作、代理、发布广告；企业形象策划；组织文化艺术交流活动；建筑机械设备租赁；承办展览展示；园林绿化工程施工；草坪养护；园林景观艺术设计；会议服务；销售五金交电、化工产品、家用电器、金属材料、苗木、花卉、机械设备、电子产品、安全技术防范产品、针纺织品、家具、厨卫用具、消防器材、化工产品、日用品、文化用品、办公用品、塑料制品、玻璃制品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '认真做事，诚信经营', '117.00927900000001', '40.059275999999997', '117.00927900000001', '40.059275999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3786', '北京中消伟业安全技术工程有限公司', '637', '穆重廉', '13901207578', '陈春兰', '13621150530', '1997年01月13日', '3000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南三环东路23号安泰小区1号楼4层04西段办公02', '北京市', '北京市', '丰台区', '方庄地区办事处', '北京市丰台区南三环东路23号安泰小区1号楼4层04西段办公02', '', '建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '1997年01月13日', '2064年01月12日', '', '', '', '911101066337867953', '', '工程总承包、专业承包；销售消防器材及设备、建筑材料、金属材料、机械电器设备、五金交电、通讯设备、计算机及外部设备；技术开发、技术转让、技术咨询、技术服务；信息咨询（不含中介服务）；技术进出口、货物进出口、代理进出口；维修消防设备；出租办公用房。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京中消伟业安全技术工程有限公司成立于1997年1月13日，注册资金3000万元。法定代表人：穆重廉。\r\n       公司现有资质：消防设施工程专业承包壹级、消防设施工程设计专项乙级、建筑智能化工程专业承包贰级、建筑机电安装工程专业承包叁级、建筑装修装饰工程专业承包贰级。并于2003年3月及2005年7月分别取得ISO 9000质量体系、职业健康安全管理体系和环境管理体系认证证书。\r\n2010年，我公司还取得了中华人民共和国对外承包工程资格证书。在公司经营范围中增加了技术进出口、货物进出口、代理进出口业务。2010年与孟加纳国JAMUNA建筑有限公司签订并完成了几百万美元的设备、材料的采购供货合同。已具备承包境外工程、货物进出口及代理进出口业务的实践经验和能力。\r\n       公司成立20年来，先后承揽了：北京大学人民医院新病房楼、陈留庄、南苑220KV变电站、北京市人大常委会办公楼、海淀区招商大厦、伊士顿国际商务酒店（五星级）、皇史宬（古建筑）、故宫（古建筑）、奥运交通指挥中心、奥运媒体村二期、2008年奥运柔道、跆拳道馆等项目4000多项。', '116.427057', '39.858916999999998', '116.427057', '39.858916999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3787', '北京都之洁清洗服务有限公司', '636', '樊天明', '13621298379', '樊天明', '13621298379', '2014年06月30日', '50万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区桥东街13楼北118-13室', '北京市', '北京市', '门头沟区', '龙泉地区办事处', '北京市门头沟区桥东街13楼北118-13室', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年06月30日', '2034年06月29日', '2018/4/8', '2019/4/7', '京消协（2018）证字1066号', '9111010930637163X1', '', '建筑物清洁服务；家政服务；维修空调制冷设备；销售机械设备、空调制冷设备、厨房用具、日用品、五金交电；保洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司成立于2014年6月30日，是一家正规注册、经验丰富、专业从事厨房油烟清洗的服务性公司。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的企事业单位、酒店、商场、大厦等提供专业的清洗服务。我公司在管理上，注重员工素质的培养及技术的提高，只有经过严格培训的员工方能上岗。\r\n    我公司的服务宗旨：服务至上、质量至上、着重长远、共同进步。\r\n    我公司的服务理念：想客户所想、做客户所求、超客户所望。', '116.103058', '39.945683000000002', '116.103058', '39.945683000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3788', '北京海生亮洁环保科技有限公司', '635', '李刚', '13071161290', '李刚', '13071161290', '2013年11月25日', '800万元', '北京市', '北京市', '大兴区', null, '北京市大兴区黄村镇兴业大街76号1至2层13', '北京市', '北京市', '大兴区', '林校路街道', '北京市大兴区黄村镇兴业大街76号1至2层13', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年11月25日', '2033年11月24日', '2019/5/15', '2020/5/14', '京消协（2019）证字263号', '911101090828163361', '', '技术开发；技术咨询；技术服务；技术转让；保洁服务；销售及维修厨房设备、五金产品（不含电动自行车）、电子产品、汽车配件；家居装饰；空调设备清洗；害虫防治服务；建筑物外墙清洁服务：家用电器维修；园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京海生亮洁环保科技有限公司，是经消防协会培训考试的专业防火单位，是专业从事油烟管道清洗，大型油烟机清洗的环保科技公司，公司自成立以来，一直致力于烟道防火清洗养护服务，我公司以先进的清洗设备和优质的服务成为同行业中的皎皎者。\r\n我公司将人性化的服务模式及专业的清洗技术融为一体，公司的宗旨是通过与客户建立稳定的服务关系，向客户提供高效专业的服务，使客户在激烈的市场竞争中降低成本，提高竞争力，享受到专业服务化。本公司已向多家机关单位、院校、酒店提供了常年专业的烟道防火清洗养护服务，有效地清除了火灾隐患，确保了用户消防安全，受到了用户的广泛好评。\r\n    我们的服务宗旨是为广大客户提供最优质的质量、最优惠的价格、以及最满意的服务。北京海生亮洁环保科技有限公司的所有技术人员均有8年以上的工作经验，训练有素的专业技术服务队伍随时待命，为你24小时提供服务。\r\n我公司以朝气蓬勃的精神、专业的服务、严谨的管理制度为中心经营理念，始终保持“安全、科技、环保、创新、专业”的宗旨，竭尽全力为你提供最完美的服务。\r\n\r\n         我们真诚欢迎与你有更多的机会进行交流，合作！', '116.328227', '39.728552999999998', '116.328227', '39.728552999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3789', '北京江山利达消防科技有限公司', '634', '毛炳达', '13311228058', '毛炳达', '13311228058', '2003年12月09日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区天水大街46号院2号楼2层227', '北京市', '北京市', '大兴区', '天宫院街道', '北京市大兴区天水大街46号院2号楼2层227', '', '消防设施', '有限责任公司（自然人投资或控股）', '2003年12月09日', '2033年12月08日', '', '', '', '91110115756706759G', '', '消防装备的技术咨询、服务；专业承包；施工总承包；劳务分包；销售五金产品（不含电动自行车）、日用品、针纺织品、建筑材料、装饰材料、机械设备、消防器材、安全技术防范产品、仪器仪表、电气设备；维修空调、家用电器、计算机、消防器材、消防设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京江山利达消防科技有限公司是经市工商行政管理局注册认证，集消防相关设备和设施产品、销售、充装、保养及维护于一体的，具有专业化消防保安器材及消防自动报警灭火等设备维保及技术咨询资格的公司。  拥有多功能化工作性质分明作业工厂，厂区总面积1500平方米，承揽各项消防设施设备维护维修业务。 公司拥有一批从事消防专业十多年的技术人才，并拥有多支技术精湛、实力雄厚的消防施工队伍。十三年来承接了数个工程项目，工程质量优良，深受广大客户的信任、支持和好评。 北京江山利达消防科技有限公司为了能够提供更好、更完善的配套服务，与多家名优设备及设施生产企业多年战略合作。以不断开拓进步精神、严密的品质管理、实实在在的价格及周到的服务原则，和您携手真诚合作共创辉煌未来！', '116.319351', '39.669054000000003', '116.319351', '39.669054000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3790', '北京天宇恒远厨房设备有限公司', '633', '李玉荣', '13021035157', '李凤英', '13522089578', '2016年12月13日', '500万元', '北京市', '北京市', '密云区', null, '密云区育才路9号檀营乡政府办公室215室-699（檀营集中办公区）', '北京市', '北京市', '密云区', '鼓楼街道', '密云区育才路9号檀营乡政府办公室215室-699（檀营集中办公区）', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年12月13日', '2036/12/12', '2018/8/27', '2019/8/26', '京消协（2018）证字277号', '91110228MA00ABRN13', '', '销售厨房设备、专用设备、金属制品、通用设备、五金、交电、陶瓷制品、服装、日用杂货、化工产品（不含危险化学品及易制毒品）；技术开发、技术推广、技术转让、技术咨询、技术服务；机器和办公设备的清洗；锅炉烟囱的清扫；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；建筑物清洁服务；承办展览展示活动。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天宇恒远厨房设备有限公司从事油烟管道清洗，烟道清洗，大型油烟机清洗，油烟净化器清洗，中央空调系统清洗，专业生产环保通风设备、承接工厂、企事、酒店、餐馆、公共场所、超市等各场地的、排风、通风净化工程，生产、加工、安装车间厨房整体通风系统通风管道，厨房排烟罩，通风管道，风机消音箱，销售风机净化器。并配套生产各类空气调节系统的通风、排气、送风等风管工程及其配件，承接各种不锈钢通风管道的制作，厨房排油烟系统，宾馆商场新风系统.业务涵盖北京各区及周边等地烟道清洗工作。\r\n    北京天宇恒远厨房设备有限公司.一贯坚持“以质量求生存，以诚信拓市场，以服务谋发展”，可根据客户的要求规格设计、定做各种空气净化、通风、排风工程,具有多年设计、制作、及安装工程的丰富经验，技术力量雄厚，产品质量可靠。成功修理和改造了上千家饭店不合理的排烟问题。被评为“重合同守信用单位”，是中国保洁协会会员、中国清洗工程技术合作协会会员、中国消防协会协会会员，中国通风处理协会会员单位等资格，以先进的清洗设备和优质的服务成为同行业中企业。', '116.846891', '40.378000999999998', '116.846891', '40.378000999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3791', '北京盛世宏业清洁服务有限责任公司', '632', '李凤英', '13522089578', '李凤英', '13522089578', '2009年06月17日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十八里店乡西直河第四生产队', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡西直河第四生产队', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年06月17日', '2029年06月16日', '2018/7/26', '2019/7/25', '京消协（2018）证字244号', '911101056908172528', '', '清洁服务（不含餐具消毒）；销售五金交电、玩具、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京盛世宏业清洁服务有限责任公司成立于2016年，是从事厨房烟道清洗、中央空调清洗、地毯清洗；销售厨房设备，厨房用品，及厨房设备的维护与保养的综合性服务公司，注册资金 500万元；\r\n 本公司主要是排油烟管道清洗及环保技术推广服务的高新技术企业，是目前京城厨房烟道清洗行业最大的专业公司之一；拥有在职员工28名，每天可同时对3个厨房进行清洗,五星级酒店可一夜清洗完毕；同时拥有专业的厨房设备维护人员。所有管理和技术人员均接受过专业的培训及消防协会相关的专业培训，综合素质高，技术过硬。自入行至今，我公司在合作客户中未出现过由于我方清洗质量引发的烟道火灾。\r\n\r\n天独厚。数十位高端技术人才的人力资源，具有规模化发展的资本优势资源。\r\n我们具备：公司具有一流的管理团队，雄厚的技术力量和一            支庞大的经过专业培训考核、管理严格的清洁清洗队', '116.529606', '39.844504000000001', '116.529606', '39.844504000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3792', '北京京荣顺达科技发展有限公司', '631', '顾金荣', '13611048337', '王晨菲', '18910083816', '2008年08月29日', '200万元', '北京市', '北京市', '大兴区', null, '北京市大兴区兴华大街（二段）13号院2号楼901', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区兴隆家园南区37号楼2单元302', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年08月29日', '2028年08月28日', '2018/5/11', '2019/5/10', '京消协（2018）证字106号', '91110115679615027Q', '', '技术开发、转让、咨询、推广、服务；清洁服务；经济贸易咨询；零售日用百货、五金（不含电动自行车）、工艺美术品、建筑材料、机械设备、电子产品；家政服务（中介除外）；家居装饰；维修厨房设备、通风设备；专业承包；园林绿化工程；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京荣顺达科技发展有限公司(原北京京荣顺达商贸有限公司),成立于1999年7月,2008年8月更名为“北京京荣顺达科技发展有限公司,是一家集保洁、维修和消杀为一体的综合性服务公司。公司实行总经理责任制,采用职能组织机构,遵循精于高效的原则,竭诚为北京市各类宾馆、酒店、写字楼、机关团体、企事业单位、学校等提供各类型的清洁服务。\r\n我公司工程部技术人员采用军事化管理,训练有素，纪律严明、作风优良、技术过硬,所有人员均是通过专业培训、实战演练经严格的考核合格后上岗,可清洁其他公司无法清洁的竖管道、特殊风机等设施\r\n同行业保证质量最高,价格最低,清洁标准符合北京市消防局的要求、消除一切火灾隐患,保证清洁后所有设备的正常运转\r\n在不影响客户正常营业和工作的前提下,不断提高技术能力和水平,科学合理的制定施工计划和人员配备,以最短的时间最高的质量完成施工计划，以质量求生存,以信誉求发展”为经营理念,以“高质量、低价格、优服务、快效率”为经营宗旨,人性化的经营管理模式,严格的品质管理体制,完善的售后服务系统,不断创新技术标准,扩大市场范围,使京荣顺达在同行业独占熬头,将服务品牌推向了更高的层次。', '116.33078999999999', '39.764637', '116.524447', '39.910981999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3793', '北京金坡通德科技有限公司', '629', '张金坡', '13910599234', '张金坡', '13910599234', '2010年10月28日', '1000万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区乐园西大街15号院19号楼1层1单元19-6', '北京市', '北京市', '怀柔区', '雁栖地区办事处', '北京市怀柔区乐园西大街15号院19号楼1层1单元19-6', '', '烟道清洗,建筑防火,消防产品', '有限责任公司（自然人独资）', '2010年10月28日', '2060年10月27日', '', '', '', '91110116563645435D', '', '科技开发、技术咨询、技术服务、技术转让、技术推广；大气污染治理；室内空气成分测试；建设工程项目管理；技术进出口；水污染治理；建筑物清洁服务；道路货运代理；航空货运代理；施工总承包、专业承包、劳务分包；城市园林绿化；餐饮管理；物业管理；企业管理咨询；酒店管理；技术检测服务；机动车公共停车场服务；租赁建筑工程机械、建筑工程设备；销售电子产品、机械设备、仪器仪表、五金交电、化工产品（不含危险化学品）、文化用品、工艺品、日用品、家具、消防器材、安全技术防范产品、农药（不含危险化学品农药）、第一类医疗器械、第二类医疗器械、消毒产品；环境监测；家庭劳务服务；办公室保洁服务；维修制冷设备；森林病虫、鼠、兽害防治服务；害虫防治服务；灭鼠及预防服务；道路货物运输；销售第三类医疗器械。（企业依法自主选择经营项目，开展经营活动；道路货物运输、销售第三类医疗器械以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金坡通德科技有限公司成立于2010年10月28日，公司以科技开发、技术服务、保洁服务、建筑物清洁服务；大气污染治理；室内空气成分测试；施工总承包、专业承包、劳务分包；销售化工产品；等为主。公司全体员工具有高度的责任感，本着客户至上的原则服务每一位客户，力争为北京的绿色环保事业贡献’一份力量。', '116.65551000000001', '40.348948999999998', '116.65551000000001', '40.348948999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3794', '北京延京富安消防科技有限公司', '628', '陈曦', '13801176000', '余丽川', '18911282039', '2017年03月07日', '500万元', '北京市', '北京市', '延庆区', null, '延庆镇卓家营', '北京市', '北京市', '延庆区', '延庆镇', '延庆镇卓家营', '', '烟道清洗,电气防火,消防设施', '有限责任公司（自然人独资）', '2017年03月07日', '长期', '2018/11/9', '2019/11/8', '京消协（2018）证字361号', '91110229MA00CEYU2B', '电气防火检测技术服务机构  排油烟设施清洗机构', '技术开发、技术咨询、技术服务、技术推广、技术检测、技术转让；清洁服务；教育咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京延京富安消防科技有限公司是经北京市公安局消防局、北京消防协会、北京市质量技术监督局等单位批准成立的消防科技服务公司。公司于2017年3月注册成立至今，秉承着“质量第一、服务为先、客户至上”的经营理念，为广大客户提供优质、便捷的服务。\r\n公司作为北京市消防协会会员单位，多年来与中石油、中国联通、北京市自来水公司、北京市公安局等企事业单位建立了长期良好的合作关系，同时也是唯一一家注册于北京市延庆区的消防电气检测科技公司。\r\n公司拥有消防维保检测资质、电气防火检测技术资质，取得了CMA检验检测计量认证，通过了ISO9000质量管理体系认证。公司配备高级工程师2名、电气工程师2名、机械工程师2名、注册一级消防工程师6名、中高级建构筑物消防员3名、具有10年以上检测经验的专业检测人员10名。\r\n公司将凭借着饱满的热情、认真负责的态度、百分百的诚信为客户量身打造满意的服务，构建起坚实的安全保障。', '115.989515', '40.505561999999998', '115.989515', '40.505561999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3795', '玉鼎云华(北京）信息技术有限责任公司', '627', '王全亮', '13911333918', '徐长丰', '13681627615', '2013年05月13日', '900五万元', '北京市', '北京市', '通州区', null, '北京市通州区宋庄镇文化创意产业集聚公共服务平台', '北京市', '北京市', '通州区', '宋庄镇', '北京市通州区宋庄镇文化创意产业集聚公共服务平台545号', '', '消防设施', '有限责任公司（自然人独资）', '2013年05月13日', '2033年05月12日', '2018/12/19', '2019/12/18', '京消协（2018）证字447号', '9111022606961692xf', '电气防火检测技术服务机构', '技术开发、技术咨询、技术服务；计算机系统集成；计算机系统服务；消防技术检测；电气防火检测技术服务；维修消防设施（仅限上门维修）；软件开发；零售计算机软件及辅助设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '玉鼎云华（北京）信息技术有限责任公司成立于2013年5月13日，注册资金900万，经营范围：技术开发、技术咨询、技术服务、计算机系统集成、计算机系统服务、消防技术检测、电气防火检测服务、维修消防设施。软件开发、零售计算机软件及辅助设备。', '116.72126799999999', '39.950152000000003', '116.72126799999999', '39.950152000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3796', '中海洋保洁服务(北京）有限公司', '625', '郭永金', '15801319718', '闫新新', '17725562698', '2018年09月06日', '2000万元', '北京市', '北京市', '房山区', null, '燕山岗北路2号楼B座201', '北京市', '北京市', '丰台区', '长辛店街道', '长辛店珠江御景7号楼4-501', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年09月06日', '2048年09月05日', '2018/10/30', '2019/10/29', '京消协（2018）证字346号', '91110304MA01EG8T68', '排油烟设施清洗机构', '工程设计；清洁服务（不含清洗服务和消毒服务）；园林绿化工程；施工总承包；专业承包；劳务分包；家庭劳务服务；机电设备维修；技术开发、技术转让、技术服务、技术咨询；经济信息咨询（投资咨询除外）。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中海洋保洁服务（北京）有限公司从事酒店、食堂、学校、机关单位油烟机、油烟管道及其空调系统等清洗服务，清洗业务涵盖北京、天津、河北等地。\r\n公司被评为“重合同守信用单位”，是中国保洁协会会员、中国清洗工程技术合作协会会员、中国消防协会协会会员，中国通风处理协会会员单位等资格，以先进的清洗设备和优质的服务成为同行业中领跑企业。   我司致力于烟道、空调管道清洗技术的开发和应用实践，并取得了令人瞩目的骄人成绩。2018年随着经营战略的调整和技术扩张，实施战略联盟、正式纳入中海洋工程技术有限公司被集团授权成立中海洋保洁服务（北京）有限公司。为海洋工程战略部署，落地亲民实现集团一体化管理。', '115.969301', '39.752932000000001', '116.176552', '39.818795999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3797', '北京昊坤科技发展有限公司', '623', '刘峰', '13301290110', '潘广海', '13311109070', '2005年03月14日', '500万元', '北京市', '北京市', '石景山区', null, '北京市石景山区苹果园南路69号院1号楼15层1513号', '北京市', '北京市', '朝阳区', '小红门地区办事处', '北京市朝阳区成寿寺路150号店铺425-426室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年03月14日', '2025年03月13日', '2018/8/27', '2019/8/26', '京消协（2018）证字276号', '91110107772584130K', '排油烟设施清洗机构', '技术服务、技术咨询、技术培训、技术转让、技术推广；销售机械电器设备、汽车配件、五金交电（不含电动自行车）、建筑材料、办公用品、电子产品、计算机软硬件及外围设备、工艺美术品、化工产品（不含危险化学品）；保洁服务；销售机械电器设备、充电专用设备、环保设备；租赁机械电器设备；厨房设备（抽油烟机等）的清洗；风景园林工程设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京昊坤科技发展有限公司--清洗服务部，于2017年与上海水威公司旗下的上海洁侠环保科技有限公司，签订战略合作协议，北京昊坤科技与上海洁侠环保在华北地区共同打造“洁侠”这个清洗服务品牌，依托北京昊坤科技在华北地区近15年的清洁清洗设备销售服务经验，及各种清洗清洁设备（各种型号清洗机、吸尘吸水机、蒸汽清机等10余台套），正式在华北地区开展油烟抽排系统清洗工程，为了能更好的为我们的客户提供清洗服务，2018年公司投入20余万元从而欧洲引进了专业的油烟管道清洗系统，专用于各种油烟管道的清洗施工，从而大幅度的降低了人工清洗的强度与风险。', '116.17897600000001', '39.926350999999997', '116.44861899999999', '39.837240000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3798', '北京东方净美厨房设备有限公司', '622', '庞仁义', '13381408161', '庞仁义', '13381408161', '2009年06月17日', '500万元', '北京市', '北京市', '密云区', null, '北京市密云区大城子镇政府东侧海惠诚综合楼101室-1737', '北京市', '北京市', '密云区', '大城子镇', '北京市密云区大城子镇政府东侧海惠诚综合楼101室-1737', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年06月17日', '2029年06月16日', '2018/8/20', '2019/8/19', '京消协（2018）证字273号', '91110228MA00ABJ7XJ', '', '销售厨房用具、专用设备、金属制品、通用设备、五金、交电、陶瓷制品、服装、日用杂货、化工产品（不含危险化学品及易制毒品）；技术开发、技术推广、技术转让、技术咨询、技术服务；机器和办公设备的清洗；锅炉烟囱的清扫；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；建筑物清洁服务；承办展览展示活动。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '　北京东方净美厨房设备有限公司一直以诚信为本、坚持科学、严格、规范的管理体系。所有经过专业的培训的员工将真诚为您服务！多年来，我们积累了丰富的管理经验和实践经验，公司秉承“服务第一、信誉第一、质量第一”的理念，让客户感受到泰峰积极向上的敬业务实精神。“让客户称心、满意”。\r\n　　公司针对国内部分油烟管道的复杂性，研制出适合任何异形管道的清洗方法，工程已经涵盖企事业单位、宾馆酒店、大型商场超市、医院、车站、学校等各种使用排油设备的餐厅食堂场所，并得到了客户的一致好评和行业的推荐。\r\n　　公司在完成施工的同时，还为客户提供清洗前后对比照片、清洗证明等服务。我们的服务宗旨是为广大客户提供最优质的产品、最优惠的价格、以及最周到的服务。\r\n主营清洁保洁项目\r\n油烟管道清洗：单位油烟管道清洗、脱排油烟机清洗、大型油烟机清洗、排烟罩清洗、运水烟罩清洗。\r\n厨房设备清洗：环保网清洗、运水面板清洗、油烟净化器清洗、离心风机清洗、轴流风机清洗。\r\n厨房设备维修：鼓风机维修、油烟净化器维修、蒸饭箱维修、炮台灶维修、柴油灶维修。', '117.109769', '40.392924999999998', '117.109769', '40.392924999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3799', '北京德技盛科技有限公司', '621', '刘强', '13552252985', '刘强', '13552252985', '2010年02月23日', '960万元', '北京市', '北京市', '丰台区', null, '北京市丰台区分中寺关家坑200号院421', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区博大路3号院8号楼701室', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年02月23日', '2030年02月22日', '2018/5/22', '2019/5/21', '京消协（2018）证字147号', '911101065514161926', '', '专业承包；技术开发；技术咨询；技术转让；技术服务；空调设备维修；清洗保洁服务；水泵维修；销售机电设备、玻璃钢制品、制冷空调设备、五金交电（不含电动自行车）、建筑材料、电子产品、化工产品（不含化学危险品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京德技盛科技有限公司是家诚实守信的综合性公司，售后服务高效，公司技术人员是经专业培训合格高素质的专业人才，对冷却塔维修保养，中央空调系统水处理，管道改造，机组维修维保及故障判断具有熟练度和敏感度。我们提供一年365天，每天24小时的服务，我们的维修工程师会在第一时间赶到事故现场及时完成应急抢修服务。我们的目标是确保最快的反馈和最短的停机时间，将客户的损失降至最低。作为中央空调业界可靠的合作伙伴，德技盛秉承不断创新、以崭新理念改进技术及服务为宗旨，籍以增强竞争力及扩展不同市场。通过为客户创造更高价值，为客户提供更高技术、更高性价比的服务，以及最优化的解决方案和合理的价格是本公司赢得客户的关键。因有专业的技术团队，公司至今有长期的合作客户，如中央民进办公厅，中国中铁建工集团，中国有色金属研究总院，中国科学院微电子研究所，空军第二招待所，福特宝足球协会，北京之夜，华风宾馆，金龙潭大饭店，北京佳龙阳光酒店，乐凯大厦，嘉里大通大厦，韩国学校，国家语言翻译学院，欧尚超市等等。并获得客户高度认同与信任；加强科学管理不屑努力与开拓，勇于参与市场竞争，严格要求服务质量，以期更多新老客户的支持。', '116.448775', '39.853423999999997', '116.473231', '39.835918999999997', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3800', '北京云海心诚清洁服务有限责任公司', '620', '李玉云', '15120046076', '庞仁义', '13381408161', '2006年06月07日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十八里店乡老君堂新平房185号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡老君堂新平房185号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年06月07日', '2026年06月06日', '2018/7/26', '2019/7/25', '京消协（2018）证字246号', '9111010578996982XK', '', '清洁服务（不含餐具消毒）；销售日用品、五金交电、化工产品（不含危险化学品）、机械设备、文具用品、电子产品、厨房用具、计算机、软件及辅助设备；技术推广服务；承办展览展示活动；绿化管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京云海心诚清洁服务有限责任公司成立于2006年，是从事厨房烟道清洗、中央空调清洗、地毯清洗；销售厨房设备，厨房用品，及厨房设备的维护与保养的综合性服务公司，注册资金 500万元；\r\n 本公司主要是排油烟管道清洗及环保技术推广服务的高新技术企业，是目前京城厨房烟道清洗行业的专业公司之一；拥有在职员工20名，每天可同时对4个厨房进行清洗,五星级酒店可一夜清洗完毕；同时拥有专业的厨房设备维护人员。所有管理和技术人员均接受过专业的培训及消防协会相关的专业培训，综合素质高，技术过硬。自入行至今，我公司在合作客户中未出现过由于我方清洗质量引发的烟道火灾。\r\n      企业文化：厚德载物，行胜于言，科学发展，自主创新；打造满意服务，成就健康财富。\r\n设备特性：国际领先水准、智能化程度高、工作效率快、洁净度达标、安全性强、设备耐用性好。\r\n资源优势： 科研氛围，信息交流，政策导向等人文资源得天独厚。数十位高端技术人才的人力资源，具有规模化发展的资本优势资源。\r\n我们具备：公司具有一流的管理团队，雄厚的技术力量和一 支庞大的经过专业培训考核、管理严格的清洁清洗队\r\n伍。', '116.51620200000001', '39.838743999999998', '116.51620200000001', '39.838743999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3801', '北京天使霓裳科贸有限公司', '618', '张金玲', '18911089416', '刁维利', '13520551895', '2007年08月01日', '600万元', '北京市', '北京市', '通州区', null, '北京市通州区经海六路1号院9号楼3层301室', '北京市', '北京市', '通州区', '台湖镇', '北京市通州区经海六路1号院9号楼3层301室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2007年08月01日', '2027年07月31日', '2018/12/28', '2019/12/27', '京消协（2018）证字480号', '911101066656242809', '排油烟设施清洗机构', '技术推广；经济信息咨询；清洁服务；害虫的防治服务;销售厨房用具、机械设备、化工产品（不含化学危险品）、服装、日用品；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京天使霓裳科贸有限公司成立于 2007 年，是一家专业事厨房设备及中央空调设备清洗、维修、保养、设计、安装、改造一条龙服务的专业正规集团化公司，经过 10 年公司的不断发展，规模已从原有的 10 几人发展到现今120 余人，2013 年成立了唐山办事处，2016 年底在北京同时成立了家分公司、2017 年初北京天使霓裳科贸有限公司总部在北市通州区尖子班设立了运营管理中心并通过 IS09001 质量管理体系认证、IS014001 环境管理体系认证，OHSAS18001 职业健康安全管理认证；公司业务市场已深入北京、河北、天津、内蒙、山东、河南等省市；业务范围从烟道清洗、空调清洗、扩展到整体厨房设计、安装、改造、维保等多项业务，让客户轻松体验一站式服务；并建立了完善的管理体系、所有员工均经过专业系统化培训、职能技术培训、职业专业素养考核；本公司本着质优价廉的原则为客户提供多元化、全方位的服务，收到了广大客户的一致好评，并获得了国家相关部门颁发的资质证书及荣誉证', '116.540159', '39.823025999999999', '116.540153', '39.823065', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3802', '北京顺新消防科技有限公司', '617', '宋桂宝', '13901165225', '耿新秀', '13901236702', '2005年03月02日', '500万元', '北京市', '北京市', '密云区', null, '北京市密云区鼓楼西区6号楼3单元102室', '北京市', '北京市', '密云区', '鼓楼街道', '北京市密云区鼓楼西区6号楼3单元102室', '', '电气防火,消防设施', '其他有限责任公司', '2005年03月02日', '2025年03月01日', '', '', '', '91110228771978816P', '', '物业管理；消防设施检测；科技开发、科技服务；经济贸易咨询；消防电气防火检测；技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司为北京市消防协会单位会员，是经北京市消防局、北京市工商局批准的具有电气防火、消防设施专业检测一级资质的检测公司，并通过了GB/TI9001-2008/ISO9001:2008《质量管理体系要求》认证；连续两年成为北京消防协会通报表彰“建筑消防设施检测成绩突出”单位；连续六年荣获建筑消防设施、电气防火安全检测“双优企业”称号。\r\n北京顺新消防科技有限公司主要对建筑业、餐饮业、娱乐业、市场、仓库、商店（场）、医疗机构、旅店业、办公场所、生产车间、住宅、中小学校、托幼园所、体育场馆等；民用建筑及高层建筑的电气防火、消防设施的检测。\r\n\r\n我公司坚持以市场为导向，以用户为中心，以保障社会消防安全为责任和使命；努力提高企业的科技力、生产力、拓展力。服务宗旨：“为社会尽责，为用户尽心。”企业经营理念：“以质量求生存，以技术求进步，以信誉求发展。”企业精神：“团结友爱、刚正赤诚、开拓进取、精益求精。”一握“顺新”手、一颗“平安”心。\r\n\r\n我们承诺，我们努力————顺新消防，专业保证！', '116.84590900000001', '40.380372999999999', '116.84590900000001', '40.380372999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3803', '北京福海芮轩清洁服务有限责任公司', '616', '孟令芝', '13121840774', '庞仁文', '13718559591', '2014年05月07日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十八里店乡老君堂村新平房186号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡老君堂村新平房186号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年05月07日', '2034年05月06日', '2019/1/17', '2020/1/16', '京消协（2019）证字022号', '91110105099449819T', '', '清洁服务（不含餐具消毒）；销售日用品、五金交电、化工产品（不含危险化学品）、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京福海芮轩清洁服务有限责任公司成立于2014年，是从事厨房烟道清洗、中央空调清洗、地毯清洗；销售厨房设备，厨房用品，及厨房设备的维护与保养的综合性服务公司，注册资金 100万元；\r\n 本公司主要是排油烟管道清洗及环保技术推广服务的高新技术企业，是目前京城厨房烟道清洗行业最大的专业公司之一；拥有在职员工58名，每天可同时对10个厨房进行清洗,五星级酒店可一夜清洗完毕；同时拥有专业的厨房设备维护人员。所有管理和技术人员均接受过专业的培训及消防协会相关的专业培训，综合素质高，技术过硬。自入行至今，我公司在合作客户中未出现过由于我方清洗质量引发的烟道火灾。', '116.51454', '39.837885', '116.51454', '39.837885', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3804', '北京双文保洁有限公司', '615', '王志向', '13141379941', '王志向', '13141379941', '2006年03月10日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区方庄芳群园四区3号楼1204室', '北京市', '北京市', '丰台区', '长辛店镇', '丰台区长辛店白草洼246号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年03月10日', '2026年03月09日', '2017/4/17', '2018/4/16', '京消协（2017）证字1064号', '91110106786165105R', '', '保洁服务；家居装饰；信息咨询（中介除外）。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京双文保洁有限公司成立于2006年，专业从事排油烟管道清洗工作，公司拥有4套高，中低压清洗设备。公司坚持以“精准服务、精品工程”为理念，服务于高、中档餐厅，酒店。所有一线员工先后参加过消防协会的职业培训，不但能出色完成清洗工作，同时掌握厨房设备安全使用的检测、维护、维修技能。为餐厅，酒店的消防安全事宜提供了安全保障。公司拥有完善的规章制度，严格的、科学的施工流程，标准化的验工条例。公司全体员工同心同德，协同作战，积极进取，勇于创新，不断完善。以客户为上帝，以精品为信念，受到了广大客户的好评。', '116.429771', '39.861066000000001', '116.166183', '39.853270000000002', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3805', '北京荣杰天使清洗服务有限责任公司', '613', '王利杰', '13331128164', '庞世超', '15210189005', '2017年11月06日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧宫镇旧宫西路93号3幢3层3317室', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧宫镇旧宫西路93号3幢3层3317室', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年11月06日', '2047年11月05日', '', '', '', '91110115MA018JPG3D', '', '清洁服务；销售日用品、建筑材料；技术开发、服务、咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京荣杰天使清洗服务有限责任公司是一家专业的酒店厨房油烟清洗服务公司，公司成立于2017年11月。公司主营油烟机、排烟系统清洗服务，网片、管道、风机、净化器、机械设备清洗服务。', '116.42432100000001', '39.804448999999998', '116.42432100000001', '39.804448999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3806', '北京安美佳保洁服务有限公司', '612', '李远锋', '13911564814', '李远锋', '13911564814', '2008年11月20日', '358万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区王四营乡观音堂文化大道甲6号北二楼218室', '北京市', '北京市', '朝阳区', '王四营地区办事处', '北京市朝阳区王四营乡观音堂文化大道甲6号北二楼218室', '', '消防产品,烟道清洗', '有限责任公司（自然人独资）', '2008年11月20日', '2058年11月19日', '2018/8/1', '2019/7/31', '京消协（2018）证字254号', '9111011168288720XW', '排油烟设施清洗机构', '清洁服务（不含洗车服务）；技术开发、技术服务；保洁技术咨询（中介除外）；物业管理；销售日用杂货、机械设备、环保设备、通风设备、污水处理设备、电力设备、空调制冷设备、建筑材料；种植、租摆花卉；技术检测；组织文化艺术交流活动（演出除外）；承办展览展示。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司成立于2008年，也是中国的奥运之年；本公司是一家专业清洗大型油烟管道和日常保洁的服务公司，本公司油烟清洗工30人左右，专用清洗车8辆；日常保洁员工100人左右，主要承接大型美食广场和写字楼的日常保洁。', '116.531516', '39.872974999999997', '116.531516', '39.872974999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3807', '北京富洁科贸有限公司', '609', '郑孟青', '13341192858', '郑孟青', '13341192858', '2016年10月25日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区安苑北里23号南楼5层507', '北京市', '北京市', '朝阳区', '小红门地区办事处', '北京市朝阳区小红门乡鸿博家园二期A区', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年10月25日', '2046年10月24日', '2018/5/11', '2019/5/10', '京消协（2018）证字118号', '91110105MA0092RW5D', '', '技术推广服务；清洁服务（不含餐具消毒）；经济贸易咨询；组织文化艺术交流活动（不含演出）；销售家用电器、电子产品、五金交电（不从事实体店铺经营）、建筑材料（不从事实体店铺经营）、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是一家经过正式注册合法的公司，原名北京市华正孟青灶具维修部，成立于2004年12月23日。由于维修清洗范围扩大，于2016年10月25日，成立第二家正式公司，北京富洁科贸有限公司。本公司有严格的管理制度，维修保养清洗全方面服务。以客户至上满意为原则，以质量求生存，信誉求发展为准则，不断提高公司服务质量信誉。\r\n     本公司经营范围：\r\n    一、专业为宾馆、饭店、机关、单位、学校、幼儿园等单位食堂，提供厨房灶具、餐厅用具、厨房设备的销售安装、维修保养、改装检测服务。   \r\n二、排油烟系统维修保养清洗； 排油烟风机和油烟净化器维修制作生产，包含蒸箱、蒸柜、茶炉、热水器除碱制造；冰柜、冰箱、空调、热募机制冷设备的安装销售；可提供厨房成套设备，及排烟系统设计、生产安装维护一条龙服务。', '116.424588', '39.995004000000002', '116.464483', '39.826717000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3808', '北京易达通慧商贸有限公司', '608', '周其才', '13269222626', '杨玉杰', '13167538787', '2002年11月20日', '30万元', '北京市', '北京市', '大兴区', null, '旧宫镇吉庆庄旧宫西路南三条12号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '十八里店乡西直河村271号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2002年11月20日', '2022年11月19日', '2018/6/27', '2019/6/26', '京消协（2018）证字215号', '91110115744710566T', '', '零售五金交电、制冷空调设备、机械电器设备、日用百货、汽车配件、建筑材料、工艺美术品、仪器仪表、炊事用具、炉具、化工产品（不含危险化学品、不含一类易制毒化学品）；维修家用电器；安装、维修、调试家用空调；清洗通风管道清洗。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京易达通慧商贸公司是原一家消防设施工程专业承包壹级资质，可承担火灾自动报警及联动系统、消防广播系统、消防水喷淋系统、消火栓系统、气体灭火系统的设计、施工、申报、验收、物业管理、技术开发、技术转让等一条龙服务及技术服务、专业承包服务为一体的服务性公司；现更名为易达通，长期以来，以“顾客第一、诚信为本、高效求实，稳步发展”的经营理念为宗旨，销售和维修、维保及机电、消防工程、安保系统安装劳务为主，开拓发展了厨房烟囱排油烟道、外墙清洗、石材保养、厨具设备清洗及空调清洗业务。\r\n  公司服务员工都通过消防安装，维保、烟道设备清洗、高空作业等方面的专业技能培训,同时还要进行从业道德、服务质量、安全第一等意识方面的培训，通过考核后方可上岗。\r\n  公司具有完善的工作管理制度和安全操作制度,制订了规范的工序操作流程。同时，拥有经过专业培训的作业人员以及全套优质设备,各项服务收费合理，能为客户提供安全、规范和满意的消防设备安装维保、烟道清洗、建筑物清洗、石材维护等服务。\r\n  ', '116.510267', '39.818806000000002', '116.530371', '39.844318000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3809', '北京特洁科技有限公司', '607', '李忠辉', '13051314880', '李忠辉', '13051314880', '2016年08月01日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区黄土岗高场村2号A座六层6630', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区黄土岗高场村2号A座六层6630', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年08月01日', '2046年07月31日', '2017/12/1', '2018/12/1', '京消协（2017）证字1169号', '91110106MA007ACH8A', '排油烟设施清洗机构', '技术检测、技术开发、技术推广、技术转让、技术咨询、技术服务；经济贸易咨询；公共关系服务；会议服务；工艺美术设计；电脑动画设计；企业策划；市场调查；企业管理咨询；组织文化艺术交流活动；承办展览展示活动；影视策划；翻译服务；清洁服务；劳务服务；销售电子产品、家用电器、机器设备、文具用品、日用品、服装、鞋帽、化妆品、工艺美术品、计算机硬件及辅助设备、针纺织品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京特洁科技有限公司成立于2016年，注册资本500万元，主要从事餐饮行业中承接大型烟道清洗工程等。公司技术力量雄厚，人才济济，拥有员工50人，公司聘用制度严格，施工人员全部拥有3年以上工作经验，员工整体素质高，凭借着雄厚的实力，本公司于2017年正式加入北京消防协会，再次增强了员工的专业技能以及服务水平。公司注重以人为本、客户至上的原则，用态度让您感受到我们服务的真诚，用效率来提升我们的工作质量，用服务来让您感受诚挚的关怀。我们一直相信，顾客就是上帝，只有拥有顾客，才能拥有效益，只有拥有更多的顾客，才能成为市场的赢家！本公司员工愿携手一道，以顾客为中心，用最专业的技能打造最满意的服务！', '116.327703', '39.832977', '116.327703', '39.832977', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3810', '北京蓝天洁美环保科技有限公司', '605', '刘俊国', '15001052130', '刘俊国', '15001052130', '2016年02月22日', '200万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区青春路26号1幢6008室', '北京市', '北京市', '朝阳区', '黑庄户地区办事处', '朝阳区黑庄户乡万子营村', '', '消防设施,烟道清洗', '有限责任公司（自然人独资）', '2016年02月22日', '2046年02月21日', '2018/5/22', '2019/5/21', '京消协（2018）证字131号', '91110116MA003NA0XM', '', '施工总承包、专业承包、劳务分包；工程勘查设计；建设工程项目管理；租赁建筑工程机械、设备；房地产开发；物业管理；销售五金交电、机械设备、电子产品；建筑物清洁服务；家庭劳务服务；城市园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京蓝天洁美环保科技有限公司成立于2016年，从事北京地区排油烟设施清洗，保洁服务。', '116.63039499999999', '40.319487000000002', '116.60055199999999', '39.865397000000002', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3811', '北京巨安顺鑫消防科技有限责任公司', '604', '李富群', '18611916778', '姜超', '13511015929', '2005年01月14日', '430万元', '北京市', '北京市', '', null, '采育镇沙窝店村村富街1号', '北京市', '北京市', '', '宋庄镇', '采育镇沙窝店村村富街1号', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2005年01月14日', '2025年01月13日', '2017/12/11', '2018/12/10', '京消协（2017）证字208号', '91110115770413928Y', '电气防火检测技术服务机构', '技术开发、转让、咨询、服务；消防安全检测服务；维修消防器材。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京巨安顺鑫消防科技有限责任公司成立于2005年1月，是经北京市工商行政管理局注册，具有独立法人资格，并通过北京市消防局审核批准，主要从事建筑内固定消防设施检测、电气设施防火安全技术检测及消防设施维保等技术性服务及零售消防设施、消防器材、机械电器设备。我公司技术力量雄厚，拥有一支高素质的专业技术队伍，公司员工持证上岗100%（建筑消防设施技术检测、电气防火技术检测证书及高压电工本）。公司业务广泛，曾为北京市各大商市场、酒店、写字楼、学校、医院、工厂、体育场馆、电影院、游乐场、地铁等提供消防安全检测和消防设施维保等服务，在业内享有良好的信誉。', '116.70658299999999', '39.605145999999998', '116.70658299999999', '39.605145999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3812', '北京德裕盛清洁环保科技有限公司', '601', '张海明', '13031182761', '张海明', '89372996    13031182761', '2006年02月10日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡苏庄东街9号西侧1幢3层330', '北京市', '北京市', '房山区', '西潞街道', '北京市房山区良乡苏庄东街9号西侧1幢3层330', '', '消防设施,烟道清洗', '有限责任公司（自然人投资或控股）', '2006年02月10日', '2056年02月09日', '2018/9/6', '2019/9/5', '京消协（2018）证字287号', '91110111785539275P', '排油烟设施清洗机构', '环保技术推广；家庭劳务服务；销售、安装、维修家用电器、空调制冷设备、厨房用具、环保设备、办公用品、水处理设备、机电设备；清洁服务（不含洗车服务）；技术检测；大气污染治理；害虫防治服务；专业承包；劳务分包；物业管理；园林绿化服务；租摆绿植；销售机械设备、清洁用品、化工产品（不含危险化学品）、日用化学品、第一类医疗器械、第二类医疗器械、办公用品、消防器材、服装、鞋帽；技术检测；环境保护监测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京德裕盛清洁环保科技有限公司简介\r\n北京德裕盛清洁环保科技有限公司创立于2006年，是经北京市工商行政管理局核准注册登记，北京消防协会核发油烟清洗资质的专业从事饭店、酒店、宾馆、企事业机关单位食堂、医院、部队、学校食堂油烟管道清洗，油烟机清洗，油烟净化器清洗，灶台油烟罩清洗，中央空调保养清洗，地毯清洗，外墙清洗，地面保养，新居开荒保洁，家庭、办公室清洁，石材养护，绿植租摆养护，同时从事社区家庭家政服务，家庭油烟机清洗，家庭各种家电清洗消毒，家庭保洁，室内消毒，灭鼠灭蟑螂及其他虫害，家庭老人护理照护，保姆月嫂家政服务，物业管理服务，环保技术推广及人才中介服务等服务的大型综合性公司。公司注册资金1000万人民币。公司系北京消防协会会员单位、北京家政服务协会会员单位，获得北京市人力资源和社会保障局颁发的人力资源诚信服务示范单位荣誉称号。\r\n公司证照资质齐全，全员持证上岗。公司拥有一支高素质的经营管理队伍和技术精湛的施工服务队伍。公司建立健全了一整套严格完善的管理制度，并采取有效措施保证制度的落实。公司拥有先进的清洗保洁设备，引进先进施工技术，确保为客户提供高效优质专业的服务。', '116.126772', '39.726796999999998', '116.126772', '39.726796999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3813', '北京嘉智佳美科技有限公司', '599', '菅坤', '18911934516', '菅坤', '18911934516', '2016年06月17日', '300万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区开放路113号南四层409室', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '北京市怀柔区开放路113号南四层409室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年06月17日', '2046年06月16日', '2019/1/11', '2020/10/10', '京消协（2019）证字008号', '91110116MA0069QK3H', '', '技术开发、技术推广；物业管理；专业承包；劳务分包；建筑物清洁服务、办公室保洁服务；销售机械设备、化工产品（不含危险化学品）、厨房用具、家用电器、五金交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是一家经过正式注册（注册资金：300万），拥有合法经营执照的正规企业。专业为宾馆饭店机关单位食堂提供厨房大型排油烟系统清洗和设备维护服务！公司拥有严格的管理制度以及施工质量标准；依靠先进的设备、精湛的技术为客户提供全方位服务！。清洗维修技师都具备多年清洗、维修、安装经验，特别是在清洗过程中对厨房的电源保护的非常到位；并不断吸收新的技术和先进的检测设备来满足广大客户的需求！\r\n公司经营范围：排油烟系统清洗维护；排烟风机清洗维修；油烟净化器销售安装；厨房灶具维修改造；节能型炉头推广；蒸箱热水器除垢；炊事机械设备销售维修；冰箱制冷设备维修销售；厨房设备及排烟系统设计生产安装一条龙服务！', '116.64410100000001', '40.334054999999999', '116.64410100000001', '40.334054999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3814', '北京碧诺鸿德环保科技有限公司', '598', '周英德', '13651213546', '周英德', '13651213546', '2012年07月16日', '800万元', '北京市', '北京市', '海淀区', null, '北京市海淀区上庄馨瑞嘉园1号楼1-2层1单元103-4', '北京市', '北京市', '丰台区', '长辛店街道', '长兴路12号中体奥园25号楼103', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年07月16日', '2032年07月15日', '2018/10/30', '2019/10/29', '京消协（2018）证字347号', '91110108599610277R', '排油烟设施清洗机构', '技术开发、技术转让、技术推广、技术咨询、技术服务；厨房设备（抽油烟机等）的清洗；害虫的防治服务；销售机械设备、电子产品、五金交电、计算机、软件及辅助设备；机械设备租赁（不含汽车租赁） 。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '关于我们：北京碧诺鸿德环保科技有限公司是开发、销售、KPC油烟净化设备,并承接烟道清洗工程，从事保洁服务的现代新型环保公司。\r\n公司理念：不懈的努力、不懈的追求是本公司永保活力的源泉 ，科学灵活的经营管理是本公司的成功的保证；客户至上，信誉第一，奉行诚信服务，是本公司赖以发展的宗旨。\r\n个性服务特点：在签订合同的同时，以双方认可的样版为基础，互惠互助的合作的原则达成协议，以客户满意为验收标准，员工实行统一管理、统一形象、统一培训并注重企业形象力。\r\n公司员工：所有上岗人员均经过严格的培训和考核。跟踪世界先进技术发展潮流，引进先进的清洁设备、清洁用品及先进的清洁保养理念，对高校、写字楼、酒店、机关单位的清洁管理运作贯以严格管理和规范服务。\r\n公司设备：拥有一流的机械设备、进口高效清洁剂一套完整的清洗保洁质量保证体系，严格按照服务程序，倡导星级保洁。洗地机、抛光机、吸尘器、吸水机、烘干机、干洗机等都为意大利产品。\r\n独到之处：对清洁行业中系列难处理的棘手问题都有独到的处理方法，比如厨房油污、卫生间污垢、水泥垢等等都可以做到洁白如新。', '116.21603399999999', '40.126218000000001', '116.185523', '39.836078999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3815', '北京华烨消防科技有限公司', '597', '梁立山', '18911009865', '梁立山', '18911009865', '2013年09月02日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号-D2727', '北京市', '北京市', '房山区', '青龙湖镇', '北京市房山区青龙湖镇小马村146号', '', '消防设施', '有限责任公司（自然人投资或控股）', '2013年09月02日', '2063年09月01日', '2018/7/19', '2019/7/18', '京消协（2018）证字238号', '91110109078594902E', '', '专业承包；施工总承包；消防安全技术开发、服务；保洁服务；销售日用品、五金交电、交通设施、消防器材、消防设备、安防产品；维修消防器材、消防设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华烨消防科技有限公司成立于2013年9月，主要从事消防器材销售、灭火器维修保养，2015年7月31日取得临时三级资质，2019年1月1日取得正式三级资质。', '116.12697', '39.717785999999997', '116.086704', '39.747405000000001', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3816', '北京鑫太阳清洗服务有限公司', '596', '夏喜霞', '13520083848', '李茂华', '13001978886', '2015年04月29日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区卓秀北街8号院8号楼6层604', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区卓秀北街8号院8号楼6层604', 'AAA', '烟道清洗', '有限责任公司（自然人独资）', '2015年04月29日', '2035年04月28日', '2018/6/15', '2019/6/14', '京消协（2018）证字189号', '9111010633979944N', '排油烟设施清洗机构', '清洁服务；机械设备、仪器仪表、家用电器维修；销售机械设备、卫生用品、电子产品、家用电器、日用杂货、建筑材料；技术开发、技术服务、技术咨询、技术转让。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫太阳清洗服务有限公司，是北京市消防协会团体会员单位，是经消防部门审批的专业商用厨房烟道防火清洗服务公司。向客户提供高效专业的服务,享受到专业化服务，常年提供专业烟道防火清洗.有效地消除了火险隐患，确保了用户消防安全， 鑫太阳清洗公司，所有的技术人员均有十五年以上的经验。训练有素的专业技术服务队伍随时待命，为您24小时提供服务。我们从业经验更多，管理规范。从业以来，我们清洗服务的客户都是国家一级重点防火单位（钓鱼台国宾馆、全国政协礼堂.东城消防局.法制日报社.北京第二监狱.北京食品药品监督管理局.大兴消防局.天津海关总署.等）、三级甲等医院、大专院校等各种场所，拥有丰富的管理和施工经验。我们的各种资质、认证更完备。“鑫太阳”公司通过了ISO9001质量管理体系、ISO14001环境管理体系和ISO 28001职业健康安全管理体系.认证企业.', '116.18172', '39.731569', '116.18172', '39.731569', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3817', '北京安泰洁佳保洁有限公司', '595', '王亚岭', '13691139112', '王亚岭', '13691139112', '2009年01月09日', '50万元', '北京市', '北京市', '石景山区', null, '北京市石景山区双峪路35号爱玛裕家居购物广场', '北京市', '北京市', '石景山区', '广宁街道', '北京市石景山区双峪路35号爱玛裕家居购物广场', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年01月09日', '2029年01月08日', '2018/7/26', '2019/7/25', '京消协（2018）证字242号', '911101076843712900', '', '清洗服务；技术转让；销售日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '本公司一直从事专业清洗保洁服务，未出现过任何安全事故，无任何投诉', '116.118649', '39.939574999999998', '116.118649', '39.939574999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3818', '北京华宇众洁科技发展有限公司', '594', '任燕玲', '15011139024', '任燕玲', '15011139024', '2013年11月28日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区花乡郑王坟万柳桥南97号6号楼101室', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区花乡郑王坟万柳桥南97号6号楼101室', '', '消防产品,烟道清洗', '有限责任公司（自然人独资）', '2013年11月28日', '2033年11月27日', '2018/8/9', '2019/8/8', '京消协（2018）证字257号', '911101060855479286', '', '技术开发、技术服务、技术转让；清洁服务；机械设备租赁；经济信息咨询；销售消防器材、厨房用具、卫生间用具、日用品、清洁用品、五金交电、机械设备、电子产品、化工产品（不含化学危险品）、建筑材料、汽车配件、工艺品、针纺织品；维修家用电器。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京华宇众洁科技发展有限公司是一家集设计开发、生产、销售、安装、维修、清洁服务于一体的专业公司，公司秉承以“质量求生存，以信誉求发展”的宗旨和以“质服人、以信感人、以诚待人”的理念赢得了广大客户的赞誉。\r\n我公司主要为宾馆、饭店、中西餐厅、酒楼、快餐厅、机关企事业单位、学校及部队等进行专业设计、销售、安装、维修及清洁服务。\r\n我公司本着以人为本、以诚经营、以义制利的经营理念、为力争客户提供优质的产品、合理的价格及满意的售后服务；以专业化、职业化、规范化、标准化、国际化的商业标准，引进先进的生产设备与高薪技术人员。\r\n基本原则：公司坚持以“质量第一、顾客至上”为基本原则，搭配厨房整体节能系统，并提供现场设计、定制、安装、维修、清洁服务等与一体化服务。\r\n服务理念：以客户的满意度作为我们服务的第一标准，以准时、保质保量的完成客户交给我们的任务作为出发点，创建高质量、高品质的厨房工程。', '116.332194', '39.842604000000001', '116.332194', '39.842604000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3819', '北京乙辉华强科贸有限公司', '592', '郭军强', '13911797569', '孙艳华', '13651067499', '2013年08月08日', '100万元', '北京市', '北京市', '丰台区', null, '葆台北路8号院1区1号楼1-7-1', '北京市', '北京市', '丰台区', '花乡地区办事处', '葆台北路8号院1区1号楼1-7-1', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年08月08日', '2043年08月07日', '2018/5/30', '2019/5/29', '京消协（2018）证字155号', '91110106076645761H', '排油烟设施清洗机构', '专业承包；技术开发、技术服务、技术咨询；劳务服务；清洁服务；害虫防治服务；大气污染治理；水污染治理；日用电器维修（不符合家用电子电器维修业服务规范的不得开展经营活动）；销售电器设备、电子产品、五金交电、建筑材料、机械设备、日用品、消防器材。（领取本执照后，应到市住建委取得行政许可。；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京乙辉华强科贸有限公司是一家专业从事清洗服务、劳务服务及机械设备、电器设备、五金交电等材料销售、安装、维修为一体的服务性公司。本公司自2013年成立以来，以成为北京消防协会单位会员，是消防协会质量体系认证的单位。以“顾客第一、诚信为本、高效求实、稳步发展的经营理念为宗旨，销售和维修、维保及机电、消防、安保系统安装劳务为主，开拓发展了厨房烟囱排油烟道、厨具设备清洗、安装、维修、管道设计、安装及空调清洗、维修业务。\r\n公司服务员工都通过安装保养、维修、烟道设备清洗方面的专业技能培训，同时还要进行从业道德、服务质量、安全第一意识方面的培训，通过考核后方可上岗。\r\n公司具有完善的工作管理制度和安全操作制度，制订了规范的工序操作流程。同时，拥有经过专业培训的作业人员以及全套优质设备，各项服务收费合理，能为客户提供安全、规范和想满意的厨房设备、烟道清洗维护服务。\r\n公司竭诚为您提供专业的“一点通、一站式”咨询服务，随时为您排忧解难。为了方便广大客户，我们公司还推出消防工程安装、设计、维保服务等咨询服务和上门服务业务。竭诚为新老客户提供快捷、方便的上述各项服务，是我们衷心所望。', '116.28619399999999', '39.804797999999998', '116.28619399999999', '39.804797999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3820', '北京陆顺佳安交通消防安全设备有限公司', '591', '郁茂峰', '18801265788', '郁茂峰', '18801265788', '2014年02月17日', '300万元', '北京市', '北京市', '丰台区', null, '北京市丰台区六合庄', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市丰台区六合庄恒润公寓5号院', '', '消防设施,消防产品', '有限责任公司（自然人独资）', '2014年02月17日', '2034年02月16日', '2018/7/19', '2019/7/18', '京消协（2018）证字236号', '911101060924391240', '', '专业承包；销售机械设备、交通设施、消防器材、电子产品、建筑材料、五金交电、金属材料、服装；技术开发；技术服务；技术检测；消防器材维修；机械设备维修；机械设备租赁；家居装饰；服装加工。(领取本执照后，应到住房城乡建设部取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司主要从事消防器材销售，维修、检测。', '116.42871599999999', '39.838160000000002', '116.419197', '39.822612999999997', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3821', '北京京安翔业机械设备有限公司', '590', '李建海', '13683336723', '杨帆', '13910266563', '2005年04月20日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区博大路鸿博家园一期B区2号楼3单元1802', '北京市', '北京市', '朝阳区', '小红门地区办事处', '北京市朝阳区博大路鸿博家园一期B区2号楼3单元1802', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年04月20日', '2035年04月19日', '2018/8/20', '2019/8/19', '京消协（2018）证字271号', '911101127740586952', '排油烟设施清洗机构', '销售机械设备及配件、五金交电（不含电动自行车）、建筑材料、化工产品（不含危险化学品）、钢材、电子产品、塑钢门窗；维修、租赁建筑工程机械、建筑工程设备；建筑物清洁服务；工程造价咨询；施工总承包；专业承包；劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京京安翔业机械设备有限公司成立于2005年，是一家经过国家工商行政管理部门注册，拥有合法经营资格，致力于环保事业的工程服务型企业。专业从事中央空调系统清洗消毒、厨房不锈钢设备更换维护、上下水管改造、油烟设备和排烟系统清洗服务，是北京消防协会会员单位。\r\n公司本着 “创新高效  诚信务实”的企业文化， 以一批经验丰富的技术服务人员组成的专业化施工队伍。通过先进的科技产品和专业化设备，为用户提供完善的标准化服务。所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质服务。\r\n    公司引进了国内最先进的清洗系统（机器人系统）。采用了先进的清洗技术，力求全面的为社会各界创造一个清新、健康、安全、卫生的工作和生活环境。\r\n公司与国内多家知名企业建立了广泛持久的合作关系，并与具体项目相结合，本公司质优价廉的为您提供全方位的安装维护、清洗保洁服务。\r\n    公司一惯秉承环保第一、效益第二的经营理念。各种材料，药剂，为环保产品，绝不含腐蚀剂，不会对清洗物造成二次污染。', '116.472722', '39.831305', '116.472722', '39.831305', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3822', '北京隆盛环境工程有限公司', '589', '石东春', '010-69087398', '石爱国', '010-69087398', '2002年08月23日', '5000万元', '北京市', '北京市', '密云区', null, '北京市密云区西门外大街8号楼3号房二层', '北京市', '北京市', '密云区', '果园街道', '北京市密云区西门外大街8号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2002年08月23日', '2022年08月22日', '', '', '', '91110228742320441L', '', '施工总承包；专业承包；劳务分包；建设工程项目管理；室内外保洁；城市园林绿化；家庭劳务服务；害虫的防治服务；建筑物清洁服务；房屋的清扫、消毒；机器和办公设备的清洗；厨房设备（抽油烟机等）的清洗；出租商业用房、办公用房；委托加工；销售机械设备；污水处理；物业管理；租赁机械设备；普通货运；城市生活垃圾清扫、收集、运输、处理；人力资源服务；餐饮管理。（企业依法自主选择经营项目，开展经营活动；人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京隆盛环境工程有限公司（原名北京隆盛保洁服务有限公司）是专注于人居环境综合提升的环境服务企业，注册资金5000万元人民币，总部位于北京市朝阳区西大望路19号。自2002年成立以来，始终贯彻“至诚服务，大道行远”的经营理念。公司成立十七年来，深耕环境治理领域，形成了集环卫一体化综合服务、物业保洁服务、园林绿化服务为一体的环境综合治理运营模式。\r\n公司弘扬“诚信、敬业、创新、共享”的企业精神，形成了一支团结、稳定、专业的创新型管理团队，获得多项发明和新型技术专利，在职员工2600余人。\r\n公司系高新技术企业；符合ISO质量、环境、职业健康安全认证；是央企和北京市政府采购中心“物业服务定点政府采购项目”定点采购单位；获得“中国清洁清洗行业国家一级”资质、“高空服务业企业安全资质证书”资质、市政市容委“从事城市垃圾（含生活垃圾和建筑垃圾）经营性清扫、收集、运输处理服务”行政许可资质；通过“企业AAA级”信用管理体系标准认证；是中国战略性新兴环保产业标杆企业。', '116.832954', '40.377406999999998', '116.832954', '40.377406999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3823', '北京润泽民生商贸有限公司', '588', '段俊立', '13901263984', '段俊立', '13901263984', '2012年04月18日', '206万元', '北京市', '北京市', '朝阳区', null, '通惠家园惠泽园13号楼1层1-5', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '通惠家园惠泽园13号楼1层1-5', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年04月18日', '2032年04月17日', '2018/7/12', '2019/7/11', '京消协（2018）证字233号', '91110105593821268F', '排油烟设施清洗机构', '售五金交电、建筑材料、日用品、家具；家庭劳务服务；清洁服务；专业承包；打字、复印；摄影扩印服务；会议及展览服务；组织文化艺术交流活动（不含演出）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2012年4月18日，是北京市安全生产监督管理局评判的达标企业。是北京市消防协会会员单位。\r\n是中国中小商业企业协会清洁行业分会理事会员。\r\n公司本着为客户着想真诚服务的原则，竭诚为企事业单位、宾馆、酒店、饭店、写字楼、机关团体、学校等提供优质专业的抽排油烟机设施清洁服务。', '116.499751', '39.908906999999999', '116.499751', '39.908906999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3824', '北京海润保洁有限公司', '587', '红山', '13911699178', '杨永生', '15510074132', '2006年12月15日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区北务镇政府街9号-379', '北京市', '北京市', '顺义区', '北务镇', '北京市顺义区北务镇政府街9号-379', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年12月15日', '2026年12月14日', '2018/8/20', '2019/8/19', '京消协（2018）证字270号', '91110108796703747P', '排油烟设施清洗机构', '建筑物清洁服务；机器和办公设备的清洗；锅炉烟囱的清扫；厨房设备（抽油烟机等）的清洗；房屋的清扫、消毒；害虫的防治服务；城市园林绿化、城市生活垃圾运输；劳务分包；销售机械设备、化工产品（不含危险化学品及一类易制毒化学品）；劳务派遣。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京海润保洁有限公司企业简介\r\n         \r\n北京海润保洁有限公司创建于2006年，拥有员工2500多人，是一家长年从事多项清洁服务,集管理、养护、服务于一体的专业保洁服务公司，经营范围：楼宇保洁、开荒；外墙清洗、粉刷；石材养护；有害生物防制；绿化养护；烟道清洗；垃圾清运劳务分包；销售清洁设备、用品，花卉租摆；劳务派遣。我公司在所承接的高档写字楼、酒店、场馆、医院、商场、公寓、别墅、机场、宾馆、影院等项目,凭借国内一流的服务水平和良好的信誉,同客户建立了长期、稳定的合作关系,在同行业中享有极高的声誉。\r\n\r\n◎ 经营理念  \r\n以人为本的管理方式   \r\n细致规范的质量标准   \r\n认真敬业的工作态度  \r\n永争第一的进取精神\r\n◎ 质量方针\r\n   追求卓越，精益求精\r\n\r\n◎ 质量目标\r\n客户满意率大于98%，客户投诉处置率100%\r\n    保洁服务合格率98%   合同履约率100%\r\n◎ 环境目标    \r\n   固废分类收集率95%\r\n◎ 安全目标\r\n   全年无重大工伤事故；全年轻伤事故控制在2件以下', '116.829432', '40.066327999999999', '116.829432', '40.066327999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3825', '北京云渺峰上保洁服务有限公司', '586', '王寒刚', '13241878259', '王寒刚', '13241878259', '2018年05月28日', '100万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖经济开发区雁栖大街13号3层', '北京市', '北京市', '朝阳区', '三里屯街道', '北京市朝阳区工人体育场北路8号院2号楼4层2526', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年05月28日', '长期', '2018/7/19', '2019/7/18', '京消协（2018）证字240号', '91110116MA01CFU48Y', '', '办公室清洁服务、建筑物清洁服务、家庭劳务服务、机械设备专业清洗服务、生活清洗、消毒服务；水污染治理、大气污染治理；专业承包、劳务分包、施工总承包；技术服务、技术咨询、技术转让、技术开发、技术推广；林业有害生物防治服务；害虫的防治服务；灭鼠及预防；销售农药（不含危险化学品农药）；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京云渺峰上保洁服务有限公司是专业的服务型企业，主要从事机械设备专业清洗、办公室清洁服务、生活清洗、消毒服务；水污染治理、大气污染治理等专项服务。本公司既服务于各类商业企业、机关团体、建筑、装饰施工企业，同时也为千家万户提供优质，便捷的服务。\r\n北京云渺峰上保洁服务有限公司致力于长期合作关系，提高服务质量，提供高标准的排油烟管道清洗、办公室清洁服务、生活清洗等一系列保洁服务。我们的经营理念：专业为您营造一个更安全、更洁净亮丽的工作和生活环境而努力!\r\n“诚信”是本公司成功的保证。\r\n“客户至上，信誉第一”是本公司的宗旨。\r\n“给您多一份安心、少一份担心”是我们的原则。\r\n第一时间提供一流的客户服务，维护客户利益、形象是我们始终不渝的目标。\r\n本公司以一流的质量、优惠的价格、周到热情的态度为广大客户提供更多、更好的清洁服务，您的支持是我们公司发展的源泉!\r\n优质服务：\r\n1.我们以客户为中心，公司规定各施工人员在施工中必须倾听客户的要求。\r\n2.我们有专业的管理人才和一支技术实力雄厚的施工队伍，配合先进的清洗设备，保证施工质量和后期维护。\r\n3.我公司为所有施工人员投保施工作业意外伤害险，确保甲乙双方都无后', '116.696758', '40.362198999999997', '116.45343200000001', '39.932192000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3826', '北京洁屋靓厨科技有限公司', '585', '周举锋', '15330015131', '夏秀艳', '13391960910', '2014年12月09日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区南磨房路37号1701-1703', '北京市', '北京市', '朝阳区', '劲松街道', '华腾北塘集中办公区179771号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年12月09日', '2034年12月08日', '2017/6/14', '2018/6/13', '京消协（2017）证字1112号', '911101053183876123', '排油烟设施清洗机构', '技术推广服务；技术咨询；家庭劳务服务；清洁服务（不含餐具消毒）；销售日用品、厨房设备、办公用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '我公司自创办以来，一直兢兢业业，主推排油烟设施清洗，得到了大家的认可，为我们的消防事业贡献了一份力量·', '116.46743499999999', '39.885131999999999', '116.46743499999999', '39.885131999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3827', '北京中泰鑫消防工程服务有限公司', '584', '孙琳琳', '15810467456', '王江', '18610414098', '2016年02月29日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区马昌营镇天井大街甲2号', '北京市', '北京市', '通州区', '台湖镇', '北京市通州区次渠铺西路1号', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年02月29日', '2066年02月27日', '2018/7/19', '2019/7/18', '京消协（2018）证字235号', '91110117MA003TF910', '', '施工总承包；专业承包；劳务分包；工程勘察设计；技术开发；技术转让；技术服务；计算机技术培训（不得面向全国招生）；家庭劳务服务；租赁建筑机械设备；建筑物清洁服务；室内外装饰设计；经济贸易咨询；销售机械设备、五金交电、化工产品、日用品、办公用品、厨卫用具、安全技术防范产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中泰鑫消防工程服务有限公司，是一家从事消防工程专业公司，经北京市工商管理局批准注册成立，主营业务范围：施工总承包，专业承包，劳务分包，工程勘察设计，室内外装潢装饰设计，技术开发，转让，技术服务，消防设备安装工程，消防维保，验收。租赁建筑机械设备，销售机械设备，建筑物清洁。厨卫用具等……为一体的服务性公司。\r\n公司具有完善的管理制度以及安全的操作管理流程，公司遵循以人为本的企业文化、秉承“专心致志，营造安全”的企业理念。 在经营过程中，一直坚持“质量第一，信誉至上”的原则。以真诚热情的服务态度，严谨的工作作风，为国家的可持续发展和人民的生命财产安全保驾护航。', '117.018359', '40.112555', '116.577804', '39.808827000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3828', '北京志晨美家保洁清洗有限公司', '583', '李慧', '13521789883', '陈县忠', '13366584368', '2017年09月15日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰管路22号院12幢2331室', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区丰管路22号院12幢2331室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年09月15日', '2047年09月14日', '2018/5/30', '2019/5/29', '京消协（2018）证字162号', '91110106MA017LGEXR', '排油烟设施清洗机构', '清洁服务；技术服务、技术咨询、技术转让；销售清洁用品、日用品、家用电器、五金交电（不得从事实体店铺经营）、建筑材料（不得从事实体店铺经营）、装饰材料（不得从事实体店铺经营）、机械设备、酒店用品；城市园林绿化；劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京志晨美家保洁清洗有限公司在2017年9月15日成立以来，本公司主要业务厨房排油烟设施的清洗；锅炉烟囱的清洗；厨房设备的清洗；房屋的清扫、消毒；建筑物清洁服务等.......我们始终为客户提供好的产品和技术支持、健全的售后服务，坚持以技术为基础、服务为根本、创新为灵魂，不断提高客户的满意度，是全体员工不懈追求。\r\n  公司经营范围包括：清洁服务、技术服务、技术咨询、技术转让；销售清洁用品、日用品、家用电器、五金交电（不得从事实体店铺经营）、机械设备、酒店用品、城市园林绿化；劳务服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门经批准后批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）\r\n  经营管理是本公司成功的保证，“客户至上，信誉第一”是本公司信赖以发展的宗旨。本公司以一流的质量、优惠的价格、周到热情的态度为广大客户提供更多、更好的服务，并热诚欢迎社会各界朋友光临本公司业务洽谈。\r\n 期待与您的握手，原我们的握手真诚而有力。', '116.313866', '39.857754', '116.313866', '39.857754', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3829', '北京东富净化技术有限公司', '582', '邹树铮', '13601304672', '翟玮', '16601033619', '2007年09月25日', '320万元', '北京市', '北京市', '大兴区', null, '北京经济技术开发区科创五街38号院2号楼930', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京经济技术开发区科创五街38号院2号楼930', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2007年09月25日', '2027年09月24日', '2018/5/3', '2019/5/2', '京消协（2018）证字093号', '911103026675332514', '排油烟设施清洗机构', '技术开发、技术转让；技术检测；室内环境治理；销售空调配件、净化设备、建筑材料、文化用品(不含行政许可的项目)、工艺美术品、五金交电、化工产品（不含一类易制毒品及危险化学品）、机械电子设备；清洗服务；保洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动）', '北京东富净化技术有限公司成立于2007年，是一家经过北京市工商局注册正规企业。专业从事酒店、食堂、学校、机关单位排油烟管道清洗，空调清洗，石材保养、翻新，锅炉清洗服务的清洗技术公司。\r\n我公司拥有严格的管理制度、先进的设备、一流的服务质量，精湛的技术。清洗维修技师都具备多年清洗、维修、安装经验，并不断吸收新的技术和先进的检测设备来满足广大客户的需求。全员上岗前都必须经过严格的岗前培训，并通过统一的考核方可上岗。公司的服务形式灵活多样，价格合理，并全心全意为客服提供细致周到的服务，客户的满意和认可是我们赖以生存的基础，也是我公司全体员工坚持不懈的追求目标，公司在运营中注重全面管理，定期对各岗位员工进行清洁技术培训，严格要求，积极进取，并且不断完善尽美的服务为每一位客服打造一个健康、洁净、舒适的美好环境！', '116.53223199999999', '39.801369000000001', '116.53223199999999', '39.801369000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3830', '北京英兰环保科技有限公司', '581', '张庆春', '13661000787', '张庆春', '13661000787', '2007年03月05日', '55万元', '北京市', '北京市', '通州区', null, '北京市通州区张家湾镇齐善庄村208号', '北京市', '北京市', '通州区', '张家湾镇', '北京市通州区张家湾镇齐善庄村208号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年06月16日', '2044年06月15日', '2018/5/30', '2019/5/29', '京消协（2018）证字171号', '91110112l168057702', '', '环保技术推广；销售、维修环保专用设备、水处理专用设备、家用电器、电子产品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京英兰环保科技有限公司，成立于2007年，注册资金55万元，是“有限责任公司（自然人独资）”企业，从事水处理设备销售、安装、维修维护、售后服务及配套设备设计，家用电器维修维护技术咨询为一体的销售公司。', '116.697388', '39.827179999999998', '116.697388', '39.827179999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3831', '中消联盟（北京）消防工程技术有限公司', '580', '成劲松', '13801268091', '杨晓娟', '18654511314', '2015年09月18日', '1484万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡长虹西路翠柳东街1号-3081', '北京市', '北京市', '丰台区', '长辛店镇', '北京市丰台区长辛店镇射击场路15号园博园一号服务区103室', '', '建筑防火,宣传教育培训', '有限责任公司（自然人投资或控股）', '2015年09月18日', '2045年09月17日', '2018/5/30', '2019/5/29', '京消协（2018）证字164号', '91110111MA0012E15T', '', '工程技术咨询；建设工程项目管理；技术开发、技术转让、技术咨询（中介除外）、技术服务；技术检测；施工总承包；专业承包；消防工程设计；计算机技术培训（不得面向全国招生）；维修消防器材；经济信息咨询；销售消防器材、机电设备、机械设备、日用杂品、服装、鞋帽、五金、交电、化工产品（危险化学品除外）、仪器仪表、办公用品、针纺织品、儿童玩具（仿真枪械除外）、消防器材、建筑材料、金属材料、计算机软硬件及辅助设备、汽车配件；货物进出口（国营贸易管理货物除外）、代理进出口、技术进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中消联盟（北京）消防工程技术有限公司成立于2015年09月18日，注册资本为1484万元。公司从事专业建筑消防工程，致力于为广大用户提供国内外先进的消防产品和消防工程安装服务。我们的服务宗旨是：争当消防行业里的“红旗手”，为广大用户提供最为优质的消防产品及专也的工程技术服务，为祖国的消防安全建设做到尽心尽力，尽职尽责。', '116.127313', '39.726514999999999', '116.197885', '39.871116000000001', '注册地址坐标位置不准确', null, null, null, null);
