INSERT INTO `t_fc_company` VALUES ('3833', '北京锦祥辉消防工程有限公司', '578', '丁泽坤', '18500311042', '丁泽坤', '18500311042', '2018年10月17日', '50万元', '北京市', '北京市', '大兴区', null, '北京市大兴区瀛吉街8号院3号楼4层403', '北京市', '北京市', '大兴区', '瀛海地区办事处', '北京市大兴区瀛吉街8号院3号楼4层403', '', '消防设施,烟道清洗', '有限责任公司（自然人独资）', '2018年10月17日', '2048年10月16日', '2018/12/6', '2019/12/5', '京消协（2018）证字437号', '91110115MA01F4CC52', '排油烟设施清洗机构', '专业承包；出租商业用房、办公用房；科技开发；科技推广；技术转让、服务；清洁服务；销售五金产品（不含电动自行车）、建筑材料、日用品、电子产品、纺织品、制冷设备、环保设备、家用电器、汽车配件、化工产品（不含危险化学品及一类易制毒化学品）；劳务服务；劳务分包；家政服务；代收衣物；销售食品；零售烟草。（企业依法自主选择经营项目，开展经营活动；销售食品、零售烟草以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '专业清洗饭店，学校各大商场排油烟设施服务', '116.449923', '39.763109999999998', '116.449923', '39.763109999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3834', '北京市顺义区人力资源和社会保障局高级技工学校', '577', '李征艳', '69419700', '卢立明', '18811318207', '', '', '北京市', '北京市', '顺义区', null, '北京市顺义区牛栏山镇牛富路10号', '北京市', '北京市', '顺义区', '牛栏山地区办事处', '北京市顺义区牛栏山镇牛富路10号', '', '宣传教育培训', '民办学校', '', '', '2019/1/17', '2020/1/16', '京消协（2019）证字019号', '1113133001001', '社会消防安全培训机构', '', '北京市顺义区人力资源和社会保障局高级技工学校位于顺义区牛栏山镇牛富路。学校成立于1989年，隶属于北京市顺义区人力资源和社会保障局。学校现设置数控加工（车工方向）、汽车维修、电气自动化设备安装与维修、计算机网络应用、航空服务、现代物流6个三年学制专业，2018年学校获批三年制消防专业招生资格。学校积极开展面向社会的技能培训工作，设有32个初、中级工培训工种、12个高级工培训工种和8个非等级培训工种，年培训量约12000人。', '116.655832', '40.221978999999997', '116.655832', '40.221978999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3835', '北京和安消防工程有限公司', '575', '张洮', '13801132689', '朱亚红', '13811382689', '2005年10月13日', '3000万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区青春路26号', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区大成路6号', '', '消防设施,消防产品', '有限责任公司（自然人投资或控股）', '2005年10月13日', '2025年10月12日', '', '', '', '911101167809546724', '', '专业承包；工程勘察设计；工程项目管理；技术检测；技术开发、技术咨询、技术服务；工程和技术研究与试验发展；销售安全技术防范产品、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京和安消防工程有限公司创建于二〇〇五年十月，注册资金人民币3000万元；是一家专门集火灾自动报警系统、自动喷洒系统、消火栓系统、气体灭火系统、消防泵系统等自动消防系统的销售、施工、安装、运营维护、售后服务于一体，为客户提供整体优质服务的专业企业。\r\n北京和安消防工程有限公司可为大、中型建筑构造完善有效的消防电子系统工程和公共安全技术防范系统工程。承接工程的范围包括：消防报警及联动控制系统、气体灭火系统，安防视频监控系统等。公司可协助甲方办理公安行管及消防部门的有关手续，并保证承接的工程验收合格。公司在北京不仅安装、代理销售、消防、安防电子产品，同时也可提供消防、安防工程设计、施工、开通调试及售后的一条龙综合服务。', '116.630842', '40.319344999999998', '116.27201100000001', '39.889015000000001', '', null, null, null, null);
