INSERT INTO `t_fc_company` VALUES ('3837', '中交华远（北京）建设工程有限公司', '573', '李世国', '13366608046', '邓桂', '010-87220218', '2017年05月15日', '15000万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区荣华南路9号院2号楼7层701-1', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区荣华南路9号院2号楼7层701-1', '', '电气防火,建筑防火,消防设施,消防安全检查,消防产品,烟道清洗', '有限责任公司（自然人投资或控股）', '2017年05月15日', '2047年05月14日', '2018/5/22', '2019/5/21', '京消协（2018）证字127号', '91110109MA00EEYE29', '', '施工总承包；专业承包；劳务分包；工程设计；房地产开发；工程勘察；污水处理；销售建筑材料、五金交电（不含电动自行车）、化工产品（不含危险化学品及一类易制毒化学品）、电子产品；技术开发、推广、转让、服务、咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '企业简介\r\n中交华远（北京）建设工程有限公司注册资金15000万元，是一家以消防工程、建筑装修装饰工程、建筑幕墙、建筑工程施工总承包、钢结构工程、环保工程等工程服务为一体的专业建筑公司。公司拥有消防工程专业承包贰级、建筑装修装饰工程专业承包贰级、建筑幕墙工程专业承包贰级、环保工程专业承包叁级、钢结构工程专业承包叁级、建筑工程施工总承包叁级等资质。\r\n公司主营消防业务范围是：消防报批、消防施工、建设工程消防施工备案、消防咨询、消防维保、消防设施及电气防火检测等服务。\r\n公司各类专业技术人员齐全，技术力量雄厚，公司秉承“以市场为导向，以科技为支撑、发挥专业优势创高效低耗优质企业”的宗旨，始终坚持以“专业过硬的技术，一流的服务意识”为我们的合作伙伴提供优质的服务，并不断完善与开拓！交流与合作是市场经济发展的主旋律，也是企业赖以生存和发展的契机。平安的事业凝聚着平安人矢志不渝的努力与追求，更仰仗社会各界的鼎力协持和帮助，我们怀存一颗感恩的心，与时俱进，开拓创新，并诚挚地期待社会各界与我们进一步精诚合作，共同创作美好未来！', '116.515079', '39.785339999999998', '116.515079', '39.785339999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3838', '北京万事通保洁有限公司', '572', '王喜英', '15210203228', '方兴才', '18710164335', '2014年07月03日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区三间房乡西柳村中街（三间房动漫集中办公区1341号）', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区三间房乡西柳村中街（三间房动漫集中办公区1341号）', 'AA', '烟道清洗', '有限责任公司（自然人独资）', '2014年07月03日', '2044年07月02日', '2019/5/15', '2020/5/14', '京消协（2019）证字261号', '9111010530641867X2', '烟道清洗', '清洁服务（不含餐具消毒）；家庭劳务服务；销售厨房用具、家用电器、建筑材料。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京万事通保洁有限公司成立于2014年，拥有多年丰富的保洁施工经验，凭着自强不息的奋斗，精进的设备、以及真挚的服务，迅速的成为北京市保洁市场上最具特色、最具实力、最具专业的保洁公司！', '116.56996100000001', '39.903283000000002', '116.56996100000001', '39.903283000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3839', '北京中科桐华环保科技有限公司', '571', '何艳敏', '18511192933', '侯亮亮', '13718910033', '2013年06月21日', '50万元', '北京市', '北京市', '大兴区', null, '旧宫镇旧宫西路93号7幢4层412室', '北京市', '北京市', '大兴区', '旧宫地区办事处', '旧宫镇旧宫西路93号7幢4层412室', '', '消防设施,烟道清洗', '有限责任公司（自然人独资）', '2013年06月21日', '2033年06月20日', '2018/6/8', '2019/6/7', '京消协（2018）证字184号', '91110106071708831E', '', '技术开发、技术服务、技术转让；销售五金产品（不含电动自行车）、装饰材料、建筑材料、日用品、电子产品、机械设备、厨房设备、化工产品（不含危险化学品及一类易制毒化学品）；保洁服务；劳务服务；清洁服务；维修空调制冷设备；水污染治理；空气污染治理；病虫害防治；园林绿化工程。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中科桐华环保科技有限公司成立2013年，从事酒店、食堂、学校、机关单位油烟机、油烟管道，净化器的改造、安装、维修、维保行业，业务涵盖北京、天津、河北等地。\r\n　　几年来，我司致力于厨房排油烟设施的安装、维修、维保事业，并取得了一定成绩。随着公司经营理念与业务的调整扩充，把厨房排油烟设施清洗纳入公司业务范围，于2015年底部分员工参加了北京消防协会组织的厨房排油烟设施清洗培训，并以优异的成绩结业。今后努力把公司打造成厨房排油烟设施安装、改造、维修、维保与清洗全方位的一条龙服务公司。\r\n　　公司将人性化的服务模式及专业的安装维修技术与清洗技术融为一体，公司拥有一流的管理队伍、高精尖的技术人员、聘请北京最早从事厨房排油烟设施清洗行业的专业施工管理人员、现场演示操作清洗步骤与要领，并培训一批专业性高、责任心强的施工团队。\r\n我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念，始终保持“健康、科技　环保、创新、专业”的宗旨，竭尽全力为客户提供最完美的服务。', '116.424944', '39.803759999999997', '116.424944', '39.803759999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3840', '北京祥铭吉耀科技有限公司', '570', '石海祥', '13911728531', '石海祥', '13911728531', '2019年01月14日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南彩镇南彩祥东路16号1幢1层110室', '北京市', '北京市', '顺义区', '仁和地区办事处', '北京市顺义区仁和镇河南村平安北路2号', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年01月14日', '2049年01月13日', '2019/1/22', '2020/1/21', '京消协（2019）证字038号', '91110113MA1GR6C5J', '', '技术开发、技术咨询、技术转让、技术服务、技术推广；清洁服务（不含餐具消毒）；物业管理；销售日用杂品、机械设备、化工产品（不含危险化学品及一类易制毒化学品）、建筑材料（不含砂石及其制品）；种植业（不含野生植物、种子、芦荟、麻醉药品原植物、草皮）；技术检测（不含认证认可）；承办展览展示服务；花卉租摆；组织文化艺术交流活动（不含演出）；电脑图文设计、制作；设计、制作、代理、发布广告；经济贸易咨询；基础软件服务；计算机系统集成服务；公共关系服务；企业营销策划。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京宇润阳光清洗技术有限公司是一家集日常保洁、烟道清洗、厨房设备维修托管、石材翻新保养、地毯清洗、高空外墙清洗、清洗技术推广、清洗用品配送于一体的综合性清洗技术服务公司。 \r\n\r\n        公司现在拥有一支高素质的专业技术工程施工人员及具有丰富管理经验的员工队伍。规范化、人性化的企业环境使他们更加诚信、更加敬业、更加热忱。定期业内行家的培训与指导使他们更加专业化、更加标准化、更加国际化，从而使他们能够胜任各种场所的施工和现场指挥工作。\r\n\r\n        公司面向社会承接机关食堂、饭店酒楼、事业单位、厂矿企业、学校食堂的排油烟管道系统的防火清洗；各种大理石的结晶、翻新、养护；外墙玻璃清洗、工程开荒保洁；地毯沙发清洗、豪华灯饰清洗养护；社区、大厦、办公楼的日常保洁；各种清洁用品的配送。\r\n\r\n        期待与您的合作，愿我们的服务让您满意！\r\n\r\n        您的要求是我们公司的前进的方向！\r\n\r\n        我们的服务：专业、标准、周到、细致。', '116.69492099999999', '40.137095000000002', '116.702977', '40.107551999999998', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3841', '北京消兴安顺清洗技术有限公司', '569', '李凤珍', '18911623385', '周迎兵', '13691300332', '2013年04月10日', '350万元', '北京市', '北京市', '大兴区', null, '上筑家园11号楼1层15室', '北京市', '北京市', '大兴区', '亦庄地区办事处', '上筑家园11号楼1层15室', '', '建筑防火,消防设施,烟道清洗,消防安全检查', '有限责任公司（自然人独资）', '2013年04月10日', '2033年04月09日', '2018/5/30', '2019/5/29', '京消协（2018）证字161号', '91110115064857011J', '排油烟设施清洗机构', '劳务分包；技术开发、转让、咨询、服务；保洁服务；劳务服务（中介除外）；经济贸易咨询；销售厨房设备、消防设备、家庭用品、文具用品、清洁用具、清洁用品；维修厨房设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京消兴安顺清洗技术有限公司成立于2001年，正规注册从事，党政机关、单位、学校、医院、饭店、餐厅、物业公司等\r\n油烟管道清洗，业务涵盖北京、上海、天津、湖北等地。\r\n\r\n您给的信任！我绝不辜负！您给我机遇！我还您满意！', '116.464759', '39.796509999999998', '116.464759', '39.796509999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3842', '北京仟佰佳清洗服务有限公司', '568', '陈颜东', '13911048814', '陈颜东', '13911048814', '2008年08月18日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北花园街甲一号A-214', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区北花园街甲一号A-214', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年08月18日', '2028年08月17日', '2018/6/8', '2019/6/7', '京消协（2018）证字176号', '91110105679639299E', '排油烟设施清洗机构', '清洁服务（不含餐具消毒）；技术推广服务；维修厨房用具；专业承包；销售卫生用品、机械设备、厨房用具、五金交电、电子产品、建材（不从事实体店铺经营）、空调制冷设备；日用电器修理（不符合家用电子电器维修业服务经营规范不得开展经营活动）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京仟佰佳清洗服务有限公司成立于2008年，公司拥有严格科学的管理制度和施工质量标流程，依靠专业清洗设备、精湛的技术、丰富的施工经验、为客户提供全方位优质服务！\r\n     我公司主要经营业务有两个板块，一是食堂大型排油烟设施的清洗维护服务，清洗范围涵盖各类型排油烟罩、水平烟道、运水控制箱、竖井烟道、高低空油烟净化器、排油烟风机（柜）以及厨房整体保洁等；二是厨房设备的销售和维修，服务范围包含：①厨房内设备摆放和排油烟系统走向的整体设计出图（平面及水电图）；②销售厨房设备、炊事设备、制冷设备、排烟设备；③排油烟系统的的拆装、改造、换新服务；④厨房灶具、蒸箱、电饼铛、和面机、排烟风机、油烟净化器、冰箱冷库等的维修服务！\r\n     公司客户群体涵盖企事业单位、政府机关、武警部队、各大院校、医院幼儿园、宾馆饭店等，只要您有需要，只需一个电话，我们就能给您一个满意的结果！', '116.565618', '39.905197999999999', '116.565618', '39.905197999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3843', '北京快洁星保洁服务有限公司', '567', '周英鹏', '010-67387302', '周英鹏', '13811293155', '2009年07月27日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区小武基村8队9排81号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区小武基村8队9排81号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年07月27日', '2029年07月26日', '2018/5/11', '2019/5/10', '京消协（2018）证字114号', '911101056932993580', '排油烟设施清洗机构', '清洁服务；技术推广服务；维修家具、计算机、厨房用具、家用电器；销售日用品、机械设备、电子产品。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京快洁星保洁服务有限公司成立于2009年，是一家综合性清洁服务公司。\r\n快洁星宗旨：“快洁”指所做服务高效、快捷、洁净； “星”蕴含的是 “星”级的服务标准，同时“星”与“心”“信”谐音，意为用“心”做事，诚“信”经营。秉承环保清洗，芳香天涯创业理念，恪守以质量谋生存、重信誉求发展，坚持使用安全环保溶剂，不为小利而忘大义，一切为客户着想，脚踏实地、锐意创新。每一次清洁的过程就是一次服务质量的攀升，都是一次健康、安全、环保理念的传递。\r\n自公司成立以来，在油烟管道清洁、高空幕墙清洗、工程类清洁、地毯清洗等领域，我公司累计为京、津、沪等地区大中型国内外企业做专项清洁服务达万次以上。尤其在油烟管道清洁领域，我公司员工不仅具备行业要求所有标准，同时还要求具备相关交叉行业特殊技能要求， 力求为客户排除更多安全隐患。到目前为止，因我公司烟道清洁而发生的火灾次数为“0”；到目前为止，与我公司争端和诉讼为“0”。\r\n快洁星坚持一步一个脚印，不盲目扩张；不为最大！只求最好！', '116.494264', '39.853492000000003', '116.494264', '39.853492000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3844', '北京鼎鸿东方保洁有限公司', '566', '田东芳', '15010608215', '丁鸿亮', '18210888413', '2014年05月04日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰管路22号院12幢2210室', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区丰管路22号院12幢2210室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年05月04日', '2034年05月03日', '2018/6/15', '2019/6/14', '京消协（2018）证字199号', '911101060994483221', '', '保洁服务；清洁服务；维修、销售厨房设备；技术咨询、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鼎鸿东方保洁有限公司是一家专业从事油烟管道清洗的服务性企业。为用户的厨房排烟系统提供“最优质的清洗方案”是企业的服务性宗旨。立志用最优的资源配备、最优秀的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\r\n       公司拥有一批专业的人才队伍，所有员工均经过系统的专业技术和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质的完成油烟管道系统清洗全系列工作。\r\n       我们丰富的经验可广泛服务于所有使用烟道系统的场所，包括写字楼、宾馆、饭店、商场、学校、机关办公区等。\r\n       公司理念：不懈努力、不懈追求是本公司永保活力的源泉；科学灵活的经营管理是本公司成功的保证；客户至上，信誉第一，奉行诚信服务是本公司赖以发展的宗旨。', '116.313866', '39.857754', '116.313866', '39.857754', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3845', '北京康安洁科技发展有限公司', '565', '孙安安', '18611133801', '孙安安', '18611133801', '2018年09月14日', '500万元', '北京市', '北京市', '大兴区', null, '大兴区金星路12号院2号楼2层2059室', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '大兴区金星路12号院2号楼2层2059室', '', '消防设施,烟道清洗', '有限责任公司（自然人独资）', '2018年09月14日', '长期', '', '', '', '91110115MA01EM9R28', '', '技术开发、推广、咨询、转让、服务；清洁服务；销售机械设备、电子产品、服装。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司虽然成立较晚，但是在北京市2019年对于加强环保理念的带领下，我公司将秉承“诚信至上，价格合理，服务第一，相互促进”的经营理念，扩大经营与发展。\r\n在发展壮大的同时，不断引进国外高新技术及先进机器设备和经营理念，急客户之所急，想客户之所想，尽善尽美的完成每一个工作项目。拒绝平庸，追求卓越，与时俱进。\r\n1、关于我们：承接清洗、维保工程，开展技术培训及连锁服务于一体的现代新型清洗公司。\r\n2、公司理念：不懈努力、不懈追求是本公司永保活力的源泉；科学灵活的经营管理是本公司的成功的保证；客户至上，信誉第一，奉行诚信服务，是本公司懒以发展的宗旨。\r\n3、服务特点：在签订合同的同时，以双方认可的样板为基础，互惠互助的合作的原则达成协议，以客户满意为验收标准。员工实行统一管理、统一形象、 统一培训并注重企业形象力。\r\n4、公司员工：所有上岗人员均经过严格的培训和考核。跟踪世界清洁技术发展潮流，引进先进的清洁设备、清洁用品及先进的清洁保养理念，对高校、写字楼、酒店、商厦的清洁管理运作贯以严格管理和规范服务。\r\n5、公司设备：拥有一流的机械设备、进口高效清洁剂一套完整的清洗保洁质量保证体系，严格按照服务程序', '116.35006799999999', '39.762312000000001', '116.35006799999999', '39.762312000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3846', '北京鑫源绿地科技有限公司', '564', '王红梅', '17743535542', '梁宝义', '13701006380', '2014年07月21日', '50万元', '北京市', '北京市', '平谷区', null, '北京市平谷区马坊镇河奎村北小街13号', '北京市', '北京市', '海淀区', '甘家口街道', '北京市海淀区增光路33号', '', '消防产品', '有限责任公司（自然人独资）', '2014年07月21日', '2034年07月20日', '2018/5/30', '2019/5/29', '京消协（2018）证字169号', '911101173065609327', '', '节能技术开发及转让、技术推广与服务；代理进出口、园林绿化；销售太阳能设备、家具、五金交电（不含电动自行车）、照明器材、消防器材、安全技术防范产品、办公用品；消防技术服务、技术咨询；技术检测；建筑物清洁服务；园林绿化；维修家用电子产品、维修办公设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司成立于2016年，公司一贯奉行“以质量求生存、以产量求效益、以技术求进步、以信誉求发展”的经营理念，以“树一流意识、创一流管理、建一流环境、争一流效益”为目标，真诚希望与社会各界新老客户精诚合作，客户满意是我们永无止境的追求,热诚欢迎各方宾客惠顾洽谈，鑫源绿地愿与您携手共创锦绣辉煌的明天。我们将竭诚为您提供“优质、安全、专业”的消防服务。', '116.989406', '40.091093999999998', '116.323542', '39.928699999999999', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3847', '北京中安精益科技发展有限公司', '562', '田灵钦', '13601246126', '田灵钦', '13601246126', '2011年07月15日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区六里桥甲1号弘利苑大厦4001-4004,4010-4015', '北京市', '北京市', '丰台区', '太平桥街道', '北京市丰台区六里桥甲1号弘利苑大厦4001-4004,4010-4015', '', '消防设施', '有限责任公司（自然人投资或控股）', '2011年07月15日', '2031年07月14日', '2018/4/17', '2019/4/16', '京消协（2018）证字077号', '91110108579040430Y', '电气防火检测技术服务机构', '技术检测；技术开发、技术推广、技术咨询、技术服务；销售汽车零配件、化工产品（不含危险化学品及一类易制毒化学品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中安精益科技发展有限公司主要从事电气及消防设施维护保养检测。消防检测、电气检测业务公司下设业务部、检测部、技审部、检测报告审核部、咨询处、培训部、维保部、自主选择经营项目部等服务。\r\n公司有高级工程师，工程师，经消防检测认证人员，主要由工程物理、工业民用建筑、管理、建工、电子机械、计算机、机械设计与制造、电气、水暖等专业人员构成。\r\n面对新世纪的挑战，公司以“忠诚友善、勤奋进取、艰苦创业”的企业精神，认真贯彻“质量为基础，服务作保证”的方针，为广大用户提供完备、周到的服务，成为一名真正合格的消防医生。我们本着诚信、共谋、双赢、互惠的原则，为营造一个和谐、安全的社会，尽最大努力贡献出我们“消防人”的力量。', '116.305695', '39.883181999999998', '116.305695', '39.883181999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3848', '北京航天海泉测试技术有限公司', '561', '蒋如蓉', '15810917122', '吴焱宇', '18610033059', '2010年07月20日', '800万元', '北京市', '北京市', '房山区', null, '北京市房山区石楼镇石楼村石楼镇政府东200米', '北京市', '北京市', '房山区', '石楼镇', '北京市房山区石楼镇石楼村石楼镇政府东200米', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2010年07月20日', '2040年07月19日', '2019/1/17', '2020/1/16', '京消协（2019）证字025号', '911101065585207508', '电气防火检测技术服务机构', '技术检测；技术咨询（中介除外）；维修消防器材、通风设备；接受委托提供劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司成立于2010年7月，注册资本为800万元，注册地和经营地都在北京市房山区石楼镇石楼村石楼镇政府东200米，是一家专门从事技术检测、技术咨询的有限责任公司，于2012年首次取得资质认定证书并维持至今，以独立法人形式承担第三方公正检验、独立财务核算和开展检测业务活动，是一家环境条件优良，检测人员结构合理，管理制度健全的检测公司。\r\n      我公司管理人员和专业检测人员共31名，现设有综合管理部、检测部2个职能部门，是一支具有较高文化素质、年轻化的员工队伍，检测人员均经过培训，持证上岗。\r\n      我公司目前承担的主要检验检测任务和技术服务有：各类不燃、可燃、难燃建筑材料燃烧性能检验检测；饰面型防火涂料检验检测；钢结构防火涂料检验检测；电气防火检测；建筑消防设施检测等。实验室主要检测设备为：不燃炉、铺地材料试验装置、单体燃烧及热值试验装置等各类材料防火性能检测设备及钢结构、消电检设备，检测设备齐全、先进，状态完好，能够满足检验检测工作的需要,且公司不参与任何可能危及对检测工作判断独立性和诚实性的活动。', '115.984927', '39.656244999999998', '115.984927', '39.656244999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3849', '北京市安康诺盾科技有限公司', '560', '王苑', '', '刘毅', '17701143999', '2014年09月09日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区日坛北路17号17号楼1号院14层1418', '北京市', '北京市', '朝阳区', '朝外街道', '北京市朝阳区日坛北路17号17号楼1号院14层1418', '', '消防产品', '有限责任公司（自然人独资）', '2014年09月09日', '2064年09月08日', '', '', '', '91110115317901595E', '', '技术开发、技术咨询、技术转让、技术服务；销售日用品、电子产品、社会公共安全设备及器材、机械设备、文具用品、Ⅱ类医疗器械；货物进出口、技术进出口；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '“铁肩担道义，精诚铸华章”。创建于2001年12月的中国北京市卫民安消防教育咨询中心是由诺盾国际集团出资成立的社会化、专业化消防公益服务组织。她的成立，标志着我国市场经济条件下的社会化专职消防宣传队伍应运而生。目前已发展成为中国社会化公益消防宣传领域的领头羊和主力军。\r\n\r\n成立至今，卫民安人始终秉承“奉献消防事业、永卫人民平安”的工作理念，秉承“追求国家、社会、客户、企业价值互惠共赢”的发展思路。始终坚定的把消防安全事业理解为公益事业，始终关注民生、关注消防、关注安全。坚定不移的把中心的经营思路定位成公益事业社会化手段的推广，强调为社会各行业单位提供高质量的服务，再谋求有价值的回报。立志整合、优化消防经营网络资源，促进消防相关产业经济发展，力争为国家公共安全事业作出应有贡献。\r\n\r\n目前，中国卫民安通过十余年坚持不懈的努力，已使中国亿万民众获得持续性、公益性的消防知识宣传培训福利。在宣教同时，更在消防综合服务、专业精诚提供上为社会和民众不断带来福祉：协助各单位定期开展消防应急救援预案的演练；配合各单位完成消防安全评估；协助各单位完善、落实各项消防安全管理规章制度；帮助各单位及家庭完成火灾隐患', '116.44299100000001', '39.919131', '116.44299100000001', '39.919131', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3850', '北京中维立洁科技有限公司', '559', '李树龙', '13911795696', '李树龙', '13911795696', '2010年01月26日', '300万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区来广营乡新生村万乐家工业园106号', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区来广营乡新生村万乐家工业园106号', 'AA', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年01月26日', '2030年01月25日', '2018/4/8', '2019/4/7', '京消协（2018）证字1063号', '9111010569955011XE', '烟道清洗', '技术推广服务；工程技术咨询；经济贸易咨询；专业承包；清洁服务；家庭服务（限符合家政服务通用要求）；销售五金交电、建筑材料、空调制冷设备；维修家用电器。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京中维立洁科技有限公司成立于2010年1月，注册资金300万元，是一家提供专业化、全方位的清洁服务企业。公司主要经营室内外保洁服务、建筑物外墙清洗、厨房油烟管道清洗、集中空调清洗、石材翻新养护、地毯清洗保养、沙发布艺清洗、地板上蜡养护、大型工程保洁开荒等服务，服务涉及宾馆、饭店、企事业单位、餐饮企业、物业管理等领域。目前，公司具有高空悬吊清洁安全生产证书、厨房烟囱排油烟道清洗服务资质，是中国职业安全健康协会高空服务业分会委员单位。', '116.44807299999999', '40.034486000000001', '116.44807299999999', '40.034486000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3851', '北京优沃普环境科技有限公司', '558', '蒙晓东', '15901157678', '蒙晓东', '15901157678', '2015年07月07日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区青龙湖镇西庄户村委会东210米', '北京市', '北京市', '房山区', '青龙湖镇', '北京市房山区青龙湖镇西庄户村委会东210米', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年07月07日', '2045年07月06日', '2018/5/22', '2019/5/21', '京消协（2018）证字139号', '91110111348399083D', '', '技术开发；劳务分包、专业承包；物业管理；清洁服务（不含洗车服务）；园林绿化服务；维修、租赁机械设备；家居装饰及设计；销售计算机软硬件及辅助设备、厨房设备、酒店用品、办公用品、文化体育用品（音像制品除外）、健身器械、建筑材料、装饰材料、机械设备、化工产品（不含危险化学品）、环保设备、仪器仪表、电子产品、厨房用具、机械设备、电线电缆、通风设备、金属材料；维修电梯、空调制冷设备、机电设备；水污染治理；基础软件服务；计算机系统服务；专业承包；水污染治理；大气污染治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京优沃普环境科技有限公司是一家专业的餐饮业油烟污染治理物联网综合解决方案的服务商。致力于餐饮业油烟污染的终极解决方案的技术研发‘产品开发‘销售及服务。公司拥有错项自主知识产权的核心技术及产品；把治理油烟排放污染与后期清洗维护为结合的一体化公司。’’', '116.0728', '39.747971', '116.0728', '39.747971', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3852', '恒泰安顺（北京）智能科技有限公司', '557', '尤胜祥', '13716357119', '朱钧钰', '18601960667', '2013年10月16日', '5000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区马家堡路180号7层812', '北京市', '北京市', '丰台区', '大红门街道', '北京市丰台区马家堡路180号7层812', '', '消防产品', '有限责任公司（自然人投资或控股）', '2013年10月16日', '2033年10月15日', '2018/5/22', '2019/5/21', '京消协（2018）证字150号', '91110106080513542U', '', '技术开发、技术推广、技术转让；销售消防器材、化工产品（不含危险化学品）、建筑材料（不在实体店铺经营）、社会公共安全防范设备及器材、电子产品、电器设备；货物进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '恒泰安顺(北京)智能科技有限公司是集研发、生产、销售、服务为一体的智能化新型消防科技公司。公司创建于2013年，注册资本5000万元。在北京、安徽两地国家级开发区建有现代化的科研实验生产基地。通过采用消防智能化管控、互联网云计算、物联网布控、结合智能、高效灭火装置设备的应用，实现火灾预、防、控系统的高效运作。形成整套有效的城市防控、指挥、联动“智慧大消防”体系。\r\n公司自主研发多项国内、外领先的消防专利产品。用以解决高层建筑、公共交通、地下车库、化工高危行业、电力等特殊产业的消防安全难题。通过和南京理工大学、中国科技大学(火灾科学国家重点实验室)、中国建筑科学研究院等高校和科研机构密切合作，充分利用物联网管控、无线传输技术、云计算分析等高新技术，与传统消防行业融合创新应用，先后研发、生产了城市公共交通智能消防安全系统、移动式高效灭火设备、楼宇智能灭火器箱、防触电消防水带、智慧消防路灯,智能化水电气预管控系统等消防专利产品。产品获得了国家公安部评定中心颁发的3C证书，并且获得多项国家级的荣誉证书。', '116.379676', '39.834896000000001', '116.379676', '39.834896000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3853', '北京圣堡净雅保洁服务有限责任公司', '556', '高辉', '13261892128', '杨红', '13311532856', '2010年10月25日', '100万元', '北京市', '北京市', '朝阳区', null, '黑庄乡万子营村512', '北京市', '北京市', '朝阳区', '黑庄户地区办事处', '黑庄乡万子营村512', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年10月25日', '2030年10月24日', '2018/5/22', '2019/5/21', '京消协（2018）证字134号', '91110105563658359M', '', '清洁服务（不含餐具消毒）；家居装饰及设计；家庭服务；技术推广；销售机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '商务厨具、油烟管道及厨房设计、销售、安装、清洗一体化服务。\r\n商务酒店、商务宾馆、私人会所、高级会际，各种地毯专业清洗。\r\n大厦、院校、小区、别墅、大楼日常保洁。\r\n大厦、高楼、玻璃外墙专业清洗。\r\n中高档、沙发、墙体、大理石、木质地板、清洗、抛光、打蜡。\r\n停车场、大厦、大楼、中高端物业管理。', '116.60055199999999', '39.865397000000002', '116.60055199999999', '39.865397000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3854', '北京中卓时代消防工程有限公司', '553', '王东方', '67806366', '王凤磊', '67806366', '1997年04月08日', '2000万元', '北京市', '北京市', '大兴区', null, '荣昌东街甲5号2号楼6层604', '北京市', '北京市', '大兴区', '北京经济技术开发区', '荣昌东街甲5号2号楼6层604', '', '建筑防火,消防设施,消防产品', '有限责任公司（自然人投资或控股）', '1991年05月11日', '长期', '2019/4/26', '2020/4/25', '京消协（2019）证字190号', '9111633015077G', '', '可承担各类消防设施工程的施工；专业承包；销售消防器材、消防设备、钢材、机械电子设备、五金交电（不含电动自行车）、装饰材料；技术开发、技术转让、技术咨询、技术服务；消防安全评估；消防设备检测；消防设备维修；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中卓时代消防工程有限公司成立于1997年4月。注册资金2000万元人民币。公司致力于工业和民用建筑消防以及各种消防系统集成。公司位于北京亦庄开发区，集设计、施工和服务于一体。具有丰富的系统集成和设计、施工经验，可以为客户提供一体化的消防解决方案。\r\n北京中卓时代消防工程有限公司具有建设部颁发的消防设施设计与施工一级专业总承包资质。并且具有机电安装和智能化施工资质。公司的设计、生产和服务严格遵循ISO 9000质量管理体系、ISO 14000环境管理体系和GB/T 28000职业健康安全管理体系的要求，并得到了权威机构的认证。公司一流的设计和施工团队可以胜任各种工业和民用消防系统工程。北京中卓时代消防工程有限公司的宗旨是：优质服务，质量第一，用户至上。', '116.52475699999999', '39.783617999999997', '116.52475699999999', '39.783617999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3855', '北京京朝顺达消防器材设备有限公司', '552', '张燕涛', '13801182878', '张燕涛', '13801182878', '2005年09月22日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区广渠东路华能电厂西门', '北京市', '北京市', '朝阳区', '王四营地区办事处', '北京市朝阳区广渠东路华能电厂西门', '', '消防产品', '有限责任公司（自然人投资或控股）', '2005年09月22日', '2025年09月21日', '2019/5/8', '2020/5/7', '京消协（2019）证字214号', '91110105780984740R', '', '销售消防器材、机械设备、电子产品；维修消防器材；清洁服务（不含餐具消毒）；专业承包；技术开发、技术推广、技术转让、技术咨询、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司经北京市消防局同意批准，市工商局注册登记。主要以维修手提贮压式干粉灭火器、手提式二氧化碳灭火器、手提式水系灭火器（销售各种品牌规格消防器材）为主的消防器材专业维修厂家。业绩遍及首都各防火重点单位及各大宾馆、大厦、商场、企事业单位和院校。公司维修设备齐全并拥有专业维修技术员工。具有一定的经济实力。详情可查阅中国消防北京网。\r\n成立几年来，我公司在上级各主管部门关心、领导及社会各单位的支持下，已被中国消防协会吸收为团体会员单位，在首都的各重点防火单位的历年历次各项重大社会活动中，特别是在国庆60周年，我公司为天安门、首都机场等大型防火地区的消防器材维修和配置都得到了好评与认可，并起到了应有的作用。\r\n谨此，我公司热烈欢迎各界新老客户来人、来电、来函、来我公司参观，洽谈指导。我公司对维修后的消防器材一年内保证正常使用（按维修合格证日期为准）。如属于质量问题，我公司24小时内免费负责维修。客户如有应急需要消防器材我公司随叫随到，负责送货到指定地点。\r\n我们的服务宗旨是：用户至上、质量第一、信誉为重，诚信服务。', '116.53464', '39.885494999999999', '116.53464', '39.885494999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3856', '北京德众国良环保科技有限公司', '551', '周国梁', '13910879367', '李晶晶', '13260097024', '2010年10月28日', '1300万元', '北京市', '北京市', '昌平区', null, '昌平区城区镇宽街综合楼二层201号', '北京市', '北京市', '海淀区', '西三旗街道', '海淀区西三旗桥南泰山饭店17层', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年10月28日', '2060年10月27日', '2019/1/11', '2020/1/10', '京消协（2019）证字012号', '911101145636454516', '', '中央空调技术推广服务；软件开发；技术转让、技术咨询；普通货运代理；销售五金交电（不含电动自行车）、建筑材料、日用品、文化用品、工艺品、仪器仪表、化工产品（不含危险化学品）、医疗器械一类、机械设备、消防器材、制冷设备；维修机械设备（未取得专项许可的除外）；保洁服务；机器和办公设备的清洗；劳务派遣（不含境外劳务派遣）；委托加工机械设备；计算机系统集成；大气污染治理；建筑物清洁服务；专业承包、劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '德众国良公司成立于 2010 年，是一家专注于城市空气环保行业的创新型环保科技企业。治理服务。“让每个人都能享受洁净的空气”是德众国良公司的愿景。一直以来，德众国良以最专业、最严谨、最科学的极 2010 年德众国良以楼宇空气、餐饮油烟净化服务作为切入点，自创办以来，保持了令业内惊讶的增长速度，截止 2015 年德众国良累计提供净化服务千余次，业务覆盖北京、上海、广州、杭州等各大一线城市，并与多家大型企业建立了稳固的战略合作伙伴关系。2016 年德众国良领先提出了针对城市空气的第三方治理服务理念，并联合清华大学环境学院、北京市环境保护科学研究院、中国环保工业促进会以及大气监控行业顶尖企业，搭建了首个城市楼宇空气&餐饮油烟实验空间，该实验空间通过模拟最真实的、最苛刻的城市楼宇空气以及餐饮油烟污染场景，并根据国家相关法规并定义了多项能够真实反映治理服务质量的核心指标，可实时量化的完成对第三方治理服务质量给出最权威的评估分析。德众国良将秉承开放、不排他、非独家的合作策略，和业界合作伙伴一起推动城市油烟环保生态链建设。展望未来，公司将致力于城市空气污染的第三方治理服务，打造最具影响力的城市空气污', '116.23341600000001', '40.214981000000002', '116.32941700000001', '40.049165000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3857', '中国空间技术研究院', '550', '张洪太', '-', '乔雨', '68117708', '1968年2月20日', '19101万元', '北京市', '北京市', '海淀区', null, '北京市海淀区中关村南大街31号', '北京市', '北京市', '海淀区', '西北旺地区办事处', '北京市海淀区友谊路104号', '', '宣传教育培训,消防信息化', '', '1968年2月20日', '长期', '2018/5/3', '2019/5/2', '京消协（2018）证字101号', '12100000400014049H', '', '外层空间技术开发；微信、飞船及其他航天器研制；空间技术成果推广；空间领域对外技术交流与合作；卫星应用及空间技术二次开发', '中国空间技术研究院成立于1968年，隶属于中国航天局科技集团公司,是中国主要的空间技术研制基地，抓总研制和发射的近200个航天器，百余颗航天器在轨稳定运行。有载人航天、深空探测、导航定位等航天器，著名的有“载人”、“北斗”、“嫦娥”等系列的航天器。', '116.32104', '39.947439000000003', '116.27842200000001', '40.069909000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3858', '中国建筑科学研究院有限公司建筑防火研究所', '549', '邱仓虎', '64517698', '时艳艳', '18001383179', '2001年08月16日', '120000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北三环东路30号', '北京市', '北京市', '朝阳区', '和平街街道', '北京市朝阳区北三环东路30号', '', '电气防火,消防安全评估,建筑防火,消防信息化,消防设施,灭火救援,事故调查,法规政策,消防保险,消防产品,消防安全检查', '有限责任公司（国有独资）', '2017年12月29日', '长期', '2018/12/26', '2019/12/25', '京消协（2018）证字475号', '911100004000011410', '电气防火检测技术服务机构', '《建筑科学》、《工程质量》、《工程抗震与加固改造》（有效期至2018-12-31；一般工业产品认证；工业设计及前期策划，建筑智能化、建筑室内外装饰装修的设计；工程咨询；城乡规划编制；建筑业（土木工程）勘察、设计、施工、监理的监督及管理；工程与产品监测；计算机软件、通信设备的开发、生产、销售；技术开发、技术转让、技术咨询、技术服务、实业投资；物业管理；自有房屋租赁；对餐饮、住宿业的管理；激动车停车服务；设计、制作印刷品广告，利用自有《工程质量》、《建筑科学》、《工程抗震与加固改造》杂志发布广告；消防安全评估；消防技术检测；承包与其实力、规模、业绩相适应的国外工程项目。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中国建筑科学研究院有限公司建筑防火研究所（以下简称“防火所”）,成立于1985年，是由联合国开发计划署和中华人民共和国建设部联合投资组建的建筑行业最大的一个专门从事建筑防火研究的机构，2000年由科研事业单位转制为科技型企业。承担着中国建筑学会建筑防火综合技术分会、北京消防协会城市规划与建筑防火委员会和北京建材行业联合会防火涂料分会的日常工作。\r\n        经过三十多年的发展，防火所已成为国内建筑防火领域一支重要的科技力量，可为社会提供建筑工程等领域的全方位消防技术服务，形成了以“建筑构件耐火性能测试和研究技术”、“建筑材料对火反应综合性质测定和研究技术”、“消防规划、设计与咨询”、“消防安全评估与性能化防火设计技术”、“复杂、超规及特殊建筑防排烟系统性能检验鉴定”、“地铁与隧道防排烟系统性能检测技术”、“火灾后建筑结构安全性评估技术”、“ 消防设施及电气防火安全检测技术”等为核心的技术服务体系。', '116.413569', '39.968254999999999', '116.413569', '39.968254999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3859', '北京远佳成消防安全技术有限公司', '548', '沈少明', '13501197873', '侯井龙', '13501018915', '2011年10月17日', '1068万元', '北京市', '北京市', '房山区', null, '北京市房山区拱辰街道天星街1号院2号楼202', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区拱辰街道天星街1号院2号楼202', '', '电气防火,消防设施', '有限责任公司（自然人投资或控股）', '2011年10月17日', '2031年10月16日', '2018/11/26', '2019/11/25', '京消协（2018）证字423号', '91110111584450813C', '电气防火检测技术服务机构', '电气防火检测、消防设施检测（计量认证证书有效期至2023年11月27日）；技术开发、技术服务；经济信息咨询；维修消防设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京远佳成消防安全技术有限公司成立于2011年10月，是经北京市工商行政管理局注册，北京市消防局审核批准成立的专业消防技术服务公司，具有电气防火检测资质、建筑消防设施检测、维修、保养一级资质，并取得了北京市质量技术监督局计量认证证书，通过了质量管理体系认证，是北京消防协会会员单位。\r\n公司作为一家专业从事建筑物固定消防设施检测、电气设施防火安全技术检测及消防设施维护保养的技术服务公司，拥有一支实践经验丰富、技术实力雄厚、专业设备齐全、长期从事消防设施和电气防火检测及消防设施维修保养的专业队伍。公司现有职工25人，其中总经理1名，高级工程师1名，一级注册消防工程师10名，高级建（构）筑物消防员2名，中级建（构）筑物消防员4名，内审员1名，设备管理员1名，持证上岗率100%，设有综合部、财务部、检测部、维保部。\r\n公司本着以高品质的技术服务为先导，以科学的管理为保证的原则，秉持: “诚信为本、客户至上、工作高效、服务满意”的工作精神，秉承“客观、公正、科学、准确”的质量方针，严格执行国家及地区相关技术规范，自觉遵守行业标准及自律原则，服务于北京市的各个行业。', '116.16053599999999', '39.756275000000002', '116.16053599999999', '39.756275000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3860', '北京友安盛防火技术有限公司', '547', '王文铎', '13901099331', '杨洋', '13910234566', '1999年10月26日', '2061.22万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区石龙经济开发区永安路20号3号楼A-3990室', '北京市', '北京市', '朝阳区', '和平街街道', '北京市朝阳区北三环东路30号防火所207', '', '消防设施', '有限责任公司（自然人投资或控股）', '1999年10月26日', '2029年10月25日', '2018/1/25', '2019/1/24', '京消协（2018）证字028号', '911101097002844890', '', '火灾烟感、温感、报警器及控制系统、报警系统及计算机软硬件及外设的开发、销售；技术开发、转让、咨询、服务；信息咨询（除中介服务）；消防系统维护、清洗；销售电子产品、化工产品（不含化学危险品及一类易制毒化学品）、消防器材、建筑材料、木材、机械电器设备、家具；专业承包；消防设施工程设计与施工壹级（有效期至2020年05月28日）。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京友安盛防火技术有限公司1999年注册，是依托中国建筑科学研究院建筑防火研究所而成立的集消防工程设计与施工、消防设施维护保养于一体的专业化公司。公司注册资金2061.22万元，先后取得消防设施工程专业承包壹级资质、消防设施工程设计专项甲级资质、消防技术服务机构临时二级资质。\r\n公司取得了ISO9001质量管理体系、ISO14001环境管理体系、GB/T28001职业健康安全管理体系的认证证书。2005年获得北京市工商行政管理局颁发的“守信企业”证书。2012－2020年度获得中央国家机关工程定点施工企业入围供应商资格。\r\n公司自成立以来，本着“以人为本，诚信为先，质量第一，不断企业创新”的经营理念，经过上千个消防工程项目的锤炼，已培养出一批具有丰富消防工程设计和施工经验的中、高级工程管理人员和一支技术过硬的施工队伍。公司先后在天津、内蒙古、山西、青岛、潍坊、武汉、成都、安徽、江西、新疆、河北、甘肃等地建立了分公司或办事机构，逐步发展成跨地区的工程公司。公司管理体系完善、技术力量雄厚、施工工艺先进、检测手段精良，有极强的消防工程设计能力和丰富的工程施工经验，在建筑防火领域中享有良好的声誉。', '116.126994', '39.896732', '116.41334999999999', '39.968438999999996', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3861', '北京靓洁安保洁服务有限责任公司', '546', '周爱莲', '13910183180', '周爱莲', '13910183180', '2005年08月22日', '50万元', '北京市', '北京市', '丰台区', null, '和义西里三区20幢1单元302号', '北京市', '北京市', '丰台区', '和义街道', '和义西里三区20幢1单元302号', '', '烟道清洗', '有限责任公司（自然人独资）', '2005年08月22日', '2055年08月21日', '2018/5/22', '2019/5/21', '京消协（2018）证字144号', '911101067795211675', '', '清洁服务；家庭服务；家居装饰；销售日用品、服装、鞋帽、文具用品、电子产品、五金交电、计算机软硬件及辅助设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '厨房烟道清洗及开荒保洁', '116.39492300000001', '39.814210000000003', '116.39492300000001', '39.814210000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3862', '北京海马岛净水设备有限公司', '545', '高宝会', '13701182289', '高宝会', '13701182289', '2010年05月01日', '100万元', '北京市', '北京市', '通州区', null, '北京市通州区葛布店南里17号楼361', '北京市', '北京市', '通州区', '玉桥街道', '北京市通州区葛布店南里17号楼361', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2012年10月25日', '2032年10月24日', '', '', '', '91110112055573025K', '', '销售专用设备、通用设备、电子产品、金属制品、净水设备、水处理设备；零售计算机软件及辅助设备、通讯设备、机械设备、钢材、建筑材料、化工产品（不含危险化学品）、五金交电、体育用品（不含弩）、食品添加剂；技术推广、技术开发；零售乐器日用品、家具、服装、花卉、报警系统视频监控设备、舞台灯光音响设备、教学专用设备、空调制冷专用设备、汽车配件；大气污染治理；软件开发；机动车公共停车场经营管理；分批包装；技术检测；组织文化艺术交流活动；飞机、火车、船舶清洗消毒服务；厨房设备清洗服务；土壤环境污染防治服务；清洗空调制冷专用设备；零售食品；互联网信息服务；专业承包；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n北京海马岛净水设备有限公司 成立于2010年。主要从事 水处理设备，新风设备的生产与销售。本着以质量为生存，信誉为发展的原则，为机关 厂矿 学校 企事业单位提供良好的产品与技术服务。得到同行及业主的高度评价。本公司是一家致力于将新技术应用于传统生产中，提高生产效率，并努力为之实践的集研发、生产、销售一体的民营企业。公司是集科研、开发、工程设计、技术服务、生产制造为一体的综合性高新技术企业，主要产品有各种水处理设备、空气净化灭菌设备、恒压供水设备、水处理药剂（各种阻垢剂、絮凝剂）等，产品广泛用于化工、电子、电力、医药、纺织、涂料、食品、酿造、饮料及饮用水行业。近年来，我们坚持走科技管理之路，坚持以价值创造为核心，立足稳步经营，稳健拓展市场，实现业绩稳定增长，不断提高综合竞争力，海马岛净水处理设备有限公司健康发展的背后是一个勇于创新、团结实干、追求成功的团队，每位员工都是我们宝贵的财富，是企业保持生机，不断发展的动力源泉，在激烈的市场竞争中，我们将更加团结一心，以产品和服务满足新老用户的要求。    \r\n　　 在广大用户及社会各界的关心支持下、在公司自身的不懈努力下，如今公司已成为', '116.66098599999999', '39.890707999999997', '116.66098599999999', '39.890707999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3863', '中强环宇（北京）科技有限公司', '543', '宋爱', '13601153459', '王可', '13810870829', '2007年06月12日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区化工路5号（西院）1号楼4层421室', '北京市', '北京市', '朝阳区', '垡头街道', '北京市朝阳区化工路5号（西院）1号楼4层421室', '', '烟道清洗', '有限责任公司（自然人独资）', '2007年06月12日', '2027年06月11日', '2018/12/29', '2019/12/28', '京消协清证字（2018）059号', '911101056631138740', '排油烟设施清洗机构', '技术推广服务；清洁服务；专业承包；家居装饰；展览服务；经济贸易咨询；市场调查；组织文化艺术交流活动（不含演出）；企业管理咨询；日用电器修理（不符合家用电子电器维修业服务经营规范不得开展经营活动）；销售制冷空调设备、机械设备、化工产品（不含危险化学品）、五金交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中强环宇科技有限公司创立于2007年，注册资本500万，公司总部位于北京市朝阳区，下设上海分公司、天津分公司、广州分公司。总部原隶属区疾病预防控制中心下属企业，各分公司均经市卫生局、中国卫生协会、水务局、消防局批准的对生活供水、管道、中央空调、烟道系统等设施清洗、消毒、改造、维修保养的专业型企业。\r\n本企业集《中央空调系统清洗》、《中央空调维修保养》、《中央空调净化设备》《二次供水系统清洗》、《烟道系统清洗》、《供水设备改造》等业务于一体。开展多元化服务，斩获多项荣誉称号，并获得各项权威资质，麾下职员规模200余名，其中管理人员30名，各专业技术人员30人，专业清洗人员140名，打造了精英管理团队与技术骨干力量。具备各项领域专业清洗设备，并通过ISO9001质量管理体系认证、ISO14001环境管理系统认证等。\r\n自公司创立以来坚持努力奋斗、技术创新，赢得广大客户的信任和好评，我们本着以《诚信●务实》为宗旨，以一流的服务、一流的管理创造行业第一品牌，为各城市广大客户提供优质的服务。', '116.51824499999999', '39.859079000000001', '116.51824499999999', '39.859079000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3864', '北京中意悦杰厨房设备有限公司', '542', '王志军', '13910769767', '王志军', '13910769767', '2010年05月20日', '600万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰管路16号1号楼', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区丰管路16号1号楼', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年05月20日', '2030年05月19日', '', '', '', '911101065548352455', '', '销售厨卫用品、不锈钢制品；机电设备维修；清洁服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京中意悦杰厨房设备有限公司主要经营从事销售厨房设备及厨房设备维保和厨房排烟设备安装清洗等业务。企业已通过iso9001;lso14001,GB/T28001-2001职业健康安全管理体系认证。', '116.311187', '39.856214000000001', '116.311187', '39.856214000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3865', '北京科安达消防工程有限公司', '541', '王泽炎', '', '张媛', '01067866752', '1998年04月15日', '6008万元', '北京市', '北京市', '东城区', null, '珠市口东大街3号119室', '北京市', '北京市', '大兴区', '北京经济技术开发区', '同济中路2号狮岛索龙大厦302', '', '建筑防火', '有限责任公司（自然人投资或控股）', '1998年04月15日', '2058年04月14日', '2019/1/11', '2020/1/10', '京消协（2019）证字015号', '911101016343574906', '', '专业承包；销售建筑材料、装饰材料、消防器材；技术咨询（不含中介服务）、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京科安达消防工程有限公司成立于1998年4月15日，是北京市早期成立的消防工程公司之一。注册资金人民币6008万元。\r\n    随着国家经济建设发展，在市场激烈竞争中成长壮大，公司以“讲信誉、重质量、守合同、保工期”为宗旨，坚持“信誉第一、质量第一、用户至上”的原则，在经营活动中严格遵守法律、法规，一切为用户着想，把用户的需求与企业的自身发展联系在一起，以诚恳的态度，优良的质量，高效的服务赢得了客户的满意。\r\n    公司在竞争中加强自身建设，广揽人才，狠抓技术，不断提高员工政治和业务素质，加强管理，完善各种规章制度，创建了一支具有敬业精神，技术精、素质高的施工队伍。公司取得了消防设施工程专业承包壹级资质、电子与智能化工程专业承包贰级资质、建筑机电安装工程叁级资质，通过了质量管理体系认证、职业健康安全管理体系认证和环境管理体系认证，是中央国家机关工程定点采购施工入围企业。\r\n    创建一流的工程设计，一流的工程施工，选用一流的工程材料，做好一流的售后服务，是我们努力的方向：使客户满意，管理部门放心，是我们奋斗的目标，让我们携手共创一个安全美好的社会环境。', '116.415656', '39.893473', '116.52238800000001', '39.797660999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3866', '北京华欣博瑞消防工程有限公司', '540', '贾炳友', '13381202036', '贾炳友', '13381202036', '2013年08月27日', '600万元', '北京市', '北京市', '平谷区', null, '北京市平谷区夏各庄镇纪太务村南街61号', '北京市', '北京市', '平谷区', '夏各庄镇', '北京市平谷区夏各庄镇纪太务村南街61号', '', '建筑防火,消防产品', '有限责任公司（自然人投资或控股）', '2013年08月27日', '2033年08月26日', '2018/12/6', '2019/12/5', '京消协（2018）证字429号', '911101170765812271', '', '专业承包；劳务分包；消防设施工程设计；道路货物运输；维修消防设备；销售消防器材、建筑材料、装饰材料、安全技术防范产品；技术咨询、技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华欣博瑞消防工程有限公司经营范围包含：专业承包；劳务分包；防设施工程设计；道货物运输；维修消防设备；销售消防器材；建筑材料、装饰材料、安全技术防范产品；技术咨询、技术服务。\r\n    公司于2013年成立，注册资金600万元，有灭火器维修证书10人，北京市消防设施工程设计证书10人，\r\n有职称的工程技术和经济管理人员占90%以上。公司逐步建立和完善了现代化管理制度和企业管理体系。并获得ISO9001：2000标准质量管理体系认证证书、ISO1400：2004标准环境管理体系认证证书、GB/T28001-2001标准职业健康安全管理体系认证证书。\r\n    公司成立以来先后承接了国家部委、国家电网、金融系统、教育系统、医疗卫生系统、商业、住宅项目和奥运项目等国家重点大型项目工程。其中部分工程获奖，消防验收合格率100%，在业内得到一致好评。\r\n公司秉承“精益求精、质量第一、优质服务、信益为重”的宗旨，依靠丰富的施工经验，高水平的专业施工团队，先进的管理理念，有信心为中国消防工程事业做出更大贡献，争创一流消防工程公司。', '117.19383500000001', '40.144137999999998', '117.19383500000001', '40.144137999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3867', '北京京苑龙安消防器材有限公司', '539', '柴云妹', '15010682119', '赵世忠', '13701038696', '2005年07月15日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北苑东路19号院4号楼18层1810', '北京市', '北京市', '顺义区', '高丽营镇', '北京市顺义区高丽营镇闫家营20号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2005年07月15日', '2025年07月14日', '2018/12/28', '2019/12/27', '京消协（2018）证字483号', '91110105777679112Q', '', '销售消防器材、五金交电（不含电动自行车）、建筑材料（不从事实体店铺经营）；建筑工程机械与设备租赁；维修消防器材；计算机技术培训（不得面向全国招生）；技术推广服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京京苑龙安消防器材有限公司，坐落于北京市朝阳区。公司经北京市工商行政管理局朝阳分区批准、备案，注册成立于2005年7月。是一家以消防器材销售与灭火器维修为主业，销售消防设备、建筑材料、五金交电等产品系列为一体的专业型消防器材公司。在公司的发展上受到各级消防领导的关怀和新老顾客的大力支持。并在北京京苑龙安消防器材有限公司全体员工不懈努力下，北京京苑龙安消防器材有限公司从一个小型门市部企业发展成为北京市消防器材行业领域的一颗靓丽明珠。\r\n自北京京苑龙安消防器材有限公司成立十多年来，北京京苑龙安消防器材有限公司的产品与服务覆盖了北京市和临近地市。公司现有员工6人。先后拥有当今消防行业领先的灭火器维修和检验设备。公司以专业的队伍、严谨的管理、先进的设备、着力打造京苑龙安消防器材产品和维修服务品牌与文化。\r\n北京京苑龙安消防器材有限公司坚持用企业文化和温馨的服务以及产品差异化提升企业核心竞争力，为了适应消防市场的千变万化，公司全体员工将更加团结一致、顽强拼搏、艰苦奋斗、默默奉献确保企业在发展中树立和取得良好的社会形象和经济效益。“行远必自迩，追求无止境”。北京京苑龙安消防器材有限公司将伴随着北京市', '116.439735', '40.041749000000003', '116.5252', '40.151401999999997', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3868', '北京惟泰安全设备有限公司', '538', '朱刚', '', '常久洋', '13716110025', '2009年12月24日', '3000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区闵庄路3号26号楼一层', '北京市', '北京市', '海淀区', '四季青地区办事处', '北京市海淀区闵庄路3号26号楼一层', '', '消防产品', '有限责任公司（法人独资）', '2009年12月24日', '2039年12月23日', '2018/2/1', '2019/1/31', '京消协（2018）证字033号', '91110108699631008C', '', '销售仪器仪表、电子产品、机械设备；货物进出口、技术进出口、代理进出口；技术开发、技术转让、技术咨询、技术服务；基础软件服务；应用软件服务；生产工业用安全环保检测报警仪器、安保消防救援设备；（生产仅限地下一层、一层经营）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京惟泰安全设备有限公司成立于2009年12月24日，注册资金3000万元。公司专业从事气体检测报警系统产品的研发、生产、销售与服务工作。公司产品可广泛应用于冶金、石油、化工、燃气、消防、环保、电力、通讯、造纸、印染、粮食储备、污水处理、矿业、食品、酿造、科研、教育、国防、核工业、市政等多个领域。\r\n      惟泰安全一直秉承“顾客至上，科技创新，持续改进，和谐惟泰”的管理理念，重视与市场伙伴和供应商的合作与分享，激励员工自我价值的实现，追求产品最优的客户应用体验。公司坚持贯彻科技创新战略，立足于新技术开发和高科技成果向市场转化，专注于做最专业的气体检测报警系统产品的供应商和制造商。\r\n质量管理方针：顾客至上、科技创新、持续改进、和谐惟泰\r\n\r\n环境管理方针：节能降耗、预防污染、遵纪守法 持续改进\r\n\r\n职业健康安全管理方针：以人为本、预防为主、依法管理、健康和谐\r\n\r\n企业精神: 诚信、专业、专注、高效\r\n\r\n企业价值观: 天和人安，惟泰是从\r\n\r\n企业经营战略: 利用先进的技术，为客户提供一流的产品和优质的服务，做最专业的气体检测报警产品供应商和服务提供商。', '116.25543399999999', '39.975796000000003', '116.25543399999999', '39.975796000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3869', '中富安泰（北京）智能科技有限公司', '536', '王敬涛', '18611865119', '王敬涛', '18611865119', '2012年04月26日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十八里店乡小武基村武基路5号-2', '北京市', '北京市', '通州区', '台湖镇', '经海四路11号院4号楼6层', '', '建筑防火,消防设施,烟道清洗,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2012年04月26日', '2032年04月25日', '2019/1/17', '2020/1/16', '京消协（2019）证字037号', '91110105596095601B', '电气防火检测技术服务机构', '产品质量检验；技术推广服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n   中富安泰（北京）智能科技有限公司经北京市工商行政管理局批准成立于2012年4月，专业从事消防设施维护保养、检测及电气防火检测服务工作，是北京市消防协会会员单位，公司具有北京市技术监督局频发的《计量认证证书》、北京市公安消防总队频发的《消防技术服务机构资质证书》和北京市消防协会频发的《电气防火检测技术服务机构资信证书》并取得《IS09001质量管理体系证书》。\r\n本公司业务主要包括：消防工程、弱电工程及电气方面的专业检测，检测、维护服务人员（其中工程师及高级工程师占30%，大专及本科学历占到80%）。他们均经过严格的技能培训，持证上岗，且多年从事消防设施及电气检测维护工作，经验丰富、服务专业；由实践经验丰富、理论知识深厚的专家组成的顾问组可以随时为客户提供权威的方案论证和技术支持，确保我们的客户得到全面而周到的无忧服务。\r\n公司拥有齐全、专业的计量和检测设备，科学严谨的体系规范，严格依据包括《质量手册》、《程序文件》和《作业指导书》在内的全部质量管理体系运行，确保方法科学、数据准确、结论正确。\r\n我们完全有能力依照国家、行业及北京市相关技术标准，科学、公正、准确、规范地开展检测', '116.504358', '39.844444000000003', '116.534677', '39.811613000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3870', '北京市琦联锋电气消防安全检测有限公司', '534', '王淑华', '15801271953', '李斌琦', '13901108121', '2001年12月25日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区城关镇西大街7号五层', '北京市', '北京市', '房山区', '城关街道', '北京市房山区城关镇西大街7号五层', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2001年12月25日', '2031年12月24日', '2018/12/28', '2019/12/27', '京消协（2018）证字497号', '91110111733483580C', '电气防火检测技术服务机构', '电气消防安全检测；建筑消防设施检测；消防设施维修、维护。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京市琦联锋电气消防安全检测有限公司成立于2001年,注册资本500万,总投资额780万元。公司位于北京市房山区,公司员工总数 16名,其中专业技术人员及管理人员10名，具有中高级职称的工程师2名，拥有高低、压电工本的检测人员8名。\r\n公司配备红外热成像仪、感温感烟探测器试验装置、消火栓喷淋系统试水检测装置、照度计、风速计、声级计、微压计、红外线测温仪、超声波漏电测试仪、接地电阻测试仪及对讲系统等先进的检测设备175台（部），检测专用车5辆，办公面积570平米。\r\n公司主营业务为电气设施安全检测、建筑消防设施检测；消防设施的维修、维护。公司下设技术部、检测部、综合管理部、财务部。公司管理规范严格，企业文化氛围浓厚，有明确的发展纲要、员工手册，明确公司以及员工的发展方向。\r\n2001年以来，我公司本着“诚信为本、严格标准、公证科学、服务社会”的宗旨，认真贯彻“预防为主、防消结合”的方针，以建筑工程消防技术标准为依据，不断完善消防安全检测，为用户和公安消防机构提供公证、科学、先进的技术测试报告。已经成功的检测了很多大型的商场、饭店及娱乐场所等建筑。', '115.982714', '39.703294', '115.982714', '39.703294', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3871', '北京弘仁消防安全检测有限公司', '532', '董振亚', '13321190012', '董科跃', '13436575956', '2010年01月12日', '200万元', '北京市', '北京市', '昌平区', null, '北七家镇天通苑东苑一区4号楼1至4层2', '北京市', '北京市', '丰台区', '花乡地区办事处', '新发地宜兰园一区南门96号院', '', '消防安全评估,建筑防火,消防设施,消防安全检查,电气防火', '有限责任公司（自然人投资或控股）', '2010年01月12日', '2040年01月11日', '2019/1/11', '2020/1/10', '京消协（2019）证字014号', '911101146995863746', '', '建筑消防技术检测；电器防火技术检测；技术开发、技术咨询、技术服务、技术转让；软件开发；基础软件服务、应用软件服务（不含医用软件）；施工总承包、专业承包、劳务分包；物业管理；机动车公共停车场管理服务；出租商业用房；出租办公用房；会议服务；承办展览展示；组织文化艺术交流活动（不含演出）；设计、制作、代理、发布广告；经济信息咨询（不含中介服务）；销售消防器材、机械设备、五金交电（不含电动自行车）、电子产品、化工产品（不含危险化学品）、日用品、建筑材料；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京弘仁消防安全检测有限公司成立于2010年01月，是经工商行政管理部门登记注册，具有独立的企业法人。公司注册资金200万元，是从事消防设施检测的专业公司。\r\n公司经营范围：建筑消防设施维护、保养、检测，建筑防火材料及消防电气设备安全检测，消防安全评估 。公司成立后，依据国家质量技术监督局的有关要求，建立了完整的质量管理体系文件，完善了各项规章制度。2004年4月被北京消防协会评定为会员单位。\r\n　　公司成立以来，我们严格管理自己的团队，以先进的检测设备、熟练的检测技术为依托，以优质的服务为宗旨，以用户满意为标准，严格执行消防检测的规范标准，努力把北京弘仁消防安全检测有限公司打造成具有强大的竞争力和具有良好社会影响力的团队。', '116.431899', '40.069313000000001', '116.33954900000001', '39.827984999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3872', '北京军亿发餐饮管理有限公司', '531', '侯殿军', '13910736151', '侯磊', '15611118388', '2018年06月20日', '50万元', '北京市', '北京市', '顺义区', null, '顺义区南彩镇彩达二街2号', '北京市', '北京市', '顺义区', '南彩镇', '顺义区南彩镇彩达二街2号', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年06月20日', '长期', '2018/12/28', '2019/12/27', '京消协（2018）证字462号', '91110113MA01CYR246', '', '企业管理、餐饮管理、酒店管理、经济贸易咨询、企业策划、会议服务、承办展览展示活动；技术服务、技术转让、技术开发、技术推广、技术咨询；销售电子产品、计算机、软件及辅助设备、家用电器、卫生用品、食用农产品；物业管理；保洁服务、清洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京军亿发餐饮管理有限公司始建于2018年，现位于北京市顺义区，注册资金为50万元人民币，服务于各大型企事业单位、医院、学校，至今已发展成为一个保洁服务、油烟清理和餐饮从业人员培训等为一体的餐饮服务型企业。\r\n       公司自创建之日就秉诚“规范经营、诚信为本、顾客第一、持续改进”为质量方针，以“卫生第一、服务第一、质量第一”为服务宗旨。为广泛吸纳优秀管理人才，培养扩大优秀管理队伍，加大食品卫生安全监控力度，广纳货源输入渠道，加强办公现代化管理等一系列措施，为公司稳健拓展奠定了基础。\r\n       公司的经营遵循;不求大，但求强；不求快，但求稳的方针，并且坚持安全第一，质量第一，服务第一，信誉第一;的原则，与合作伙伴共同发展。另外公司市场开发部也在不断的搜集各种信息及行业动态，并以此制定公司长期的发展计划，同时也为公司各种规章制度的逐步完善提供强有力的保障。展望未来，我公司将一如既往地为客户提供最优质、经济、高效的服务，更期待着能与更多的朋友携手共创美好的明天。', '116.697045', '40.133657999999997', '116.697045', '40.133657999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3873', '北京天泰丰源建筑工程有限公司', '530', '王敬涛', '18611865119', '王敬涛', '18611865119', '2016年08月29日', '2000万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡长虹西路翠柳东街1号-3627', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡小武基村武基路5号-1', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2016年08月29日', '2066年08月28日', '2019/1/17', '2020/1/16', '京消协（2019）证字036号', '91110111MA007XNT90', '电气防火检测技术服务机构', '施工总承包；专业承包；劳务分包；工程勘察设计；建设工程项目管理；工程招标代理；工程造价咨询、工程技术咨询（中介除外）；园林绿化服务；租赁建筑机械设备；销售建筑材料、机械设备、装饰材料、保温材料、金属材料、门窗、五金、交电；清洁服务（不含洗车服务）；技术服务；技术检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n    北京天泰丰源建筑工程有限公司是由北京市消防局退伍老兵创建成立。以“渠道为王、货通天下”为基本商业模式，秉承“追求客户、社会、员工、企业价值相协调”的企业理念、立志整合、优化消防经营网络资源，促进消防相关产业经济发展，为国家公共安全事业作出卓越贡献。北京天泰丰源建筑工程有限公司是经国家建设部和北京市建委核准、北京市消防局备案的消防公司，具备消防设施工程专业设施承包贰级资质，通过ISO9001:2000质量管理体系认证,环境管理体系认证,职业健康安全管理体系认证公司拥有一批高级工程师、预算和施工。北京天泰丰源建筑工程有限公司，从事办公室、餐饮、酒店、娱乐场所等装修设计、装修施工图深化、水电专业施工图深化、消防报审报验、消防改造工程图纸设计、建筑结构图设计、蓝图盖章、效果图、投标书、预结算编制、及施工等为一体的专业中心，精通消防报批、报审等环节的政策法规及办理流程，且与政府消防部门及各大厦物业建立了良好的相互信任的合作关系，竭诚为广大需要消防报批者提供优质的服务。根据国家法律规定，办公室、餐饮、商业店铺、酒店宾馆等属于人群密集型的场所装修，为保证人和财产的安全，要进行消防报', '116.127211', '39.726692', '116.504358', '39.844444000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3874', '北京卫利洁物业管理有限公司', '529', '杨勇', '13911831515', '邹治亚', '13911719527', '2015年08月26日', '100万元', '北京市', '北京市', '丰台区', null, '北京丰台区汽车博物馆东路1号院2号楼3层南座317', '北京市', '北京市', '丰台区', '新村街道', '北京丰台区汽车博物馆东路1号院2号楼3层南座317', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年08月26日', '2035年08月25日', '2019/1/17', '2020/1/16', '京消协（2019）证字031号', '91110108355251837U', '', '物业管理；技术开发、技术推广、技术服务；化粪池清掏；水污染治理；大气污染治理；软件开发；基础软件服务；应用软件服务；城市园林绿化服务；清洁服务；机械设备租赁；普通货运（道路运输经营许可证有效期至2022年02月08日）；互联网信息服务；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；互联网信息服务、城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '经营范围：技术开发、技术推广、技术服务、技术咨询；化粪池清掏；水污染治理；大气污染治理；固体废物污染治理；软件开发；基础软件服务；城市园林绿化服务；清洁服务；机械设备租赁；普通货运；互联网信息服务；城市生活垃圾、清扫、收集、运输、处理', '116.300888', '39.827032000000003', '116.300888', '39.827032000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3875', '北京东汉阳光科技有限公司', '528', '李峭玲', '010-84895628', '李妍', '010-84895628', '2006年03月23日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区来广营西路5号院诚盈中心5号楼901、908室', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区来广营西路5号院诚盈中心5号楼901、908室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2006年03月23日', '2026年03月22日', '2018/10/19', '2019/10/18', '京消协（2018）证字315号', '911101057868774280', '电气防火检测技术服务机构', '技术推广；技术开发、技术培训、技术咨询、技术服务；电气防火检测技术服务；建筑消防设施检测技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东汉阳光科技有限公司成立于2006年3月，注册资本金1000万元，是一家从事建筑消防设施检测、电气防火安全检测、消防设施维护保养的专业技术服务公司。公司于2007年2月通过了GB/T	19001/ISO9001质量管理体系认证，于2014年8月通过了实验室和检查机构资质认定评审，取得了《资质认定计量认证证书》，于2014年12月取得了《消防设施维护保养检测一级资质证书》、《电气防火检测技术服务机构资信证书》。作为北京消防协会会员单位，我公司连续六年被评为“建筑消防设施、电气防火安全检测双优企业”。\r\n本公司拥有雄厚的技术力量，严格按照国家、行业和北京市相关技术标准，开展建筑消防设施检测、电气防火安全检测及消防设施维护保养工作，提供科学、客观、准确、规范的检测报告及科学、严谨、可靠的维护保养服务，竭诚服务于北京市建筑消防安全事业。', '116.465176', '40.021116999999997', '116.465176', '40.021116999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3876', '北京盛安益达科技发展中心', '527', '李克元', '13601085219', '黄长生', '13001204339', '2006年11月29日', '30万元', '北京市', '北京市', '房山区', null, '北京市阎村镇张庄村西', '北京市', '北京市', '房山区', '阎村镇', '北京市阎村镇张庄村西', '', '消防产品', '集体所有制', '2006年11月29日', '2036年11月28日', '', '', '', '91110111796741663J', '', '技术开发、技术服务、技术咨询（中介除外）；安装仪器仪表、电器设备；维修机械设备、消防器材；销售五金、交电、建筑材料、日用百货、化工产品（不含化学危险品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京盛安益达科技发展中心是经北京市消防局核准备案的消防产品销售、检测维修的专业公司，北京市消防协会的会员', '116.093672', '39.733074999999999', '116.093672', '39.733074999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3877', '北京利达恒信科技发展有限公司', '526', '涂燕平', '67876688', '任丽璇', '13611014635', '2002年07月23日', '1000万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区荣京东街17号3幢二层、三层', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区荣京东街17号', '', '消防设施', '其他有限责任公司', '2002年07月23日', '2000年07月22日', '', '', '', '91110302740402363U', '', '生产电气火灾监控设备、电气火灾探测器；组装生产消防应急照明、疏散指示系统；生产火灾报警控制系统；技术开发、技术咨询、技术服务；销售电子产品、机械设备（不含小汽车）；设备安装、维修（不含行政许可的项目）；计算机系统集成；消防安全评估；销售计算机、软件及辅助设备；技术检测（限分支机构经营）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京利达恒信科技发展有限公司位于北京亦庄经济技术开发区，是利达集团下属一家具有消防技术服务资格的专业机构 。公司是生产电气火灾监控设备、电气火灾探测器、消防应急照明、疏散指示系统、火灾报警控制系统并从事消防技术开发、技术咨询、技术服务的高新技术企业。 公司从事各类建筑的建筑消防设施的维修和保养活动。售后服务中心共有70名员工，专职负责维修维保工作的工程技术人员50人，全部工程人员配备笔记本电脑、GPS定位手机，配备工程用车16辆，有力的保障了服务质量和服务效率。在客户管理上公司应用ERP管理系统，为每一个客户建立专门档案，同时开辟24小时客户服务专线，及时解答客户提出的问题、记录客户的服务要求。公司根据设备的使用年限，派维保专员走访用户，现场检查设备运行情况，确保设备的可靠运行。\r\n公司成立消防联网控制中心，目前已有我公司负责的维保单位及部分使用利达产品的非维保用户近1500个单位通过无线网络联网至消防联网平台，联网平台的值班人员在平台能够实时掌握联网单位的消防控制系统的工作状态，发现异常情况会第一时间安排维保工程师赴现场处理或通知联网单位处理，为联网单位的消防系统正常运行起到的重要', '116.522693', '39.799809000000003', '116.522693', '39.799809000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3878', '北京利达华信电子有限公司', '525', '涂燕平', '67876688', '任丽璇', '13611014635', '2004年06月04日', '3517.9万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区荣京东街17号2幢1-4层', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区荣京东街17号2幢1-4层', '', '消防产品', '有限责任公司（法人独资）', '2004年06月04日', '2024年06月03日', '', '', '', '91110302762993192T', '', '生产消防应急电源、防火保安产品、环保监测系统的电子产品；开发消防应急电源、防火保安产品、环保监测系统的电子产品；销售自产产品；自产产品的安装、调试、维修；代收居民水电费。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京利达华信电子有限公司是以生产火灾自动报警控制系统为主导产品的高新技术企业。公司生产火灾自动报警控制系统产品已有近30年的历史，产品行销全国及世界20多个国家，并设有100多个分销公司及售后服务机构。利达华信公司早已成为国内生产火灾自动报警产品最大的厂家之一。\r\n公司在1994年通过了国际ISO9001:1994产品质量认证，取得了认证证书；四次被公安部通报表扬；多次被北京市消防局评为“质量管理先进企业”；1999年获得《向欧盟推荐产品》证书；2001年通过了ISO9001英国皇家UKAS体系认证，公司通过了ISO9001: 215质量管理体系、ISO14001：2015环境管理体系认证、OHSAS18001：2011职业健康安全管理体系认证及产品质量3C强制认证；2006年通过北京质量协会资质等级认定，被认定为消防行业“质量卓越单位”。2007年获得“北京市重质量守信用企业”。同年6月，通过新版国家标准的3C强制认证', '116.522693', '39.799809000000003', '116.522693', '39.799809000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3879', '北京金玉航辉消防安全技术有限公司', '524', '郭志伟', '', '吴月美', '18001036225', '2004年01月14日', '400万元', '北京市', '北京市', '丰台区', null, '昆明湖南路九号-9号商业楼权金城国际酒店603室', '北京市', '北京市', '丰台区', '卢沟桥街道', '长安新城商业中心B座3层', '', '消防设施,电气防火', '有限责任公司（法人独资）', '2004年01月14日', '2024年01月13日', '2018/11/21', '2019/11/20', '京消协（2018）证字380号', '91110108758212760U', '电气防火检测技术服务机构', '技术服务、技术咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '京金玉航辉消防安全技术有限公司成立于2004年1月，2005年2月，经北京市消防协会专家评审委员会的评审，我公司已具备建筑消防设施检测技术服务质量保障体系和电气防火检测技术服务质量保障体系单位，2006年8月，我公司取得了ISO9001：2000版质量管理体系认证证书，同时我们还是北京消防协会的会员单位和电气防火检测“十佳”单位之一。我公司自成立以来在北京市消防局和北京市消防协会的指导下开展电气防火检测、消防设施检测服务工作。\r\n我公司于2014年11月取得CMA计量认证证书和消防设施维护保养检测临时一级资质。', '116.264167', '39.888823000000002', '116.264167', '39.888823000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3880', '北京华安恒信消防科技有限公司', '522', '张恒', '13901100338', '孙正', '13911805500', '2003年12月05日', '600万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区松榆南路54号3层54-3内B01、B09、C03', '北京市', '北京市', '朝阳区', '潘家园街道', '北京市朝阳区松榆南路54号3层54-3内B01、B09、C03', '', '消防安全评估,建筑防火,消防设施,消防产品,电气防火', '有限责任公司（自然人独资）', '2003年12月05日', '2023年12月04日', '2018/11/26', '2019/11/25', '京消协（2018）证字397号', '911101057577499294', '电气防火检测技术服务机构', '技术检测；技术推广服务；消防设施的维护与保养；消防安全检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '技术检测；技术推广服务；消防设施的维护与保养；消防安全检测。', '116.464106', '39.870730999999999', '116.464106', '39.870730999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3881', '北京圣元天享工贸有限公司', '521', '赵佩武', '13501057676', '李洪娟', '13621281792', '2008年08月01日', '2000万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山丁东路11号', '北京市', '北京市', '房山区', '城关街道', '北京市房山区燕山丁东路11号', '', '消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2008年08月01日', '2038年07月31日', '', '', '', '91110111678790659G', '', '委托加工；维修消防器材；销售劳保用品；环保技术开发、技术咨询、技术服务；环境监测分析；技术检测；接受委托提供劳务服务；建筑消防设施检测；电力、电气防火检测；安全咨询；安全评估。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京圣元天享工贸有限公司成立于2008年，有一支从事消防工作多年的专业技术人员队伍，建立了消防器材销售、消防系统设备维修保养、建筑消防设施检测、电气防火技术检测专业公司。\r\n2009年加入北京市消防协会；2010年被中国消防协会评审为中国消防协会会员单位，公司董事长谢元先生成为中国消防协会个人会员；同年加入中国消防协会电气防火专业委员会；同年通过了中石化HSE管理体系认证。\r\n 2014年11月取得北京市质量技术监督局资质认定计量认证证书。\r\n2014年11月取得北京消防协会电气防火检测技术服务机构资信证书。\r\n2014年12月公司总经理张志强先生被聘为中国消防协会电气防火专业委员会第七届委员会通讯委员。\r\n2015年1月取得中华人民共和国消防技术服务机构一级(临时)资质证书。\r\n2015年1月公司总经理张志强先生被聘为北京市消防协会第四届理事会电气防火检测行业分会副会长。\r\n2015年7月取得中华人民共和国消防技术服务机构三级（临时）资质证书。\r\n公司特聘国内知名建筑电气防火专家杨在塘教授为技术总监（总工程师）。 ', '115.990878', '39.731465', '115.990878', '39.731465', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3882', '北京佳佳慧福商贸有限公司', '520', '姚慧敏', '13699206922', '赵福强', '13552534887', '2014年06月30日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区造甲街110号2号平房', '北京市', '北京市', '大兴区', '黄村地区办事处', '北京市大兴区滨河东里20号', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年06月30日', '2034年06月29日', '', '', '', '91110106317982620H', '', '括网上销售厨房用具、机械设备、五金产品（不含电动自行车）、日用品、卫生间用具、建筑材料、装饰材料、金属材料、消防器材、塑料制品；清洁服务；劳务服务；技术服务；机械设备维修；餐饮管理；企业管理服务；经济信息咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司是一家集策划、设计、销售、安装及售后服务于一身的专业厨房设备公司，从事厨具行业已有五年历史，已通过环保产业协会认证。设备齐全，技术力量雄厚，属下有北京源浩洁不锈钢厨房设备经营部，河北固安万顺腾达商贸有限公司，以及天津、石家庄、西安、太原、郑州、长沙、济南、杭州等十多家产品代理公司。\r\n承蒙各级领导和各界朋友的厚爱，本公司自成立至今已承接多家星级酒店、大型酒楼及各重点大学学生食堂的厨房设备工程，并涉足军队后勤设备供应，在厨房的设计与设备制作方面积累了丰富的经验。\r\n本公司主要经营的系列产品有：新式环保节能不锈钢炉具、不锈钢台柜、冷冻冷藏设备、抽气鲜风系统、油烟净化设备、噪声处理设备、及军用不锈钢设备等。\r\n“工欲善其事，必先利其器”，本公司拥有日本进口（AMADA）激光切割机、数控冲床等先进设备。加上大批经验丰富的技术工人，以及高效的ISO9001模式的生产管理，生产出来的产品无论是外观还是环保节能性均能傲视同行。\r\n公司另外经营国内外各优质名牌西餐炉具、食品加工机械、冷冻冷藏设备、洗碗消毒设备、酒店宾馆清洁设备、中西餐不锈钢餐具、金银器用具、刀叉具、进口玻璃杯器具、陶瓷餐具、酒店宾馆一次', '116.297507', '39.843966999999999', '116.34212599999999', '39.747200999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3883', '北京乐邦佳业保洁服务有限公司', '519', '李京明', '13381201091', '夏文波', '18911821711', '2009年07月03日', '50万元', '北京市', '北京市', '西城区', null, '北京市西城区前面西大街8号楼西侧二层206室', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店老君堂新平方117号', '', '烟道清洗', '有限责任公司（自然人独资）', '2009年07月03日', '2029年07月02日', '', '', '', '911101026916643662', '', '清洁服务；家庭劳务服务；技术服务；设备维修；家用电器维修；销售日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京乐邦佳业保洁服务有限公司是一家正规注册、实力雄厚、专业从事烟道清洗服务性公司。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦等都提供了全方位的清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.367484', '39.899149000000001', '116.515642', '39.837519', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3884', '北京宇航晟都保洁服务有限公司', '518', '杨文强', '13511033890', '杨文强', '13511033890', '2016年02月24日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区大孙各庄镇薛庄村五街二条3号', '北京市', '北京市', '顺义区', '大孙各庄镇', '京市顺义区大孙各庄镇薛庄村五街二条3号', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年02月24日', '2066年02月23日', '2019/3/6', '2020/3/5', '京消协（2019）证字087号', '91110113MA003QDA96', '排油烟设施清洗机构', '清洁服务（不含餐具消毒）；接受委托提供劳务服务（不含排队服务、对外劳务合作）；家政服务；家居装饰；销售空调制冷设备、计算机、厨房用具、装饰材料；零售机械设备、五金交电（不含电动自行车）、建筑材料（不含砂石及砂石制品）；虫害与鼠害防治；保洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立之初承接各大饭店、企事业机关厨房油烟管道的消防清洗工程，2018年5月经北京消防协会培训审核取得《北京消防协会会员证》证书，公司现有固定客户100余家，拥有专业员工80余人，公司主要经营、厨房油烟管道消防清洗、外墙清洗、杀虫灭鼠、日常保洁、各种石材保养打腊及室内外开荒。虽不属于业内的大公司，但能一如继往的保持与客户良好的合作关系，诚心的服务态度和较高的服务质量。\r\n公司奉行“以质胜人、以信感人、以诚待人”的经营宗旨为用户提供全面、快捷的服务，并不断创新发展，为广大用户解除后顾之忧。\r\n公司的经理级以上管理人员都是本市户口，均从事过相关的服务行业如酒店、物业等，个人相关管理经验均在五年以上。主管由本市及外埠人员构成，具有三年以上工作经验及高中以上文化学历，有较强的组织管理能力。领班具有两年以上工作经验及初中以上文化学历，具有一定的组织管理和协调能力。\r\n公司主营业务介绍：1、	厨房油烟管道、排风系统的清洗，2、油烟净化器的清洗，3.日常保洁4，有害生物防	5.石材打腊、养护及结晶', '116.919584', '40.066282999999999', '116.919584', '40.066282999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3885', '北京贺贺佳业保洁服务有限公司', '517', '张辉', '18612086069', '张辉', '18612086069', '2017年12月08日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山凤凰亭北里1号楼3-0161', '北京市', '北京市', '房山区', '向阳街道', '北京市房山区燕山凤凰亭北里1号楼3-0161', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2017年12月08日', '2037年12月07日', '2018/5/11', '2019/5/10', '京消协（2018）证字111号', '91110304MA0199BJ7T', '', '技术开发；软件开发；家庭劳务服务；建筑物清洁服务；办公室保洁服务；机械设备专业清洗服务；生活清洗、消毒服务；经济信息咨询（不含投资咨询）；承办展览展示活动；物业管理；计算机系统服务；销售厨房用具、家用电器、清洁用品、化工产品(不含危险化学品)、电子产品、机械设备、五金产品（不含电动自行车）、家具、灯具、日用品、工艺品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京贺贺佳业保洁服务有限公司的经营范围是清洁服务；家居装饰；汽车装饰；销售：清洁用品、化工产品、电子产品。', '115.94577200000001', '39.739660999999998', '115.94577200000001', '39.739660999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3886', '北京齐航楼宇清洁有限公司', '515', '张建宁', '18911181522', '陈立荣', '63328207', '2003年06月12日', '200万元', '北京市', '北京市', '西城区', null, '北京市西城区广安门外南街50号院2号楼205室', '北京市', '北京市', '西城区', '牛街街道', '北京市西城区广安门外南街50号院2号楼205室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2003年06月12日', '2023年06月11日', '2019/4/9', '2020/4/8', '京消协（2019）证字163号', '91110102751320064A', '', '清洁服务；害虫防治服务；大气污染治理；园林绿化服务；家居装饰；物业管理；维修机械设备；销售建筑材料、五金交电、机械设备、家用电器、厨房用品、卫生间用具；花卉租摆；会议服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京齐航楼宇清洁有限公司创建于2003年，是一家常年从事多项清洁服务，集管理、养护、服务于一体的专业清洁服务公司。公司成立16年来，一直采用标准化、制度化、规范化的科学管理方式，不断引进国内外先进的专业机械设备，聘请清洁管理、养护方面的专业人才。在简单清洁的服务基础上，积极开拓、努力提高，使一般的“搞卫生”变成现代化的以维护保养为主，清洁服务并举的服务项目。在提高保洁及养护能力的同时，也提高了劳动效率，保证了服务质量。有效的解决了许多企业清洁中的疑难问题。\r\n公司主要业务包括：物业管理；建筑物楼宇外墙清洗、防水及粉饰，厨房排油烟设施清洗及铜器不锈钢制品的清洗与维护，家居装饰；各种类型的写字楼、宾馆、商场、别墅、公寓、医院、银行及其它对外营业场所的日常维护保洁、开荒工作和灭蚊蝇、防治白蚁等虫害的服务工作；同时还承接各种地毯、沙发套、窗帘、地面的清洗；大理石、木地板的上蜡及维护；各种地面及浴缸的翻新等。 \r\n北京齐航楼宇清洁有限公司坚持“重合同、守信誉”的经营原则，秉承“敬业、管理、人才、发展”的宗旨，贯彻“高标准、高素质、高效率”的企业精神，公司推行“团结、奉献、求实、科学”的工作准则。', '116.34710800000001', '39.882914', '116.34710800000001', '39.882914', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3887', '绿港蓝天（北京）环保科技有限公司', '513', '侯瑞东', '13601358321', '侯瑞东', '13601358321', '2019年02月14日', '10000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区高丽营镇文化营村北（临空二路1号科技创新 功能区）', '北京市', '北京市', '顺义区', '高丽营镇', '北京市顺义区高丽营镇文化营村北（临空二路1号科技创新功能区）', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年02月14日', '长期', '2017/11/22', '2018/11/22', '京消协（2017）证字1167号', '91110113MAO1H89C8R', '排油烟设施清洗机构', '技术开发、技术咨询、技术转让、技术服务、技术推广；施工总承包、专业承包；大气污染治理；清洁服务（不含餐具消毒）；污水治理；病虫害防治；维修家用电器、制冷设备、消防器材、机械设备；销售制冷设备、厨房用具、卫生间用具、消防器材、日用品、机械设备；技术检测（不含认证、认可）；家政服务；安装、租赁机械设备；接受委托提供劳务服务（不含排队服务及对外劳务合作）；劳务分包；人力资源服务。（企业依法自主选择经营项目，开展经营活动；人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司成立于2019年2月 位于中关村科技园顺义园区 主要从事大型油烟机、中央空调清理  病虫害防治  现为广州毕卓环保科技有限公司中央空调清理项目顺义代理  广州三淼环保科技有限公司大型油烟机清理项目顺义代理  面对激烈的市场竞争 我公司要尽快完善自己的资质  成为行业内专业的公司  在成就自己的同时 为还北京一片蓝天  做出一份贡献', '116.55162199999999', '40.155214999999998', '116.55162199999999', '40.155214999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3888', '北京富铭远洋建筑装饰设计有限公司', '512', '张晓坡', '13910693163', '张晓坡', '13910693163', '2015年10月14日', '100万元', '北京市', '北京市', '延庆区', null, '北京市延庆区大榆树镇北京科技职业学院八达岭校区13号楼126室', '北京市', '北京市', '延庆区', '大榆树镇', '北京市延庆区大榆树镇北京科技职业学院八达岭校区13号楼126室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年10月14日', '长期', '2018/9/26', '2019/9/25', '京消协（2018）证字304号', '91110229MA00183P80', '排油烟设施清洗机构', '工程设计；工程勘察；专业化设计服务；绿化管理；设计、制作、发布广告；销售建筑材料、文化用品、消防器材、五金、交电、日用品、电子产品、针纺织品、灯具、厨具卫具、机械设备、服装、鞋帽、消防器材、一类医疗器械、二类医疗器械、汽车、仪器仪表、机械设备、安全技术防范产品；货物进出口、代理进出口、技术进出口；计算机、软件辅助设备；专业承包；会议服务；清洁服务；技术开发；软件开发；委托加工安全技术防范产品、二类医疗器械。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '富铭远洋企业简介\r\n北京富铭远洋建筑装饰设计有限公司于二〇一五年十月十四日正式被北京市工商局批准成立。公司秉承“客户第一，服务第一，技术第一，质量第一”的理念。通过服务创新，来满足客户潜在需求，并且通过技术创新来改变原始的设计模式。    \r\n  设计团队参与的首都机场、新东安市场、国家大剧院、国家体育场、上海科技馆、知名央企、国家会议中心、等百余项国家和省市级重点工程的装饰设计，屡创佳绩，好评如潮，多次获得国家“鲁班奖”、“全国建筑工程装饰奖”以及省市级优质工程奖等奖项，取得了良好的社会效益和经济效益。 \r\n  富铭远洋公司顺应时代发展要求，总是站在新起点，迎接新挑战，与时俱进，对内不断完善企业管理，对外广泛合作，谋求共赢，愿与业内外同仁将建筑装饰业推向更新、更高层次而努力。为把富铭远洋公司建成国内一流,国际知名企业而奋斗! \r\n 设计是魂，质量是本。公司拥有先进的管理体制，一流的设计师团队。我们将追求卓越，创造精品，相信只有专业的技术才能打造一流的品质。\r\n五部：承接全国各大饭店、酒店、宾馆、写字楼、商场、公寓、机关单位、工厂、部队等大型油烟管道、排风机、空气净化器清洗服务。\r\n机械设备供应。', '116.023735', '40.416488999999999', '116.023735', '40.416488999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3889', '北京火政殷实消防技术有限公司', '511', '胡涛', '17600134149', '苏恩情', '18611657808', '2002年12月04日', '600万元', '北京市', '北京市', '大兴区', null, '北京市经济技术开发区永昌中路甲6号院2号楼502室', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市经济技术开发区永昌中路甲6号院2号楼502室', '', '消防设施', '有限责任公司（自然人投资或控股）', '2002年12月04日', '2052年12月0.日', '2018/3/9', '2019/3/8', '京消协（2018）证字053号', '91110302745473208U', '', '消防技术的开发、技术咨询、技术转让、技术服务；消防设备维修；消防设施、消防电器检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司主要从事消防设施（维保、检测）。', '116.51992799999999', '39.794989000000001', '116.51992799999999', '39.794989000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3890', '北京市顺诚东消防器材有限公司', '510', '赵贺民', '13901183893', '赵贺民', '13901183893', '2002年07月26日', '50万元', '北京市', '北京市', '顺义区', null, '北京市顺义区顺平路南侧（加油站）', '北京市', '北京市', '顺义区', '杨镇地区办事处', '北京市顺义区顺平路南侧（加油站）', '', '消防产品', '有限责任公司（自然人投资或控股）', '2002年07月26日', '2032年07月25日', '2018/3/29', '2019/3/28', '京消协（2018）证字072号', '911101137415631508', '', '普通货运；销售消防器材、安全技术防范产品；维修检测灭火器；安全评估；技术开发、技术咨询。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京市顺诚东消防器材有限公司成立于2002年，经营地址位于顺义区地铁15号线俸伯站出口往东300米路南侧，是顺义区成立时间较早、经营规模较大的专业经营批发销售各类消防器材和专业维修检测灭火器的公司。公司自成立时起，一直坚持诚信为本、服务社会的宗旨，主要经营行业内优质产品，各种型号灭火器、消防水带、水枪、消火栓、消防箱、消防架子、应急照明灯、逃生救援器材、防火禁令标牌等相关产品。库存商品充足。品种齐全，质量优良，价格合理，所售产品经过国家消防相关机构检验合格并出具检验报告和型式认可证书。', '116.801171', '40.147978999999999', '116.801171', '40.147978999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3891', '北京蓝冰宝环保技术有限公司', '508', '许保利', '010-57195982', '贾立强', '13011106080', '2007年09月30日', '300万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区八里庄西里98号15层1807室', '北京市', '北京市', '朝阳区', '八里庄街道', '北京市朝阳区八里庄西里98号15层1807室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2007年09月30日', '2002年09月29日', '2018/3/31', '2019年3余e30ri', '京消协（2018）证字1050号', '911101056675218247', '排油烟设施清洗机构', '技术推广服务；专业承包；销售机械设备、建材、文具用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京蓝冰宝环保技术有限公司是专业从事中央空调清洗、水系统处理、主机维护保养、锅炉清洗、建筑物外墙清洗、室内外保洁、排油烟管道清洗及环保技术推广服务的高新技术企业。', '116.494421', '39.914647000000002', '116.494421', '39.914647000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3892', '北京优诺科技发展有限公司', '507', '赵朝阳', '87952276', '孟林雁', '13910889402', '2010年08月17日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区大郊亭中街2号院2号楼5层2-5A', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区大郊亭中街2号院2号楼5层2-5A', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2010年08月17日', '2030年08月16日', '2018/10/30', '2019/10/29', '京消协（2018）证字344号', '911101055604077736', '电气防火检测技术服务机构', '技术推广服务；电气防火检测技术服务；建筑消防设施检测技术服务；计算机系统服务；承办展览展示活动；组织文化艺术交流活动（不含演出）；销售计算机、软件及辅助设备、机械设备、电子产品、五金交电、建材、金属材料、日用品、家用电器、化工产品（不含危险化学品）、服装、医疗器械（限一类）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京优诺科技发展有限公司始建于2002年，前身为北京正凡正消防科技有限公司。公司是经北京市消防局审核批准的专业从事建筑电气防火检测和建筑消防设施检测服务、工程维保及相关技术咨询的企业，且为北京市消防协会旗下的单位会员，公司在市消防局和市消防协会的指导下，以防火减灾为目的，遵循“预防为主，防消结合”的消防工作方针，为数百家企事业单位预防和减少火灾安全隐患，提供充分的科学依据和有效的整改建议。\r\n优诺科技公司经历了十二年的风雨洗礼与市场考验，在拼搏中提高技术水平，在发展中升华管理经验，公司一贯重视管理精神与实践工作的结合，与时俱进更新管理理念，带领公司于2013年8月21日顺利通过了ISO9001国际质量管理体系认证。公司采用先进的检测技术，综合配备了适宜的检测仪器、设备，能够高效、公正、科学、可靠的呈现检测结果，最大限度的为客户减少火灾隐患，2014年12月5日公司通过了北京市质量技术监督局严格的资质评定，颁发了国家认可的计量认证证书。经计量认证合格的产品质量检验机构所提供的数据，作为公证数据，具有法律效力。', '116.48684799999999', '39.888238000000001', '116.48684799999999', '39.888238000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3893', '北京光诚环保科技有限公司', '504', '夏时光', '13681384359', '夏时光', '13681384359', '2017年08月09日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区康泽路3号院12号楼7层2单元709', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区彰化路智业园A座15A', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年08月09日', '2047年08月08日', '2019/5/27', '2020/5/26', '京消协（2019）证字280号', '91110108MA00GYLW2K', '', '技术服务、技术咨询（中介除外）、技术开发；建筑物清洁服务；清洁服务（不含洗车服务）；维修厨房设备；销售电子产品、机械设备、厨房设备、家用电器、服装、日用杂货、五金交电（不含电动自行车）、建筑材料。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京光诚环保科技有限公司是一家经过正式注册，拥有合法经营执照的正规企业。专业从事酒店、食堂、学校、机关单位等厨房排油烟管道清洗、风机净化器清洗、大型油烟机清洗会员单位，中央空调清洗，通风管道工程安装的清洗技术公司。公司还销售各种厨房设备、机械设备、清洗设备、保洁用品、环保产品等。我公司将人性化的服务模式及专业的清洗技术融为一体，拥有严格的管理制度、先进的设备、一流的服务质量，精湛的技术。清洗维修技师都具备多年清洗、维修、 安装经验，并不断吸收新的技术和先进的检测设备来满足广大客户的需求。\r\n我公司还承接外墙清洗，地毯清洗，石材结晶，地板打蜡，日常保洁等各种工程。公司的服务形式灵活多样，价格合理，并全心全意为客户提供细致周到的服务，客户的满意和认可是我们赖以生存的基础，也是我公司全体员工坚持不懈的追求目标, 公司在运营中注重各方面的管理，定期对各岗位员工进行清洁技术培训，严格要求，积极进取，并且不断完善更加有效的管理体系，不断创新，不断前进，以尽善尽美的服务为每一位客户打造一个健康、洁净、舒适的美好环境。', '116.21404099999999', '39.769855', '116.288956', '39.945073999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3894', '北京利华消防工程有限公司', '503', '常立明', '010-64219813', '刘明', '18611146685', '1985年11月17日', '5000万元', '北京市', '北京市', '朝阳区', null, '和平里七区18号楼', '北京市', '北京市', '朝阳区', '和平街街道', '和平里七区18号楼', '', '建筑防火,消防设施,电气防火', '有限责任公司（法人独资）', '2012年08月06日', '长期', '', '', '', '91110101101295004Y', '', '消防工程设计、安装、维修、技术咨询服务；技术开发；销售消防器材、防盗监控器。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京利华消防工程有限公司是隶属于中国核工业集团有限公司的国有独资企业，成立于1985年，具备国家建设部核准颁发的消防设施工程专业承包壹级资质，消防设施工程设计专项甲级资质，消防设施维护保养检测国家临时一级资质，并通过GB/T19001质量管理体系，GB/T24001环境管理体系、GB/T28001职业健康安全管理体系和中核集团安全生产标准化体系四个认证。公司是首批获得中国消防行业信用等级评价AAA级的企业并连续多年获得北京市建设行业诚信企业和资信评价AAA级信用企业，是我国成立时间最早、消防工程企业资质最全、施工技术最强的消防专业工程公司之一。\r\n利华公司现有核心员工100余人，国家一级建造师24人、二级建造师11人，是我国“火灾自动报警系统施工及验收规范（GB50166-2007)”等5个国家标准的主要参编单位。利华公司坚持“质量第一、信誉第一、用户至上”的宗旨，贯彻“以人为本、优质服务、遵规守法、安全兴业、环保高效、创新进取”的管理方针，以顾客满意为重点，坚持优质服务、诚信合作、拼搏进取的精神。', '116.42379099999999', '39.961058999999999', '116.42379099999999', '39.961058999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3895', '北京智德宏业消防工程有限公司', '502', '李斌', '13701058057', '赵春杰', '13810369101', '2017年11月06日', '1001万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区大台商贸公司玉皇庙门市部2幢1至2层DT0963', '北京市', '北京市', '门头沟区', '大台街道', '北京市门头沟区大台商贸公司玉皇庙门市部2幢1至2层DT0963', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2017年11月06日', '2047年11月05日', '', '', '', '91110109MA018J724H', '', '施工总承包；专业承包；劳务分包；技术开发、转让、服务、咨询；承办展览展示；销售消防产品、通讯设备、照明设备、医疗器械（限I类）、机电设备、化工产品（不含化学危险品及一类易制毒化学品）、建筑材料、装饰材料、五金交电、金属材料、汽车配件、安防产品、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京智德宏业消防工程有限公司，是一家专业从事消防系统工程施工、安装、调试业务的专业公司，公司实力雄厚，注册资本人民币1001万元。公司具有国家建设部和北京市建委审核，北京市消防局备案的消防工程公司。公司具有一批高级工程师和高素质、技术过硬、经验丰富的专业施工团队。', '115.914108', '39.956812999999997', '115.914108', '39.956812999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3896', '北京六合成消防技术有限公司', '500', '姜凌', '13910703969', '姜彤华', '13661251987', '2001年03月12日', '5060万元', '北京市', '北京市', '海淀区', null, '北京市海淀区西四环北路140号5层509、512室', '北京市', '北京市', '海淀区', '八里庄街道', '北京市海淀区西四环北路140号京鼎原商务楼509室', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2001年03月12日', '2051年03月11日', '2018/11/21', '2019/11/20', '京消协（2018）证字379号', '91110108802214895E', '电气防火检测技术服务机构', '技术开发、技术咨询；销售建筑材料、电器设备；电气安全检测；消防设施检测；消防器材维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京六合成消防技术有限公司，经北京市消防局、公安消防部门考核首批通过的具有正式一级消防技术服务资质的专业消防技术公司；属北京市消防协会会员单位。具备质监部门考核颁发的计量认证考核证书（CMA许可）和北京消防协会电检资信证书。配备了先进的检测仪器和专业工具，并拥有10名一级注册消防工程师、2名高级工程师和经验丰富的技术人员组成的专业检测队伍。经营优势：1、消防器材批发、维修中心；2、消防设施、电气防火检测中心；3、消防报警清洗、维保中心；通过我们不断的努力，依靠先进的科学技术和诚信务实的经营理念，全体员工团结奋进、共同致力于首都的消防安全防火工作，为建设现代化的城市做出自己的贡献，通过我们的服务为用户提供有效快速的消防安全技术保障。', '116.27582700000001', '39.936943999999997', '116.27582700000001', '39.936943999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3897', '北京特洁特清洗保洁服务中心', '499', '石海燕', '13241311508', '黄自立', '15901259826', '2007年09月05日', '', '北京市', '北京市', '丰台区', null, '丰台区五里店路189号', '北京市', '北京市', '朝阳区', '平房地区办事处', '平房乡亮马厂村229号', '', '烟道清洗', '个人独资企业', '2007年09月05日', '长期', '', '', '', '91110106666936198H', '', '清洗保洁服务；家庭服务；接受委托提供劳务服务；翻译服务；电脑图文设计；技术服务、技术咨询；信息咨询（中介除外）。【经营范围中未取得专项许可的项目除外】（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本中心现有一支高素质的专业技术施工人员及具有丰富管理经验的员工队伍，规范化、人性化的企业环境使他们更加诚信、更加敬业、更加热忱，定期的业内行家的培训与指导，使他们更加专业化、更加标准化，从而使他们能够胜任各种场所的施工及现场指挥工作。\r\n主要经营企事业单位的排油烟管道系统清洗，厨房设备维修保养,新装修工程开荒，高空外墙清洗，清洗沙发、地毯，大理石、花岗岩结晶、翻新及养护，社区、大厦物业、办公楼的日常保洁。\r\n公司以“服务社会、美化环境、低碳环保”为目的，以服务规范化、管理人性化、安全优质化，崇尚并贯彻顾客是上帝，以赢得客户的满意为我们不断努力的追求为服务宗旨，始终如一的坚持“诚实、守信、规范、高效”的企业精神，使公司在清洗技术服务领域里独树一帜、成为行业标杆。公司现有专业清洗人员20余人，随着公司不断成长壮大，将成为京城清洗行业一支强大的技术力量。\r\n\r\n\r\n\r\n\r\n\r\n                                           北京特洁特清洗保洁服务中心', '116.258653', '39.855690000000003', '116.531741', '39.926096000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3898', '北京勃顺兴劳务服务有限公司', '498', '周海顺', '13910626889', '周海顺', '13910626889', '1999年07月19日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区金盏乡小店村', '北京市', '北京市', '朝阳区', '金盏地区办事处', '北京市朝阳区金盏乡小店村', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1999年07月19日', '2019年07月18日', '2018/4/8', '2019/4/7', '京消协（2018）证字1034号', '91110105700375938C', '', '劳务服务；家居装饰；电脑图文设计；打字；彩扩；组织展览展示活动；组织文化艺术交流活动；维修家用电器；油烟管道清理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于1999年，自成立以来不断研究探索，开拓进取，自行研制了一些专业工具，积累了很多的丰富经验和先进技术方法，为客户提出了很多的合理化建议，本公司有足够的专业技术人员，有固定良好的办公场所，有状况良好的办公车辆和施工车辆做保障，收到了较多客户的好评。', '116.568777', '40.011595999999997', '116.568777', '40.011595999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3899', '北京建和兴业电气防火安全检测中心', '497', '朱凌波', '13901370463', '谢辉', '15010516223', '2003年02月26日', '800万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰体北路5号1幢410室', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区丰体北路5号1幢410室', '', '消防设施,电气防火', '集体所有制（股份合作）', '2003年02月26日', '长期', '2018/11/26', '2019/11/25', '京消协（2018）证字392号', '91110106747514253Q', '', '电气防火检测；消防设施检测；技术开发、技术服务、技术咨询；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京建和兴业电气防火安全检测中心是一家为社会提供专业电气消防安全检查服务的特殊性企业，是由北京市消防局、消防协会统一领导和管理，由北京市工商行政管理局颁发营业执照，北京市物价局确定收费标准，具有电气消防安全检测资格的专业公司，我公司现已通过ISO9000质量管理体系认证并取得国家法定机构颁发的计量认证证书、消防技术服务机构临时一级资质、电气防火检测技术服务机构资信证书。公司拥有一批中、高级专业技术人才，从国内外引进当今世界先进的红外热像仪、红外点温仪、现代超生探测仪等设备，使检测工作达到程序化、现代化、科技化。\r\n本公司在执行《北京市电气防火检测技术规范》等有关技术标准的前提下，提供对企业事业单位、机关团体、住宅楼、各种公共娱乐场所、展览、展销场所的电气防火检测、消防设施检测、消防设施维护保养、维修消防器材、消防安装工程，科学、准确的反映检测现场的真实情况；以检测数据进行准确分析并出具完整的技术检测报告，真实准确的预测电气消防设备隐蔽工程中的火灾隐患所在部位和危险程度，为有效预防和减少电气消防火灾隐患提供科学依据，起到保驾护航的作用。', '116.27947', '39.868639999999999', '116.27947', '39.868639999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3900', '北京华安北海机电工程有限公司', '495', '张国玲', '87952265', '钟晓芳', '87952265', '1994年08月08日', '3500万元', '北京市', '北京市', '朝阳区', null, '永定门内东街中里9-17号楼274室', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '大郊亭中街2号华腾国际2号楼5层', '', '建筑防火', '有限责任公司（中外合资）', '1994年08月08日', '长期', '2018/10/30', '2019/10/29', '京消协（2018）证字345号', '911101016000153884', '', '专业承包（以工程设计与施工资质证书中审批的业务范围为准）；建筑物的消防系统、建筑智能化工程咨询、设计、施工、维修，销售自产产品；批发消防设备、消防器材及安全防范系列产品（涉及配额许可证管理、专项规定管理的商品按照国家有关规定办理）。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京华安北海机电工程有限公司成立于1994年，主要从事建筑物的消防、安防、智能系统工程咨询、设计、施工、维修以及国际消防品牌设备代理等业务。\r\n　　公司拥有中华人民共和国建设部核发的消防设施工程专业承包壹级资质、电子与智能化工程专业承包壹级、消防设施工程设计专项甲级、建筑智能化系统设计专项甲级资质、机电安装工程专业承包叁级资质，并通过了ISO9001:2015质量管理体系认证、ISO14001:2015环境管理体系认证、OHSAS 18001:2007职业健康安全管理体系认证，多年被政府部门评为守信企业和用户满意企业。\r\n　　公司原为武警系统的改制企业，大批的优秀专业人才转业留在企业。公司不仅拥有国内知名的消防、安防专家，还有一大批中青年国家级建造师和设计师及各层级专业技术人员，随时为客户提供专业的、全面的技术服务。', '116.48684799999999', '39.888238000000001', '116.48684799999999', '39.888238000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3901', '北京鑫诚佰顺保洁服务有限公司', '494', '刘长江', '13801283441', '王平', '13466329975', '2015年04月30日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区南新园中路106号西侧平房', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区南新园中路106号西侧平房', '', '烟道清洗', '有限责任公司（法人独资）', '2015年04月30日', '2035年04月29日', '2017/8/26', '2018/8/25', '京消协（2017）证字113号', '91110105339768887H', '', '清洁服务（不含餐具消毒）；家庭劳务服务；害虫防治服务；污染治理设施运营；销售日用品；城市生活垃圾清扫、收集、运输。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫诚佰顺保洁公司主要从事家庭、大型单位保洁，工程、家庭开荒保洁，外墙清洗、保洁，管道疏通，地毯清洗保养，石材翻新保养，地板保养、清洗、打蜡，地毯清洗，中央空调清洗，高空作业，家用空调移机、保养、维修，大型油烟机清洗，玻璃、窗帘、沙发清洗，大理石抛光打蜡，搬家等专项服务及托管服务，室内外开荒保洁等一系列保洁服务。\r\n北京鑫诚佰顺保洁公司既服务于各类商业企业，机关团体，建筑，装饰施工企业，同时也为千家万户提供优质，便捷的服务，致力于长期合作关系。\r\n北京鑫诚佰顺保洁公司从成立之初就确立了以顾客100%满意度为核心的经营理念，并将这一经营理念贯穿于公司组织架构、岗位设置、业务流程、管理制度、绩效管理之中。追求客户的绝对满意和为客户创造轻松、愉快、高品质的生活是本公司整个团队为之毕生奋斗的事业，为每个客户营造一个更清洁、亮丽的生活和工作环境而努力。', '116.466638', '39.868490000000001', '116.466638', '39.868490000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3902', '北京合安利达保洁服务有限公司', '493', '马建鲁', '13520079559', '马建鲁', '13520079559', '2008年09月28日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区金盏乡盏西大队村179号', '北京市', '北京市', '朝阳区', '金盏地区办事处', '北京市朝阳区金盏乡盏西大队村179号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2008年09月28日', '2028年09月27日', '2018/4/17', '2019/4/16', '京消协（2018）证字1071号', '91110105680457355X', '排油烟设施清洗机构', '清洁服务；经济贸易咨询；技术推广服务；会议服务；组织文化艺术交流活动（不含演出）；企管理业咨询；企业管理；销售日用品、办公用品、工艺品、五金交电、建筑材料；计算机、软件及辅助设备、装饰材料、电子产品；设计、制作、代理、发布广告；害虫防治服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司成立于2008年、位于朝阳区金盏乡，主要经营餐饮业排油烟管道清洗业务，有用专业的清洗队伍，本着质量优先、服务为本的优良传统。', '116.57245399999999', '40.006950000000003', '116.57245399999999', '40.006950000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3903', '北京国泰瑞安消防工程有限公司', '491', '胡红亮', '13901116159', '邱小方', '18600231169', '2008年11月26日', '15000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区郭公庄中街20号院3号楼8层809', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区郭公庄中街20号院3号楼8层809', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2008年11月26日', '2028年11月25日', '2018/7/6', '2019/7/5', '京消协（2018）证字221号', '91110106682884148D', '', '工程设计；专业承包；技术咨询；工程管理服务；会议服务；销售五金产品（不含电动自行车）、钢材、日用品、建筑材料、消防器材。（其中知识产权出资3500.万元；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京国泰瑞安消防工程有限公司组建于2008年11月26日，注册资金1亿5000万元。专业从事消防、建筑装饰装修工程设计与施工，电子与智能化工程和机电工程的施工，并提供相应的技术服务。目前拥有消防设施工程施工壹级、设计甲级－行业双甲资质，装饰装修施工壹级、设计乙级资质，电子与智能化工程施工壹级，机电工程施工壹级,建筑幕墙施工贰级，防水防腐保温工程施工二级，建筑工程施工总承包叁级资质，市政公用工程施工总承包三级，安防工程施工与设计壹级资质。公司自成立以来先后取得了ISO90001质量管理体系认证，ISO14001环境管理体系认证、OHSAS18001职业健康安装管理体系认证，坚持实行质量、环境，安全的三大方针。公司目前员工总人数130余人，其中拥有注册一级消防工程师3人，注册一级建造师30人，注册二级建造师10人，拥有电气、给排水、暖通、建筑智能化等各专业高级工程师15人，中级工程师29人，专业设计师8人，施工员、质检员、安全员等60余人，可独立完成各类消防、机电、装修、智能化工程的设计与施工任务。', '116.301286', '39.812973', '116.301286', '39.812973', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3904', '北京天赐金消防设备有限公司', '490', '马明霞', '13311291175', '李智东', '13311291175', '2013年04月11日', '2000万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区荣华南路16号1幢19层A座1902', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区荣华南路16号1幢19层A座1902', '', '消防产品', '有限责任公司（自然人独资）', '2013年04月11日', '2033年04月10日', '2018/1/4', '2019/1/3', '京消协（2018）证字010号', '911101060648526084', '', '专业承包；技术检测；工程设计；刻制公章；销售消防设备、机电设备、机械设备、通讯设备、软件及辅助设备、计算机、安防电子产品、交通设施、建筑材料、五金交电（不含电动自行车）、文具用品、日用品、化工产品（不含化学危险品）、厨房用具、卫生间用品、体育用品、仪器仪表、电线电缆；技术开发、技术咨询、技术服务、技术转让；维修消防设备；施工总承包。（企业依法自主选择经营项目，开展经营活动；刻制公章、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天赐金消防设备有限公司，是经北京市消防局核准备案的消防专业公司，是北京市消防局定点的灭火器维修专业公司，为北京市消防协会会员单位，年检产品均已通过国家消防装备质量监督检测中心检测认定资质和公安部消防产品型式认可证书，并通过ISO9001: 2008质量管理体系认证。\r\n       公司主要以销售消防器材，交通设施，安防产品，防火门系列，防火卷帘门系列等。消防设施检测、维修、年检，电气防火检测、应急广播系统消防检测、消防电梯消防检测、火灾探测器清洗、消防工程施工、安防监控施工、楼宇自控、防火阻燃及钢结构防火涂料喷涂、气体灭火系统、火灾自动报警系统及自动喷淋系统等维修保养服务为一体的消防实体企业。\r\n       公司奉行以用户利益高于一切为己任,以科技为手段、“质量第一，信誉第一”为方针，为广大用户提供性能全面、价格惠廉、质量更好、服务周到、快速发货，同时提供我们团队精诚、专业、技术力量雄厚、最完善的售后服务保障体系，保证用户的最大利益，热诚欢迎各方宾客前来惠顾。', '116.517961', '39.784629000000002', '116.517961', '39.784629000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3905', '国琳（天津）科技有限公司北京分公司', '489', '周庆念', '010-53561006', '葛毅', '13520063962', '2018年09月14日', '', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路188号总部基地十八区21号楼1至11层101内7层702室', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路188号总部基地十八区21号楼1至11层101内7层702室', '', '消防产品', '有限责任公司（自然人投资或控股）', '2018年09月14日', '长期', '', '', '', '91110106MA01ELXCXP', '', '技术开发、技术服务、技术推广。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '国琳（天津）科技有限公司是一家现代化创新型管道产品制造商，是卡环式内外涂塑管道系统的开创者，致力于用科技创新推动管材及管件的转型升级，推进管道系统由“制造” 转向“创造” 。 \n    国琳卡环式内外涂塑管道系统拥有国家专利证书。先进的卡环式连接结构，为传统连接方式带来革命，安装更为快捷、使用更为可靠。内外涂塑工艺填补了传统碳钢、塑料管道在安全性和使用寿命上的短板，同时也弥补了不锈钢、铜质管道价格上的劣势。\n  秉承正直、进取、务实、高效的理念，国琳希望以创新和技术为核心竞争力，成为全球流体输送领域的标准制定者，让流体输送变得更加安全、环保、高效。\n    国琳——真芯 · 做好管', '116.291847', '39.820205999999999', '116.291847', '39.820205999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3906', '北京华信达消防工程有限公司', '488', '杨启生', '13661383424', '李腾', '13811814863', '2018年07月20日', '3000万元', '北京市', '北京市', '朝阳区', null, '北京市房山区良 乡凯旋大街建设路18号-E 810', '北京市', '北京市', '朝阳区', '大屯街道', '北京市朝阳区芍药居北里101号世奥中心A座1008室', '', '建筑防火,消防设施', '有限责任公司（自然人独资）', '2018年07月20日', '2048年07月19日', '', '', '', '91110111MA01DLLD6Ⅹ', '', '施工总承包、专业承包、劳务分包；消防安全技术服务、技术咨询（中介除外）；销售电子产品、机电设备、建筑材料、五金（不含电动自行车）、消防设备；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华信达消防工程有限公司是专业从事电气防火安全及建筑消防设施检测，消防技术服务，消防系统维护保养的公司。 公司拥有北京市质量技术监督局颁发的计量认证证书，北京市公安消防总队颁发的消防技术服务机构一级资质证书，北京消防协会颁发的电气防火检测技术服务机构资信证书，公司现有高级、中级工程师，中级技术人员40多人。拥有多支经验丰富的专业检测队伍和国内外最先进的电气及消防设施检测设备。公司已通过质量管理体系、环境管理体系、职业健康安全管理体系认证。 公司严格执行国家及北京市相关技术规范，自觉遵守行业自律规则，严格内部管理，努力提高从业人员素质，不断完善质量保证体系，全心全意为客户提供优质的消防设施检测服务和电气防火检测服务，为客户和消防监督机关提供详细、客观、科学、公正、真实的检测报告。 公司将始终以诚信赢得商机、专业铸就品质的企业精神和对质量精益求精、对服务尽善尽美的服务宗旨，长期致力于为客户提供高科技消防安全产品和全方位的消防安全服务。', '116.43130600000001', '39.988224000000002', '116.43130600000001', '39.988224000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3907', '中国中安消防安全工程有限公司', '486', '李炜', '010-68167795', '王怡轩', '010-68167948-6605', '1988年02月25日', '3000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区复兴路33号翠微大厦写字楼七层C段', '北京市', '北京市', '海淀区', '羊坊店街道', '北京市海淀区复兴路33号翠微大厦写字楼七层C段', '', '建筑防火,消防设施', '有限责任公司（法人独资）', '2005年07月26日', '2025年07月25日', '2018/8/29', '2019/8/28', '京消协（2018）证字283号', '91110108100007373N', '', '承包各类消防、安全工程（包括勘察、设计、施工、安装、调试、维修）和建筑装修；消防、安全器材及建筑五金的销售和售后服务；消防、安全工程和建筑装修的工程咨询、技术咨询和技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '中安公司承包各类消防工程（包括勘察、设计、施工、安装、调试、维修），从事消防器材的销售及售后服务。同时，开展与主营业务有关的工程咨询和技术服务。获得国家建设部颁发的《消防设施工程专业承包壹级》、《消防设施专项工程设计甲级》双甲资质证书。', '116.303904', '39.908237999999997', '116.303904', '39.908237999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3908', '北京胜华消防科技有限公司', '485', '刘景周', '18611132119', '宋耀东', '13910048119', '2014年09月15日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区金星路12号院3号楼8层0910', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '北京市大兴区金星路12号院3号楼8层0910', '', '消防设施', '有限责任公司（自然人投资或控股）', '2014年09月15日', '2034年09月14日', '2018/3/19', '2019/3/18', '京消协（2018）证字061号', '91110115317921908L', '', '消防产品科技开发；技术服务；销售社会公共安全产品、消防设备、消防器材、安全技术防范产品、日用品、文化用品、交通设施、建筑材料、医疗器械（限Ⅰ类）、五金产品(不含电动自行车)；维修消防器材；技术检测；清洁服务；教育咨询（不含出国留学咨询及中介服务）；施工总承包；专业承包；组织文化艺术交流活动（不含演出）工程勘察；工程设计；保安培训。（企业依法自主选择经营项目，开展经营活动；保安培训、工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京胜华消防科技有限公司，是一个综合性消防服务公司，公司拥有雄厚的技术力量，秉承全新的管理理念，充分发挥自身优势，树立良好社会形象，创造业内佳绩。胜华消防公司主要从事高标准居家消防设备，家庭报警、灭火、自救逃生设备，消防设备的维修保养，消防器材销售，气体灭火设备的设计和安装，消防报警盖章安装调试，保证满足用户对产品质量和服务的要求。', '116.34957199999999', '39.762453000000001', '116.34957199999999', '39.762453000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3909', '北京建锋消防工程有限公司', '484', '刘建锋', '15010192234', '刘建锋', '15010192234', '2015年01月26日', '1000万元', '北京市', '北京市', '密云区', null, '北京市密云区信远大厦3段3层316室-236', '北京市', '北京市', '密云区', '密云镇', '北京市密云区大唐庄工业园5号', '', '建筑防火,消防设施,灭火救援,消防产品', '有限责任公司（自然人投资或控股）', '2015年01月26日', '2035年01月25日', '', '', '', '91110228330287964Y', '', '专业承包；劳务分包；技术服务、技术转让、技术开发、技术推广、技术咨询；销售消防器材、家用电器、电子产品、化工产品（不含危险化学品及易制毒品）、文化用品、卫生用品、鞋帽、针纺织品、五金交电（不含电动自行车）、灯具、卫生间用具、专用设备、通用设备、电气机械、金属材料（不从事实体经营）、机械设备、仪器仪表、入侵探测器、防盗报警控制器、报警系统出入口控制设备、机械防盗锁、防盗安全门、防弹复合玻璃、报警系统视频监控设备；会议服务；承办展览展示活动；经济贸易咨询；机械设备租赁；道路货物运输。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京建锋消防工程有限公司成立于2015年1月26日，注册资本1000万元，总部位于北京市密云区信远大厦3段3层，主要以建筑消防工程、建筑消防设施检测、建筑消防设施维护保养，并多方面开展其他业务，经过多年的发展，现已发展为专业的建筑消防工程与建筑智能化建设服务型企业。 \n本公司主要从事建筑消防工程施工、维护管理、设计，建筑消防设施检测，并开展机电安装工程及系统集成服务，为工程项目提供适用的解决方案和技术支持。', '116.85051799999999', '40.37679', '116.822039', '40.393856999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3910', '北京白云消防工程服务有限公司', '482', '黄永超', '13718984805', '黄永超', '18611685874', '2015年04月01日', '1000万元', '北京市', '北京市', '密云区', null, '密云区鼓楼东大街山水大厦3层313室', '北京市', '北京市', '密云区', '鼓楼街道', '密云区鼓楼东大街山水大厦3层313室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年04月01日', '2045年03月31日', '2018/4/17', '2019/4/16', '京消协（2018）证字1067号', '91110228339687622M', '排油烟设施清洗机构', '专业承包、劳务分包；工程勘察设计；物业管理；技术开发、技术转让、技术服务；计算机技术培训；家庭劳务服务；租赁建筑工程机械、建筑工程设备；建筑物清洁服务；维修消防器材；零售建筑材料、仪器仪表、机械设备、五金交电、化工产品（不含危险化学品及易制毒品）、日用杂货、办公用文具、厨房用具、防盗报警控制器、消防器材；经济贸易咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京白云消防工程服务有限公司经,北京市消防局消防协会考核审批的一家可提供多方位技术服务的专业公司，从事厨房烟道深度清洗、安防监控、物业保洁、工程开荒、外墙清洗，石材保养、地毯清洗，等多项综合性服务。\n    公司引进国内外多项具有较高科技含量的工程及清洁技术，建立起一套行之有效的运行管理及技术保障体系，公司所有外勤人员均为有着多年经验的工人组成，有激情，有干劲，做事精细、高效。目前公司为全市多家客户提供专业化的相关技术服务，客户类型包括：酒店、医院、部队、国家机关、餐饮酒楼等。公司的优质服务，获得客户和有关方面的良好赞誉，公司各项业务稳步向前发展。\n    公司坚持：诚信（至诚至信，以优质的服务达到您的满意）、厚德（德为人之本、企业之本）、精细（所有项目精耕细作）的经营理念，务求把工作做到实处，为了更好的为客户服务，公司制定了“六不”标准：不夸大项目难度，不避讳个人及企业不足，不虚报项目报价，不放过任何项目的任何细节，不夸张效果，不乱摊乱收项目结算款。\n    公司目前正在业务扩张期，公司将会以比同行业更完善、精细、优质的服务，更优惠实在的价格来回馈新老客户，北京白云消防工', '116.864069', '40.376773999999997', '116.864069', '40.376773999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3911', '北京厨瑞达厨房设备有限公司', '481', '宋红兴', '18811040938', '宋红兴', '18811040938', '2012年02月20日', '2000万元', '北京市', '北京市', '延庆区', null, '北京市延庆区延庆镇京张路口南（化肥库）2幢12号', '北京市', '北京市', '延庆区', '延庆镇', '北京市延庆区延庆镇京张路口南（化肥库）2幢12号', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年02月20日', '2062年02月19日', '', '', '', '91110229590647399C', '', '销售厨房用具、家用电器、五金、交电、机械设备、消防器材、日用品、文化用品、建筑材料、家具；维修家用电器；社会经济咨询（投资咨询除外）；清洁服务；城市园林绿化施工；道路货物运输；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；道路货物运输、城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京厨瑞达厨房设备有限公司（以下简称公司）成立于2012年，法人代表：宋红兴。坐落于北京市延庆区延庆镇京张路口南（化肥库）2幢12号。\n       本公司是一家专业从事中西餐商用厨房设备为主的销售商贸型企业，主要为餐饮、酒店、部队、学校、工厂、机关、超市、食品加工企业、中央厨房等厨房系统提供成套设备的设计、供应、安装与售后等一站式解决方案。\n       公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断创新、不断超越，通过自身丰富的行业专业知识、无与伦比的全球采购整合资源使我们已经成长为中国厨具行业的引导者，产品以细节完美而著称，凭借其追求卓越品质的极致要求领军国内厨具市场。我们为您提供商用厨房星级一体化解决方案使您的厨房占得先机为您的经营赢在起跑线上。全球签约为您提供360度无忧服务免除您的后顾之忧，您的满意就是我们的追求！欢迎新老朋友与我们联系，我们将本着为用户提供最优质产品、最周到服务的宗旨，竭诚助您成功！', '116.002818', '40.461044000000001', '116.002818', '40.461044000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3912', '北京视觉保洁服务有限公司', '480', '黄建民', '15811351658', '黄建民', '15811351658', '2012年12月06日', '50万元', '北京市', '北京市', '昌平区', null, '北京市昌平区东小口镇白坊村东利康虹桥新发服装百货市场内8号', '北京市', '北京市', '昌平区', '北七家镇', '北京市昌平区东小口镇白坊村东利康虹桥新发服装百货市场内8号', '', '烟道清洗', '有限责任公司（自然人独资）', '2012年12月06日', '2062年12月05日', '2018/3/31', '2019/3/30', '京消协（2018）证字1058号', '9111011405927484XJ', '排油烟设施清洗机构', '家庭劳务服务；洗车服务；技术开发；经济信息咨询（不含中介服务）；设计广告；承办展览展示；租赁机械设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', null, '116.443854', '40.070149999999998', '116.443854', '40.070149999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3913', '北京桑迪餐饮娱乐管理有限公司', '478', '章李成', '18911581518', '杨文广', '13811359413', '2013年05月31日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区工体西路6号二层北区部分', '北京市', '北京市', '朝阳区', '三里屯街道', '北京市朝阳区工体西路6号二层北区部分', '', '消防产品', '有限责任公司（自然人投资或控股）', '2013年05月31日', '2033年05月30日', '', '', '', '911101050695565097', '', '餐饮管理；会议及展览服务；组织文化艺术交流活动；酒店管理；物业管理；企业管理咨询；销售工艺品、电子产品、日用品、文具用品、机械设备；冷热饮服务（食品经营许可证有效期至2021年08月29日）；歌舞娱乐；文艺表演；零售烟草。（企业依法自主选择经营项目，开展经营活动；文艺表演、歌舞娱乐、零售烟草以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', 'ONE THIRD是耗资4500万，斥重金邀请荷兰TOMORROWLAND音乐节视觉团队LiveLegend打造的全新娱乐品牌。国际化、年轻化、尊重音乐是ONE THIRD品牌调性。在这里，不用在乎这个世界强加于你的一切标签，年轻、自由、平等的消费理念，是ONETHIRD团队坚持打造的现场体验。', '116.444226', '39.929800999999998', '116.444226', '39.929800999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3914', '北京派尔德教育科技有限公司', '477', '师海维', '13581670842', '龚峰强', '13581670842', '2017年04月14日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北苑东路19号院3号楼4层413', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区北苑东路19号院3号楼4层413', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2017年04月14日', '2037年04月13日', '', '', '', '91110105MA00DJA465', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；软件开发；教育咨询（不含出国留学咨询及中介服务）；承办展览展示活动；会议服务；组织文化艺术交流活动（不含演出）；企业管理咨询；出版物零售。（企业依法自主选择经营项目，开展经营活动；出版物零售以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京派尔德教育科技有限公司于2017年4月挂牌成立，是一家专注于注册消防工程师考前辅导的专业化培训机构，从2017年起该公司围绕“以学员为中心，以拼搏者为本”的教学理念展开服务，积极配合国家《注册消防工程师管理规定》《公安部61号令》和《129号令》等相关规划，应用“互联网+消防”的模式将优质的学习方式传输给广大学员。截至目前，公司所聘请的教研组老师涉及多个专业领域，包含：一级注册消防工程师、建筑师、给排水工程师、强弱电工程师、建造师、安全工程师、深入到消防考试所涉及的各个领域，共招生参与培训人员高达6000于人，为天津、广东、四川、山东等消防维保企业直接输送了大量的相关技术人才', '116.44053700000001', '40.041465000000002', '116.44053700000001', '40.041465000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3915', '北京中炬启航教育科技发展有限公司', '476', '徐珠蓉', '01084714008', '宋威', '18831657109', '2018年01月17日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区物流园六街12号3幢三层301', '北京市', '北京市', '顺义区', '南法信地区办事处', '北京市顺义区物流园六街12号3幢三层301', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2018年01月17日', '长期', '2018/6/8', '2019/6/7', '京消协培证字（2018）007号', '91110113MA01A1E397', '社会消防安全培训机构', '技术推广、技术开发、技术咨询、技术服务、技术转让；技术检测（不含认证、认可）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中炬启航教育科技发展有限公司于2018年1月经北京市工商行政管理局批准依法注册成立，具有独立法人资格。2018年6月正式获得北京消防协会授予的第二类社会消防安全培训机构资质，北京同类资质培训学校共计五家，顺义区仅此一家。\r\n        我公司硬件满足《社会消防安全培训机构设置与评审》国家标准的相关要求，配有消防知识查询台、室内外消火栓模拟装置、自动喷水灭火系统、电气火灾演示系统、火灾逃生模拟疏散系统、烟热训练室等专业培训设施和设备，多功能授课教室，技能实操教室等设施。\r\n        我公司聘请原武警学院副教授杨迎为校长，原北京房山消防支队高工李琳为副校长，依托中国人民警察大学（原中国人民武装警察部队学院，即武警学院）教师团队、北京市各消防支队高级工程师等优质师资力量，从事消防基础知识、建筑防火、消防设施、电气防火、消防管理、灭火指挥等学科的教学。我公司根据客户需求，量身打造专项课程，为政府机关、社区、校园仓库物流企业员工、餐饮企业员工、大型企事业单位进行消防安全培训及应急预案和演练的打造。', '116.590644', '40.123660000000001', '116.590644', '40.123660000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3916', '北京天瑞恒保洁服务有限公司', '472', '潘恒军', '13522173786', '潘恒军', '13522173786', '2015年11月25日', '80万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山大件路（集联北区）2号楼二层B区7068', '北京市', '北京市', '房山区', '阎村镇', '北京市房山区燕山大件路（集联北区）2号楼二层B区7068', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年11月25日', '2035年11月24日', '', '', '', '91110106MA00241R6U', '', '技术开发、技术推广、技术服务、技术转让；清洁服务（不含洗衣、洗车、清洗、消毒）；劳务服务；婚庆服务；会议服务；企业管理；物业管理；园林绿化服务；绿植摆租；承办展览展示；技术检测；病虫害防治；销售清洁用品、文具用品、办公用品、日用品、机电设备、服装鞋帽、化妆品。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京天瑞恒保洁服务有限公司成立于2015年，主要从事酒店、餐饮、食堂油烟管道清洗。业务涵盖北京、天津、河北等地。\r\n业务范围’：油烟管道清洗、油烟净化器清洗、清洗隔油池、化粪池等清洗。', '116.036868', '39.721935999999999', '116.036868', '39.721935999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3917', '北京卓屹方消防科技有限公司', '471', '卢朝阳', '13810277786', '包京京', '18612760151', '2013年03月12日', '450万元', '北京市', '北京市', '东城区', null, '北京市东城区珠市口东大街11号四层412', '北京市', '北京市', '东城区', '崇文门外街道', '北京市东城区珠市口东大街11号四层412', '', '消防安全评估,宣传教育培训,消防设施,烟道清洗,消防产品', '有限责任公司（自然人投资或控股）', '2013年03月12日', '2033年03月11日', '', '', '', '911101060627544730', '', '技术检测、技术推广、技术开发、技术服务、技术咨询；销售机械设备、消防器材、化工产品（不含危险化学品）；清洁服务；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京卓屹方消防科技有限公司是由北京消防局审核批准的企业，具有消防设施工程专业承包贰级资质，专业从事各类消防工程、消防设施的维修与保养，以及灭火器的销售维修与保养；可以为业主提供工程前期消防规划与设计，以及相关的消防方面的技术服务；公司可以承接钢结构防火涂料喷涂、防火封堵等业务。', '116.408665', '39.893174000000002', '116.408665', '39.893174000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3918', '北京中德启锐安全设备有限公司', '470', '马达伟', '13051093290', '姚婷婷', '18010110668', '2004年01月14日', '1500万元', '北京市', '北京市', '房山区', null, '北京市房山区阎村镇大董村西街119号', '北京市', '北京市', '房山区', '阎村镇', '北京市房山区阎村镇大董村西街119号', '', '消防安全评估,建筑防火,宣传教育培训,消防信息化,消防设施,消防产品,消防安全检查,电气防火', '有限责任公司（自然人投资或控股）', '2005年05月10日', '2025年05月09日', '2018/11/9', '2019/11/8', '京消协（2018）证字352号', '91110304758231347H', '电气防火检测技术服务机构', '销售仪器仪表、家用电器、建筑材料、电子产品、电子元器件、计算机软硬件及辅助设备、日用杂品、安全技术防范产品、社会公共安全设备及器材；技术开发、技术咨询（中介除外）、技术转让、技术服务；电子产品技术开发；电脑动画设计、承办展览展示；建筑消防设施检测技术服务；电气防火检测技术服务；技术检测服务；维修消防设施、安全防范用品；网络技术服务；家庭劳务服务；货物进出口（国营贸易管理货物除外）；安全技术咨询、教育咨询（中介除外）；消防安全评估；维修消防器材；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中德启锐安全设备有限公司成立于2004年，注册资金1500万元，北京市消防协会理事会员单位之一，具备消防技术服务消防设施检测维保一级资质，消防安全评估二级资质。中德启锐现有员工58人，拥有一批技术精湛、经验丰富、服务一流的技术工作人员，其中国家一级 注册消防工程师15名，中级工程师4名，建构筑物消防员11人建模工程师、UI设计工程师、程序开发工程师、硬件工程师等消防教育产品开发团队5人。公司始终坚持致力于包括消防技术咨询、消防工程施工、消防器材设备销售；消防设施和电气检测、消防设施维护保养；建筑消防安全评估及性能化设计，消防安全科普教育建馆产品研发、消防安全培训服务等消防安全综合业务的开拓推广，为您提供优质、专业、科学、高效的消防安全服务。我们将始终坚持以“技术源于实力，服务源于真诚，创新源于追求”的企业精神，致力于消防安全运营服务产业的发展、明确专业定位、构建消防安全行业全产业链生态系统的平台公司。全力打造消防安全运营商服务模式，成为具有社会价值的消防安全服务行业领军企业。', '116.053754', '39.715995999999997', '116.053754', '39.715995999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3919', '准信智慧消防股份有限公司', '469', '李杰', '18600188585', '侯颖', '18600188585', '1998年03月23日', '6660万元', '北京市', '北京市', '西城区', null, '北京市西城区西外大街1号西环广场2号楼19层', '北京市', '北京市', '西城区', '新街口街道', '北京市西城区西外大街1号西环广场2号楼19层', '', '消防设施,消防产品', '法人商事主体【股份有限公司（非上市、自然人投资或控股）】', '1998年03月23日', '长期', '', '', '', '91350200612034447X', '', '消防安全评估；消防设施维护、保养、检测；专业化设计服务；其他未列明专业技术服务业（不含需经许可审批的事项）；电气安装；管道和设备安装；其他建筑安装业；提供施工设备服务；未列明的其他建筑业；信息技术咨询服务；其他未列明信息技术服务业（不含需经许可审批的项目）；服装批发；鞋帽批发；纺织品、针织品及原料批发；化妆品及卫生用品批发；厨房、卫生间用具及日用杂货批发；家用电器批发；汽车零配件批发；金属及金属矿批发（不含危险化学品和监控化学品）；其他化工产品批发（不含危险化学品和监控化学品）；摩托车及零配件批发；五金产品批发；电气设备批发；计算机、软件及辅助设备批发；摩托车及零配件零售；其他机械设备及电子产品批发；汽车零配件零售；日用家电设备零售；其他电子产品零售；计算机、软件及辅助设备零售；五金零售；工程管理服务；建设工程勘察设计。', '消防安全评估；消防设施维护、保养、检测；专业化设计服务；其他未列明专业技术服务业（不含需经许可审批事项）；电气安装；管道和设备安装；其他建筑安装业；提供施工设备服务；未列明的其他建筑业；信息技术咨询服务；其他未列明信息技术服务业不含需经许可审批事项）；电气设备批发；其他机械设备及电子产品批发；工程管理服务；建设工程勘察设计等。', '116.35246600000001', '39.941692000000003', '116.35246600000001', '39.941692000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3920', '北京市双节京诚油烟管道清洗有限公司', '468', '乔书岭', '13811870730', '乔书岭', '13811870730', '2006年07月26日', '10万元', '北京市', '北京市', '丰台区', null, '北京市丰台区星火路1号3A1-3室（园区）', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区星火路1号3A1-3室（园区）', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2006年07月26日', '2026年07月25日', '', '', '', '9111010679161258XN', '', '清洗保洁服务；技术检测；专业承包；销售机械设备、厨房用具；产品设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市双节京诚油烟管道清洗有限公司成立于2006年7月，是一家专业清洗公司。公司主营业务是清洗保洁，厨房设施设备清洗、维修服务；楼宇保洁服务等。\r\n          我们的服务对象包含党政机关、单位，院校、医院，宾馆、饭店，餐厅、物业公司等，业务区域覆盖京、津、冀、地区。\r\n\r\n“京诚油烟清洗”公司通过了ISO9001质量管理体系、ISO14001环境管理体系和职业健康安全管理体系的认证。', '116.28527', '39.834474999999998', '116.28527', '39.834474999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3921', '北京春光好环保科技有限公司', '467', '张立平', '18601366306', '徐建强', '18515502528', '2019年03月12日', '1000万元', '北京市', '北京市', '平谷区', null, '邑上原著31号楼3单元101', '北京市', '北京市', '平谷区', '兴谷街道', '邑上原著31号楼3单元101', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年03月12日', '长期', '', '', '', '91110117MA01HMDDXA', '', '技术推广服务；专业承包；建筑物清洁服务；保洁服务；设计、制作、代理、发布广告；销售五金交电（不含电动自行车）、环保设备、厨房设备、机电设备；园林绿化工程施工；汽车租赁（不含九座以上客车）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京春光好环保科技从事酒店、餐厅、食堂油烟管道清洗服务，业务涵盖北京、天津、河北等地。我公司致力于油烟道清洗技术的开发和实践，个性化的服务模式及专业的清洗技术融为一体，公司拥有一流的做专业服务队伍，针对部分油烟管道的复杂性，研制出异型的清洗方法。公司以诚信的服务，周到的服务为宗旨。', '117.104191', '40.154612999999998', '117.104191', '40.154612999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3922', '北京励拓新安安全防范技术有限公司', '464', '刘立新', '13701215752', '刘红琳', '13521373928', '2012年02月15日', '550万元', '北京市', '北京市', '石景山区', null, '古城大街（特钢公司厂内）北京国际汽车贸易园区F区16号九层926室', '北京市', '北京市', '石景山区', '古城街道', '古城大街（特钢公司厂内）北京国际汽车贸易园区F区16号九层926室', '', '消防安全评估,消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2012年02月15日', '2032年02月14日', '2018/10/30', '2019/10/29', '京消协（2018）证字329号', '91110108590658311P', '电气防火检测技术服务机构', '技术检测、技术服务、技术咨询；消防技术服务、技术开发、技术咨询；物联网技术服务；维修消防器材、安全技术防范产品；销售消防器材；消防安全评估；电子与智能化系统技术服务；弱电系统技术服务；建筑消防设施技术服务；建筑消防设施检测技术服务；电气防火检测技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京励拓新安安全防范技术有限公司是经北京市消防局、北京市工商局批准成立依法注册的有限公司。经营范围：技术检测；技术服务、技术咨询；消防安全评估。\r\n我公司于2014年6月28日通过北京市消防局和北京市质量技术监督局联合监督评审实验室计量认证（CMA），并于2017年5月24日正式通过CMA复评审。\r\n企业优势：我公司拥有自主开发的励拓新安服务平台，通过设备物联技术手段，实现7*24小时不间断的贴身管家服务系统。', '116.181269', '39.917065000000001', '116.181269', '39.917065000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3923', '北京安舒保洁服务有限公司', '463', '田苏华', '13691021982', '徐云龙', '15901560892', '2001年08月01日', '50万元', '北京市', '北京市', '通州区', null, '北京市通州区富河园15号楼', '北京市', '北京市', '通州区', '永顺地区办事处', '北京市通州区富河园15号楼', '', '烟道清洗', '有限责任公司（自然人独资）', '2001年08月01日', '2051年07月31日', '2018/3/20', '2019/3/19', '京消协（2018）证字1046号', '91110112802433596N', '排油烟设施清洗机构', '保洁服务；下水管道疏通；建筑物清洁服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动）（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京安舒保洁服务有限公司是一家正规注册、实力雄厚、专业从事清洗与保洁的服务性公司。我公司拥有一批专业的管理人才和一支技术实力雄厚的员工队伍，在拥有多种先进清洗设备的基础上，为市内的饭店、商场、宾馆、写字楼、大厦及家庭等都提供了全方位的开荒保洁和清洗保洁。公司在管理上，注重员工素质的培养以及技术的提高，只有经过严格培训后的员工方能上岗。', '116.65348899999999', '39.927151000000002', '116.65348899999999', '39.927151000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3924', '北京云瀚清洁工程有限公司', '462', '姬霞', '13810377056', '刘国琴', '18610085597', '1997年07月02日', '600万元', '北京市', '北京市', '石景山区', null, '北京市石景山区古城大街75号院3号楼2层1单元201', '北京市', '北京市', '石景山区', '苹果园街道', '北京市石景山区实兴大街30号3号楼10层', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1997年07月02日', '长期', '2019/2/27', '2020/2/26', '京消协（2019）证字072号', '91110107102989403N', '', '建筑内外墙、玻璃、室内装饰物、油烟管道、机械设备的清洗、养护；园林绿化服务；与经营范围有关的信息咨询服务（涉及专项许可的除外）；保洁服务；建筑物清洁服务、机器和办公设备的清洗、厨房设备的清洗、房屋的清扫、清毒、害虫的防治服务；劳务派遣；中央空调清洗；销售机械电器设备、日用品；城市道路冲洗服务；公共厕所维护管理；城市生活垃圾清扫、收集、运输。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '云瀚集团是一家集物业管理、保洁服务、园林绿化工程及互联网家政平台服务于一体的大型综合服务企业。最早成立于1997年，现有四家子公司：北京云瀚物业管理有限公司、北京云瀚清洁工程有限公司、北京云瀚园林绿化工程有限公司、北京三个阿姨信息科技有限公司。总注册资金达2000余万元。\r\n  业务范围包含了物业管理、室内外日常保洁、工程开荒、户外高空清洗工程、户外墙面粉刷、石材翻新养护、地毯清洗、沙发清洗、各类地板上蜡养护、空调及油烟管道清洗、虫控消杀、园林绿化工程、绿化养护、绿植租摆及苗木草种销售、三个阿姨O2O家政服务平台等多项服务。市场领域涵盖了高端社区、交通枢纽、商场、宾馆、饭店、学校、工厂、医院、养老机构、写字楼、办公楼、医药食品生产基地、旅游风景区及市政道路等多种业态。\r\n  企业具备物业服务三级资质、清洗保洁服务壹级资质、城市园林绿化叁级资质、石材应用护理专业贰级资质、有害生物防制C级资质、高空清洗悬吊作业企业安全资质、厨房烟囱排油烟管道清洗服务资质、生活垃圾经营许可、企业信用3A等级证书等资质证书。并通过了SO9001:2015质量管理体系、ISO14001:2015环境管理体系、OHS', '116.186009', '39.908062999999999', '116.193512', '39.939461000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3925', '北京港洁物业管理有限公司', '461', '张弘扬', '13401115608', '米雪', '15210111455', '2001年08月12日', '110万元', '北京市', '北京市', '顺义区', null, '北京市顺义区临空经济核心区汇海南路1号院5号楼6层5-702', '北京市', '北京市', '顺义区', '李桥镇', '北京市顺义区临空经济核心区汇海南路1号院5号楼6层5-702', '', '消防安全评估,消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2001年08月12日', '2021年08月11日', '2018/10/30', '2019/10/29', '京消协（2018）证字333号', '91110113102568705J', '电气防火检测技术服务机构', '接受委托从事物业管理；家居装饰；保洁服务；绿化服务；室内空气检测；消防设备、安全技术防范产品、电气机械及器材的检测、维修（经营范围涉及国家专项审批的项目除外）；停车服务；接受委托提供劳务服务（不含对外劳务合作、排队服务）；劳务派遣。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2001年，注册资金1100万元，物业管理二级资质服务企业，北京市政府采购中心定点物业服务采购供应商。\r\n公司组织机构完善，现设置董事长、总经理、集团服务部、集团财务部、运营管理部、营销部、技术节能部、采购供应部和十个直线项目部。\r\n公司首先于2004年通过了ISO9001质量认证，使内部管理更加成熟化、规范化；同年公司又加入了中国消防管理协会，成为正式的荣誉会员；\r\n2005年公司成为北京市消防协会会员，成为了全国“唯一”具备消防、电气检测的消防管理企业；\r\n2006年底公司成功引入了“VI”视觉识别系统；\r\n2007年获得ISO9001-2000质量管理体系、GB/T28001-2001职业健康安全管理体系和GB/T24001-2004 idt ISO14001:2004环境管理体系认证；\r\n2009年对管理体系进行了升级，升级为ISO9001-2008版本。\r\n2010年通过了ISO10015:1999  GB/T19025-2001 培训管理体系认证。\r\n2013年被北京市总工会评为工人先锋号单位。\r\n2015年被首都文明办评为2013-2014年度首度文明单位。', '116.64138', '40.045352999999999', '116.64138', '40.045352999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3926', '北京雨洛恬环保科技有限公司', '458', '邱飞跃', '13671024196', '邱飞跃', '13671024169', '2016年05月27日', '100万元', '北京市', '北京市', '怀柔区', null, '怀柔区庙城镇庙城村十字街南320号', '北京市', '北京市', '昌平区', '东小口地区办事处', '昌平区东小口镇店上村15号', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年05月27日', '2046年05月26日', '2019/3/21', '2020/3/20', '京消协（2019）证字130号', '91110116MA005R796U', '', '技术开发、咨询、转让、服务；建筑物清洁服务；办公设备清洗服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京雨洛恬环保科技有限公司是一家具有独立法人资格的专业消防烟道保洁清洗公司，成立于2016年，公司从事技术开发、咨询、转让、服务，建筑物清洁服务，办公设备清洗等服务。开展经营活动。我公司成立以来，在烟道清洗行业中探究发现积累了充足的管理和施工经验，技术力量雄厚，设备齐全，练就了一支专业素质高，实践经验丰富的具有专业化管理水平和高素质的员工队伍。目前拥有经验丰富的老师傅20余人，技术工人若干。随着公司业务不断发展，壮大。不断完善和改进服务质量，并根据客户的实际情况以合理的价格为客户提供专业、高效的消防设施清洗、维护服务，得到了广大合作方的认可。', '116.634086', '40.291226999999999', '116.38137399999999', '40.067174999999999', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3927', '北京豫东信诚环保科技有限责任公司', '457', '刘卫珍', '13939441380', '张志伟', '15101691883', '2013年09月02日', '200万元', '北京市', '北京市', '丰台区', null, '北京市丰台区青塔西路甲1号万丰嘉信商务酒店6-23', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区青塔西路甲1号万丰嘉信商务酒店6-23', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年09月02日', '2033年09月01日', '2019/4/9', '2020/4/8', '京消协（2019）证字154号', '911101060785987944', '', '城市园林绿化；技术开发、技术服务；劳务服务；清洁服务；计算机系统服务；设计、制作、代理、发布广告；销售日用品、化妆品、清洁用品、文具用品。（领取本执照后，应到市园林绿化局取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京豫东信诚环保科技有限责任公司是一家专业从中央空调系统清洗、油烟管道清洗的服务型企业。为用户的中央空调系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供清洗的最优解决方案。\r\n公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成中央空调系统清洗全系列工作。\r\n我们丰富的经验可广泛服务于所有使用中央空调的场所，包括写字楼、宾馆、饭店、商场、学校、机关办公区等。\r\n您的健康是我们的责任，豫东信诚愿用自己的努力，为您提供一个洁净、健康、舒适的环境。为我们人类多留一片洁净的蓝天。', '116.26335899999999', '39.878126000000002', '116.26335899999999', '39.878126000000002', '', null, null, null, null);
