INSERT INTO `t_fc_company` VALUES ('3929', '北京百家修商贸有限公司', '454', '曹崛', '13501350923', '王宏洲', '13466610417', '2018年05月31日', '500万元', '北京市', '北京市', '昌平区', null, '北京市昌平区昌平镇鼓楼西街12号楼1至三层19', '北京市', '北京市', '昌平区', '城北街道', '北京市昌平区昌平镇鼓楼西街12号楼1至三层19', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2018年05月31日', '2048年05月30日', '', '', '', '91110114MA01CJF00N', '', '销售电子产品、日用品、家用电器、通讯设备、计算机、软件及辅助设备、机械设备、仪器仪表、音响设备、消防器材；技术开发、技术服务、技术转让、技术咨询、技术推广；设计、制作、代理、发布广告；建筑物清洁服务；专业承包；施工总承包；劳务分包；城市园林绿化服务；建设工程项目管理；电脑图文设计；房地产开发；物业管理；出租商业用房；出租办公用房；维修家用电器；人才中介服务。（企业依法自主选择经营项目，开展经营活动；人才中介服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '百家修品牌成立于2015年，以打造房屋全生命周期的服务平台作为企业的核心定位，通过O2O模式和互联网技术为用户提供更低的价格、更高品质的产品和更好的维修、装修服务。\r\n公司的两大核心服务内容：装修和维修。\r\n百家修的业务范围包括：针对家庭用户的家装、水电维修、家电清洁保养和维修服务；针对企业用户的工装、水电维修、专业设备清洁保养和维修、下水道疏通以及排油烟设施清洗服务。', '116.231065', '40.223985999999996', '116.231065', '40.223985999999996', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3930', '中消安（北京）消防工程有限公司', '453', '姜云', '13601360829', '姜云', '13601360829', '2005年01月06日', '800万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡北花园村花园中路花园金地写字楼B座一层113', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区高碑店乡北花园村花园中路花园金地写字楼B座一层113', '', '消防产品', '有限责任公司（自然人投资或控股）', '2005年01月06日', '2025年01月05日', '2019/3/6', '2020/3/5', '京消协（2019）证字089号', '911101057704229207', '', '专业承包；工程勘察设计；技术开发、技术转让、技术咨询、技术服务、技术检测；销售消防器材、社会公共安全设备及器材、机械设备、五金交电、文具体育用品、建筑材料、电子产品、通用设备、交通运输设备、日用品；清洁服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '中消安（北京）消防工程有限公司，成立于2005年，公司主要经销消防器材（设备），配合上级公司工程项目的后序服务，我们有一批高素质、技术过硬经验丰富的专业队伍，能够进行对产品从销售及售后做到讲质量、讲信誉、讲效率。承担灭火器的检修、维护和保养。我们始终坚持质量第一、客户至上的生产经营理念，对待客户，公司始终坚持“完美、适宜、快捷、保障、双赢”的宗旨。\r\n　　我们的团队坚持采用科学的管理方法，以人为本，诚信务实，制定了严格的质量保障体系及优质的售后服务措施。并以优质的产品和良好的服务，赢得了广大客户的赞誉和好评。\r\n　　公司已经走在迈向全球经济一体化的征程上，我们期待与您的合作，共铸更美好、更辉煌灿烂的明天。发挥各方面优势，积极采用先进技术和设备，坚持“客户第一、质量第一、信誉第一”的宗旨，发扬求实、拼搏、创新的企业精神，为用户提供及时、优质的服务。\r\n中消安（北京）消防工程有限公司愿以先进的技术和良好的信誉为八方朋友提供最优质的服务！为中国消防安全产业的发展作出微薄之力。', '116.55352600000001', '39.902428999999998', '116.55352600000001', '39.902428999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3931', '北京怡帆汇通清洗服务有限公司', '452', '谷占国', '13693354296', '史小峰', '18311097298', '2008年10月16日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区瀛吉街8号院3号楼15层1504', '北京市', '北京市', '大兴区', '瀛海地区办事处', '北京市大兴区瀛吉街8号院3号楼15层1504', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2008年10月16日', '2028年10月15日', '2018/6/8', '2019/6/7', '京消协（2018）证字175号', '91110115681220227X', '排油烟设施清洗机构', '清洁服务；销售洗涤用品、家庭用品、五金产品（不含电动自行车）、厨房设备；零售电子产品、机械设备、照明设备；维修厨房设备；零售消防器材；病虫害防治；保洁服务；技术咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京怡帆汇通清洗服务有限公司是一家油烟管道系统清洗服务型企业。为用户的清洗系统提供最优质的解决方案，是企业的宗旨。立志用最优的资源配备，最优的经营模式，最优的服务质量，为用户提供系统清洗的最优解决方案。\r\n       公司拥有一批专业的技术人才队伍，所有员工均经系统的专业技术培训，和严格的技术，职业素质考核。高素质的专业团队可确保高效，优质的油烟管道全系列工作服务。', '116.449923', '39.763109999999998', '116.449923', '39.763109999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3932', '北京安华元消防技术检测有限公司', '451', '席玉龙', '13910323527', '徐巧凌', '13801208647', '2014年01月07日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区高碑店乡北花园村花园中路花园金地写字楼A座113', '北京市', '北京市', '朝阳区', '三间房地区办事处', '北京市朝阳区高碑店乡北花园村花园中路花园金地写字楼A座113', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2014年01月07日', '2034年01月06日', '2018/3/6', '2019/3/5', '京消协（2019）证字088号', '91110105089656048J', '电气防火检测技术服务机构', '特种设备检验检测；建筑消防设施检测技术服务；电气防火检测技术服务；技术推广服务。（企业依法自主选择经营项目，开展经营活动；特种设备检验检测以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安华元消防技术检测有限公司是北京市消防协会审核批准的具有建筑消防设施检测、电气防火安全检测资格的企业。公司现有高级工程师2人，一级注册消防工程师10人，工程师2人，平均年龄三十五岁，检测人员均具有大专以上学历，有多年从事消防工作的经验。\r\n\r\n公司在组建初期，制定了适合本公司的服务方针、员工行为准则、人员培训制度、\r\n\r\n设备管理制度、检测工作程序、检测报告编审制度、检测档案管理制度等并在工作中严\r\n\r\n格按照各项规章制度执行，检测能力、专业水平及服务质量受到业界的一致好评，并\r\n\r\n成功的通过了IS09001质量管理体系认证。\r\n\r\n安华元公司领导层具有丰富的管理经验、先进的经营理念、极强的号召力和凝聚力，\r\n\r\n按照公司制定的长期发展规划，致力于将企业做大、做强;员工朝气蓬勃，年富力强，勇\r\n\r\n于学习进取；公司全员以领导层为核心，正在努力将安华元科技有限公司打造成适应消\r\n\r\n防行业发展的成名企业。\r\n\r\n安华元公司秉承科学、公正、客观、真实的质量方针，以热情周到的服务，诚信\r\n\r\n的企业信誉，诚交消防行业朋友，并愿意与各位朋友共同进步、发展。', '116.55352600000001', '39.902428999999998', '116.55352600000001', '39.902428999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3933', '北京阜达宏安系统工程有限公司', '450', '任东剑', '13810380576', '刘涛', '13581912805', '2000年06月20日', '6000万元', '北京市', '北京市', '通州区', null, '新华北街75号', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '大郊亭中街2号院华腾国际3号楼9A', '', '消防设施', '有限责任公司（自然人投资或控股）', '2000年06月20日', '长期', '2018/4/25', '2019/4/24', '京消协（2018）证字087号', '91110112700259021H', '', '消防工程设计、施工；建筑智能化工程设计施工；消防设备设施及建筑智能化设备设施维护；消防技术服务；销售消防及智能化设备、器材；技术开发、咨询、培训。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京阜达宏安系统工程有限公司成立于2000年06月20日，注册资金为 1500 万元，2017年07月12日增资至6000万元，经营范围包括消防工程专业承包施工；电子与智能化专业承包施工；消防设备设施及建筑智能化设备设施维护保养；消防技术服务；销售消防及智能化设备、器材；技术开发、咨询、培训。公司为北京消防协会单位会员，并经国家权威机构评定为企业资信等级AAA级企业。\r\n2006年我公司进行了ISO9000 国际质量管理体系认证，2007年又 取 得 了 ISO14001 ： 2004 环 境 管 理 体 系 和 T28001-2001 职业健康安全管理体系两项认证证书。2018年01月18日换版为ISO9001：2015、ISO14001： 2015，2016年9月24日取得了新版AAA企业信用等级证书。公司坚持以科学严谨的方法进行管理。\r\n公司最高决策层是董事会，实行总经理负责制。总公司设有市场部、产品销售部、工程部、技术部、质量安全部、预算合约部、采购供应部、售后服务部、人力资源部、行政商务部、财务部。公司自成立以来，在各方的友好合作下，先后完成了数百项重点消防工程。', '116.638953', '39.905445', '116.48618500000001', '39.888257000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3934', '北京市海淀区众安晓育消防职业技能培训学校', '449', '王阳', '13911255207', '李斌', '13810692510', '', '', '北京市', '北京市', '海淀区', null, '北京市海淀区高里掌路3号院17号楼3层301', '北京市', '北京市', '海淀区', '温泉地区办事处', '北京市海淀区高里掌路3号院17号楼3层301', '', '宣传教育培训', '', '', '', '2018/6/15', '2019/6/14', '京消协（2018）证字190号', '52110108MJ0252776P', '', '', '北京市海淀区众安晓育消防职业技能培训学校是由海淀区人力资源和社会保障局批准，经海淀区民政局注册，以开展各类消防培训工作为主的定点职业技能培训学校。\r\n学校坐落在海淀区高里掌路3号院（中关村翠湖云中心内），目前开设有初、中、高级建（构）筑物消防员、一级注册消防工程师等专项职业技能培训，以及面向党政机关、社会单位、百姓群众的各类社会化消防安全培训。\r\n学校秉承“诚信教学，精益求精”的办学宗旨，积极探索适合消防行业特点的继续教育运作模式，通过新颖实用的教材、科学的教学方法和严格的管理制度，建立以培养复合型人才为目的的培训体系，努力将培训学校建设成为消防职业资格培训基地、社会化消防宣传培训基地和高素质、综合性消防人才培养基地。\r\n学校拥有一支专业素质强、教学和实践经验丰富的消防培训师资队伍（大多参与过北京重大消防保卫任务和国家重点项目消防设施的检测评定工作）。现有专兼职任课教师20余人，其中高级工程师8人，工程师12人，骨干教师均具有高级建（构）筑物消防员、一级注册消防工程师等专业技术职称。\r\n学校将“以人为本、开拓创新、求真务实”作为不懈的追求，坚持学员至上，质量第一，努力为首都的消防事业做出应有的', '116.154196', '40.064762999999999', '116.154196', '40.064762999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3935', '北京昕亿华消防工程有限公司', '448', '李欣欣', '88797952', '王丽', '13811278702', '1997年03月05日', '2000万元', '北京市', '北京市', '海淀区', null, '四季青镇北辛庄路北软双新科创园B座204房间', '北京市', '北京市', '石景山区', '苹果园街道', '实兴大街30号院16号楼1007室', '', '建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '1997年03月05日', '2037年03月04日', '2018/2/27', '2019/2/26', '京消协（2018）证字041号', '911101086337903805', '', '设计、施工安全技术防范工程；可承担各类消防工程施工；销售建筑材料、装饰材料、机械电器设备、五金交电、化工产品（不含危险化学品及一类易制毒化学品）、民用建材、百货、消防器材、医疗器械（Ⅰ类）；技术开发、技术转让、技术服务；信息咨询（除中介服务）；可承担工程造价200万元以下的电子工程施工。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京昕亿华消防工程有限公司成立于1997年3月，是建设部核准的消防专业施工企业，公司具有消防工程施工壹级资质和消防专项设计甲级资质，为北京市消防协会会员。公司先后通过了ISO9001质量管理体系和ISO14001环境管理体系认证，连续多年被北京市工商行政管理局评为“重合同守信用”单位，被海淀区私营个体企业经济协会评为“先进企业”。近几年被海淀区评为“创建学习型组织先进单位”、“精神文明单位”。公司以技术为依托，以发展为主线，以创新为动力，在市场竞争中不断发展壮大。公司组织机构健全，管理制度完善，技术队伍稳定，逐步形成了具有现代企业管理特征和自身管理特点的科学管理机制和激励机制。现有消防工程专业技术人员和管理人员近百人，其中，中、高级以上技术职称人员占总人数的三分之一，一、二级建造师十几人。公司实行总经理领导下的各级分工负责制，以事业心强、经验丰富的三副总（技术副总、经营副总、生产副总）及总经理办公室为企业领导核心，并在江苏、广西等地设立有分支机构。', '116.213455', '39.969672000000003', '116.19169599999999', '39.937325999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3936', '北京京盾恒安消防科技有限公司', '447', '边鹤龙', '13521653165', '张文静', '13161906585', '2014年01月16日', '800万元', '北京市', '北京市', '通州区', null, '北京市通州区景盛中街2号院2号楼1层101', '北京市', '北京市', '通州区', '马驹桥镇', '北京市通州区景盛中街2号院2号楼1层101', '', '消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2014年01月16日', '2034年01月15日', '2018/5/30', '2019/5/29', '京消协（2018）证字165号', '911101120896103731', '', '技术推广；消防设施技术检测；电气防火技术检测；基础软件服务；应用软件服务（不含应用软件）；计算机系统服务；软件开发；维修消防器材；技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '我公司专业从事消防检测服务十余年，先后取得国家二级消防技术等级证书，CMA国家计量认证证书，电气防火检测技术服务机构资信证书一级IS09001：2015质量管理体系认证证书，并具有完善的质量管理体系。主要业务范围;消防设施技术检测、电气防火技术检测、消费器材销售与维修；气体灭火销售与维修；消防工程及维保。', '116.58029000000001', '39.738272000000002', '116.58029000000001', '39.738272000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3937', '北京如韵春风商务服务有限公司', '444', '赵大永', '18910016000', '罗敬', '18910016001', '2014年08月27日', '500万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区妙峰山镇水丁路1号院', '北京市', '北京市', '门头沟区', '妙峰山镇', '北京市门头沟区妙峰山镇水丁路1号院', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年08月27日', '2034年08月26日', '2018/3/26', '2019/3/25', '京消协（2018）证字1049号', '9111010930677202XF', '排油烟设施清洗机构', '会议服务；保洁服务；家居装饰设计；餐饮管理（未取得专项许可不得经营餐饮服务）；技术开发、转让、咨询、服务；汽车租赁（不含九座以上客车）；销售照明设备、音响设备、舞台设备、机械设备、电子产品、五金交电、建筑材料、装饰材料、金属材料、仪器仪表、家用电器、健身器材、体育用品、橡胶制品、健身器材；汽车装饰；工程设计；施工总承包；专业承包。（企业依法自主选择经营项目，开展经营活动；施工总承包、专业承包、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京如韵春风商务服务有限公司成立于2014年，是一家专门从事大型排油烟设施及管道清洗的企业。有多年排油烟管道清洗、中央空调清洗、管道疏通等服务经验。\r\n北京如韵春风商务服务有限公司是消防协会会员单位已近十年。先后从国内外引进了各种先进的清洗设备、环保清洗原料等。公司聘用的员工均具有本专业技能，全部持证上岗，管理层人员均是从事本行业多年的技术人才，采用科学、规范的操作流程。人性化的工作环境使员工更加诚信、更加敬业、更加热忱。由于多年来的支持与厚爱，公司现已发展成拥有近几十人的专业清洗团队和管理保障。给客户提供更安全、更环保、更专业的服务。\r\n公司始终秉承环保清洗理念，坚持使用安全环保的清洗剂，不断创新、积极探索新的服务模式，为客户提供更加优质的个性化解决方案，愿能用服务和质量赢得您的信任', '116.050313', '39.975729999999999', '116.050313', '39.975729999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3938', '北京天润鹏缘厨房设备有限公司', '443', '刘佰权', '13911805427', '刘佰权', '13911805427', '2011年06月01日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区西红门镇新安里S1商业1-2层4号', '北京市', '北京市', '大兴区', '观音寺街道', '北京市大兴区西红门镇新安里S1商业1-2层4号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2011年06月01日', '2031年05月31日', '2018/6/27', '2019/6/26', '京消协（2018）证字206号', '91110115576937365F', '排油烟设施清洗机构', '销售厨房设备、不锈钢制品、家用电器、日用品、食品机械、酒店用品、五金交电（不含三轮摩托车及残疾人机动轮椅车、不含电动自行车）、建筑材料、装饰材料、塑料制品；保洁服务；清洗服务；维修空调制冷设备；病虫害防治；烟气治理；噪声治理；维修厨房设备、家用电器；科技开发、转让、咨询、服务；劳务服务；家居装饰；餐饮管理；园林绿化管理；投资管理；仓储服务（未经专项审批的项目除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天润鹏缘厨房设备有限公司是一家综合性环保服务企业，业务主要包括【厨房设备销售】、【厨房设备及排烟系统安装】、【厨房设备维修】、【厨房油烟管道维护清洗】等。作为服务行业的一员，公司秉承“专注服务，创新共赢”的服务宗旨，融质量管理服务体系与高科技施工手段为一体，为客户提供品质更良好，实践更专业，成本更可控的服务。 \r\n       公司始终坚持员工自有化，拥有一套系统的、严格的、专业的技术培训管理体系，打造了一支高效率、高品质的专业队伍。公司现有施工人员20余人，经营管理人员10余人，我们丰富的经验可广泛服务于星级宾馆、酒店、商场、影院、火车站、写字楼、学校、医院、餐饮连锁、党政机关办公区、化工热力等工厂企业等，我们坚持用最先进的技术、最严格的管理体系、最优质的服务质量，为用户提供最优解决方案。\r\n持续创新是一种品质，全员参与服务品质和服务内涵的不断提升是天润鹏缘持续奋斗的目标。我们并非仅仅着眼于业务领域的创新，而是更加珍视现有业务环节的不断进步。在安全保障的前提下，深入研究并完善服务环节的质量管理和流程控制。把传统业务赋予崭新的面貌和内涵，持续完善理念范畴，追求技术进步。', '116.354784', '39.741788', '116.354784', '39.741788', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3939', '北京川消消防设备有限公司', '442', '吴文质', '15601333999', '吴文质', '15601333999', '2017年03月29日', '100万元', '北京市', '北京市', '朝阳区', null, '建国路15号院甲1号北岸1292三间房创意生活园区8-2169', '北京市', '北京市', '丰台区', '马家堡街道', '南三环西路16号搜宝商务中心2号楼1211室', '', '消防产品', '有限责任公司（自然人投资或控股）', '2017年03月29日', '2037年03月28日', '2018/3/19', '2019/3/18', '京消协（2018）证字059号', '91110105MA00D3EA7Q', '', '销售电子产品、机械设备、社会公共安全设备及器材、五金交电（不从事实体店经营）、金属材料；技术开发、推广服务；维修计算机；委托加工阀门、传动装置、消防水喷淋设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京川消消防设备有限公司\"隶属四川消防机械总厂驻京办事处 ，主营消防工程设计、施工、项目管理与咨询、工程维护、建筑材料的生产与销售等业务项目。公司已于\"北京宇世恒消防工程有限公司\"达成长期战略合作协议。', '116.582199', '39.910756999999997', '116.3681', '39.854810999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3940', '北京金鹏康达伟业保洁有限公司', '441', '杨静静', '13693124241', '李健', '13671239092', '2010年07月02日', '10万元', '北京市', '北京市', '丰台区', null, '北京市丰台区分中寺关家坑206号', '北京市', '北京市', '丰台区', '南苑地区办事处', '北京市丰台区分中寺关家坑206号', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年07月02日', '2030年07月01日', '', '', '', '911101065585681802', '', '保洁服务；劳务服务；城市园林绿化及养护；物业管理；技术服务；企业策划；销售日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '1 、烟道清洗部：排烟管道清洗、净化器清洗、排烟系统维修、排烟风机清洗等。\r\n\r\n2 、石材养护部：石材翻新打磨、石材修补着色、石材病变处理、石材防护保养等。\r\n\r\n3 、清洗保洁部：地毯清洗、沙发、椅子清洗、地面清洗、地板打蜡、外墙、玻璃清洗、开荒保洁等。', '116.447462', '39.857328000000003', '116.447462', '39.857328000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3941', '北京运超保洁服务有限公司', '440', '林庆勋', '18211030989', '林庆勋', '18211030989', '2017年12月14日', '100万元', '北京市', '北京市', '延庆区', null, '大庄科乡汉家川河南村12号北数第4间', '北京市', '北京市', '延庆区', '大庄科乡', '大庄科乡汉家川河南村12号北数第4间', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年12月14日', '2037年12月13日', '2018/6/8', '2019/6/7', '京消协（2018）证字187号', '91110229MA019CCD2K', '', '清洁服务；组织文化艺术交流活动；家庭服务；施工总承包、专业承包、劳务分包；专业化设计服务；物业管理；技术开发、技术咨询、技术服务、技术转让、技术推广；销售日用品、文化用品、家用电器；工程勘察。（企业依法自主选择经营项目，开展经营活动；工程勘察以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司是经北京市工商管理局正式注册批准，竭诚致力于清洗保洁的专业性清洗公司。我们面向社会各机关、团体、宾馆、酒店、商场、写字楼、娱乐场所等提供全方位的清洗保洁服务，主要致力于酒店、商场、快餐厅的大型厨房烟道防火清洗等；开展新大楼竣工、装饰后全套清洗保洁；各种石材地板清洗打蜡、翻新、结晶、养护技术；真皮沙发清洗养护；各种地毯的清洗护理；建立了完善的服务体系；积累了丰富的工作经验，并已在北京市场占有一席之地。 公司实行总经理负责制，严格管理，力争创新技术，努力发展企业文化。有市场总监率领着独立的团队，并设立网络部、企划公关部、业务部为公司的日益俱增的业绩做坚强的后盾；专人的调度，专业的车队确保客户的准时、准量高效完成。由设备检修组、库管众人组成的后勤部为前线时刻准备着，公司将以北京市区为中心，并继续努力拓展华北市场。 　　 公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！', '116.25902499999999', '40.438285', '116.25902499999999', '40.438285', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3942', '北京博雅建业教育科技有限公司', '438', '张帅', '15210629033', '张帅', '15210629033', '2016年08月19日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区黄厂路3号院6号楼3层320', '北京市', '北京市', '朝阳区', '豆各庄地区办事处', '北京市朝阳区黄厂路3号院6号楼3层320', '', '建筑防火,宣传教育培训,消防信息化,法规政策', '有限责任公司（自然人投资或控股）', '2016年08月19日', '2036年08月18日', '', '', '', '91110105MA007PLE1E', '', '互联网信息服务；技术开发、技术转让、技术咨询、技术服务、技术推广；教育咨询（不含出国留学咨询及中介服务）；产品设计；企业管理咨询；数据处理（数据处理中的银行卡中心、PUE值在1.5以上的云计算数据中心除外）；文艺创作；市场调查；企业策划；设计、制作、代理、发布广告；经济贸易咨询；公共关系服务；销售文具用品、工艺品。（企业依法自主选择经营项目，开展经营活动；互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京博雅建业教育科技有限公司(简称：建业网校)；全国商业消防与安全协会会员单位；2016年成立就专注于消防工程师考试培训教育； 培训学员已多达几万多人，遍及全国各大城市。 是业内最先 打造并采用在线课程教学加线下班主任督导的一站式学习服务理念的教育机构。 建业网校现拥有完善的授课模式和服务体系； 公司整合优质的教育资源； 聘请行业权威的培训老师，并采用先进的互联网智能技术进行授课；只为更好为学员服务。北京博雅建业教育科技有限公司结合自身优势，公司集研发、教学、就业方向指导和职业发展于一体的立体化人才增值新模式的企业。公司目前只主营职业证书注册消防工程师项目，努力为学员打造功能齐全的再教育平台，形成完善的教育培训生态产业链。公司核心人员均是经验丰富的消防系统人才；业务能力覆盖全国20多个省市自治区。致力于提高学员的职场竞争力，整合优质的教育资源，采用先进的互联网智能技术，通过研发自己的教材、教辅资料、科学打造教学内容，并向社会输送大量消防工程师人才，在业内具有一定的威望。', '116.55098099999999', '39.855248000000003', '116.55098099999999', '39.855248000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3943', '北京顺诚合鑫科技发展有限公司', '435', '温秀芹', '13691106827', '贾玉民', '13691106827', '2018年05月11日', '600万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南法信镇南陈路南法信段13号9幢1层', '北京市', '北京市', '顺义区', '南法信地区办事处', '北京市顺义区南法信镇南陈路南法信段13号9幢1层', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年05月11日', '2048年05月10日', '2018/6/8', '2019/6/7', '京消协（2018）证字178号', '91110113MA01C3R89Q', '排油烟设施清洗机构', '技术推广服务；销售机械设备、消防器材、五金产品（不含电动自行车）、厨房用具、日用百货、化妆品、文化用品、服装、计算机、软件及辅助设备、家用电器、建筑材料（不含砂石及其砂石制品）、工艺品（不含文物、象牙及其制品）、卫生用品、纺织品、针织品、鞋帽；翻译服务；工艺美术创作；图文设计；清洁服务（不含餐具消毒）；害虫的防治服务；室内装饰设计；城市园林绿化施工；专业承包；保洁服务；接受委托提供劳务服务（不含排队服务、对外劳务合作）；污水处理；城市生活垃圾清扫、收集、运输、处理。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2018年5月，主营排油烟设施清洗，员工技术专业，服务周到。公司自成立以来，秉承顾客至上，质量第一，诚实守信，技术专业的原则，赢得客户的信任与支持，你的信任，我的专业，合作共赢。', '116.617372', '40.146053000000002', '116.617372', '40.146053000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3944', '北京中消长城消防安全工程有限公司', '434', '许鹭', '13911837518', '谷爱新', '13910988650', '2000年11月20日', '3000万元', '北京市', '北京市', '通州区', null, '北京市通州区工业开发区', '北京市', '北京市', '丰台区', '新村街道', '北京丰台科学城富丰路4号工商联大厦B座604、605', '', '消防设施', '有限责任公司（自然人投资或控股）', '2000年11月20日', '2030年11月19日', '2018/3/19', '2019/3/18', '京消协（2018）证字057号', '91110112802431136B', '', '专业承包；工程勘察设计；维护消防设施；技术开发；技术服务；技术咨询；技术转让；销售建筑材料、装饰材料、钢材、机械电器设备、消防器材、通讯器材、日用品、五金交电、计算机及外围设备。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京中消长城消防安全工程有限公司成立于2000年，是在北京市工商行政管理局登记注册的企业，注册资本金3000万元人民币。具有消防设施工程专业承包壹级；电子与智能化工程专业承包贰级；机电工程施工总承包三级资质；建筑机电安装工程专业承包三级；消防设施工程设计专项甲级；建筑智能化系统设计专项乙级；安防工程设计、施工企业资质壹级；消防设施维护保养检测临时一级资质。 \r\n公司拥有一批多年从事消防、安防、建筑智能化工程设计、施工的专业技术管理人员。公司40%以上的员工具有一级消防工程师、一级建造师、二级建造师、注册造价师等专业执业资格证书。30%以上的员工具有高、中级工程师证书。公司自主研发的消防维保运维软件获得多项国家专利，被国家授予“高新技术企业”证书。凭借雄厚的科技人才实力、扎实的施工技术力量、经验丰富的管理团队、科学严谨的质量管理体系，公司先后承担了国家多项大、中型消防工程施工项目，并全部通过消防主管部门的验收，广泛受到各方的好评，成为消防工程施工行业中技术过硬，管理严格的先锋。\r\n通过公司全体员工奋发努力，不断开拓市场，公司实力不断发展壮大。2003年以来，公司先后通过了质量管理体系GB/T', '116.721144', '39.857948', '116.28499100000001', '39.835155999999998', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3945', '中环清新科技发展（北京）有限公司', '433', '宋长青', '13901379220', '魏晓雪', '13581804674', '2010年12月13日', '1050万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北辰西路69号8层1单元902号', '北京市', '北京市', '朝阳区', '望京街道', '北京市朝阳区望花路西里16号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年12月13日', '2030年12月12日', '', '', '', '91110105567485985K', '', '技术推广服务；清洁服务（不含餐具消毒）；销售机械设备、五金机电（不含电动自行车）、计算机、软件及辅助设备、化工产品（不含危险化学品）；机械设备租赁。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中环清新科技发展（北京）有限公司是中环清新人工环境工程技术（北京）有限责任公司的全资子公司，立足创造低碳环保健康生活，以室内空气质量(Indoor Air Quality简称IAQ）污染综合防控与治理为目标，集室内PM2.5专项治理；室内空气质量在线实时监控系统；中央空调系统清洗消毒、维修保养、运营托管和节能改造；排油烟清洗服务；“中环清新”系列产品的研发、生产、销售和工程服务为一体，全面打造绿色建筑的专业化综合服务商。', '116.387187', '39.983240000000002', '116.470556', '39.987966', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3946', '北京华清保洁服务有限公司', '431', '宋海滨', '13911823981', '宋海滨', '1391182981', '2009年07月08日', '50万元', '北京市', '北京市', '平谷区', null, '北京市平谷区平谷镇金海小区3号楼（1）-1-2', '北京市', '北京市', '平谷区', '滨河街道', '北京市平谷区平谷镇金海小区3号楼（1）-1-2', '', '烟道清洗', '有限责任公司（自然人独资）', '2009年07月08日', '2029年07月07日', '', '', '', '91110117690806342A', '', '清洁服务；家庭服务；代收洗衣服务；经济贸易咨询。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京华清保洁服务有限公司，经北京市工商局批准的清洁服务类企业。\r\n是（北京市消防协会）的会员单位，证书号码为[京消协（2019）证字018号]。：排油烟设施清洗证书号码为[京消协清证字（2019）002号]。是一支专业化的厨房烟道防火清洗的公司，拥有进口的高温高压清洗设备，有专业的施工队员，有完善的管理体制，有很好的质量反馈机制。        \r\n我公司现有员工10余人，有电工、管道工、枪手的专业技术人员。', '117.09974099999999', '40.137011000000001', '117.09974099999999', '40.137011000000001', '', null, null, null, null);
