INSERT INTO `t_fc_company` VALUES ('3949', '北京山河佳业保洁有限公司', '427', '于海生', '13910740744', '于海生', '13910740744', '2005年04月21日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡长虹西路翠柳东街1-388号', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区汤立路218号明天生活馆1058室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年04月21日', '2025年04月20日', '2018/12/28', '2019/12/27', '京消协（2018）证字467号', '9111011177405415XG', '排油烟设施清洗机构', '保洁服务；技术服务；技术开发；维护厨房设备、空调制冷设备；销售厨房设备、空调制冷设备、酒店用品、电子产品、五金交电（不含电动自行车）、建筑材料、日用杂货。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京山河佳业保洁有限公司是以专业清洗厨房排油烟系统、中央空调排风系统，排油烟管道安装维修改造、厨房设备维修，石材养护与翻新为主、楼宇日常保洁、地毯清洗、写字楼开荒、家政服务为辅的专业保洁服务公司。\r\n公司成立于1998年3月，前身是北京山河佳业保洁服务部，于2005年4月更名为北京山河佳业保洁有限公司。\r\n北京消防协会会员单位\r\n具备厨房烟囱排油烟管道清洗服务质量保障体系单位。\r\n公司现拥有一批实践经验丰富，具有高度责任感的员工，本着“客户至上”的原则，“以质量求生存，以信誉求发展，在发展中创新，在竞争中创新”为经营宗旨，以客户满意为服务宗旨，多年来致力于保洁服务行业，“高质量、低价格，优服务、快效率”地先后为京城多家饭店企事业单位提供了优质满意快捷的服务，得到了客户的一致信赖和好评，同时与众多客户一起为北京的绿色环保事业尽了一份应尽的义务和责任。', '116.127331', '39.726497999999999', '116.413736', '40.050235999999998', '注册地址坐标位置不准确', null, null, null, null);
