INSERT INTO `t_fc_company` VALUES ('3955', '北京宇润大地环保科技有限公司', '421', '唐本俊', '13910697318', '李桂红', '15901396188', '2014年04月28日', '500万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区金沙西街10号院5号楼5层508', '北京市', '北京市', '门头沟区', '永定地区办事处', '北京市门头沟区金沙西街10号院5号楼5层508', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年04月28日', '2034年04月27日', '2018/3/20', '2019/3/19', '京消协（2018）证字1045号', '91110108099024335H', '排油烟设施清洗机构', '技术开发、技术转让、技术咨询、技术服务；投资咨询；保洁服务；建筑物清洁服务；害虫防治服务；家庭劳务服务；经济贸易咨询；市场调查；组织文化艺术交流活动（不含营业性演出）；承办展览展示活动；房地产咨询；会议服务；包装装潢设计、电脑动画设计；设计、制作、代理、发布广告；销售电子产品、计算机、软件及辅助设备、医疗器械I类、钟表、首饰、家具、建筑材料、汽车零配件、通讯设备、文化用品、工艺品、家用电器、机械设备、厨房用品、金属材料、服装、鞋帽、花、草及观赏植物；办公设备维修；委托加工不锈钢产品；租赁建筑工程机械、建筑工程设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京宇润大地环保科技有限公司是一家拥有正规资质的清洗单位，公司从2014年成立以来，就一直致力于厨房排烟管道的清洗防火服务。公司随着这几年的发展和技术员工的稳定，大大小小积累了好几百家客户。常年为客户提供专业的烟道清洗和油垢检测工作，有效的消除了火灾隐患，确保用户的安全生产，受到用户的广泛好评。在清洗过程中用相机进行清洗前和清洗后拍照，还配有管道检测机器人对每个管道的狭小部分进行拍摄和录像，让客户看到实实在在的情况，无后顾之忧！', '116.128845', '39.904795999999997', '116.128845', '39.904795999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3956', '北京京海康宁生物科技有限公司', '418', '胡军', '13701266359', '胡军', '13701266359', '2004年02月20日', '100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区阜外高甲店1号恩济西园产业园产业孵化区二层201室', '北京市', '北京市', '海淀区', '八里庄街道', '北京市海淀区阜外高甲店1号恩济西园产业园产业孵化区二层201室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2004年02月20日', '2024年02月19日', '2018/12/28', '2019/12/27', '京消协（2018）证字471号', '91110108758706680A', '排油烟设施清洗机构', '技术开发、技术转让、技术咨询、技术服务、技术推广；组织文化艺术交流活动（不含演出）；工程和技术研究与试验发展；建筑物清洁服务；会议服务；承办展览展示活动；企业管理咨询；企业策划；投资咨询；经济贸易咨询；销售五金、交电、日用品、厨房用具；修理非家用制冷、空调设备；厨房设备清洗服务；害虫防治服务；灭鼠及预防。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京海康宁生物科技有限公司成立2004年2月20日，经北京工商行政管理局核准。注册资金100万元，自成立来，凭借良好的经营环境、诚信的经营理念，打造了集中央空调清洗、有害生物防治、石材养护、厨房烟囱排油设施清洗、环保节能、产业技术开发于一体的综合技术型服务公司。公司始终秉承“促绿色环保、创优质环境、倡健康生活”的目标，坚持为用户提供 “一站式”“24小时”“360度”全方位管家式服务。“京海康宁”是经北京消防协会、北京疾控中心评审委员会评审北京京海康宁生物科技有限公司为具备厨房烟囱排油管道清洗服务质量保障体系单位、北京市集中空调通风系统清洗技术服务机构和有害生物防治技术服务机构。“京海康宁”多次被行业协会评为先进单位。\r\n在“大众创业、万众创新”新时代，“京海康宁”始终坚持“不断创新，锐意进取”的企业精神。目前“京海康宁”是国内企事业单位厨房排油烟设施和空调风管清洗优秀供应商之一，业务覆盖京、津、冀地区的油烟管道清洗', '116.280316', '39.930635000000002', '116.280316', '39.930635000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3957', '北京达安顺消防科技有限公司', '417', '裴雷', '13011179142', '陆群', '18518098766', '2011年08月11日', '400万元', '北京市', '北京市', '丰台区', null, '北京市丰台区科学城恒富中街2号院一号楼二层2058室', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区科学城恒富中街2号院一号楼二层2058室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2011年08月11日', '2031年08月10日', '2019/1/11', '2020/1/10', '京消协（2019）证字007号', '911101065808620798', '电气防火检测技术服务机构', '技术开发；技术服务；技术咨询；技术检测；企业管理；自费出国留学中介服务；销售消防器材、五金交电（不含电动自行车）、计算机、软件及辅助设备、金属制品、通用设备、专用设备、电气设备、机械设备、电子产品、电子元器件、仪器仪表。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京达安顺消防科技有限公司（以下简称公司）成立于2011年8月11日，是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，并已通过了ISO9001:2008质量管理体系认证。\r\n       公司经北京市消防局消防协会的严格考核和认证，取得了中化人民共和国消防技术服务机构临时一级资质，同时，公司还通过了北京市质量技术监督局的考核，取得了CMA资质认定证书，是开展建筑消防设施及电气防火检测技术服务的消防检测和消防设施维护保养单位，技术力量雄厚，设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测和消防设施维保工作。\r\n      公司的主要业务是： \r\n      1、建筑消防设施检测：火灾自动报警系统、消防供水系统、消火栓系统、自动喷水灭火系统、防烟排烟及通风空调系统、气体灭火系统、防火门、防火卷帘、灭火器。\r\n      2、电气设施检测：变配电装置、开关、插座、灯具、线路敷设。\r\n      3、消防设施维护保养', '116.296093', '39.836691999999999', '116.296093', '39.836691999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3958', '北京中天建科消防安全检测有限责任公司', '416', '王新', '15901450288', '赵雪梅', '18910871189', '2002年04月27日', '1000万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南法信镇信中街12号院7号楼102', '北京市', '北京市', '顺义区', '仁和地区办事处', '北京市顺义区南法信镇信中街12号院7号楼102', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2002年04月27日', '2032年04月26日', '2018/10/12', '2019/10/11', '京消协（2018）证字311号', '91110113738236933w', '电气防火检测技术服务机构', '消防设施检测、电气防火安全检测；维修消防设施、消防器材；技术开发、技术转让、技术咨询、技术服务、技术推广；基础软件开发；数据处理（数据处理中的银行卡中心、PUE值在1；5以上的云计算数据中心除外）；销售计算机软硬件及辅助设备、电子产品、建筑材料（不含砂石及砂石制品）、机械设备、家用电器；清洁服务。（涉及专项审批的项目除外。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中天建科消防安全检测有限责任公司成立于2002年，注册资金1000万元人民币。具有独立法人资格，承担第三方公正检测，对相应的检测结果独立承担法律责任。北京中天建科消防安全检测有限责任公司是北京消防协会的会员单位，通过了国家计量资质认定（CMA）及ISO 9001：2015质量管理体系认证，具有消防技术服务、消防设施维护保养、建筑消防设施检测、电气防火技术安全检测壹级资质。\r\n   公司经过十多年发展对建筑消防设施检测、电气防火安全检测、建筑消防设施的维护保养积累了丰富经验，公司拥有30余人的专业检测队伍，从事建筑消防设施、电气防火技术安全检测工作多年，具有丰富的检测经验。经过专业技术的培训和国家计量资质认证培训，均取得了消防检测人员执业资格证书。公司目前拥有各种先进的检测设备120余台（套），能够顺利完成各类建筑消防设施、电气防火安全检测任务。\r\n   北京中天建科消防安全检测公司以“质量为本  科学公正  客户至上  服务规范”为经营理念。本着“科学、准确、公正、及时”为原则服务于社会，受到客户的一致好评，在建筑消防设施检测、电气防火安全检测行业中有着良好声誉。', '116.61503', '40.120278999999996', '116.61503', '40.120278999999996', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3959', '北京森源达消防科技有限公司', '415', '葛杰', '17801078817', '葛杰', '17801078817', '2017年07月25日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区天星街1号院11号楼5层504室', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区天星街1号院11号楼5层504室', '', '消防产品', '有限责任公司（自然人独资）', '2017年07月25日', '2047年07月24日', '', '', '', '91110111MA00GL44XM', '', '技术服务、技术转让；销售消防器材、交通管理用金属标志及设施、机械设备、仪器仪表、办公用品、计算机软件及辅助设备、空调制冷设备、电器设备、节能环保设备、社会公共安全设备、安全技术防范产品；清洁服务（不含洗车服务）；维修消防器材；家庭劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京森源达消防科技有限公司，是2017年7月25日注册于北京市房山区的一家小规模销售类公司，公司注册资本100万元。主要营业范围：技术服务、技术转让、销售消防器材、交通管理备用金属标志及实施、机械设备、仪器仪表、办公用品、计算机软件及辅助设备、空调制冷设备、电器设备、节能环保设备、社会公共安全设备；清洁服务（不含洗车服务）；维修消防器材；劳务服务等。\r\n我公司本着诚信经营的理念先后推出了五大服务承诺,24小时上门服务,2年包修 ,1年包换,终身技术支持，即买即装等服务承诺,以专业,专心,专注的态度和实实在在的行动将服务贯穿于售前,售中,售后服务的每一个环节。\r\n我们的服务不仅是售后的，而是全程的，服务的观念贯穿到销售的各个环节，户满意是检验我们工作的唯一标准。', '116.159845', '39.755501000000002', '116.159845', '39.755501000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3960', '北京中消永安消防安全技术有限公司', '414', '郑书萍', '13911892788', '孙小慧', '18610868590', '2013年12月03日', '658万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路128号院2号楼4层507室', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡吕家营村1422号', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2013年12月03日', '2033年12月02日', '2018/12/28', '2019/12/27', '京消协（2018）证字486号', '91110106085537359J', '电气防火检测技术服务机构', '技术检测、技术开发、技术转让、技术咨询、技术推广、技术服务；检测服务；家居装饰、室内装饰工程设计；劳务服务；清洁服务；经济信息咨询；维修机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）。', '北京中消永安消防安全技术有限公司是建筑消防设施检测、电气防火检测、火灾探测器清洗、消防产品销售与维修检测，消防设备及安防系统维修保养为一体的专业消防安全技术企业。公司拥有北京市消防局，北京市消防协会，颁发的建筑消防设施检测、电气防火检测专业承包资质；北京市工商管理局注册登记核发的消防技术服务、消防产品推广为一体的消防检测企业。拥有经验丰富的专业技术检测人员及国内外先进的建筑消防设施检测设备、电气防火技术检测设备。公司注册资金为658万元，现有国家中高级技术人员20多名。\r\n   公司始终秉承“信誉第一，服务至上”的原则，凭借雄厚的实力和精湛的技术取得了市场的一致好评，   以诚信赢得市场，专业铸就品质的企业精神、以尽善尽美、精益求精的服务为宗旨，长期致力于为客户提供优质、安全、高效的消防科技产品及消防安全检测技术服务。', '116.29979400000001', '39.829230000000003', '116.47013099999999', '39.843491', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3961', '北京荣立信保洁服务有限公司', '413', '何娟', '13520639293', '何娟', '13520639293', '2016年04月13日', '800万元', '北京市', '北京市', '通州区', null, '北京市通州区新华南路39号63幢三层N区003号', '北京市', '北京市', '通州区', '中仓街道', '北京市通州区四员厅街36号院7号楼A604', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年04月13日', '2036年04月12日', '', '', '', '91110112MA004R2T23', '', '建筑物清洁服务；零售机械设备、标识标牌、交通专用设备、厨房用具、日用杂货；维修标识标牌、交通专用设备（仅限上门维修）。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司从事厨房设备，烟道清洗等项目，望贵部门批示！', '116.65871300000001', '39.902759000000003', '116.65871300000001', '39.902759000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3962', '北京金水永和消防科技有限公司', '412', '姜献华', '13671224366', '周灵燕', '13683201663', '2012年06月26日', '600万元', '北京市', '北京市', '丰台区', null, '北京市丰台区造甲街110号2号平房（新村企业集中办公区）', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区造甲街110号2号平房（新村企业集中办公区）', '', '消防产品', '有限责任公司（自然人投资或控股）', '2012年06月26日', '2032年06月25日', '2017/6/22', '2018/6/21', '京消协（2017）证字093号', '911101065996914252', '', '技术开发；技术服务；技术咨询；技术检测；清洁服务；维修消防器材；网上销售消防器材、公共安全设备、机械设备、五金交电、电子产品、建筑材料、化工产品（不含化学危险品）；消防器材维修。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。', '北京金水永和消防科技有限公司于2012年在北京工商管理局注册，是经过北京市消防局核准备案同时获得中华人民共和国消防技术服务机构资质证书的单位，2013年成为中国消防协会会员单位，2015年获得中国质量管理企业协会授予的荣誉证书，2015年成功加入北京市政府采购供应商的行列。\r\n公司拥有一批高素质、技术过硬、经验丰富的专业维修、施工队伍，能够进行消防器材维修、检测，调试及承担消防火灾自动报警系统、水喷淋系统、气体灭火系统的检修、维护和保养。代理销售欧伦泰品牌各型号的灭火器，正压式空气呼吸器、94-97-02式战斗服、过滤式呼吸器等消防产品。\r\n公司自成立以来，坚持采用科学的管理办法，以人为本，诚信务实、制定了严格的质量保障体系与优质的售后服务措施，先后与国家机关、企事业单位建立了良好的合作双赢关系，获得了广大客户的赞誉和好评。\r\n公司经营理念：充分发挥各方面优势，积极采用先进的技术和设备，坚持“客户第一、质量第一、信誉第一”的宗旨，发扬求实、拼搏、创新的企业精神。', '116.295835', '39.844577999999998', '116.295835', '39.844577999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3963', '北京众安晓育教育科技有限公司', '411', '翟媛媛', '13911935249', '李斌', '13810692510', '2017年10月18日', '100万元', '北京市', '北京市', '海淀区', null, '北京市海淀区白家疃尚水园4号楼9层3单元907', '北京市', '北京市', '海淀区', '温泉地区办事处', '北京市海淀区高里掌路3号院17号楼3层301', '', '宣传教育培训', '有限责任公司（自然人投资或控股）', '2017年10月18日', '2047年10月17日', '2019/3/6', '2020/3/5', '京消协（2019）证字095号', '91110108MA0186964U', '', '技术开发、技术推广、技术咨询、技术转让；消防安全评估的技术服务；经济贸易咨询；公共关系服务；企业策划；企业管理咨询；承办展览展示活动；销售安全技术防范产品、电子产品、机械设备、金属制品、文化用品、建筑材料；技术检测；教育咨询（中介服务除外）；技术进出口、货物进出口、代理进出口。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京众安晓育教育科技有限公司成立于2017年10月,公司秉承“诚信教学，精益求精”的办学宗旨，积极探索适合我国消防产业特点的继续教育运作模式，通过新颖实用的教材、科学的教学方法和严格的管理制度，建立以培养复合型人才为目的的培训体系，努力将培训学校建设成为： 一流消防职业资格培训基地、社会化消防培训基地和高素质、综合性消防人才培养基地。 \r\n学校开设有初、中、高级构建筑物消防员、一级注册消防工程师等专项职业技能培训，以及面向党政机关、社会单位、百姓群众的各类消防安全培训。 \r\n公司配有多间培训教室，安装有多媒体投影仪，实施多媒体教学。 技能实操区安装有自动喷水灭火系统、气体灭火系统、通风防排烟系统、火灾报警自动报警和联动控制系统等19大类67项实操教学系统。 完善的软、硬件配套设施，可满足不同层次、各种需求的消防培训需要。\r\n我校将以人为本，脚踏实地，不断创新，将用更好的工作和服务去获得社会各界的认可，为全市培养出更多合格的专业消防技术人才而努力奋斗。', '116.185768', '40.045361', '116.154196', '40.064762999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3964', '北京红顺天厨房设备有限公司', '409', '陈朝红', '13810912360', '陈朝红', '17710883989', '2013年01月16日', '588万元', '北京市', '北京市', '通州区', null, '北京市通州区环科中路6号2号楼1层', '北京市', '北京市', '通州区', '马驹桥镇', '北京市通州区环科中路6号2号楼1层', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年01月16日', '2033年01月15日', '2019/1/11', '2020/1/10', '京消协（2019）证字010号', '91110106061310547J', '', '销售厨房专用设备、五金交电（不含电动自行车）、电子产品、制冷专用设备、建筑材料；技术服务、技术开发；家庭劳务服务；建筑物清洁服务；经济贸易咨询；组织文化艺术交流活动；维修厨房设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '本公司是一家经过正式注册（注册资金：588万），拥有合法经营执照的正规企业。专业为宾馆饭店机关单位食堂提供厨房大型排油烟系统清洗和设备维护服务！公司拥有严格的管理制度以及施工质量标准；依靠先进的设备、精湛的技术为客户提供全方位服务！。清洗维修技师都具备多年清洗、维修、安装经验，特别是在清洗过程中对厨房的电源保护的非常到位；并不断吸收新的技术和先进的检测设备来满足广大客户的需求！\r\n公司经营范围：排油烟系统清洗维护；排烟风机清洗维修；油烟净化器销售安装；厨房灶具维修改造；节能型炉头推广；蒸箱热水器除垢；炊事机械设备销售维修；冰箱制冷设备维修销售；厨房设备及排烟系统设计生产安装一条龙服务！', '116.55724600000001', '39.741776000000002', '116.55724600000001', '39.741776000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3965', '北京广达盛杰清洗服务有限公司', '408', '王昌广', '18513000096', '王昌广', '18513000096', '2008年01月25日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区安慧东里2号院1号楼1007室', '北京市', '北京市', '朝阳区', '大屯街道', '北京市朝阳区安慧东里2号院1号楼1007室', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年01月25日', '2028年01月24日', '', '', '', '91110105671713095W', '', '清洁服务；家庭服务；技术推广服务；会议展览服务；销售日用百货、厨具用具。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京广达盛杰清洗有限公司（是厨具制造厂家办），成立于2000年8月，是一家清洗及保洁为一体的综合性服务公司。公司实行总经理负责制，采用职能组织机构，遵循精于高效的原则，竭诚为北京市各类旅馆、酒店、写字楼、机关团体、企事业单位、学校等提供各类型的清洗服务。', '116.421691', '39.992815999999998', '116.421691', '39.992815999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3966', '北京宇伊安全防范技术咨询有限公司', '407', '张洪岩', '13521216633', '张洪岩', '13521216633', '2018年04月04日', '1000万元', '北京市', '北京市', '海淀区', null, '中关村东路123号1号楼三层8306', '北京市', '北京市', '海淀区', '西三旗街道', '安宁庄东路18号光华创业园4号楼三层', '', '消防安全评估,建筑防火,消防设施,消防安全检查', '有限责任公司（自然人独资）', '2018年04月04日', '2048年04月03日', '', '', '', '91110108MA01B87X4X', '', '安全风险评估方面的技术咨询、技术开发、技术推广、技术转让、技术服务；教育咨询（中介服务除外）；经济贸易咨询；企业管理咨询；企业策划；市场调查；设计、制作、代理、发布广告；会议服务；承办展览展示活动；计算机系统服务；基础软件服务；软件开发；产品设计；公共关系服务；工艺美术设计；组织文化艺术交流活动（不含营业性演出）；文艺创作；机械设备租赁（不含汽车租赁）；机动车公共停车场服务；物业管理；人力资源服务。（企业依法自主选择经营项目，开展经营活动；人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京宇伊安全防范技术咨询有限公司成立与2018年，公司是一家专业型公司。\r\n 公司成立以来一直致力于安全风险评估、技术防范、物体防范等相关邻域。公检法机关，企事业单位和大型活动制定安全检查，物体防范，技术防范措施总体方案并提供相应的设备设施，公司成立以来获得了企事业单位的一致好评，取得了令人瞩目的成绩。公司秉承诚信至上、科技创新、以人为本、精益求精、安全永远第一的思想理念，开拓进取，为祖国的稳定繁荣发展贡献着自己的力量，我们会以最诚挚的热心最优质的产品服务好每一位客户!', '116.333443', '39.970989000000003', '116.33216', '40.043782999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3967', '北京昊天雨晨科贸有限公司', '405', '吴江涛', '13261992884', '吴晨风', '13011219015', '2014年09月18日', '1000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区卢沟桥南里10号院8号楼1至3层1单元01号-1010', '北京市', '北京市', '丰台区', '宛平城地区办事处', '北京市丰台区卢沟桥南里10号院8号楼1至3层1单元01号-1010', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年09月18日', '2034年09月17日', '2018/3/20', '2019/3/19', '京消协（2018）证字1043号', '911101063179091839', '排油烟设施清洗机构', '专业承包；技术开发、技术推广、技术服务；销售建筑材料、电子产品、机械设备、五金交电、日用品；清洁服务；销售化工产品；销售兽药；杀虫服务。（领取本执照后，应到区县住建委（房管局）取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京昊天雨晨科贸有限公司是一家专业从事中央空调系统清洗、油烟管道清洗的服务型企业。为用户的中央空调系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\r\n    公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成中央空调系统清洗全系列工作。我们丰富的经验可广泛服务于所有使用中央空调的场所。\r\n您的健康是我们的责任，我们愿用自己的努力，为您提供一个洁净、健康、舒适的环境。\r\n公司成立至今，以一流的服务、先进的技术、严格的管理为众多客户提供优质服务，在同行业中树立了专业化清洗公司的典范，成为活跃在北京市及其周边的高智能综合大厦、写字楼、小区、工厂、学校、事业单位清洗服务的尖兵。', '116.23394', '39.846310000000003', '116.23394', '39.846310000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3968', '北京丰盛清洁服务有限公司', '404', '黄立祥', '13683276919', '黄立祥', '13683276919', '2015年12月28日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区槐房西路316号院二号楼二2007室', '北京市', '北京市', '大兴区', '黄村地区办事处', '大兴区狼垡四村', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年12月28日', '2035年12月27日', '2018/3/1', '2019/2/28', '京消协（2018）证字1033号', '91110106MA002Tu593', '排油烟设施清洗机构', '清洁服务；劳务服务；销售机械设备、日用品、家用电器、厨房用具。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京丰盛清洁服务有限公司成立于2016年一月。主要在北京从事保洁与厨房排油烟设施清洗。', '116.36845', '39.807318000000002', '116.28286199999999', '39.786082', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3969', '北京保盛科技有限公司', '403', '胡康欢', '18911644245', '胡康欢', '18911644245', '2018年04月24日', '20万元', '北京市', '北京市', '海淀区', null, '北京市海淀区东北旺西路8号院4号楼四层430-2', '北京市', '北京市', '海淀区', '上地街道', '北京市海淀区东北旺西路8号院4号楼四层430-2', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2018年04月24日', '长期', '', '', '', '91110108MA01BMDN96', '', '技术开发、技术推广、技术转让、技术咨询、技术服务；销售自行开发的产品；计算机系统服务；基础软件服务；应用软件服务；软件开发；软件咨询；产品设计；模型设计；包装装潢设计；教育咨询（中介服务除外）；经济贸易咨询；文化咨询；体育咨询；公共关系服务；会议服务；工艺美术设计；电脑动画设计；企业策划、设计；设计、制作、代理、发布广告；市场调查；企业管理咨询；组织文化艺术交流活动（不含营业性演出）；文艺创作；承办展览展示活动；会议服务；影视策划；翻译服务；数据处理（数据处理中的银行卡中心、PUE值在1.5以上的云计算数据中心除外）；自然科学研究与试验发展；工程和技术研究与试验发展；农业科学研究与试验发展；医学研究与试验发展。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n我公司自2018年4月24日成立成立以来主要从事清洁服务包括排油烟管道清洗、排烟风机清洗、烟罩紫外线除油灯管维保、灶台灭火装置维保等。我公司的服务宗旨是“诚信“是本公司成功的保证。“客户至上，信誉第一。”高标准提供服务，维护客户利益、形象“是我们始终不渝的目标。', '116.298203', '40.047753', '116.298203', '40.047753', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3970', '北京卫京安消防培训中心', '402', '温书云', '13901103527', '代娜娜', '13488799292', '2004年05月13日', '400万元', '北京市', '北京市', '平谷区', null, '北京市平谷区新平西路14号-31', '北京市', '北京市', '平谷区', '滨河街道', '北京市平谷区新平西路14号-31', '', '消防设施,电气防火', '集体所有制（股份合作）', '2004年05月13日', '2024年05月12日', '', '', '', '91110117762164001H', '', '消防技术培训；消防安全评估；消防设施维护保养；消防设施检测；电气防火检测；消防技术服务。(依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。)', '北京卫京安消防培训中心于2004年05月13日经北京市工商行政管理局批准成立，《企业法人营业执照》统一社会信用代码为91110117762164001H，注册资本为人民币400万元，公司地址位于北京市平谷区新平西路14号-31，公司法人代表温书云，公司经营业务范围包括消防技术培训；消防安全评估；消防设施维护保养；消防设施检测；电气防火检测；消防技术服务。', '117.101399', '40.134628999999997', '117.101399', '40.134628999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3971', '北京方超环保科技有限公司', '401', '宋益芳', '13552508208', '向军超', '18301501929', '2019年01月16日', '500万元', '北京市', '北京市', '通州区', null, '北京市通州区景盛南四街17号院49号楼5层101-521A', '北京市', '北京市', '通州区', '马驹桥镇', '北京市通州区景盛南四街17号院49号楼5层101-521A', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2019年01月16日', '长期', '2018/11/21', '2019/11/20', '京消协（2018）证字386号', '91110112MA01GTDL9P', '电气防火检测技术服务机构', '技术推广、技术开发、技术转让、技术咨询；城市园林绿化；建筑物清洁服务；水污染治理；害虫的防治服务；家庭劳务服务；专业承包；劳务分包；施工总承包；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京方超环保科技有限公司是一家专注与用户提供清洗设备和相关用品，服务为一体的科技公司。我司主要教育项目：写字楼、酒店厨房、商场、医院、公司等各类公共场所委托长期定点保洁、地毯清洗、地面清洗、及办公座椅清洗等。\r\n  方超公司企业精神：我司一直秉承着“质量第一，服务至上”的企业精神为用户提供专业的清洗方案，搞质量的清洗设备，高效的售后服务，大力降低企业保洁成本。公司服务承诺：了解用户的真实情况，提供专业的清洗解决方案，提供技术的售后保障。\r\n  方超公司发展愿景：我们真诚的期待与您共同发展，为健康整洁的工作环境一起努力奋斗。', '116.554095', '39.731127000000001', '116.554095', '39.731127000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3972', '京盾消安（北京）环保科技有限公司', '400', '崔平', '13716480997', '覃长城', '13910682117', '2018年05月14日', '200万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区九渡河镇石湖峪村106号', '北京市', '北京市', '怀柔区', '九渡河镇', '北京市怀柔区九渡河镇石湖峪村106号', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年05月14日', '长期', '2018/5/30', '2019/5/29', '京消协（2018）证字163号', '91110116MA01C4C275', '', '技术服务、技术转让、技术开发、技术推广、技术咨询；城市园林绿化；专业承包、劳务分包、施工总承包；物业管理；销售文化用品、日用品、机械设备；管道疏通；办公室保洁服务；家庭劳务服务；建筑物清洁服务；生活清洗、消毒服务；机械设备专业清洗服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '京盾消安（北京）环保科技有限公司是一家拥有正规资质清洗单位，一直致力于烟道防火清洗养护服务，我单位的服务宗旨是通过与客户建立稳定的服务关系，向客户提供高效专业的多方面服务,使客户在激烈的市场竞争中降低成本。\r\n本着向客户提供专业、快捷、低价、满意的这一宗旨，本公司已向和睦家康复医院、东城党校等各大机关食堂以及那家小馆、小吊梨汤、粥立方、天外天烤鸭店等酒店多家单位提供了常年专业烟道防火清洗养护服务，有效地消除了火险隐患，确保了用户生产安全，受到用户的广泛好评。\r\n    ***** 为了给客户减少成本，在提供高质量的消防清洗服务的同时，同时提供部分设备的检修保养工作，并对客户的设备配件进行盘点备档，确保在客户设备发生故障时更加快捷的进行维修服务，将客户的维修费用和损失控制在最低。我公司的技术人员均有五年以上的经验，训练有素的专业技术服务队伍随时待命，为您24小时提供服务。', '116.320628', '40.408729999999998', '116.320628', '40.408729999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3973', '奥来国信（北京）检测技术有限责任公司', '399', '孙文伟', '13901035996', '彭文浩', '13683206462', '2000年04月26日', '931.7647万元', '北京市', '北京市', '顺义区', null, '北京市顺义区高丽营镇顺于路高丽营段138号院', '北京市', '北京市', '顺义区', '高丽营镇', '北京市顺义区高丽营镇顺于路高丽营段138号院', '', '电气防火', '有限责任公司（自然人投资或控股）', '2000年04月26日', '2020年04月25日', '2018/3/19', '2019/3/18', '京消协（2019）证字062号', '91110113717737106F', '电气防火检测技术服务机构', '建筑工程质量检测；工程材料及建筑装饰、装修材料检测；室内环境检测；钢结构及压力容器的检测；工程测量服务；环境监测；测检科学技术研究；维修消防设备；职业健康技术服务；质检技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '奥来国信（北京）检测技术有限责任公司是经中国合格评定国家认可委员会、北京市质量技术监督局、北京市消防协会、北京市公安局消防局、北京市住房与城乡建设委员会、北京市安全生产监督管理局、北京市环境保护局、北京市司法局及等政府主管部门批准与认可的第三方检测、鉴定与评价机构。\r\n公司于2000年4月经北京市工商行政管理局批准依法注册成立，具有独立法人资格。注册资本为931.7647万元，实验室面积7000余平米，拥有国外引进和国内购置先进仪器设备1000余台套，各类专业技术及管理人员近300人。其中，国家级注册实验室资质认定、实验室认可评审员5人；国家一级注册结构工程师5人；注册土木工程师（岩土）1人，一级建造师2人；注册安全工程师1人；正高级职称2人；高级工程师15余人，工程师30余人；国家质检总局无损检测三级人员3人，二级人员4人；建设项目职业病危害评价师23人；司法鉴定人10余人。\r\n公司下设质量科技安全部、行政安全部、人力资源部、业务部、财务部及综合服务部等职能部门，并按专业不同设立工业与建材事业部（材料检测室、节能检测室、结构消防与防雷检测室、无损检测室、质量技术管理室），环境与健康事业部', '116.55798', '40.131079999999997', '116.55798', '40.131079999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3974', '北京中加全成消防科技有限公司', '398', '丁德胜', '13366882608', '丁永其', '17661936691', '2013年08月06日', '1800万元', '北京市', '北京市', '丰台区', null, '北京市丰台区石榴园北里42号楼一层2-3单元115', '北京市', '北京市', '丰台区', '东铁匠营街道', '北京市丰台区石榴园北里42号楼一层2-3单元115', '', '消防设施,电气防火', '其他有限责任公司', '2013年08月06日', '2033年08月05日', '2019/3/6', '2020/3/5', '京消协（2019）证字091号', '91110106074107660Y', '电气防火检测技术服务机构', '技术检测；技术开发、技术咨询、技术服务；维修消防器材、机械设备；劳务服务。（领取本执照后，应到市质量技术监督局计量认证取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中加全成消防科技有限公司是专业从事电气防火安全及建筑消防设施检测，消防技术服务，消防系统维护保养的公司。 公司拥有北京市质量技术监督局颁发的计量认证证书，北京市公安消防总队颁发的消防技术服务机构一级资质证书，北京消防协会颁发的电气防火检测技术服务机构资信证书，公司现有高级、中级工程师，中级技术人员40多人。拥有多支经验丰富的专业检测队伍和国内外最先进的电气及消防设施检测设备。公司已通过质量管理体系、环境管理体系、职业健康安全管理体系认证。   \r\n公司严格执行国家及北京市相关技术规范，自觉遵守行业自律规则，严格内部管理，努力提高从业人员素质，不断完善质量保证体系，全心全意为客户提供优质的消防设施检测服务和电气防火检测服务，为客户和消防监督机关提供详细、客观、科学、公正、真实的检测报告。 \r\n公司将始终以诚信赢得商机、专业铸就品质的企业精神和对质量精益求精、对服务尽善尽美的服务宗旨，长期致力于为客户提供高科技消防安全产品和全方位的消防安全服务。', '116.419804', '39.846637999999999', '116.419804', '39.846637999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3975', '北京赛沃斯环保工程有限公司', '397', '龚艳霞', '13521564735', '王正萍', '13691556138', '2016年08月05日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-L293', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区小屯路89号航天石化大厦九层920', '', '消防设施,烟道清洗,消防产品', '有限责任公司（自然人独资）', '2016年08月05日', '2046年08月04日', '', '', '', '91110111MA007H079Q', '', '噪音污染治理服务；专业承包；环保技术开发、技术咨询（中介除外）、技术服务、技术转让；清洁服务（不含洗车服务）；销售、安装、维修环保节能设备、水处理设备、光电设备、通讯设备（卫星接收设备除外）、水暖器材；销售五金、交电、化妆品、日用杂品；经济信息咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京赛沃斯环保有限公司有一批自2010年开始涉足清洗服务行业的专业人员组成的技术服务型企业。在实际的烟道防火清洗、通风管道清洗服务行业里有着丰富的实际工作经验。\r\n         公司拥有多套清洗检测机器人、清洗负压机、升降机等清洗专用设备。技术人员中电工、暖通、空调制冷、电焊、有限空间作业、高处作业等专业岗位资质。熟练掌握各系统清洗服务的管理及作业技术。\r\n        “赛沃斯” 是一个精诚合作、锐意进取的管理团队。具有一批高素质的服务技术人员，一支训练有素、经验丰富的队伍。\r\n        “赛沃斯” 以技术清洗服务为向导，致力于消除火险隐患、提高设备的运行效率、节能降耗、延长设备使用寿命、降低设备运行成本，确保用户消防安全，营造健康卫生的工作环境。\r\n         “赛沃斯” 坚持“诚信为本，服务至上”的原则，从用户需要出发，以用户满意为指导，为用户量身定做科学的技术服务方案，让用户感受专业一流的服务。', '116.016452', '39.705629000000002', '116.251369', '39.877384999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3976', '北京湘秦装饰材料有限公司', '396', '李奇', '', '李奇', '13691589165', '2014年06年04日', '900万元', '北京市', '北京市', '丰台区', null, '北京市丰台区方庄芳星园二区13号楼2号平台52号', '北京市', '北京市', '丰台区', '大红门街道', '大红门西里19号院', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年06年04日', '2034年06年03日', '', '', '', '91110106397179052F', '', '销售装饰材料、建筑材料、金属材料、五金交电（不含电动自行车）、服装、服饰、针纺织品、日用品、工艺品、文具用品、机电设备、机械设备、厨房用具、电子产品；清洁服务；经济信息咨询；技术服务；城市园林绿化。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '北京湘秦环保科技发展有限公司始建于20世纪21世纪交替时期，发展于中国的改革高潮之际，坐落在北京市丰台区方庄产业园。主要从事厨房的油烟管道清洗。公司经过合并(原北京铁科联环保科技发展有限公司)于2014年6月份整改为现北京湘秦环保科技发展有限公司。·现拥有一批优秀的清洗人员，技术人员，中层领导12人，公司设有从事厨房油烟管道的设计与制造，市场营销，以及管理等部门。2014年8月创造了后厨一体化服务，从设计到安装，清洗，维修一条龙的服务战略。公司的经营目标和方向是：内塑素质，外塑形象，在下个五年内，成为行业的主力军。成为一个合格的企业，公司以“专业清洗用心服务”，为核心价值，希望通过我们的专业水平和不懈努力，塑造中小型企业形象。同时还建立了完善的售后服务体系，为企业发展中遇到的问题和困难提供指导帮助。我们相信，通过我们的不断努力和追求，一定能够实现与中小企业的互利共赢。', '116.43419', '39.865560000000002', '116.401824', '39.838146000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3977', '北京世纪昊诚消防安全科技有限公司', '395', '李宗堂', '13301337870', '马冲', '13366672139', '2011年06月17日', '1020万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区西大望路27号[2-1]42幢3层301', '北京市', '北京市', '朝阳区', '劲松街道', '北京市朝阳区西大望路27号[2-1]42幢3层301', 'AA', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2011年06月17日', '2031年06月16日', '2019/9/25', '2020/9/24', '2019-HY-0053', '91110105576887660M', '消防设施  电气防火', '技术推广服务；产品质量检验。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '《北京世纪昊诚消防安全科技有限公司》是从事建筑消防设施维护保养、建筑消防设施、电气防火安全检测的专业检测技术服务公司，经北京市公安消防局、北京市消防协会审核批准、北京市技术监督局、北京市工商局核准依法成立于2011年6月17日，注册资金1020万元，同时成为北京消防协会会员单位。公司拥有精良的检测设备（红外热像仪、红外测温仪、真有效电流表、数字微压计、照度计、火灾探测器实验装置等）。高级工程师多名，均从事十几年消防施工、安装经验，一级消防工程师多名，二十多名专业检测技术人员。我公司以热情的服务态度、严谨的工作作风、科学的检测手段和合理的收费价格，依据有关法规和消防规范对建筑设施、电气防火安全进行检测，出具科学的检测报告，并协助使用单位对设备故障进行维修、保养，保障了建筑的消防安全，赢得了社会各界的好评。在与时俱进的今天，公司将一如既往以科学、准确、高效、热情为行为准则，为您提供一流的检测质量和一流服务。为发展首都消防现代化，保障经济建设和人民生命财产安全做出贡献！', '116.47786000000001', '39.884807000000002', '116.47786000000001', '39.884807000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3978', '北京三通伟业安全自动化工程有限公司', '392', '孙新华', '13311088111', '郭静', '13810999920', '2004年11月02日', '5518万元', '北京市', '北京市', '昌平区', null, '北京市昌平区城北街道昌崔路198号院9号楼6层610', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区金庄1号院1号楼3层301室', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2004年11月02日', '2024年11月01日', '2018/9/26', '2019/9/25', '京消协（2018）证字299号', '911101087684639180', '', '施工总承包；专业承包；劳务分包；工程造价咨询；技术开发、技术转让、技术咨询、技术服务、技术推广；销售安全防范技术产品；计算机技术培训；计算机系统服务；数据处理；计算机维修；基础软件服务；应用软件服务；销售计算机、软件及辅助设备、电子产品、机械设备、通讯设备、五金、交电、化工产品（不含危险化学品及一类易制毒化学品）、日用品、家用电器、金属材料、文化用品；软件开发。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京三通伟业安全自动化有限公司是一家为社会提供建筑智能化系统工程、安全防范系统工程等综合系统服务的专业化企业。主要业务范围为安防工程，消防设施工程，建筑装修装饰工程，建筑机电安装工程，环保工程，安防监控行业监控安装,网络监控设备,数字监控设备,监控报警设备器材等安防产品的生产并提供安防监控解决方案，。\r\n公司成立于2004年，先后获得安防工程企业设计施工维护能力壹级证书，建筑业企业资质证书包含建筑装修装饰工程专业承包贰级、消防设施工程专业承包贰级、电子与智能化工程专业承包贰级、特种工程（结构补强）专业承包不分等级、建筑机电安装工程专业叁级、环保工程专业承包叁级、模板脚手架专业承包不分等级，并通过ISO9001质量管理体系认证。作为提供以应用解决方案为核心的系统集成服务商，公司有经验丰富的专业工程师、项目技术负责人及工程技术人员。公司秉承“诚信、专业、共赢”的经营理念,坚持用户至上、质量第一，以科技服务客户，坚持技术进步、不断创新、不断超越，已经成为一家在安全防护行业颇具实力和规模的企业。', '116.265525', '40.217485000000003', '116.28068', '39.944029', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3979', '北京博霖翔皓消防科技有限公司', '391', '刘军伟', '13911190139', '刘春', '15810925817', '2012年04月18日', '1000万元', '北京市', '北京市', '西城区', null, '北京市丰台区马连道卫强校村118号483室', '北京市', '北京市', '西城区', '广安门外街道', '北京市丰台区马连道卫强校村118号483室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2012年04月18日', '20312年04月17日', '2018/11/9', '2019/11/8', '京消协（2018）证字358号', '911101065938263928', '电气防火检测技术服务机构', '技术服务；技术咨询；建筑消防设施检测；电气防火检测；清洁服务；劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京博霖翔皓消防科技有限公司是专门从事建筑消防设施检测、电气防火检测、消防设施维护保养的专业公司。公司注册资金1000万元，通过了ISO9001:2015质量管理体系认证，是首批通过北京市质量技术监督局计量认证（CMA证书编号：170121020468）和北京市消防局消防技术服务机构临时一级认证（证书编号：京公消技字[2014]第022号）的单位之一。\r\n公司现有管理及检测人员16名，其中高级工程师技术职称1名，中级工程师技术职称2名，一级注册消防工程师2名，中级建（构）筑物消防员10名。\r\n公司配备了先进的检测仪器设备，例如红外热成像仪、超声波探测仪、漏电电流测试仪、可燃气体浓度测试仪、钳型电流表、万用表、风速仪、微压计、真有效值钳型电流表、数字微压计、数字式照度计、声级计、水压表、压力表、加烟器等，同时对所有仪器定期进行校准或检定，为保证检测质量提供了强有力的支持。', '116.328337', '39.874474999999997', '116.328337', '39.874474999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3980', '北京隆安鸿运消防设施技术检测有限公司', '390', '祝春松', '13801290942', '祝春松', '13801290942', '2005年12月15日', '500万元', '北京市', '北京市', '平谷区', null, '北京市平谷区平谷镇民迎路6号', '北京市', '北京市', '平谷区', '兴谷街道', '北京市平谷区平谷镇民迎路6号', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2005年12月15日', '2025年12月14日', '2015/11/18', '2016/11/17', '京消协证字493号', '91110117783206389G', '电气防火检测技术服务机构', '消防设施技术检测；电气防火检测；技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京隆安鸿运消防设施技术检测有限公司（以下简称公司）成立于2005年12月15日，是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，并已通过了ISO9001:2008质量管理体系认证。通过我们不断的努力，依靠诚信务实的经营理念，“客户第一、质量第一、服务第一”。凭借着过硬的专业技术、良好的信誉、严格管理制度、质量监督制度，为用户提供快速有效的消防安全保障。', '117.125163', '40.160482000000002', '117.125163', '40.160482000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3981', '北京众创蓝天环保科技有限公司', '389', '刘春梅', '13811009335', '李变', '13439681186', '2017年02月16日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区酒仙桥路2号院内（707厂）（5-2）2层212', '北京市', '北京市', '朝阳区', '豆各庄地区办事处', '北京市朝阳区西直河152号', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2017年02月16日', '2037年02月15日', '2018/6/8', '2019/6/7', '京消协（2018）证字181号', '91110105MA00C1T77K', '', '技术推广服务；清洁服务（不含餐具消毒）；大气污染治理设施运营服务；销售机械设备、家用电器、卫生间用品、厨房用具；物业管理、花卉租摆、害虫防治服务；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司简介\r\n\r\n北京众创蓝天环保科技有限公司是工商行政管理机关正式注册的专业化清洗维保生产安装销售净化器设备，公司所有管理及操作人员均经过严格培训上岗，达到专业水准。公司自成立以来始终秉承着“客户第一，质量第一、服务第一、信誉至上”的服务宗旨，发扬专业、高效、及时、严谨的工作风格，用我们一流的服务为客户创造一个清洁舒适环境的经营理念，参与了多家单位的净化环保工程，深受广大客户的好评。我公司致力于创品牌、树形象，营造一个健康、清洁、文明的生活空间是我们共同的目标。\r\n    我公司主要是以销售机械设备油烟净化设备，清洁服务（不包含餐具消毒）；中央空调通风系统清洗；厨房排油油烟管道清洗；制作；安装；工程勘察；工程设计。同时在社会各界的大力支持下，本着“以质量求生存，以创新求发展”的精神，使我公司迅速成为了具有现代化的管理、高技术水平、有丰富实践经验及高度责任感的敬业团体。 \r\n    随着我国经济的不断发展，人们的生活水平和工作环境越来越好，清洁成为物业维护最基本的要素之一。现代油烟净化工程工作是一门科学、一门专业，不仅是城市清洁、美观、空气清新，为人们的身心健康提供有力的保障。\r\n    在日常管', '116.48824999999999', '39.983477999999998', '116.535447', '39.843221', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3982', '北京天瑞平环保科技有限公司', '388', '李丹丹', '010-52870605', '封子庄', '13718949946', '2008年06月24日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区化工路59号院1号楼1至14层01内B座六层706室', '北京市', '北京市', '朝阳区', '垡头街道', '北京市朝阳区化工路59号院1号楼1至14层01内B座六层706室', '', '烟道清洗', '有限责任公司（自然人独资）', '2008年06月24日', '2028年06月23日', '', '', '', '911101086774300535', '', '技术开发、技术推广、技术服务、技术咨询；建筑物清洁服务；清洁服务（不含餐具消毒）；大气污染治理设施运营；销售机械设备、家用电器、厨房及卫生间用具；物业管理；花卉租摆；害虫防治服务；专业承包；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天瑞平环保科技有限公司成立于2008年06月。专业从事中央空调通风系统清洗、排油烟管道系统的清洗、冷却塔清洗、改造安装，外墙清洗等业务。\r\n我公司引进了澳大利亚空调清洗设备，德国排油烟管道清洗设备。为保质保量的清洗服务奠定了良好的设备基础。\r\n我公司专业服务资质齐全，具有优良的施工队伍，是为客户优质服务的保证。\r\n我公司以高科技为导向，以服务及产品为途径，致力于改善现代化楼宇内的空气质量，餐饮行业安全营运，为现代都市人营造健康卫生的生存环境。\r\n   我公司坚持“诚信为本，服务至上”的原则，从客户需要出发，以客户满意为指导，为客户量身定做科学的清洗方案，让客户享受专业一流的服务。\r\n   我公司拥有一个精诚合作、锐意进取的管理团队，一批高素质的工程技术人员，一支训练有素、经验丰富的工程队伍，确保清洗工程高效、高速、高品质地完成。\r\n我公司在2008年奥运期间为中国的中央空调清洗、餐饮行业防火安全、起到了应有的作用。取得了北京市卫生部门的跟定和好评。\r\n  我公司在同行业相比，我公司成立早、技术力量雄厚，拥有一批高素质、能吃苦耐劳的施工人员。公司现有经济师1名，高级工程师1名，工程师2名，技术工人', '116.531795', '39.851170000000003', '116.531795', '39.851170000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3983', '北京佰易和环保工程有限公司', '386', '牛红英', '13811680089', '王军', '13701286058', '2010年02月24日', '100万元', '北京市', '北京市', '丰台区', null, '北京市区刘家村127号西3号', '北京市', '北京市', '丰台区', '新村街道', '北京市区刘家村127号西3号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年02月24日', '2030年02月13日', '2018/11/26', '2019/11/25', '京消协（2018）证字412号', '911101065514125467', '排油烟设施清洗机构', '劳务分包；固体废物污染治理、烟气治理；清洁服务；害虫防治服务；维修厨房设备；销售厨房用具、家用电器、机械设备、电子产品、日用品、汽车配件、五金交电、办公用品、通讯设备；广告制作；家居装饰；技术开发、技术服务、技术咨询、技术转让。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '佰易和环保工程有限公司，是经消防协会培训考试的专业防火清洗会员单位，连续多年被评为消防协会先进单位。主要从事油烟管道清洗、大型的餐饮食堂等排油烟系统清洗、油烟净化器清洗，专业维修、维护全面升级改造油烟净化系统，达到北京最新环保标准。公司自2010成立以来，一直致力于烟道防火清洗养护服务，专业维修、维护、升级改造油烟净化器系统、精良化工作。佰易和公司凭着良好的信用和优良的服务与多家企事业单位建立了长期的合作关系。本公司已向多家机关单位、院校、酒店提供了常年专业的烟道防火清洗养护服务和净化器升级改造服务。有效的清除了火险隐患，确保了用户消防安全，受到用户的广泛好评。\r\n      佰易和公司凭借多年的专业清洗经验，根据油烟管道的特殊性，自行研制了适合不同排油烟管道的新型高效油烟管道清洗器和新型多功能排烟设施清洗机，通过现场施工验证，得到了客户的高度肯定。提高了油烟管道清洗的工作效率，更加保证了清洗服务质量，大大降低了火灾隐患。公司经过多年不懈努力，在不断的开拓创新的同时，不断提高公司员工的服务意识和管理水平，为未来油烟管道清洗注入了最新的技术力量，为低端产业转型奠定了坚实的基础。', '116.303585', '39.845843000000002', '116.303585', '39.845843000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3984', '北京汇杰嘉业科技发展有限公司', '385', '王仕刚', '13716204622', '陈莎', '13882146843', '2018年12月24日', '1000万元', '北京市', '北京市', '大兴区', null, '北京市经济开发区荣都东街3号1棟7层2单元510', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市经济开发区荣都东街3号1棟7层2单元510', '', '消防设施,烟道清洗', '有限责任公司（自然人投资或控股）', '2018年12月24日', '长期', '', '', '', '91110302MA01GBJ81D', '', '技术开发、技术服务、技术转让、技术推广、技术咨询；清洁服务；会议服务；销售电子产品、电气设备、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司成立于2018年12月24日，注册资金1000万元，主要经营技术开发，技术服务，技术转让，技术推广、技术咨询；清洁服务；销售电子产品、电气设备、机械设备，清洗油烟，地毯清洗项目。我们公司拥有专业的技术人员，稳定的施工队伍，我们将竭诚为客户服务。', '116.511235', '39.794164000000002', '116.511235', '39.794164000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3985', '北京芯泰环境科技有限公司', '384', '赵峰', '13911750087', '刘蒙', '18801037572', '2015年10月28日', '5000万元', '北京市', '北京市', '昌平区', null, '北京市昌平区回龙观镇北清路1号院7号楼7-3Ｂ-155', '北京市', '北京市', '昌平区', '回龙观地区办事处', '北京市昌平区回龙观镇北清路1号院7号楼7-3Ｂ-155', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年10月28日', '2045年10月27日', '2018/5/22', '2019/5/21', '京消协（2018）证字142号', '91110114MA001KY03L', '排油烟设施清洗机构', '技术开发、技术推广、技术服务、技术转让、技术咨询；施工总承包、专业承包、劳务分包；系统集成；供热服务（不含燃油、燃煤热力生产）；环境监测；城市园林绿化服务；大气污染治理、水污染治理；家庭劳务服务；建筑物清洁服务；销售机械设备、电子产品、化工产品（不含危险化学品）、建筑材料、五金交电、家用电器；维修建筑工程机械设备；合同能源管理；物业管理；投资管理、资产管理、项目投资；货物进出口、技术进出口、代理进出口；城市生活垃圾清扫、收集、运输、处理；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；城市生活垃圾清扫、收集、运输、处理、工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京芯泰环境科技有限公司拥有优秀的管理团队和高素质的技术团队，并与多家知名企业（海立睿能、江苏启能、卫士通信息股份、国电南瑞）达成终端战略合作伙伴关系，有很强的项目策划、项目实施和综合协调能力，并具有丰富的各种复杂条件的项目经验。坚持“节能 低碳 环保 科技 安全 便捷”的企业文化，“以客户为中心，以奋斗者为本”是芯泰员工行事的一贯作风，倡导专业高效、诚信创新，为客户提供绿色环保、温暖舒适的最佳环境解决方案和快速安全的信息自动化网络传输方案以及及服务至上的服务理念， 服务以为客户持续创造价值为己任，在任何时候都结合创造力专业化，进行不断自我更新，坚守品质保证，成为您的首选合作伙伴。依托知名公司的技术支持与自身优秀的管理与技术施工团队公司业绩遍及全国，为客户提供因需而异的冷暖空调、冬季供暖、中央热水的个性化最佳环境整体解决方案和信息自动化传输管理方案，已经在发电、电网、铁路和环保等行业实施诸多成功案例，提供了大量的优质产品和服务，赢得了业界和客户的一致好评和信赖！', '116.287724', '40.098230999999998', '116.287724', '40.098230999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3986', '北京富邦新天地清洁服务有限公司', '383', '廖佼', '15652625159', '廖佼', '15652625159', '2014年05月06日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区石佛营西里12号楼2层07房间', '北京市', '北京市', '朝阳区', '东风地区办事处', '北京市朝阳区石佛营西里12号楼2层07房间', '', '烟道清洗', '有限责任公司（自然人独资）', '2014年05月06日', '2034年05月05日', '2018/5/11', '2019/5/10', '京消协（2018）证字108号', '91110105099315087P', '', '清洁服务（不含餐具消毒）；餐饮服务；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品、餐饮服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京富邦新天地清洁服务有限公司是一家拥有先进设备和高素质的专业技术工程施工人员的保洁服务公司，公司资质齐全、设备先进，竭诚以专业的保洁清洗技术为写字楼、商场、酒店、住宅小区、医院、工厂及学校、企事业单位提供日常保洁、地毯清洗、开荒保洁、大理石翻新养护、外墙清洗、油烟管道清洗等一切保洁业务。服务方式:对玻璃、地面、墙体等处所沽灰法、污垢、水泥点、石灰迹等，以及装修完的各类物业、住宅、为增加卖点，对不易出手的物业进行清洗、翻新。\r\n    我公司无论在技术、设备规模、工作经验均有能力和信心为客户提供高素质的清洁服务。公司自成立以来,本着以质量求生存，以信誉求发展的服务精神,不断拼搏，不断创新，赢得了广大客户的支持和信赖，为广大客户提供低价位，高品质的清洁服务，公司通过与同行之间的学习交流及实干中的积极探索，形成了一套科学的管理体系和专业的清洁程序，为广大客户进行24小时全城服务，能为您服务是我们的理想，能让您满意是我们永远的追求。愿我们的服务给您带来精彩生活每一天。\r\n业务：开荒保洁，大理石翻新养护，外墙清洗，油烟管道清洗，地毯清洗', '116.49992899999999', '39.932547999999997', '116.49992899999999', '39.932547999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3987', '北京信德扬天餐饮管理有限公司', '382', '王洪涛', '18600973976', '王洪涛', '18600973976', '2015年06月24日', '500万元', '北京市', '北京市', '石景山区', null, '双峪路35号院2号10层1001', '北京市', '北京市', '石景山区', '广宁街道', '双峪路35号院2号10层1001', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年06月24日', '2035年06月23日', '2018/10/30', '2019/10/29', '京消协（2018）证字330号', '9111010934838309X0', '', '餐饮管理（未取得餐饮许可不得开展餐饮服务）；项目投资；组织文化艺术交流活动；技术服务、推广、开发、咨询、转让；销售厨房用具、日用品、消防器材、机械设备、五金交电（不含电动自行车）、建筑材料、装饰材料、金属制品、玩具、文化用品、体育用品、空调制冷设备、化工产品（不含危险化学品及一类易制毒化学品）、电子产品、珠宝首饰、新鲜水果、新鲜蔬菜、医疗器械（ⅠⅡ类）、农药、花卉、苗木、不再分装的包装种子；礼仪服务；会议服务；保洁服务；出租商业用房；维修家用电器；家政服务；家居装饰及设计；建筑物外墙清洗服务；大气污染治理；企业管理咨询；合同能源管理；园林景观设计；室内装饰设计；环境保护监测；害虫防治服务；种植苗木、花卉；绿植租摆；婚庆服务；物业管理；专业承包；园林绿化；销售食品；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；销售食品、工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司拥有一批优秀的管理人才及专业技术人员，同时和国内外多所著名高校建立了良好的产、学、研合作关系，建立了一整套完善而优质的销售服务体系。我们在中央空调水系统清洗消毒、风管清洗消毒方面有着丰富的实践经验，能严格按国家颁布的技术规范和行业标准组织设计、生产、施工。我们的愿望是通过努力，降低中央空调风管清洗设备价格，提升中央空调风管清洗工程服务质量，普及中央空调风管清洗概念，推动中央空调风管清洗产业，让更多的人生活在健康自然的清新空气中，自由地呼吸，成为您中央空调专业的卫生预防服务师。', '116.113725', '39.935701999999999', '116.113725', '39.935701999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3988', '北京金玉升环保科技有限公司', '380', '范文章', '18901191067', '张生玘', '13811781298', '2016年03月16日', '100万元', '北京市', '北京市', '延庆区', null, '北京市延庆区八达岭经济开发区康西路2055号', '北京市', '北京市', '延庆区', '康庄镇', '北京市延庆区八达岭经济开发区康西路2055号', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年03月16日', '2036年03月15日', '2018/5/11', '2019/5/10', '京消协（2018）证字104号', '91110229MA0045TY52', '', '技术开发、技术推广、技术转让；烟囱清洗服务；大气污染治理；专业承包、劳务分包；会议服务；承办展览展示；商务咨询；公司礼仪服务；销售日用品、清洁用具、建筑材料、花卉作物、文化用品、五金、交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金玉升环保科技有限公司是一家专业从事清洁服务为一体的服务型的公司,业务范围包括大型酒店油烟机清洗、净化器清洗，风机清洗、大型工厂,外墙清洗、地板打蜡等业务。服务区域遍及北京市各区。我公司配有多辆施工工程车，各地工程业务均方便施工操作。\r\n      公司自成立以来，经过实践与经验积累，已经建立了一套比较完善的管理体系和质量监督体系，竭诚为所有城区的饭店、宾馆、商场、写字楼、家庭、工厂、各种大型的展会等，提供全方位保洁服务。公司拥有先进的设备，优质的工作员工及一流的服务质量。 我公司不仅拥有专业的保洁技术人员，并有一流的机械设备，如拍照摄像机器人，升降机，高压清洗设备等。', '115.85913600000001', '40.405979000000002', '115.85913600000001', '40.405979000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3989', '北京绿源恒辉科技发展有限公司', '379', '王国伍', '18611079008', '王兴东', '13911726682', '2015年12月29日', '1018万元', '北京市', '北京市', '丰台区', null, '科学城海鹰路8号1号楼8层095室', '北京市', '北京市', '丰台区', '新村街道', '科学城海鹰路8号1号楼8层095室', 'AA', '烟道清洗', '有限责任公司（自然人投资或控股）', '2015年12月29日', '2035年12月28日', '2018/12/19', '2019/12/18', '京消协（2018）证字450号', '91110106MA002UFX5J', '烟道清洗', '技术开发、技术服务、技术咨询；清洁服务；日用电器维修（限符合家用电子电器维修业服务经营规范）；销售厨房用具、不锈钢制品、制冷设备、电子产品、空气净化设备、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京绿源恒辉科技发展有限公司，成立于北京市丰台区企业总部基地，注册资本1018万元。在同行业中率先通过了ISO9001质量管理体系认证，ISO14001环境管理体系认证和OHSAS18001职业健康管理体系认证。北京市消防协会会员单位，中国清洗协会会员单位。公司一直致力于为企事业单位、宾馆酒店、餐饮场所的后厨油烟设施，中央空调，玻璃幕墙等清洁保养服务，开发、生产、销售现代化新型清洁保洁产品，开展技术培训、连锁服务及中央空调与热能设备应用技术的研究。\r\n公司拥有一支稳定而优秀且训练有素的专业技术人员队伍，具有强大的技术力量和施工能力，施工质量获得了客户和社会各界的广泛认同。\r\n    公司本着“树德、诚信、立世”的原则，严格按照“系统调查、科学分析、高质量施工、完善的售后支持”的工作流程，坚持“诚信为本，操守为重”的企业宗旨，信守“高效、专业、严谨”的职业道德，依靠客户的支持、广泛的公共关系资源、优秀的企业文化和诚信的服务意识，致力于为客户提供优质、高效的服务。', '116.281137', '39.826773000000003', '116.281137', '39.826773000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3990', '北京博亚盛技术检测有限公司', '378', '孙新华', '13311088111', '郭静', '13810999920', '2014年07月17日', '1000万元', '北京市', '北京市', '海淀区', null, '北京市海淀区金庄1号院1号楼3层301室', '北京市', '北京市', '海淀区', '曙光街道', '北京市海淀区金庄1号院1号楼3层301室', '', '消防安全评估,消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2014年07月17日', '2044年07月16日', '2019/1/11', '2020/1/10', '京消协电证字（2019）003号', '911101063063601640', '', '技术检测；技术服务；维修机械设备（不含汽车）；销售机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京博亚盛技术检测有限公司创始于2014年，是北京市第一批取的消防设施维护保养检测正式资质、消防安全评估正式资质、雷电防护装置检测资质的公司之一。公司先后获得了CMA计量认证证书，ISO9001质量体系认证，ISO14001：2004环境管理体系认证、OHSAS18001：2007职业健康安全管理体系认证。\r\n北京博亚盛技术检测有限公司清楚地认识到企业的生命在于质量、企业的活力在于人才，公司拥有一支专业精通、技术精良、操作规范、管理严格、人员稳定的文明施工队伍。\r\n公司主要业务是根据客户的具体要求承接各种防雷检测项目、消防检测项目、消防维保项目、消防安全评估项目。采用国内外先进技术，提供完备的检测、维护等服务。公司的宗旨：精湛的施工技术；先进的检测管理；完善的质量保证体系；诚实的售后服务是我们追求的唯一目标。\r\n近年来，公司凭借丰富的检测技术经验及良好的售后服务承接北京市及周边地区大小防雷检测、消防检测、消防维护保养、消防安全评估项目500多项，公司面向各类重要政治活动场所、写字楼、学校、医院、大型商场、各类工矿企业、专业仓库、酒店宾馆、住宅社区等建筑设施。公司将竖立和发展现代企业管理模式，', '116.28174300000001', '39.943767000000001', '116.28174300000001', '39.943767000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3991', '北京市大兴区众合平安消防职业技能培训学校', '377', '林森', '13001070388', '韩忠', '13051258251', '', '', '北京市', '北京市', '大兴区', null, '北京市经济技术开发区地盛中路3号中辉世纪传媒大厦', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市经济技术开发区地盛中路3号中辉世纪传媒大厦', '', '宣传教育培训', '民办非企业单位', '', '', '2018/5/21', '2019/5/20', '京消协培证字（2018）006号', '52110115MJ0340469F', '', '', '北京市大兴区众合平安消防职业技能培训学校总校坐落于大兴区经济技术开发区，是经北京市人力资源和社会保障部门批准，北京市民政部门注册，北京市消防部门评审通过的专业从事“消防职业资格培训”和“消防安全专项培训”的一级职业学校。\r\n  学校坚持求真务实、锐意创新，率先实现了消防职业教育领域的若干重大创新，探索出一条行之有效的高技能人才培养模式，形成了以高级技能培训，高端带动各层次职业技能培训协同并进的职业培训新格局。学校以“重点突出实际技能训练，理论和实践紧密衔接的特点，着重培养学生的实际操根据国家劳动和社会保障部新【国家消防设施操作员​‌‌职业标准】，我校常年开设初、中、高级消防设施操作员学习培训班。\r\n    学校师资力量雄厚。其中拥有二名全国消防科学传播专家团成员，高级工程师十一人，工程师五人，一级注册消防工程师三人，一级建造师二人，高级消防设施操作员考评专家四人，高级消防设施操作员九人。\r\n      学校一线教师团队拥有多名实际工作经验丰富的教师，多次参与国家重点项目消防设施的检测评定工作。多次参与北京市地方标准及北京消防团体标准的编写与审定工作。', '116.50158', '39.786866000000003', '116.50158', '39.786866000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3992', '一诺美家（北京）清洁服务有限公司', '376', '李燕', '15101087517', '葛华彬', '18910211257', '2013年08月08日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰管路22号院12幢203-1', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区丰管路22号院12幢203-1', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年08月08日', '2033年08月07日', '2018/6/15', '2019/6/14', '京消协（2018）证字197号', '91110106076641349L', '排油烟设施清洗机构', '专业承包；清洁服务；家用电器维修；技术开发、技术服务；销售家用电器、厨房用具、五金交电、机械设备、化工产品（不含危险化学品）、办公用品、日用品；害虫防治服务；灭鼠及预防服务；化粪池清掏；工程设计。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '专业承包，清洁服务，家用电器维修，技术开发，技术服务，销售厨房用具。', '116.313866', '39.857754', '116.313866', '39.857754', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3993', '北京鸿基消防文化发展有限公司', '374', '韦安庆', '13381326833', '韦安庆', '13381326833', '2015年04月28日', '1190万元', '北京市', '北京市', '石景山区', null, '北京市石景山区八宝山南路重兴嘉园4号楼4层402-18', '北京市', '北京市', '石景山区', '八宝山街道', '北京市石景山区鲁谷大街53号西富港写字楼418', '', '宣传教育培训,烟道清洗', '有限责任公司（自然人独资）', '2015年04月28日', '2045年04月27日', '2018/3/12', '2019/3/11', '京消协（2018）证字055号', '91110105339783243A', '排油烟设施清洗机构', '组织文化艺术交流活动（不含演出）；技术开发、技术转让、技术咨询、技术服务；销售社会公共安全设备、五金交电（不含电动自行车、不从事实体店铺经营）、建筑材料（不从事实体店铺经营）、工艺品、文具用品、钢材、机械设备、电子产品、体育用品、电子产品、家用电器、环保设备、厨房用具、化工产品（不含危险化学品）、金属材料、花卉、草、观赏植物、专用设备、汽车配件；承办展览展示活动；设计、制作、代理、发布广告；产品设计；城市园林绿化；建筑物清洁服务；锅炉烟囱的清扫；保洁服务；大气污染防治；企业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鸿基消防文化发展有限公司是全国首家综合性消防文化公司，成立于2015年4月，公司秉承“以安全为标准尽到责任”的经营理念，坚定“让中国消防文化走进世界”的目标，主营六大核心业务：消防安全宣传培训（科普培训）、消防科技新产品孵化、消防宣传设计制作、消防器材装备展览、消防安全论坛举办、消防公众媒体宣传。通过几年的不懈努力，赢得社会大众的广泛认可，收获了良好的社会、经济与人文效益，为公司发展壮大提供了广阔前景，为传统消防事业转型升级提供了有效借鉴。', '116.230811', '39.891019', '116.231382', '39.889704999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3994', '北京亚太鸿基建设工程有限公司', '373', '李新年', '18511975333', '焦辉', '15701639672', '2017年06月07日', '1833万元', '北京市', '北京市', '房山区', null, '北京市房山区城关街道顾八路1区1号-T365', '北京市', '北京市', '石景山区', '八宝山街道', '北京市石景山区鲁谷大街53号西富港写字楼420', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2017年06月07日', '2047年06月06日', '2018/3/12', '2019/3/11', '京消协（2018）证字054号', '91110111MA00F5A65B', '', '专业承包；劳务分包；工程招标代理；工程造价咨询、工程技术咨询（中介除外）；园林绿化服务；租赁建筑机械设备；销售电子产品、电器设备、建筑材料、机械设备、装饰材料、保温材料、金属材料、门窗、五金、交电；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京亚太鸿基建设工程有限公司成立于2017年6月，坐落于石景山区鲁谷大街53号西富港写字楼420室，公司注册资金1833万元，主要从事消防工程施工、消防设施维护保养与检测。公司现处于大力发展期，成立以来，我们始终为客户提供好的产品和技术支持、健全的售后服务，我们有专业的商务和技术团队，公司秉承“以安全为标准尽到责任”的经营理念，赢得了社会大众的认可，收获了良好的社会、经济效益，为公司发展壮大提供了广阔前景。', '116.018866', '39.708221999999999', '116.231382', '39.889704999999999', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3995', '北京神吉啦商贸有限公司', '372', '王艳奎', '13910265888', '马添翼', '13701136564', '2011年12月27日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区马家堡路88号5号楼1门2210室', '北京市', '北京市', '丰台区', '大红门街道', '北京市丰台区马家堡路88号5号楼1门2210室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2011年12月27日', '2031年12月26日', '2018/8/15', '2019/8/14', '京消协（2018）证字267号', '9111 0106 5891 3513 4E', '', '销售日用品、化妆品、五金交电、家用电器、机械设备、汽车配件、电子产品、化工产品（不含危险化学品）、农药、针纺织品、通讯设备、珠宝首饰、工艺品、服装鞋帽、文具用品、体育用品、建筑材料、装饰材料、箱包、厨房用具、卫生间用具、茶具、塑料制品、陶瓷制品、玻璃制品、家具、钟表、眼镜、玩具、计算机软硬件及辅助设备、粮食、新鲜水果、新鲜蔬菜；开锁服务、修锁、配钥匙；清洁服务；灭鼠服务；虫害防治；大气污染治理；绿化管理；花卉租摆；机械设备租赁；技术开发、技术转让、技术服务、技术咨询；经济信息咨询；制作、代理、发布广告；组织文化艺术交流活动；承办展览展示；企业管理咨询；货物进出口、代理进出口；销售食品。（企业依法自主选择经营项目，开展经营活动；销售食品以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '企业简介\r\n　　北京神吉啦商贸有限公司是一家综合性商贸及服务公司。涉及行业广泛，其中，专注于锁具及智能防盗产品销售、安装；灭蟑螂灭鼠消杀服务；餐厅厨房大型油烟管道清洗等服务行业，总部设立于首都北京，并在全国主要地区设有分支机构。公司自成立以来，始终坚持以人为本、诚信立业的经营原则，荟萃业界精英，将国内外先进的服务行业经验与本地实际情况相结合，为企业机构及家庭提供全方位的服务解决方案，不断实现生产生活安心、畅心。公司在多地设有上门服务机构。系中国防盗联盟协会会员单位、中国保安协会锁具分会会员单位、北京有害生物防治协会会员单位、北京消防协会会员单位', '116.384112', '39.854126999999998', '116.384112', '39.854126999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3996', '北京东方雄安消防技术服务有限公司', '371', '吕珍', '13718197078', '吕珍', '13718197078', '2012年05月18日', '506万元', '北京市', '北京市', '丰台区', null, '北京市丰台区六里桥甲1号01号楼（悦都大酒店1716-1719室）', '北京市', '北京市', '丰台区', '太平桥街道', '北京市丰台区六里桥甲1号01号楼（悦都大酒店1716-1719室）', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2012年05月18日', '2042年05月17日', '2018/11/9', '2019/11/8', '京消协（2018）证字368号', '91110106596026892J', '电气防火检测技术服务机构', '技术开发、技术服务、技术检测；消防设施维护；销售电子产品、机械设备、文具用品、社会公共安全设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东方雄安消防技术服务有限公司是经北京市消防协会专家评审委员会评定，具备电气防火检测和建筑消防设施检测、消防设备维护保养的专业单位。', '116.306304', '39.883805000000002', '116.306304', '39.883805000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3997', '北京清江源技术服务有限公司', '370', '周岳翠', '13520133020', '张家俊', '13801072483', '2005年06月07日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区长兴路16号院1号楼6层617', '北京市', '北京市', '丰台区', '长辛店镇', '北京市丰台区长兴路16号院1号楼6层617', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年06月07日', '2025年06月06日', '2018/12/28', '2019/12/27', '京消协（2018）证字487号', '911101067763780005', '', '技术服务、开发、转让、咨询；信息咨询；保洁服务；维修厨房用具；销售仪器仪表、电子产品、家用电器、日用品、建筑材料（不得从事实体店铺经营）；害虫防治服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京清江源技术服务有限公司（简称清江源）是北京市消防协会团体会员单位，是经消防部门审批的专业防火清洗企业，具备厨房烟囱排油烟管道清洗技术服务质量体系单位资信证书及清洗技术人员上岗证书。\r\n    清江源公司注册资本500万元，现有员工约60人，其中专业技术人员占60％，拥有一批经验丰富的专业清洗技术人员和训练有素的专业施工队伍。公司引进德国高温高压清洗设备，技术先进、清洁度高，具有很强的综合实力，可确保清洗质量。\r\n    清江源公司近年来已为北京海南航空基地、北京大学医学部、政法大学、环球贸易中心、国家商务部、房山绿地缤纷城、世贸天阶、喜来登酒店、英蓝国际金融中心、国家奥林匹克体育中心、中办秘书局、解放军总医院、中国农业银行总行、芳草地中心等500余家酒楼、宾馆、机关、学校进行累计几千次防火清洗，清洗面积几十万平方米，有效地消除了火灾隐患，确保用户消防安全，受到用户的广泛好评。\r\n    清江源公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，全体员工将继续团结奋进为首都的社会经济发展和两个文明建设做出不懈的努力，为首都的社会公共安全事业做出更大的贡献！', '116.186144', '39.832428999999998', '116.186144', '39.832428999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3998', '北京弘锐消防科技服务有限公司', '369', '詹春阳', '13311363587', '宋玉龙', '13146556682', '2010年11月12日', '500万元', '北京市', '北京市', '大兴区', null, '北京市大兴区春和路39号院3号楼2-511', '北京市', '北京市', '大兴区', '国家新媒体产业基地', '北京市大兴区春和路39号院3号楼2-511', '', '消防安全评估,消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2010年11月12日', '2040年11月11日', '2018/4/24', '2019/4/23', '京消协（2018）证字084号', '911101065636083274', '电气防火检测技术服务机构', '技术开发、技术咨询、技术推广、技术服务、技术转让；技术检测；消防设施检测；消防设施维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京弘锐消防科技服务有限公司成立于2010年11月12日，经国家工商局正式注册，本公司现已取得北京市消防局颁发的消防设施维护保养检测临时一级资质、消防安全评估临时一级资质和北京市质量技术监督局颁发的计量认证资质。具备独立开展建筑消防设施检测及电气防火检测技术服务、消防设施维护保养、消防安全评估的资格。公司技术力量雄厚，检测维护保养设备配套，安全评估体系健全，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测、消防设施维护保养、及消防安全评估工作，确保检测及评估结论科学、公正、准确、规范。', '116.35605700000001', '39.773161999999999', '116.35605700000001', '39.773161999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('3999', '北京星昊美物业管理有限公司', '368', '迟彦军', '13801377515', '孙丽妹', '13611313191', '2009年11月30日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市东城区广渠门南小街3号楼2单元1204号', '北京市', '北京市', '朝阳区', '双井街道', '北京市东城区广渠门南小街3号楼2单元1204', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年11月30日', '2029年11月29日', '2018/5/22', '2019/5/21', '京消协（2018）证字153号', '911101016977193995', '', '物业管理；清洁服务；建筑物清洁；病虫害防治；出租商业用房；城市园林绿化；劳务派遣（劳务派遣经营许可证有效期至2021年09月13日）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。', '我公司成立于2009年，属于股份制，下属企业有北京星昊保洁服务有限公司、北京瑞德易美日化有限责任公司、北京天喜时代环境科技有限公司、通州区张家湾培训基地等四家子公司。注册资金1000万，于2009年取得了ISO9001质量管理体系认证、ISO14001环境管理体系认证和GB/T28001职业健康安全管理体系认证；2011年获得了北京市工商联清洗保洁商会的优秀会员企业；2016年取得了“北京市市级行政事业单位2016-2017年度物业服务定点政府采购项目”指定供应商资质；自创办10年以来，深受社会各界用户的信赖与支持，公司得以迅猛发展！\r\n目前所涉及领域包括党政机关、大型写字楼、高等院校、宾馆酒店、商场、医院、小区物业管理等三十八家日常保洁的合作单位，其中管理人员65人，保洁服务人员2760人，年营业额1.2亿。“诚信服务、专业优质、创新发展、互利共赢”是星昊美公司的最高经营理念和宗旨！', '116.44108900000001', '39.892989999999998', '116.44108900000001', '39.892989999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4000', '北京点阵建设工程有限公司', '366', '王希东', '', '方奇', '13801362290', '2017年08月16日', '1000万元', '北京市', '北京市', '丰台区', null, '北京市房山区良乡凯旋大街建设路18号-D1703', '北京市', '北京市', '丰台区', '马家堡街道', '北京市丰台区嘉园三里8号楼', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2017年08月16日', '2047年08月15日', '', '', '', '91110111MA00H7GD7Q', '', '专业承包；维修消防设备；安装机电设备、空调制冷设备；销售消防器材、建筑材料、五金交电（不含电动自行车）、机械设备、金属材料；技术咨询（中介除外）、技术服务；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京点阵建设工程有限公司成立于2019年2月，位于北京市房山区。是由北京点阵消防工程有限公司更名而来，北京点阵消防工程有限公司成立于2011年，原名为北京四海消防工程有限公司第七工程部。2017年改制后更名为北京点阵消防工程有限公司。公司主要以消防工程的设计、施工、维护；机电设备安装；房屋装修、装饰为主。公司拥有70多名职工，基本上都具有大专院校以上学历，有5人具有建造师证资格，若干名专职安全员，其他相关持证人员都能满足工程需要。公司成立以来，就经历了新形势和激烈竞争的市场挑战，敢于拼搏，善于创新，以崭新的理念、科学的管理和优质的服务，积极培育和提高企业的核心竞争力，为公司在国内消防工程市场中奠定了可靠基础，并在市场中树立了良好的信誉和企业形象。公司目前已取得国家建设部颁发的消防设施工程专业承包资质、公司通过建立有效的项目管理体系，建立并取得ISO9001：2000质量管理体系、ISO14001：2004环境管理体系、OHSAS18001：1999职业健康安全管理体系认证证书。经过多年的发展，公司拥有了一批的优秀技术人员和专家顾问人员，公司拥有建筑、结构、暖通、给排水、计算机、自动控制', '116.366058', '39.844009', '116.366058', '39.844009', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4001', '北京诚信华宇环保科技有限公司', '365', '张士成', '13901333727', '张士成', '13901333727', '2008年01月07日', '500万元', '北京市', '北京市', '平谷区', null, '北京市平谷区马昌营镇天井大街甲2号', '北京市', '北京市', '平谷区', '马昌营镇', '北京市平谷区马昌营镇天井大街甲2号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2008年01月07日', '2028年01月06日', '2019/1/17', '2020/1/16', '京消协（2019）证字026号', '911101176705582066', '', '技术开发及转让；保洁服务；专业承包；销售消防器材、空调设备、厨房设备；消防器材检测(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '　北京诚信华宇环保科技有限公司是一家专业从事中央空调系统安装及清洗、油烟管道系统清洗、厨房设备安装及清洗、保洁服务及消防工程的服务型企业。为用户的清洗系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。 公司拥有一批中高级专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成中央空调系统清洗及油烟管道全系列工作。', '117.018359', '40.112555', '117.018359', '40.112555', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4002', '北京金瓯鼎建筑装饰工程有限公司', '364', '冯艳永', '13311186777', '冯艳永', '13311186777', '2009年09月04日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区拱辰大街98号 8层0901', '北京市', '北京市', '房山区', '拱辰街道', '北京市房山区拱辰大街98号 8层0901', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年09月04日', '2029年09月03日', '2018/5/3', '2019/5/2', '京消协（2018）证字098号', '91110106694999460L', '排油烟设施清洗机构', '工程设计；专业承包；劳务分包；家居装饰；园林绿化服务；草坪维护；承办展览展示；物业管理；技术咨询（中介除外）、技术服务、技术转让、技术开发；电脑图文设计；设计、制作、代理、发布广告；销售建筑材料、装饰材料、金属材料、家用电器、日用杂品、橡胶制品、机械设备、五金交电（不含电动自行车）、化工产品（不含一类易制毒及化学危险品）、苗木、花卉。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京金瓯鼎建筑装饰工程有限公司于2009年09月在北京市丰台区注册成立，法定代表人为冯艳永、主要从事装修业务，自2018年开使业务延伸，发展油烟机及净化器的清洗业务、主要包括油烟机、净化器的清洗、维修、及工程服务，具备北京市消防协会的业务资质。我们凭借着专业的的团队和良好的信誉，努力加强公司内部管理，不断完善质量监督制度，建立全面用户服务体系。 公司配备了先进的检测仪器和专业工具，所有员工都通过有关的消防培训和技术考核。做到及时发现问题、消除隐患，保证用户的消防设施能够正常有效的运行，充分发挥报警和灭火的作用。', '116.14254099999999', '39.732393000000002', '116.14254099999999', '39.732393000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4003', '北京清源时代保洁服务有限公司', '363', '王晓芳', '18611863666', '贺丽燕', '13520255126', '2016年01月14日', '800万元', '北京市', '北京市', '平谷区', null, '北京市平谷区夏各庄镇王都庄村东路9号', '北京市', '北京市', '平谷区', '夏各庄镇', '北京市平谷区夏各庄镇王都庄村东路9号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2016年01月14日', '2046年01月13日', '', '', '', '91110117MA0034T09Y', '', '保洁服务；家庭劳务服务；园林绿化；建筑物清洁服务；机动车公共停车场服务；花卉、苗木租摆；病虫害防治；设计、制作、代理广告；电脑图文设计、制作；草坪养护；道路货运代理；室内空气成分测试；销售日用品、办公用品；小客车代驾服务；污水处理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京清源时代保洁服务有限公司从事酒店、餐厅、食堂油烟管道清洗服务,业务涵盖北京、天津、河北等地。\r\n公司成立于2016年,被评为“重合同守信用单位”,以先进的清洗设备和优质的服务成为同行业中领跑企业。\r\n几年来,我司致力于烟道清洗技术的开发和应用实践,并取得了令人瞩目的骄人成绩。\r\n我公司针对国内部分油烟管道的复杂性,选用适合任何异形管道的清洗方法,工程已经涵盖企事业单位、宾馆酒店、大型商场超市、医院、车站、学校等各种使用排油设备的餐厅食堂场所,并得到了客户的一致好评和行业的推荐。\r\n公司在完成施工的同时,还为客户提供清洗证明等服务。我们的服务宗旨是为广大客户提供最优质的产品、最优惠的价格、以及最周到的服务。\r\n我们以朝气蓬勃的精神、专业的服务、严谨的管理为企业经营理念,始终保持“健康、科技、环保、创新、专业”的宗旨,竭尽全力为您提供最完美的服务。\r\n目标:成为中国排油烟设备清洗的领航者\r\n业务范围:\r\n油烟管道清洗\r\n大型油烟机清洗\r\n大型油烟净化器清洗\r\n油烟管道清洗技术及设备应用\r\n油烟管道清洗技术利用和推广\r\n油烟管道清洗技术加盟连锁', '117.181195', '40.151316000000001', '117.181195', '40.151316000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4004', '北京星宇首泰环保科技有限公司', '362', '张立桥', '15810313871', '张立桥', '15810313871', '2011年08月02日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区卢沟桥城北路1号62幢014', '北京市', '北京市', '丰台区', '宛平城地区办事处', '北京市丰台区卢沟桥城北路1号62幢014', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年08月02日', '2031年08月01日', '2018/5/22', '2019/5/21', '京消协（2018）证字133号', '91110106580888869F', '', '技术开发、技术推广、技术服务、技术咨询；经济信息咨询；会议服务；组织文化艺术交流活动；承办展览展示；保洁服务；清洁服务；建筑物外墙清洗；销售空调设备、厨房设备、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '尊敬的各位领导，负责人您好：\r\n很高兴各位领导关注我们《北京星宇首泰环保科技有限公司》\r\n我们是经北京市公司管理局正式批准的一家集保洁、清洗服务为一体的综合公司。主要供与酒店、商场、快餐厅、连锁店等保洁服务、石材翻新护理、油烟管道、中央空调循环水系统清洗保养与末端机清洗、外墙清洗、管道安装、管道清洗、厨房设备全一体化的专业服务公司。\r\n我公司本着发展经济、服务社会的经营思想，以市场为导向，以质量为基础，以优质服务为宗旨，努力为广大客户提供高品质的环保服务。星宇首泰将不断超越。\r\n同时我公司为方便服务北京周边地区现今：\r\n北京总公司成立于2011年，联系人：张经理15810313871\r\n唐山办事处成立于2014年，联系人：周经理13313291810\r\n为公司整体成为更专业化的集保洁、清洗服务为一体的综合公司做好永久的铺垫。', '116.222435', '39.853104999999999', '116.222435', '39.853104999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4005', '小蜜蜂互联（北京）消防信息技术有限公司', '361', '李晓华', '13693557698', '刘晶', '13693557698', '2016年12月23日', '2050万元', '北京市', '北京市', '西城区', null, '北京市西城区西直门外大街1号西环广场T2座17C5', '北京市', '北京市', '西城区', '新街口街道', '北京市西城区西直门外大街1号西环广场T2座19层', '', '消防信息化', '有限责任公司（自然人投资或控股）', '2016年12月23日', '2046年12月22日', '2018/12/6', '2019/12/5', '京消协（2018）证字431号', '91110102MA00ATBY96', '', '互联网信息服务；数据处理；市场调查；企业管理咨询；企业策划；软件开发；技术转让、技术咨询、技术开发、技术服务；计算机系统服务；基础软件服务；应用软件服务；销售电子产品、计算机、软件及辅助设备、通讯设备；货物进出口、技术进出口、代理进出口。（企业依法自主选择经营项目，开展经营活动；互联网信息服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '小蜜蜂互联（北京）消防信息技术有限公司（简称“小蜜蜂消防”）2016年12月成立于北京，在新疆、河南、福建设有分部，目前已为全国3万多家社会单位及消防维护企业提供平台数据服务。 小蜜蜂消防专注于消防服务行业创新发展，依据国家标准规范，结合人防、技防手段，运用互联网、物联网、人工智能、大数据、云计算等最新技术，紧扣火险隐患的发现、排查、整改、消除这条主线，先后研发消防设施维护保养系统、消防物联网系统、AI智能摄像机系统、消防巡查系统、消防监督系统等多个城市消防安全管理系统，获得多项国家专利，把原来纷繁复杂的管理工作变的简单易行，给城市的消防安全赋能，全面改善消防安全环境状况。', '116.35252199999999', '39.941581999999997', '116.35252199999999', '39.941581999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4006', '北京华宇顺成环保科技有限公司', '360', '张爽', '13911683987', '张爽', '13911683987', '2010年07月17日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区张镇雁户庄村村委会东150米', '北京市', '北京市', '顺义区', '张镇', '北京市顺义区张镇雁户庄村村委会东150米', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年07月17日', '2030年07月16日', '2018/9/6', '2019/9/5', '京消协（2018）证字289号', '9111011355856880XF', '', '技术开发、技术咨询；接受委托提供劳务服务（排队服务，对外劳务合作除外）；保洁服务；专业承包；消防器材检测；销售消防器材、厨卫器材、制冷设备、五金、交电、办公用品、日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京华宇顺成环保科技有限公司是一家具有独立法人资格的专业保洁清洗公司,公司成立于2010年，是一家集保洁服务、清洗服务、设备销售、保洁技术培训于一体的综合性保洁服务公司。我公司成立以来，在保洁行业中探索积累了丰富的管理经验，技术力量雄厚，设备齐全，练就了一支专业水平高，实践经验丰富的具有专业化管理水平和高素质的员工队伍。现有人员100余人，基层管理人员10多人，中高层管理人员10余人，随着公司业务不断发展，壮大。公司主要经营：大型中央空调系统清洗,新旧居开荒保洁，工程开荒，地板打蜡、抛光，玻璃擦拭，内外墙粉刷、清洗；清洗沙发、地毯、排油烟设施清洗；石材结晶、翻新和养护，社区、大厦物业、办公楼保洁。各类企事业单位的包月保洁。且在凯德商用、华威大厦、现代城、万达广场、国际商城、四川驻京办、唐山新华联铂尔曼大酒店等以及阿香米线、亚米荟、达美乐披萨连锁系列等大型单位油烟清洗工作并得到客户的好评，已成为我公司多年的合作伙伴。在发展的过程中，我们不断研究创新，汲取先进的管理理念和先进技术，不断完善和改进服务质量，并根据客户的实际情况以合理的价格为客户提供专业、敬业、高效的品牌服务，得到了相关行业机', '116.927441', '40.165795000000003', '116.927441', '40.165795000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4007', '北京洁晟环保科技有限公司', '359', '贺新', '13910990312', '王哲', '13901262143', '2017年05月15日', '600万元', '北京市', '北京市', '丰台区', null, '丰桥路8号院甲14号1层08', '北京市', '北京市', '丰台区', '马家堡街道', '角门18号枫竹苑2区1号', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年05月15日', '2037年05月14日', '2019/3/21', '2020/3/20', '京消协（2019）证字120号', '91110106MA00EGH48T', '排油烟设施清洗机构', '技术推广、技术转让、技术咨询、技术服务；计算机系统服务；清洁服务；劳务服务；基础软件服务；应用软件服务（不含医用软件）；软件开发；产品设计；模型设计；包装装潢设计；经济贸易咨询；公共关系服务；工艺美术设计；电脑图文设计、制作；企业策划；设计、制作、代理、发布广告；市场调查；企业管理咨询；组织文化艺术交流活动（不含演出）；文艺创作；承办展览展示活动；会议服务；翻译服务；自然科学研究；工程和技术研究；农业科学研究；医学研究(不含诊疗活动)；数据处理（数据处理中的银行卡中心、PUE值在1；5以上的云计算数据中心除外）；销售机械设备、厨房用具、电子产品、制冷设备、油烟净化设备、空气净化设备、汽车配件、劳保用品、家用电器。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京洁晟环保科技有限公司专注于油烟管道清洗、中央空调清洗、油烟净化器设备安装与维保；\r\n服务对象包含党政机关，企事业单位、医院、宾馆、酒店、餐厅、物业公司及大型商业中心等业务覆盖京津冀地区；\r\n我们的服务宗旨是为广大客户提供最优质的产品，最优惠的价格，最周全的服务', '116.371319', '39.834107000000003', '116.371319', '39.834107000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4008', '北京市金安华瑞消防工程技术有限公司', '358', '郑玉焜', '13381066686', '梁丽', '15300016212', '2005年01月13日', '400万元', '北京市', '北京市', '海淀区', null, '海淀区紫竹院路116号嘉豪国际D座702', '北京市', '北京市', '海淀区', '紫竹院街道', '海淀区紫竹院路116号嘉豪国际D座702', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2005年01月13日', '2025年01月12日', '2019/1/30', '2020/1/29', '京消协电证字（2019）013号', '9111010877159322XT', '电气防火检测技术服务机构', '消防安全的技术服务、技术检测；技术开发、技术转让、技术咨询、技术培训；基础软件服务；应用软件服务；计算机系统服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2005年01月13日，经国家工商局正式注册，具有独立法人，于当年被北京市消防协会接纳为会员单位。本公司具有独立开展检测工作的资格，其对外法律责任由北京市金安华瑞消防工程技术有限公司以独立法人地位承担。\r\n公司现有从事本专业工作多年，具有丰富检测经验的专职检测人员12名，其中：高级工程师1名，中级工程师4名，大专生7名。所有从事检测的工作人员都经过严格的专业技能和岗位知识培训，具有较高的理论水平和良好的业务素质，能够承担公司所开展的检测评价项目工作。\r\n公司现有设备一百余台（套），包括辐射温度计、风速仪、红外热成像仪、超声波检漏仪、照度计、红外点温仪等。设备齐全、先进，状态完好并定期检定，能够满足检测工作的需要。\r\n公司拥有用房面积313余平方米，具备单独的仪器室、会议室及办公室等。设有检测组及办公室两大职能部门，分别为公司的管理部门和技术部门。为适应检测机构管理标准《检验检测机构资质认定评审准则》的要求，我公司编写了《质量手册》、《程序文件》、《作业指导书》及各类表格，以此为基础建立了质量管理体系，符合《检验检测机构资质认定评审准则》要求，取得了CMA证书。', '116.29204900000001', '39.946677999999999', '116.29204900000001', '39.946677999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4009', '北京升鼎浩瀚消防安全检测有限公司', '357', '李征', '13910510527', '刘莹', '13810772498', '2009年07月08日', '210万元', '北京市', '北京市', '怀柔区', null, '开放东路11号2幢三层', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '开放东路11号2幢三层', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2009年07月08日', '2029年07月07日', '2018/11/21', '2019/11/20', '京消协（2018）证字376号', '9111011669080673X5', '电气防火检测技术服务机构', '建筑消防设施技术检测、电气防火技术检测；消防设施维修保养；维修消防器材；技术服务、技术咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京升鼎浩瀚消防安全检测有限公司成立于2009年7月8日，是经北京市公安局消防局核准备案的专业消防检测公司，属北京消防协会会员单位，并通过了ISO9001:2008质量管理体系认证。公司配备的检测仪器均已通过中国计量科学研究所校准检定，拥有专业检测人员16人，其中6名一级注册消防工程师，1名消防高级工程师，1名高级消防员和经验丰富的技术人员组成的专业检测队伍，所有检测人员均有关消防专业的培训和技术考核均持证上岗。', '116.650586', '40.325423999999998', '116.650586', '40.325423999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4010', '北京英豪建筑装饰设计工程有限公司', '356', '叶三樟', '15019288881', '叶洲池', '17718412195', '2009年07月08日', '4000万元', '北京市', '北京市', '通州区', null, '北京市通州区环科中路16号32幢1层101', '北京市', '北京市', '通州区', '马驹桥镇', '北京市通州区环科中路16号32幢1层101', '', '消防安全评估', '有限责任公司（法人独资）', '2009年07月08日', '2029年07月07日', '2018/3/29', '2019/3/28', '京消协（2018）证字075号', '911101086916528672', '', '专业承包；工程勘察；工程设计；货物进出口；代理进出口；技术进出口；销售建筑材料、五金交电、机械设备、金属材料；经济贸易咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京英豪建筑装饰设计工程有限公司成立于2009年7月8日，注册资本4000万元人民币，是经建设主管部门批准的建筑装饰装修工程专业承包一级企业、建筑幕墙工程专业承包一级、消防设施工程专业承包二级、电子与智能化工程专业承包二级、建筑装饰工程设计专项甲级、建筑幕墙工程设计专项甲级、建筑智能化系统设计专项乙级、消防设施工程设计专项乙级，中国建筑装饰协会第七届理事会理事单位、北京市建筑装饰协会理事单位。\r\n英豪装饰创建伊始，矢志不渝地确立打造中国建筑装饰行业一流品牌\"为远大目标，在执行董事叶三樟的带领下，秉承\"创业信是 根、经营诚为 本\"的经营理念，全体员工勇于进取，努力拼搏，立足北京，放眼全国，致力于人与环境的融通和协调，创造独特的室内空间，锐意开拓市场，承接了一大批高端建筑装饰工程，奠定了走精品强司之路的基础。', '116.55763899999999', '39.732793000000001', '116.55763899999999', '39.732793000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4011', '北京京豫鲁达科技发展有限公司', '354', '杨金平', '18801333197', '赵保勇', '13520371641', '2010年08月23日', '500万元', '北京市', '北京市', '朝阳区', null, '朝阳区黑庄户乡大鲁店二村', '北京市', '北京市', '朝阳区', '黑庄户地区办事处', '朝阳区黑庄户乡大鲁店二村', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年08月23日', '2030年08月22日', '2019/5/8', '2020/5/7', '京消协（2019）证字208号', '91110105560391441K', '排油烟设施清洗机构', '专业承包；物业管理；技术推广服务；清洁服务；家庭服务；家居装饰；销售日用品、五金交电、服装、化工产品（不含危险化学品）、工艺品、机械设备、电子产品、建材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京豫鲁达科技发展有限公司成立于2010年8月 是一家集保洁维修等为一体的服务公司，竭诚为宾馆/写字楼/机关团体、企事业单位、学校医院等提供油烟清洗服务。', '116.59358', '39.83905', '116.59358', '39.83905', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4012', '中建亚泰消防技术（北京）有限公司', '353', '郭长星', '13311378827', '常娜', '13811292915、010-83609112', '2013年01月08日', '400万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路186号四区3号楼3层03-04单元', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路186号四区3号楼3层03-04单元', 'AA', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2013年01月08日', '2043年01月07日', '2019/2/27', '2020/2/26', '京消协（2019）证字076号', '91110106061337088F', '电气防火', '技术推广服务；技术检测；建筑材料（不从事实体店铺经营）、机械设备、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '中建亚泰消防技术（北京）有限公司是一家经北京市消防协会认证的检测企业，为北京消防协会会员单位，中国消防协会会员。通过GB/T19001-2016/ISO9001:2015质量管理体系认证，及质监局CMA计量认证，证书号：170121020594；消防局临时一级资质，证书号：京公消技字【2014】第002号。注册资本金为400万元,主要从事建筑消防设施检测、维保、电气防火检测。 \r\n    公司拥有一支专业齐全、经验丰富、技术实力雄厚，长期从事消防设施及电气防火安全检测的专业队伍。公司依托雄厚的技术力量和先进的仪器设备，能够准确、及时地发现新旧建筑中存在的消防及电气安全隐患，并提出科学的整改意见，及时消除火灾隐患，为预防和减少相关损失提供有力的技术保证。\r\n    我们以高素质的检测人员、先进的检测设备及科学的管理体系为保障，为受检单位提供优质可靠的服务。公司严格执行消防协会的有关规定，坚持检测质量第一。以高起点、高效率为服务宗旨，以认真负责的工作态度为原则，在检测工作中不漏检、不误检，恪守科学、公正行业理念，严格执行国家消防法规和技术规范。做到数据准确、检测全面，热情服务。', '116.295731', '39.820690999999997', '116.295731', '39.820690999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4013', '北京久久神龙消防器材有限公司', '352', '贾香娥', '13801026609', '张大志', '13552200937', '2003年09月20日', '1300万元', '北京市', '北京市', '大兴区', null, '北京市大兴区采育镇京津塘科技园东西二路1号', '北京市', '北京市', '大兴区', '采育镇', '北京市大兴区采育镇京津塘科技园东西二路1号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2003年09月20日', '长期', '2019/1/17', '2020/1/16', '京消协（2019）证字033号', '911101157546606112', '', '生产灭火器、灭火剂；专业承包；消防技术检测；道路货物运输；销售五金交电（不含三轮摩托车及残疾人机动轮椅车、不含电动自行车）、汽车配件、仪器仪表、建筑材料、机械设备、百货、针纺织品、矿产品（稀有矿产品除外）、新鲜蔬菜、新鲜水果、鲜蛋、化工产品（不含危险化学品、不含一类易制毒化学品）、消防器材、交通设施、医疗器械（Ⅰ类、Ⅱ类）；维修灭火器；技术咨询。（企业依法自主选择经营项目，开展经营活动；道路货物运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京久久神龙消防器材有限公司位于北京采育经济开发区，是定点研发生产水系灭火剂、水基型灭火器、干粉灭火器等系列产品的专业生产企业。公司于2002年3月获得ISO9001质量管理体系认证书，至今保持有效；2011年4月公司取得了中国消防协会颁发的“企业信用等级AAA级证书；2013年8月水基型（水雾）项目获得中国消防协会科学技术创新一等奖；2014年“神龙”商标荣获北京市著名商标证书；2017年4月取得中国环境标志产品认证证书。\r\n “神龙”牌环保型高效水基型灭火器，采用纯植物型灭火药剂，无毒、无味、无刺激性、喷射后能百分之百自动降解、易清理，对大气、土地、人体均无害，是一种绿色环保产品，是淘汰哈龙灭火器，净化蓝天的理想替代品。它具有灭火速度快、抗复燃性强的特点，尤其是水雾灭火器，还能扑灭36kV的高压电器火，是水基型灭火器灭火性能的一大突破。\r\n 公司销售网络遍布全国，在国内及港、澳、台地区设有代理及售后服务机构，在泰国曼谷设有国泰神龙消防器材有限公司，在北京、湖北设有生产基地，产品广泛应用于铁路、汽车、工矿等领域。', '116.674846', '39.652346000000001', '116.674846', '39.652346000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4014', '北京清江鸿达技术服务有限公司', '351', '李洪', '18001309478', '李洪', '18001309478', '2017年01月19日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区辰光东路16号院4号楼5层504', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区辰光东路16号院4号楼5层504', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年01月19日', '2047年01月18日', '2018/6/15', '2019/6/14', '京消协（2018）证字198号', '91110106MA00BFHU1E', '排油烟设施清洗机构', '技术服务、技术推广、技术开发、技术转让、技术培训；经济信息咨询；物业管理；电脑图文设计；打字服务；承办展览展示；设计、制作、代理、发布广告；劳务服务；清洁服务；销售家用电器、机械设备、办公用品、电子产品、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京清江鸿达技术服务有限公司是一家经过正式注册，具有合法经营执照的正规企业。公司拥有严格的管理制度、先进的设备、一流的服务质量，清洗维修技师均具备多年清洗、维修、安装经验，专业提供油烟管道清洗、厨房设备维修以及大理石结晶养护和地毯清洗等服务。经过多年施工，我公司积累了丰富的经验，北京清江鸿达技术服务有限公司是一家年轻、充满朝气、具有法人资格的专业性保洁公司。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写字楼、娱乐场所等提供全方位的清洗保洁服务，包括大型厨房烟道防火清洗、地毯清洗、石材翻新、结晶、养护、新大楼竣工、装修后的全套清洗保洁、各种地板清洗打蜡以及真皮沙发清洗养护等各种清洗保洁服务。可以为不同领域客户提供全方位的满意服务。 作为北京消防协会会员单位，公司一贯遵循“客户至上、至诚至信”的服务精神，坚持高定位、高质量、高效率的“三高”服务标准，经过多年的发展积累，我公司拥有了一批具有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了良好的口碑。 科学的经营管理是本公司成功的保证，“客户至上，信誉第一”是本公司信赖以发展的宗旨', '116.186733', '39.749957000000002', '116.186733', '39.749957000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4015', '北京骥中建消防科技有限公司', '350', '张建忠', '13901254152', '张宁宁', '13501183762', '2005年07月28日', '1228万元', '北京市', '北京市', '丰台区', null, '北京市丰台区西三环南路57号6层608', '北京市', '北京市', '丰台区', '长辛店镇', '北京市丰台区大灰厂东路槐树岭4号院', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2005年07月28日', '2055年07月27日', '2018/11/21', '2019/11/20', '京消协（2018）证字387号', '91110106778633941G', '电气防火检测技术服务机构', '技术开发、技术咨询；建筑消防设施检测、电气防火检测；建筑消防设施维修；销售社会公共安全设备、五金交电（不含电动自行车）、机械设备、电子产品、建筑材料、装饰材料、金属材料、通讯设备、办公用品、计算机软硬件及辅助设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京骥中建消防科技有限公司（以下简称公司）是依法注册的有限责任公司。公司成立于2005年，是一家专门从事建筑消防设施检测和电气防火检测的专业公司。本公司获得北京质量技术监督局颁发的资质认定计量认证证书具备专业的CMA检测资质、于2019年取得北京市公安局消防总队颁发的《中华人民共和国消防技术服务机构资质证书正式一级》、北京消防协会颁发的电气防火检测技术服务机构资信证书。\r\n公司根据国务院办公厅《消防改革和发展纲要》的精神，遵循北京市消防局“预防为主，消防结合” 的工作方针。奉行“以服务求生存、以质量求效益 、以信誉求发展、以技术求进步”的宗旨“坚持客户”为本的服务理念，为客户提供完善的服务，取得客户的信赖与支持。\r\n公司现有技术人员23人,其中一级注册消防工程师10人，高级工程师1人，检测人员9人。高级消防员3人。从事检测的人员均经公安部消防局消防行业职业鉴定指导中心培训考核合格，持证上岗。\r\n公司拥有实践经验丰富的专业队伍和一批先进的检测仪器仪表，为消防火灾隐患检测提供了坚实技术基础。\r\n公司的主要业务是：建筑消防设施检测服务、电气防火检测技术服务。', '116.309371', '39.863869000000001', '116.16963199999999', '39.860314000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4016', '北京诚安顺消防科技有限公司', '348', '徐军', '13911597518', '徐军', '13911597518', '2012年06月08日', '506万元', '北京市', '北京市', '西城区', null, '北京市丰台区广安路1幢-1层1202', '北京市', '北京市', '西城区', '广安门外街道', '北京市丰台区广安路1幢-1层1202', '', '消防产品', '有限责任公司（自然人独资）', '2012年06月08日', '2032年06月07日', '', '', '', '91110106597705256A', '', '专业承包；技术开发；技术服务；清洁服务；销售电子产品、消防产品、建筑材料、机械设备、交通设施、五金交电、文具用品；技术检测；维修消防器材。（领取本执照后，应到住房城乡建设部门取得行政许可；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立以来本着对消防事业高度负责的精神，我们坚持“质量第一、用户至上”的经营方针，把产品质量和售后服务放在第一位。', '116.324994', '39.890723999999999', '116.324994', '39.890723999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4017', '北京林海世通科技有限公司', '347', '黄赛波', '13439618587', '黄赛波', '13439618587', '2017年12月13日', '100万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区地盛北街1号院18号楼2层226室', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区地盛北街1号院18号楼2层226室', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年12月13日', '长期', '2018/11/9', '2019/11/8', '京消协（2018）证字367号', '91110203MA019BF539', '', '技术开发、技术服务、技术推广；清洁服务；病虫害防治服务；设备安装、维修；销售机械设备、化工产品、清洁用品、通讯设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京林海世通科技有限公司成立于2017年12月。专业从事中央空调通风系统清洗、排油烟管道系统的清洗、冷却塔清洗、改造安装清洗等业务。\r\n我公司专业服务资质齐全，具有优良的施工队伍，是为客户优质服务的保证。\r\n我公司以高科技为导向，以服务及产品为途径，致力于改善现代化数宇内的空气质量，餐饮行业安全营运，为现代都市人营造健康卫生的生存环境。\r\n我公司坚持“诚信为本，服务至上”的原则，从客户需要出发，以客户满意为指导，为客户量身定做科学的清洗方案，让客户享受专业一流的服务。\r\n我公司拥有一个精诚合作、锐意进取的管理团队，一批高素质的工程技术人员，一支训练有素、经验丰富的工程队伍，确保清洗工程高效、高速、高品质地完成。\r\n我公司技术力量雄厚，拥有一支稳定的队伍、一个进取的团队，时刻准备着为您提供最优质服务。\r\n我公司为满足客户的一条龙服务的需求，不断扩展业务范围。目前我公司拓展的业务有：1、中央空调通风系统清洗；\r\n2、厨房排油油烟管道清洗；\r\n3、冷冻系统，冷却塔清洗；\r\n4、病虫害防治服务；', '116.497103', '39.782837000000001', '116.497103', '39.782837000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4018', '北京坤钧枫消防技术有限公司', '345', '韩宗曙', '13501359261', '孙亚宁', '15718861520', '2004年11月11日', '420万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路188号十五区2号楼2层202室', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路188号十五区2号楼2层202室', '', '建筑防火,消防设施,消防安全检查,电气防火', '其他有限责任公司', '2004年11月11日', '2024年11月10日', '2018/4/25', '2019/4/24', '京消协（2018）证字080号', '911101067693903199', '电气防火检测技术服务机构', '技术检测；技术服务、技术咨询、消防安全检测、电气防火安全检测；消防设施的维护保养；消防安全评估；灭火器维修；消防咨询、消防设计咨询、消防安全培训等消防技术服务技术开发、服务、转让、咨询；信息咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '4.公司简介\r\n    北京坤钧枫消防技术有限公司是经国家工商局正式注册，隶属于独立法人单位，面向社会开展检测工作。本公司具有独立开展检测工作的资格，具有独立账户，独立对外行文，对外法律责任由北京坤钧枫消防技术有限公司以独立法人地位承担。设立了检测部、管理部两大部门。\r\n1.1 资源\r\n北京坤钧枫消防技术有限公司共有13名具有丰富检测经验的专职检验/检测人员，其中2人为工程师，本科生3名，大专生4名，高中及中专3人。\r\n近12年，北京坤钧枫消防技术有限公司投入专项建设经费100余万元，主要用于实验室改造及配备检测设备，已到位36余台（套），包括热象仪等设备，能够满足检测工作的需要。拥有100%产权。机构总面积320m2，，具备单独的仪器室、会议室及办公室等。\r\n1.2 能力范围 描述\r\n资质认定通过公安领域电气防火检测类（1.1～1.23），消防设施检测类（2.24～2.85）共85个参数，\r\n1.3 机构识别\r\n机构名称：北京坤钧枫消防技术有限公司\r\n机构性质： 消防安全检测\r\n法定代表人： 韩宗曙\r\n地址： 北京市南四环西路188号十五区2号楼2层202室\r\n电话： 010-83512005', '116.28848499999999', '39.820926999999998', '116.28848499999999', '39.820926999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4019', '北京智朗卓越消防科技有限公司', '344', '安军臣', '15830627590', '鱼洋', '13601277017', '2011年06月27日', '400万元', '北京市', '北京市', '西城区', null, '北京市西城区广义街5号5层2-508', '北京市', '北京市', '西城区', '广安门内街道', '北京市西城区广义街5号5层2-508', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2011年06月27日', '2031年06月26日', '2019/2/27', '2020/2/26', '京消协（2019）证字075号', '911101025768618230', '电气防火检测技术服务机构', '技术检测；技术服务、技术咨询。（领取本执照后，应到市质量技术监督局取得行政许可；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京智朗卓越消防科技有限公司成立于2011年6月27日，是依法在北京市工商局注册的具有独立法人地位的，经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，已通过了ISO9001:2015质量体系认证，并于2014年10月经国家认证认可监督管理委员会考核、评审、认证具有北京市级专业水准和专业资质的消防设施及电气防火检测的专业单位。颁发有CMA资质认证书，并在2018年底北京市消防局、北京市消防协会又相续进行了考评通过了消防协会正式一级资质评审、认证。从以上考核评定说明，北京智朗卓越消防科技有限公司是开展建筑消防设施和电气防火检测技术服务的可依托、可信赖的消防检测单位。\r\n    本公司技术力量雄厚，检测设备先进，具有严格的管理制度和先进的质量管理体系。能够严格 执行国、行业的法律、法规和规程、规范，以及北京市相关的技术标准，开展各项消防检测工作。', '116.355346', '39.890856999999997', '116.355346', '39.890856999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4020', '北京金和顺消防安全技术有限公司', '343', '徐俊', '13522258888', '刘玉琴', '15311218891', '2008年12月18日', '680万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丰台镇东货场路38号11栋403室', '北京市', '北京市', '丰台区', '丰台街道', '北京市丰台区丰台镇东货场路38号11栋403室', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2008年12月18日', '2028年12月17日', '2018/10/19', '2019/10/18', '京消协（2018）证字317号', '91110106683574352X', '电气防火检测技术服务机构', '技术检测；技术开发、技术咨询、技术服务；销售消防器材、安全技术防范用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司是北京消防协会的会员单位，并于2012年度、2013年度连续荣获建筑消防设施、电气防火安全检测双优公司,2014年度通过计量评审获得CMA证书、2015年初取得消防技术服务机构临时一级资质。', '116.29683799999999', '39.853831999999997', '116.29683799999999', '39.853831999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4021', '北京帅安鸿运科技发展有限公司', '342', '杜加森', '13501208457', '任朝国', '13167552951', '2014年05月08日', '100万元', '北京市', '北京市', '通州区', null, '北京市通州区西集镇国防路43号A座1105室', '北京市', '北京市', '通州区', '潞城镇', '北京市通州区通湖大街百合湾21-1-1302室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2014年05月08日', '2034年05月07日', '2018/10/12', '2019/10/11', '京消协（2018）证字313号', '91110112399068401E', '', '工程勘察设计；专业承包；技术推广；建筑物清洁服务；厨房设备的清洗；销售建筑材料、通讯设备。（领取本执照后，应到市规划委、区县住建委（房管局）取得行政许可；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京帅安鸿运科技发展有限公司是经北京市工商管理局通州分局正式注册批准，竭诚致力于清洗保洁的专业性清洗公司。我们面向社会各机关、团体、宾馆、酒店、商场、写字楼、娱乐场所等提供全方位的清洗保洁服务，主要致力于酒店、商场、学校的大型厨房烟道防火清洗等；开展新大楼竣工、装饰后全套清洗保洁；各种石材地板清洗打蜡、翻新、结晶、养护技术；真皮沙发清洗养护；各种地毯的清洗护理；建立了完善的服务体系；积累了丰富的工作经验，并已在北京市场占有一席之地。 公司实行总经理负责制，严格管理，力争创新技术，努力发展企业文化。并有专人的调度，专业的车队确保客户的准时、准量高效完成。由设备检修组、库管众人组成的后勤部时刻准备着，公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力', '116.881604', '39.815384000000002', '116.68779600000001', '39.913305999999999', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4022', '北京市今日阳光保洁有限公司', '341', '王会君', '17801309070', '王建新', '13301139695', '2002年12月16日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区博大路3号院7号楼8层804', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区博大路3号院7号楼8层804', 'AA', '烟道清洗', '集体所有制（股份合作）', '2002年12月16日', '2022年12月15日', '2019/3/21', '2020/3/20', '京消协（2019）证字118号', '9111010566913932XU', '烟道清洗', '清洁服务（不含餐具消毒）；花卉租摆；销售日用品、厨房用具、金属材料、家用电器、五金交电（不含电动自行车）；害虫防治服务；技术开发、技术转让、技术咨询、技术服务；家庭服务（不符合家政服务通用要求不得开展经营活动）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市今日阳光保洁有限公司，成立于2007年，是一家可为各楼宇及大厦提供多项服务的专业化服务公司。公司秉承诚实守信、高效务实的发展原则，配备有先进的施工及维修设备，采用高质量、高水准、纯环保的施工材料及专业设备，旨在做优质工程和提升公司品牌。\r\n经过多年的努力与发展，公司现拥有一支技术精湛的专业服务团队，以卓越的服务品质、专业安全的技术服务实力，为不同类型的大厦及楼宇提供更高更优质的专项服务。公司致力于环保，注重于专业，全力塑造诚心、省心、舒心、放心、信心五星服务精神，走创新之路，全心全意为客户服务，服务项目包括企事业单位、家庭、宾馆、学校、别墅、酒店、商厦、物业小区、公共设施等场所的外墙清洗、地毯清洗、空调清洗维修、厨房排油烟系统清洗维修、地板打蜡、石材翻新、绿植租摆等服务。\r\n我们的定位：以现代化的最专业服务提供给广大客户! \r\n我们的理念：做客户最满意的服务!\r\n我们的发展目标：创行业一流，做精品工程!\r\n我们的团队：专业、热情、细致、周到! \r\n展望未来，阳光人将继续以科技为先导，以创新为动力，以管理为保障，为国家提倡的绿色环保事业、为还人们为还人们绿色、洁净的生存环境贡献一份力量。', '116.473338', '39.835391999999999', '116.473338', '39.835391999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4023', '北京蘅之立业科技发展有限公司', '340', '王春文', '13910386649', '王春文', '13910386649', '2008年10月24日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区鑫福里小区1号楼', '北京市', '北京市', '丰台区', '大红门街道', '北京市丰台区鑫福里小区1号楼', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2008年10月24日', '2028年10月23日', '2018/4/8', '2019/4/7', '京消协（2018）证字1065号', '911101066812052626', '排油烟设施清洗机构', '技术开发；技术咨询；清洗保洁服务；劳务服务；家政服务；物业管理；家居装饰；广告设计、制作；机械设备租赁；销售电器设备、机械设备、日用品、化工产品、文具用品、体育用品、新鲜蔬菜、新鲜水果；建筑物管道疏通服务；城市园林绿化；预包装食品销售（不含冷藏冷冻食品）（食品流通许可证有效期至2021年01月07日）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京蘅之立业科技发展有限公司成立于2008-10-24，注册地址在北京市丰台区鑫福里小区1号楼，主要从事零售预包装食品；技术开发；技术咨询；清洗保洁服务；劳务服务；家政服务；机械设备租赁；销售等。', '116.392754', '39.848526', '116.392754', '39.848526', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4024', '北京德信龙光环保技术有限公司', '339', '毛伟光', '18611161122', '毛伟光', '18611161122', '2017年12月12日', '100万元', '北京市', '北京市', '通州区', null, '北京市通州区中关村科技园区通州金桥产业基地景盛南二街12号11号楼7层714', '北京市', '北京市', '通州区', '马驹桥镇', '北京市通州区中关村科技园区通州金桥产业基地景盛南二街12号11号楼7层714', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2017年12月12日', '2067年12月11日', '2018/5/3', '2019/5/2', '京消协（2018）证字095号', '91110228MA019AHQ5P', '排油烟设施清洗机构', '技术推广、技术开发、技术转让、技术咨询、技术服务；建筑物清洁服务；家庭劳务服务；维修空调制冷设备、办公设备、计算机、仪器仪表、家用电器、通讯设备（仅限上门维修）；专业承包、施工总承包、劳务分包；城市园林绿化；物业管理；工程勘察；工程设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '我公司多年从事环保技术开发；环保工程承揽；施工，中央空调、地毯清洗，餐饮业厨房设计、改造，集油烟罩、管道、风机、净化器清洗的专业公司。\r\n我公司以匠人精神自律，致力服务于环保、消防领域。以减少环保排放、降低火灾隐患为己任，帮助客户实现低排放、零火险。\r\n我公司拥有专业技术人才及设备，以专业的角度勘察现场，急客户之所急、想客户之所想，制定完善的实施方案，专业的施工队伍360度无死角的去除火灾隐患。达到政府要求的防火要求，满足客户的需求。\r\n德行天下，诚信为本是我公司一贯秉承的宗旨！！！', '116.545193', '39.733007000000001', '116.545193', '39.733007000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4025', '北京家信展亮清洁服务有限公司', '338', '付天水', '13641197051', '孟英丽', '15210224161', '2009年05月19日', '50万元', '北京市', '北京市', '大兴区', null, '北京市丰台区南四环路西路128号院4号楼12层1515-1516（园区））', '北京市', '北京市', '大兴区', '西红门地区办事处', '北京市大兴区西红门宏盛西区22号楼4单元103室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年05月19日', '2029年05月18日', '2019/2/27', '2020/2/26', '京消协（2019）证字068号', '9111010669004654XM', '', '清洁服务；物业管理；技术开发；技术转让；技术咨询；技术服务；承办展览展示；组织文化艺术交流活动；企业策划；设计、制作、代理、发布广告；经济信息咨询；电脑动画设计；市场调查；会议服务；家居装饰；销售机械设备、电子产品、化工产品、汽车配件、计算机及辅助设备、文具用品、金属材料、建筑材料、日用品、针纺织品、工艺品、装饰材料、电子元器件。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动）（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京家信展亮清洁服务有限公司公司简介：\r\n北京家信展亮清洁服务有限公司是一家从事油烟管道清洗、日常保洁、化工产品销售的专业单位。本公司清洗设备先进，技术力量雄厚，管理完善。具有高素质、严纪律、精工艺的专业施工团队，以及精干的领导班子，汇集了同行业的业务精英，在北京市场上有了广泛的影响力，取得了明显的效果。\r\n北京家信展亮清洁服务有限公司是经北京市工商局正式注册批准，竭诚致力于清洗保洁的专业公司。我们面向社会各机关、团体、宾馆、幼儿园、大学院校等提供全方位的清洗保洁服务商。', '116.333386', '39.794808000000003', '116.333386', '39.794808000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4026', '北京云港晶鑫环保科技有限公司', '337', '仲崇健', '13522131296', '仲崇健', '13522131296', '2015年06月29日', '100万元', '北京市', '北京市', '石景山区', null, '北京市石景山区西井路17号1号楼6层638室', '北京市', '北京市', '石景山区', '苹果园街道', '北京市石景山区西井路17号1号楼6层638室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年06月29日', '2045年06月28日', '2018/5/22', '2019/2/21', '京消协（2018）证字126号', '91110107348298186R', '', '技术开发、技术咨询、技术服务、技术推广、技术转让；防治林业有害生物；害虫的防治服务；灭鼠及预防；保洁服务；水污染治理；大气污染治理；城市园林绿化；销售农药（不含危险化学品的农药）、洗涤用品、化工产品（不含危险化学品）、厨房用具、卫生间用品、装饰材料（不从事实体店铺经营）、建筑材料（不从事实体店铺经营）、日用品、办公用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2015年6月29日，主要从事酒店、餐厅、学校等单位的四害防治及保洁服务工作', '116.186179', '39.934882000000002', '116.186179', '39.934882000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4027', '北京京铁安达消防技术检测有限公司', '336', '刘喜臣', '18901398861', '石文珍', '13801108835', '2004年11月15日', '400万元', '北京市', '北京市', '西城区', null, '北京市西城区广安门外南街63号天健宾馆南楼二层8201', '北京市', '北京市', '西城区', '什刹海街道', '北京市西城区广安门外南街63号天健宾馆南楼二层8201', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2004年11月15日', '2024年11月14日', '2018/3/29', '2019/3/28', '京消协（2018）证字074号', '91110102769384920U', '电气防火检测技术服务机构', '电气消防安全检测、消防设施安全检测；质检技术服务、技术推广。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京京铁安达消防技术检测有限公司是经北京市工商行政管理局西城分局批准于2004年11月成立，面向社会开展建筑消防设施、电气防火检验检测工作。本公司具有独立开展检测工作的资格，具有独立账户，独立对外行文，其对外法律责任由北京京铁安达消防技术检测有限公司以独立法人地位承担。北京京铁安达消防技术检测有限公司设立管理部和检测部二大部门。\r\n\r\n1、资源\r\n北京京铁安达消防技术检测有限公司共有13名具有丰富检测经验的专职检测人员，其中1人为高级工程师,3人为工程师。近2年，北京京铁安达消防技术检测有限公司投入专项建设经费35余万元，主要用于设施改造及配备检测设备，已到位100余台（套），包括激光测距仪、数字接地电阻测试仪等，能够满足检测工作的需要。拥有100%产权。实验室总面积335平方米，具备单独的仪器室、会议室及办公室等。\r\n\r\n2.、能力范围描述	\r\n检测的范围、对象、能力与北京京铁安达消防技术检测有限公司的项目构成单元及功能相适应。检测能力：包括电气防火检测，建筑消防设施检测两大领域的检测项目。\r\n\r\n3、 质量方针\r\n质量为本，科学公正，准确高效，持续规范。', '116.373738', '39.920107000000002', '116.373738', '39.920107000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4028', '北京三和永安消防设施检测有限公司', '335', '康永生', '84853217', '程少英', '18911607197', '2003年08月14日', '400万元', '北京市', '北京市', '海淀区', null, '北京市海淀区阜成路58号8层801', '北京市', '北京市', '海淀区', '八里庄街道', '北京市海淀区阜成路58号8层801', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2009年04月28日', '2029年04月27日', '2018/11/9', '2019/11/8', '京消协（2018）证字360号', '91110108753313570C', '电气防火检测技术服务机构', '消防设施检测；调试、维修电子计算机；机械设备维修；技术开发；技术咨询；技术转让；技术服务；计算机技术培训。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京三和永安消防设施检测有限公司系北京消防局北京消防协会会员单位。是专门从事消防设施安全检测和电气防火安全检测的专业技术公司。公司通过了ISO9001：2016质量管理体系认证，更好的对受检的消防项目进行检测质量管理。公司的宗旨是：为客户提供服务、为社会提供安全、为人民生活提供保障。制定了较为完善的内部管理制度和检测安全管理制度，严格执行国家和北京市相关技术规范标准，确保检测质量的准确性、公正性，为客户和消防监督机关掌握受检单位消防设施和电气火灾隐患状况提供详尽、真实的检测报告，通过受检单位对消防设施的完善和电气火灾隐患的整改，杜绝火灾事故的发生.', '116.286584', '39.923512000000002', '116.286584', '39.923512000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4029', '北京宇润阳光清洗技术有限公司', '334', '彭玉柏', '18801063535', '张家驹', '13391823535', '2009年04月28日', '200万元', '北京市', '北京市', '通州区', null, '北京市通州区砖厂北里154号楼406', '北京市', '北京市', '朝阳区', '金盏地区办事处', '朝阳区金盏西村农行大院', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年04月28日', '2029年04月27日', '2018/12/28', '2019/12/27', '京消协（2018）证字465号', '91110112688354789D', '排油烟设施清洗机构', '技术推广、技术开发、技术转让、技术服务、技术咨询；建筑物清洁服务；害虫防治服务；零售日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京宇润阳光技术服务有限公司是具有合法经营执照的正规企业，是具有多年烟道清洗经验的专业清洗公司。拥有完善的管理制度、一流的服务质量，优秀稳定的施工队伍。拥有清洗维修技师3名，烟道清洗人员20名，高空作业人员5名，有限空间作业人员2名。具备多年清洗、维修、安装经验，专业提供油烟管道清洗、厨房设备维修等。大理石结晶翻新养护、高空外墙清洗、开荒保洁等主营业务。\r\n经过多年施工，我公司积累了丰富的经验。本公司面向社会，竭诚为各机关单位、饭店、餐厅、宾馆、酒店、写字楼、娱乐场所等提供全方位的清洗保洁服务，包括大型厨房烟道防火清洗、地毯清洗、石材翻新结晶养护、新大楼竣工开荒保洁等各种清洗保洁服务。为不同领域的客户提供全方位的优质服务。 \r\n作为北京消防协会会员单位，公司一贯遵循“客户至上、服务至上、诚信为本”的服务精神。经过多年的发展积累，我公司拥有了一批具有严格专业素质的管理及施工人员，赢的了广大客户的一致好评，在业内树立了良好的口碑。 我们将服务大北京，放眼京津冀脚踏实地的做好我们的消防事业。', '116.701521', '39.875343999999998', '116.57292', '40.006886999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4030', '北京安博楼宇设施管理有限公司', '333', '陈菊音', '13436567761', '唐振明', '13501027455', '2012年08月28日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区甘露园南里25号（三期）8号楼18层1805', '北京市', '北京市', '朝阳区', '平房地区办事处', '北京市朝阳区甘露园南里25号（三期）8号楼18层1805', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2012年08月28日', '2032年08月27日', '2019/1/11', '2020/1/10', '京消协（2019）证字006号', '91110105053635181L', '电气防火检测技术服务机构', '物业管理；技术推广服务；基础软件服务；设计、制作、代理、发布广告；企业管理咨询；文艺创作；企业管理；建筑消防设施检测技术服务；电气防火检测技术服务。(依法须经批准的项目，经相关部门批准后方可开展经营活动)（领取本执照后，应到住房城乡建设部、市住房城乡建设委、区县住房城乡建设委取得行政许可。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安博楼宇设施管理有限公司致力为高端商业地产各种业态项目提供专业化全链设施管理运营服务及维修改造服务、系统解决方案。同时通过建设或改造智能化管理、节能降耗、空气治理、楼宇直饮水等系统以实现楼宇品质的提升。北京安博楼宇设施管理有限公司依托核心管理层多年的工程设施管理及实施经验，为客户提供专业设施管理服务、楼宇设备设维修改造服务、系统解决方案。依据国际先进的楼宇设施管理理念，遵循服务理念国际化、管理手段信息化、工作流程科学化、单项服务专业化、管理人员职业化的工作宗旨，规范管理，强化服务意识。为客户提供优质、安全、高质量的工程服务。“设施管理”不同于一般意义上的物业管理，它与物业管理的管理对象一致——物业资产，但管理方法却不同。“设施管理”提出了物业寿命期全过程管理，包括产业、设施发展的长远策略，楼宇管理（包括设计、建造、装修），空间利用，设施保养，计划、维持和改善机构内的设备去创造一切有利于发展的环境；它具有常规设施设备管理的一般内涵，更重要的是通过对设施管理，进入到经营管理系统实施运营管理，并通过科学运行实现增值服务。', '116.517213', '39.917034999999998', '116.517213', '39.917034999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4031', '北京航天常兴科技发展股份有限公司', '332', '王德坤', '13601271316', '丁鹏忠', '18610132220', '2001年11月29日', '3350万元', '北京市', '北京市', '大兴区', null, '北京市大兴区金星路30号5号院6层', '北京市', '北京市', '大兴区', '观音寺街道', '北京市大兴区金星路30号5号院6层', '', '消防安全评估', '其他股份有限公司（非上市）', '2001年11月29日', '2021年11月28日', '', '', '', '91110115801172283G', '', '技术开发、技术转让、技术咨询、技术服务；施工总承包；投资管理；销售机械设备、电子产品、计算机、软件及辅助设备、建筑材料、金属材料、五金交电、日用杂货、化工产品（不含危险化学品及一类易制毒化学品）；货物进出口；技术进出口；代理进出口；生产及组装火灾监控系统、消防电子产品（消防应急照明和疏散指示系统）、智能电力仪表、智能家居控制系统、智能安防控制系统。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '航天常兴成立于2001年，注册资本3350万元，拥有正式员工76人，2008年航天科工主辅剥离改制为民营企业，是国家和中关村双高新技术企业、已经通过了ISO9001国际质量体系认证、消防产品CCC强制认证、美国UL认证等。2016年1月份成功挂牌新三板。公司主营智能消防产品，专注于智能消防产品的研发和生产，涉及三个领域，四个产品。三个领域是：火灾预警、火灾报警、消防服务。四个产品：智能消防产品、智慧消防监控常兴云平台、智慧城市指挥中心平台建设和社区消防服务站。\r\n航天常兴国内首创电气火灾技术，二代产品在线绝缘监测技术世界唯一技术。公司拥有 30项专利，发明专利 2项，软件著作权及实用新型专利 20 余项。\r\n智能型消防硬件产品包括《电气火灾监控系统》、《在线绝缘监测装置》、《智能消防应急照明和疏散指示系统》、《防火门监控系统》、《智能电力监测系统》、《消防设备电源监控系统》、《阻性漏电式电气火灾监控探测器》等，为建筑物安全用电（绝缘检测）、预防电气火灾、智能消防应急照明和疏散、消防设备电源的监测、电力监控等提供多种设计及解决方案。', '116.364862', '39.761271999999998', '116.364862', '39.761271999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4032', '北京卫京安烟道清洗中心', '330', '秦立芳', '13901103527', '代娜娜', '13488799292', '1999年03月18日', '50万元', '北京市', '北京市', '平谷区', null, '北京市平谷区新平西路14号-30', '北京市', '北京市', '平谷区', '滨河街道', '北京市平谷区新平西路14号-30', '', '烟道清洗', '集体所有制（股份合作）', '1999年03月16日', '长期', '2019/1/11', '2020/1/10', '京消协（2019）证字016号', '911101177000725827', '排油烟设施清洗机构', '劳务分包；烟道清洗；石材清洁养护、建筑物外立面清洁养护、空调清洗养护；维修消防设备；销售消防器材。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '我公司于1999年3月18日正式办理了工商执照，成立了“北京卫京安烟道清洗中心”，是北京市消防协会专家评审委员会评定、确定，具备厨房烟道清洗的专业单位，本公司技术力量雄厚，设备齐全，技术人员具有多年清洗经验，确保在清洗过程中严格执行消防法规及北京市地方标准。\r\n我们的服务宗旨为：不管您在任何地方都能享受到我们快捷周到的服务。我们始终坚持尽职尽责，诚信经营，用户至上的经营方针。凭借雄厚的实力和良好的信誉。竭诚为社会各界朋友提供优质满意的服务。\r\n我公司经营理念：以最优质的服务,最低廉的价格,让你得到最满意的结果，让您称心、放心、安心。', '117.100478', '40.134075000000003', '117.100478', '40.134075000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4033', '北京安泰达消防技术检测有限公司', '329', '张金阳', '13910023322', '张金亮', '18600379076', '2009年03月11日', '518万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区妙峰山镇政府大院南楼MFS1108室', '北京市', '北京市', '门头沟区', '妙峰山镇', '北京市门头沟区妙峰山镇陇驾庄东庄子临40号陇上工业园区东楼101室', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2009年03月11日', '2059年03月10日', '2018/12/28', '2019/12/27', '京消协（2018）证字469号', '91110109686945470P', '电气防火检测技术服务机构', '消防设施技术检测；电气消防安全检测；消防设施维护；技术开发、转让、咨询；经济信息咨询；机械设备租赁；出租商业用房；出租办公用房；销售消防产品、办公设备、建筑材料、装饰材料、五金交电、钢材；劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安泰达消防技术检测有限公司（以下简称公司）成立于2009年03月11日，是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京消防协会会员单位，并已通过了ISO9001:2008质量管理体系认证。\r\n公司具备消防设施检测和电气防火检测领域的专业检测资质，是开展建筑消防设施及电气防火检测技术服务的消防检测单位，技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，提供公正、科学、详尽和真实的检测报告。\r\n公司现有检测人员16名：其中,高级工程师1人，工程师3人，助理工程师1人。从事检测的人员均经培训考核合格，持证上岗。\r\n公司的主要业务是：消防设施技术检测；电气消防安全检测；消防设施维护。', '116.050366', '39.975814999999997', '116.055947', '39.977058', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4034', '北京天川科技发展有限公司', '328', '李惠忠', '13901105314', '张娜', '13611128300', '1996年18月09日', '5002万元', '北京市', '北京市', '海淀区', null, '远大路远大居住区二期住宅商务中心A区南端9A号（住宅）', '北京市', '北京市', '海淀区', '曙光街道', '四季青路7号郦城工作区806室', '', '建筑防火', '有限责任公司（自然人投资或控股）', '1996年18月09日', '长期', '2018/5/3', '2019/5/2', '京消协（2018）证字102号', '91110108633053807K', '', '卫星地面接收设施安装；有线电视站、共用天线设计、安装；工程勘察设计；技术开发、技术咨询、技术转让、计算机技术培训；承办展览展示活动；家居装饰；销售五金、交电、化工产品（不含危险化学品及一类易致毒化学品）、建筑材料、工艺品、计算机、软件及辅助设备、电子元件、器件、仪器仪表、汽车零配件；专业承包；租赁计算机、通讯设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天川科技发展有限公司（简称天川科技）创建于1996年，注册资金5002万元，办公场所面积双层楼共507平米，公司在不断提升产品质量，提高服务理念，是一家实力雄厚，赞誉度高的科技公司。 经营范围\r\n为卫星地面接收设施施工；有限电视站、共用天线设计、安装。公司主要致力于：建筑智能化弱电系统、安防监控系统、消防系统、综合布线系统、有线电视接地系统、防雷系统、计算机系统集成系统及综合管理平台系统集成开发、设计、安装、调试及技术支持、技术咨询为一体的高新技术企业。\r\n 公司拥有一批中高层管理人才及技术人才。最早获得了英国UKAS证书，后又顺利通过ISO9000质量体系认证，环境管理体系认证职业健安全管理体系认证、安防壹级、电子与智能化工程专业承包壹级、建筑机电安装工程专业承包叁级、工程设计甲级、消防设施工程专业承包二级、建筑装修装饰工程专业承包贰级、计算机信息系统集成叁级、安全生产许可证、音视频集成工程企业资质壹级、有线电视站及共用天线设计和安装许可证、中国安防协会会员单位、北京安防协会会员单位、软件会员单位等一系列专业公司必备的资质项目。', '116.28083700000001', '39.95308', '116.271429', '39.953406999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4035', '北京市慈航伟业环保科技有限公司', '327', '刘红光', '13701114657', '刘红光', '13701114657', '2009年10月12日', '1500万元', '北京市', '北京市', '丰台区', null, '北京丰台区西三环南路201号融达国际613', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京丰台区西三环南路201号融达国际613', '', '烟道清洗', '有限责任公司（自然人独资）', '2009年10月12日', '2029年10月11日', '2018/5/22', '2019/5/21', '京消协（2018）证字125号', '91110106696396188M', '排油烟设施清洗机构', '技术开发、技术推广、技术服务、咨询、转让；清洁服务；水污染治理；销售机械设备、电子产品、化工产品（不含危险化学品）、金属材料、家用电器；管道疏通；化粪池清掏。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司是一家集中央空调维修，维保，环境处理，水质处理，通风管道和厨房排烟管清洁清洗为一体的综合性服务企业。经过公司全体员工多年来的共同奋斗，公司从无到有、从大到强，从单一的厨房排烟管道、中央空调通风管道清洗工程到中央空调的综合维修维保工程，同时公司获得了两家油烟净化设备厂家京津冀区域的总代资质，一路走来不断发展壮大。\r\n     公司北京总部位于西三环南路201号，交通便利。我方将在4小时到达现场，24小时内解决问题。Tel:010-67613818，Mob:13701114657.', '116.319473', '39.852327000000002', '116.319473', '39.852327000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4036', '北京国泰怡安电子有限公司', '326', '彭宝秋', '', '赵豫龙', '18333561199', '2000年01月03日', '2010万元', '北京市', '北京市', '东城区', null, '北京市东城区东打磨厂街3号楼707室', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区华威南路弘善家园118号楼', '', '消防产品', '其他有限责任公司', '2000年01月03日', '2020年01月02日', '2018/3/9', '2021/3/9', '中消协证字第1468号', '911101017002531133', '', '制造电子产品（仅限分支机构经营）；安装、维修公用天线、音像设备、给排水设备、制冷空调设备；技术咨询、技术服务；销售五金交电、仪器仪表、电子元器件、木材、家具；制造、安装、维修火灾报警系统（仅限分支机构经营）；安装监控电视；接受委托从事物业管理；自营和代理各类商品及技术的进出口业务（国家限定公司经营或禁止进出口的商品及技术除外）；经营进料加工和“三来一补”业务；经营对销贸易和转口贸易；代理出口将自行研制开发的技术转让给其他企业所生产的非自产产品；制造家具（其中“制造家具”仅限分支机构经营）。（未经专项审批的项目除外。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京国泰怡安电子有限公司成立于1992年，成立至今一直致力于消防安全电子产品的研发、生产、销售和服务。历经20余年的发展和积累，公司先后荣获“重合同守信用单位”、“北京市科技之光信用企业”、“中国消防产业三十强”、“北京消防协会会员”等国家和省市级数十项荣誉称号。\r\n公司依托强大的研发技术实力和大批具有丰富开发经验的专业技术精英，采用先进的研发技术手段、IPD集成产品开发管理体系和严格完善的测试验证标准，坚持以市场为导向，以客户满意为宗旨，逐步发展成为行业内领先的消防电子产品制造企业和智能消防安全系统的方案解决专家，并取得多项国家专利。\r\n公司在不断壮大过程中，销售和服务网络已经覆盖到全国各地。公司以星级服务和超值服务为基本理念，体现规范、全面、快捷、主动和及时的服务特色，将优质的服务延伸到售前、售中和售后的全过程。目前公司拥有两个生产基地，近10条流水作业生产线，完全可以满足日益增长的市场需求。', '116.415829', '39.899417', '116.455043', '39.869183999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4037', '北京城建天宁消防有限责任公司', '324', '粟付芃', '63039182', '刘光美', '63183995', '1994年11月21日', '3003万元', '北京市', '北京市', '丰台区', null, '科技园富丰路4号3层03B04（园区）', '北京市', '北京市', '西城区', '金融街街道', '长椿街西里7号楼', '', '消防安全评估', '其他有限责任公司', '1994年11月21日', '2050年11月20日', '', '', '', '911101061015434771', '', '专业承包；工程设计；技术开发、技术转让、技术咨询；技术推广服务；销售机电设备、建筑材料、消防器材、机械设备、五金交电、电子产品、电器设备、通讯设备、计算机软硬件及辅助设备；货物进出口、技术进出口；维护消防设备、机电设备、建筑设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）（经营场所：北京市西城区长椿街西里7号楼）', '北京城建天宁消防有限责任公司是一家集科研、设计、施工、和销售为一体的高新技术企业。公司成立于1994年，注册资金2100万元，2002年即取得消防设施工程专业承包壹级资质。\r\n公司立足消防行业前沿，以艰苦创业、开拓进取、科技兴企、诚实守信为宗旨，锐意进取，2003年跻身中国消防产业三十强，连续多年被评为北京市高新技术企业、北京市建设行业诚信企业和资信评价AAA级信用企业，是首批获得中国消防行业信用等级评价AAA级的企业。\r\n公司具备消防设施工程专业承包壹级、机电安装工程专业承包贰级、建筑智能化专业承包叁级、消防设施专项工程和建筑智能化系统设计专项甲级资质。公司通过ISO9001∶2008质量管理体系、ISO14001∶2004环境管理体系和GB/T28001-2001职业健康安全管理体系认证。公司拥有成熟先进的技术、施工装备、数十名高、中级专业技术人员和一、二级注册建造师的经营管理团队，可以承担多类消防、机电安装和建筑智能化工程的设计和施工任务。', '116.28492', '39.835453000000001', '116.359233', '39.898496000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4038', '北京华祺洋消防安全有限公司', '323', '孟庆国', '64066047', '曲丽华', '13693228538', '1998年12月29日', '1200万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区天华北街11号院2号楼15层1507', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区天华北街11号院2号楼15层1507', '', '消防安全评估,建筑防火,宣传教育培训,消防设施,烟道清洗,消防信息化,消防产品,消防安全检查,电气防火', '其他有限责任公司', '1998年12月29日', '2028年12月28日', '2018/10/30', '2019/10/29', '京消协（2018）证字324号', '91110101634308058L', '排油烟设施清洗机构', '消防安全工程的设计；消防设备的安装、调试、维修；建筑装饰材料的防火处理；厨房烟道防火处理、清洗；摄影；销售消防器材、电子计算机及配件；消防安全技术开发、技术咨询（不含中介服务）、技术服务；楼宇自控设备的安装、调试；出版物零售。（企业依法自主选择经营项目，开展经营活动；出版物零售以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华祺洋消防安全有限公司(简称华祺洋公司) 是中华人民共和国建设部和国家消防部门批准的消防设施工程施工一级企业，消防设施工程设计甲级企业，可承担任何消防工程。本公司同时具备建筑装修装饰工程二级资质及建筑装饰装修工程设计乙级资质，电子与智能化工程专业承包贰级施工资质。并通过质量、环境和职业健康安全三个管理体系的认证。华祺洋公司的前身是北京市消防局所属的北京市华安消防安全公司。\r\n公司现有员工160余人，其中专业技术人员占70%，拥有一批高水平的高、中级工程技术人员，现有高级工程师10人，工程师23人，助理工程师12人，国家注册一级建造师7人，国家注册二级建造师6人。公司技术先进，设备精良，具有很强的综合实力。 \r\n    华祺洋公司遵循“努力做得更好，力争做到最好”的经营理念，将公司发展与用户需求紧密结合，充分发挥自身优势，促使公司工程业绩逐年大幅攀升，平均每年在施的工程项目近百项 ，其中许多是国家或北京市的重点工程。 \r\n华祺洋公司实施“素质-行为-业绩-效益-发展”的持续发展战略，运用“零距离”服务理念，不断提升服务质量，全力为用户提供全方位、全过程服务。\r\n华祺洋公司全体员工，团结奋进，', '116.50079700000001', '39.802888000000003', '116.50079700000001', '39.802888000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4039', '北京中联行消防工程有限责任公司', '322', '陈亚丽', '', '田红卫', '13501145753', '2005年06月23日', '1000万元', '北京市', '北京市', '东城区', null, '北京市东城区东打磨厂街3号楼704', '北京市', '北京市', '东城区', '东花市街道', '北京市东城区东打磨厂街3号楼704', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2005年06月23日', '2035年06月22日', '2018/10/30', '2019/10/29', '京消协（2018）证字342号', '91110101777072062C', '', '专业承包；销售消防设备、楼宇自控设备、安防设备；安装照明器材、安防设备；工程设计。（未经专项审批的项目除外；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中联行消防工程有限公司（以下简称北京中联行）是具有独立企业法人资格的专业消防工程公司，是集消防系统安装、维修、保养及咨询服务为一体的现代化企业。北京中联行的前身为甘肃中联行消防工程有限公司。\r\n公司最初成立于1996年，于2005年正式迁京，改为北京中联行消防工程有限公司。公司是经中华人民共和国建设部核定的国家一级资质的消防设施工程专业施工单位，承接了包括写字楼、酒店、商场、工业企业、金融机构、医疗单位、电厂、石油化工等大中型工程的火灾自动报警系统、自动喷水灭火系统、气体灭火系统、消火栓系统、防排烟系统、防火涂料等消防工程。以其卓著的信誉与卓越的品质赢得了社会各界的好评及信赖，并荣获多种奖项。\r\n公司现有员工中，专业技术人员超过80%，拥有一批高水平的高、中级工程技术人员。公司技术先进，设备精良，具有很强的综合实力。', '116.415829', '39.899417', '116.415829', '39.899417', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4040', '北京新百发缘科技有限公司', '321', '黄大林', '13371676955', '陈永利', '13371676955', '2005年02月22日', '1000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧桥路25号院3号楼7层708', '北京市', '北京市', '大兴区', '旧宫地区办事处', '北京市大兴区旧桥路25号院3号楼7层708', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年02月22日', '2025年02月21日', '2018/12/28', '2019/12/27', '京消协（2018）证字470号', '91110302771986912R', '排油烟设施清洗机构', '技术开发；技术转让；技术咨询；中央空调通风管道清洗；电力设施清洗；中央空调水路清洗的技术检测；清洁服务；工程项目管理；机电设备及空调设备的维修、安装；销售机械设备、电子产品、仪器仪表、建筑材料、五金交电（不含电动自行车）、化工产品（不含危险化学品及一类易制毒化学品）、电气设备；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京新百发缘科技有限公司注册于2005年2月，注册资金1000万元，是一家集中央空调系统清洗、排油烟设施清洗、空调设备维护保养及净化环保设备销售的高科技公司。\r\n自2005年2月成立至今，中央空调通风系统清洗面积已达160万平方米、排油烟设施清洗面积已达50万平方米。清洗领域涉及国家政府机构、三级甲等医院、五星级酒店、大型商场、高档写字楼及各类餐厅。公司拥有专业的中央空调维保团队，掌握开利、特灵、约克、麦克维尔及国内各大品牌先进维保技术。\r\n我司已被评为国家高新技术企业和AAA级信用企业、拥有多项国家专利，并荣获北京市卫生局颁发的集中空调通风系统清洗技术服务资质、中国设备管理协会颁发的中国制冷空调设备维修安装A类贰级资质、北京市消防局协会颁发的排油烟设施清洗资质。已成为中国卫生监督协会会员、中国中小商业企业协会会员和中国公共机构绿色节能产业创新联盟会员。同时通过了ISO9001质量管理体系ISO14001环境管理体系和18001职业健康安全管理体系的认证。\r\n  我司以艰苦的作风打拼坚实的企业基础；以诚实的信念承诺一流的企业服务；实干的精神创造高效的企业业绩。', '116.454791', '39.793624999999999', '116.454791', '39.793624999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4041', '北京英特莱科技有限公司', '320', '刘学锋', '010-69742811', '颜会芬', '15110031152', '2001年12月28日', '7600万元', '北京市', '北京市', '昌平区', null, '城北街道西环路76号', '北京市', '北京市', '昌平区', '城北街道', '城北街道西环路76号', 'AAA', '消防产品', '其他有限责任公司', '2001年12月28日', '2051年12月27日', '2018/9/12', '2019/9/11', '京消协（2018）证字291号', '911101147334473015', '', '技术推广服务；软件开发；安装节能保温制品；经营本企业和成员企业自产产品及技术出口业务；本企业和成员生产所需的原辅材料、仪器仪表、机械设备、零配件及技术的进口业务（国家限定公司经营和国家禁止进出口的商品除外）；经营进料加工和“三来一补”业务；设计防火卷帘、防火门、挡烟垂壁、防火母线槽、防火桥架、防火包、防火毯、防火板、防火装饰壁布；销售纺织品、消防服装、灭火毯、环保过滤材料及制品、服装面料、安全防护用品、计算机、软件及辅助设备、机械设备及配件、日用品、第一类、二类医疗器械；供暖服务；专业承包；制造、安装防火卷帘、防火门、挡烟垂壁、防火母线槽、防火桥架、防火包、防火毯、防火板、防火装饰壁布；生产消防服装、灭火毯、环保过滤材料及制品、服装面料、安全防护用品、第一类医疗器械；工程设计；销售第三类医疗器械；生产第二类、第三类医疗器械。（企业依法自主选择经营项目，开展经营活动；生产第二类、第三类医疗器械、销售第三类医疗器械、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京英特莱科技有限公司成立于2001年12月28日，由北京英特莱技术公司、北京工业发展投资管理有限公司及北京平板玻璃集团公司共同组建，注册资本7600万元。本公司是国家级高新技术企业，主要从事安全防护产品、工业保温节能产品的研发、设计、生产和销售。产品包括消防战斗服、消防指挥服、消防隔热服、抢险救援服、消防执勤服、消防头盔、消防靴、消防手套、空军连体飞行服、飞行员夹克及核电、火电保温节能被等。', '116.22902499999999', '40.216647000000002', '116.22902499999999', '40.216647000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4042', '北京市澳际智能消防安全工程有限责任公司', '319', '彭素平', '', '杨旭', '18611130539', '1998年04月08日', '2900万元', '北京市', '北京市', '东城区', null, '北京市东城区安化寺幸福家园11幢1705号', '北京市', '北京市', '东城区', '东花市街道', '北京市东城区东打磨厂街3号', '', '消防设施', '其他有限责任公司', '1998年04月08日', '2028年04月07日', '2018/10/30', '2019/10/29', '京消协（2018）证字342号', '91110101634301956Y', '', '消防工程施工；工程设计；销售、维修消防设备、楼宇自控设备、安防设备；安装照明器材、安防设备；消防工程技术服务；专业承包；货物进出口；技术进出口；代理进出口；出租商业用房；出租办公用房。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '公司简介\r\n北京市澳际智能消防安全工程有限责任公司（以下简称澳际消防）成立于1998年，2001年经建设部审定授予“消防设施工程专业承包一级”资质，中国消防协会团体会员，是集消防系统集成供货、施工安装、交工验收、维护保养及技术咨询服务为一体的现代化企业。\r\n公司于2005年通过“质量、环境及职业健康安全”三标一体认证，公司财务、技术咨询、采购、施工、售后服务等各环节均采用信息化的管控手段，尤其是自2012年起全面实行项目IPD管控体系，使公司的整体管理水平得到了进一步提升，确保实现公司工程项目一次验收合格率100%的质量目标。\r\n公司成立20年以来，承接了包括写字楼、酒店、商场、工业企业、金融机构、医疗单位、学校、电厂、石油化工等大中型工程中的火灾自动报警系统、自动喷水灭火系统、气体灭火系统、消火栓系统、防排烟系统、防火涂料等系统的消防工程。所承担的项目全部一次性的通过消防验收，获得了客户的一致好评，卓越的品质赢得了社会各界的好评及信赖，并荣获多种奖项。\r\n公司遵循“满足客户要求，满足市场竞争要求”的经营理念，将公司发展与用户需求紧密结合，充分发挥自身优势，促使公司工程业绩逐年攀升。', '116.429469', '39.891443000000002', '116.415829', '39.899417', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4043', '北京顺安盛消防科技有限公司', '318', '商会娥', '13693679811', '陈莹', '13718687708', '2004年07月30日', '500万元', '北京市', '北京市', '通州区', null, '北京市朝阳区垡头村北人集团公司第十印刷机械厂24幢、41幢', '北京市', '北京市', '通州区', '中仓街道', '北京市朝阳区垡头村北人集团公司第十印刷机械厂24幢、41幢', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2004年07月30日', '2024年07月29日', '2019/2/27', '2020/2/26', '京消协（2019）证字070号', '911101027655298382', '电气防火检测技术服务机构', '技术检测；技术开发、技术咨询、技术服务；组织文化艺术交流活动；承办展览展示；经济贸易咨询；基础软件开发；销售纸制品、工艺品、茶具、日用品、文具用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京顺安盛消防科技有限公司（以下简称:我公司）成立于2004年 7 月，位于北京市朝阳区垡头村北人集团公司第十印刷机械厂24幢、41幢，检测办公面积400余平方米。主要从事电气防火检测、建筑消防设施检测工作。\r\n公司现有从事本专业工作多年，具有丰富检测经验的专职检测人员10名，所有从事检测的工作人员都经过严格的专业技能和岗位知识培训，具有较高的理论水平和良好的业务素质，能够承担公司所开展的检测评价项目工作。\r\n公司现有便携检测仪器：辐射温度计、红外热像仪、钳形表、钳形表（真有效）、钳形功率表（谐波）、钳形功率表、漏电流钳形表、钳形接地电阻测试仪、火灾探测加烟试验器、火灾探测加温试验器、一般压力表、风速仪、照度计、温湿度计、数字微差压计(数字压力计)、声级计、电子秒表、手持式激光测距仪、数显卡尺、线型光束感烟探测器滤光片、钢卷尺、数字压力计(压力变送器）、超声波流量计、对讲机检测器。设备齐全、先进，状态完好并定期检定，能够满足检测工作的需要。\r\n为适应检测机构管理标准《实验室资质认定评审准则》的要求。我公司编写了《质量手册》、《程序文件》、《作业指导书》及各类表格，以此为基础建立了质量管理体系', '116.674471', '39.906632000000002', '116.674471', '39.906632000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4044', '北京京安福伟业消防安全检测有限公司', '317', '于清', '15911186618', '葛杰', '17801078817', '2010年04月16日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区天星街1号院11号楼5层503室', '北京市', '北京市', '房山区', '长阳镇', '北京市房山区天星街1号院11号楼5层503室', '', '消防设施', '有限责任公司（自然人独资）', '2010年04月16日', '2030年04月16日', '2018/12/28', '2019/12/27', '京消协（2018）证字482号', '911101065530626315', '电气防火检测技术服务机构', '建筑消防设施检测；电气防火检测；销售消防器材、安全技术防范产品、机械设备、仪器仪表、办公用品、计算机软件及辅助设备、空调制冷设备、电气设备、节能环保设备；维修消防设备；技术推广；技术开发、技术转让、技术咨询（中介除外）、技术服务；家居装饰及设计；工程设计；家庭劳务服务；清洁服务（不含洗车服务）；经济信息咨询（中介除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京安福伟业消防安全检测有限公司成立于2010年，注册资金1000万元。是北京市消防局审核批准的具有电气安全与消防设施检测、火灾报警探测器清洗、消防自动报警系统维护与保养资质的企业。本公司经消防协会的严格考核和认证已经具备消防设施检测和电气防火检测两项行业资质，通过了GB/T19001-2008质量管理体系认证，并且获得由北京市消防协会颁发的“北京市2013年度建筑消防设施、电气防火安全检测双优企业”荣誉称号。我公司目前已经通过北京市质量技术监督局的计量认证及北京市消防局的临时一级资质现场审核并颁发证书，具备消防设施及电气防火技术检测及自动报警灭火系统维护保养的资质和能力要求。', '116.159721', '39.755324999999999', '116.159721', '39.755324999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4045', '北京大德润生消防检测有限公司', '316', '彭宝秋', '', '岳建', '13810151861', '2003年11月07日', '1000万元', '北京市', '北京市', '东城区', null, '北京市东城区东打磨厂街3号', '北京市', '北京市', '东城区', '东花市街道', '北京市东城区东打磨厂街3号', '', '电气防火', '有限责任公司（自然人投资或控股）', '2003年11月07日', '2023年11月06日', '2018/10/30', '2019/10/29', '京消协（2018）证字341号', '91110101756019158D', '电气防火检测技术服务机构', '提供消防技术检测服务、电气防火安全技术检测服务；技术开发、技术咨询（不含中介服务）；维修消防器材。(（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动）)', '北京大德润生消防检测有限公司成立于2003年，是经北京市消防协会评审通过的，在国家工商行政管理部门注册具有独立法人资格的企业连续多年被评为北京市检测行业“双优”企业。是专门提供电气防火安全检测和建筑消防设施检测和各类消防设施维护保养的专业机构。本公司检测维保范围包括：强电系统的变配电装置、电力电缆、电气线路、控制电路、保护电器及用电设备；弱电系统的火灾自动报警系统、消火栓系统、自动喷水灭火系统、气体灭火系统、防排烟系统、防火卷帘门及挡烟垂壁、防火门、泡沫灭火系统等。\r\n公司技术力量雄厚，检测人员均具有大专以上学历，熟悉国家现行各种技术规范和标准，均经过北京市消防协会的严格培训，具备上岗资格。检测人员具有丰富的检测技术经验，检测过程中采用高科技仪器设备，严格执行国家消防行业的法律、规范及北京市地方标准和检测规程，确保检测质量。\r\n为完善和规范内部管理，不断满足顾客需求,增强市场竞争力，本公司于2004年通过了ISO9001:2000质量管理体系认证，并取得了认证证书；于2014年10月通过实验室资质认证，并取得计量认证证书。在持续改进质量管理体系的同时,也极大地促进了公司的发展。', '116.415829', '39.899417', '116.415829', '39.899417', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4046', '北京大洋巨人环保科技有限公司', '315', '郭洪波', '010-87696262', '王峰', '010-67153330', '2004年05月17日', '500万元', '北京市', '北京市', '东城区', null, '北京市东城区东大地街1号P9室', '北京市', '北京市', '东城区', '体育馆路街道', '北京市东城区东大地街1号P9室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2004年05月17日', '2024年05月16日', '2019/1/17', '2020/1/16', '京消协（2019）证字027号', '91110101762997038M', '', '技术推广、技术服务；机器和办公设备的清洗；厨房设备的清洗；房屋的清扫、消毒；销售机械设备、电子产品、化工产品（不含危险化学品及一类易制毒化学品）、金属矿石、非金属矿石、文化用品；修理非家用制冷、空调设备；建设工程项目管理；经济贸易咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京大洋巨人环保科技有限公司成立于2004年，是中澳合作，以中央空调室内空气质量（IAQ）技术研发、中央空调清洗检测设备生产销售及中央空调风道清洁服务为主营业务的民营企业。 \r\n北京大洋巨人环保科技有限公司成立之初以空调清洗服务为主，已经成功完成100多个工程项目，公司从2004年开始研发空调专用清洗设备，依托DUST BUSTERS在澳大利亚二十多年的专业清洗经验，针对国内空调管道的复杂性，自行研制出适合任何异型管道的多种清洗设备，确保中央空调清洗服务的高效实施。经过几年的发展，公司的产品系列包括：清扫刷机器人、检测机器人、过滤集尘机、电动清扫刷、气锤机器人，竖管手动汽锤等。 \r\n在进行产品创新的同时，“北京大洋巨人环保科技有限公司”不断提高公司的管理水平和能力，北京大洋巨人环保科技有限公司通过了ISO9001、ISO14001、ISO18001等管理体系认证，并通过了国家疾病预防控制中心公共场所集中空调通风系统专用清洗设备技术评估，为公司的进一步发展创造了坚实的平台。', '116.419865', '39.888899000000002', '116.419865', '39.888899000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4047', '北京天汇中方消防技术检测有限公司', '314', '续庆祝', '13901070225', '刘东明', '13911239713', '2002年07月04日', '210万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区慧忠北里111号楼3层308室', '北京市', '北京市', '朝阳区', '大屯街道', '北京市朝阳区慧忠北里111号楼3层308室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2002年07月04日', '2022年07月03日', '2019/1/11', '2020/1/10', '京消协（2019）证字002号', '91110105740442306Y', '电气防火检测技术服务机构', '电路及消防设施检测；技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京天汇中方消防技术检测有限公司（以下简称公司）成立于2002年07月04日，是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，并已通过了CMA认证和ISO9001认证。是一家专门从事建筑物固定消防设施技术检测及电气防火安全检测的专业公司。公司经北京市消防局消防协会的严格考核和认证，具备消防设施检测和电气防火检测领域的专业检测资质，是开展建筑消防设施及电气防火检测技术服务的消防检测单位，技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，提供公正、科学、详尽和真实的检测报告。\r\n公司人员共有10名,其中检测人员6名,财务1人，总经理1人，综合办公室1人，其中工程师1人。从事检测的人员均经培训考核合格，持证上岗。', '116.405613', '40.005597000000002', '116.405613', '40.005597000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4048', '北京鑫淼润泽消防设施检测有限公司', '313', '赵建军', '13601061150', '肖珊珊', '010-69698559', '2014年10月30日', '1000万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区雁栖经济开发区雁栖东二路17号2幢205、206室', '北京市', '北京市', '怀柔区', '北京雁栖经济开发区', '北京市怀柔区雁栖经济开发区雁栖东二路17号2幢205、206室', '', '电气防火', '有限责任公司（自然人投资或控股）', '2014年10月30日', '长期', '2018/8/9', '2019/8/8', '京消协（2018）证字260号', '91110116318081365B', '', '消防设施检测；电气消防安全检测；维修消防器材；消防设施维护；技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', null, '116.690882', '40.361832999999997', '116.690882', '40.361832999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4049', '北京恩和物业服务有限公司', '312', '卞红英', '13661226092', '卞红英', '13661226092', '2011年08月12日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市西城区人定湖北巷1号楼', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区龙万基商务楼315房间', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年08月12日', '2031年08月11日', '2018/6/27', '2019/6/26', '京消协（2018）证字214号', '911101025808342112', '', '物业管理；清洁服务；绿化管理；经济贸易咨询；日用电器修理（不符合家用电子电器维修业服务经营规范不得开展经营活动）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京恩和物业服务有限公司，致力于为客户提供高品质的物业及清洁服务。公司从2011创立之初至今，始终秉承“感恩受福，爱敬存心”的经营理念。 “路漫漫其修远兮，吾将上下而求索”，没有一个企业的资源能够完全适应瞬息万变的市场，也没有任何一个市场会去“包容或谅解”企业的不足。我们将时怀敬畏之心，慎独之身，为社会、为客户提供更好、更优的服务品质。', '116.38761', '39.962828999999999', '116.49300700000001', '39.902988000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4050', '北京市富熙豪安防技术有限公司', '311', '徐晓永', '13911823253', '徐晓永', '13911823253', '2003年11月24日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区广顺北大街31号院3号楼3层B-305', '北京市', '北京市', '朝阳区', '望京街道', '北京市朝阳区广顺北大街31号院3号楼3层B-305', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2003年11月24日', '2023年11月23日', '2018/12/28', '2019/12/27', '京消协（2018）证字498号', '91110105756720040G', '电气防火检测技术服务机构', '技术推广服务；质检技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市富熙豪安防技术有限公司有限公司（以下简称公司）成立于2003年11月24日，是依法在北京市工商管理局注册的具有独立法人地位的公司，是经北京消防协会核准备案的专业消防检测公司，是北京市消防协会会员单位，已取得资质认定计量认证证书，并已通过了ISO9001:2008质量管理体系认证。', '116.46737299999999', '39.996197000000002', '116.46737299999999', '39.996197000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4051', '北京世纪中科清洁服务有限公司', '310', '张中科', '18911586995', '张梦悦', '18871788872', '2008年08月15日', '600万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区博大路3号院3号楼2层207', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区博大路3号院3号楼2层207', 'AA', '烟道清洗', '有限责任公司（自然人独资）', '2008年08月15日', '2028年08月14日', '2019/11/20', '2020/11/19', '2019-HY-0283', '91110105679643896K', '烟道清洗', '清洁服务（不含餐具消毒）；技术开发、技术转让、技术咨询、技术服务；销售化工产品（不含危险化学品）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京世纪中科清洁服务有限公司成立于二零零八年，是一家专门从事油烟管道防火清洗的企业。\n\n本公司已经走过十余年的辉煌历程逐渐发展成为清洗设备先进、技术力量雄厚、管理完善、在同行业中小有名气的企业。十余年以来，始终以良好的服务质量，优质的服务态度为宗旨，赢得了广大客户的广泛赞誉。目前本公司已和北京市和周边地区200多个单位签订了长期服务合同。公司始终坚持“质量第一、信誉至上”的原则，愿将一流的舒适环境与客户的形象融为一体。\n\n本公司在发展的同时，不断追求卓越，在烟道防火清洁方面，严格按照国家消防部门规定，排除因油烟而存在的消防隐患。同时还对排烟系统进行维修和日常保养。使其达到安全、高效、环保、节能。\n\n我们全体员工很高兴能有机会向您提供服务，我们将以最真诚的服务为您创造一个理想的环境。', '116.474194', '39.835818000000003', '116.474194', '39.835818000000003', '', null, null, null, null);
