INSERT INTO `t_fc_company` VALUES ('4054', '北京宝凤翔通消防技术检测有限公司', '306', '谢玉凤', '15911027539', '刘建国', '13071153456', '2008年06月25日', '1200万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区庙城镇庙城村北十字街A03号', '北京市', '北京市', '怀柔区', '庙城地区办事处', '北京市怀柔区庙城镇庙城村北十字街A03号', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2008年06月25日', '2028年06月24日', '2018/3/29', '2019/3/28', '京消协（2018）证字071号', '91110116677435428Y', '电气防火检测技术服务机构', '消防技术检测；销售日用百货、电子产品、五金交电、化妆品、工艺美术品、服装鞋帽、通讯设备（不含卫星地面发射、接收设备）；设计广告；消防设施维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京宝凤翔通消防技术检测有限公司成立于2008年，是经市消防局正式批准、市工商局登记注册的企业。现为北京市消防协会会员及北京消防协会十佳单位。\n  北京宝凤翔通消防技术检测有限公司是从事建筑消防设施的检测﹑电气防火检测，是对建筑消防设施检测﹑电气防火检测的专业技术公司，并具备检测资质。\n公司本着以高品质的技术服务为先导，以科学的管理为保证的原则，通过具有丰富经验的专业人员多年的实践，不断的摸索和创新，现已建立起配置科学合理﹑职能分工明确﹑衔接严密可靠的管理机制。从而制定出符合企业发展的工作指导思想：以客户的最大利益为中心，以全面的的技术力量为保障，优质高效地提供一流的服务，使所管理的消防设备处于良好的状态，真正发挥其应有的功能，最大程度的消除火灾隐患，确保安全，解除各客户的后顾之忧。\n我公司愿竭诚于各界朋友携手合作，为消防事业作出应有的贡献，为人民创造安全良好的环境。', '116.628435', '40.294601', '116.628435', '40.294601', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4055', '北京洁乐士环保科技有限公司', '304', '刘春强', '18811496866', '魏超', '18811496866', '2016年10月09日', '100万元', '北京市', '北京市', '大兴区', null, '北京市大兴区旧桥路25号院7号楼1402', '北京市', '北京市', '大兴区', '瀛海地区办事处', '北京市大兴区104国道瀛海段22号2幢4层8402室', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年10月09日', '2036年10月08日', '2018/6/8', '2019/6/7', '京消协（2018）证字185号', '91110105MA008M8F4X', '排油烟设施清洗机构', '技术推广服务；清洁服务（不含餐具消毒）；销售安全技术防范产品、厨房设备、家用电器、电子产品、日用品、建筑材料、机械设备、文具用品、化工产品（不含危险化学品及一类易制毒化学品）、金属材料、厨房用具、花卉、苗木（种苗木除外）；维修办公设备、仪器仪表、空调制冷设备；害虫防治服务；灭鼠及预防服务；大气污染治理；城市园林绿化；餐饮管理；保洁服务；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京洁乐士环保科技有限公司是一家专业从事排油烟设施清洗工程的服务型企业。为用户的清洗系统提供“最优质的解决方案”是企业的服务宗旨。立志用最优的资源配备、最优的经营模式、最优的服务质量，为用户提供系统清洗的最优解决方案。\n    公司拥有一批专业技术人才队伍，所有员工均经过系统的专业技术培训和严格的技术、职业素养考核。高素质的专业团队可确保高效、优质地完成油烟管道的清洗工作。\n    公司不断吸收和引进各类专业技术和管理人才，提高经营管理人员的素质，以一流的品质求生存、一流的诚信求发展、一流的管理求进取、合理的价格来服务于广大客户。\n　公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！\n    我们的承诺：您的满意才是我们的满意！我们的今天：全凭客户以往的支持！\n    我们的未来：将继续全方位的服务！我们的坚信：做到专业，就能做到最好！', '116.45650999999999', '39.793190000000003', '116.44819099999999', '39.768149000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4056', '北京海泰永成科技有限公司', '303', '于喆', '13501219936', '于喆', '13501219936', '2006年04月29日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区左安门外饮马井1号院2号楼1层1单元104', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区左安门外饮马井1号院2号楼1层1单元104', '', '烟道清洗', '有限责任公司（自然人独资）', '2006年04月29日', '2026年04月28日', '2018/5/11', '2019/5/10', '京消协（2018）证字103号', '91110105788615173Y', '排油烟设施清洗机构', '技术推广服务；经济贸易咨询；组织文化艺术交流活动（不含演出）；清洁服务；电脑图文设计；展览服务；销售机械设备、五金交电、电子产品、建材、工艺品、文具用品；打字；复印服务；维修灶具。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京海泰永成科技有限公司是一家综合性环保服务企业，位于北京市朝阳区左安门外。公司下设餐饮商务服务事业部、中央空调服务事业部、厨房设备事业部、业务主要包括【中央空调运行维护清洗】、【油烟管道维护清洗、设备安装】、【有害生物防治服务】、【厨房设备销售，维修】、【餐饮排烟系统安装，维修】等。\n    作为服务行业的一员，公司秉承“零投诉”的服务宗旨，融质量管理服务体系与高科技施工手段为一体，拥有了一套严格、有效的质量管理体系和服务流程管理体系，打造了一支高效率、高品质的专业队伍。\n    公司坚持：所有员工都是我们质量管理体系、服务流程管理体系中的一员，均要经过系统、严格、长期的专业技术培训和职业素养培训。公司现有施工人员50余人，经营管理人员10余人，我们丰富的经验可广泛服务于星级宾馆、酒店、商场、影院、火车站、写字楼、学校、医院、餐饮连锁、党政机关办公区、化工热力等工厂企业等，我们坚持用最先进的技术（光触媒、PHI）、最严格的管理服务体系(ISO9000)、最优质的服务质量，为用户提供最优解决方案。', '116.443794', '39.868586999999998', '116.443794', '39.868586999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4057', '北京安泰德科技有限公司', '302', '张春龙', '010-84639601', '任晗光', '13520671103', '1998年05月25日', '800万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区金盏乡金盏大街55号', '北京市', '北京市', '朝阳区', '金盏地区办事处', '北京市朝阳区金盏乡金盏大街55号', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '1998年05月25日', '长期', '2018/5/22', '2019/5/21', '京消协（2018）证字151号', '911101056337015289', '电气防火检测技术服务机构', '技术推广服务；安全检测；质量检测；劳务派遣；设计、制作、代理、发布国内及外商来华广告；承办展览展示；广告信息咨询；清洁服务（不含餐具消毒）；机动车公共停车场服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安泰德科技有限公司成立于1998年，注册地址北京市朝阳区金盏乡金盏大街55号，注册资本800万元。我公司是专业的消防技术服务机构，被北京消防协会吸纳为正式会员。取得了消防技术服务机构的所有资质及认证，包括：计量认证（CMA）证书、电气防火检测技术服务机构资信证书、消防技术服务机构（一级）资质。公司通过了质量管理体系认证、环境管理体系认证、职业健康管理体系认证。所有业务均按照管理体系的要求可靠运转。', '116.56880099999999', '40.006943999999997', '116.56880099999999', '40.006943999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4058', '北京中安颐合消防技术有限公司', '301', '李方玉', '13901197206', '朱建海', '18611718786', '2008年11月05日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区辛庄村大灰厂东路甲26号', '北京市', '北京市', '西城区', '广安门外街道', '广安门外大街182号远见国际2606', '', '消防设施,电气防火,消防安全评估', '有限责任公司（自然人投资或控股）', '2008年11月05日', '2028年11月04日', '2018/11/9', '2019/11/8', '京消协（2018）证字359号', '911101066819866448', '电气防火检测技术服务机构', '技术检测；技术服务、技术开发、技术转让、技术咨询；维修消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中安颐合消防技术有限公司是2008年经北京消防协会专家评审委员会评审为具备建筑消防设施检测技术和电气防火检测技术服务质量保障体系单位，并通过了ISO9000质量管理体系认证，是消防检测行业中的一支新兴力量。同时在实践工作中积累了大量宝贵经验，并给客户提供了一流的服务，赢得了客户和业界的信赖与好评。\n中安颐合吸纳了在这个专门领域已经具备较高理论素养和丰富实践经验的专家和大专以上学历的技术精英20多人。建设成拥有高级工程师4人，工程师15人，技术人员若干的一流人才梯队。中安颐合利用人才资源这一巨大优势，使得其在行业内具备了卓越的竞争能力和服务能力。本公司配备了目前国际上最先进的红外热像仪、红外测量仪、超声检测仪等检测仪器，可以对检测过程中的各项数据以及红外热图象进行智能化分析与处理，使检测结果更准确、更详细。提高了消防检测工作的公正性、准确性和科学性。\n中安颐合公司机制灵活，管理完善，拥有一个具有现代企业管理思想、充满活力、不断进取的管理团队。一批年轻、知识新、肯钻研、有思想、有追求的技术精英，聚集在“中安颐合”的旗帜下，与企业共同进步。', '116.151668', '39.860540999999998', '116.336597', '39.889322999999997', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4059', '北京安亿通消防安全技术有限公司', '300', '徐堂卿', '13511078588', '肖志义', '13910699231', '2005年07月27日', '410万元', '北京市', '北京市', '门头沟区', null, '门头沟区石龙经济开发区永安路20号2号楼3单元6层', '北京市', '北京市', '门头沟区', '永定地区办事处', '门头沟区石龙经济开发区永安路20号2号楼3单元6层', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2005年07月27日', '2055年07月26日', '2018/11/26', '2019/11/25', '京消协（2018）证字395号', '91110109778631495J', '', '消防技术开发、服务、咨询；技术检测；销售消防器材、电子产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京安亿通消防安全技术有限公司是专业从事建筑消防设施检测和电气防火安全检测的技术服务公司。2005年7月经北京市消防局资质审核批准、北京市工商局核准正式成立,注册资金410万元人民币，办公面积387.9平方米。\n公司拥有雄厚的技术力量和高素质的专业队伍。总工程师具有几十年建筑消防设施和电气防火的设计、施工及检测经验，具备高级工程师职称和注册消防工程师资格。公司现有检测技术人员20人，其中高级职称2人，一级注册消防工程师10人，中级建构筑物消防员6人。\n公司自成立以来始终坚持“公正、科学、优质、高效”的质量方针，为社会提供一流的服务，先后承接了上千项消电检业务。为了更好地开展检测工作，提高检测能力和服务质量，公司依据《实验室资质认定评审准则》的要求，建立了完整的质量管理体系、制定了科学严谨的检测技术方法，并将持续不断的进行改进和完善，使检测工作更加规范，检测质量进一步提高。\n北京安亿通消防安全技术有限公司郑重承诺', '116.125978', '39.896276999999998', '116.125978', '39.896276999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4060', '北京重泰安消防技术服务有限责任公司', '299', '李征', '13701234010', '王宝新', '13581577745', '2004年06月10日', '228万元', '北京市', '北京市', '西城区', null, '北京市西城区马连道路9号安华景苑饭店3031室', '北京市', '北京市', '西城区', '广安门外街道', '北京市西城区马连道路9号安华景苑饭店3031室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2004年06月10日', '2034年06月09日', '2018/4/18', '2019/4/17', '京消协（2018）证字081号', '91110102763511044B', '', '技术检测；技术服务；技术咨询；销售消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京重泰安消防技术服务有限责任公司（以下简称公司）成立于2004年6月10日，是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，并已通过了ISO9001:2008质量管理体系认证。\n公司经北京市消防局消防协会的严格考核和认证，具备消防设施检测和电气防火检测领域的专业检测资质，是开展建筑消防设施及电气防火检测技术服务的消防检测单位，技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，提供公正、科学、详尽和真实的检测报告。\n公司现有的检测人员满足检测业务。从事检测的人员均经培训考核合格，持证上岗。\n公司的主要业务是： \n建筑消防设施维修保养及检测： 火灾自动报警及联动控制系统、消防供水系统、消火栓系统、自动喷水灭火系统、气体灭火系统、防烟排烟系统、防火门、防火卷帘及档烟垂壁。\n电气防火检测：变配电装置、照明灯具、开关、插座、线路敷设。', '116.32621399999999', '39.886747', '116.32621399999999', '39.886747', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4061', '北京力天京安消防科技有限公司', '298', '汪亮', '13801193512', '苏檀华', '13811129697', '2010年06月04日', '519万元', '北京市', '北京市', '西城区', null, '北京市西城区马连道南街6号院1号楼6B-15', '北京市', '北京市', '西城区', '广安门外街道', '北京市西城区马连道南街6号院1号楼6B-15', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2010年06月04日', '2030年06月03日', '', '', '', '91110102556865253R', '', '技术服务、技术咨询；设备维修；清洁服务；销售日用品、标牌；技术检测（不含产品质量检验）；维修消防设备。(依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。)', '北京力天京安消防科技有限公司最早成立于2010年，是一家以技术服务、技术咨询、设备维修、清洁服务、销售日用品、标牌、技术检测、消防设备维修，实行科工贸一体同心多元化经营的法人经济联合体。\n该公司具有良好的企业形象和产品形象，公司通过几年来的“务实、创新、垂质、求益”的经营理念，和雄厚的资金，科技人才，地域优势，在经营消防器材，及消防工程等领域开拓进取，在营业量上不断上升，并以优质的产品，优良的服务，优惠的价格，为客户提供了全方位配套服务，赢得了广大客户的高度认可。\n公司目前拥有一批长期从事消防工作，精通消防技术，熟悉消防规范，实践经验丰富的工程技术人员，并组成了一支经验丰富的“阻燃奇兵”业务队伍:\n公司的宗旨是：以质量求生存，以技术创新拓展与海内外、及全国各界同仁精成合作，占科技之高点，成科贸之伟业，为消防事业做出更大贡献。', '116.324692', '39.883194000000003', '116.324692', '39.883194000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4062', '北京久久神龙咨询服务有限公司', '297', '杨洋', '13701017110', '李骋', '13601209040', '2013年11月06日', '234万元', '北京市', '北京市', '大兴区', null, '北京市大兴区采育镇北京采育经济开发区育祥街1号', '北京市', '北京市', '大兴区', '采育镇', '北京市大兴区采育镇北京采育经济开发区育祥街1号', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2014年05月26日', '2034年05月25日', '2019/1/17', '2020/1/16', '京消协（2019）证字032号', '91110115082867328R', '电气防火检测技术服务机构', '经济贸易咨询；建筑消防检测技术服务；电气防火检测技术服务；维修消防设备、灭火器；销售办公用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京久久神龙咨询服务有限公司坐落于北京采育经济开发区，于2014年5月依法注册成立。2015年3月、7月公司分别取得消防技术服务机构临时二级、临时三级资质证书，是建筑消防设施检测、电气防火检测及灭火器维修的技术服务专业单位。公司技术力量雄厚，检测、维修设备齐全，检测、维修人员均具备多年专业检测及灭火器维修经验，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施、电气防火检测及灭火器维修，确中维保检测工作科学、公正、准确、规范。公司现有专职检测人员9名、专职灭火器维修人员6名、管理人员6名，所有从事检测的工作人员都经过严格的专业技能和岗位知识培训，具有较高的理论水平和良好的业务素质，能够承担公司所开展的检测评价项目工作。所有从事灭火器维修的工作人员都参加了北京市消防协会组织的专业技能培训并通过考核取得上岗资格。公司现有各类设备60余台（套），设备齐全先进，状态完好并定期检定，能够满足检测及灭火器维修工作的需要。公司以技术求生存，以公正拓发展，迎合时代、追求卓越，愿与消防各界同仁精诚合作，共创辉煌。', '116.63733000000001', '39.651198999999998', '116.63733000000001', '39.651198999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4063', '北京宏安兴业消防技术有限公司', '296', '朱海峰', '13911321422', '朱海峰', '13911321422', '2013年01月16日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区张镇雁户庄村雁北路14号', '北京市', '北京市', '顺义区', '张镇', '北京市顺义区张镇雁户庄村雁北路14号', '', '烟道清洗', '有限责任公司（自然人独资）', '2013年01月16日', '2033年01月15日', '2018/3/17', '2019/3/16', '京消协（2018）证字1037号', '911101130613080179', '', '技术开发、技术转让、技术咨询、技术服务；销售、维修消防设备；销售安全技术防范产品、厨房用具、电子产品、五金、建筑材料（不含砂石及砂石制品）、金属材料（不含电石、铁合金）、化工产品（不含危险化学品及一类易制毒化学品）、仪器仪表；清洁服务（不含餐具消毒）；专业承包；安装机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '您们好！非常感谢您在百忙之中对我们的关注！\n在此，我北京宏安兴业消防技术有限公司真诚地向您表示问候，并期望能为您排忧解难，期待以我们的优质服务、先进的技术力量、良好的职业素养和高超的操作技能，随时为您提供一流的服务，带给您安全舒适的环境。\n首先，向各位领导简要介绍一下我们公司的概况：\n我公司致力于保洁服务，是北京较早具有资质的公司，经过几年所有员工的努力以及各界朋友的支持与厚爱，公司的业绩不断上升，几年的艰苦努力使得我们有了新的发展（现下属公司2家、兄弟公司实行资源设备共享），经营项目有：烟道清洗、排烟管道的生产制作、排烟风机、清洗空调管道、烟罩紫外线除油灯管、消防器材、灶台灭火装置、消防检测、电检。现有专业专管人员十余人，我们配备的设备全部使用意大利、德国和美国等进口，为提高效率、降低噪音污染做出很大的努力。\n我公司所有员工经过正规培训持证上岗，丰富的实际操作经验，高素质的专业队伍和一流的清洗设备、数字微压计、数字式照度计、加烟器等。使我公司在激烈的市场竞争中不断前进。我们承诺：“信誉第一，客户至上!”我们合理的价格，周到的服务能赢得您的认可，共创洁净的生活工作空间！', '116.956349', '40.119399000000001', '116.956349', '40.119399000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4064', '北京华安全鼎消防科技有限公司', '294', '刘宝辉', '63373733', '江朝晖', '13601253551', '2002年01月04日', '500万元', '北京市', '北京市', '西城区', null, '北京市丰台区太平桥路15号3层321室', '北京市', '北京市', '西城区', '广安门外街道', '北京市丰台区太平桥路15号3层321室', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2002年01月04日', '2022年01月03日', '2018/11/26', '2019/11/25', '京消协（2018）证字393号', '911101067334685165', '电气防火检测技术服务机构', '消防设施技术检测；维修机械设备；电气消防安全检测服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华安全鼎消防科技有限公司成立于2002年，是经国家工商行政管理部门注册，由北京市消防协会评审通过,具有独立法人资格的企业，专业提供建筑消防设施维护保养检测和技术咨询等服务的专业机构，北京市消防协会会员单位。\n公司2006年通过ISO9001质量管理体系认证，并连续9年被北京市消防协会评为“双优”企业，得到了各级消防监督部门的认可和众多客户的好评。并于2014年9月获得了北京市质量技术监督局颁发的计量认证证书；2015年12月获得北京市消防协会颁发的电气防火检测技术服务机构资信证书；2015年6月通过北京市消防局消防设施维护保养检测临时一级资质现场评审。\n公司技术力量雄厚，检测人员90%以上具有大专以上学历，经过北京市消防职业技能鉴定机构的严格培训、考核，具备上岗资格。大部分技术人员均从事消防检测工作十多年，具有丰富的技术检测经验，熟悉国家现行各种技术规范和标准。检测过程中采用高科技仪器设备，严格执行国家消防行业的法律、规范及北京市地方标准和检测规程，确保检测质量。\n“科学、公正、准确、高效”是本公司的质量方针，公司所有员工力求为客户及时有效地提供最优质的专业技术服务。', '116.31733199999999', '39.879492999999997', '116.31733199999999', '39.879492999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4065', '瑞华鑫机电设备安装（北京）有限公司', '293', '赵昆', '13810963534', '赵昆', '13810963534', '2015年02月26日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南法信镇焦各庄街2号院1号楼7层2单元704', '北京市', '北京市', '顺义区', '旺泉街道', '北京市顺义区南法信镇焦各庄街2号院1号楼7层2单元704', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年02月26日', '2045年02月25日', '2018/6/8', '2019/6/7', '京消协清证字（2018）003号', '911101133303895147', '', '安装空调设备；维修空调设备；专业承包；销售装饰材料、安全技术防范产品、消防设备；消防技术咨询；零售建筑材料（不含砂石及砂石制品）；清洁服务（不含餐具消毒）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '瑞华鑫机电设备安装（北京）有限公司成立于2015年，我公司拥有完善的管理团队和经验丰富的工作人员。 \n 公司的服务宗旨：做最诚信的公司，提供最专业的服务。我公司尊崇“踏实、拼搏、责任”的企业精神，并以诚信、共赢作为经营理念，创造良好的企业环境，以全新的管理模式，完善的技术，周到的服务，卓越的品质为生存根本，我们始终坚持用户至上，用心服务于客户，坚持用自己的服务去打动客户。', '116.62051099999999', '40.132474999999999', '116.62051099999999', '40.132474999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4066', '北京卫安诚信消防技术有限公司', '291', '金晓红', '', '冯海涛', '13301178713', '2004年03月25日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十八里店乡十八里店村868号院内', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市大兴亦庄经济技术开发区同济中路2号狮岛索龙大厦302室', '', '消防设施,消防信息化,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2004年03月25日', '2024年03月24日', '2019/1/22', '2020/1/21', '京消协（2019）证字040号', '91110105760109228H', '电气防火检测技术服务机构', '技术咨询、技术转让、技术开发；质量检验、检测；销售社会公共安全器材；电气防火检测技术服务；建筑消防设施技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公 司 简 介\n一、概述\n北京卫安诚信消防技术有限公司是较早经北京消防局批准成立的一家股份高科技实体企业，我公司通过ISO9001及CMA计量体系认证，主要从事火灾报警系统的设计、安装、维修保养、消防及电气检测及火灾探测器的清洗、维修业务，公司下设业务部、工程部、生产部、检测部、管理部、开发部及专业清洗厂。\n二、主要服务项目\n1.我公司主要从事火灾报警系统的维修保养及火灾探测器的清洗、维修及各类消防工程设计、安装施工、调试。\n2.为各地建立专业清洗维修厂，提供工装、工艺、配方及基础设施的设计、生产、咨询、培训等服务。使您成为专业清洗维修的专家。\n3.消防设施检测、电气检测。\n4.多功能火灾探测器试验器产品开发销售。\n5.负离子火灾探测器超声波清洗机开发销售。\n面对新世纪的挑战，公司正以“忠诚友善、勤奋进取、艰苦创业、务就必胜”的企业精神，以一流的检测设备、精湛的技艺为指导思想，认真贯彻“质量为基础，服务作保证”的方针，为广大用户提供完备、周到的服务，将北京卫安诚信消防技术有限公司做强做大，成为一名真正合格的消防医生。欢迎各使用“火灾自动报警系统等消防设施”的各界朋友前来洽谈业务。', '116.49761700000001', '39.829970000000003', '116.52238800000001', '39.797660999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4067', '北京欣科建科技发展有限公司', '290', '李国有', '13601356002', '张晓雯', '13810955168', '2002年03月14日', '300万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区百子湾路29号4排4号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区微沃办公区B座213-1', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2002年03月14日', '2022年03月13日', '2018/12/28', '2019/12/27', '京消协（2018）证字495号', '911101057364863576', '排油烟设施清洗机构', '机电产品的技术咨询、技术服务；维修、安装家用电器；劳务服务；清洁服务(不含餐具消毒）；家居装饰；销售机械设备、电器设备、化工产品（不含化学危险品）、五金交电、建筑材料、金属材料、仪器仪表、汽车配件、劳保用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京欣科建科技发展有限公司，于2002年3月成立，公司现有员工100余人，是经北京市消防协会认证的专业消防清洗企业。\n   公司主要从事消防、安防系统安装工程；消防检测、水电安装、维护保养；消防建审、技术咨询；销售消防设备、机械设备；大型油烟管道清洗、劳务服务为一体的消防、清洗服务。\n   公司成立17年来，一直以优质的服务及完善的售后服务的经营理念，建立了严格的质量保证管理体系，制订了规范的安全操作流程，严格执行国家行业的有关标准、规范要求自己，对所有工程精心施工，严守规范；经过了十数载不断的努力和创新，欣科建清洗公司以专业、快捷、优质的服务，在消防清洗界拥有良好的声誉，得到了数万家客户的信誉和认可。被评为“ 重合同守信用单位”、“消防清洗工程技术单位”和“北京消防协会协会会员单位”。\n    公司“精、诚、优、新”的企业文化精神，体现了我们这支队伍的追求和目标。  \n   北京欣科建科技发展有限公司将一直秉承 “以质量求生存，以信誉求发展”的经营理念，全体欣科建人正在为把公司建设成为重合同、守信誉的百年企业而努力奋斗！\n     以满意回报顾客，以真诚回报社会', '116.47453899999999', '39.900708999999999', '116.480749', '39.853321000000001', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4068', '北京路路通保洁服务有限公司', '289', '袁党辉', '18910205800', '姜立强', '13311166878', '1998年06月10日', '600万元', '北京市', '北京市', '丰台区', null, '北京市丰台区五里店小区33号人防地下室', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区五里店小区33号人防地下室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1998年06月10日', '2018年06月09日', '2018/4/17', '2019/4/16', '京消协（2018）证字1072号', '911101066337730899', '', '清洁服务；会议服务；城市园林绿化服务；信息咨询服务；技术开发、技术服务；销售百货、针纺织品、工艺美术品、电子计算机及外部设备、装饰材料、建筑材料、金属材料、仪器仪表、五金交电、化工；石材养护；室内空气治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京路路通保洁服务有限公司组建于1996年，成立于1998年，是一家专门为公寓、写字楼、宾馆、酒店、行政单位、商场，大型超市、医院、工矿企业、学校等大型公共场所提供长期、全面的清洁、保养、维护等项服务的专业保洁公司，具有独立法人资格。在20多年的经营运作中，为发展首都的清洗保洁事业作出了贡献。\n我公司在行业内率先通过了ISO 9001：2008质量管理体系；ISO14001:2004环境管理体系；GB/T2008职业健康安全管理体系的认证；并于2006年初完成“路路通”的企业商标注册。在“打造清洁航母，展示专业品牌”的企业战略思想指导下，秉承“君德 礼和 天道 义富”的处世理念；公司规模持续做大，为大量城市下岗人员提供了再就业机会，同时也吸纳了众多农村富余劳动力。', '116.25880100000001', '39.853389999999997', '116.25880100000001', '39.853389999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4069', '北京星磊百吉保洁有限公司', '287', '成建民', '13621034139', '成建民', '13681023688', '2011年06月30日', '100万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区石龙经济开发区永安路20号3幢B1-1102室', '北京市', '北京市', '门头沟区', '斋堂镇', '斋堂镇军饷村JXC003', '', '烟道清洗', '有限责任公司（自然人独资）', '2011年06月30日', '2041年06月29日', '2018/12/8', '2019/12/27', '京消协（2018）证字479号', '91110109576856442R', '', '保洁服务；家政服务；清洗服务；劳务分包；劳务派遣；专业承包；园林绿化；技术开发、转让、咨询、服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京星磊百吉保洁有限公司是一家集保洁、洗涤、维护为一体的综合性服务公司，公司实行总经理负责制，采用职能组织机构，遵循精于高校的原则，竭诚为北京市各类宾馆、酒店、写字楼、机关团体、企事业单位、学校等提供各类型的清洁服务。', '116.12743', '39.896790000000003', '115.771102', '39.995353000000001', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4070', '北京金誉世华消防科技有限公司', '285', '赵宏新', '13911023512', '赵宏新', '13911023512', '2008年05月16日', '518万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区五里桥二街1号院7号楼201室', '北京市', '北京市', '朝阳区', '常营地区办事处', '北京市朝阳区五里桥二街1号院7号楼201室', '', '建筑防火,消防设施,消防信息化,电气防火,消防安全检查,消防安全评估', '有限责任公司（自然人独资）', '2008年05月16日', '2028年05月15日', '2018/10/30', '2019/10/29', '京消协（2018）证字332号', '91110105675740760C', '电气防火检测技术服务机构', '消防技术开发、技术检测；技术推广服务；消防设施维护保养检测、消防安全评估。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。', '北京金誉世华消防科技有限公司成立2008年5月，注册资金518万元。公司具有现代的经营管理理念和完善科学的管理制度及配套的组织机构。认真贯彻执行北京市公安局消防局和北京市技术质量监督局的工作方针，首次取得计量认证证书、消防设施检测壹级资质和电气防火检测资质。公司技术力量雄厚，仪器设备齐全，其中：高级工程师3人，专职检测技术人员13人等，均具有多年电气防火检测及消防设施检测的经验，公司检测人员均持有建构筑物消防员证书和高低压电工本，具有丰富的实践经验。', '116.617144', '39.928682999999999', '116.617144', '39.928682999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4071', '北京恒润博悦机电设备有限公司', '284', '李素芬', '13501184099', '李文杰', '18500568111', '2010年08月02日', '2600万元', '北京市', '北京市', '丰台区', null, '北京市丰台区北京南站换乘层快1维保楼213室', '北京市', '北京市', '丰台区', '西罗园街道', '北京市丰台区北京南站换乘层快1维保楼213室', '', '烟道清洗', '有限责任公司（自然人独资）', '2010年08月02日', '2030年08月01日', '2018/6/27', '2019/6/26', '京消协（2018）证字202号', '91110106560443643x', '', '销售机械设备、消防器材、电器设备、金属制品、装饰材料、橡胶制品、五金交电（不含电动自行车）、建筑材料、塑料制品、玻璃制品、文具用品、日用品、计算机软硬件及辅助设备；技术推广；机械设备维修；制冷空调设备维修；技术开发；技术服务；清洁服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京恒润博悦机电设备有限公司是经北京市工商管理局正式注册批准，主要销售机械设备、电器设备、金属制品、装饰材料、建筑材料及清洁服务。我们面向社会各机关、团体、宾馆、酒店、商场、写字楼、娱乐场所等提供全方位的清洗保洁服务，主要致力于酒店、商场、快餐厅的大型厨房烟道防火清洗等；积累了丰富的工作经验，并已在北京市场占有一席之地。 公司实行总经理负责制，严格管理，力争创新技术，努力发展企业文化。有市场总监率领着独立的团队，并设立网络部、企划公关部、业务部为公司的日益俱增的业绩做坚强的后盾；专人的调度，专业的车队确保客户的准时、准量高效完成。由设备检修组、库管众人组成的后勤部为前线时刻准备着，公司将以北京市区为中心，并继续努力拓展华北市场。 　　 公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！', '116.380172', '39.864676000000003', '116.380172', '39.864676000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4072', '北京禹顺消防科技有限公司', '283', '葛广顺', '13911798057', '刘永平', '13241091166', '2010年07月27日', '1000万元', '北京市', '北京市', '西城区', null, '北京市西城区', '北京市', '北京市', '西城区', '西长安街街道', '西交民巷114号', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2010年07月27日', '2040年07月26日', '', '', '', '911101025585030880Q', '', '技术检测；技术推广服务；维修消防设施。（领取本执照后，应到市质监局取得行政许可；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京禹顺消防科技有限公司（以下简称公司）成立于2011年07月10日，是依法在北京市工商管理局注册的具有独立法人地位的公司，是经北京市消防局核准备案的专业消防检测公司，是北京市消防协会会员单位，并已通过了国家计量认证CMA、ISO9001:2008质量管理体系认证;公司经北京市消防局消防协会的严格考核和认证，具备建筑消防设施检测和电气防火检测领域的专业检测资质，是开展建筑消防设施及电气防火检测技术服务的消防检测单位，技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，提供公正、科学、优质、高效和真实的检测报告。我公司拥有一批老中青相结合的技术骨干，具有国家中级专业技术职称和中专以上学历的技术人员占职工总数的75%以上，经北京市消防协会专业考核后在全市范围内从事电气检测和消防检测。公司共有10人,管理人员4人，检测人员8人。设总经理1名、质量负责人1名、技术负责人1名（工程师）。从事检测的人员均经培训考核合格，持证上岗。公司的主要业务是：主做电气防火技术检测、建设消防设施检(维护保养）', '116.386894', '39.901913', '116.386894', '39.901913', '', null, null, null, null);
