INSERT INTO `t_fc_company` VALUES ('4074', '北京顺安洁消防安全技术有限公司', '281', '张文满', '13911021290', '张文满', '13911021290', '2003年06月07日', '100万元', '北京市', '北京市', '顺义区', null, '北京市顺义区张镇雁户庄村雁北路14号', '北京市', '北京市', '顺义区', '张镇', '北京市顺义区张镇雁户庄村雁北路14号', '', '建筑防火,消防设施,烟道清洗,消防产品,事故调查,消防安全评估', '有限责任公司（自然人独资）', '2003年06月07日', '2023年06月06日', '2019/1/17', '2020/1/16', '京消协（2019）证字020号', '9111011375132433XG', '排油烟设施清洗机构', '技术开发、技术转让、技术咨询、技术服务；销售、维修消防设备、厨房设备、五金、交电、建筑材料（不含砂石及砂石制品）、金属材料（不含电石、铁合金）、化工产品（不含危险化学品及一类易制毒化学品）；清洁服务；机械设备安装；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '我公司成立于2003年06月07日，经过所有员工的不断努力以及各界朋友的支持与厚爱，公司的业绩不断上升，我公司经营项目有：烟道清洗、排烟风机、清洗空调管道、烟罩紫外线除油灯管、消防器材。\n我们承诺：“信誉第一，客户至上!” 合理的价格，周到的服务，专业的技术，先进的管理理念，我们将为您奉上最好的服务!', '116.956349', '40.119399000000001', '116.956349', '40.119399000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4075', '北京三马机电工程有限公司', '280', '金吉彪', '18611108366', '渠红', '18612455329', '2002年04月05日', '2000万元', '北京市', '北京市', '海淀区', null, '青龙桥西街67号南院', '北京市', '北京市', '海淀区', '青龙桥街道', '青龙桥西街67号南院', '', '烟道清洗', '有限责任公司（自然人独资）', '2002年04月05日', '2022年04月04日', '2019/1/28', '2020/1/27', '京消协（2019）证字048号', '91110108737689543G', '排油烟设施清洗机构', '施工总承包；专业承包；劳务分包；技术服务；厨房设备的清洗；建筑物烟囱的清洗；房屋的清扫、消毒；经济贸易咨询；电脑打字服务；复印；销售机械设备、建筑材料、五金交电；普通货运（道路运输经营许可证有效期至2020年12月25日）。（企业依法自主选择经营项目，开展经营活动；普通货运以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京三马机电工程有限公司成立于2002年，注册资金2000万元，是一家致力于暖通、输配电、给排水、粉尘处理、降噪音和排油烟管道清洗的规划、设计和施工的技术型企业。公司拥有一支以工程技术人员和工程管理人员为核心的高素质员工队伍，其中一级机电工程建造师1名、高级电气工程师2名、二级机电工程建造师3名、各类专业技工25名。\n    公司位于北京市海淀区北五环内，毗邻山青水秀的颐和园，公司下设综合部、业务部、工程部、财务部和售后服务部。公司各专业设备齐全，配套工具现代化，能够为客户提供完善的一条龙服务。\n公司秉承“以质量求信誉、以服务拓市场、以薄利求发展”的诚信理念，坚持“追求质量完美，确保人员平安，创造价值，服务客户，回报社会”的企业宗旨。公司愿以我们优良的产品、周到的服务与各界朋友真诚地合作，共创美好未来。', '116.26622999999999', '40.002899999999997', '116.26622999999999', '40.002899999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4076', '北京中府消防检测有限公司', '278', '高金龙', '18513191111', '金立珍', '15910271783', '2018年09月05日', '6500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区林河北大街21号院4幢7层809', '北京市', '北京市', '顺义区', '旺泉街道', '梅香街7号院9-2-801', '', '消防设施,烟道清洗,消防产品,电气防火', '有限责任公司（自然人独资）', '2018年09月05日', '长期', '2019/1/28', '2020/1/27', '京消协（2019）证字047号', '91110113MA01EF8650', '', '检测服务；维修消防器材、机械设备；清洁服务（不含餐具消毒）；技术开发、技术转让、技术咨询、技术服务、技术推广；信息咨询（不含中介服务）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中府消防检测有限公司成立于2018年9月5日，主要经营检测服务、维修消防器材、机械设备；清洁服务（不含餐具消毒）；技术开发、技术转让、技术咨询、技术 服务技术推广；信息咨询（不含中介服务）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策和限制类项目的经营活动。', '116.662554', '40.095821000000001', '116.639022', '40.112906000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4077', '北京华腾互通科技有限公司', '277', '于成伟', '13522365586', '田甜', '15210059181', '2015年11月10日', '2000万元', '北京市', '北京市', '昌平区', null, '沙河镇昌平路97号8幢B203-1', '北京市', '北京市', '海淀区', '西北旺地区办事处', '北清路68号院3号楼1层北侧', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2015年11月10日', '2045年11月09日', '2018/1/18', '2019/1/17', '京消协（2018）证字022号', '91110114MA001UHTX0', '', '技术开发、技术咨询、技术转让、技术服务；建设工程项目管理；专业承包、施工总承包；计算机系统的设计、集成、安装、调试和管理；销售计算机、软件及辅助设备、通讯设备、电子产品、五金交电、机械设备、文化用品、建筑材料；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华腾互通科技有限公司（简称：华腾互通）成立于2015年，注册资金2000万元。公司拥有电子与智能化工程专业承包、消防设施工程专业承包等多项行业资质，并通过了质量、环境、职业健康安全认证。\n自公司组建以来，企业秉承“求实诚信、敬业创新，质量第一、信誉至上”的经营理念和“自强不息，厚德载物，成于精勤、止于至善”的企业精神，锻炼企业，培养人才，稳扎稳打地发展。\n目前，华腾互通公司已拥有专业的设计团队、精良的施工管理团队，建立了完善的项目全过程管理服务体系，集工程专业承包、项目管理运营、技术推广、工程咨询设计、设备安装调试、售后服务保障等优势于一体，成为建筑智能化、消防等领域中的全专业工程服务商。同时成为北京消防协会、北京市昌平区建筑行业协会会员单位，2018年9月，华腾互通公司被评为AAA级中国信用企业单位。 \n随着公司的稳步发展，华腾互通公司秉承质量与安全并重的原则，与国内外的主流品牌产品供应商建立了良好的合作关系，并通过对客户需求的深入分析，建立了无障碍的供货以及服务通道，使公司在迅捷、高效地为客户提供高质量服务的同时，最大程度地客户节约工程建设成本，提供项目安全运营保障。\n公司始终', '116.256553', '40.143839999999997', '116.233831', '40.068474999999999', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4078', '北京精诚安保消防工程有限责任公司', '276', '殷胜利', '010-87766666', '李力', '010-87766888', '1997年10月15日', '1018万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区百子湾路16号5号楼A1101室', '北京市', '北京市', '朝阳区', '南磨房地区办事处', '北京市朝阳区百子湾路16号5号楼A1101室', '', '建筑防火,消防设施', '其他有限责任公司', '1997年10月15日', '长期', '', '', '', '91110105633686903X', '', '专业承包；工程勘察；工程设计；技术培训、技术服务、技术咨询；安装计算机网络系统；销售社会公共安全设备及器材、机械设备、建筑材料（不得从事实体店铺经营）。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京精诚安保消防工程有限责任公司（原北京精诚安保消防安全工程处），成立于1993年，隶属于公安部，1997年改制为有限责任公司。公司注册资金1018万元，具有建设部批准的消防设施工程专业承包一级资质及消防设施专项工程设计资质，同时还具有建筑智能化、建筑装饰装修、机电设备安装工程专业承包资质。\n   公司成立十九年以来，先后承担了政府机关、军用设施、办公大楼、银行、医院、图书馆、博物馆、体育馆（奥运场馆）、影剧院、宾馆、商厦、别墅、公寓、化工厂、发电厂等数千项消防、建筑智能化和装饰装修工程。其中有十余项工程获得国家优质奖“鲁班奖”、北京市优质奖和“长城杯”奖。代表工程有：天安门、东方广场、国家图书馆、首都机场办公楼、人民解放军电视大楼、北京医院、人民日报事业发展中心、电子工业出版社、中国国际贸易中心、新保利大厦、 北京国际会议中心、五洲大酒店、中国运载火箭技术研究院科研楼、中关村信息广场（辉煌国际广场）、长江三峡工程指挥中心、沈阳五洲商厦、北京理工大学等。\n    公司建立先进的管理体系，并获得了ISO9001质量管理体系；ISO14001环境管理体系；OHSAS18001职业健康与安全', '116.485276', '39.900229000000003', '116.485276', '39.900229000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4079', '北京清大同恒消防安全技术研究院有限公司', '275', '李振锁', '18901070119', '郑军霞', '18600573628', '2007年06月07日', '800万元', '北京市', '北京市', '昌平区', null, '北京市昌平区北七家镇七北路42号院4号楼11层3单元1101', '北京市', '北京市', '昌平区', '北七家镇', '北京市昌平区北七家镇七北路42号院4号楼11层3单元1101', '', '电气防火', '有限责任公司（自然人投资或控股）', '2018年09月11日', '长期', '2019/4/9', '2020/4/8', '京消协（2019）证字167号', '91110114663122201Y', '', '工程和技术研究与试验发展；技术检测；技术推广服务；消防安全评估；经济信息咨询（不含中介）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '工程和技术研究与实验发展；技术检测；技术推广服务；消防安全评估；经济信息咨询（不含中介）。（企业依法自主选择经营项目，开展经营活动，依法须经批准的活动，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动）。', '116.365587', '40.098719000000003', '116.365587', '40.098719000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4080', '北京天一星熙消防安全技术检测有限公司', '274', '胡梅玉', '15901011524', '胡梅玉', '15901011524', '2009年07月01日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区博大路3号院9号楼6层613', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区博大路3号院9号楼6层613', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2009年07月01日', '2029年06月30日', '2018/8/29', '2019/8/28', '京消协（2018）证字285号', '9111010969167031X4', '电气防火检测技术服务机构', '技术检测；技术推广服务；家居装饰及设计；物业管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京天一星熙消防安全技术检测有限公司为北京市消防协会单位会员，是经北京市公安消防总队、北京市工商局批准的具有电气防火、建筑消防设施专业检测一级资质的检测公司，并通过了GB/TI9001-2008/ISO9001:2008《质量管理体系要求》认证；并在2018年02月评为北京经济技术开发区安全防范协会《第三届副会长单位》；2018年元月二十一日评为北京市东城区兄弟帮扶中心《荣誉理事单位》。 我公司主要对建筑业、餐饮业、娱乐业、市场、仓库、商店、市场、医疗机构、旅店业、办公场所、生产车间、住宅、中小学校、托幼儿园所、体育场馆等；民用建筑及高层建筑的电气防火、消防设施的检测。\n秉持“尊重人的价值、开发人的潜能、升华人的心灵”人才工作宗旨，培养和造就一支赢得市场领先、创造组织优势、引领价值导向、有使命感与责任感的人才队伍，支持战略目标的实现，是我公司持续不断的人才追求。我公司坚持以市场为导向，以用户为中心，以保障社会消防安全为责任和使命；努力提高企业的科技力、生产力、拓展力；坚持公开、公平、公正、诚实、信用的服务原则，遵循客观独立、恪守职业道德，承担社会责任。', '116.47293500000001', '39.836491000000002', '116.47293500000001', '39.836491000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4081', '北京鑫湘宁消防检测有限公司', '273', '贾景印', '13240407536', '王歆舒', '13121011281', '2006年11月15日', '400万元', '北京市', '北京市', '朝阳区', null, '东土城路4号3幢2层206、207、209、210室', '北京市', '北京市', '朝阳区', '香河园街道', '东土城路4号3幢2层206、207、209、210室', '', '消防设施,电气防火,消防安全评估', '有限责任公司（自然人独资）', '2006年11月15日', '2026年11月14日', '2018/11/26', '2019/11/25', '京消协（2018）证字399号', '9111010579598177X2', '电气防火检测技术服务机构', '消防设施检测；电气安全检测；消防技术咨询；技术开发、技术服务；计算机系统服务；销售社会公共安全设备及器材、建筑材料、五金交电；工程咨询。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '本公司是独立法人企业，开展消防技术服务接受北京市消防局监督，检验检测工作接受北京市质量技术监督局监督。 北京鑫湘宁消防检测有限公司现有员工26人，其中注册一级消防工程师15人，高级消防员2人，中级消防员4人，设有综合管理部、检测部、评估部。公司面积305㎡，现有主要设备109台（套）。检测工作中严格按有关标准、规范执行。北京鑫湘宁消防检测有限公司本着服务社会，关注顾客的经营理念，建立了完善的质量管理体系。用科学的方法、公正的态度、精湛的技术，做好消防技术服务工作。', '116.432276', '39.958796', '116.432276', '39.958796', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4082', '北京鑫智慧消防技术有限公司', '272', '李楠', '13810955168', '李景镇', '13717736271', '2008年10月06日', '100万元', '北京市', '北京市', '朝阳区', null, '朝阳区大 洋路333号微沃办公区B209-1室', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '朝阳区大 洋路333号微沃办公区B209-1室', '', '烟道清洗', '其他有限责任公司', '2008年10月06日', '2028年10月05日', '2018/9/26', '2019/9/25', '京消协（2018）证字301号', '911101056812403918', '排油烟设施清洗机构', '专业承包；技术推广服务；清洁服务（不含餐具消毒）；销售机械设备、社会公共安全设备及器材、建筑材料、五金交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫智慧消防技术有限公司，成立于2008年， 主要从事专业承包；技术推广；清洁服务；销售机械设备、社会公共安全设备及器材、建筑材料、消防器材等。现公司业务主要以烟道清洗为主，客户群体主要为北京全市以及周边区域的各大型酒店，饭店，机关单位等。经过几年的快速发展，我公司的施工队伍不断壮大，人员稳定，施工经验丰富，可以为客户提供专业高效的清洗服务！自公司成立以来，一直以优质的产品及完善的售后服务的经营理念，不断地进行创新和突破，建立了严格的质量保证管理体系，制订了规范的安全操作流程，严格执行国家行业的有关标准、规范要求自己，对所有工程精心施工，严守规范； 我们成长的过程，就是服务客户并和客户一起不断成功的过程 ，我们用心、努力做好每一件事，满怀信心迎接每一次挑战。\n北京鑫智慧消防技术有限公司是一个充满生机和蓬勃发展的企业，我们秉承“遵纪守法、以人为本”的指导思想，一直以优质的产品及完善的售后服务的经营理念，以“精、诚、优、新”的企业文化精神。经过了几年不断的努力和创新，以专业、快捷、优质的服务 ，赢得了数以千万家客户的信誉和认可。  \n我们坚信，只要以市场为导向，以创新为动力，以质量求生存', '116.480749', '39.853321000000001', '116.480749', '39.853321000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4083', '北京佰仕兴隆消防技术有限公司', '271', '武海军', '13031098096', '崔庭婷', '13031020001', '2010年06月07日', '1006万元', '北京市', '北京市', '密云区', null, '密云镇大唐庄村西450米', '北京市', '北京市', '密云区', '果园街道', '密云镇大唐庄村西450米', '', '建筑防火,消防设施,电气防火,消防安全检查,消防安全评估', '有限责任公司（自然人投资或控股）', '2010年06月07日', '2030年06月06日', '2018/11/21', '2019/11/20', '京消协（2018）证字383号', '911102285568749856', '电气防火检测技术服务机构', '技术开发、技术转移；消防设施安全技术检测；维修安全消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京佰仕兴隆消防技术有限公司2010年06月07日在北京工商行政管理局密云分局登记成立，是主要专业从事研发消防及建筑智能化高新技术企业，公司聘有高素质的研发人员，专业管理人才及专业技术人员。拥有多项消防、建筑智能网络技术及专业设备。\n佰仕兴隆公司积极倡导以超前的消防及建筑智能化的技术、严密的消防及建筑智能化的措施为企业发展理念。以先进的设备为保障，以高素质的人才为基础。致力于向建筑领域进军。广泛开展技术开发、技术转移；消防设施安全技术检测；维修安全消防器材。\n展望未来，公司将一如既往的加强和社会各界朋友真诚合作与交流，在更大范围，更广领域，实现更高层次上发展与共赢，构筑人类的安宁续写新的华章。\n“以人为本，诚信为先，质量第一，不断创新”是佰仕兴隆公司的经营理念、服务宗旨。', '116.835159', '40.387141', '116.835159', '40.387141', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4084', '北京四海荣兴科技发展有限公司', '268', '许章勇', '15110265823', '许章勇', '15110265823', '2005年12月30日', '100万元', '北京市', '北京市', '平谷区', null, '北京市平谷区马昌营镇天井大街甲2号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡西直河村918号', 'AA', '烟道清洗', '有限责任公司（自然人独资）', '2005年12月30日', '长期', '2018/3/26', '2019/3/25', '京消协（2018）证字1047号', '911101177848498291', '烟道清洗', '技术开发、技术转让、技术服务、技术推广、技术咨询；建筑物清洁服务；保洁服务；家庭劳务服务；家具装饰及设计；园林绿化；承办展览展示；会议服务；经济贸易咨询；室内装饰设计；销售机械设备、文化用品、日用品、五金交电、建筑材料、金属材料、计算机软硬件及外围设备、家用电器、化工产品、体育用品、厨卫用具、花卉、苗木；物业管理；施工总承包；专业承包；劳务分包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京四海荣兴科技发展有限公司成立于2005年12月，是一家以技术服务，专业承包，消防烟道消洗等一条龙服务公司，随着社会的发展，消防安全，食品安全，消洁卫生越来越被大家接受和需要，并已进入了千万食堂，餐厅，酒店等等大中小型饭馆共同成长中，我们公司致力于给客户千万个同胞创造一个安全生产，更加清洁更加亮丽的生活工作环境而努力!为每个经营饭店食堂酒店的老板提供一个安全生产的环境，努力提升人们的现化生活质量而努力!\n\n    公司成立以来，致力于长期合作系，提高服务质量，提更高标准的清洁服务，以“消防安全为已任，顾客至上，信警第一，诚信为本，高效求实，稳步发展的经管理念为宗旨，高标准高质量提供服务，维护客户利益，形象是我们始终不渝的目标。\n\n    公司服务员工.均通过消防安装，维护，烟道设备清洗，高空作业等方面的专业培训，同时还要进行从业道德，服务质量，安全第一，等意识方面的培训，通过考核后方可上岗。\n\n    公司具有完善的工作管理制度和安全操作制度，制定了规范的工序操作流程。公司管理机制完善，清洁作业经验丰富，拥有雄厚的技术力量。严格实行岗前培训一岗中督查上岗在培训的员工管理措施，凭着优', '117.018359', '40.112555', '116.530371', '39.844318000000001', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4085', '北京洋河消防安全技术有限公司', '267', '马军', '15311434081', '马伟洋', '17710548087', '2018年03月19日', '1000万元', '北京市', '北京市', '通州区', null, '于家务乡国际种业科技园区聚合七街2号-258', '北京市', '北京市', '通州区', '宋庄镇', '丁各庄66号院', '', '消防产品', '有限责任公司（自然人投资或控股）', '2018年03月19日', '2068年03月18日', '', '', '', '91110112MA01AU0W6M', '', '技术推广、技术服务；销售电子产品、机械设备、消防器材、仪器仪表；维修消防器材（仅限上门维修）；租赁消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本区产业政策禁止和限制类项目的经营活动。）', '北京洋河消防安全科技有限公司位于北京副中心通州区 成立于2018年4月 注册资本1000万，主要从事消防器材销售 灭火器维修 等业务 。公司具有专业的技术人才，完善的结构体系 ，一直秉承认证负责的工作态度为消防工作添砖加瓦，努力做到让每一位客户满意。', '116.691858', '39.708272000000001', '116.734886', '39.929779000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4086', '北京洁宁环境治理有限公司', '265', '刘辉', '18003365808', '刘辉', '18003365808', '2018年11月23日', '50万元', '北京市', '北京市', '昌平区', null, '北京市昌平区回龙观镇回龙观西大街35号院1号楼1层165A', '北京市', '北京市', '昌平区', '回龙观地区办事处', '北京市昌平区回龙观镇回龙观西大街35号院1号楼1层165A', '', '烟道清洗,消防产品', '有限责任公司（自然人独资）', '2018年11月23日', '长期', '', '', '', '91110114MA01FQY58C', '', '大气污染治理；水污染治理；技术检测；家庭劳务服务；建筑物清洁服务；厨房设备的清洗；销售卫生用品、化工产品（不含危险化学品）、日用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司北京洁宁环境治理有限公司，成立日期是：2018年11月23日，注册地址是：北京市昌平区回龙观镇回龙观西大街35号院1号楼1层165A，法定代表人是刘辉。\n北京洁宁环境治理有限公司专注于大气污染治理、水污染治理；建筑物清洁服务；厨房设备的清洗等全产业链，在环卫市场化改革、政府购买服务、城乡环境综合治理、城市垃圾分类、转运站建设与运营、智慧环卫系统运营等方面，具备丰富的示范项目业绩和精益化管理经验，公司致力于成为城市环境综合管理的服务商，持续拓展延伸服务领域，为城市提供园林绿化养护、市政道路管护、公共设施服务、物业管理服务、水域河道保洁等完整的一体化解决方案，实现全方位的城市综合管理服务，稳定的管理队伍，有效的项目管控，完美的团队执行，造就了城乡环卫综合服务和城市环境综合管理的专业和专注，公司管理团队是一支在企业经营实战中锻炼出来的队伍，是一支优秀的、专业搭配合理、具有凝聚力的人才团队，公司以“技术为本，服务为主”为经营宗旨，以专业化、规范化为己任，成立以来的多项成果都得到了各级国土部门的认可和好评。', '116.329748', '40.079298999999999', '116.329748', '40.079298999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4087', '北京莱福灵商贸有限责任公司', '264', '郭胜利', '18801162688', '于敏', '13601218581', '2017年06月07日', '100万元', '北京市', '北京市', '延庆区', null, '北京市延庆区沈家营镇八里店村', '北京市', '北京市', '延庆区', '沈家营镇', '北京市延庆区沈家营镇八里店村', '', '烟道清洗', '有限责任公司（自然人独资）', '2017年06月07日', '2047年06月06日', '2018/3/26', '2019/3/25', '京消协（2018）证字1048号', '91110229MA00F3MG87', '', '销售日用品、厨房用具、电气设备、机械设备、家具、建筑材料、安全技术防范产品、五金、交电、电子产品；清洁服务；家庭服务；林业有害生物防治服务；专业承包；修锁服务；配钥匙服务；维修家用电器；绿化管理；技术开发、服务、咨询、转让；环境保护监测；大气污染治理；水污染治理；噪声与振动控制服务；租赁汽车；工程设计；道路货物运输；城市生活垃圾清扫、收集、运输。（企业依法自主选择经营项目，开展经营活动；工程设计、道路货物运输、城市生活垃圾清扫、收集、运输以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京莱福灵商贸有限责任公司专业从事清洗服务，提供：排油烟设备清洗、高空外墙清洗、地毯清洗、石材翻新、地板清洗、地板抛光打蜡、大型开荒保洁、日常保洁、空气净化等全方位的清洁服务。\n    公司具备丰富的专业清洁经验，拥有各类进口专业清洁保养设备，齐全的清洁工具，清洁器具，环保清洁剂，拥有一支经验丰富，技术规范扎实，素质优秀稳定的专业清洁服务队伍，目前，北京莱福灵商贸有限责任公司已具备了对家庭、写字楼、宾馆、酒店、学校、工厂等楼宇进行全面清洁保洁的能力。\n    除清洗服务外，北京莱福灵商贸有限责任公司还为客户提供专业的有害生物防制服务（杀蟑，灭鼠等）。公司特设PCO(有害生物防控)部门，主要从业人员都是长期从事卫生防疫事业的专业人员。采用国际先进的生物防治理念和技术标准，对不同环境下的有害生物进行科学有效的控制和安全治理，满足特殊行业和高端客户对虫害骚扰，无化学药物污染的环境要求，提高室内环境品质。\n    本着“诚信服务、务实创新、规范操作、高效作业”的理念，一切从客户的实际需求出发，力求为每一位客户提供最优质的服务。', '116.024405', '40.479782999999998', '116.024405', '40.479782999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4088', '北京鑫雨盛安消防科技有限公司', '263', '南新华', '13161855222', '南新华', '13161855222', '2014年09月19日', '308万元', '北京市', '北京市', '大兴区', null, '天水大街46号院1号楼10层1006', '北京市', '北京市', '大兴区', '天宫院街道', '天水大街46号院1号楼10层1006', '', '消防产品', '有限责任公司（自然人独资）', '2014年09月19日', '2034年09月18日', '2018/3/29', '2019/3/28', '京消协（2018）证字073号', '91110115317922767K', '', '技术开发、转让、咨询、推广服务；技术检测；零售安全技术防范产品、消防器材、建筑材料、机械设备、电气设备、五金（不含电动自行车）、化工产品（不含危险化学品及一类易制毒化学品）；维修消防器材；技术进出口；代理进出口；货物进出口；销售电子产品；普通货运（道路运输经营许可证有效期至2023年03月05日）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鑫雨盛安消防科技有限公司是专业从事舰船和陆地消防产品设计开发、生产、销售及消防系统器材配套销售、消防系统产品维护保养、清洗感烟火火灾探测器、感温火灾探测器、承接消防工程施工安装等业务的企业。生产、销售气体灭火系统、泡沫灭火系统、消防炮、防排烟系统、消防风机、通用风机、消防气瓶、氧气瓶等 工业用高压无缝气瓶等产品。', '116.31895400000001', '39.669795999999998', '116.31895400000001', '39.669795999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4089', '北京绿港鼎鑫环保科技服务有限公司', '262', '彭雨', '18600084008', '张晓光', '15901268322', '2019年01月09日', '500万元', '北京市', '北京市', '顺义区', null, '北京市顺义区南法信镇焦各庄街2号院2号楼6层3单元606', '北京市', '北京市', '顺义区', '旺泉街道', '北京市顺义区南法信镇焦各庄街2号院2号楼6层3单元606', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年01月09日', '2049年01月08日', '', '', '', '91110113MA001GN745A', '', '技术服务、技术转让、技术开发、技术推广、技术咨询；清洁服务（不含餐具消毒）；销售金属制品、环保设备、制冷设备、机械设备、日用百货、针纺织品、文化用品、体育用品（不含弩）、五金交电（不含电动自行车）、化工产品（不含危险化学品及一类易制毒化学品）、建筑材料（不含砂石及其制品）、金属材料（不含电石、铁合金）；机械设备维修；施工总承包；专业承包；劳务分包；接受委托提供劳务服务（不含排队服务、对外劳务合作）；建设工程项目管理；城市园林绿化施工；病虫害防治。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京绿港鼎鑫环保科技服务有限公司\n                                                                                                         简    介\n\n   北京绿港鼎鑫环保科技服务有限公司成立了于2019年1月9日，我公司是一家以环保设备销售、环保产品开发、环保技术推广咨询为主，同时涉足厨房设备清洁服务及制冷设备、机械设备、五金交电销售等多产业的综合性科技服务企业。\n\n   我公司自成立以来，先后引进国内先进的环保设备、环保材料及清洁设备，公司秉承着“专业、诚信、值得信赖”的服务于北京市大中性企业，政府行政单位，为客户提供多方案的同时，提供专业化、个性化、全天候、全方位的服务。', '116.619101', '40.132103999999998', '116.619101', '40.132103999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4090', '北京市创岚环保工程有限责任公司', '261', '刘景', '68365958', '赵颖', '13811378896', '1997年06月24日', '100万元', '北京市', '北京市', '西城区', null, '北京市西城区西直门外大街135号展览馆宾馆6211室', '北京市', '北京市', '西城区', '展览路街道', '北京市西城区西直门外大街135号展览馆宾馆6211室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1997年06月24日', '2047年06月23日', '', '', '', '9111010260046145XA', '', '保洁服务；维修安装空调、维修电梯。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京市创岚环保工程有限责任公司公司简介\n\n北京市创岚环保工程有限责任公司成立于1994年，公司办公地点设在燕京饭店。在1997获得北京市消防局审批《北京市油烟管道清理工程消防安全许可证》；公司在2001年度在全国以环保工作为主题的大会上，受到时任全国人大常委会副委员长曹志同志的表彰，并为公司题词“服务社会  环保先锋”。公司在经营的同时也积极支持社会公益事业，2004年出资捐助河北省张北县后河子西城希望小学工程，受到市建委表彰。  \n北京市创岚环保工程有限责任公司是一家环保型企业。主要从事消防油烟管道清洗，中央空调管道清洗消毒、系统保养，专业建筑设备安装施工。公司经过多年的不断发展，现已成为消防局许可施工企业，建筑设备安装资质企业，多次获得消费协会评选的年度先进单位称号建委安全施工信得过企业。\n\n\n\n\n北京市创岚环保工程有限责任公司', '116.346323', '39.941690999999999', '116.346323', '39.941690999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4091', '北京美思特保洁服务有限公司', '260', '陈远远', '13716871786', '陈远远', '13716871786', '2018年10月29日', '200万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区吉庆里6号楼4层407', '北京市', '北京市', '朝阳区', '三里屯街道', '北京市朝阳区吉庆里6号楼4层407', '', '烟道清洗', '有限责任公司（自然人独资）', '2018年10月29日', '长期', '2018/5/30', '2019/5/29', '京消协（2018）证字170号', '91110105MA01F9TE32', '', '清洁服务（不含餐具消毒）；技术开发、技术服务、技术转让；销售日用品、卫生间用具、文具用品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京美思特公司服务项目：烟道清洗，技术转让，销售日用品，文化用具等，本公司成立于2018年，是一家清洗保洁服务于一体的综合性保洁服务公司。\n低价位，高质量，享受星级服务，是本公司的服务理念', '116.44073899999999', '39.927748000000001', '116.44073899999999', '39.927748000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4092', '北京华升志远机电设备有限公司', '258', '常秀兰', '13429503821', '曾金盼', '13910446787', '2015年02月15日', '300万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区西大望路甲12号（国家广告产业园区）2号楼2层21119', '北京市', '北京市', '朝阳区', '劲松街道', '北京市朝阳区西大望路34号金丰尚商务楼423室', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年02月15日', '2035年02月14日', '2018/3/6', '2019/3/5', '京消协（2018）证字047号', '91110105330315769H', '', '专业承包；销售空调机制冷设备、化工产品（不含危险化学品）、机械设备、电子产品；空调制冷设备维修；供暖设备维修；清洁服务（不含餐具消毒）；技术服务。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京华升志远机电设备有限公司成立于2015年2月，公司现有技术人员均经过专业培训，对通风系统清洗，冷却塔维修保养，中央空调系统水处理，机组维修保养及故障判断具有丰富的工作经验。\n        我们提供一年365天×24小时的专业服务，我们的目标是确保最快的反馈和最短的停机时间，将客户的损失降至最低。作为中央空调业界可靠的合作伙伴，华升志远秉承不断创新、以崭新理念改进技术及服务为宗旨，通过为客户创造更高价值，提供更高技术、更高性价比的服务，以及最优化的解决方案和合理的价格赢得更多客户。\n本公司从事项目：中央空调水系统清洗、预膜、加药水处理；冷凝器，蒸发器，风机盘管，通风系统，新风机组的清洗；中央空调的维修保养等。\n       企业宗旨：以技术求生存，以质量求发展，信誉第一，保证质量，达到客户满意。\n经营方针：技术为先，质量为重，诚信为本，服务至上。', '116.473281', '39.903337999999998', '116.476798', '39.886456000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4093', '北京市京阳伟业安全技术有限责任公司', '257', '罗京春', '62081585', '张群', '62081585', '2009年12月14日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区四惠桥南侧一号伊莎文化中心主楼A01B', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区四惠桥南侧一号伊莎文化中心主楼A01B', '', '宣传教育培训,烟道清洗', '有限责任公司（自然人投资或控股）', '2009年12月14日', '2029年12月13日', '2018/3/9', '2019/3/8', '京消协（2018）证字051号', '9111010569765752XY', '', '技术推广；技术服务；专业承包；维修安全消防器材；销售日用品、建材（不从事实体店铺经营）、化工产品（不含危险化学品）、五金交电（不从事实体店铺经营、不含电动自行车）、金属制品、消防设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于1998年，是立足于消防领域的专业化销售、服务公司。公司拥有高素质的专业人员，具备具备先进的专业技术，售后服务完善。始终贯彻“用户至上、保证质量，信守承诺”的原则，所售灭火器均可上消防网站查询，灭火器年检严把质量关，保证通过消防检查。免费提供消防咨询及普及消防知识培训，注重社会责任，拥有极高的行业信誉。', '116.49651', '39.903579999999998', '116.49651', '39.903579999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4094', '北京五岳朝天消防技术有限公司', '254', '王志民', '13716699986', '皮连欣', '15801696082', '2011年08月18日', '500万元', '北京市', '北京市', '门头沟区', null, '北京市门头沟区石龙经济技术开发区永安路20号', '北京市', '北京市', '通州区', '宋庄镇', '北京市通州区宋庄镇前夏邢各庄20号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2011年08月18日', '2031年08月17日', '2018/12/28', '2019/12/27', '京消协（2018）证字474号', '911101095808418093', '', '技术开发；消防工程设计、咨询；经济信息咨询；消防设备维修；消防设施检测；销售消防器材、电子产品、机械设备、五金交电；物业管理；专业承包。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京五岳朝天消防技术有限公司成立于2011年8月18日，注册资金500万元 经营范围：消防工程设计、咨询；消防设备维修；消防设施检测；销售消器材、电子产品、机械设备、五金交电；物业管理。\n公司成立至今，得到了广大客户的信赖与支持 并承接了包括：SOHO物业及中德启锐等大项目的长期合作机会。', '116.126834', '39.896590000000003', '116.74319199999999', '39.935586000000001', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4095', '北京东方磊鑫建筑装饰工程有限公司', '253', '阮传磊', '13366771828', '阮传磊', '010-89201824', '2013年08月22日', '1000万元', '北京市', '北京市', '大兴区', null, '北京市大兴区魏善庄镇后大营村后禄街12号', '北京市', '北京市', '大兴区', '魏善庄镇', '北京市大兴区魏善庄镇后大营村后禄街12号', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年08月22日', '2033年08月21日', '', '', '', '91110115076593500K', '', '专业承包；劳务分包；租赁、维修建筑机械设备；组织文化艺术交流活动（不含演出）；会议服务（不含食宿）；承办展览展示；经济贸易咨询；市场营销策划；企业形象策划；图文设计；设计、制作、代理、发布广告；销售化工产品（不含危险化学品及一类易制毒化学品）、建筑材料、装饰材料、金属材料、汽车零配件、五金产品（不含三轮摩托车及残疾人机动轮椅车）、家庭用品；委托加工化工设备、腻子粉、涂料、保温材料、防水材料、体育用品。（领取本执照后，应到区县住建委（房管局）取得行政许可。；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京东方磊鑫建筑装饰工程有限公司于2013-08-22在大兴分局登记成立。法定代表人阮传磊，公司经营范围包括专业承包；销售建筑材料、五金交电。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）等。', '116.37487', '39.688966000000001', '116.37487', '39.688966000000001', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4096', '北京华融义缘消防技术有限公司', '252', '王亦男', '13601377844', '郭志成', '18611394145', '2011年06月24日', '1070万元', '北京市', '北京市', '顺义区', null, '北京市顺义区杨镇地区老庄户村环镇北街30号', '北京市', '北京市', '顺义区', '杨镇地区办事处', '北京市顺义区杨镇地区老庄户村环镇北街30号', '', '建筑防火,消防设施,烟道清洗,消防信息化,消防产品,电气防火,消防安全检查,消防安全评估', '有限责任公司（自然人投资或控股）', '2011年06月24日', '2061年06月23日', '2018年12月6日  2019年1月22日', '2019年12月5日  2020年1月21日', '京消协（2018）证字427号 京消协电字（2019）008号', '91110113576857760N', '电气防火检测技术服务机构', '技术开发、技术咨询；技术检测（不含认证、认可）；销售、维修消防器材、安全技术防范产品；维修电子产品；物业管理；保洁服务；承装（承修、承试）电力设施。（企业依法自主选择经营项目，开展经营活动；承装（承修、承试）电力设施以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京华融义缘消防技术有限公司成立于2011年6月，于2014年11月被北京市消防协会接纳为会员单位，证书编号：（京消协证字059号）。公司长期从事社会单位消防设施维护保养及电消检业务，服务单位包括东城区政府14处办公地点、东城区工商局18处办公地点、 学校、医院、文化馆、幼儿园、办公楼、大型仓库以及数家物业公司的几十栋居民楼等。检测维保内容涉及面广，包括火灾自动报警系统、消火栓系统、喷淋系统（湿式、干式、预作用、雨淋）及气体灭火系统和电气线路的检测等。公司现有设备，包括辐射温度计、风速仪、红外热成像仪、超声波检漏仪、照度计、红外点温仪等。\n公司于2014年12月5日取得了资质认定计量认证证书，（证书号：2014010675X），并允许使用徽标CMA；于2015年1月14日通过ISO9001:2008质量管理体系认证，认证范围：建筑消防设施、电气防火检测及消防技术服务；于2019年1月1日取得北京市公安消防总队颁发的临时一级资质（经营范围：各类建筑的消防检测、维修、保养工作）。', '116.825349', '40.162100000000002', '116.825349', '40.162100000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4097', '北京中泰伟业消防设备技术有限公司', '251', '徐珠蓉', '13811529692', '张丽英', '18610334880', '2011年10月18日', '600万元', '北京市', '北京市', '朝阳区', null, '来广营乡来广营西路316号108室', '北京市', '北京市', '顺义区', '南法信地区办事处', '物流园六街12号宝供物流基地B座3层', '', '消防设施', '有限责任公司（自然人独资）', '2011年10月18日', '2031年10月17日', '2018/11/9    2018年12月28日', '2019/11/8   2019年12月27日', '京消协（2018）证字366号 京消协电字（2018）093号', '91110105584458161P', '电气防火检测技术服务机构', '技术开发、咨询、交流、转让、推广服务；计算机系统服务；清洁服务（不含餐具消毒）；维修消防设备（不含特种设备）；消防安全评估；技术检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中泰伟业消防设备技术有限公司成立于2011年，注册资金陆佰万元，是一家针对建筑消防设施检测，电气防火检测及消防维保的专业消防公司。本公司已通过北京市公安消防局批准、北京市工商局核准注册、北京市消防协会认证合格的建筑消防设施检测和消防电气检测技术服务的公司。\n     本公司技术精、设备优、管理严、质量高、速度快。公司现有职员37人，检测技术人员22名，全体检测人员均经培训、持证上岗。并配有多年从事强弱电系统和水系统施工的工程监督管理人员。公司拥有进口红外线热像仪、红外测温仪、超声波探测仪、可燃气体探测仪及消防设施专用检测工具等现代高科技的专业检测仪器设备以及常规电工仪器仪表灯。公司的所有检测数据依照国家有关规定进行分析甄别，为受检单位及消防监督部门提供详实准确的检测报告。\n     公司以“忠诚友善、勤奋进取、艰苦创业、务就必胜”的企业精神，认真贯彻“质量为基础，服务作保证”的方针，为广大用户提供完备、周到的服务，成为一名真正合格的消防医生。您给中泰一次机会，中泰给您一个惊喜！我们本着诚信、共谋、双赢、互惠的原则，为营造一个和谐、安全的社会，尽最大努力贡献出我们“消防人”的力量。', '116.452338', '40.020543000000004', '116.590183', '40.124336', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4098', '北京宛清保洁服务有限责任公司', '250', '孙源', '13901221920', '孙明阳', '13901221920', '2000年04月11日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区晓月五里6号楼501-21', '北京市', '北京市', '丰台区', '宛平城地区办事处', '北京市丰台区晓月五里6号楼501-21', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2000年04月11日', '2020年04月10日', '2018/5/10', '2019/5/10', '京消协（2018）证字105号', '91110106718739779J', '', '清洗保洁服务；家居装饰；技术服务、技术咨询、技术推广、技术转让、技术开发；物业管理；承办展览展示；会议服务；组织文化艺术交流活动；礼仪服务；企业管理咨询；城市园林绿化服务；花卉租摆；灯光影响设备租赁；销售清洁用品、五金交电、日用品、花卉。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司成立于2000年，北京宛清保洁服务有限责任公司在长期的服务当中一贯秉持“视质量为生命，视服务为灵魂”的企业精神。在工作中取得了良好的信誉，得到了各类客户的广泛好评。北京宛清保洁服务有限责任根据不同客户的需求，竭力为您提供多种类型的专业物业管理服务。通过多种服务模式，充分整合资源为广大客户提供专业优质的物业管理服务。北京宛清保洁服务有限责任公司长期坚持“规范管理、挚诚服务、不断进取、追求卓越”的服务方针；以“遵守法律法规、倡导绿色生活、积极预防污染、营造清洁环境、提高环保意识、不断持续改进”为环境方针；遵循“以人为本、完美服务”的服务管理宗旨。不断提升服务效率以及服务质量，努力维护服务项目的商务形象和品质。全面关注客户点滴需求，长期保持“不是无所不能，一定竭尽所能”的服务态度，为客户量身设计管理服务计划。为广大客户提供良好生活以及办公环境。经过多年的积累，目前已形成独具特色的管理模式。从市场以及客户的需求出发，不断改进和完善管理体系及服务质量，全心全意为客户提供优质完美的服务。', '116.23763', '39.834646999999997', '116.23763', '39.834646999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4099', '力景（北京）系统技术有限公司', '248', '田瑞', '13701171993', '李蔷微', '18611725078', '2002年12月23日', '1000万元', '北京市', '北京市', '东城区', null, '北京市东城区东四十条甲22号南新仓商务大厦A1503', '北京市', '北京市', '东城区', '东直门街道', '北京市东城区东四十条甲22号南新仓商务大厦A1503', '', '消防设施', '有限责任公司（自然人投资或控股）', '2002年12月23日', '2032年12月22日', '', '', '', '911191917461426895', '', '技术检测；技术开发；技术服务；技术咨询；专业承包；物业管理；消防设施工程设计；消防设备、安全防范设备的技术培训；计算机系统服务；维修消防设备、安全技术防范设备；销售消防设备、安全技术防范设备、机电设备。（领取本执照后，应到市质监局取得行政许可。依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '力景（北京）系统技术有限公司成立于2002年，是专业从事高端建筑智能消防系统集成的技术型公司。拥有消防设施工程设计与施工一体化二级资质，通过质量、环境、职业健康安全管理体系认证，并严格按照其标准要求进行消防工程施工、产品销售及服务过程的管理与控制。\n从消防工程施工、安全技术咨询，到消防系统调试；从消防系统技术开发，到消防及机电设备销售、调试应用；从售后维保服务到专业的运行维护……力景公司为客户提供完整的建筑消防安全系统解决方案和专业的技术、工程、服务。', '116.430925', '39.932800999999998', '116.430925', '39.932800999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4100', '北京维盛通技术服务有限公司', '247', '唐建强', '65272363', '衣晓梅', '18600012151', '2010年01月06日', '500万元', '北京市', '北京市', '延庆区', null, '北京市延庆区大榆树镇高庙屯村西3幢6号（北京同悦朋商行院内）', '北京市', '北京市', '朝阳区', '和平街街道', '北京市朝阳区和平西街青年沟路23号', 'AA', '烟道清洗', '有限责任公司（自然人投资或控股）', '2010年01月06日', '2040年01月05日', '2019/3/14', '2020/3/13', '京消协（2019）证字105号', '91110229699605643B', '烟道清洗', '技术推广服务；经济信息咨询；建筑物清洁服务；劳务派遣；保洁服务；维修家用电器、电梯及制冷空调设备；装饰设计；销售工艺品、机械设备、电子产品；会议服务；绿化管理；租赁建筑工程机械、建筑工程设备、花卉；林业有害生物防治服务、害虫防治服务、灭鼠及预防服务；餐饮管理；物业管理；专业承包；空气污染治理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京维盛通技术服务有限公司是一家可提供多方位技术服务的专业公司，从事推广新技术新能源、综合物业委托管理、各类工程建筑物保洁清洗服务等业务；包括建筑工程保洁开荒、高层建筑楼宇外墙清洗粉刷、中央空调清洗、厨房油烟管道清洗，石材养护、地毯清洗、电梯保养、设备安装维修保养、劳务服务、有害生物防制、绿植租摆、室内空气污染治理等项目。\n \n公司引进国内外多项具有较高科技含量的工程及清洁技术，建立起一套行之有效的运行管理及技术保障体系，培养出一支专业化的技术服务管理队伍。目前公司为全市百余家客户提供专业化的相关技术服务，客户类型包括：酒店、宾馆、写字楼、公寓楼、国家机关、医院、餐饮酒楼等。公司的优质服务，获得客户和有关方面的良好赞誉，公司各项业务稳步向前发展。\n \n公司注重每一个服务细节，规范作业，质量第一。同时，公司努力为员工提供良好的工作环境、工作报酬，进行多层次的职业技能、职业道德培训，不断提高员工的整体素质，保证公司持续稳定发展。\n \n公司注重创建企业品牌，秉承企业文化和服务宗旨，以科学管理、优质服务、满足客户的各种需求为目标，在行业中拥有良好信誉，不断开拓进取，竭诚为客户提供优质技术产品与', '116.03949799999999', '40.435845', '116.41688600000001', '39.962784999999997', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4101', '北京广安顺合消防科技有限公司', '245', '张小垒', '', '赵骞', '18600601940', '2004年07月26日', '500万元', '北京市', '北京市', '门头沟区', null, '葡东20号楼办公室6-1-35-36', '北京市', '北京市', '门头沟区', '永定地区办事处', '葡东20号楼办公室6-1-35-36', '', '', '有限责任公司（自然人投资或控股）', '2004年07月26日', '2024年07月25日', '', '', '', '911101097650357747', '', '建筑消防设施检测技术服务；电气防火检测技术服务；建筑消防设施维护。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '建筑消防设施检测技术服务，电气防火检测技术服务，建筑消防设施维护。', '116.11734800000001', '39.926082999999998', '116.11734800000001', '39.926082999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4102', '北京鹰翔风景消防科技有限公司', '244', '高伟', '13910101405', '高伟', '13910101405', '2011年07月07日', '500万元', '北京市', '北京市', '丰台区', null, '北京市丰台区首经贸中街1号院1号楼01-022', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区首经贸中街1号院1号楼01-022', '', '建筑防火,消防设施,消防产品,电气防火,消防安全检查', '有限责任公司（自然人投资或控股）', '2011年07月07日', '2031年07月06日', '2018/12/28', '2019/12/27', '京消协电证字（2018）092号京消协（2018）证字473号', '91110106579074876k', '电气防火检测技术服务机构', '技术推广；技术检测；机械设备维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京鹰翔风景消防科技有限公司是北京市消防局审核批准的具有建筑消防设施检测、电气防火检测资质的企业，为北京市消防协会会员单位。主要从事建筑内固定消防设施检测、电气设施防火安全技术检测、大型活动的消防技术检测及消防设施维保等技术性服务及零售消防设施、消防器材、机械电器设备，承接各项消防工程。\n公司技术力量雄厚，引进世界先进的高科技检测仪表、仪器，并拥有一批多年从事消防安全工作的工程技术人员，全部持有证上岗。凭借经验丰富的管理队伍、雄厚的专业人才基础、科学严谨的质量保证体系、扎实的施工技术力量、先进的施工技术设备，公司先后承揽了北京市多项消防工程、检测，并均受到工程项目各方的好评。为了保证检测工程质量公司完善了各项规章制度，制定了适合自己的服务方针、员工行为准则、人员培训制度、设备管理制度，以及检测工作程序、检测报告编审制度、检测档案管理制度，在工作中严格按照各项规章制度执行。\n我公司严格执行国家及北京市相关技术规范，自觉遵守行业自律规则，严格内部管理，努力提高从业人员素质，不断完善质量保证体系，遵循社会效益重于经济效益的原则，秉承“诚信为本、质量第一”的宗旨，以“务实、高效”为企业精神', '116.324956', '39.840896999999998', '116.324956', '39.840896999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4103', '北京双达欣保洁服务有限公司', '242', '周德珍', '63381002', '刘利生', '13681507869', '2009年06月10日', '100万元', '北京市', '北京市', '丰台区', null, '北京市丰台区西马场北里17号楼3层2-302', '北京市', '北京市', '丰台区', '大红门街道', '北京市丰台区西马场北里17号楼3层2-302', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2009年06月10日', '2029年06月09日', '2018/5/11', '2019/5/10', '京消协（2018）证字107号', '91110106690829560Q', '排油烟设施清洗机构', '专业承包；物业管理；城市园林绿化服务；清洁服务；花卉种植；花卉、绿植租摆；销售五金交电、日用品、厨房用具、卫生间用具。(领取本执照后，应到区县住建委（房管局）、市园林绿化局取得行政许可。；企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '企业简介北京双达欣保洁服务有限公司是一家具有独立法人资格的专业保洁公司。具有十几年的工作经验，现承接国务院新闻办公厅、首都宾馆、地坛体育馆、绿地缤纷城、东城区体育局、天坛体育中心、中油瑞飞、金隅物业、史家小学、丽京花园、北京食品药品监督管理局、恒泰证券、银河证券、永泰大厦、欧尚超市等单位的全厨房排油烟设备清洗工作。同时还承接其他宾馆、饭店、大厦、写字楼、商场、机关等企、事业单位的室内外各项保洁服务；清洗石材地面、翻新、结晶、保养打腊；大型厨房油烟罩、油烟管道、油烟净化器及排烟风机的清洗和维修；保洁设备维修及其它高、难、危险性作业等。\n我公司自成立以来，经过多年的实践与经验积累，已经建立了一套比较完善的管理体系和质量监督体系，为企事业单位、办公楼、大厦、饭店、写字楼、商场、超市等提供长期、短期各种清洗、保洁服务，公司的管理人员和专业技术人员具备多年丰富的经验和熟练的职业技能，所有的作业人员都经过岗前培训。使用专业的清洗设备及清洁药剂等，严格按照操作程序及技术规范进行各种清洁、保洁服务。客户至上“以品质谋生存，以信誉图发展”是我公司成功发展的服务宗旨。', '116.379769', '39.843386000000002', '116.379769', '39.843386000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4104', '中翔消防工程有限公司', '241', '姜梅敏', '01063858899', '杜微', '13301152832', '2005年03月07日', '5068万元', '北京市', '北京市', '丰台区', null, '北京市丰台区马家堡角门14号楼商业酒店14层1727', '北京市', '北京市', '海淀区', '八里庄街道', '北京市海淀区西四环北路140号京鼎原商务楼512', '', '建筑防火', '有限责任公司（自然人投资或控股）', '2005年03月07日', '2025年03月06日', '2018/3/9', '2019/3/8', '京消协（2018）证字050号', '911101067719692744', '', '专业承包；工程勘察设计；销售消防器材、建筑材料、五金交电；技术培训、技术服务、技术咨询。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '中翔消防工程有限公司（原北京零和消防安全工程有限公司）是经国家建设部和北京市规委及建委审核、北京市消防局备案的消防工程公司，公司成立于2005年03月07日，注册资金5068万元。 \n公司资质：消防设施工程专业承包壹级、消防设施工程设计专项甲级、建筑装修装饰工程专业承包贰级、建筑装饰工程设计专项乙级、建筑机电安装工程专业承包叁级。公司通过了质量管理体系认证、环境管理体系认证、职业健康安全管理体系认证。公司下属有总工程师、行政部、设计部、工程部、维保部、公维部、运营部等6个一级管理部门和10多个具备丰富管理经验的项目部，全国目前拥有20多个分公司。公司不但拥有多名素质良好的高、中级专业技术工程师和多名一、二级注册建造师，组成了一支高素质、技术过硬、经营和服务管理经验丰富的团队，而且还拥有成熟的先进技术、良好的施工装备、科学人文的管理方法以及优美的办公环境。公司不但可以承担各类消防、机电安装和装饰装修工程设计与施工任务。而且还拥有提供专业消防技术培训、技术服务和技术咨询的实力强、技术精和经验足的管理团队。\n    公司自成立以来，坚持采用科学和人文的管理方法，以人为本，诚信务实，坚持“客户', '116.387147', '39.842599999999997', '116.27582700000001', '39.936943999999997', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4105', '北京泽惠风消防技术有限公司', '239', '王文涛', '13901222517', '王小醒', '13911136208', '2005年01月28日', '1000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区西四环南路46号A座2801', '北京市', '北京市', '丰台区', '卢沟桥地区办事处', '北京市丰台区西四环南路46号A座2801', '', '建筑防火,消防设施,宣传教育培训,消防信息化,消防产品,事故调查,电气防火,法规政策,消防安全检查,消防安全评估', '有限责任公司（自然人投资或控股）', '2005年01月28日', '长期', '2018/11/9', '2019/11/8', '京消协（2018）证字355号', '911101067715748628', '', '技术开发、技术咨询、技术服务、技术检测；消防设施维护保养检测、消防安全评估、电气防火检测、消防安全监测、消防安全检查、消防安全管理、消防技术咨询、物联网技术服务、销售日用品。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动。）', '北京泽惠风消防技术有限公司 成立于2005年，中国消防协会单位会员，北京消防协会单位会员，消防技术服务机构一级资质，电气防火检测资信证书企业，并取得计量认证证书（CMA）和质量管理体系认证证书（GB/T I9001-2016 / ISO 9001:2015标准）。\n泽惠风团队为客户提供全过程消防技术服务，包括设计、审图、施工、检测、维保、评估、咨询、培训等，采用“智慧消防”技术手段帮助客户实现现代科技与消防安全管理工作的深度融合，推动单位全面落实自身消防安全职责，采取有效措施消除火灾隐患、降低火灾风险，推进单位的消防安全管理工作向科技化、信息化、智能化发展，全面提升单位火灾防控能力和水平。', '116.28232800000001', '39.869866999999999', '116.28232800000001', '39.869866999999999', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4106', '北京京盾消防设备工程有限公司', '235', '檀国敏', '13718850191', '高淑英', '13911041553', '2001年06月12日', '1330万元', '北京市', '北京市', '丰台区', null, '北京市丰台区花乡黄土岗宜兰园三区32号楼楼底商10号', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区花乡黄土岗宜兰园三区32号楼楼底商10号', '', '建筑防火,消防设施', '有限责任公司（自然人投资或控股）', '2001年09月28日', '2024年09月07日', '', '', '', '911101068022249975', '', '气体灭火设备组装生产；消防栓箱体制造（需消防部门审批的除外）；金属结构制造；制造加工空气呼吸器；销售、修理消防产品；火灾探测器清洗；消防设备安装、维修；销售涂料、仪器仪表、机械设备、交通设施、汽车（不含九座以下）、汽车配件；专业承包；消防设施检测；服装加工。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京盾消防设备工程有限公司是公安部消防局批准的专业从事消防产品设计开发、生产、销售的综合性企业。公司主要销售呼吸防护系列、抢险救援系列、个人装备系列、各种灭火器材及消防器材和设施的维保、检修。本公司创建于1996年，至今已有19年的发展历史，位于首都北京，地理位置优越，交通十分便利。通过ISO9001：2000全面质量管理体系认证，具有完善的质量保证体系，是全国消防重点骨干企业、北京消防协会会员单位；具有消防设施检测资质和消防工程安装资质。现有职工27人，其中各类工程技术人员15人。公司秉承“顾客至上，锐意进取”的经营理念，坚持“客户第一”的原则为广大客户提供优质的服务。', '116.334368', '39.827024000000002', '116.334368', '39.827024000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4107', '北京京安宏业消防安全检测中心', '234', '庞艳霞', '13439996336', '李建新', '13601124407', '2003年03月05日', '500万元', '北京市', '北京市', '海淀区', null, '北京市海淀区西杉创意园二区13号楼1至2层01', '北京市', '北京市', '海淀区', '四季青地区办事处', '北京市海淀区西杉创意园二区13号楼1至2层01', '', '电气防火', '集体所有制（股份合作）', '2003年03月05日', '2033年03月04日', '2018/4/25', '2019/4/24', '京消协（2018）证字090号', '91110108747510201D', '电气防火检测技术服务机构', '消防设施检测、电气检测；技术服务。（依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动）（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京安宏业消防安全检测中心（以下简称“公司”）成立于2003年3月5日, 是依法在北京市工商局注册的具有独立法人地位的公司，是经北京市消防局核准备案的具备消防检测一级资质的检测机构（临时一级），是北京市消防协会会员单位，是通过北京市质量技术监督局认可的检测机构（于2014年11月通过CMA认证），并依据ISO9001建立了质量管理体系认证。\n公司经北京市消防局和消防协会的严格考核和认监委的认证，具备消防设施和电气防火领域的专业检测资质，是开展建筑消防设施及电气防火检测技术服务的消防检测单位。公司技术力量雄厚，检测设备先进，能够严格按照国家、行业和北京市相关技术标准开展建筑消防设施及电气防火检测工作，能够提供公正、科学、详尽和真实的检测报告。\n公司现有员工24人，其中工程师11人，从事检测工作的检测人员11人，均经培训考核合格，持证上岗。\n公司的主要业务是建筑消防设施检测和电气防火安全检测。\n公司基本信息：\n公司名称：北京京安宏业消防安全检测中心\n办公地址：北京市海淀区杏石口路65号中间建筑二区1301   \n联系电话及传真：010-627205', '116.25112', '39.953249', '116.25112', '39.953249', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4108', '北京顺和安消防安全检测有限公司', '233', '谢长海', '13901371773', '郭秋菊', '13681366686', '2003年11月05日', '1000万元', '北京市', '北京市', '怀柔区', null, '北京市怀柔区迎宾中路乙10号二层', '北京市', '北京市', '怀柔区', '怀柔地区办事处', '北京市怀柔区迎宾中路乙10号二层', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2003年11月05日', '2023年11月05日', '2018/12/28', '2019/12/27', '京消协电字（2018）102号', '91110116756027270D', '电气防火检测技术服务机构', '消防安全检测；消防设施维修、维护、保养；消防技术咨询（不含中介服务）、培训；销售消防器材、五金交电。（涉及专项审批的项目除外。企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京顺和安消防安全检测有限公司是北京市消防局核准备案的消防专业公司，属北京市消防协会会员单位。公司于2003年11月5日成立，主要承揽电气防火检测、建筑消防设施检测和消防设施维护保养工作，具备北京市质量技术监督局颁发的CMA计量认证证书，消防协会颁发的电气防火检测技术服务机构资质证书、消防局认定的消防技术服务机构临一级资质证书。公司严格执行国家相关的法规和检测规范，坚持“高品质的追求、全方位的服务、积极奉行、诚信可靠、开拓进取、高质高效”的工作原则，以求真务实的科学精神、勇于开拓的创业精神、团结协作的团队精神打造自己的优质服务，争创一流的宗旨，竭诚为广大客户服务。', '116.638554', '40.3095', '116.638554', '40.3095', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4109', '北京聚元隆安全技术有限公司', '232', '陆天华', '13381025655', '梁庆新', '13521590877', '2005年12月26日', '500万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山北庄路甲1号院内', '北京市', '北京市', '房山区', '向阳街道', '燕山迎风2里2巷3号院', '', '消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2005年12月26日', '2025年12月26日', '2019/1/17', '2020/1/16', '京消协（2019）证字037号', '91110304783973254A', '电气防火检测技术服务机构', '建筑消防设备检测、维修、保养、技术服务；电气防火检测技术服务；技术开发；销售机械设备、通讯设备、仪器仪表、橡胶制品、文化用品、日用品、服装鞋帽、针纺织品、眼镜；维修、租赁机械设备；企业管理技术培训；经济信息咨询；工程技术咨询服务；消防安全技术咨询、培训。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京聚元隆安全技术有限公司成立于2005年，是专门从事建筑消防设施检测和维护保养、电气防火检测和维护保养、安全培训和安全咨询等相关安全技术服务的专业公司。具有北京市相关机关认定并核发的《消防技术服务机构一级资质证书》及《电气防火检测技术服务机构资信证书》，系北京消防协会会员单位。\n我公司已经取得ISO9001：2008质量管理体系、ISO14001：2004环境管理体系、GB/T28001-2011职业健康安全管理体系认证、中国石化工程建设市场资源库B级施工成员单位证书及燕山石化公司承包商安全资格认可证，并荣获北京消防协会颁发的2011年度建筑消防设施、电气防火安全检测双优单位证书。', '115.983171', '39.721215000000001', '115.95290799999999', '39.729913000000003', '注册地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4110', '北京煊煊佳业保洁服务有限公司', '231', '张卫星', '13693631283', '张卫星', '13693631283', '2018年02月28日', '200万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山凤凰亭北里1号楼3-0164', '北京市', '北京市', '房山区', '向阳街道', '北京市房山区燕山凤凰亭北里1号楼3-0164', '', '', '有限责任公司（自然人独资）', '2018年02月28日', '2048年02月27日', '2019/3/14', '2020/3/13', '京消协（2019）证字104号', '91110304MA01AHW88M', '', '技术开发；软件开发；环境治理咨询；家庭劳务服务；建筑物清洁服务；办公室保洁服务；机械设备专业清洗服务；生活清洗、消毒服务；经济信息咨询；承办展览展示活动；物业管理；计算机系统集成服务；销售厨房用具、家用电器、清洁用品、化工产品（不含危险化学品）、电子产品、机械设备、五金交电（不含电动自行车）、家具、灯具、日用品、工艺品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京煊煊佳业保洁服务有限公司提供建筑物清洁等服务的综合保洁服务提供商。', '115.945753', '39.739679000000002', '115.945753', '39.739679000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4111', '哲翰（北京）科技服务有限公司', '230', '朱坤', '13911043135', '朱坤', '13911043135', '2018年03月23日', '118万元', '北京市', '北京市', '海淀区', null, '北京市海淀区北三环西路甲18号中鼎大厦A座7层723室', '北京市', '北京市', '海淀区', '北太平庄街道', '北京市海淀区北三环西路甲18号中鼎大厦A座7层723室', '', '消防信息化,消防产品', '有限责任公司（自然人投资或控股）', '2018年03月23日', '长期', '', '', '', '91110108MA01B08Q1B', '', '技术服务、技术转让、技术开发、技术咨询、技术推广；销售文化用品、计算机、软件及辅助设备、工艺品、服装、鞋帽；企业管理；设计、制作、代理、发布广告；经济贸易咨询；企业策划；商标转让；商标代理；翻译服务；版权贸易；应用软件服务；软件开发；数据处理（数据处理中的银行卡中心、PUE值在1.5以上的云计算数据中心除外）；产品设计；基础软件服务；工艺美术设计；文艺创作；组织文化艺术交流活动（不含营业性演出）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '哲翰（北京）科技服务有限公司是一家科技型服务企业，致力于开发研究云计算在各行业中的应用。使生活更加智能化，产品广泛适用于网络与物联网。', '116.341149', '39.966861000000002', '116.341149', '39.966861000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4112', '北京京达金鼎消防安全技术有限公司', '229', '孙哲', '13911443873', '郑利俊', '13717792388', '2004年06月07日', '500万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区十八里店乡横街子村209-3号', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '北京市朝阳区十八里店乡横街子村209-3号', '', '建筑防火,消防设施,电气防火,消防安全检查', '有限责任公司（自然人投资或控股）', '2004年06月07日', '2024年06月06日', '2018/12/6', '2019/12/5', '京消协（2018）证字426号', '91110105763539389L', '电气防火检测技术服务机构', '消防技术服务；电气防火检测；建筑消防设施检测（特种设备除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京京达金鼎消防安全技术有限公司成立于2004年06月07日，是经过消防局正式认可的机构，具备消防设施检测和电气防火检测的两项检测资质。公司成立以来，本着对消防事业高度负责的精神，我们坚持“质量第一、诚信至上”的经营方针，把质量和售后服务放在第一位。本公司拥有高素质的消防专业工程师和现场作业队伍，我们凭借着专业的的团队和良好的信誉，努力加强公司内部管理，严格质量监督制度，建立完善用户服务体系。\n       公司配备了先进的检测仪器和专业工具，并拥有由高级工程师和经验丰富的技术人员组成的专业检测队伍，所有员工都通过有关的消防培训和技术考核。做到及时发现问题、消除隐患，保证用户的消防设施能够正常有效的运行，充分发挥报警和灭火的作用。消防检测过程中采用高科技手段和精密测量相结合的方法，为有效预防、避免火灾的发生，消除火灾隐患，提供科学准确的检测报告。', '116.505342', '39.832593000000003', '116.505342', '39.832593000000003', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4113', '北京博峰消防技术有限公司', '228', '李月云', '13910990160', '刘学军', '13911061989', '2013年10月21日', '660.6万元', '北京市', '北京市', '顺义区', null, '北京市顺义区马坡镇毛家营村南大街2号', '北京市', '北京市', '顺义区', '牛栏山地区办事处', '北京市顺义区马坡镇毛家营村南大街2号', 'AA', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2013年10月21日', '2033年10月20日', '2019/10/21', '2020/10/20', '2019-HY-0099', '91110113080495495J', '消防设施                 电气防火', '电气防火技术检测；建筑消防设施技术检测；技术开发、技术咨询、技术服务；消防设备维修；清洁服务；健康咨询、健康管理（须经审批的诊疗活动除外）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京博峰消防技术有限公司，是一家专门从事电气消防检测、消防设施检测、消防设施维护保养、消防远程监控联网为一体的综合性消防科技企业，公司位于北京市顺义区马坡镇毛家营村南大街2号；公司注册资本为人民币660.6万元；总经理李月云为公司法定代表人；公司现有26名从业人员,具有大专以上学历的占86%,同时具有多年的电气及消防设施检测经验；公司组织机构设置齐全，人员及检测仪器设备配置齐备，在检测技术和经营管理方面已具备了坚实的基础。\n     公司以消除社会电气火灾隐患，保证消防设施正常运行，为社会的稳定和谐为己任；奉行科学严谨、实事求是、 服务社会的经营宗旨和 信誉第一、优质服务、敬业严谨、客观公正的质量方针；不断持续改进，以使公司稳定健康发展。', '116.637316', '40.189036000000002', '116.637316', '40.189036000000002', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4114', '北京御宇环保科技有限公司', '226', '陈宇', '18612645582', '陈宇', '18612645582', '2016年07月26日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区南四环西路186号一区1号楼2层1931', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区南四环西路186号一区1号楼2层1931', '', '烟道清洗', '有限责任公司（自然人独资）', '2016年07月26日', '2046年07月25日', '', '', '', '91110106MA007HC67E', '', '技术开发、技术服务、技术转让、技术咨询；销售日用品、办公用品、电子产品、机械设备、计算机及辅助设备；清洁服务；劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京御宇环保科技有限公司从事酒店、食堂、学校、机关单位油烟机、油烟管道清洗清洗，业务涵盖北京、天津、河北等地。\n  几年来我司致力于烟道清洗技术的开发和应用实践，并取得了令人瞩目的骄人成绩。近年随着经营战略的调整和技术扩张，实施战略联盟、优势互补、重组了、市场应用技术培训服务为一体的重型全新御宇烟道防火清洗公司。我公司将人性化的服务模式及专业的清洗技术融为一体，公司拥有一流的管理队伍、高精尖的研发人员、国内最早从事油烟管道清洗行业的专业施工服务队伍、现场模拟演示我公司针对国内部分油烟管道的复杂性，研制出适合任何异形管道的清洗方法，工程已经涵企事业单位、宾馆酒店、大型商场超市、医院、车站、学校等各种使用排油设备的餐厅食堂场所，并得到了客户的一致好评和行业的推公司在完成施工的同时，还为客户提供清洗前后对比照片、清洗证明等服务。我们的服务宗旨是为广大客户提供最优质的产品、最优惠的价格、以及最周到的服务。', '116.29580199999999', '39.827879000000003', '116.29512800000001', '39.827979999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4115', '北京富东宏远消防技术有限公司', '225', '王东', '13301075605', '王海威', '17800819606', '2019年01月22日', '100万元', '北京市', '北京市', '房山区', null, '北京市房山区康泽路3号院12号楼7层2单元706', '北京市', '北京市', '朝阳区', '十八里店地区办事处', '十八里店老君塘综合服务中心对面', '', '烟道清洗', '有限责任公司（自然人独资）', '2019年01月22日', '2049年01月21日', '2019/2/27', '2020/2/26', '京消协（2019）证字063号', '91110111MA01H0L63U', '', '技术推广；厨房设备的清洗服务、害虫的防治服务；销售机械设备、建筑材料、五金交电（不含电动自行车）、化工产品（不含危险化学品及一类易制毒化学品）、金属制品；日用电器修理（不符合家用电子电器维修业服务经营规范不得开展经营活动）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京富东宏远消防技术有限公司，成立于2019年，主要从事专业承包；技术推广；清洁服务；销售机械设备、社会公共安全设备及器材、建筑材料、消防器材等。自成立以来公司一直以优质的产品及完善的售后服务的经营理念，不断地进行创新和突破，建立了严格的质量保证管理体系，制定了规范的安全操作流程，严格执行国家行业的有关标准、规范要求自己，对所有工程精心施工，严守规范；我们成长的过程，就是服务客户并和客户一起不断成功的过程，我们用心、努力做好每一件事，满怀信心迎接每一次挑战。', '116.21404099999999', '39.769855', '116.519093', '39.831462999999999', '经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4116', '北京中消世纪消防安全检测技术服务有限公司', '224', '陈炫炫', '13501010628', '张琪', '15901207967', '2002年07月04日', '500万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区科创十三街31号院15号楼2层201-2', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区科创十三街31号院15号楼2层201-2', 'AA', '消防设施,电气防火', '其他有限责任公司', '2008年11月07日', '2028年11月06日', '2019/12/2', '2021/12/1', '2019-HY-0372        2019-HY-0379', '911101067404084313', '消防设施                 电气防火', '建筑消防设施检测技术推广；技术检测；检测服务；消防设备电气防火安全检测；建筑物烟囱的清洗；技术开发；消防安全技术咨询、培训；劳务分包；销售消防器材、化工产品、电子产品、通讯设备、建筑材料、装饰材料、水处理设备；设备安装、维修。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中消世纪消防安全检测技术服务有限公司成立于2002年，是经北京市消防局、北京市质量技术监督局、北京消防协会审核批准的具有建筑消防设施检测、电气防火检测资质的企业，是北京市消防协会会员单位，通过GB/T19001-2016 / ISO 9001:2015质量管理体系认证。\n       公司领导层具有丰富的管理经验，先进的经营理念，并且具有极强的号召力和凝聚力，为公司制定了长期的发展规划。公司组建初期就完善了各项规章制度，制定了适合自己的服务方针、员工行为准则、人员培训制度、设备管理制度，以及检测工作程序、检测报告编审制度、检测档案管理制度等各项质量保证体系，并在公司发展道路上不断完善各项制度和体系。\n       公司拥有一支专业性强、经验丰富、技术力量雄厚的专业检测团队，全心全意为客户提供优质的消防设施检测服务和电气防火检测服务，并为客户和消防监督机关提供详细、客观、科学、公正、真实的检测报告，通过客户的整改，消除火险隐患，杜绝火灾事故。多年来我们始终坚持以信誉为根本，以技术为依托，以质量为生命，以服务为基础，在与合作单位和施工单位的合作中为公司赢得了良好的声誉。', '116.554542', '39.777447000000002', '116.554542', '39.777447000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4117', '北京市昌平区清大东方消防职业技能培训学校', '223', '程水荣', '', '应卫华', '13910757096', '2007年05月07日', '30万元', '北京市', '北京市', '昌平区', null, '北七家镇宏福创业园17号院', '北京市', '北京市', '昌平区', '北七家镇', '北七家镇宏福创业园17号院', '', '宣传教育培训', '民办非企业单位', '2018年02月08日', '无固定期限', '', '', '', '52110114681200904D', '', '初、中级、高级：消防设施操作员培训', '北京市清大东方消防职业技能培训学校始建于2006年，是我国最早从事消防职业教育的民办学校。学校主校区位于风景秀丽的北京昌平，拥有国内先进规范的培训场所、实操教学设施设备和专业师资队伍。在北京市人力资源和社会保障局组织的民办校分级评估工作中，被评为市级A类职业技能培训学校。建校以来，学校逐步建立健全建筑消防设施实操教室，能够全面展示消防设施的基本原理、使用操作和维护保养，为学生实操学习提供了十分便利的条件，我校教学系统包括灭火部分的消防水系统、气体灭火系统、通风防排烟系统和火灾报警自动报警和联动控制系统，共分为室内消火栓灭火系统、自动喷水灭火系统（含湿式、干式、预作用、雨淋）、泡沫喷淋灭火系统、气体灭火系统、通风防排烟系统、防火门和防火卷帘联动控制系统、火灾自动报警系统、建筑消防设施联动教学系统等。目前已经完成覆盖建筑消防设施各个方面的八套系统，上万件器材装备，能够真实模拟各种消防设施的运行和工作状况。', '116.367064', '40.105486999999997', '116.367064', '40.105486999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4118', '北京美洁佳物业管理有限公司', '222', '李伟', '18610953888', '孙士祥', '13051349808', '2005年04月15日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市西城区北三环裕民中路6号17号楼506室', '北京市', '北京市', '朝阳区', '安贞街道', '北京市西城区北三环裕民中路6号17号楼506室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2005年04月15日', '2025年04月14日', '2018/4/8', '2019/4/7', '京消协（2018）证字1064号', '91110102774068703G', '', '物业管理；劳务派遣；劳务服务；清洁服务；家居装饰；承办展览展示；组织文化艺术交流活动（不含演出）；信息咨询（不含中介服务）；技术服务；保洁方面的技术培训；维修办公设备；销售日用百货、工艺美术品、机械电器设备、办公设备、计算机软硬件及辅助设备；机动车公共停车场服务；中央空调清洗服务；室内空气成份检测；维修空调设备；餐饮管理。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京美洁佳物业管理有限公司成立于2005年4月，注册资本1000万元，三级物业资质，通过了ISO9001质量管理体系、ISO14001环境管理体系、GB/T28001健康安全管理体系资质认证，是一家专业从事医院后勤管理服务、高校后勤管理服务为主的综合性物业管理公司。公司依托深厚的物业管理经验和完备的国际质量管理体系，专注于为各医疗机构、高校提供环境清洁、房屋修缮、绿化养护、辅助医疗、工程运维、秩序维护、消防监控、被服洗涤、医疗垃圾分类、运送服务、餐饮会务、车场运营、电梯运行、食堂烟道清洗等多元化、专业化、酒店式、一站式的综合后勤服务解决方案。 ', '116.38940599999999', '39.971995', '116.38940599999999', '39.971995', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4119', '北京蓝剑天亭科技开发有限责任公司', '221', '曹志勇', '13901076053', '孙亚东', '13522077000', '2003年09月19日', '680万元', '北京市', '北京市', '丰台区', null, '北京市丰台区海鹰路5号', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区海鹰路5号', '', '消防设施', '有限责任公司（自然人投资或控股）', '2003年09月19日', '2023年09月18日', '2019/1/28', '2020/1/27', '京消协（2019）证字049号', '91110106754669413W', '电气防火检测技术服务机构', '技术开发、转让、服务、咨询；技术检测；社会经济咨询；消防设施维修；建筑消防设施检测技术服务；电气防火检测技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京蓝剑天亭科技开发有限责任公司成立于2003年，是一家经过北京市消防协会培训并考核认证合格的消防检测企业。目前从事消防设施检测、电气防火安全检测等服务。我公司自成立以来，已为多家企事业单位提供了各项服务，深受客户的好评。\n公司从事检测工作十几年，拥有经验丰富的技术精英和管理人才，技术精素质好。其中，中、高级工程师专业职称比例占职工总数的30%以上。所有检测人员经北京消防协会的严格专业考核后，从事全市范围的消防设施检测、电气防火安全检测。公司拥有雄厚的技术力量和先进的仪器设备对新旧建筑中存在的消防设施和电气火灾隐患能够准确及时的发现，并提供科学的整改建议，及时消除隐患的发生，为预防和减少火灾事故提供强有力的技术保证。\n公司全体员工团结一致，共同致力于北京消防安全检测工作。精益求精，一丝不苟，实事求是，认真负责是我公司的一贯作风。希望通过我们的努力为您减少安全方面的担忧是我们的最终目的。', '116.28560400000001', '39.828862000000001', '116.28560400000001', '39.828862000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4120', '富锦博（北京）建筑工程有限公司', '220', '马诗峰', '13681767457', '马庆灿', '18811648855', '2017年05月11日', '5000万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区科创五街38号院3号楼12层1205', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区科创五街38号院3号楼12层1205', '', '建筑防火,消防信息化,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2017年05月11日', '2037年05月10日', '2018/3/29', '2019/3/28', '京消协（2018）证字069号', '91110302MA00EH2U85', '', '专业承包、劳务分包；工程造价咨询；销售建筑材料、装饰材料、机械设备、电气设备、金属材料、消防设备、花卉；技术开发、转让、咨询、服务；工程设计。（企业依法自主选择经营项目，开展经营活动；工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '富锦博（北京）建筑工程有限公司成立于2017年，是在北京市工商行政管理局登记注册的企业，注册资本金5000万元人民币；现有北京市建委资质：消防设施工程专业承包贰级、 建筑智能化工程专业承包贰级、装饰装修贰级、机电设备工程专业承包叁级、玻璃幕墙工程专业承包贰级。并取得了ISO-9000质量体系、职业健康安全管理体系和环境管理体系认证证书。\n公司主要从事建筑消防设施施工、安防监控施工、智能化系统集成施工、装饰装修施工、机电设备安装、玻璃幕墙施工、电气火灾监控系统施工、防雷工程；建筑消防设施维护保养、安防监控维护保养、电气火灾监控系统；建筑消防设施检测、电气防火安全检测、防雷设施检测。\n公司拥有一批多年从事消防及弱电安全施工、实践经验丰富的工程技术、管理人员和多支专业施工队伍。 现有人员90% 以上人员具有大专及以上学历，其中国家壹级建造师8名、国家贰级建造师6名，高级工程师6名，中级工程师13名，助理 工程师15名，工程技术人员60多名。\n公司本着“以人为本、客户至上、保证安全、质量第一”为宗旨，以“团结、敬业、创新、求实、”为企业精神，为新老客户提供安全、可靠、优质的服务。', '116.53393699999999', '39.801709000000002', '116.53393699999999', '39.801709000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4121', '北京富锦博消防科技有限公司', '219', '刘海军', '010-67889190', '马李淼', '13717573907', '2009年11月19日', '800万元', '北京市', '北京市', '顺义区', null, '北京市顺义区赵全营镇豹房村北丰路6号', '北京市', '北京市', '顺义区', '赵全营镇', '北京市顺义区赵全营镇豹房村北丰路6号', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2009年11月19日', '2039年11月18日', '2018/12/6', '2019/12/5', '京消协（2018）证字425号', '91110113697727292F', '', '技术开发、技术咨询、技术服务、技术转让；技术检测；企业形象策划；销售建筑材料（不含砂石及砂石制品）、装饰材料、机械设备、电器设备、金属材料、消防设备、通讯设备、五金交电、电子产品；维修消防设备、安全技术防范产品。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京富锦博消防科技有限公司成立于2009年，企业注册资金800万元，现有高级工程师、工程师、专业技术人员及管理人员30人，为使国家、企业、个人火灾损失降至最低水平，做出我们的努力与贡献，故成立本公司。本公司由一批长期从事安全工作的专家及技术人员发起创立的，公司是由北京市工商管理局批准注册，经北京市质量技术监督局、北京市公安消防局资质审批的消防设施检测、电气防火检测及防雷安全检测、维护保养专业性公司，北京市消防协会的会员单位。\n公司基于消防设施检测、电气防火检测及防雷安全检测基础之上的专业化维修保养工作模式，全面、及时、准确地反映消防设施的即时工作状态，及时发现存在隐患的表现形式、危险程度和具体位置，并整治修复，确保消防及防雷系统的正常运行。\n公司拥有一支专业、经验丰富、技术实力雄厚、长期从事消防设计、防雷工程、消防工程、消防维保、技术咨询、消防设施检测、电气防火检测、防雷安全检测的专业团队。\n公司一贯信守“信誉至上、客户为本、严谨认真、竭诚服务”的经营方针。立志为您提供一流的检测质量和一流的服务。', '116.58269799999999', '40.234966', '116.58269799999999', '40.234966', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4122', '北京华安泰达消防科技有限公司', '218', '王杨', '13910773519', '刘荣华', '13910322511', '2003年06月03日', '1180万元', '北京市', '北京市', '丰台区', null, '北京市丰台区大红门南苑路84-5', '北京市', '北京市', '丰台区', '东铁匠营街道', '北京市丰台区大红门南苑路84-5', '', '消防设施,消防产品,电气防火', '有限责任公司（自然人投资或控股）', '2003年06月03日', '2023年06月02日', '2019/1/17', '2020/1/16', '京消协（2019）证字028号', '91110106751344971B', '', '气体灭火系统生产；消防产品的技术开发、技术转让、技术咨询、技术服务；维修消防器材；销售机械设备、消防产品、仪器仪表、建筑材料、装饰材料、电子元器件、电器设备；建筑消防设施检测、电气防火检测、维护、管理。(依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动)', '北京华安泰达消防科技有限公司（以下简称华安泰达），成立于2003年6月，是一家综合性消防服务公司。公司拥有雄厚的技术力量，秉承全新的管理理念，经营项目包括：气体灭火设备生产、安装、维修和保养，建筑消防设施、电气防火安全检测、维保，以及消防器材维修等。公司将企业发展与用户需求紧密结合，不断提升服务质量，努力为顾客提供全方位、全过程服务，为社会消防安全事业做贡献。', '116.40136800000001', '39.855742999999997', '116.40136800000001', '39.855742999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4123', '北京业佳琪科贸有限公司', '217', '刘宝敬', '15612466793', '李广民', '13811386157', '2013年03月22日', '220万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区望京园609号楼11层1202', '北京市', '北京市', '朝阳区', '望京街道', '北京市朝阳区望京园609号楼11层1202', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '2013年03月22日', '2033年03月31日', '2019/3/6', '2020/3/5', '京消协（2019）证字093号', '91110105064913482T', '排油烟设施清洗机构', '技术推广服务；销售厨房用具、电子产品、家用电器、机械设备、服装、日用品；会议服务；经济贸易咨询；清洁服务（不含餐具消毒）；维修家用电器（不符合家用电子电器维修业服务经营规范不得开展经营活动）；人力资源服务。（企业依法自主选择经营项目，开展经营活动；人力资源服务以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京业佳琪科贸有限公司，成立于2013年03月22日，专业从事酒店、食堂、学校、机关单位排油烟管道系统消防清洗。并于2015年正式开始拓展：厨房设备销售、通风系统工程、高低空净化器安装、风机维修保养、中央空调工程、新风工程的设计、安装、维护等业务。\n\n        公司自成立以来先后服务过的知名品牌：赛特购物中心、 国瑞大厦、万达集团、将太无二、东方饺子王 、胡大饭馆 、 味多美 、 巴黎贝甜、中粮集团以及朝阳大悦城等 ， 并2017年成功参与由 《北京市朝阳区环保局》 开展的朝阳区餐饮企业油烟净化器升级改造工程，期间由我公司服务的知名餐饮企业有：吉野家、和合谷、大董烤鸭、肯德基、麦当劳等。\n\n        公司以人性化管理为根本，由专业的财务部、业务部工程部组成的精英团队随时待命为您服务。公司承诺工程部各组长及技术骨干全部经过消防协会专业培训持证上岗，具有多年施工经验。公司具有完善的工作管理制度和安全操作制度，制定了规范的工序操作流程，各项收费公平合理，我们有决心高效、准确、安全的完成客户交给我们的厨房设备和烟道清洗业务，为客户厨房消防把好关！', '116.47650899999999', '39.989728999999997', '116.47650899999999', '39.989728999999997', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4124', '北京朗朗洁美保洁服务有限公司', '216', '孙园园', '13439212827', '梅军满', '13661291679', '2015年03月31日', '50万元', '北京市', '北京市', '丰台区', null, '北京市丰台区造甲街110号', '北京市', '北京市', '丰台区', '新村街道', '北京市丰台区造甲街110号2号平房', '', '烟道清洗', '有限责任公司（自然人独资）', '2015年03月31日', '2035年03月30日', '', '', '', '91110106335547382F', '', '保洁服务；劳务服务；技术推广服务；设计、制作、代理发布广告；企业管理服务；会议服务；清洗服务；杀虫服务；网上销售建筑材料、装饰材料、清洁用品、化工产品（不含危险化学品）、五金交电、日用品。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '北京朗朗洁美保洁服务有限公司从事酒店、餐厅、食堂油烟管道清洗服务，业务涵盖北京、天津、河北等地。\n　　几年来，我司致力于烟道清洗技术的开发和应用实践，并取得了令人瞩目的骄人成绩。2015年随着本公司经营战略的调整和技术扩张，实施战略联盟、优势互补、重组了集连锁加盟、设备销售、市场应用、技术培训服务为一体的重型全新朗朗烟道防火清洗公司。\n　　我公司针对国内部分油烟管道的复杂性，研制出适合任何异形管道的清洗方法，工程已经涵盖企事业单位、宾馆酒店、大型商场超市、医院、车站、学校等各种使用排油设备的餐厅食堂场所，并得到了客户的一致好评和行业的推荐。', '116.29606800000001', '39.843842000000002', '116.29606800000001', '39.843842000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4125', '北京安泰诚信消防器材有限公司', '213', '龚建英', '13801198192', '朱岐', '13671195351', '2002年08月22日', '50万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区向军南里二巷5号', '北京市', '北京市', '朝阳区', '团结湖街道', '北京市朝阳区向军南里二巷5号', '', '消防产品', '有限责任公司（自然人投资或控股）', '2009年02月13日', '2029年02月12日', '2018/3/9', '2019/3/8', '京消协（2018）证字052号', '91110105742304097K', '', '销售、维修：消防器材及设备；销售电子产品，五金交电，防火材料。(企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。)', '本公司主要销售、维修消防器材及设备', '116.459771', '39.922131999999998', '116.459771', '39.922131999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4126', '北京火正消防安全技术研究院有限公司', '212', '侯军峰', '13801107685', '侯军峰', '13801107685', '2016年10月21日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区北苑路40号14号楼三层西侧', '北京市', '北京市', '朝阳区', '来广营地区办事处', '北京市朝阳区北苑路40号14号楼三层西侧', '', '建筑防火,消防信息化,消防产品,灭火救援,法规政策,消防安全评估', '有限责任公司（自然人投资或控股）', '2016年10月21日', '2046年10月20日', '2018/3/29', '2019/3/28', '京消协（2018）证字068号', '91110105MA0091KW', '', '工程和技术研究；消防安全技术开发：技术咨询：技术服务；技术推广；消防设施工程专项设计服务；设计、制作、代理、发布广告；承办展览展示活动；市场调查；组织文化艺术交流活动（不含演出）。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京火正消防安全技术研究院有限公司作为业内一支新兴力量，在解决建筑设计复杂消防问题，提供工程建设消防政策保障方面有着独到的优势和丰富的经验，公司主要专业技术人员均具有深厚的消防行业背景，目前公司拥有消防专业高级工程师4名，一级注册消防工程师9名，防火专业工程师1名，灭火专业工程师1名，安全专业博士1名。针对项目的实际情况，北京火正消防安全技术研究院有限公司能够为该项目在建筑设计中遇到的消防问题和消防政策难题提供有效的解决方案，为该项目通过消防行政部门的审核提供协助。\n北京火正消防安全技术研究院有限公司咨询价值观：\n1、服务需求：一切咨询建议都服务于企业需求\n2、追本溯源：一切咨询建议都应从根本上解决使用功能与消防安全的矛盾问题\n3、技术导向：一切咨询建议都以技术方法的应用为导向\n4、尊重法规：一切咨询建议都应以法律法规和消防技术标准为依据', '116.419044', '40.034669000000001', '116.419044', '40.034669000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4127', '北京安富伟业消防安全检测有限公司', '210', '姜子华', '', '杨建民', '18101203011', '2005年08月12日', '2000万元', '北京市', '北京市', '丰台区', null, '北京市丰台区', '北京市', '北京市', '丰台区', '卢沟桥街道', '北京市丰台区京铁家园1区4号楼2层', 'AA', '消防设施,电气防火', '其他有限责任公司', '2005年08月12日', '2025年08月11日', '2019/11/15', '2020/11/14', '2019-HY-0151', '91110106779541299K', '消防设施、电气防火', '消防技术检测；销售消防器材、机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '　　北京安富伟业消防安全检测有限公司是经北京市工商管理局正式注册成立于2005年，为中国消防协会、北京消防协会、中国安全技术学会单位会员，通过北京市公安部消防局审核批准成立的消防技术服务机构一级资质，通过北京消防协会批准颁发的电气防火检测资信证书企业，并取得北京市质量技术监督局审核批准的检验检测机构资质认定证书（CMA）及79项检验检测能力，取得质量管理体系、环境管理体系、职业健康安全管理体系认证证书审查通过中华人民共和国专利法，授予15项专利权，由国家知识产权局颁发证书，本公司具有独立开展检测工作的资格，具有独立账户，独立对外行文，对外法律责任由北京安富伟业消防安全检测有限公司以独立法人地位承担。\n　　公司主要以消防设施检测、电气防火检测、维修保养消防设施服务为一体的消防实体企业。公司拥有一支专业性强、经验丰富、技术力量雄厚的专业团队，多年来始终坚持以企业宗旨为核心，已为1000多家企事业单位提供优质的服务。未来我们将为您提供更优秀的产品和更专业精湛完善的服务！\n\n　　', '116.28053', '39.894823000000002', '116.28053', '39.894823000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4128', '北京中视华业电视工程有限公司', '209', '芦燕生', '13311012776', '马长青', '13501064709', '1949年12月30日', '460万元', '北京市', '北京市', '朝阳区', null, '北京市东城区禄米仓胡同71号24号楼101', '北京市', '北京市', '朝阳区', '朝外街道', '北京市东城区禄米仓胡同71号24号楼101', '', '消防设施', '有限责任公司（法人独资）', '2009年08月12日', '2059年08月11日', '', '', '', '91110101101300061L', '', '广播电视通讯网络设计；设计、安装有线电视站、共用天线；技术开发、技术咨询、技术转让、技术服务；经济信息咨询（中介服务除外）；办公设备维修；日用电器维修；购销百货、化工（不含危险化学品）、工艺美术品、日用杂品、针纺织品；技术检测。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京中视华业电视工程有限公司成立于1949年，隶属于中国国际电视总公司。\n公司在有线电视宽带设计及施工、智能小区及楼宇系统、综合布线系统、数字监控和报警系统、灯光音响系统、停车场管理系统、会议系统和公共广播系统、卫星电视系统以及消防、电气检测等方面有精湛的专业技术、严格的质量管理制度、良好的资源优势以及较强的综合实力。\n公司秉承“敬业、求实、高效、创新”的企业精神，奉行“以人为本、树立形象、扩大影响、不断进取、回报社会”的经营理念，凭借雄厚的实力，通过现代化的运营机制、高效的管理团队和优秀的施工队伍，在同行业中有着强劲的竞争优势和发展潜力。', '116.42868300000001', '39.917631', '116.42868300000001', '39.917631', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4129', '北京星顺达保洁服务有限公司', '208', '于彦敏', '13901333727', '张爽', '13911683987', '1997年10月23日', '100万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区驼房营南路2号院18号楼4单元101室', '北京市', '北京市', '朝阳区', '东风地区办事处', '北京市朝阳区驼房营南路2号院18号楼4单元101室', '', '烟道清洗', '有限责任公司（自然人投资或控股）', '1997年10月23日', '长期', '2019/1/17', '2020/1/16', '京消协（2019）证字029号', '91110105633662899P', '', '保洁服务；提供劳务服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '企 业 简 介\n\n  北京星顺达保洁服务有限公司是经北京市工商管理局正式注册批准，竭诚致力于清洗保洁的专业性清洗公司。我们面向社会各机关、团体、宾馆、酒店、商场、写字楼、娱乐场所等提供全方位的清洗保洁服务，主要致力于酒店、商场、快餐厅的大型厨房烟道防火清洗等；开展新大楼竣工、装饰后全套清洗保洁；各种石材地板清洗打蜡、翻新、结晶、养护技术；真皮沙发清洗养护；各种地毯的清洗护理；建立了完善的服务体系；积累了丰富的工作经验，并已在北京市场占有一席之地。 \n公司实行总经理负责制，严格管理，力争创新技术，努力发展企业文化。有市场总监率领着独立的团队，并设立网络部、企划公关部、业务部为公司的日益俱增的业绩做坚强的后盾；专人的调度，专业的车队确保客户的准时、准量高效完成。由设备检修组、库管众人组成的后勤部为前线时刻准备着，公司将以北京市区为中心，并继续努力拓展华北市场。\n　　  公司坚持“客户就是上帝，质量就是生命，团结就是力量”的经营理念，携手新老客户为创造“文明北京”、“绿色首都”做出更大的努力！更多的奉献！', '116.50748900000001', '39.959532000000003', '116.50748900000001', '39.959532000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4130', '北京逆火文化传媒有限公司', '206', '王立新', '13701285932', '王梦丽', '18248743126', '2018年01月03日', '300万元', '北京市', '北京市', '丰台区', null, '北京市丰台区丽泽路1号院9号楼201-1号', '北京市', '北京市', '丰台区', '太平桥街道', '北京市丰台区丽泽路1号院9号楼201-1号', '', '宣传教育培训,消防安全评估', '有限责任公司（自然人投资或控股）', '2018年01月03日', '2038年01月02日', '2018/6/27', '2019/6/26', '京消协（2018）证字213号', '91110106MA019NCW8E', '', '技术推广；技术服务；技术开发、技术咨询、技术转让；组织文化艺术交流活动（不含演出）；电脑图文设计；包装装潢设计；企业策划；市场调查；公关关系服务；展厅布置设计；会议服务；承办展览展示；设计、制作、代理、发布广告；摄影服务；礼仪服务；销售日用品、电子产品、礼品、文化用品、办公用品、工艺品、五金交电（不含电动自行车）、体育用品、机械设备、建筑材料。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京逆火文化传媒有限公司成立于2018年1月，是旨在打造专业消防文化、传播消防知识、提高全民消防意识的文化公司。我公司是由在北京消防总队各岗位工作20至30年的骨干精英以及注册消防工程师、消防专业大学生和报刊、报社、电台等资深媒体战略合伙人组成，业务精湛，热爱消防事业，对消防工作充满感情，励志通过我们的努力为消防事业做出贡献。\n我公司创建的目的是通过我们这个中介组织，以购买服务的方式，落实指示要求，专门从事消防宣传工作。一是配合支队打造消防文化，研判消防宣传形式，有针对性的开展消防宣传；二是与支队通力配合，落实好全民消防培训计划任务，要使培训效果达到最好；三是做好支队和媒体之间的桥梁和纽带作用，引导媒体开展形式多样的消防宣传；四是充分发挥消防宣传车的作用，由本公司出人、出设备、出资料，支队派专职司机，开动宣传车，到社区、街道、企业、学校、农村等进行不间断的消防宣传；五是协助乡镇政府开展宣传工作，免费向乡镇政府、社区发送宣传内容，使他们能及时有效的开展消防宣传；六是有针对性的对乡镇专职消防人员和各微型消防站的工作人员进行专业消防知识培训，使他们能够掌握初级的防、灭火知识，能发现一般性的火', '116.341425', '39.869784000000003', '116.341425', '39.869784000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4131', '北京泽仪市政工程有限公司', '204', '张碧华', '18601210166', '张琪', '15901207967', '2008年08月13日', '2000万元', '北京市', '北京市', '大兴区', null, '北京市北京经济技术开发区科创十三街31号院二区15号楼2层201-1', '北京市', '北京市', '大兴区', '北京经济技术开发区', '北京市北京经济技术开发区科创十三街31号院二区15号楼2层201-1', '', '消防设施', '有限责任公司（自然人投资或控股）', '2008年08月13日', '2028年08月12日', '', '', '', '91110106678763941Y', '', '施工总承包、专业承包；建筑消防设施检测技术推广；技术服务；消防安全技术咨询、培训；技术检测；检测服务；设备维修、安装；节能设备技术开发、转让、服务；企业管理；销售消防器材、安防器材、化工产品（不含化学危险品、不含一类易制毒化学品）、电子产品、通讯设备、建筑材料、装饰材料、水处理设备；工程项目咨询；软件开发；工程勘察设计。（企业依法自主选择经营项目，开展经营活动；工程勘察、工程设计以及依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京泽仪市政工程有限公司（以下简称泽仪）创立于2008年，经过持续的产业结构调整和资源优化整合，形成了以市政工程、消防安全工程、机电安装工程、外墙保温工程为核心业务的建筑工程专项工程公司，并以从施工承包为主发展成为具有科研、规划、设计、施工、维护、运营和投融资为一体的全产业链基础设施专业平台，具备了为业主提供一站式综合服务的能力。\n　　目前，泽仪具有市政公用工程施工总承包叁级资质，消防设施工程专业承包壹级资质及工程设计专项甲级资质。公司培养、汇聚了国内一流的工程管理专家和工程设计专家。现已拥有注册一级建造师10人，二级建造师12人，专家顾问团6人，高级工程师8人，中级工程师30人，本科及以上学历人员占员工总数的82%以上。凭借着雄厚的专业施工实力、丰富的施工经验和骄人的施工业绩，征战北京、天津、重庆、海南、成都、珠海、内蒙古等地区，向社会奉献出多项省市级优质工程。近年来，泽仪在不断的深化改革过程中，积极探索多元化、多方位、多模式、多渠道的合作模式，始终坚持以“质量求生存，信誉得市场，管理出效益”为指导思想。', '116.554542', '39.777447000000002', '116.554542', '39.777447000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4132', '北京安宁威尔应急消防安全科技有限公司', '203', '陶铁牛', '13901193615', '许丹', '18211056560', '2013年08月27日', '2000万元', '北京市', '北京市', '海淀区', null, '彩和坊路8号3层301', '北京市', '北京市', '海淀区', '海淀街道', '彩和坊路8号3层301', 'AA', '消防设施,消防信息化,消防产品,电气防火,消防安全评估', '有限责任公司（自然人投资或控股）', '2013年08月27日', '2033年08月26日', '2018/12/13', '2019/12/12', '京消协（2018）证字460号', '9111010807657174XT', '消防设施、消防产品、消防安全评估、消防信息化、电气防火', '技术开发、技术咨询、技术服务、技术推广；技术检测；基础软件服务；应用软件服务；维修机械设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司地址位于北京市海淀区，设有天津分公司。注册资本2000万元。通过了管理三体系认证，获得了CMA证书，是北京第一家全项通过60项检验检测能力认定的检测服务机构。2018年取得了全国范围内的消防技术服务机构正式资质。', '116.308813', '39.981458000000003', '116.308813', '39.981458000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4133', '北京永信安保公共安全技术有限公司', '201', '刘刚', '13311515922', '秦宁宁', '13910723892', '2004年01月19日', '1000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区利泽中2路1号4层3A18', '北京市', '北京市', '朝阳区', '高碑店地区办事处', '北京市朝阳区高碑店文化新大街1718A', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2004年01月19日', '2024年01月18日', '2018/12/6', '2019/12/5', '京消协（2018）证字436号', '91110105758212349K', '', '公共安全技术开发；技术服务；技术检测；经济贸易咨询；工程勘察设计（含室内装饰设计服务）；清洁服务（不含餐具消毒）；家庭服务（不符合家政服务通用要求不得开展经营活动）；销售社会公共安全设备及器材、五金交电、建筑材料。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京永信安保公共安全技术有限公司成立于2004年，是在国家工商行政管理部门注册具有独立法人资格的企业，营业执照注册号：91110105758212349K。公司于2014年取得了北京市质量技术监督局CMA证书，2017年到期后，再一次取得了北京市质量技术监督局CMA证书。公司还取得了消防设备及电气设备一级检测资质，消防设备维修、保养一级资质，成为了中国消防协会和北京市消防协会的会员单位。', '116.47206799999999', '40.013762', '116.5449', '39.896962000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4134', '北京虹仪消防技术服务有限公司', '200', '李铁刚', '13001953456', '文东义', '13521392198', '2008年01月24日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区燕山燕东路动力厂对面', '北京市', '北京市', '房山区', '迎风街道', '北京市房山区燕山燕东路动力厂对面', '', '消防设施,电气防火', '有限责任公司（自然人独资）', '2008年01月24日', '2038年01月23日', '2018/11/9', '2019/11/8', '京消协（2018）证字364号', '91110304671717678Y', '电气防火检测技术服务机构', '施工总承包；专业承包；劳务分包；维修、销售消防器材、消防设备；消防设施系统维护保养；建筑设施消防检测技术服务；电气防火检测技术服务；技术检测（未取得行政许可的项目除外）；清洁服务；销售电子产品、安全防范用品、建筑材料（不从事实体店铺经营）、五金交电（不从事实体店铺经营、不含电动自行车）、保温材料；设计、制作、代理、发布广告；消防安全评估、咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '公司注册资金1000万元，主要从事消防器材的维修与销售、接受建筑消防设施检测和电气防火消防检测，提供消防设施维护保养，消防技术咨询等服务。2010年公司成为北京市消防协会会员单位，2014年11月公司取得消防技术服务临时一级资质证书，建立并取得ISO9001：2008质量管理体系、ISO14001：2004环境管理体系、 GB/T 28001-2011职业健康安全管理体系认证证书。', '115.99138000000001', '39.725189999999998', '115.99138000000001', '39.725189999999998', '注册和经营地址坐标位置不准确', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4135', '北京中安质环技术评价中心有限公司', '198', '任磊', '13910968888', '罗金安', '13264278158', '2002年06月18日', '2000万元', '北京市', '北京市', '朝阳区', null, '北京市朝阳区东三环南路58号富顿中心A座22层', '北京市', '北京市', '朝阳区', '劲松街道', '北京市朝阳区东三环南路58号富顿中心A座22层', '', '消防设施,电气防火,消防安全评估', '其他有限责任公司', '2002年06月18日', '2022年06月17日', '2018/10/19', '2019/10/18', '京消协电字（2018）064号', '911101057400838849', '电气防火检测技术服务机构', '安全评价；建设项目环境影响评价；技术服务、技术咨询、技术转让、技术开发；产品质量检验；消防安全评估；教育咨询。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '本公司现有员工120人，拥有一级注册消防工程师19人。中心专职评价师35人，一级评价师6人，二级评价师18人，三级评价师11人。注安师25人。高级消防员2人，中级消防员8人。高级职称人员25人。其中从事检测人员20人，从事消防评估人员12人。公司主要从事建筑消防设施检测、电气防火检测两大领域的消防技术服务工作。中心拥有用房面积1300余平方米，其中技术检测专业领域工作区域使用面积300余平方米，具备单独的仪器室。中心拥有各种检测试验设备/仪器100多台（件），包括辐射温度计、风速仪、红外热成像仪、超声波检漏仪、照度计、红外点温仪等。设备齐全、先进，状态完好并定期检定，能够满足检测工作的需要。', '116.462163', '39.885122000000003', '116.462163', '39.885122000000003', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4136', '北京海安博大电气消防安全检测有限公司', '196', '魏美玲', '', '敖日塔', '13911111574', '2006年04月11日', '1118万元', '北京市', '北京市', '海淀区', null, '香山门头新村2号南侧三层307室', '北京市', '北京市', '海淀区', '四季青地区办事处', '香山门头新村2号南侧三层307室', '', '消防设施,电气防火', '有限责任公司（自然人投资或控股）', '2006年04月11日', '2026年04月10日', '2018/11/21', '2019/11/20', '京消协（2018）证字378号', '91110108787773022Q', '电气防火检测技术服务机构', '技术检测；技术开发、技术转让、技术咨询、技术服务、技术推广；计算机技术培训；基础软件服务、应用软件服务；计算机系统服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京海安博大电气消防安全检测有限公司是专门从事建筑消防设施技术检测（包括消防系统检测和电气检测）与消防设施维护保养的专业公司；消防设施检测与维保资质为一级资质；是北京市消防协会会员，北京市消防协会电气防火检测分会会长单位。 \n公司现有管理及检测人员28名，其中高级工程师技术职称3名，中级工程师技术职称3人，注册消防工程师10人，高级建（构）筑物消防员4人，中级建（构）筑物消防员14人，检测人员多是常年从事消防、电气检测的行业技术人员，理论实践经验丰富，检测人员均经考试中心培训考核合格后，持证上岗。 \n自公安部颁布《社会消防技术服务管理规定》（公安部令第129号）以来，北京市第一家获得计量认证证书的社会消防技术服务企业\n公司全体员工本着“以社会效益为主”的指导思想，按照公司“科学、公正、廉洁、求实”的八字方针，练就一专多能、客户至上的软、硬本领，投身于我国的消防事业。', '116.235821', '39.975678000000002', '116.235821', '39.975678000000002', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4137', '北京奥得海消防设备有限公司', '195', '邢瑞丰', '13651290335', '邢瑞丰', '13651290335', '2003年04月21日', '360万元', '北京市', '北京市', '石景山区', null, '北京市石景山区西下庄2-2-16', '北京市', '北京市', '石景山区', '苹果园街道', '北京市石景山区西下庄2-2-16', '', '消防产品', '有限责任公司（自然人投资或控股）', '2003年04月21日', '2023年04月20日', '', '', '', '9111010774937088XM', '', '零售消防设备、建筑材料、装饰材料、五金、仪器仪表、化工原料（不含危险化学品，不含一类易制度化学品）、百货、机械、电器设备；修理消防器材。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京奥得海消防设备有限公司秉承人性化服务，视人才、技术为立业之本；视产品质量为生命保障。公司有一整套严格的产品管理体系，可为您提供安全可靠的产品。在建立健全多元化的服务体系中，发挥人才、技术优势，以一流的产品、一流的售后服务，不断提高您的满意度和期望值。\n公司一直以来秉承“诚实、守信、拼搏、创新”的经营理念，本着“质量第一、顾客至上、合作共赢”的服务宗旨，利用科技的管理模式，以严格的质量保障、优质的售后服务，树立企业形象。不断进取，打造更优质的消防产品，缔造新世纪消防行业典范。', '116.19954', '39.945661000000001', '116.19954', '39.945661000000001', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4138', '北京太平机电设备安装有限责任公司', '192', '张海建', '13701170380', '杨培', '18810781703', '1995年01月18日', '2100万元', '北京市', '北京市', '石景山区', null, '北京市石景山区五里坨车站路1号', '北京市', '北京市', '朝阳区', '东风地区办事处', '北京市朝阳区姚家园路105号观湖国际1座1903', '', '消防设施', '其他有限责任公司', '1995年01月18日', '长期', '', '', '', '91110107101227618D', '', '消防器材；机电设备及计算机房设备的安装；家居装饰；装饰设计；消防设施工程专业承包壹级；消防技术服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京太平机电设备安装有限责任公司成立于1995年,多年来一直致力于建筑工程中消防工程的施工、设备安装，调试、维修保养、消防设备销售及消防检测等业务。公司具备独立的法人资格，是建设部认定的具有“消防设施专业承包壹级”资质，可承担各类消防设施工程施工的单位。公司成立至今已经承揽消防工程近百项，均得到了甲方及业主的好评。同时公司具备北京市消防局、消防协会认可的“建筑消防设施检测”及“电气防火检测”资质，可承担各类建筑工程的消防和电气防火检测，消防和电气检测的工程项目已达到三百多项，均达到了北京市消防局的验收标准。公司已通过了GB／T19001-2008-ISO9001：2008质量体系认证、GB/T28001-2001职业健康安全管理体系认证、GB/T24001-2004-ISO14001：2004环境管理体系认证。使得施工质量、施工安全及施工环境达到更高标准，服务水平也大幅度提升。', '116.12610100000001', '39.956448999999999', '116.494315', '39.935094999999997', '', null, null, null, null);
