INSERT INTO `t_fc_company` VALUES ('4140', '北京万家洁新科技有限公司', '165', '尹龙春', '13331090905', '黄剑', '13331090905', '2018年05月09日', '500万元', '北京市', '北京市', '海淀区', null, '海淀南路36号三层0312-A024', '北京市', '北京市', '海淀区', '田村路街道', '玉泉路5号', '', '消防设施,烟道清洗,电气防火', '有限责任公司（自然人投资或控股）', '2018年05月09日', '长期', '2018/10/19', '2019/10/18', '京消协（2018）证字320号', '91110108MA01C1DRXE', '排油烟设施清洗', '技术服务、技术推广、技术开发；应用软件服务；软件开发；公共关系服务。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京万家洁新科技有限公司是一家致力于规范清洁行业的互联网公司，以互联网+为手段，以资源为依托，以政策为导向，扎根服务业，以O2O模式进军油烟机及空调清洁领域，以线上线下同步接单，线上派单，线下服务，线上监管的方式，整合行业上下游资源 ，建立油烟机空调清洁的行业平台，打造产业发展新格局，当前以北京为试点探索新时代下清洁行业的发展之路。 主营业务包括油烟管道清洁、空调运保（运维、清洁、保养）。', '116.302452', '39.974063999999998', '116.247867', '39.923538999999998', '', null, null, null, null);
INSERT INTO `t_fc_company` VALUES ('4141', '北京光尘环保科技股份有限公司', '156', '张玲玲', '13701373100', '孙朝中', '13311127888', '2007年09月05日', '1000万元', '北京市', '北京市', '房山区', null, '北京市房山区良乡凯旋大街建设路18号－E858', '北京市', '北京市', '丰台区', '花乡地区办事处', '北京市丰台区富丰桥外杨柳垂钓园内', '', '烟道清洗', '股份有限公司（非上市、自然人投资或控股）', '2007年09月05日', '长期', '2018/1/3', '2019/1/2', '京消协（2018）证字1001号', '911101086669309843', '', '技术开发、技术服务、技术咨询（中介除外）、技术转让；建筑物清洁服务；清洁服务（不含洗车服务）；维修办公设备、仪器仪表、空调制冷设备；害虫防治服务；灭鼠及预防服务；大气污染治理；城市园林绿化；企业管理咨询（中介除外）；合同能源管理；销售厨房设备、电子产品、家用电器、日用杂品、建筑材料、机械设备、化工产品（不含危险化学品）、金属材料、厨房用具、花卉、苗木；安装厨房设备。（企业依法自主选择经营项目，开展经营活动；依法须经批准的项目，经相关部门批准后依批准的内容开展经营活动；不得从事本市产业政策禁止和限制类项目的经营活动。）', '北京光尘环保科技股份有限公司成立于２００７年９月５日，注册资金1000万元，拥有员工１９７人。“光尘环保”是目前国内最大的排油烟设施清洗企业，也是国内该领域唯一一家上市公司，股票代码“８３９３２２”，企业简称“光尘环保”。\n“光尘环保”拥有国内该行业最大、最稳定的施工队伍。我们一线清洗员工１００人以上，７０％是工作一年以上的老员工，稳定的施工队伍才能有稳定的施工质量。最大的施工队伍可以用最短的时间完成整个清洗工程，还可以把甲方配合管理成本大大降低，而我们行业主流规模是５－８人，我们的施工能力是同行业内没有的。\n“光尘环保”有行业内最完备的保障、考评和管控体系。我公司全员社保，重点工种全部商业再保险。多种保险最大程度减少了由于意外伤害可能转嫁给甲方的损失；我们制定了四等１６级极考评激励体系，最大程度体现员工的能力和价值；对员工管控到位，才能对客户负责到位。我们的激励和管控体系是我们同行业绝无仅有的。\n我们拥有最强的技术实力，为客户提供了最完备的服务综合保障。我们不仅拥有厨房烟道清洗的能力，还拥有厨房从设计、安装到维修维护的全部技术实力；我们自主研发、且拥有自主知识产权的水平管道、竖向烟道', '116.137918', '39.721812999999997', '116.269301', '39.824903999999997', '注册和经营地址坐标位置不准确', null, null, null, null);
